{"department_text": "Envelopes | Labels | Mailing", "level": 1, "url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "text": "Envelopes | Labels | Mailing", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Envelopes | Labels | Mailing", "keyword_count": {"envelopes labels": 1, "labels": 3, "mailing": 2, "envelopes": 2}, "description_wc": 119, "description_text": "We know it can take forever to find exactly the kinds of sized envelopes and labels you need for your office. Rest assured that you can find what you need on Staples.com. Whether you simply need to restock your basic mailroom supplies, or are after something more specific, such as return address labels, we\u2019ve got all the office supplies you need at great prices. From tape for packaging and shipping, mailers and tubes, label makers, shipping and mailing supplies to all the tags you need for easy and convenient organization, you will find everything you need right here. Browse our expanded assortment today and stock up on all the envelopes, labels and mailing products you need every day.", "keyword_density": {"mailing": "1.7", "labels": "2.5", "envelopes labels": "1.7", "envelopes": "1.7"}, "department_id": 8}
{"department_text": "TV | Home Entertainment", "level": 1, "url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "text": "TV | Home Entertainment", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "TV | Home Entertainment", "keyword_count": {"tv": 7, "home entertainment": 2, "home": 4, "entertainment": 3}, "description_wc": 207, "description_text": "TV and home entertainment systems give you the opportunity to provide some relaxation in the company break room or a welcome distraction for customers in your waiting area. This keeps employee productivity and client satisfaction going strong. Whether you just want a simple LCD TV, gaming consoles, the latest in Beats By Dre headphones or a selection of popular movies and TV shows on DVD and Blu-ray, our catalog provides for all of your entertainment needs. TVs and Home Theaters Today's televisions come in a wide range of resolutions, screen sizes, and price points. Choose from LCD, LED, Plasma and 3-D sets, depending on your preferences and budget. Movies, TV Shows, and Games TV and home entertainment systems are only as good as the shows you're watching. From documentaries and children's movies to instructional DVDs and full sitcom seasons, our catalog of movies, games, and shows lets you provide your audience with a range of classics and new releases. Audio If the built-in speakers on your TV aren't cutting it, check out our Bluetooth and home audio speakers to provide surround sound. If you need to block out the office chatter, ear buds and noise-canceling headphones are also available.", "keyword_density": {"tv": "3.4", "home entertainment": "1.9", "entertainment": "1.4", "home": "1.9"}, "department_id": 13}
{"department_text": "PCs | Drives | Accessories", "level": 1, "url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "text": "PCs | Drives | Accessories", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "PCs | Drives | Accessories", "keyword_count": {"drives": 1, "accessories": 1}, "description_wc": 107, "description_text": "In today\u2019s fast paced world, you want the best technology to help you keep up. We offer the top names in laptops , computers, computer software, phones and tablets. Our external hard drives provide plenty of extra storage and our wide selection of mice, keyboards and webcams will make great accessories. We carry the most eco-friendly and fast printers and copiers for all of your printing needs. Need to use your device on the go? From alkaline batteries to rechargeable, you\u2019ll always be powered up. If it\u2019s high quality and relates to technology, we\u2019ve got all of your technology at reasonable prices.", "keyword_density": {"drives": "0.9", "accessories": "0.9"}, "department_id": 9}
