{"department_text": "Software | Cloud Software | Tech Support", "level": 1, "url": "http://www.staples.com/Software-Cloud-Software/cat_SC1941", "text": "Software | Cloud Software | Tech Support", "department_url": "http://www.staples.com/Software-Cloud-Software/cat_SC1941", "description_title": "Software | Cloud Software | Tech Support", "keyword_count": {"tech support": 2, "support": 3, "software cloud software": 2, "software": 7}, "description_wc": 183, "description_text": "Software, cloud software, and tech support programs help you keep office efficiency and productivity high. Whether you need a basic word processing program or the all-inclusive Office Professional software, these programs keep your business dealings organized. Anti-virus and Internet security offerings make sure your information is protected, so you can work without worry. Budgeting Budgeting and payroll support software is an integral part of any business. Choose from programs from Quicken and QuickBooks, from basic to deluxe and professional editions, to keep track of your profits and expenses. Word Processing and Data Entry Microsoft Office offers a variety of programs, including Word, Excel, OneNote, Publisher, PowerPoint, Outlook, and Access, to keep your business communications running smoothly. Choose from keycards that include access for one, two, or up to five different devices. Computer Security The category of software, cloud software, and tech support programs also includes anti-virus and security programs from trusted names like Norton and Kaspersky. Whether you have a PC or a Mac, these software programs help keep your documents and Internet files secure from viruses and other threats.", "keyword_density": {"tech support": "2.2", "support": "1.6", "software cloud software": "3.3", "software": "3.8"}, "department_id": 10}
{"department_text": "Printers | Shredders | Machines", "level": 1, "url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "text": "Printers | Shredders | Machines", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "Printers | Shredders | Machines", "keyword_count": {"shredders": 3, "printers shredders": 1, "machines": 3, "printers": 2}, "description_wc": 177, "description_text": "Today's printers, shredders, and machines help you tackle piles of paperwork quickly. Laminators protect frequently used documents from liquid spills and dirt smudges, while binding machines can help you create a polished and professional employee manual without needing to go outside the office. Create Custom Materials Every office needs printers , shredders, and machines designed to make basic office tasks quicker. Design your own marketing fliers and then use lightning-fast copiers to make bulk mailings fast and easy. Conquer Clutter Keep your office space and supply closet organized and make sure everyone knows what goes where by using label makers to mark shelf space or note the contents of a box. Scanners and accessories can also help you turn piles of paper into digital files. Shredders built to handle high volumes ensure your company's confidential papers are properly disposed of. Make Presentations Perfect Professional equipment and high-quality sound are vital to an effective presentation or meeting. Large high-contrast screens and reliable microphones ensure your audience can see and hear every important detail.", "keyword_density": {"printers": "1.1", "printers shredders": "1.1", "machines": "1.7", "shredders": "1.7"}, "department_id": 11}
{"department_text": "Filing | Binders | Organizers", "level": 1, "url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "text": "Filing | Binders | Organizers", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "Filing | Binders | Organizers", "keyword_count": {"binders": 1, "filing": 2}, "description_wc": 108, "description_text": "Is your desk piled high with documents? Get sorted fast with our wide range of\u00a0organizational and filing products\u00a0and the best office supplies you'll find anywhere. Tidy your office or home into a model of organization with colorful and manila file folders . Shop our wide selection of top tab, classification and hanging file folders and insure you never lose a thing. Choose one of our binders with sturdy rings to store all of your projects, whether big or small. Use tabs to create a filing system and expanded files that grow along with your needs, or order your index cards with an index card filer.", "keyword_density": {"binders": "0.9", "filing": "1.9"}, "department_id": 6}
{"department_text": "Paper | Notebooks | Post-it &reg", "level": 1, "url": "http://www.staples.com/Paper-Notebooks-Post-it/cat_SC1676", "text": "Paper | Notebooks | Post-it &reg", "department_url": "http://www.staples.com/Paper-Notebooks-Post-it/cat_SC1676", "description_title": "Paper | Notebooks | Post-it &reg", "keyword_count": {"post": 1, "paper": 11}, "description_wc": 99, "description_text": "From Post-its to graph paper, we\u2019ve got your paper needs covered. Find that stylish notebook you can carry with you wherever you go. Give that report that extra gloss with photo paper. Many eco-friendly office supplies and paper types are available, and at prices you\u2019ll love. You\u2019ll find paper products of all shapes, sizes and colors, from copy and printer paper to laser paper, photo paper, and filler paper. Don\u2019t know which one to choose? Let our Paper Buying Guide help you decide which types of paper are best for you and why.", "keyword_density": {"post": "1.0", "paper": "11.1"}, "department_id": 5}
{"department_text": "Pens | Tape | Desk Supplies", "level": 1, "url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "text": "Pens | Tape | Desk Supplies", "department_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "description_title": "Pens | Tape | Desk Supplies", "keyword_count": {"desk supplies": 1, "pens": 1}, "description_wc": 74, "description_text": "With our wide range of desk supplies, you will always have what you need. Choose from rollerball, gel-ink, ballpoint, felt and a variety of other pens to find the right fit, grip, and tip for you. Find the perfect dry erase marker for your white board brainstorming sessions and write great notes with any one of our mechanical or wood pencils. Or make your key calculations with a cutting edge scientific calculator .", "keyword_density": {"desk supplies": "2.7", "pens": "1.4"}, "department_id": 7}
