{"department_text": "TV | Home Entertainment", "level": 0, "url": "http://www.staples.com/Gaming/cat_CG1403", "text": "Gaming", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Gaming", "parent_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "keyword_count": {"gaming": 5}, "description_wc": 198, "description_text": "The gaming industry changes constantly, with updated consoles and brand new releases of your favorite games. Stay on top of the trends and technology with the latest in accessories and gaming equipment. Browse our selection of games for the XBOX 360, Wii, PlayStation, and Nintendo DS systems to find your next favorite. Cutting-Edge Technology The newest consoles offer breakthrough technology, from 3-D graphics and built-in Wi-Fi to real-motion controls and large capacity hard drives. Some systems even do double duty, letting your play DVDs and Blu-rays or take pictures and browse the Internet. Portable Entertainment Take your favorite games wherever you go with portable gaming systems like the Nintendo 3DS and the PlayStation Vita. Protect your consoles from scratches and dings by storing them in protective cases when not in use. All the Accessories Whether you want to keep extra styluses on hand or need a new pair of 3-D glasses, we have all the accessories you need to get the most out of your gaming experience. When you're not playing, keep all of your electronics organized and protected when you store them in specially designed gaming towers or hubs.", "parent_text": "TV | Home Entertainment", "keyword_density": {"gaming": "2.5"}, "department_id": 13}
