{"department_text": "PCs | Drives | Accessories", "level": 0, "url": "http://www.staples.com/Flash-Memory-Cards-Readers/cat_CG1125", "text": "Flash Memory Cards & Readers", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Flash Memory Cards & Readers", "parent_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "keyword_count": {"readers": 3, "flash": 15, "flash memory": 14, "memory": 15, "cards": 16, "flash memory cards": 13}, "description_wc": 161, "description_text": "Having the right flash memory cards and readers for your cameras, mobile phones and other digital devices is a necessity, not a luxury. Shop our wide selection of flash memory cards and readers to find a flexible, reliable solution that works for you. Flash Memory Cards \u2013 Today's cameras, tablets, smart phones and camcorders require the latest generation of flash memory cards. Staples carries the form factors you need for any device, including SD cards, Micro SD cards, Compact Flash cards and Memory Stick. Flash Memory Card Readers & Adapters - Quickly and conveniently access your data on your flash memory cards. Find the flash memory cards you need from brands you trust. Staples offers flash memory cards from SanDisk, PNY, Kingston, Lexar, Transcend and Verbatim. SanDisk flash memory cards , PNY flash memory cards , Kingston flash memory cards , Lexar flash memory cards , Transcend flash memory cards and Verbatim flash memory cards are quality tested for reliable and optimal performance.", "parent_text": "PCs | Drives | Accessories", "keyword_density": {"readers": "1.9", "flash": "9.6", "flash memory": "17.8", "memory": "9.6", "cards": "10.2", "flash memory cards": "24.8"}, "department_id": 9}
