{"department_text": "PCs | Drives | Accessories", "level": 0, "url": "http://www.staples.com/Monitors-Digital-Projectors/cat_CG4", "text": "Computer Monitors / Screen Filters", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Computer Monitors / Screen Filters", "parent_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "keyword_count": {"screen": 3, "computer": 1, "monitors": 1}, "description_wc": 70, "description_text": "In today's fast paced world, you want the best technology to help you keep up. We offer the top names in monitors, touchscreens, TV's and accessories. Our monitor/TV assortment will help you with any decision whether you are looking to play games, watch movies or just work on excel spreadsheets. Guard your computer screen against nicks, stains and radiation with a screen protector from 3M or Fellowes.", "parent_text": "PCs | Drives | Accessories", "keyword_density": {"screen": "4.3", "computer": "1.4", "monitors": "1.4"}, "department_id": 9}
