{"department_text": "PCs | Drives | Accessories", "level": 0, "url": "http://www.staples.com/Networking-Cables/cat_CG58", "text": "Networking", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Networking", "parent_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "keyword_count": {"networking": 4}, "description_wc": 93, "description_text": "Set up your home or office with an efficient high-speed network with computer networking brands like Netgear, Linksys, D-Link and Western Digital. Staples has a large selection of networking products for both small and large networks. Wireless networking : Connect to the internet with convenience and flexibility with wireless networking solutions like routers, modems, and range extenders. Connect multiple devices : Connect to the internet on virtually any device with multiple wire ports and wireless internet. Stay protected with firewalls : Keep your business or home protected with secure firewalls and anti-virus software.", "parent_text": "PCs | Drives | Accessories", "keyword_density": {"networking": "4.3"}, "department_id": 9}
