{"department_text": "PCs | Drives | Accessories", "level": 0, "url": "http://www.staples.com/Mice-Keyboards-Speakers/cat_CG18", "text": "Mice / Keyboards / Speakers", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Mice / Keyboards / Speakers", "parent_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "keyword_count": {"speakers": 3, "mice": 4, "keyboards": 1}, "description_wc": 184, "description_text": "Computer mice and other accessories like keyboards and computer speakers are the key to maximum productivity. These accessories are touched more often than the computer itself. 1. On the go or at the desk: We carry corded, cordless and mobile computer mice to match every preference. 2. Keyboard and Computer Mouse Bundles: Consider a bundle like the Logitech Wireless Combo, which allows you to use one receiver for both the mouse and keyboard. 3. Ergonomic design: Get the best computer mouse and keyboard for your body. Search our variety of ergonomic and natural shape options. 4. Mac and PC-compatible: No matter what your platform, we have a computer mouse, webcam, keyboard and set of speakers that will work with your devices. 5. The most trusted brands: From Logitech to Microsoft, we carry the names you trust. Staples has you covered, no matter what you\u2019re looking for in computer mice or peripherals. Our computer mice are perfect for any laptop , and if you are in the market for computing accessories, considering pairing your mouse with a new set of computer speakers .", "parent_text": "PCs | Drives | Accessories", "keyword_density": {"speakers": "1.6", "mice": "2.2", "keyboards": "0.5"}, "department_id": 9}
{"department_text": "Accounting | Forms | Security", "level": 0, "url": "http://www.staples.com/Store-Fixtures-Signage-Display/cat_CG2898", "text": "Store Fixtures / Signage / Display", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Store Fixtures / Signage / Display", "parent_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "keyword_count": {"store fixtures signage": 1, "display": 1}, "description_wc": 43, "description_text": "Selecting the correct store fixtures, signage and displays for your business can often be an intimidating task. At Staples we strive to make that decision process an effortless event that allows you to spend more time on your day to day business tasks.", "parent_text": "Accounting | Forms | Security", "keyword_density": {"store fixtures signage": "7.0", "display": "2.3"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "level": 0, "url": "http://www.staples.com/Store-Retail-Security-Operations/cat_CG2902", "text": "Store / Retail Security & Operations", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Store / Retail Security & Operations", "parent_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "keyword_count": {"security": 6, "store": 1, "retail security": 2}, "description_wc": 101, "description_text": "Retail security is crucial to the health of your business. Keeping your business safe, both inside and outside, shouldn\u2019t be a hassle or expensive. With the most current products and best in class indoor and outdoor retail security brands, Staples can offer your store the security and level of protection it needs. The wide array of building and item level security will allow you to select what\u2019s right for the type and size of your business. Choose from traditional convex mirrors, motion detectors and faux security cameras all the way up to multi-camera indoor and out security systems.", "parent_text": "Accounting | Forms | Security", "keyword_density": {"security": "5.9", "retail security": "4.0", "store": "1.0"}, "department_id": 25}
{"department_text": "PCs | Drives | Accessories", "nr_products": 442, "level": 0, "url": "http://www.staples.com/USB-Flash-Drives/cat_CL142211", "text": "USB Flash Drives", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "USB Flash Drives", "parent_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "keyword_count": {"usb flash": 3, "flash": 4, "drives": 4, "flash drives": 2, "usb flash drives": 1, "usb": 4}, "description_wc": 172, "description_text": "Staples carries USB flash drives that will meet your unique needs and provide solutions that deliver performance and security. One of the fastest ways to transfer data today, a USB flash drive dramatically reduces data transfer times and makes the transfer process easy. They are ultra small, easily fitting in the palm of your hand or in nearly any pocket, so you can take a lot of data with you without taking up a lot of space. They're perfect for tech gurus as well as anyone frequently on the go. Staples also carries software, hardware and AES encrypted USB drives, ensuring piece of mind in cases of lost or stolen data. Find the USB flash drive you need from brands you trust. Staples offers flash drives from SanDisk, PNY, Kingston, Lexar, HP and Verbatim. These drives are quality tested for reliable and optimal performance and are available in a wide array of size and storage options, ensuring that you find the perfect one for your laptop or touch screen laptop .", "parent_text": "PCs | Drives | Accessories", "keyword_density": {"usb flash": "3.5", "flash": "2.3", "flash drives": "2.3", "drives": "2.3", "usb flash drives": "1.8", "usb": "2.3"}, "department_id": 9}
