{"department_text": "PCs | Drives | Accessories", "nr_products": 43, "level": -1, "url": "http://www.staples.com/USB-CD-DVD-Blu-Ray-Duplicators/cat_CL163235", "text": "USB / CD / DVD / Blu-Ray Duplicators", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "USB / CD / DVD / Blu-Ray Duplicators", "parent_url": "http://www.staples.com/CD-DVD-Blu-Ray-Burners-Media/cat_CG1039", "keyword_count": {"dvd": 10, "duplicators": 2, "cd dvd": 1, "cd": 15}, "description_wc": 177, "description_text": "Making copies of your music, photos and movies has never been easier. With our fast, high-quality CD and DVD duplicators you\u2019ll spend more time enjoying those files than waiting for them to copy. Visit our research center for more tips on how to choose the right DVD burner or CD burner for you. Here\u2019s a little more information about what we have in stock: Copy at lightening speed: DVDs at up to 18X or CDs at up to 48X CD/DVD duplicators can work alone or can interface with your Mac or PC Duplicate 1 to 7 CDs or DVDs at once Good for data backup Support most popular formats and media, including DVD-R/RW, DVD+R/W, Dual Layer (DL), CD-R/RW, VD-ROM, DVD Video, CD-ROM Mode 1 & 2 CD-DA, CD-ROM/XA Video CD, Game CD Mix Mode, Multisession, HFS CD Bridge, Photo CD, CD Extra Stop struggling with slow and outdated CD duplication and DVD duplication technology. Find a DVD duplicator that works for you.", "parent_text": "CD / DVD / Blu-Ray Burners & Media", "keyword_density": {"dvd": "5.7", "duplicators": "1.1", "cd dvd": "1.1", "cd": "8.5"}, "department_id": 9}
