{"department_text": "PCs | Drives | Accessories", "nr_products": 76, "level": -1, "url": "http://www.staples.com/Flash-Memory-Adapters-Readers/cat_CL141727", "text": "Flash Memory Card Readers & Adapters", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Flash Memory Card Readers & Adapters", "parent_url": "http://www.staples.com/Flash-Memory-Cards-Readers/cat_CG1125", "keyword_count": {"memory card readers": 5, "flash memory card readers adapters": 2, "flash memory card": 3, "memory card": 6, "memory": 7, "card readers": 8, "card": 9}, "description_wc": 156, "description_text": "With our wide range of flash memory card readers & adapters, get the fastest data transfer and backup for all of your mobile devices, no matter where you are. We carry flash memory card readers & adapters\u00a0in a variety of formats so you\u2019ll be sure to find the right one for you. 1. Capture, load and transfer: With our high capacity SD memory card readers, microSD memory card readers, USB card readers and media card readers, capture, load and quickly transfer high quality media files on your smartphone or tablet. 2. Widely compatible: Our media card readers are compatible with a range of memory and media formats, so your data is always accessible. 3. For the mobile professional: Memory card readers from Vivitar, Sony, Staples, SanDisk and Kodak are compact and lightweight, making them the ideal solution for on the go professionals. Browse our selection today for a flash memory card reader that suits your needs.", "parent_text": "Flash Memory Cards & Readers", "keyword_density": {"card readers": "10.3", "flash memory card readers adapters": "6.4", "flash memory card": "5.8", "memory card": "7.7", "memory": "4.5", "memory card readers": "9.6", "card": "5.8"}, "department_id": 9}
