{"department_text": "PCs | Drives | Accessories", "nr_products": 167, "level": -1, "url": "http://www.staples.com/Firewalls/cat_CL166252", "text": "Firewalls", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Firewalls", "parent_url": "http://www.staples.com/Networking-Cables/cat_CG58", "keyword_count": {}, "description_wc": 61, "description_text": "Protect your business\u2019s network security with firewall software, hardware, and intrusion prevention. Staples offers robust security solutions with brands like Netgear, Sonicwall, and 321 Studios. Comprehensive Security : Firewall packages come with anti-spam, anti-virus, anti-spyware, and more. All in one : The all in one network protection services combine gateway security, content filtering, firmware updates, and 24/7 support.", "parent_text": "Networking", "keyword_density": {}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 326, "level": -1, "url": "http://www.staples.com/TV-Mounts/cat_CL142753", "text": "TV Mounts", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "TV Mounts", "parent_url": "http://www.staples.com/Monitors-Digital-Projectors/cat_CG4", "keyword_count": {"tv": 6, "mounts": 5, "tv mounts": 4}, "description_wc": 186, "description_text": "TV mounts enhance your viewing options, allowing you to hang or mobilize displays for easier adjustment. Find kits for attaching your monitors to a range of surfaces or add-on accessories to expand your mounted setup with other computing equipment. Staples carries TV mounts from innovative brands like Ergotron, Atdec, and Level Mount that feature rotating, tilting, and panning capabilities. Support TVs of All Sizes Pair your TVs and computer monitors with compatible ceiling, desk, and wall mounts for secure installations that can support small or bulky devices. Reinforced arms, tracks, and extension poles provide the durability and strength needed to attach multiple devices to a single base, allowing you to conserve space throughout your business. Extend Visual Range TV mounts introduce better viewing options using flexible repositioning systems. With extendable and articulating arms, you can quickly adjust height, angle, protrusion, orientation, and more to increase ergonomic comfort and accommodate larger audiences. Expand Your Setup Upgrade your existing setup with add-on clamps, brackets, and keyboard trays. These accessories increase the stability of your TV mounts when you need to design versatile workstations in limited spaces.", "parent_text": "Computer Monitors / Screen Filters", "keyword_density": {"tv": "3.2", "mounts": "2.7", "tv mounts": "4.3"}, "department_id": 9}
