{"department_text": "Office Supplies", "nr_products": 16, "level": -1, "url": "http://www.staples.com/Briefcases/cat_CL120500", "text": "Briefcases", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Briefcases", "parent_url": "http://www.staples.com/Laptop-Bags-Luggage-School-Uniforms/cat_CG20", "keyword_count": {"briefcases": 4}, "description_wc": 165, "description_text": "Briefcases from manufacturers such as Case Logic, SOLO, McKlein, and Samsonite let you carry your notebook computer, binders, folders, and other essentials from place to place. Choose a basic briefcase for traveling to and from the office or a large version for international business trips. Modern briefcases make transporting your necessary items simple. Leather Exterior A briefcase with a leather exterior offers a classic look and feel that generations of executives have enjoyed. Slim Case Slim briefcases are designed for the times when you need to transport the basics without too much fuss. These cases can hold everything you need, from your laptop to your phone, without being bulky or hard to carry. Alternately, choose a simple laptop sleeve if all you need to carry is your computer. Contemporary Portfolios When your business requires you to keep product samples or mock ups on hand, contemporary portfolios combine classic style and modern convenience. These briefcases feature plenty of pockets for easy access to all your stuff.", "parent_text": "Laptop Bags / Luggage / School Uniforms", "keyword_density": {"briefcases": "2.4"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 130, "level": -1, "url": "http://www.staples.com/Laptop-Sleeves/cat_CL164769", "text": "Laptop Sleeves", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Laptop Sleeves", "parent_url": "http://www.staples.com/Laptop-Bags-Luggage-School-Uniforms/cat_CG20", "keyword_count": {"laptop sleeves": 3, "laptop": 7, "sleeves": 4}, "description_wc": 149, "description_text": "Laptop sleeves keep your favorite device protected from the elements, bumps, scrapes, and scratches. Choose a practical design or a handy carry bag that fits your computer and all of the accessories you normally carry with you. Wherever you go, you can tote your laptop and accessories simply, safely, and stylishly. Convenient Laptop sleeves are designed to securely cushion your laptop without being bulky. Nylon or neoprene padding ensures sufficient airflow without sacrificing protection. Designer Cases Designer laptop cases show off your personal style while keeping your computer safe. Choose leather models for a professional look or cute patterned fabrics to draw attention and garner compliments. Checkpoint-Friendly Sleeves Laptop sleeves designed to be checkpoint friendly help you get through airport security faster because you don't have to remove the entire computer to show the security agent. Frequent travelers with more accessories may prefer a rolling laptop case.", "parent_text": "Laptop Bags / Luggage / School Uniforms", "keyword_density": {"laptop sleeves": "4.0", "laptop": "4.7", "sleeves": "2.7"}, "department_id": 30}
