{"department_text": "Office Supplies", "nr_products": 50, "level": -1, "url": "http://www.staples.com/Laptop-Cases-Rolling/cat_CL160954", "text": "Laptop Cases - Rolling", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Laptop Cases - Rolling", "parent_url": "http://www.staples.com/Laptop-Bags-Luggage-School-Uniforms/cat_CG20", "keyword_count": {"rolling": 2, "laptop": 4}, "description_wc": 86, "description_text": "We have a huge selection of laptop bags, sleeves and rolling laptop bags for the business professional on the go. We carry top brands names like Swiss Gear, Targus, T-Tech by Tumi, Kenneth Cole Reaction and Samsonite. Whether you are traveling for business or pleasure, our assortment will accommodate your needs. Staples rolling laptop bags are checkpoint friendly and constructed with ample storage space and padding for laptop protection and organization. Staples carries the perfect mobile office for all your needs at a great price.", "parent_text": "Laptop Bags / Luggage / School Uniforms", "keyword_density": {"rolling": "2.3", "laptop": "4.7"}, "department_id": 30}
