{"department_text": "Office Supplies", "nr_products": 11, "level": -2, "url": "http://www.staples.com/Desktop-Organizers/cat_CL163275", "text": "Desktop Organizers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Desktop Organizers", "parent_url": "http://www.staples.com/Desktop-Organizers-Holders-and-Accessories/cat_DP1203", "keyword_count": {"desktop organizers": 1, "desktop": 6}, "description_wc": 111, "description_text": "De-clutter your desk and stay organized with desktop accessories from brands like Safco, Martha Stewart, 3m, and Staples. Staples has desktop organizer products like trays, file sorters, shelves, storage, holders, and more. Storage galore. We have hundreds of desktop storage products for files, paperwork, writing utensils, and other desktop items. All in one. For maximum space utilization, all in one desktop organizers provide storage for just about anything that you could use on a desk like pencils, rulers, sticky notes, scissors, and more. Optimize your space. No matter what type of desk or space you are working with, we have the desktop organization to create a more productive work space.", "parent_text": "Desktop Organizers, Holders and Accessories", "keyword_density": {"desktop organizers": "1.8", "desktop": "5.4"}, "department_id": 30}
