{"department_text": "Office Supplies", "nr_products": 25, "level": -2, "url": "http://www.staples.com/Plastic-Desktop-Organizers/cat_CL161539", "text": "Plastic Desktop Organizers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Plastic Desktop Organizers", "parent_url": "http://www.staples.com/Desktop-Organizers-Holders-and-Accessories/cat_DP1203", "keyword_count": {"organizers": 5, "desktop organizers": 1, "plastic": 2}, "description_wc": 102, "description_text": "For small desks or cubicles that are short on extra space, plastic desk organizers are a great way to stay organized. Staples offers rotating and all-in-one desktop organizers from brands like Fellowes, 3m, Staples, Rubbermaid, and more. Reduce clutter. Compact plastic organizers provide a clutter free way to store all of your desk supplies without taking up too much space. All in one. All in one organizers come with storage space for common desk items like writing utensils, scissors, sharpies, sticky notes, and more. Rotating desk organizer. Rotating desk organizers utilize space efficiently with convenient storage space 360 degrees around.", "parent_text": "Desktop Organizers, Holders and Accessories", "keyword_density": {"organizers": "4.9", "desktop organizers": "2.0", "plastic": "2.0"}, "department_id": 30}
