{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/School-Uniforms/cat_DP8386", "text": "School Uniforms", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "School Uniforms", "parent_url": "http://www.staples.com/Laptop-Bags-Luggage-School-Uniforms/cat_CG20", "keyword_count": {"school uniforms": 4, "school": 7}, "description_wc": 258, "description_text": "Shop School Uniforms at Staples\u00ae Kids\u2019 school uniforms from French Toast\u00ae are now available at Staples. Having successfully dressed school children since 1958, French Toast can be counted on to consistently deliver style, durability and comfort. The entire collection consists of: blouses, shirts, sweaters, cardigans, Polos, pants, skirts, scooters, jumpers, dresses, shorts and even blazers and shoes. Shopping the potentially endless combinations of mix-and-match apparel available in a wide array of colors and styles will ensure your youngsters have a fully stocked wardrobe. School Uniforms Were Never This Much Fun Your children will be pleased to be sent back to school in style. Because fashion is important to them, they will look forward to getting dressed each morning in today\u2019s top trends. Both boys and girls alike will delight in creating each day\u2019s ensemble, pairing classic dress shirts and Oxfords with sweaters and sweater vests. With an assortment of adjustable waist, pleated, pull-up and dress pants available in classic colors like navy, grey, black and khaki, your children will have a different exciting look for each new day. Don\u2019t forget, no look is complete without appropriate outerwear and shoes. Self-Close Strap Shoes for both boys and girls can seamlessly tie an outfit together, topped off with a tasteful unisex lined jacket. If you had been wondering where to buy school uniforms, Staples is the place. We like to make your search for school clothes a family affair. Get started by making your selections together below and check back for updates often.", "parent_text": "Laptop Bags / Luggage / School Uniforms", "keyword_density": {"school uniforms": "3.1", "school": "2.7"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Backpacks/cat_DP3983", "text": "Backpacks", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Backpacks", "parent_url": "http://www.staples.com/Laptop-Bags-Luggage-School-Uniforms/cat_CG20", "keyword_count": {"backpacks": 5}, "description_wc": 195, "description_text": "The best backpacks for girls and boys, school, college or travel are cool and make things easy, a necessity in today's mobile, on-the-go world. Staples has a large variety of these great book bags that will add comfort, style, utility and organization to your workday, education or trip. We carry rolling & laptop backpacks from top brands like Reebok, Puma, SwissGear, Targus, High Sierra, Kenneth Cole, OGIO, Samsonite, SOLO and Timberland. Staples makes shopping easy by offering a huge selection of the best backpacks, plus traditional book bag options, in assorted colors, prints and sizes. Staples.com carries the perfect selection for the entire family, at the very best value. Check out our durable rolling laptop backpacks for ease and mobility or a book bag especially for travel and you will enjoy the very best in savings too. Our selection is second to none and provides a nice hassle-free alternative to a briefcase. Whether a simple book bag is your preferred choice or you are looking for comfortable, spacious and aesthetically cool backpacks for girls and boys, college, travel\u2026 whatever you need, Staples has you covered with the finest products at great prices.", "parent_text": "Laptop Bags / Luggage / School Uniforms", "keyword_density": {"backpacks": "2.6"}, "department_id": 30}
