{"department_text": "Office Supplies", "nr_products": 230, "level": -1, "url": "http://www.staples.com/Laptop-Bags-and-Totes/cat_CL140978", "text": "Laptop Bags and Totes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Laptop Bags and Totes", "parent_url": "http://www.staples.com/Laptop-Bags-Luggage-School-Uniforms/cat_CG20", "keyword_count": {"bags": 5, "laptop": 6, "laptop bags and totes": 3, "bags and totes": 4}, "description_wc": 218, "description_text": "Laptop bags and totes provide storage and help prevent your computer from becoming damaged. Padded lining serves as cushioning for your delicate device, while carrying straps make it easy to take your laptop from place to place. Brands like Targus, Cocoon, and Digital Treasures offer versatile bag styles to suit different work environments, from the fashionable to the purely functional. Find Durable Protective Gear Choose products with the right physical construction and durability level for your workplace, such as rugged fabrics that offer water and abrasion resistance and shock absorbance. Hard cases can protect laptops from being crushed in industrial settings, and padded styles can reduce the effects of minor impact. Explore Styles and Designs Beyond functionality, laptop bags and totes are a source of self-expression, so you can buy products with attractive graphic prints and fashion fabrics. Find materials like polyester and leather in classic colors for a professional look that won't go out of style. Laptop shoulder bags and totes can resemble casual or designer-style bags to disguise your device. Store and Transport Accessories Make extra pockets an important purchase factor if you frequently travel with your computer. Side pockets and interior sections provide the space you need to hold flash drives, adapters, cables, and disk media in your laptop bags and totes.", "parent_text": "Laptop Bags / Luggage / School Uniforms", "keyword_density": {"bags": "2.3", "laptop": "2.8", "laptop bags and totes": "5.5", "bags and totes": "5.5"}, "department_id": 30}
