{"department_text": "Office Supplies", "nr_products": 33, "level": -2, "url": "http://www.staples.com/Sling-Backpacks-Messenger-Bags/cat_CL210575", "text": "Sling Backpacks / Messenger Bags", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Sling Backpacks / Messenger Bags", "parent_url": "http://www.staples.com/Backpacks/cat_DP3983", "keyword_count": {"bags": 3, "messenger bags": 2, "sling backpacks": 2}, "description_wc": 152, "description_text": "Sling backpacks and messenger bags are the ultimate in business casual or sophisticated school style. The one-shoulder design makes them especially easy to get on and off, so you can pack your bag and be on your way. Choose from a variety of sizes to accommodate your needs and lifestyle. Interior and Exterior Storage Plenty of pockets inside and out make sure you that have a place for all of your work and school supplies. Zippered pockets let you store small items without worrying about them falling out. Secure Closures Sling backpacks and messenger bags have a flap opening for quick access to your things. Available closers include Velcro or speed-buckle fasteners as well as zippers for extra security. Business Functional The sleek design of these bags makes them perfect for the office. Leather trim ensures business-worthy style that still gives you enough room for your tablet or laptop.", "parent_text": "Backpacks", "keyword_density": {"bags": "2.0", "messenger bags": "2.6", "sling backpacks": "2.6"}, "department_id": 30}
