{"department_text": "Office Supplies", "nr_products": 36, "level": -2, "url": "http://www.staples.com/Pants/cat_CL208117", "text": "Pants", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Pants", "parent_url": "http://www.staples.com/School-Uniforms/cat_DP8386", "keyword_count": {"pants": 6}, "description_wc": 266, "description_text": "Finally, Pants As Durable As Your Children Are Finding pants for your growing ones can be tricky. Does it seem like you\u2019re always running back to the stores to buy the next size up? Here at Staples\u00ae, we offer a long-term solution from the latest French Toast\u00ae brand collection. Not only are they available in today\u2019s most popular styles, like cargo, pull-on, pleated and bootleg, but they are also built to last. If you have trouble finding the right size, you may be surprised at how easy it is to find the perfect fit. Pant sizes are available from toddler to husky with a variety of features and details available. Your children will love the versatility in style choices as they can select from slimmed down legs, modern styles like lower waists, pockets in the front or back, hook and eye fastening and mock belts. Pants for All Occasions For those involved in the most active extracurricular activities, pants are available with sturdy double knees. From classic pleated to modern fit, many include hidden adjustable waists and hems for growth spurts. Pick a pair to mix and match, and create outfits for all types of activity \u2014 from the academic to the after-school social. For formal occasions, both boys and girls alike will feel like royalty in a pair of classic black adjustable waist pants, with room to breathe. For dressed-down looks, a casual khaki with a unisex Polo should do the trick. You can peruse all pants below. Sort your search results by price, style, color, size and gender.", "parent_text": "School Uniforms", "keyword_density": {"pants": "2.3"}, "department_id": 30}
