{"department_text": "Accounting | Forms | Security", "nr_products": 21, "level": -2, "url": "http://www.staples.com/Time-Cards-Time-Badges/cat_CL142193", "text": "Time Cards & Time Badges", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Time Cards & Time Badges", "parent_url": "http://www.staples.com/Time-Clocks-Time-Recorders/cat_DP3901", "keyword_count": {"time cards time": 1, "time badges": 2, "time cards": 7, "time": 11, "cards": 9, "badges": 3}, "description_wc": 141, "description_text": "Track employee time efficiently with time cards and time badges, from Staples. We carry a range of solutions for the smallest office to the biggest. Shop our selection today. Restrict Entry and Access to Data Try our electronic key fobs for name-specific access to data. Pair with swipe cards or proximity to restrict entry without impairing convenience A Variety of Choices Time badges and time cards for employees are available as weekly time cards and bi-weekly time cards. We carry one sided/double sided options, a wide range of of card type/sizes, and anywhere from 50 to 200 cards per pack Employee Time Cards From Trusted Brands including Adams, Pyramid, Acroprint and Lathem time cards Time cards and badges are an easy, trusted and secure way to track employee time and know who is in your building when.", "parent_text": "Time Clocks / Time Recorders", "keyword_density": {"time cards time": "2.1", "time badges": "2.8", "time cards": "9.9", "time": "7.8", "cards": "6.4", "badges": "2.1"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 13, "level": -2, "url": "http://www.staples.com/Electronic-Time-Clocks/cat_CL163589", "text": "Electronic Time Clocks", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Electronic Time Clocks", "parent_url": "http://www.staples.com/Time-Clocks-Time-Recorders/cat_DP3901", "keyword_count": {"electronic time clocks": 3, "electronic time": 5, "time clocks": 4, "time": 7}, "description_wc": 80, "description_text": "Electronic time clocks are the best way to track time precisely. We carry heavy duty, high capacity electronic time\u00a0clocks that get the job done. Shop our selection for the best names in the industry. Proven Accuracy Choose an Electronic time clock or electronic time recorder for precision to hundreths of an hour. Versatile Electric Time Clocks Our Electronic time clocks come with top/bottom feeds for your convenience and ease. The Best Brands in the Industry Lathem and Pyramid", "parent_text": "Time Clocks / Time Recorders", "keyword_density": {"electronic time clocks": "11.2", "electronic time": "12.5", "time": "8.8", "time clocks": "10.0"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 8, "level": -2, "url": "http://www.staples.com/Time-Card-Racks/cat_CL159772", "text": "Time Card Racks", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Time Card Racks", "parent_url": "http://www.staples.com/Time-Clocks-Time-Recorders/cat_DP3901", "keyword_count": {"card": 9, "time card racks": 3, "racks": 6, "time card": 8, "time": 9}, "description_wc": 130, "description_text": "Stay organized as you track use of employee time with time card racks from top notch vendors, such as Lathem and Pyramid. We carry a wide range of time card holders and time card badge racks that will suit your needs. Browse our selection today. Full Adjustable Time card holder racks have a capacity of 25 to 40 cards, come in a range of sizes and are fully adjustable Strong and Trustworthy Try one of our heavy duty plastic time card racks for a lightweight, durable time card storage solution The Top Names in the Industry Our Pyramid and Lathem time card racks are the best on the market Browse our selection of time card holder racks to get your office in order and ready to make a great impression!", "parent_text": "Time Clocks / Time Recorders", "keyword_density": {"time": "6.9", "time card racks": "6.9", "racks": "4.6", "card": "6.9", "time card": "12.3"}, "department_id": 25}
