{"department_text": "Accounting | Forms | Security", "nr_products": 53, "level": -2, "url": "http://www.staples.com/Name-Badges/cat_CL160068", "text": "Name Badges", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Name Badges", "parent_url": "http://www.staples.com/ID-Badges-Holders/cat_DP1520", "keyword_count": {"name badges": 1, "name": 2, "badges": 2}, "description_wc": 62, "description_text": "Staples offers a wide variety of professional name badges and corresponding name badge holders perfect for any setting, whether it be corporate, medical, or security. Our ID badges come in a variety of sizes, colors, and pack sizes and our badge holders offer the convenience of retractable cords, breakaway lanyards, or clips. Browse our selection of brands like Avery, Cosco, and Staples.", "parent_text": "ID Badges & Holders", "keyword_density": {"name badges": "3.2", "name": "3.2", "badges": "3.2"}, "department_id": 25}
{"department_text": "Office Supplies", "nr_products": 5, "level": -2, "url": "http://www.staples.com/Rolling-Backpacks/cat_CL210574", "text": "Rolling Backpacks", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Rolling Backpacks", "parent_url": "http://www.staples.com/Backpacks/cat_DP3983", "keyword_count": {"rolling": 6, "rolling backpacks": 2, "backpacks": 3}, "description_wc": 140, "description_text": "Rolling backpacks make it easy to transport your academic or work materials without hurting your back. The placement of the wheels lets you navigate turns with ease. For those times when you want to move quickly or need to navigate stairs, these wheeled backpacks also come with traditional shoulder straps. Smooth-Rolling Wheels Corner-mounted wheels ensure stability, so you don't have to worry about your rolling backpack tipping over. In-line skate wheels give you the same rolling convenience with an added style boost. Carry Handles Get the convenience of multiple carry options when you choose a wheeled / rolling backpack that has both handles and straps. Telescoping handles make these even easier to move around. A Place for Everything Organization compartments abound in these wheeled / rolling backpacks. There are compartments for your books, pencils, phone, and laptop .", "parent_text": "Backpacks", "keyword_density": {"rolling": "4.3", "rolling backpacks": "2.9", "backpacks": "2.2"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 140, "level": -2, "url": "http://www.staples.com/School-Backpacks/cat_CL210573", "text": "School Backpacks", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "School Backpacks", "parent_url": "http://www.staples.com/Backpacks/cat_DP3983", "keyword_count": {"school backpacks": 2, "school": 7, "backpacks": 3}, "description_wc": 159, "description_text": "School backpacks are the foundation of back-to-school shopping. Whether you need to carry just a few notebooks and a set of pencils or several large books and your laptop, our catalog has a variety of the best backpacks for school to suit your needs. Choose from trusted brands like Jansport, High Sierra Sport, and Targus to ensure your school backpack lasts. Keep Your Electronics Safe For the tech-savvy student, a backpack for school that has specialized electronics compartments is a must. Padding and soft liners keep your tablet, computer, and phone protected. Reduce the Risk of Back Pain School backpacks carry heavy loads. Protect your back and shoulders with padded adjustable straps or a rolling backpack . Have Enough Room Your school backpack should have enough room for your daily essentials without being overstuffed. Choose a larger size if you know you will carry more than a couple books or need to bring a laptop along.", "parent_text": "Backpacks", "keyword_density": {"school backpacks": "2.5", "school": "4.4", "backpacks": "1.9"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 81, "level": -2, "url": "http://www.staples.com/Laptop-Backpacks/cat_CL210572", "text": "Laptop Backpacks", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Laptop Backpacks", "parent_url": "http://www.staples.com/Backpacks/cat_DP3983", "keyword_count": {"laptop backpacks": 4, "laptop": 6, "backpacks": 5}, "description_wc": 179, "description_text": "The best laptop backpacks let you carry all of your school and work essentials without having to bring more than one bag. Designated electronics pockets make it easy to carry your laptop, notebook, tablet, and smartphone with you safely. Lumbar padding and adjustable straps also ensure your comfort as you trek from place to place. On-the-Go Convenience Stay connected and productive when you carry your electronics in one of our best laptop backpacks. Use your daily bus ride or other spare moments to do a little homework or check your emails. Protective Padding Specialized padded compartments in our cool laptop backpacks keep your laptop and other electronic devices protected. Take your computer from school to work to home without worrying about scratches or drops. Stylish Organization These cool laptop backpacks also offer compartments and pouches to keep the rest of your essentials organized. The array of colors and designs ensures you can find one to match your needs and your personality, and for even more comfort and storage space, check out our selection of rolling backpacks .", "parent_text": "Backpacks", "keyword_density": {"laptop backpacks": "4.5", "laptop": "3.4", "backpacks": "2.8"}, "department_id": 30}
{"nr_products": 6, "level": -2, "url": "http://www.staples.com/Shoes/cat_CL209599", "text": "Shoes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/School-Uniforms/cat_DP8386", "parent_text": "School Uniforms", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 33, "level": -2, "url": "http://www.staples.com/Kids-Backpacks/cat_CL210758", "text": "Kids Backpacks", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Kids Backpacks", "parent_url": "http://www.staples.com/Backpacks/cat_DP3983", "keyword_count": {"backpacks": 6, "kids": 5, "kids backpacks": 3}, "description_wc": 131, "description_text": "The best backpacks for kids are colorful and fun, with plenty of storage space and compartmentalized pockets to keep everything organized. Staples has a complete assortment of kids backpacks from Puma, Skullcandy, Jansport and more. With bright colors and exciting design options, our kids backpacks are perfect for school, travel, or just creating extra storage space on the go. They are durable so you know they'll last and come in different sizes to accommodate what your child needs to carry. Our kids backpacks also support the back so they're comfortable to wear and use, even with a full load. The best backpacks for kids make school and transportation easier, and Staples has a full assortment from which to choose. For even easier transportation, check out our rolling backpacks .", "parent_text": "Backpacks", "keyword_density": {"kids backpacks": "4.6", "kids": "3.8", "backpacks": "4.6"}, "department_id": 30}
