{"department_text": "Office Supplies", "nr_products": 224, "level": -2, "url": "http://www.staples.com/Backpacks/cat_CL142745", "text": "All Book Bags / Backpacks", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "All Book Bags / Backpacks", "parent_url": "http://www.staples.com/Backpacks/cat_DP3983", "keyword_count": {"bags": 3, "book": 3, "backpacks": 4, "book bags": 2}, "description_wc": 142, "description_text": "Our book bags and backpacks offer you portable storage and organization. Keep everything you need close by and organized, decreasing the amount of time you spend hunting for that lost pen or folder. Whether you need one for school, work, or your next outdoor adventure, these backpacks are built to last. Comfort Features like adjustable straps and air mesh padding keep your book bag comfortable to carry. There are rolling backpacks with telescoping handles for those with sensitive backs, necks, or shoulders. Organization Never lose an important paper or homework again. Backpacks with tons of pockets inside and out give you a place for your laptop, school supplies, and work folders. Style Book bags and laptop bags are available in a range of colors and styles. Grab a sporty one for the gym or class and a classic brief pack for work.", "parent_text": "Backpacks", "keyword_density": {"bags": "2.1", "book": "2.1", "backpacks": "2.8", "book bags": "2.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 15, "level": -2, "url": "http://www.staples.com/Shorts/cat_CL208121", "text": "Shorts", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Shorts", "parent_url": "http://www.staples.com/School-Uniforms/cat_DP8386", "keyword_count": {"shorts": 3}, "description_wc": 140, "description_text": "Cool Uniforms for Warm Temperatures Shorts are a must for hot summer months or year-round warm climates. Breathable fabrics, a variety of color options, and modest lengths means you'll find exactly what you need. Finishing touches like side-seam pockets and functional belt loops create a polished look. Adjustable Fit Adjustable waists and a wide range of sizes help ensure your child's wardrobe lasts through the school year. Low-rise styles are also available for a trendier cut. The Right Length Our catalog features knee-length shorts for both boys and girls, including a flattering feminine Bermuda fit. Add a polo and dress-code appropriate shoes for a complete outfit. Functional Pockets Choose from shorts with front or side pockets, depending on your preferred design. Boys' styles include a back pocket for a wallet or ID card.", "parent_text": "School Uniforms", "keyword_density": {"shorts": "2.1"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 13, "level": -2, "url": "http://www.staples.com/Sweaters/cat_CL208119", "text": "Sweaters", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Sweaters", "parent_url": "http://www.staples.com/School-Uniforms/cat_DP8386", "keyword_count": {"sweaters": 4}, "description_wc": 133, "description_text": "Warm and Toasty Warm, lightweight sweaters let you dress for unpredictable weather. Choose from v-neck and crew-neck styles for boys and girls depending on your school's dress code, and use them year-round to guard against chilly classrooms or breezy nights at the football game. Multiseasonal Sweaters make for easy layering over your child's regular school uniform. Add a jacket for an extra layer on particularly blustery days. Quality Knit Soft, cashmere-like, fine-gauge knit sweaters are perfect for both spring and fall, when you just need a light layer. Acrylic fabrics add extra durability against snags and pulls Easy Care These cardigans can be machine washed, making it easier to keep up with the laundry. Anti-pill fabric keeps sweaters looking great through the whole school year.", "parent_text": "School Uniforms", "keyword_density": {"sweaters": "3.0"}, "department_id": 30}
{"level": -1, "url": "http://www.staples.com/Display-Towers-Cabinets/cat_DP8465", "text": "Display Towers & Cabinets", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_wc": 0, "parent_url": "http://www.staples.com/Store-Fixtures-Signage-Display/cat_CG2898", "parent_text": "Store Fixtures / Signage / Display", "department_text": "Accounting | Forms | Security", "department_id": 25}
{"department_text": "Office Supplies", "nr_products": 20, "level": -2, "url": "http://www.staples.com/Jumpers-Dresses/cat_CL208115", "text": "Jumpers - Dresses", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Jumpers - Dresses", "parent_url": "http://www.staples.com/School-Uniforms/cat_DP8386", "keyword_count": {"dresses": 2, "jumpers": 2}, "description_wc": 152, "description_text": "No-Fuss Uniforms Load your child's school wardrobe with jumpers and dresses and make getting ready in the morning easier. Put an entire outfit on one hanger, so you can just grab and go without worrying about color coordinating. The variety of colors and traditional plaids makes it easy to match the school's palette. Easy Outfits Jumpers and dresses are simple for children to match and put on by themselves, making for quicker, less-stressful mornings. Pull on a dress or add a blouse to a v-neck jumper for an instant outfit. Sophisticated Accents Adhering to the school dress code doesn't mean your child has to sacrifice personality. Little details likes ribbons, bows, and buckles make uniforms fun. No-Hassle Pleats Permanent pleats retain their shape through washing and drying, so you can spend less time ironing. Easy-care polyester fabric stands up to falls, trips, and spills.", "parent_text": "School Uniforms", "keyword_density": {"dresses": "1.3", "jumpers": "1.3"}, "department_id": 30}
