{"department_text": "Office Supplies", "nr_products": 8, "level": -2, "url": "http://www.staples.com/Shirts/cat_CL209598", "text": "Shirts", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Shirts", "parent_url": "http://www.staples.com/School-Uniforms/cat_DP8386", "keyword_count": {"shirts": 4}, "description_wc": 174, "description_text": "Dress Up or Down Shirts are a staple of school uniforms, and these choices from French Toast won't disappoint. Whether you're looking for long- or short-sleeved options, our catalog features both white and blue styles so you can stock up on one color or add a little variety. Budget-friendly prices let you buy in bulk, so you can finish your back-to-school shopping in just a few clicks. Comfortable Expandable collars and Wrinkle No More fabric keeps these oxford and classic dress shirts from being too stiff and confining. A range of sizes from toddler to husky ensures you get a great fit. Classic Button fronts, classic collars, and front pockets give these shirts classic style. Add a few different colors to your child's wardrobe for easy mixing and matching and let your child pick out an outfit while you attend to other tasks. Multipurpose These shirts don't have to be just for school. Pair them with shorts or pants for family pictures or other special occasions.", "parent_text": "School Uniforms", "keyword_density": {"shirts": "2.3"}, "department_id": 30}
