{"department_text": "PCs | Drives | Accessories", "level": -1, "url": "http://www.staples.com/Speakers-Microphones-Headsets/cat_DP1434", "text": "Speakers, Microphones & Headsets", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Speakers, Microphones & Headsets", "parent_url": "http://www.staples.com/Mice-Keyboards-Speakers/cat_CG18", "keyword_count": {"microphones": 1, "speakers": 3}, "description_wc": 134, "description_text": "Experience videos and music the way they were meant to be with speakers and audio equipment from Staples. From the richest sounds to the most subtle, you\u2019ll never miss a moment again. 1. Superior acoustics: Find a wattage preference that works for you, or purchase a speaker set that comes with a subwoofer so you can really feel that bass. 2. No more tangles: Sick of trying to unsnare the wires in your entertainment system? Upgrade to wireless speakers for a different experience. 3. Easy pairing with other audio equipment: Choose from a wide range of noise canceling microphones and headphones so you can be sure to be heard or listen in privacy without sacrificing quality. Computer Speakers are an essential part of your gaming or work space. Find the pair for you.", "parent_text": "Mice / Keyboards / Speakers", "keyword_density": {"microphones": "0.7", "speakers": "2.2"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "level": -1, "url": "http://www.staples.com/Gaming-Gear/cat_DP5069", "text": "Gaming Gear", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Gaming Gear", "parent_url": "http://www.staples.com/Mice-Keyboards-Speakers/cat_CG18", "keyword_count": {"gaming": 9, "gaming gear": 2}, "description_wc": 132, "description_text": "For the best computer gaming experience, you need the highest quality gaming accessories. Our Logitech gaming gear is the last word in PC gaming. 1. Customize your experience: With a programmable gaming mouse or keyboard, you can save preferences for you and a group of friends so you can spend less time setting up your gaming gear and more time playing. 2. Real time updates at the tip of your fingers: Try a computer gaming keyboard with an LCD game panel for the latest stats. 3. Set optimal lighting: Our computer gaming mice and keyboards allow you to assign colors to characters and match your other devices. 4. Fast and precise response: Fast reports and unparalleled accuracy. Don't forget the headphones, browse our computer gaming accessories today for a superior experience.", "parent_text": "Mice / Keyboards / Speakers", "keyword_density": {"gaming": "6.8", "gaming gear": "3.0"}, "department_id": 9}
{"department_text": "Office Supplies", "nr_products": 37, "level": -2, "url": "http://www.staples.com/Skirts-Scooters/cat_CL209600", "text": "Skirts - Scooters", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Skirts - Scooters", "parent_url": "http://www.staples.com/School-Uniforms/cat_DP8386", "keyword_count": {"scooters": 4, "skirts": 4}, "description_wc": 157, "description_text": "Comfortable Style Dress your child in skirts and scooters for feminine style or to conform with a traditional dress code. Knee-length skirts are available in a variety of muted colors and plaids for easy mixing and matching, and modern scooters give your child the comfort of pants with the look of a skirt. Modern Flair Accents like a double row of pleats, button tabs, and buckles take these skirts and scooters from wardrobe staples to clothes your child will actually want to wear. Just pair one with a blouse, and you're ready to go. Stylish Patterns Whether your dress code requires solid colors or traditional plaid, our catalog has a large selection of colors to choose from. Stick with go-to neutrals or add a bold green or burgundy for variety. Modest Lengths Find knee-length skirts and scooters that satisfy your school's lengths requirements. Add tights or knee-high socks for added coverage.", "parent_text": "School Uniforms", "keyword_density": {"scooters": "2.5", "skirts": "2.5"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 52, "level": -2, "url": "http://www.staples.com/Polos/cat_CL208120", "text": "Polos", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Polos", "parent_url": "http://www.staples.com/School-Uniforms/cat_DP8386", "keyword_count": {"polos": 4}, "description_wc": 172, "description_text": "Wardrobe Staple Shop polos for the ultimate in versatility. The three button neckline and iconic collar will have your child looking preppy and polished. Interlock knit fabrics make these shirts extra durable and easy to care for, so your child can just wash and wear. Classic Design Polos offer the best in causal and classic design, making it easy to play them up with black dress pants during school hours or throw on a pair of jeans for a more relaxed style in the evenings or on the weekends. Unisex Fit Unisex polos featuring ribbed cuffs and drop tail hems work equally well for both sexes. Dedicated boys' and girls' styles are also available if you prefer a more gender-specific fit. Color Coordinating A range of colors, from yellow to heather gray, make it easy to mix and match these polos with basic pants. Having an entire wardrobe that goes together lets your child spend less time getting ready in the morning and gets you on the road or bus faster. \"", "parent_text": "School Uniforms", "keyword_density": {"polos": "2.3"}, "department_id": 30}
