{"department_text": "Office Supplies", "nr_products": 22, "level": -2, "url": "http://www.staples.com/Blouses/cat_CL208113", "text": "Blouses", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Blouses", "parent_url": "http://www.staples.com/School-Uniforms/cat_DP8386", "keyword_count": {"blouses": 5}, "description_wc": 254, "description_text": "French Toast\u00ae Blouses Are Now on Available at Staples We are happy to bring you America\u2019s most trusted brand in school blouses and other apparel: French Toast\u00ae. Since 1958, French Toast has provided America\u2019s girls and boys with an assortment of durable school outfits. Kids love the way they look in them, and Moms love them for their affordability. With prices this good, you can get one in every style and color. Discover New Blouses \u2013 Just in Time for School Even the most fashion-savvy have developed a soft spot for this lineup. Who can resist Oxfords with darts in classic colors like white and blue, available in either a long or a short sleeve? Peter Pan and Pointy-Collar styles are a popular choice available in blue, pink, white and yellow. The self-belted and ribbon bow options are both standout selections from which to create additional unique looks. Comfort That Lasts & Care That Is Effortless With America\u2019s youth in mind, French Toast designed clothing that stands the test of time, which spares Mom a little extra housekeeping. All of the shirts are machine-washable and many come in Wrinkle No More\u2122 fabric. Soft cotton and polyester blends are refreshing against the skin, and blouses with lace add a hint of elegance to any ensemble. Find your favorites by reviewing our selection of blouses below. You should be able to find what you are looking for easily, as you can sort by price, color, size range or sleeve length.", "parent_text": "School Uniforms", "keyword_density": {"blouses": "2.0"}, "department_id": 30}
{"department_text": "PCs | Drives | Accessories", "level": -1, "url": "http://www.staples.com/Keyboards-Keypads-Drawers/cat_DP1924", "text": "Keyboards / Keypads / Drawers", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Keyboards / Keypads / Drawers", "parent_url": "http://www.staples.com/Mice-Keyboards-Speakers/cat_CG18", "keyword_count": {"drawers": 1, "keypads": 1, "keyboards": 1}, "description_wc": 186, "description_text": "A great computer keyboard is an essential part of any workstation. That\u2019s why it\u2019s important to have a keyboard that feels good and gets the job done. We carry a wide array of Microsoft and Logitech computer keyboards, plus many other models from other top brands. 1. Corded or cordless solutions: Whether you prefer to work next to your computer or from across the room, we carry the latest corded and cordless keyboard technology. 2. All-in-one: Shopping for a mouse as well? Try one of our Logitech keyboard and mouse bundles for the quickest, most cost effective route to ergonomic computer navigation. 3. A workspace for your body: Browse our desktop and articulating computer keyboard drawers and place your keyboard at a proper distance from your core. 4. Fast calculation: Try one of our separate keypads for quicker data entry. Get typing with a brand new, top of the line computer keyboard from Staples.com, and for touch screens, select a Windows 8 keyboard , which are perfect for the Microsoft Surface tablet or any of the other many popular Windows 8 devices.", "parent_text": "Mice / Keyboards / Speakers", "keyword_density": {"drawers": "0.5", "keypads": "0.5", "keyboards": "0.5"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 65, "level": -1, "url": "http://www.staples.com/Mice-Keyboard-Bundles/cat_CL141983", "text": "Mice & Keyboard Bundles", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Mice & Keyboard Bundles", "parent_url": "http://www.staples.com/Mice-Keyboards-Speakers/cat_CG18", "keyword_count": {"mice": 1, "keyboard": 5}, "description_wc": 158, "description_text": "Whether you\u2019ve just purchased a new computer or you\u2019re trying to make your work station more ergonomically correct, mice and keyboard combos are the quickest and most cost-efficient way to get set up and ready to go. 1. Wireless and corded options: The latest in long-lasting wireless or wired technology from top names like Microsoft or Logitech. 2. USB ready: Just plug the transceiver into the USB interface and you\u2019re ready to go. 3. A range of keyboard functions: Our keyboards feature customizable keys for easy access to your most used applications and control media playback. 4. The best in laser technology: Choose an optical mouse for laser precision and hyper fast speeds. 5. Technology that works with your body: From concave keys to fit your natural finger positions to a touch mouse with easy scrolling, choose a keyboard bundle designed for you. Our keyboard sets are waiting and ready for you try.", "parent_text": "Mice / Keyboards / Speakers", "keyword_density": {"mice": "0.6", "keyboard": "3.2"}, "department_id": 9}
