{"department_text": "PCs | Drives | Accessories", "nr_products": 19, "level": -2, "url": "http://www.staples.com/Gaming-Mice/cat_CL166817", "text": "Gaming Mice", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Gaming Mice", "parent_url": "http://www.staples.com/Gaming-Gear/cat_DP5069", "keyword_count": {"gaming": 4, "gaming mice": 1}, "description_wc": 123, "description_text": "At Staples, we know how important it is to choose a gaming mouse that help you perform your best. Browse our selection of the best technology with a diverse range of features. For more information, browse our research centers. 1. Reliable precision, power and speed: Try our superior Logitech gaming mice for the latest in laser and optical technology, the fastest scrolling and most precise clicks. 2. Customize your experience: Shift controls so they are easy and quick to reach for an optimal gaming experience. 3. Multiple solutions for multiple users: On-board memory profiles for up to three users so you can set it and forget it. With the right gaming mouse beneath your fingertips, better enjoy (and win) your big games.", "parent_text": "Gaming Gear", "keyword_density": {"gaming": "3.3", "gaming mice": "1.6"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 51, "level": -2, "url": "http://www.staples.com/Computer-VOIP-Headsets/cat_CL140478", "text": "Computer & VOIP Headsets", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Computer & VOIP Headsets", "parent_url": "http://www.staples.com/Speakers-Microphones-Headsets/cat_DP1434", "keyword_count": {"headsets": 3, "computer": 4}, "description_wc": 112, "description_text": "Listen to music at your desk, make a hands free call or jump into that latest game with our computer headsets. Find the sound quality you deserve with the privacy you crave. 1. Wired or wireless: Choose one of our wired and wireless computer headphones from Plantronic, GE, Logitech or Microsoft for easy syncing or plugin with any USB port. 2. Concentrate on the game: Browse our wide range of binaural noise-canceling gaming headsets and block out distractions on both ends of the line. 3. The highest quality: Choose from a variety of wideband frequency computer headsets for optimal natural voice quality. Try a computer headset today for a superior experience.", "parent_text": "Speakers, Microphones & Headsets", "keyword_density": {"headsets": "2.7", "computer": "3.6"}, "department_id": 9}
