{"department_text": "PCs | Drives | Accessories", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Gaming-Keyboards/cat_CL166818", "text": "Gaming Keyboards", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Gaming Keyboards", "parent_url": "http://www.staples.com/Gaming-Gear/cat_DP5069", "keyword_count": {"gaming": 7, "gaming keyboards": 3, "keyboards": 4}, "description_wc": 133, "description_text": "When you\u2019re in the middle of a battle and quick action is required, you need a gaming keyboard that won\u2019t quit. That\u2019s why we carry the best gaming keyboards from Logitech, the most trusted name in the industry. 1. Full range of actions: Whether you\u2019re crouching, running, sitting or performing any kind of action on screen, our fast gaming keyboards will deliver the results you desire. 2. Ergonomic design: Who said that gaming and ergonomics don\u2019t go hand in hand? Our gaming keyboards fit your body and give you the support you need. 3. Match your style: We carry keyboards with custom-color backlighting, meaning you can match your gaming keyboard with all of your equipment. A gaming keyboard from Staples.com will be a sure path to victory.", "parent_text": "Gaming Gear", "keyword_density": {"gaming": "5.3", "gaming keyboards": "4.5", "keyboards": "3.0"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 39, "level": -2, "url": "http://www.staples.com/Computer-Speakers/cat_CL140479", "text": "Computer Speakers", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Computer Speakers", "parent_url": "http://www.staples.com/Speakers-Microphones-Headsets/cat_DP1434", "keyword_count": {"speakers": 6, "computer": 4, "computer speakers": 3}, "description_wc": 128, "description_text": "Computer speakers are great for everything from video chats to movies to podcasts and music. Peruse our extensive stock of Altec Lansing, Logitech and Cyber Acoustics computer speakers to find the right item for you. 1. Better sound quality: Enhance the quality of built-in laptop speakers. 2. Connect using a range of options: We have a variety bluetooth wireless speakers as well as corded options that are ready to be connected to your USB port and RCA jack. 3. Available on the go: Try one of our portable speakers for great sound wherever you are. 4. All the wattage you need: Our computer speakers produce peak and balanced wattage for the best sound. The perfect computer speaker is just a click away at an everyday low price!", "parent_text": "Speakers, Microphones & Headsets", "keyword_density": {"speakers": "4.7", "computer": "3.1", "computer speakers": "4.7"}, "department_id": 9}
