{"department_text": "PCs | Drives | Accessories", "nr_products": 51, "level": -2, "url": "http://www.staples.com/Mouse-Pads/cat_CL141474", "text": "Mouse Pads", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Mouse Pads", "parent_url": "http://www.staples.com/Mouse-Pads/cat_DP5072", "keyword_count": {"mouse": 12, "mouse pads": 8}, "description_wc": 149, "description_text": "Mouse pads provide easy style for your desktop and a better scrolling experience. Choose from a host of cool mouse pads and custom mouse pads for a solution that fits right in with your work station and habits. Need more ideas? Check out one of our many research centers. Maximize mouse performance : With our sleek, smooth, and thin mouse pads, enhance the way your mouse scrolls without cluttering your desktop. Choose from a wide range of designs : Browse a variety of colors and fun graphics for a cool mouse pads your officemates will admire. Or, keep your family or pets nearby with one of our custom photo mouse pads. An option to suit every mouse : Our mouse pads are roller ball and optical mouse friendly. The best brands : Staples, Centon and Micro-Thin. Browse our wide selection of mouse pads today and take your scrolling to the next level!", "parent_text": "Mouse Pads", "keyword_density": {"mouse": "8.1", "mouse pads": "10.7"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 13, "level": -2, "url": "http://www.staples.com/Desktop-Drawers/cat_CL141472", "text": "Desktop Drawers", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Desktop Drawers", "parent_url": "http://www.staples.com/Keyboards-Keypads-Drawers/cat_DP1924", "keyword_count": {"desktop drawers": 1}, "description_wc": 46, "description_text": "Desktop drawers are an easy, convenient way to work with the keyboard you prefer without sacrificing storage and space. We have a number of options that will meet the needs of every preference and design. Check out our research centers for help getting on your way.", "parent_text": "Keyboards / Keypads / Drawers", "keyword_density": {"desktop drawers": "4.3"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 2, "level": -2, "url": "http://www.staples.com/Keypads/cat_CL142828", "text": "Keypads", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Keypads", "parent_url": "http://www.staples.com/Keyboards-Keypads-Drawers/cat_DP1924", "keyword_count": {"keypads": 7}, "description_wc": 112, "description_text": "When your days are filled with data entry and calculations, number keypads are the fastest way to get to the keys you need. We have a wide selection of numeric keypads for every type of task and user. 1. Easy syncing: Try one of our USB numeric keypads or wireless numeric keypads for fast connectivity to your computer. 2. Ergonomics you can trust: All numeric keypads are ergonomically designed with the proper tilt to prevent wrist pain so you can do that accounting or work with those spreadsheets as long as you need. 3. We carry Targus, the top name in keypads. Browse our number keypads today and change how you work.", "parent_text": "Keyboards / Keypads / Drawers", "keyword_density": {"keypads": "6.2"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 238, "level": -2, "url": "http://www.staples.com/Keyboards/cat_CL141981", "text": "Keyboards", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Keyboards", "parent_url": "http://www.staples.com/Keyboards-Keypads-Drawers/cat_DP1924", "keyword_count": {"keyboards": 5}, "description_wc": 211, "description_text": "Keyboards allow you to manually send commands to your computer for document creation, recording sales income, and more. Upgraded features like wireless operation make it easy to adapt to new environments. Choose from Multiple Formats Find the right data-input solution to suit your working conditions. Standard QWERTY keyboards are ideal for daily general-purpose use, while mini models exclude the number pad to save space. Slim, rugged, and flexible designs offer more versatility when you need to mount or store equipment in tight spaces and outdoor environments. Go Wireless Increase your options with wireless keyboards you can use remotely while simultaneously removing wire hazards. For employees who frequently move locations, you can also find USB models that function universally with nearly any modern computer. Operate with Ease If you plan to ditch the traditional computer mouse, choose keyboards with alternative pointing devices, such as touchpads and trackballs. These built-in data-entry components simplify portability by eliminating the need for separate equipment. Comfort and Protection Whether you work long hours or snack while you type, your work habits are supported with smart design features, such as washability and spill-resistance. Top brands like Microsoft keep comfort in mind with curved ergonomic keyboards that reduce stress on your hands and back.", "parent_text": "Keyboards / Keypads / Drawers", "keyword_density": {"keyboards": "2.4"}, "department_id": 9}
