{"department_text": "PCs | Drives | Accessories", "nr_products": 57, "level": -1, "url": "http://www.staples.com/Modems/cat_CL140458", "text": "Modems", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Modems", "parent_url": "http://www.staples.com/Networking-Cables/cat_CG58", "keyword_count": {"modems": 2}, "description_wc": 110, "description_text": "Stream high-end video, multimedia, and other speed-intensive applications with smooth internet to multiple devices using a high speed modem. Staples offers quality cable and DSL modem products with brands like Netgear, Motorola, and Zoom. Compatible with most ISP : Finding a high speed cable or DSL modem gateway that is compatible with your internet service provider is simple with Staples\u2019 selection of modems. High speed wireless : Wireless modems are convenient for cramped or cluttered spaces and provide more flexibility in your home or office with a simple Ethernet interface. Connect multiple devices : It is simple to connect to the internet wirelessly on multiple devices with one central modem router.", "parent_text": "Networking", "keyword_density": {"modems": "1.8"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 40, "level": -1, "url": "http://www.staples.com/Network-Media-Players/cat_CL160115", "text": "Network Media Players", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Network Media Players", "parent_url": "http://www.staples.com/Networking-Cables/cat_CG58", "keyword_count": {"media": 4, "network": 3, "network media players": 2}, "description_wc": 150, "description_text": "Network media players are the fastest, most affordable route to a home theater and gaming system that does everything you desire. Need more information about this cutting edge technology? Please visit our research centers. Live streaming : Stream movies and live TV right to your HD media player without sacrificing quality. Work with what you have : Try a gaming switch or Internet adapter to take your devices into the streaming age. You\u2019ll gain access to hundreds of movies and TV shows on demand along the way. Forget the wires : Stop trying to untangle a mass of wires behind your home theater. Try a wireless TV with many high def options or a wireless home theater networking kit and get down to the business of enjoying your streaming player, not setting it up. Network media players from Imation, Netgear or Western Digital are the future face of media. Get streaming today!", "parent_text": "Networking", "keyword_density": {"media": "2.7", "network": "2.0", "network media players": "4.0"}, "department_id": 9}
