{"department_text": "PCs | Drives | Accessories", "nr_products": 264, "level": -1, "url": "http://www.staples.com/Routers/cat_CL165748", "text": "Routers", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Routers", "parent_url": "http://www.staples.com/Networking-Cables/cat_CG58", "keyword_count": {"routers": 7}, "description_wc": 234, "description_text": "Staples has wireless G, N or Dual Band wireless routers from popular brands like Netgear, Linksys, Cisco, Belkin, D-Link and Western Digital. Use our best wifi routers as your access point to the Web, whether you need to keep up on email communications or upload a presentation to your marketing team on another continent. D-Link, Netgear, Western Digital, Cisco, Belkin & Linksys routers are the best quality available; they make it easy to get and stay connected. Dual-Band Routers Dual-band wireless routers give you extra speed, so there are no untimely interruptions when you are streaming media or engaging in an important video conference over the Internet. Wireless Storage Get a wifi router with built-in wireless storage to keep important project files on hand and ready to send over the Internet. Having backup copies of your files on your wifi router protects you in the event of hard drive failure. Secure Sending Sending data over wireless routers doesn't need to be nerve-wracking when you have a secure system that encrypts everything before you send it. You can also install a firewall to keep your data protected and prevent unauthorized network access. The best Linksys routers and top models from all the other big brands are available now at Staples. Purchase one today and get your wireless network optimally configured for your touch screen laptop or standard laptop model.", "parent_text": "Networking", "keyword_density": {"routers": "3.0"}, "department_id": 9}
