{"department_text": "PCs | Drives | Accessories", "nr_products": 14, "level": -2, "url": "http://www.staples.com/Mobile-Mice/cat_CL142838", "text": "Mobile Mice", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Mobile Mice", "parent_url": "http://www.staples.com/Mice-Wacom-Tablets-Mouse-Pads/cat_DP1925", "keyword_count": {"mobile": 4, "mobile mice": 1}, "description_wc": 116, "description_text": "Mobile mice provide a great solution for ergonomics and convenience when you take your laptop on the go. Choose from our wide range of wired and wireless mobile mouse options to suit every type of user. 1. BlueTrack Technology: For bluetooth and optical technology at its very best, try Microsoft\u2019s laser-precise BlueTrack Technology. 2. Universally compatible USB-transceivers: Easy storage for transport and even easier plugin for instant mouse usage. 3. Long battery life: Equipped with on-off switches so you can save battery life and money at the same time. 4. Your favorite brands: Staples, Logitech, Microsoft and Targus. Go mobile without losing the convenience of your office. Try a mobile mouse today.", "parent_text": "Mice/Wacom Tablets/Mouse Pads", "keyword_density": {"mobile": "3.4", "mobile mice": "1.7"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 259, "level": -2, "url": "http://www.staples.com/Mice/cat_CL141985", "text": "Mice", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Mice", "parent_url": "http://www.staples.com/Mice-Wacom-Tablets-Mouse-Pads/cat_DP1925", "keyword_count": {"mice": 3}, "description_wc": 212, "description_text": "Mice let you precisely control your computer, whether you're using popular applications, surfing the Web, or working on a big presentation. Choose from wired or wireless versions, depending on your personal preferences and how often you do computing on the go. Controlling your cursor has never been easier. Select a top of the line cordless Logitech mouse or another great computer mouse and enjoy the efficiency and ease of use benefits these peripherals provide. Wireless Convenience Wireless mice let you work without getting tangled up in cords and cables. A wireless or cordless mouse can usually be used on a variety of surfaces, so you don't need to carry a mouse pad along with you. Optical Mouse Design An optical mouse gives you smoother operation than a traditional mouse, and it is less likely to break or wear out because there are fewer moving parts. Gaming Device Gaming mice offer unparalleled response time and extra buttons, giving you extra control over everything you do online. Choose an ergonomically designed mouse to keep your hand comfortable during long sessions at the computer. Staples has a great cordless mouse selection, including a large optical & Logitech mouse assortment that is second to none. Shop staples and find the best mouse for your needs.", "parent_text": "Mice/Wacom Tablets/Mouse Pads", "keyword_density": {"mice": "1.4"}, "department_id": 9}
