{"department_text": "PCs | Drives | Accessories", "nr_products": 14, "level": -2, "url": "http://www.staples.com/Wireless-Range-Extenders/cat_CL160118", "text": "Wireless Range Extenders", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Wireless Range Extenders", "parent_url": "http://www.staples.com/Networking-Accessories/cat_DP3941", "keyword_count": {"wireless": 2, "range": 3, "extenders": 2}, "description_wc": 89, "description_text": "Whether you are expanding your office or trying to reach a far corner of your house, you can increase the range of your internet connection for wireless devices with a Netgear or Linksys range extender. Compatible with many brands : Staples network extenders are compatible with popular modem and router brands like Belkin, Linksys, D-Link, 2Wire, EarthLink, and more. Flexible Placement : Wireless extenders allow you to have a wider range of area that you can connect to the internet in allowing you more flexibility in setting up your network.", "parent_text": "Networking Accessories", "keyword_density": {"wireless": "2.2", "range": "3.4", "extenders": "2.2"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Wireless-Display-WiDi-Adapters/cat_CL167335", "text": "Wireless Display (WiDi) Adapters", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Wireless Display (WiDi) Adapters", "parent_url": "http://www.staples.com/Networking-Accessories/cat_DP3941", "keyword_count": {"wireless": 5, "wireless display": 4, "adapters": 4, "display": 5}, "description_wc": 133, "description_text": "Wireless display adapters allow you to display your presentations, videos, or other content right on your TV . Stop crowding everyone around your smartphone or tablet screen and get comfortable. You can even plug the adapter right into your TV's USB port if you don't have an open outlet close by. Compatibility Have just one adapter for all of your Internet-enabled devices. Wireless display adapters work with smartphones, laptops, and tablets. Wireless Convenience Break free from the mess of wires and cables. Wireless display adapters keep you from having to plug your computer directly into the TV, making it easier to watch in comfort. Optimal Video and Audio Wireless display adapters give you clear picture and sound. Show off your content in up to 1080p HD video and surround sound.", "parent_text": "Networking Accessories", "keyword_density": {"wireless": "3.8", "wireless display": "6.1", "adapters": "3.0", "display": "3.8"}, "department_id": 9}
