{"department_text": "PCs | Drives | Accessories", "nr_products": 53, "level": -2, "url": "http://www.staples.com/Networking-Accessories/cat_CL165822", "text": "Networking Accessories", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Networking Accessories", "parent_url": "http://www.staples.com/Networking-Accessories/cat_DP3941", "keyword_count": {"networking accessories": 2}, "description_wc": 165, "description_text": "Wireless networking accessories help you stay in control of your electronic devices. WeMo switches let you turn your electronics off or on from a remote location. Setup is easy, and all you have to do is plug the switch into any regular 120 V outlet to get started. Control Your Electronics Turn off your electronic devices remotely from your iPod Touch, iPhone, or iPad. Just download the free WeMo app to get started. Reduce Energy Consumption Keep your carbon footprint and electric costs low by ensuring that your electronics, including your TV, gaming system, or space heater, are only using power when you want them to. WeMo switches work with your existing Wi-Fi connection and Internet-enabled devices to keep you in control, whether you are at home or away on business. Antennas Use a multiband antenna for added flexibility. These wireless networking accessories feature a swivel-mount design, allowing for 180-degree movement, so you can get the perfect placement for your workspace.", "parent_text": "Networking Accessories", "keyword_density": {"networking accessories": "2.4"}, "department_id": 9}
