{"department_text": "PCs | Drives | Accessories", "nr_products": 468, "level": -2, "url": "http://www.staples.com/Switches/cat_CL165750", "text": "Switches", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Switches", "parent_url": "http://www.staples.com/Networking-Accessories/cat_DP3941", "keyword_count": {"switches": 1}, "description_wc": 99, "description_text": "Set up a high-speed network between multiple internet-capable devices with a desktop Ethernet switch. Staples offers quality networking products to expand your home or office network with brands like Linksys, Netgear, and Cisco. Connect virtually any device : Connect your internet with virtually any device with a wire like game consoles, printers, computers and laptops. Works with multiple platforms : Access the internet with an Ethernet switch on both Macintosh and Windows platforms. Choose the ports that fit your needs : We carry network switches to accommodate all network management types with as little as 5 up to 48 ports.", "parent_text": "Networking Accessories", "keyword_density": {"switches": "1.0"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 44, "level": -2, "url": "http://www.staples.com/Powerline-Adapters-Kits/cat_CL165774", "text": "Powerline Adapters & Kits", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Powerline Adapters & Kits", "parent_url": "http://www.staples.com/Networking-Accessories/cat_DP3941", "keyword_count": {"powerline": 4, "adapters": 2}, "description_wc": 96, "description_text": "Powerline network adapters provide high speed and powerful internet for online gaming or streaming 1080 HD video to your TV. With brands like Netgear, Western Digital, and Linksys, Staples has the powerline speed that you need for your home or office. Wireless capability : Select powerline networking adapters come with wireless capability for convenience and flexibility. Gigabit-fast wired connections : For the most bandwidth-taxing activities, get powerline speeds up to 500 Mbps. Simple setup : With an easy plug-and-play setup, you can connect to the internet and run the most demanding applications in no time.", "parent_text": "Networking Accessories", "keyword_density": {"powerline": "4.2", "adapters": "2.1"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 36, "level": -2, "url": "http://www.staples.com/Corded-Mice/cat_CL141984", "text": "Corded Mice", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Corded Mice", "parent_url": "http://www.staples.com/Mice-Wacom-Tablets-Mouse-Pads/cat_DP1925", "keyword_count": {"corded": 6, "corded mice": 4}, "description_wc": 128, "description_text": "Corded mice come in a variety of shapes and styles. If you\u2019re looking for a computer mouse with the quickest response time and best precision, a corded mouse is a great solution. 1. No battery recharge: With corded mice, you will always be ready to go. 2. Great for gaming: Laser and optical precision at optimal speeds for fast-paced computer games. 3. Built for either hand: No matter what your dominant hand, we carry a corded mouse that will work for you. 4. The best brands: From Logitech to Microsoft, we carry the most trusted names in corded mice. 5. On-board memory for multiple profiles. Whether you\u2019re a high-level gamer or just love that classic feel, try one of our corded mice today.", "parent_text": "Mice/Wacom Tablets/Mouse Pads", "keyword_density": {"corded": "4.7", "corded mice": "6.2"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 64, "level": -2, "url": "http://www.staples.com/Wireless-Adapters/cat_CL165749", "text": "Wireless Adapters", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Wireless Adapters", "parent_url": "http://www.staples.com/Networking-Accessories/cat_DP3941", "keyword_count": {"wireless": 9, "wireless adapters": 3}, "description_wc": 171, "description_text": "Wireless adapters are a simple way to get connected to the Internet when your device or wireless network doesn't have an internal Wi-Fi card. They can be internal, which requires opening up your computer to install a card, or external, which involves plugging the adapter into an external port. For high-speed transfer that isn't over a wireless connection, try a Thunderbolt adapter. USB Compatible Plug-and-play wireless adapters plug into your handy USB port on the side of your computer and connect instantly. To connect your home or office to wireless service, add a router to your wireless networking setup as well. Secure Streaming Whether you're streaming a movie or surfing the Web, a wireless adapter lets you do so securely. You can password-protect your device to make sure unauthorized users are shut out. Fast Transfers Wireless adapters let you transfer information quickly, so you don't have to worry about delays and interruptions. They are the perfect accessory for your wireless networking needs.", "parent_text": "Networking Accessories", "keyword_density": {"wireless": "5.3", "wireless adapters": "3.5"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 180, "level": -2, "url": "http://www.staples.com/Wireless-Access-Points/cat_CL165751", "text": "Wireless Access Points", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Wireless Access Points", "parent_url": "http://www.staples.com/Networking-Accessories/cat_DP3941", "keyword_count": {"access": 5, "wireless": 6, "wireless access points": 1, "access points": 2, "wireless access": 2}, "description_wc": 87, "description_text": "Connect your wire internet connection to a wireless access point for internet connection across multiple devices in your home or office. Staples has top dual band and wireless n access points from brands like Linksys and Netgear. Set up wifi access point : Turn any wire internet connection into a wifi hotspot for anyone to access. Wireless N speeds : Connect to the internet at maximum speeds with wireless-n technology Dual band technology : Dual band wireless access points provide excellent wireless internet range for large offices or homes.", "parent_text": "Networking Accessories", "keyword_density": {"access": "5.7", "wireless": "6.9", "wireless access points": "3.4", "access points": "4.6", "wireless access": "4.6"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "level": -1, "url": "http://www.staples.com/Screen-Filters-Protectors/cat_DP1590", "text": "Screen Filters/Protectors", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Screen Filters/Protectors", "parent_url": "http://www.staples.com/Monitors-Digital-Projectors/cat_CG4", "keyword_count": {"screen": 10, "filters": 1, "protectors": 2}, "description_wc": 134, "description_text": "Guard your computer screen against nicks, stains and radiation with a screen protector from 3M or Fellowes. Our screen protectors are multi-functional and of the highest quality. For further ideas about screen protection and more, please visit our research centers. Private browsing in public settings : Whether you\u2019re on an airplane or at your desk, keep your screen private with a laptop privacy screen or computer privacy filter. Find your fit : Our monitor filters come in multiple-sizes and are suitable for a range of Mac and PC screens, including laptop, widescreen, LCD and flat frame. Superior protection : Choose from a variety of computer screen protectors that are not just anti-dust but are also anti-glare, anti-static and anti-radiation. Try a screen filter today for a private, protected browsing experience.", "parent_text": "Computer Monitors / Screen Filters", "keyword_density": {"screen": "7.5", "filters": "0.7", "protectors": "1.5"}, "department_id": 9}
