{"department_text": "PCs | Drives | Accessories", "nr_products": 69, "level": -1, "url": "http://www.staples.com/Monitor-Stands-Risers/cat_CL141470", "text": "Monitor Stands/Risers", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Monitor Stands/Risers", "parent_url": "http://www.staples.com/Monitors-Digital-Projectors/cat_CG4", "keyword_count": {"risers": 1, "monitor stands": 2, "monitor": 9, "stands": 3}, "description_wc": 121, "description_text": "Raise your monitor to the proper height with a monitor stand and stop straining to see your screen. Find your favorite brands, including Fellowes, Ergotech and Doublesight. For more information, please visit our research centers. Ergonomic viewing : Try an adjustable monitor stand or computer riser with vertical, tilt and swivel functions to lift and adjust your monitor into the most comfortable position. Accommodate all of your monitors : With dual and triple arms, support all of your monitors at once. Computer monitor stands have a high weight capacity. Maximize workspace : Browse our customizable corner and platform computer stands and monitor risers to get the most out of your workspace. Your flexible workspace is just around the corner. Browse our monitor stands today.", "parent_text": "Computer Monitors / Screen Filters", "keyword_density": {"risers": "0.8", "monitor stands": "3.3", "monitor": "7.4", "stands": "2.5"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 82, "level": -1, "url": "http://www.staples.com/Monitor-Arms/cat_CL141469", "text": "Monitor Arms", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Monitor Arms", "parent_url": "http://www.staples.com/Monitors-Digital-Projectors/cat_CG4", "keyword_count": {"monitor arms": 4, "monitor": 8, "arms": 5}, "description_wc": 139, "description_text": "For more flexible monitor viewing, browse our selection of monitor arms. Our products are easy to install and adjust to you so you don\u2019t have to adjust to them. For more information, please visit our research centers. Flexibility for all of your monitors : Try one of our quad, triple or dual monitor arms to easily set up and adjust your work station. A range of motions : Our computer monitor arms can swivel, tilt and pivot and are also vertically adjustable. Customize the position of your screen throughout your work day. Clear space : Computer arms and arm mounts raise your monitor off your desk, leaving room for other essentials. Choose from suction cups or clamps for easy and secure attachment to your desk. With adjustable monitor arms from top brands like Ergotech and Doublesight, keep your monitor in sight.", "parent_text": "Computer Monitors / Screen Filters", "keyword_density": {"monitor arms": "5.8", "monitor": "5.8", "arms": "3.6"}, "department_id": 9}
