{"department_text": "PCs | Drives | Accessories", "level": -1, "url": "http://www.staples.com/Media-Disc-Labels/cat_DP1519", "text": "DVD/CD Labels, Inserts & Applicators", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "DVD/CD Labels, Inserts & Applicators", "parent_url": "http://www.staples.com/CD-DVD-Blu-Ray-Burners-Media/cat_CG1039", "keyword_count": {"inserts": 4, "dvd": 4, "labels": 5, "cd": 6, "dvd cd labels": 1, "applicators": 2}, "description_wc": 182, "description_text": "Use DVD & CD labels , CD inserts , and applicators on all of your media whether you intend to store data securely or create copies to give away. From internal videos made for employees to purchase manuals on CD, every piece of media your office creates can benefit from proper labeling. Using both stick-on labels and inserts lets you brand each piece of media as well as its case. Easy-to-Use Software Label creation software lets you design your labels to look just the way you want. Import images or create your own to give your CDs, DVDs, and media cases eye-catching appeal. Convenient Inserts Inserts fit into any slim jewel case to make your CDs and DVDs look more professional. Included templates make it easy to create your layout before you print. Applicator Technology Applicators let you precisely center your CD or DVD labels when you put them on so that you aren't left with off-center or asymmetric labels. They're quick and easy to use, helping to reduce the time you spend labeling your media.", "parent_text": "CD / DVD / Blu-Ray Burners & Media", "keyword_density": {"inserts": "2.2", "dvd": "2.2", "labels": "2.8", "cd": "3.3", "dvd cd labels": "1.7", "applicators": "1.1"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 46, "level": -1, "url": "http://www.staples.com/CD-DVD-Burners-Drives/cat_CL142594", "text": "CD / DVD Burners & Drives", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "CD / DVD Burners & Drives", "parent_url": "http://www.staples.com/CD-DVD-Blu-Ray-Burners-Media/cat_CG1039", "keyword_count": {"dvd": 7, "drives": 1, "cd": 2}, "description_wc": 116, "description_text": "Back up or copy your movies, photos, music and other digital data with a DVD drive from Staples.com. Our DVD duplication technology is fast, reliable, economical and efficient. For more information, check out our research center. Just a few great features of our DVD drives: Copy multiple DVDs at once Choose a DVD drive that stands alone or can connect to a Mac or PC Burn CDs to share your photos or music Only the best brands in stock, including Memorex, Microboards Technology and Velocity Micro in stock Whether you\u2019re burning a CD for a coworker or backing up your hard drive on DVDs, we\u2019ve got a DVD drive that\u2019s right for you.", "parent_text": "CD / DVD / Blu-Ray Burners & Media", "keyword_density": {"dvd": "6.0", "drives": "0.9", "cd": "1.7"}, "department_id": 9}
