{"department_text": "PCs | Drives | Accessories", "nr_products": 256, "level": -1, "url": "http://www.staples.com/SD-Memory-Cards/cat_CL142162", "text": "Flash Memory Cards", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Flash Memory Cards", "parent_url": "http://www.staples.com/Flash-Memory-Cards-Readers/cat_CG1125", "keyword_count": {"cards": 9, "memory": 6, "flash": 6, "flash memory cards": 4, "flash memory": 5}, "description_wc": 145, "description_text": "Flash Memory & SD Cards help keep your mobile phone, digital camera and camcorder up to speed and ready to go. Having the right SD card you need for your cameras, mobile phones and other digital devices is a necessity, not a luxury. Shop our wide selection of flash memory cards to find a flexible, reliable solution that works for you. Today's cameras, tablets, smart phones and camcorders require the latest generation of flash memory cards. Staples carries the form factors you need for any device, including SD cards, Compact Flash cards, Memory Sticks and Micro SD cards. Find the flash memory cards you need from brands you trust. Staples offers flash memory cards from SanDisk, PNY, Kingston, Lexar, Transcend and Verbatim. Cards from SanDisk, PNY, Kingston, Lexar and Verbatim are quality tested for reliable and optimal performance and are quaranteed to meet your needs.", "parent_text": "Flash Memory Cards & Readers", "keyword_density": {"cards": "6.2", "flash memory": "6.9", "flash": "4.1", "flash memory cards": "8.3", "memory": "4.1"}, "department_id": 9}
