{"department_text": "PCs | Drives | Accessories", "nr_products": 38, "level": -1, "url": "http://www.staples.com/Laptop-Cooling/cat_CL142670", "text": "Laptop Cooling", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Laptop Cooling", "parent_url": "http://www.staples.com/Computer-Parts-Components/cat_CG1272", "keyword_count": {"laptop": 8, "cooling": 5, "laptop cooling": 2}, "description_wc": 145, "description_text": "Prevent laptop overheating with a laptop cooling system from leading brands such as Targus, Antec and Logitech. Our sleek and sturdy notebook coolers are as portable as your laptop. Ergonomic laptop use : Cushioned mats and slim designs prevent the wrist and eye strain so commonly associated with laptop use. For a fun extra, choose a computer cooler with built-in speakers and experience a fuller sound while on the go. Shield your skin from heat : Try a lapdesk, cooling pad or cooling base for better heat shielding. Alternatively, take your pick of laptop coolers with built-in a laptop fan cooling system to pull heat away. Protect furniture : Try the Targus Chill mat with fans to pull away heat and protect furniture from burns. Laptop cooling systems are a sure way to ensure the longevity of your notebook and prevent discomfort. Browse our selection today.", "parent_text": "Computer Parts / Components", "keyword_density": {"laptop": "5.5", "cooling": "3.4", "laptop cooling": "2.8"}, "department_id": 9}
