{"department_text": "PCs | Drives | Accessories", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Zip-Audio-Video-Diskette-Labels/cat_CL141020", "text": "Audio-Video-Diskette-Zip", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Audio-Video-Diskette-Zip", "parent_url": "http://www.staples.com/Media-Disc-Labels/cat_DP1519", "keyword_count": {"audio video diskette": 3, "video": 5, "diskette": 5, "zip": 3}, "description_wc": 201, "description_text": "Whether you're recording a special event on videotape or storing data on diskettes, audio, video, diskette, and zip storage media labels are the way to neatly note basic identifying information on items' exteriors for easy cataloging and filing. Avery laser labels for videotapes and for 3.5- and 5.25-size diskettes turn generic media storage items into products with a customized labels so that you can prepare these items for sale to customers. This label category provides the tools you need to properly manage your media library. Easy Customization Audio, video, diskette, and zip storage media labels make it easy to identify and package recorded projects. With these bright-white labels and a laser printer, you'll have everything you need to customize each media storage item. Preset Formatting Special layouts in popular software programs make it easy to prepare audio, video, diskette, and zip storage media labels. The proper dimensions for running full sheets of labels are preset, so all you have to do is type and print. Automatic Label Feeding Label sheets fit in letter-size paper trays, so you can easily print a large quantity of labels automatically. These quality labels won't get stuck in your printer.", "parent_text": "DVD/CD Labels, Inserts & Applicators", "keyword_density": {"audio video diskette": "4.5", "video": "2.5", "diskette": "2.5", "zip": "1.5"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 2, "level": -2, "url": "http://www.staples.com/DVD-CD-Applicators/cat_CL159597", "text": "DVD / CD Applicators", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "DVD / CD Applicators", "parent_url": "http://www.staples.com/Media-Disc-Labels/cat_DP1519", "keyword_count": {"dvd": 5, "cd": 5}, "description_wc": 162, "description_text": "Use a CD and DVD label applicator to quickly and efficiently label your media. Use premade labels or design your own with convenient label-making software. Make your labels as simple or elaborate as you want; then apply them to multiple CDs or DVDs as needed. Quick Application Apply CD/DVD labels in seconds with a label applicator and free up your time to concentrate on other things. Increase your efficiency and label multiple pieces of media without having to hand-center each one. Eye-Catching Symmetry When you use a CD and DVD label applicator, you can rest assured that your labels will be applied symmetrically. Your labels will look standardized, giving a better impression to clients, customers, and employees. Label Kits Increase your productivity with a label applicator kit that includes labels, jewel cases, and software. With a kit, you'll have everything you need to produce professional-looking CDs and DVDs for in-office, retail sale, and giveaway purposes.", "parent_text": "DVD/CD Labels, Inserts & Applicators", "keyword_density": {"dvd": "3.1", "cd": "3.1"}, "department_id": 9}
