{"department_text": "PCs | Drives | Accessories", "nr_products": 6, "level": -2, "url": "http://www.staples.com/DVD-CD-Inserts/cat_CL159596", "text": "DVD / CD Inserts", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "DVD / CD Inserts", "parent_url": "http://www.staples.com/Media-Disc-Labels/cat_DP1519", "keyword_count": {"inserts": 7, "cd": 4, "dvd": 4}, "description_wc": 185, "description_text": "Impress clients with CD and DVD case inserts that create a customized display for disks. Provide easy access to information such as titles and disk content by printing the details on each insert. You can also take printing to the next level with vibrant logos and company images. Universal Case Inserts When you frequently store business records, presentations, and marketing content on CDs and DVDs, printable inserts allow you to give your disk cases a professional, personalized finish. Brands like Memorex offer standard sizing for double-window and jewel case inserts. You Choose the Design Your design options are unlimited with CD and DVD case inserts you can create and print at home or on the job. Their white surfaces are compatible with both black and color inks, giving you the flexibility to generate simple or complex layouts with bright images and edge-to-edge printing. Simple Formatting Easily design the perfect layout with inserts that work well with a range of publishing software. Choose CD and DVD case inserts from well-known brands like Avery that provide downloadable templates to simplify the formatting process.", "parent_text": "DVD/CD Labels, Inserts & Applicators", "keyword_density": {"inserts": "3.8", "dvd": "2.2", "cd": "2.2"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 1, "level": -2, "url": "http://www.staples.com/DVD-CD-Labeling-Software/cat_CL159598", "text": "DVD / CD Labeling Software", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "DVD / CD Labeling Software", "parent_url": "http://www.staples.com/Media-Disc-Labels/cat_DP1519", "keyword_count": {"dvd": 6, "labeling software": 3, "cd": 5}, "description_wc": 197, "description_text": "CD and DVD labeling software provides the tools you need to customize your authored disks. Adhesive labels stick securely to disk surfaces, while printed inserts fit neatly inside standard CD and DVD cases. Add playlists and titles to your printouts to give your business media a finished look. Multiformat Label Creation Finalize your media projects in style with CD and DVD labeling software you can use to design jewel case inserts, disk labels, and DVD case inserts. Make sure clients always recognize your company media with logos, fonts, and colors that represent your business. Once you finish the layout, save time and money by printing your own client-ready materials. Import Text and Images CD and DVD labeling software kits from brands like Memorex provide an extensive database of images and media playlists for designing professional-quality labels and protective cases. Opt for customization by uploading your own images and text to categorize and market your content. Helpful Application Features Secure adhesive disk labels without difficulty by using easy applicator tools that keep the printouts centered and that prevent curling. Your printed case inserts will slide smoothly into CD and DVD cases, making them presentable in seconds.", "parent_text": "DVD/CD Labels, Inserts & Applicators", "keyword_density": {"dvd": "3.0", "labeling software": "3.0", "cd": "2.5"}, "department_id": 9}
{"level": 0, "url": "http://www.staples.com/Binders-Pocket-Folders-Report-Covers/cat_CG2860", "text": "Binders / Pocket Folders / Report Covers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/Office-Supplies/cat_SC1", "parent_text": "Office Supplies", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "PCs | Drives | Accessories", "nr_products": 17, "level": -2, "url": "http://www.staples.com/DVD-CD-Labels/cat_CL140962", "text": "DVD / CD Labels", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "DVD / CD Labels", "parent_url": "http://www.staples.com/Media-Disc-Labels/cat_DP1519", "keyword_count": {"dvd": 8, "labels": 8, "cd": 7}, "description_wc": 178, "description_text": "These CD DVD labels are for use with writeable and rewritable CDs and DVDs. Labels are also compatible with inkjet and laser printers. Stay organized by making custom labels for discs containing music, movies, software, or other data. Maximum Compatibility Avery, Memorex, and Staples CD DVD labels are compatible with writeable and rewritable CD and DVD media, including CD+R, DVD+R, and DVD-RW discs. Keeping your office organized is easy with these customizable labels, which can be used in inkjet and laser printers. Permanent or Removable: Take Your Pick Small business owners know that life can change in an instant. Permanent labels can stand the test of time, while removable CD DVD labels save you time and money by letting you repurpose discs as your business needs change. Improve Marketability These customizable labels can be used to add a professional touch to marketing materials and digital products like audio books. Keep your business at the top of your customers' minds by adding your company's name and logo to the CDs and DVDs you ship out.", "parent_text": "DVD/CD Labels, Inserts & Applicators", "keyword_density": {"dvd": "4.5", "labels": "4.5", "cd": "3.9"}, "department_id": 9}
{"department_text": "Office Supplies", "level": 0, "url": "http://www.staples.com/Calculators/cat_DP900", "text": "Calculators", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Calculators", "parent_url": "http://www.staples.com/Office-Supplies/cat_SC1", "keyword_count": {"calculators": 1}, "description_wc": 33, "description_text": "Calculators are a necessity for any student, business owner and really most anyone, and Staples carries the best selling models from brands you trust like Texas Instruments, Canon, Sharp, HP, Casio and Staples.", "parent_text": "Office Supplies", "keyword_density": {"calculators": "3.0"}, "department_id": 30}
{"department_text": "Office Supplies", "level": 0, "url": "http://www.staples.com/Clips-Tacks-Rubber-Bands/cat_CG1036", "text": "Clips / Tacks / Rubber Bands", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Clips / Tacks / Rubber Bands", "parent_url": "http://www.staples.com/Office-Supplies/cat_SC1", "keyword_count": {"clips": 3, "tacks": 2}, "description_wc": 79, "description_text": "At Staples\u00ae, we have a wide assortment of business accessories that are essential to keeping your business organized. Choose from our selection of paper clips to keep important documents together. Or, browse through our large assortment of binder clips in multiple sizes to clamp together small to large stacks of paper. Also keep your wall space organized whether you are in a cubicle or work at home by checking out our specialty clips, pins & tacks, and magnetic accessories.", "parent_text": "Office Supplies", "keyword_density": {"clips": "3.8", "tacks": "2.6"}, "department_id": 30}
{"department_text": "Office Supplies", "level": 0, "url": "http://www.staples.com/Storage-Boxes-Bins-Cabinets/cat_CG1077", "text": "Storage / Boxes / Bins / Cabinets", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Storage / Boxes / Bins / Cabinets", "parent_url": "http://www.staples.com/Office-Supplies/cat_SC1", "keyword_count": {"storage": 4, "storage boxes": 2, "bins": 1}, "description_wc": 88, "description_text": "Looking for economic and organized ways to store and protect your documents, files and valuable items in safe storage boxes and file drawers? Whether you need to keep your personal papers protected from water damage and dust, or want a place to safely store keepsakes, seasonal decor or craft items, Staples has what you are looking for. Browse our large selection of storage boxes, storage containers, plastic storage bins, totes and crates, coming in a variety of shapes, sizes and materials to organize your home or office space.", "parent_text": "Office Supplies", "keyword_density": {"storage": "4.5", "storage boxes": "4.5", "bins": "1.1"}, "department_id": 30}
{"department_text": "Office Supplies", "level": 0, "url": "http://www.staples.com/Dividers-Tabs-Fasteners-Inserts/cat_CG1262", "text": "Dividers / Tabs / Fasteners / Inserts", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Dividers / Tabs / Fasteners / Inserts", "parent_url": "http://www.staples.com/Office-Supplies/cat_SC1", "keyword_count": {"fasteners": 1, "dividers tabs": 1}, "description_wc": 18, "description_text": "We have all the dividers, tabs and fasteners you need to keep that office organized and running smoothly.", "parent_text": "Office Supplies", "keyword_density": {"fasteners": "5.6", "dividers tabs": "11.1"}, "department_id": 30}
