{"department_text": "Office Supplies", "level": 0, "url": "http://www.staples.com/Envelopes/cat_CG23", "text": "Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Envelopes", "parent_url": "http://www.staples.com/Office-Supplies/cat_SC1", "keyword_count": {"envelopes": 2}, "description_wc": 165, "description_text": "Envelopes are simply essential for all households and offices, regardless of personal details or preferences. Whether you are mailing invoices or personal letters, be sure you always have a sized envelope or two (or more!) on hand for any office or home need. Staples has the widest high quality selection available and the best prices as well. Choose from a selection of gummed, self-sealing, strip removal, clasped closure and custom envelopes , as well as a wide assortment of additional varieties. You will find popular names including Quality Park, Ampad, Tyvek and Staples\u2019 own brand in an assortment of colors and front window styles. There are also a variety of envelope sizes, styles and materials available including, padded, security tinted, single-window, double-window, as well as 4x6 and 5x7 sizes. Explore our assortment and save time and money selecting the ideal fit for your needs from our best-in-class selection, and we also have you covered if you need a letter opener !", "parent_text": "Office Supplies", "keyword_density": {"envelopes": "1.2"}, "department_id": 30}
{"department_text": "Office Supplies", "level": 0, "url": "http://www.staples.com/Pens-Pencils-Markers/cat_CG11", "text": "Pens / Pencils / Markers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Pens / Pencils / Markers", "parent_url": "http://www.staples.com/Office-Supplies/cat_SC1", "keyword_count": {"pens": 3}, "description_wc": 149, "description_text": "No matter what thought you\u2019re trying to capture, it\u2019s important to have a writing tool that\u2019s perfect for the job. Whether you\u2019re writing a grocery list, jotting down your next big business idea or taking notes during a meeting or class, Staples has a solution for you. Pens for every job : Choose a ballpoint pen that gets the job done, a gel pen that glides across the page, a rollerball pen for writing clean, precise lines or art and felt tipped pens for your next brilliant creation. The top names in writing tools : BIC, uni-ball, Pilot and Sharpie. A variety of options : Spice those notes up with pens of every shape, size and color. Highlight information : Make the most important ideas pop off the page with liquid, pen-style or tank-style highlighters. At Staples, we have writing tools to suit your every need!", "parent_text": "Office Supplies", "keyword_density": {"pens": "2.0"}, "department_id": 30}
{"department_text": "Office Supplies", "level": 0, "url": "http://www.staples.com/Notebooks-Notepads/cat_CG1234", "text": "Notebooks / Notepads", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Notebooks / Notepads", "parent_url": "http://www.staples.com/Office-Supplies/cat_SC1", "keyword_count": {"notepads": 2, "notebooks": 2}, "description_wc": 116, "description_text": "Still love the weight and feel of a paper notebook? So do we. That\u2019s why we\u2019ve stocked our shelves with only the best notebooks , notepads memo and columnar pads, and filler paper so you can record your every thought. Full Color Palette - Our notebooks come in many colors, shapes and sizes. Sturdy Design - Choose a durable spiral notebook for your every day needs, or a customizable leather notebook for that big client meeting. Be Eco-Friendly - With the brand Sustainable Earth by Staples \u00ae notepads, you can refill in style and keep the environment in mind. Our thick, sturdy paper comes both lined and blank, and is always ready to go. Just like you.", "parent_text": "Office Supplies", "keyword_density": {"notepads": "1.7", "notebooks": "1.7"}, "department_id": 30}
{"department_text": "Office Supplies", "level": 0, "url": "http://www.staples.com/Paper/cat_CG10", "text": "Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Paper", "parent_url": "http://www.staples.com/Office-Supplies/cat_SC1", "keyword_count": {"paper": 9}, "description_wc": 164, "description_text": "It\u2019s important to have the right supplies on hand for all your paper needs, and Staples has you covered with its large selection of products and brands, including Hammermill, HP and Xerox. In addition to printer, colored, and photo papers, you\u2019ll also find diverse products like awards and certificates, wide format printing paper, and high-quality specialty finishes. Dependable Quality \u2013 From the most economical copy paper to the most elegant r\u00e9sum\u00e9 options, Staples paper is always a reliable choice. Options for Every Application - Staples offers specialized paper for any project, including waterproof, register roll, and professional-grade photo selections. Environmentally Friendly - High-quality recycled and FSC-certified paper is readily available, as well as acid-free archival options. Staples has the variety and excellence that you\u2019re looking for; with us, you\u2019ll always find the what you need at the right price. Check out our impressive selections of all paper types, including large quantity, brochure, carbonless and graph paper .", "parent_text": "Office Supplies", "keyword_density": {"paper": "5.5"}, "department_id": 30}
{"department_text": "Office Supplies", "level": 0, "url": "http://www.staples.com/File-Folders-Jackets-Pockets/cat_CG15", "text": "File Folders / Jackets / Pockets", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "File Folders / Jackets / Pockets", "parent_url": "http://www.staples.com/Office-Supplies/cat_SC1", "keyword_count": {"folders": 5, "jackets": 1, "file": 10, "file folders": 4}, "description_wc": 170, "description_text": "When finding ways to keep and stay organized in the workplace, using the right filing system and filing products are the key to success. File Folders are a necessity and Staples has every type of file folder you need. Top Tab file folders are useful for organizing your important documents. Label your folders for easy retrieval and use colored file folders for sorting your documents into groups. Hanging file folders are useful for keeping track of files and documents that need to be in alphabetical order and can be easily adjusted as your needs change. File jackets and sorters are good for keeping track of specific groupings and categories of paperwork, documents, or contracts. They also secure documents for portability. Expanding files and wallets are a compact way to store and keep important documents and projects in a single place and easily accessible. Organize and transport larger projects in durable expanding files and wallets. For more peace of mind, choose an expanding file with a flap to secure your documents.", "parent_text": "Office Supplies", "keyword_density": {"folders": "2.9", "file": "5.9", "jackets": "0.6", "file folders": "4.7"}, "department_id": 30}
