{"department_text": "Office Supplies", "nr_products": 1, "level": -1, "url": "http://www.staples.com/Pocket-Portfolios-Poly/cat_CL162168", "text": "Pocket Portfolios - Poly", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Pocket Portfolios - Poly", "parent_url": "http://www.staples.com/Binders-Pocket-Folders-Report-Covers/cat_CG2860", "keyword_count": {"pocket": 3, "portfolios": 1, "poly": 5}, "description_wc": 130, "description_text": "Get that professional look with poly folders, from Staples. Whether you\u2019re assembling your portfolio or you need an elegant look for your business meetings, our poly pocket folders are just what you seek. Browse our Learning Center for more information. A Range of Functions : Store your business cards right next to loose sheets of papers and a notepad. Most poly portfolios can hold up to 50 sheets of paper between their two convenient pockets. Choose Your Design : Our 2 pocket poly folders come both with and without prongs for hole punched paper as well as in a range of sizes and colors, including black, red, blue and burgundy. Best Brands : Including Staples, Storex and Wilson Jones. Our poly folders will get you organized and looking great in no time.", "parent_text": "Binders / Pocket Folders / Report Covers", "keyword_density": {"pocket": "2.3", "portfolios": "0.8", "poly": "3.8"}, "department_id": 30}
