{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/File-Folder-Labels/cat_DP4957", "text": "File Folder Labels", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "File Folder Labels", "parent_url": "http://www.staples.com/File-Folders-Jackets-Pockets/cat_CG15", "keyword_count": {"folder": 4, "labels": 7, "folder labels": 2, "file folder labels": 1, "file": 2}, "description_wc": 111, "description_text": "Keeping your open shelf filing system organized is made easy with end tab file folder labels to segment and categorize documentation. Color-code end tab folders by date using month and year labels. Use them to indicate when a file was created or last updated, or to signal when it should be destroyed or moved to inactive storage. Staples carries the folder labels you need from brands like Smead and Ames. Use Alphabetical color coded labels for keeping track of patient or client records and paperwork. Label protectors protect the labels on your frequently handled folders. Numeric labels, alphabetic and year labels allow you to create the filing system you need.", "parent_text": "File Folders / Jackets / Pockets", "keyword_density": {"folder": "3.6", "labels": "6.3", "folder labels": "3.6", "file folder labels": "2.7", "file": "1.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 14, "level": -1, "url": "http://www.staples.com/Magnetic-Accessories/cat_CL142825", "text": "Magnetic Accessories", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Magnetic Accessories", "parent_url": "http://www.staples.com/Clips-Tacks-Rubber-Bands/cat_CG1036", "keyword_count": {"magnetic accessories": 1, "magnetic": 5}, "description_wc": 60, "description_text": "Staples\u00ae offers a variety of magnetic accessories from quality vendors, such as Quartet\u00ae, Staples\u00ae, and Magna Visual. Choose from our assortment of magnetic push pins, heavy-duty magnets, magnetic strips, and magnetic tape. Whether you need to hang reminders on your whiteboard, or hang a picture on the refrigerator, Staples\u00ae has you covered for all your magnetic needs.", "parent_text": "Clips / Tacks / Rubber Bands", "keyword_density": {"magnetic accessories": "3.4", "magnetic": "8.6"}, "department_id": 30}
