{"department_text": "TV | Home Entertainment", "nr_products": 268, "level": -2, "url": "http://www.staples.com/PC-Games/cat_CL165725", "text": "PC Games", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "PC Games", "parent_url": "http://www.staples.com/Games/cat_DP5269", "keyword_count": {"pc games": 5, "games": 11}, "description_wc": 145, "description_text": "Enjoy hours of computer entertainment with our wide selection of top PC games. At Staples, you\u2019ll find computer games for gamers of all ages and gaming interests. With an assortment of titles in every category, it\u2019s easy to find the best PC games for you and your family. Consider the following when shopping for PC games at Staples: Leading Brands \u2013 With new PC games from Disney Interactive, Warner Home Video, and EA Games, we make it easy to find age-appropriate entertainment. Wide Variety \u2013 From digital board games to multi-player strategy games, our selection includes a wide variety of family-friendly options. Latest Titles \u2013 We keep our inventory up to date with the latest editions of your favorite games. Staples offers great value for the top PC games. Browse our selection of popular titles to find the games you\u2019re looking for.", "parent_text": "Games", "keyword_density": {"pc games": "6.9", "games": "7.6"}, "department_id": 13}
{"department_text": "Office Supplies", "nr_products": 15, "level": -1, "url": "http://www.staples.com/M-by-Staples-Arc-Notebook-System/cat_CL165557", "text": "M by Staples\u2122 Arc Notebook System", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "M by Staples\u2122 Arc Notebook System", "parent_url": "http://www.staples.com/Notebooks-Notepads/cat_CG1234", "keyword_count": {"arc": 1, "notebook": 4, "m": 7}, "description_wc": 68, "description_text": "Arc Customizable Notebooks are perfect for keeping your important documents, notes, and paperwork organized. Pick from a variety of notebooks and notebook accessories like hole punches, tab dividers, and zip pockets. Choose between notebook materials like leather for durability and poly for flexibility. Create custom organization with tab dividers, page flags, and task pads. Keep track of paperwork and business cards in the same place you take notes.", "parent_text": "Notebooks / Notepads", "keyword_density": {"arc": "1.5", "m": "10.3", "notebook": "5.9"}, "department_id": 30}
