{"department_text": "Office Supplies", "nr_products": 27, "level": -1, "url": "http://www.staples.com/Tax-Envelopes/cat_CL168346", "text": "Tax Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Tax Envelopes", "parent_url": "http://www.staples.com/Envelopes/cat_CG23", "keyword_count": {"tax": 4, "tax envelopes": 2, "envelopes": 6}, "description_wc": 133, "description_text": "Tax envelopes are designed to hold commonly used tax forms. These envelopes can be addressed by hand or put through printer for faster processing. Traditional gummed envelopes are available, or you can use self-sealing options for more convenience and quicker stuffing. Privacy Lining Privacy lined envelopes keep your tax forms safe from prying eyes. Twenty-four pound, white-wove stock adds extra durability to your envelopes. Easy-View Windows Save time and eliminate hand addressing by choosing ones with windows that allow the address to be clearly visible right from the form. Choose from single- or double-window designs, depending on your needs. Strong Adhesive You need your documents to arrive to their destinations intact. The strong adhesive of these tax envelopes ensures they stay shut until the intended recipient opens them.", "parent_text": "Envelopes", "keyword_density": {"tax": "3.0", "tax envelopes": "3.0", "envelopes": "4.5"}, "department_id": 30}
