{"department_text": "Office Supplies", "nr_products": 11, "level": -2, "url": "http://www.staples.com/End-Tab-Filing-Folder-Labels/cat_CL141753", "text": "End Tab Filing Folder Labels", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "End Tab Filing Folder Labels", "parent_url": "http://www.staples.com/File-Folder-Labels/cat_DP4957", "keyword_count": {"end": 8, "end tab": 7, "labels": 8, "folder labels": 3, "tab": 8, "filing": 2}, "description_wc": 198, "description_text": "When you need to adhere to a particular system for patient files or regulatory requirements, end-tab file folder labels can help you set your filing system up right. With alphabetic and numeric labels from brands such as Smead and Ames, it's easy to find the end-tab labels that you need to organize your files. An assortment of label sets is available in this category. Labels that Last These end-tab file folder labels are protected by a clear laminate coating, so the labels will last and won't fade. Use these tabs with a variety of end-tab expanding file pockets to set up your office file system. Multiple Organizing Options End-tab file folder labels are also color-coded, so you have extended options for organizing files. Your file system can use multiple criteria to make it easier to find the documents you need. Convenient Sets Labeling system sets and second letter starters give you the basic end-tab labels that you need to begin organizing your documents and files. Supplement these sets with a bar-style end-tab label box, so you have enough supplies to keep your filing system up to date.", "parent_text": "File Folder Labels", "keyword_density": {"end": "4.0", "end tab": "7.1", "labels": "4.0", "folder labels": "3.0", "tab": "4.0", "filing": "1.0"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 9, "level": -2, "url": "http://www.staples.com/Laundry-Sorters/cat_CL168188", "text": "Laundry Sorters", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Laundry Sorters", "parent_url": "http://www.staples.com/Laundry/cat_DP5307", "keyword_count": {"laundry": 7, "laundry sorters": 4}, "description_wc": 159, "description_text": "Laundry sorters let you put different types of clothing or linens into different sections so you can wash things according to type, helping you get your laundry done more quickly. Manufacturers such as Honey Can Do make different sizes of laundry sorters to suit your normal load capacity. Easy Transport Rolling casters make it easy to move laundry sorters from place to place. This can save you the time that you would have spent hauling each load individually. Versatility in Use Laundry sorters are for more than just dirty clothes. They can also be used to sort and transport clean clothing and linens. Choose from two, three, or four hampers to get the sorting level you need. Aids in Ironing A comprehensive laundry center not only has bins for sorting clothes but also has an ironing board or hanging bars for delicate materials. After the laundry is done, use a garment rack to hang the rest of your clothing.", "parent_text": "Laundry", "keyword_density": {"laundry sorters": "5.0", "laundry": "4.4"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 36, "level": -2, "url": "http://www.staples.com/Hampers/cat_CL168189", "text": "Hampers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Hampers", "parent_url": "http://www.staples.com/Laundry/cat_DP5307", "keyword_count": {"hampers": 10}, "description_wc": 188, "description_text": "Keep your workspace neat and tidy with hampers that let you consolidate laundry in one convenient place. Whether you tend to accumulate towels in the break room or frequently need to launder linens, having laundry hampers nearby is a necessity. Choose from utilitarian models that get the job done or cute hampers that appeal to kids and adults alike. Make Laundry More Convenient Hampers with handles are easy to carry, so you won't drop anything on the way to the laundry facilities. Hampers with multiple compartments let you presort your laundry before you wash it. Remember to keep your laundry room stocked with clothing hangers for use after you clean everything. Maximize Your Space Corner hampers can fit into spaces that other hampers can't. Pop-up hampers and collapsible hampers can be easily stored in a closet or on a shelf when not in use. Aesthetic Appeal Dirty linens, towels, clothing, or other fabric items can clutter up your space, and a hamper can keep these things off the floor and hidden away. Cute hampers designed to look like animals make kids eager to use them.", "parent_text": "Laundry", "keyword_density": {"hampers": "5.3"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 19, "level": -2, "url": "http://www.staples.com/Drying-Racks/cat_CL168190", "text": "Drying Racks", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Drying Racks", "parent_url": "http://www.staples.com/Laundry/cat_DP5307", "keyword_count": {"drying": 4, "racks": 5, "drying racks": 2}, "description_wc": 142, "description_text": "Drying racks come in a variety of sizes and styles to suit your every drying need. Specialty racks include those designed to dry sweaters or underwear. Plastic clothespins keep fabric pieces from slipping as they dry. Handle Industrial Loads When you need to air dry sheets or towels in bulk, opt for a large umbrella or accordion drying rack. Once everything is dry, contoured hangers help you organize the dried clothing or linens. Space-saving Convenience Accordion racks fold for storage when not in use to save you space. You can also opt for a retractable clothesline, which allows you to hang things anywhere you can find two attachment points. Dry Sweaters without Creasing Sweater drying racks let you lay out your sweaters to dry to prevent creasing and stretching. You can also stack sweater racks to dry multiple pieces at once.", "parent_text": "Laundry", "keyword_density": {"drying": "2.8", "racks": "3.5", "drying racks": "2.8"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/File-Frames-Guides/cat_DP1454", "text": "File Frames / Guides", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "File Frames / Guides", "parent_url": "http://www.staples.com/File-Folders-Jackets-Pockets/cat_CG15", "keyword_count": {"file frames": 1, "guides": 4, "file": 2}, "description_wc": 81, "description_text": "When keeping track of important paper work, having an efficient filing system can help you stay organized. Utilize index guides and outguides to quickly locate your documents. We carry a great assortment from Smead and Staples. Find your documents fast with monthly and alphabetized guides. Use outguides to quickly identify folders that are checked out. Set up a file system anywhere you need it, or on your desk or in a drawer using high quality file frames from Pendaflex or Staples.", "parent_text": "File Folders / Jackets / Pockets", "keyword_density": {"file frames": "2.5", "guides": "4.9", "file": "2.5"}, "department_id": 30}
