{"department_text": "Office Supplies", "nr_products": 13, "level": -2, "url": "http://www.staples.com/File-Folder-Tabs-Inserts/cat_CL140621", "text": "File Folder Tabs / Inserts", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "File Folder Tabs / Inserts", "parent_url": "http://www.staples.com/File-Folder-Tabs-Inserts/cat_DP4956", "keyword_count": {"tabs": 5, "inserts": 3, "folder": 3, "file": 6, "file folder tabs": 2}, "description_wc": 166, "description_text": "File folder tabs and inserts organize your hanging and regular files, so paperwork can be dealt with immediately, preventing backlog and office mess. File and find incoming resumes, employee records, and company policies quickly. Whether you want to alphabetize or use your own coding system, we have tabs and inserts to make the job quick and easy. Color-Code Convenience Find the right file at a glance when you use these tabs to color-code your folders. Choose associative colors, like green for financial records, to help you remember what's what. Premium Durability These file folder tabs and inserts are made from high-quality materials so they can last through the rigors of daily use. Gummed tabs add extra convenience when you need to organize on the go. Easy High-Volume Organization If you need to organize a lot of files, we have full labeling systems and refill packs to handle the job. Keep a few sets on hand for a well-stocked supply closet.", "parent_text": "File Folder Tabs / Inserts", "keyword_density": {"tabs": "3.0", "inserts": "1.8", "folder": "1.8", "file folder tabs": "3.6", "file": "3.6"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Medical-Filing-Organization/cat_DP1970", "text": "Medical Filing & Organization", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Medical Filing & Organization", "parent_url": "http://www.staples.com/File-Folders-Jackets-Pockets/cat_CG15", "keyword_count": {"medical filing": 1, "medical": 5}, "description_wc": 91, "description_text": "Medical documentation and paperwork requires specialized products like antimicrobial file folders, medical labels, and x-ray jackets. We have all of the best medical file folders from the top manufacturers; Ames, Smead, Tabbies and Staples brand. Choose from a variety of medical labels for insurance, charts, confidentiality, dates, and more. Specialized documents for x-rays and the preservation of negatives. Pick from different medical filing products like: end-tab file folders, fastener folders, X-Ray and negative folders as well as labels and tabs so you can find your documents fast.", "parent_text": "File Folders / Jackets / Pockets", "keyword_density": {"medical filing": "2.2", "medical": "5.5"}, "department_id": 30}
