{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/End-Tab-Filing-Folders/cat_DP2247", "text": "End Tab File Folders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "End Tab File Folders", "parent_url": "http://www.staples.com/File-Folders-Jackets-Pockets/cat_CG15", "keyword_count": {"folders": 3, "end tab file": 2, "end": 3, "end tab file folders": 1}, "description_wc": 86, "description_text": "If you are looking for a filing solution for your open shelf filing system, then end tab file folders are for you. These folders are created for frequently handled paperwork and are reinforced for durability. Used for a variety of medical and dental documents . End Tab files are HIPPA compliant and perfect for medical records, patient information, and charts. We carry top brands like Smead, Pendaflex, and Staples brand. Antimicrobial folders for health professionals suppress the growth of bacteria and mold, perfect for archival storage.", "parent_text": "File Folders / Jackets / Pockets", "keyword_density": {"folders": "3.5", "end tab file": "7.1", "end": "3.5", "end tab file folders": "4.7"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Classification-Fastener-Folders/cat_DP4739", "text": "Classification / Fastener Folders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Classification / Fastener Folders", "parent_url": "http://www.staples.com/File-Folders-Jackets-Pockets/cat_CG15", "keyword_count": {"folders": 9, "fastener folders": 5, "fastener": 6, "classification": 6}, "description_wc": 193, "description_text": "Classification and fastener folders provide flexibility when you need to sort, transport, or distribute files. Use classification folders to create your own distinct subcategories, and prevent documents from slipping loose with fastener folders. Thanks to the variety of brands available, such as Smead and Staples, you can choose styles ranging from basic manila to reinforced pressboard. Organized Subdivisions Spend less time shuffling through papers with classification and fastener folders that feature interior partitions. Sturdy clasps are attached to the front and back of each surface, providing a secure way to carry your business documents. With pocket-style classification folders, you can insert additional papers into storage dividers to carry them safely. Tabs for Document Filing Tab dividers enable quick sorting and navigation during business meetings or when you're filing documents. Choose top tabs for traditional drawer systems and end-tab fastener folders for open-shelf setups. Tough Construction Staples offers classification and fastener folders for every business setting, whether you need preprinted covers or antimicrobial products for folders frequently circulated throughout the office. Preserve the quality of your supplies with pressboard classification folders that feature reinforced binding and fasteners for extra durability.", "parent_text": "File Folders / Jackets / Pockets", "keyword_density": {"folders": "4.7", "fastener folders": "5.2", "fastener": "3.1", "classification": "3.1"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/File-Jackets-Sorters/cat_DP2248", "text": "File Jackets / Sorters", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "File Jackets / Sorters", "parent_url": "http://www.staples.com/File-Folders-Jackets-Pockets/cat_CG15", "keyword_count": {"file jackets": 4, "file": 6, "sorters": 5}, "description_wc": 167, "description_text": "With file jackets and sorters, you can store and categorize your paperwork. Between the durable covers, your files are protected from rips, spills, and fading. Versatile Storage Manage projects by using file jackets and sorters tailored to your tasks, from preprinted folders for medical professionals to plastic carriers for delivering departmental printouts. Thanks to pocket-style organizers, your documents fit snugly inside protective compartments for added safety. Easy Classification Choose sorters with built-in categorization features to simplify organization. Index file sorters are equipped with different types of divider tabs, allowing you to store documents in designated groups. Archive-Quality Durability Your file jackets and sorters won't degrade over long periods and will keep the storage contents in crisp condition. Choose durability features like antimicrobial protection or water resistance to safeguard your documents against moisture, bacteria, and temperature changes. The resilient construction of reinforced manila and poly file jackets prevents harmful bending and creasing from ruining your delicate business materials, such as printed photos and brochures.", "parent_text": "File Folders / Jackets / Pockets", "keyword_density": {"sorters": "3.0", "file": "3.6", "file jackets": "4.8"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Expandable-Wallets/cat_DP4740", "text": "Expandable Wallets", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Expandable Wallets", "parent_url": "http://www.staples.com/File-Folders-Jackets-Pockets/cat_CG15", "keyword_count": {"wallets": 3}, "description_wc": 94, "description_text": "Expanding file pockets and wallets are a great way to keep personal or professional documentation organized. You\u2019ll find a variety of products from brands like Globe-Weis, Pendaflex, Smead, and Staples. Expand your organizing options! Multiple pockets are ideal for organizing, storing and transporting large amounts of paperwork. Expanding wallets without flaps for work surface organization and easy access. Expanding files with flap to protect your files when on the go. Need to transport large amounts of paperwork? Expanding wallets are the solution! Staples has a huge variety of materials, sizes and prices.", "parent_text": "File Folders / Jackets / Pockets", "keyword_density": {"wallets": "3.2"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 82, "level": -1, "url": "http://www.staples.com/Pocket-Folders/cat_CL140674", "text": "Pocket Folders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Pocket Folders", "parent_url": "http://www.staples.com/File-Folders-Jackets-Pockets/cat_CG15", "keyword_count": {"pocket": 2, "folders": 4}, "description_wc": 126, "description_text": "Portfolio folders are an inexpensive, effective way to get yourself organized. From students sorting through class notes to professionals looking to clean that messy desk, our portfolios provide an elegant solution. Browse our Learning Center for more great ideas. Find Your Style : From laminated folders to those with a leather-like texture, you\u2019re sure to find a twin pocket portfolio made from materials you love. Secure Storage : Two pocket portfolios come with an extra metal prong option so you can store your materials securely. Portfolio folders also come in a range of sizes and colors to meet your preferences and needs. Trusted Brands : Including Esselte, Staples, Duo-Tang and Smead. Shop our wide selection of portfolio folders today for organization system that works for you.", "parent_text": "File Folders / Jackets / Pockets", "keyword_density": {"pocket": "1.6", "folders": "3.2"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Expanding-Files/cat_DP1458", "text": "Expanding Files", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Expanding Files", "parent_url": "http://www.staples.com/File-Folders-Jackets-Pockets/cat_CG15", "keyword_count": {"files": 7, "expanding files": 5}, "description_wc": 219, "description_text": "With expanding files, you can divide documents into organized sections for quicker retrieval. The file folders are constructed from heavy materials that won't bend under pressure and will keep your papers from crumpling. Depending on your needs, you can find open-faced designs for your drawers or elastic closures for carrying files on the go. Heavy-Duty Construction No matter how often you open and close expanding files, dig around for papers, or switch the tabs, durable materials such as polypropylene and reinforced card stock prevent the folder from losing its sturdy structure. Poly expanding files offer the added benefit of water resistance, while antimicrobial models reduce bacterial buildup from everyday use. All-in-One Storage and Travel Simplify your filing tasks with folders that function as storage, travel carriers, and dividers. From case files to media disks, expanding files separate your resources into distinct groups, so you'll always know where to find each item. Drawer pockets with flattened bottoms are perfectly shaped for file drawers, while standard folders can be carried independently for off-site meetings. A Variety of Style Options Beyond basic functionality, expanding files are available in attractive textures from brands like Martha Stewart and Fibrosource. Choose fashion folders in assorted colors to simplify coding for different categories, such as finances or marketing materials.", "parent_text": "File Folders / Jackets / Pockets", "keyword_density": {"files": "3.2", "expanding files": "4.6"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Hanging-Files/cat_DP1481", "text": "Hanging File Folders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Hanging File Folders", "parent_url": "http://www.staples.com/File-Folders-Jackets-Pockets/cat_CG15", "keyword_count": {"folders": 4, "file": 8, "file folders": 3, "hanging file": 3, "hanging file folders": 2}, "description_wc": 142, "description_text": "Alphabetical organization is made easy with hanging file folders, file frames and box bottom hanging files. When you need to store and access information rapidly, these folders are the perfect solution. We carry file system brands like Staples brand, Pendaflex, Smead, and Ampad. With our wide selection you can choose the level of durability you need. Our hanging file folders options include features like polylaminate reinforcement in critical areas and paper thicknesses from the industry standard 11pt stock up to a heavyweight 17pt stock. For increased durability, there are heavy duty products with stronger rods and hooks that can withstand the most rigorous office use. If you have large items consider a box bottom file folder which expands to hold even overstuffed file folders. Receipts and other small items can be easily organized and secured within a file folder with side gussets.", "parent_text": "File Folders / Jackets / Pockets", "keyword_density": {"folders": "2.8", "hanging file folders": "4.2", "file folders": "4.2", "file": "5.6", "hanging file": "4.2"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/File-Folders/cat_DP1453", "text": "File Folders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "File Folders", "parent_url": "http://www.staples.com/File-Folders-Jackets-Pockets/cat_CG15", "keyword_count": {"folders": 7, "file folders": 4}, "description_wc": 84, "description_text": "Keeping your documents and important paperwork organized is easy when shopping online at Staples for file folders. We have a large variety of file folders so you can find the perfect product for your organizational needs or preferences. Pick between dozens of manila or colored file folders like top tab folders, end tab folders and specialty folders. Choose single, two, three, and five cut tabs. We have a variety of materials for different purposes including poly file folders for extra durability and water resistance.", "parent_text": "File Folders / Jackets / Pockets", "keyword_density": {"folders": "8.3", "file folders": "9.5"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Specialty-Papers/cat_DP8139", "text": "Specialty Papers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Specialty Papers", "parent_url": "http://www.staples.com/Paper/cat_CG10", "keyword_count": {"papers": 3, "specialty papers": 2, "specialty": 4}, "description_wc": 195, "description_text": "Specialty papers come in many forms, from those made to withstand water damage to those used in carbon transferring. These papers can make the work day move more smoothly, particularly if they cut down on the time you spend filing documents, which the three-hole-punched paper will. Carbon paper can be used to transfer information from one page to another quickly, saving you time and energy. Resists Water Damage Specialty paper may resist water damage, so you can use it near water, such as at a marina or a pool. You can buy additional office supplies such as waterproof pens and pencils that work well with this type of paper. Different Types Available If you use specialty paper often, you may want to invest in a pack of carbon paper, laser paper, or sticker paper. Each pack can be bought separately, so you can get exactly what you need. Easy Use These specialty papers fill a niche, and each has a special quality that works in different situations. However, you can simply use them just like any other type of paper, so you can place them in printers or write on them as usual.", "parent_text": "Paper", "keyword_density": {"specialty papers": "2.1", "specialty": "2.1", "papers": "1.5"}, "department_id": 30}
{"level": -1, "url": "http://www.staples.com/Security-Check-Perforated-Carbonless-Paper/cat_DP8316", "text": "Security / Check & Perforated / Carbonless Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/Paper/cat_CG10", "parent_text": "Paper", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 4, "level": -2, "url": "http://www.staples.com/File-Frames/cat_CL140620", "text": "File Frames", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "File Frames", "parent_url": "http://www.staples.com/File-Frames-Guides/cat_DP1454", "keyword_count": {"frames": 2, "file frames": 1, "file": 3}, "description_wc": 42, "description_text": "File frames hold hanging file folders, which make it easier to organize your files. Frames can hold letter-size folders or legal-sized folders. A variety of styles, including plastic and metal, are available and durable for daily use in your office.", "parent_text": "File Frames / Guides", "keyword_density": {"frames": "4.8", "file frames": "4.8", "file": "7.1"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 9, "level": -2, "url": "http://www.staples.com/File-Guides/cat_CL141691", "text": "File Guides", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "File Guides", "parent_url": "http://www.staples.com/File-Frames-Guides/cat_DP1454", "keyword_count": {"file guides": 4, "guides": 6, "file": 8}, "description_wc": 185, "description_text": "Using file guides will help your business better identify specific folders, making it easier to find exactly what you need. With guides that can be used to organize by alphabet, month, or even color, you can customize how your office filing system works. Choose between multicolored or manila file guides, and begin organizing your filing cabinet today. Organize by Alphabet or Month File guides can be used to organize by the month or by the alphabet. Choose the type of guide you want, insert it into your file cabinet, and begin separating your office folders by date or letter. Choose Between Top Tab or End Tab Depending on the type of filing system your office has, you'll need either a top-tab or end-tab file guide. Pick the one that'll help you find the file you need the fastest. Multiple Sizes File guides come in letter or index size, giving you options when you have different types of documents to organize. Some guides even come with an out tab, so you can let your coworkers know if a file's been taken.", "parent_text": "File Frames / Guides", "keyword_density": {"file guides": "4.3", "guides": "3.2", "file": "4.3"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 9, "level": -2, "url": "http://www.staples.com/Medical-Labels-and-Tab-Protectors/cat_CL142099", "text": "Medical Labels and Tab Protectors", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Medical Labels and Tab Protectors", "parent_url": "http://www.staples.com/Medical-Filing-Organization/cat_DP1970", "keyword_count": {"medical labels and tab protectors": 3, "medical": 6, "labels": 7, "labels and tab": 4, "tab": 7}, "description_wc": 173, "description_text": "File labels, binder tabs, and chart divider sets in the medical labels and tab protectors category help health professional organize and sort medical records. These supplies from manufacturers such as Ames and Tabbies offer tools that every medical office needs to keep patient documents in order. Medical professionals can work more efficiently when it's easy to find the right file for the job. Long-Lasting Identifiers Medical labels and tab protectors are polyester laminated, so you don't have to worry about the labels and tabs fading or decaying over time. Your files and document sets will stay effectively organized and sorted for years. Permanent Adhesive Alpha, numeric, and year-coded labels feature permanent adhesive and release-coated paper backing to ensure that the labels won't fall off the file over time. Medical labels and tab protectors also come in multiple colors for additional organizing options. Convenient Organization Tabs and chart divider sets help you organize documents for easy study or presentation. Use these products with various size three-ring binders.", "parent_text": "Medical Filing & Organization", "keyword_density": {"medical labels and tab protectors": "8.7", "medical": "3.5", "labels": "4.0", "labels and tab": "6.9", "tab": "4.0"}, "department_id": 30}
{"nr_products": 133, "level": -1, "url": "http://www.staples.com/Resume-Paper-Letterhead/cat_CL140677", "text": "Resume Paper / Letterhead", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/Paper/cat_CG10", "parent_text": "Paper", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Medical-File-Organization/cat_CL142103", "text": "Medical File Organization", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Medical File Organization", "parent_url": "http://www.staples.com/Medical-Filing-Organization/cat_DP1970", "keyword_count": {"medical file organization": 2, "medical file": 3, "file": 13}, "description_wc": 194, "description_text": "Modern medical file organization cabinets and boxes help keep files, x-rays, and documents in order so that you can find what you're looking for quickly and easily. These products also help protect documents from conditions that could cause degradation, so you don't have to worry about the loss of important data. Whether you work in a hospital or a private clinic, organizing your files can make your practice more efficient. Secure Your Files Secure important medical files in a strong cabinet, box, or case that keeps papers protected from dirt, dust, UV light, and debris. Alternately, you can get a locking file cabinet to help protect confidential files. Handy Portability For ease of transport, choose a lightweight storage box with handles. These can be used when moving between clinics or when you need to transfer many files to a hospital or specialist at once. Convenient Storage Medical file organization systems are conveniently designed to hold standard file folders and hanging files, so you can easily move documents from your clipboard directly to the right file. You can alphabetize your files or store them by date to make everything easy to find.", "parent_text": "Medical Filing & Organization", "keyword_density": {"medical file organization": "3.1", "medical file": "3.1", "file": "6.7"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Medical-X-Ray-Jackets-Accessories/cat_CL142098", "text": "Medical X-Ray Jackets & Accessories", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Medical X-Ray Jackets & Accessories", "parent_url": "http://www.staples.com/Medical-Filing-Organization/cat_DP1970", "keyword_count": {"x ray": 8, "medical x ray jackets": 3, "x ray jackets": 4, "medical": 4, "accessories": 3, "jackets": 6}, "description_wc": 197, "description_text": "Use medical x-ray jackets and accessories to avoid damage to x-ray charts that are circulated between different departments. Heavy paper construction holds the film straight and protects the surface from outside elements. Preprinted lines and number codes make it easy to fill out patient and physician information. Organized Records Keep track of patient records with preprinted x-ray jackets that include designated spaces for writing down circulation dates, patient identification, diagnosis details, and all physicians who accessed the film. The jackets feature large, color-coded label bars indicating the type of file and its loan status, so important x-rays won't be confused with other medical file folders. Durable Protection Medical x-ray jackets and accessories are crafted from sturdy materials, including 28-pound kraft paper and 11-point card stock. Jackets and negative preservers provide the stiffness needed to prevent film from bending during transport, so the x-rays remain easy to view and reproduce. Report Storage Choose medical x-ray jackets and accessories with pockets for storing reports. You can store x-rays and any additional diagnosis materials in the same jacket to quickly and conveniently share patient information with other physicians.", "parent_text": "Medical Filing & Organization", "keyword_density": {"x ray": "8.1", "medical x ray jackets": "6.1", "x ray jackets": "6.1", "medical": "2.0", "accessories": "1.5", "jackets": "3.0"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 15, "level": -2, "url": "http://www.staples.com/Medical-File-Folders/cat_CL142100", "text": "Medical File Folders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Medical File Folders", "parent_url": "http://www.staples.com/End-Tab-Filing-Folders/cat_DP2247", "keyword_count": {"medical": 2, "file folders": 1}, "description_wc": 34, "description_text": "Organization is critical in the medical field. That\u2019s why we offer a variety of medical filing supplies, file folders and accessories, all at prices sure to please. Stock up today and save big!", "parent_text": "End Tab File Folders", "keyword_density": {"medical": "5.9", "file folders": "5.9"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 18, "level": -2, "url": "http://www.staples.com/Fastener-Folders/cat_CL142832", "text": "Fastener Folders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Fastener Folders", "parent_url": "http://www.staples.com/Classification-Fastener-Folders/cat_DP4739", "keyword_count": {"folders": 6, "fastener folders": 4}, "description_wc": 128, "description_text": "Fastener folders are wonderful tools for keeping your business organized. They come in different colors and sizes, so they can hold whatever information you need to have on hand. Tabs in various positions make it easy to find folders quickly. Easy Organization Fastener folders come in different styles, and you can mark the tabs to keep them organized. You might consider using labels that stand out against the folder color. Color Coding Color is a great way to make a client's folder or receipt file easier to recognize. Fastener folders come in a variety of colors for easy recognition. Durability Many styles of fastener folders are available, including folders with reinforced tabs. They are made to last longer, so they'll stand up to daily office use.", "parent_text": "Classification / Fastener Folders", "keyword_density": {"folders": "4.7", "fastener folders": "6.2"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 4, "level": -2, "url": "http://www.staples.com/Post-it-Pockets/cat_CL164299", "text": "Post-it Pockets", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Post-it Pockets", "parent_url": "http://www.staples.com/Expanding-Files/cat_DP1458", "keyword_count": {"post it pockets": 4}, "description_wc": 206, "description_text": "Post-it Pockets offer convenient transportation for your must-have work accessories. Choose from several pouch sizes, and fill the pocket with items ranging from business receipts to calculators. Each pouch is equipped with a durable adhesive and will stick to books, laptops, and other smooth surfaces. Instant Storage Solution Post-it Pockets provide a way to keep important accessories or presentation materials right on your walls, record books, project binders, and more. Whether you need to store flash drives and memory cards or note cards and projector slides, you can easily view and locate accessories through the clear material. Each pocket features a secure closure to prevent dropped items. Reposition the Pouch Enjoy versatility with strong adhesive that securely attaches to different surfaces and detaches cleanly when you need to reposition the pocket. Thanks to a flexible, tear-resistant construction, each pouch can be reused without losing durability. Multiple Pocket Sizes Choose a pouch that matches the size of your attachment surface and stored items. Staples offers small, medium, and large Post-it Pockets, including pouches that can hold letter-size documents. You can also find both horizontal and vertical Post-it Pockets to ensure that your items won't slip out of the pouches.", "parent_text": "Expanding Files", "keyword_density": {"post it pockets": "5.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 5, "level": -2, "url": "http://www.staples.com/Guide-Height-File-Folders/cat_CL142830", "text": "Guide Height File Folders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Guide Height File Folders", "parent_url": "http://www.staples.com/File-Folders/cat_DP1453", "keyword_count": {"folders": 4, "file": 6, "guide height file folders": 3}, "description_wc": 135, "description_text": "Guide height file folders make it easy to see the tabs with labels, so you can find what you need. An interior file folder won't extend beyond the top of a hanging folder's edge, so you can use a lid or cover your files easier, but still see the label tab. Whichever you choose, a variety of colors and choices are available. Bold Color Guide height file folders come with tabs that stick out and are available in a variety of colors. Using file labels can help you stay organized, especially if you place a label on each tab. Interior Tabs Some guide height file folders also have interior tabs cut out. This means that you can separate the folders into sections to store updated information, new receipts, or add-ons to paperwork.", "parent_text": "File Folders", "keyword_density": {"folders": "3.0", "file": "4.4", "guide height file folders": "8.9"}, "department_id": 30}
{"nr_products": 4, "level": -2, "url": "http://www.staples.com/Check-Files/cat_CL141357", "text": "Check Files", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/Expandable-Wallets/cat_DP4740", "parent_text": "Expandable Wallets", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 16, "level": -2, "url": "http://www.staples.com/Classification-Folders/cat_CL142831", "text": "Classification Folders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Classification Folders", "parent_url": "http://www.staples.com/Classification-Fastener-Folders/cat_DP4739", "keyword_count": {"folders": 4, "classification folders": 3}, "description_wc": 141, "description_text": "Classification folders make it simple to keep your documents together organized \u00a0logically and efficiently. They come in a wide array of different colors so you can sort your documents quickly. Many styles are available as well, so you can have as many tabs as you need for what needs to get organized and filed. Easy Storage Keep all your classification folders inside file folders for even more meticulous organization, or use them separately. With plenty of sleek and unique designs to choose from, you can select a size and style that best suits the work you do. Colorful Features You need to have classification folders that you can quickly recognize and access. Thanks to multiple color options and easy to read labeling, you can easily make your important files stand out. Organization will become faster, more intuitive and less tedious. .", "parent_text": "Classification / Fastener Folders", "keyword_density": {"folders": "2.9", "classification folders": "4.3"}, "department_id": 30}
{"nr_products": 14, "level": -2, "url": "http://www.staples.com/Expanding-Wallets/cat_CL140618", "text": "Expanding Wallets", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/Expandable-Wallets/cat_DP4740", "parent_text": "Expandable Wallets", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Waterproof-Paper-3-Hole-Punched/cat_CL168966", "text": "Waterproof  Paper - 3 Hole Punched", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Waterproof  Paper - 3 Hole Punched", "parent_url": "http://www.staples.com/Specialty-Papers/cat_DP8139", "keyword_count": {"paper": 10, "hole": 3, "waterproof paper": 4, "punched": 3, "hole punched": 1}, "description_wc": 153, "description_text": "Waterproof paper can be used in moist or wet situations when other forms of paper can't. This style of paper is ideal for use in meetings and in binders, since it won't be damaged easily. With the holes already punched, three-hole waterproof paper is perfect for binding. Resists Water Damage When you're working, specialty paper can make your life easier. Waterproof paper can withstand spills and drips, so your work won't be ruined. Different Packs Available If you use waterproof paper often, you may want to have a pack of 1,000 sheets or more. Fortunately, there are packs with as few as 100 sheets, so you can have as many pages as you need. Prepunched Paper Using three-hole-punched paper is ideal for those who place their work in binders. This paper is already ready to be bound, so you don't have to punch it yourself.", "parent_text": "Specialty Papers", "keyword_density": {"hole": "2.0", "paper": "6.5", "punched": "2.0", "waterproof paper": "5.2", "hole punched": "1.3"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 10, "level": -2, "url": "http://www.staples.com/Hanging-File-Pockets/cat_CL161019", "text": "Hanging File Pockets", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Hanging File Pockets", "parent_url": "http://www.staples.com/Hanging-Files/cat_DP1481", "keyword_count": {"hanging file": 3, "hanging file pockets": 2}, "description_wc": 132, "description_text": "Hanging file pockets make the job of running an efficient office a whole lot easier. Folders provide a place to keep track of reports, contracts, correspondence, and so much more. Shop brands that include Pendaflex and Smead for stress-free filing. Legal or Letter Hanging file folders are available in different sizes to cover office copies on letter-sized paper or contracts and other business-related correspondence on legal-sized paper. Choose both sizes to accommodate all aspects of your business. Recycled Construction Take care of the environment while taking care of business with recycled folders. These sturdy folders provide eco-friendly storage for your office. Expanding Possibilities Select expandable hanging file pockets for multifaceted projects. These folders provide more than enough space for filing all paperwork related to a specific job.", "parent_text": "Hanging File Folders", "keyword_density": {"hanging file": "4.5", "hanging file pockets": "4.5"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 18, "level": -2, "url": "http://www.staples.com/Carbonless-Laser-Paper/cat_CL168971", "text": "Carbonless Laser Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Carbonless Laser Paper", "parent_url": "http://www.staples.com/Specialty-Papers/cat_DP8139", "keyword_count": {"carbonless laser paper": 4, "carbonless": 5, "paper": 6, "laser": 5}, "description_wc": 123, "description_text": "Carbonless laser paper from companies such as Appleton and Reimage allow you to cut down on the mess and waste of preprinted forms. Create single or multipart forms with ease. Cost-Effective Carbonless laser paper allows you to cancel your order for preprinted forms and only print what you need when you need it. Custom-create everything from invoices to service agreements in minutes. Compatible Multipurpose carbonless laser paper can be used in laser , digital, and offset printers. Use any printer in your office. Versatile We offer carbonless paper in 1-part to multipart packs. For busy offices with changing document needs, keep several colors of paper on hand, and glue parts together with carbonless laser paper glue as the need arises.", "parent_text": "Specialty Papers", "keyword_density": {"carbonless laser paper": "9.8", "carbonless": "4.1", "paper": "4.9", "laser": "4.1"}, "department_id": 30}
{"nr_products": 6, "level": -2, "url": "http://www.staples.com/Blank-Check-Paper/cat_CL206130", "text": "Blank Check Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/Security-Check-Perforated-Carbonless-Paper/cat_DP8316", "parent_text": "Security / Check & Perforated / Carbonless Paper", "department_text": "Office Supplies", "department_id": 30}
{"nr_products": 35, "level": -2, "url": "http://www.staples.com/Security-Paper/cat_CL206129", "text": "Security Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/Security-Check-Perforated-Carbonless-Paper/cat_DP8316", "parent_text": "Security / Check & Perforated / Carbonless Paper", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 4, "level": -2, "url": "http://www.staples.com/Sticker-Magnetic-Paper/cat_CL141391", "text": "Sticker & Magnetic Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Sticker & Magnetic Paper", "parent_url": "http://www.staples.com/Specialty-Papers/cat_DP8139", "keyword_count": {"sticker": 3, "paper": 2}, "description_wc": 85, "description_text": "Sticker and magnet paper products can be used to turn ordinary pictures and documents into custom stickers and magnets for easy posting. Most magnet and sticker paper products are compatible with inkjet and laser printers. Easily print and post important to-dos, announcements, and policy changes without the need for tacks or nails. Easily print business card magnets to give customers an easy way to have access to your contact information. Choose between glossy and matte coated magnet sheets that are 8.5\u201d x 11\u201d.", "parent_text": "Specialty Papers", "keyword_density": {"sticker": "3.6", "paper": "2.4"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Carbon-Paper/cat_CL165827", "text": "Carbon Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Carbon Paper", "parent_url": "http://www.staples.com/Specialty-Papers/cat_DP8139", "keyword_count": {"paper": 4, "carbon paper": 3}, "description_wc": 56, "description_text": "Staples carbon paper is curl and smudge resistant and is for use with most standard or electric typewriters. Carbon paper is perfect for making copies at the same time as the original is being produced on a printer or by handwriting. Staples carbon paper comes with 100 sheets. All paper comes with a 100% satisfaction guarantee.", "parent_text": "Specialty Papers", "keyword_density": {"paper": "7.1", "carbon paper": "10.7"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 96, "level": -2, "url": "http://www.staples.com/Waterproof-Paper/cat_CL168974", "text": "Waterproof  Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Waterproof  Paper", "parent_url": "http://www.staples.com/Specialty-Papers/cat_DP8139", "keyword_count": {"paper": 8, "waterproof paper": 3}, "description_wc": 152, "description_text": "Waterproof paper is ideal for those looking for durable printing paper. This paper stands up against water, helping to protect the images or text from harm. The paper comes in traditional sizes and in a variety of additional sizes, so you can print on the size you need. Durability In the office, printer paper is great for printing large numbers of copy or reports. With waterproof paper, you can be sure that important prints won't be damaged by water, especially if you'll be outside or in a potentially wet situation. Sizes Waterproof paper comes in many sizes, from the traditional 8.5- x 11-inch printing size to pages that are 12 x 18 inches. You can choose the size that best suits your project for impact. Applications For barcodes, tags, and important information, this paper is ideal. It repels water and keeps your text and images safe from water damage.", "parent_text": "Specialty Papers", "keyword_density": {"paper": "5.3", "waterproof paper": "3.9"}, "department_id": 30}
{"nr_products": 36, "level": -2, "url": "http://www.staples.com/Punched-Perforated-Paper/cat_CL208061", "text": "Punched / Perforated Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/Security-Check-Perforated-Carbonless-Paper/cat_DP8316", "parent_text": "Security / Check & Perforated / Carbonless Paper", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 6, "level": -2, "url": "http://www.staples.com/Box-Bottom-Hanging-Files/cat_CL142827", "text": "Box Bottom Hanging Files", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Box Bottom Hanging Files", "parent_url": "http://www.staples.com/Hanging-Files/cat_DP1481", "keyword_count": {"files": 7, "hanging files": 4, "box bottom hanging files": 3, "box bottom": 4, "hanging": 5}, "description_wc": 204, "description_text": "Create more space for bulky documents, catalogs, disks, and other materials you need to file by using box-bottom hanging files. The flat edge of each offers more expansion and can be reinforced to prevent tearing. Choose files made from recycled paper in standard green or gray, or in assorted colors, from top brands like Staples, Smead, and Pendaflex. Flexible Storage for Large Items Box-bottom hanging files feature straight, widened spines that stay level on flat surfaces and offer extra interior space for large or heavy business materials. When you need maximum support for bulky items like booklets, choose reinforced box-bottom files that incorporate durable pressboard into the spine. Filing Tabs for Navigation Each folder features hanging hooks and precut notches for inserting tab labels. Writable or printable tabs allow you to add or change the folder names, while the built-in hooks slide along the filing cabinet's track, allowing you to easily navigate to your desired files. Choose the Best Size Whether storing financial records or past marketing materials, box-bottom hanging files can accommodate your documents with expansion capacities up to 4 inches. Legal-size hanging files are also available if you regularly work with 8.5\" x 14\" paper.", "parent_text": "Hanging File Folders", "keyword_density": {"files": "3.4", "hanging files": "3.9", "hanging": "2.5", "box bottom": "3.9", "box bottom hanging files": "5.9"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 9, "level": -2, "url": "http://www.staples.com/Poly-File-Folders/cat_CL141296", "text": "Poly File Folders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Poly File Folders", "parent_url": "http://www.staples.com/File-Folders/cat_DP1453", "keyword_count": {"folders": 8, "poly file folders": 2, "file": 4, "poly": 5, "poly file": 3}, "description_wc": 199, "description_text": "Poly file folders keep damaging elements away from your critical documents, whether they're stored in your office or being transported to a client. The folders are made from sturdy plastic for added protection. Thanks to trusted bands like Staples and Smead, you'll find folders with convenient features ranging from pockets to filing tabs. Preserve Important Documents With poly file folders, your papers are safely tucked between layers of durable protective plastic. While lightweight and easy to carry, these folders are crafted from sturdy material that prevents your documents from bending, snagging, and crumpling. You can ensure your morning coffee doesn't ruin your paperwork, thanks to water-resistant poly folders that protect against liquids. Readymade Index To form an index, simplify your filing needs with poly tab folders that are color coded. Writable and adhesive labels allow you to name each folder, so you can quickly identify different projects and sort your files. Storage Features When storing projects, pocket folders and organizers provide additional space for note cards, handouts, and compact discs. Built-in storage allows you to gather different project materials in one poly file folder, making them easily accessible for a presentation or client meeting.", "parent_text": "File Folders", "keyword_density": {"folders": "4.0", "poly file folders": "3.0", "poly": "2.5", "file": "2.0", "poly file": "3.0"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 12, "level": -2, "url": "http://www.staples.com/Fashion-Expanding-Files/cat_CL169006", "text": "Fashion Expanding Files", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Fashion Expanding Files", "parent_url": "http://www.staples.com/Expanding-Files/cat_DP1458", "keyword_count": {"files": 5, "expanding files": 4, "fashion expanding files": 3}, "description_wc": 151, "description_text": "Fashion expanding files make organizing different materials easy. Different sections open to allow subjects to be split apart, so you won't mix up coursework, business receipts, or client information. Expanding files make room for more documents as your business grows, so you won't need to buy extra folders. Easy Organization You can use binders to keep your notes in during a course or meeting, but you'll need somewhere to organize and store your work later. Fashion expanding files are broken down into sections, so you can keep your notes organized. Varied Sizes If you need to store letter-size paper, a selection of fashion expanding files is available. You can also find folders that are large enough for legal-size papers. Different Designs Different designs make it easier to find your files. It's simple to choose different colors or prints to make your work easier to find.", "parent_text": "Expanding Files", "keyword_density": {"files": "3.3", "expanding files": "5.3", "fashion expanding files": "6.0"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 43, "level": -2, "url": "http://www.staples.com/Top-Tab-File-Folders/cat_CL140597", "text": "Top Tab File Folders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Top Tab File Folders", "parent_url": "http://www.staples.com/File-Folders/cat_DP1453", "keyword_count": {"folders": 4, "top": 3, "top tab file folders": 2, "file": 3}, "description_wc": 66, "description_text": "Top tab file folders ensure that paperwork we need stays organized and accessible. Simplify your work with our wide selection of top tab file folders allows for instant identification and retrieval. Partnering with top file folder manufacturers like Smead and Pendaflex, we offer a wide variety of letter and legal sized folders in manila and colors for every use and specialty folders for more specific organization.", "parent_text": "File Folders", "keyword_density": {"folders": "6.1", "top": "4.5", "top tab file folders": "12.1", "file": "4.5"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 21, "level": -2, "url": "http://www.staples.com/Hanging-File-Folders/cat_CL140599", "text": "Hanging File Folders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Hanging File Folders", "parent_url": "http://www.staples.com/Hanging-Files/cat_DP1481", "keyword_count": {"file": 4, "hanging file folders": 2, "hanging file": 3}, "description_wc": 100, "description_text": "Hanging file folders will help you stay organized and clean off your desk so everything stays neat. Choose from a variety of colors and sizes so you get the exact type of hanging file folder that suits your needs. Most are 100% recycled, so you can feel good about getting organized and helping the environment, too. They also conserve space because they don't take up any of your precious desk area or table space, ensuring you can find everything you need with minimal clutter. Need something to put your hanging file folders on? File folder frames are also available.", "parent_text": "Hanging File Folders", "keyword_density": {"hanging file folders": "6.0", "file": "4.0", "hanging file": "6.0"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 22, "level": -2, "url": "http://www.staples.com/Fashion-File-Folders/cat_CL167989", "text": "Fashion File Folders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Fashion File Folders", "parent_url": "http://www.staples.com/File-Folders/cat_DP1453", "keyword_count": {"folders": 5, "fashion file folders": 1, "fashion": 2, "file folders": 2, "file": 3}, "description_wc": 123, "description_text": "Staying organized is easier than ever with fashion file folders. These folders have unique designs that stand out, putting a personal touch to your filing.\u00a0A variety of designs means you can choose different folders for important paperwork like receipts, drawings, and coupons. Bold Design You may enjoy using green or brown file folders most of the time, but if you have a special item that you need to find quickly, a bold design can help you. Fashion folders stand out, so they won't be confused with others. Color Coding Color coding is used often to separate items like billing receipts and documents containing client health information. Using a distinct design for personal items or important files can help you stay organized.", "parent_text": "File Folders", "keyword_density": {"folders": "4.1", "fashion file folders": "2.4", "fashion": "1.6", "file folders": "3.3", "file": "2.4"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 21, "level": -2, "url": "http://www.staples.com/Poly-Expanding-Files/cat_CL141235", "text": "Poly Expanding Files", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Poly Expanding Files", "parent_url": "http://www.staples.com/Expanding-Files/cat_DP1458", "keyword_count": {"files": 7, "expanding files": 4, "poly": 4, "poly expanding files": 3}, "description_wc": 156, "description_text": "Poly expanding files are made of heavy-duty plastic materials that keep your documents safe in transit. These files come in both zip-top and cascade designs, letting you choose between enhanced protection from the elements or quick access. The files fold flat to take up less space in briefcases or luggage when not in use. Heavy-Duty Poly Poly expanding files feature construction materials that resist damage from rips and tears. This helps ensure that your key documents get to the next meeting or conference in top shape. Efficient The clear material also allows you to quickly and easily view the contents inside of each file. For a protective choice that looks as good as it works, try fashion expanding files. Waterproof Poly expanding files are also great at keeping unwanted moisture from your documents. The waterproof design of these files lets you move documents and folders in the rain without fear of water damage.", "parent_text": "Expanding Files", "keyword_density": {"files": "4.5", "expanding files": "5.1", "poly": "2.6", "poly expanding files": "5.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 19, "level": -2, "url": "http://www.staples.com/Expanding-File-Pockets/cat_CL140619", "text": "Expanding File Pockets", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Expanding File Pockets", "parent_url": "http://www.staples.com/Expanding-Files/cat_DP1458", "keyword_count": {"pockets": 6, "expanding file": 4, "expanding file pockets": 3, "file": 5, "file pockets": 4}, "description_wc": 129, "description_text": "Expanding file pockets allow you to quickly and easily protect your documents when traveling between meetings or on long trips, and deep pockets safely hold your paperwork. You can also use the pockets in lieu of a briefcase for lightweight travel. Effective Expanding file pockets can fold flat to fit inside your suitcase or carry on luggage. Pull them out to store documents or fold them flat until you need them. Protective Opaque construction helps to ensure that documents contained in expanding file pockets remain safe from prying eyes. If you need a transport option that combines form and function, try fashion expanding files. Durable File pockets have durable inner and outer construction. Heavyweight materials easily protect your documents against wear during transport or when they're in storage.", "parent_text": "Expanding Files", "keyword_density": {"file": "3.9", "expanding file": "6.2", "expanding file pockets": "7.0", "pockets": "4.7", "file pockets": "6.2"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 12, "level": -2, "url": "http://www.staples.com/Expanding-Files/cat_CL140617", "text": "Expanding Files", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Expanding Files", "parent_url": "http://www.staples.com/Expanding-Files/cat_DP1458", "keyword_count": {"files": 1}, "description_wc": 36, "description_text": "Expand your organization and your wallet with great deals on expandable files and file folders. Store checks, receipts, documents and more. Choose from a variety of sizes and colors, too. Doesn\u2019t getting organized feel great?", "parent_text": "Expanding Files", "keyword_density": {"files": "2.8"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Photography-Paper-Supplies/cat_DP5606", "text": "Photography Paper & Supplies", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Photography Paper & Supplies", "parent_url": "http://www.staples.com/Paper/cat_CG10", "keyword_count": {"supplies": 3, "paper": 9, "photography paper": 3}, "description_wc": 145, "description_text": "Photographic paper and supplies are helpful when you're trying to create beautiful, high-quality prints. These papers are made to produce smooth images that you can use in advertising or other activities. You can find fabric paper, banners, and more to use with your ads and images. Perfect Prints When you're completing presentation binders , having high-quality images is important. Photography paper and supplies make sure you have the paper that will make your prints stand out. Different Styles From banners to glossy paper, photography paper and supplies include a little bit of everything. You can use large banners for advertising or print glossy images for your ads. Easy to Use Each type of photography paper is able to be used in printers, so you can create high-quality images. You can purchase fabric, fiber, or glossy papers along with many others.", "parent_text": "Paper", "keyword_density": {"supplies": "2.1", "paper": "6.2", "photography paper": "4.2"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 5, "level": -2, "url": "http://www.staples.com/File-Sorters-Organizers/cat_CL141698", "text": "File Sorters / Organizers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "File Sorters / Organizers", "parent_url": "http://www.staples.com/File-Jackets-Sorters/cat_DP2248", "keyword_count": {"organizers": 2, "file sorters": 1, "file": 8}, "description_wc": 145, "description_text": "The right file sorters and organizers keep paperwork neat and your office clean of clutter. Multicolored tabs make it simple to flip to the section you want to access, and, with the wide range of organization tools available, folders can be used to hold all manner of things, from receipts to contracts. Easy Organization Available in several different colors, file jackets make your files easy to organize. You can also make files easy to identify by using file folder labels. Tabs for Sorting Tabs are great because they make specific records stand out. With one quick look, you can find the name or subject you're looking for. Special Sizes Most file folders and organizational tools are big enough for printouts, but you can also choose file folders and organizers specifically for more fiddly things. Files are available for coupons, clippings, and other small items.", "parent_text": "File Jackets / Sorters", "keyword_density": {"organizers": "1.4", "file sorters": "1.4", "file": "5.5"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 27, "level": -2, "url": "http://www.staples.com/File-Jackets/cat_CL140598", "text": "File Jackets", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "File Jackets", "parent_url": "http://www.staples.com/File-Jackets-Sorters/cat_DP2248", "keyword_count": {"jackets": 4, "file jackets": 3}, "description_wc": 65, "description_text": "File jackets make it easy to keep important paperwork organized. Available in both letter and legal sizes, file jackets make a great choice for protecting your office documents from prying eyes or unintentional damage. File jackets can also be used for purposes beyond simple organization. Use the outer side to schedule project milestones or important meetings. Colorful jackets can even be used for key presentations.", "parent_text": "File Jackets / Sorters", "keyword_density": {"jackets": "6.2", "file jackets": "9.2"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 11, "level": -2, "url": "http://www.staples.com/End-Tab-File-Folders/cat_CL142834", "text": "End Tab File Folders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "End Tab File Folders", "parent_url": "http://www.staples.com/End-Tab-Filing-Folders/cat_DP2247", "keyword_count": {"folders": 6, "end tab": 8, "end tab file folders": 4}, "description_wc": 152, "description_text": "End-tab file folders are a mainstay in businesses that need quick access to important documents. Medical professionals and paralegals alike turn to end-tab filing systems when they need facts quickly. These versatile folders can help your office with organization and retrieval as well. Storage Options End-tab folders let you quickly and easily access key information. When you no longer need quick access, the entire folder may be stored away easily for future reference. Effective Organization End-tab file folders have been used for some time by medical professionals. Other offices appreciate the ease of sorting and flexibility that the end-tab system allows. For a wider selection of folder options, try different labels for end-tab file folders. Quality Appearance Many people recognize end-tab file folders from doctors' and lawyers' offices. You can present that same professional appearance in your office setting with an end-tab filing system.", "parent_text": "End Tab File Folders", "keyword_density": {"folders": "3.9", "end tab": "10.5", "end tab file folders": "10.5"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 62, "level": -1, "url": "http://www.staples.com/Photo-Brochure-Paper/cat_CL168887", "text": "Photo / Brochure Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Photo / Brochure Paper", "parent_url": "http://www.staples.com/Paper/cat_CG10", "keyword_count": {"brochure paper": 5, "photo": 7, "paper": 8, "photo brochure paper": 4, "brochure": 6}, "description_wc": 163, "description_text": "Photo/brochure paper is perfect for businesses who need promotional materials. The high-quality paper types will allow projects to come out looking professional. There are many styles, including trifold brochure kits, photo paper in matte and glossy styles, and wide format styles. Unique Sizes and Styles You can create your own promotional materials in trifold styles and wide format sizes, too, withphoto/brochure paper. You can store them in folders or out in the open for clients to take with them when they leave the office. Multiple Uses Use photo/brochure paper to create matte or glossy photo prints, making it easy to show off your latest customer photos and more. The brochure paper is normally available in a kit, so you can create a professional-looking menu, an easy-to-read price sheet, or another type of document. Varied Colors Make your projects stand out with this photo/brochure paper. You can find paper in bright colors, pastel tones, and more.", "parent_text": "Paper", "keyword_density": {"brochure paper": "6.1", "photo": "4.3", "paper": "4.9", "photo brochure paper": "7.4", "brochure": "3.7"}, "department_id": 30}
{"level": -1, "url": "http://www.staples.com/Die-Cut-Pre-Scored-Printables/cat_DP8315", "text": "Die-Cut / Pre-Scored Printables", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/Paper/cat_CG10", "parent_text": "Paper", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Wide-Format-Printing-Paper-Rolls/cat_DP2263", "text": "Wide Format Printing Paper Rolls", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Wide Format Printing Paper Rolls", "parent_url": "http://www.staples.com/Paper/cat_CG10", "keyword_count": {"paper": 5, "printing": 5, "format printing paper": 4}, "description_wc": 133, "description_text": "Your big ideas deserve a big look. Whether you\u2019re getting ready for a presentation or printing out a project for your CAD class, we have large format printing paper that will fit your needs. For Many Types of Projects - We stock non-coated bond paper for drafts, line drawings, tables and schedules. Our inkjet large format printing paper is just right for your media print-outs. The Best Brands - From HP to Canon to Epson to PM Company to our very own Staples brands, we have the names you trust. High Quality - Available in both mid-level and heavy weights, all large format printing paper comes with a smooth finish, little show through, great color and an even better look. Large format printing paper at Staples: there\u2019s no choice more economical.", "parent_text": "Paper", "keyword_density": {"printing": "3.8", "paper": "3.8", "format printing paper": "9.0"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Computer-Paper-POS-Rolls-Fax-Paper/cat_DP1464", "text": "Computer Paper / POS Rolls / Fax Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Computer Paper / POS Rolls / Fax Paper", "parent_url": "http://www.staples.com/Paper/cat_CG10", "keyword_count": {"paper": 7, "computer paper": 3, "pos": 3, "rolls": 1}, "description_wc": 124, "description_text": "Looking for POS paper or thermal paper for your adding machine or cash register? How about computer paper for all of your print-outs? We\u2019ve got you covered. Calculate With Quality - Our POS paper is available in a variety of sizes and in single or two part rolls. Trouble Free Performance - All POS paper has been precisely manufactured so that you can print jam-free. Our computer paper has ultra fine perforations for a smooth feed and neat refolding. Go Eco-Conscious \u2013 With recycled and EcoEasy options, you can print guilt-free. Buy Computer Paper in Bulk - Save money and another trip to the store with as many as 3,200 pages per box. These options and more, available at Staples.com and in stores.", "parent_text": "Paper", "keyword_density": {"computer paper": "4.8", "paper": "5.6", "pos": "2.4", "rolls": "0.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 3, "level": -1, "url": "http://www.staples.com/Large-Quantity-Orders/cat_CL168934", "text": "Large Quantity Orders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Large Quantity Orders", "parent_url": "http://www.staples.com/Paper/cat_CG10", "keyword_count": {"large quantity orders": 1}, "description_wc": 141, "description_text": "Large quantity orders of paper can be more cost effective than purchasing them individually, so you can have the paper you need at a lower price. The paper comes in ecocertified options, so you can also do your bit for the environment. There are many types of paper to choose from, including multipurpose paper and copy paper. Different Amounts Available You can purchase your paper in bulk easily and get the exact amount you need. There are 40 cases on each pallet for convenience. Quality Paper Just because you're buying in bulk doesn't mean your paper will be of a lower quality. These papers are bright white, so you can have stunning prints. Saves Money Buying paper in bulk can save you money, but rest assured that even though the price may be lower, the quality is still unbeatable.", "parent_text": "Paper", "keyword_density": {"large quantity orders": "2.1"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/White-Copy-Printer-Paper/cat_DP5027", "text": "White Copy / Printer Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "White Copy / Printer Paper", "parent_url": "http://www.staples.com/Paper/cat_CG10", "keyword_count": {"copy": 1, "paper": 5}, "description_wc": 29, "description_text": "Find the paper you\u2019re looking for with ease and at the everyday low prices you love. Choose from copy paper, laser paper, photo paper, filler paper and more.", "parent_text": "Paper", "keyword_density": {"paper": "17.2", "copy": "3.4"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 56, "level": -1, "url": "http://www.staples.com/Awards-Certificates-Holders-Seals/cat_CL158858", "text": "Awards & Certificates / Holders & Seals", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Awards & Certificates / Holders & Seals", "parent_url": "http://www.staples.com/Paper/cat_CG10", "keyword_count": {"certificates": 8, "awards": 7, "awards certificates holders": 3, "seals": 4}, "description_wc": 178, "description_text": "Use awards, certificates, holders, and seals to note particular accomplishments or achievements made by employees or students. From casual and fun certificates to diplomas indicating years of hard work, a wide range of certificates and accessories is available to suit any circumstance. Whether you're presenting diplomas to a class of students or awarding individual achievements within your workplace, awards, certificates, holders, and seals are great for making students or employees feel appreciated. Create Certificates Use create-your-own certificate kits to make awards or documents indicating mastery within your organization. Creative papers, such as those with cute borders, turn any accomplishment into a celebration. Display Awards Display your own awards and certificates with certificate frames. When choosing awards, certificates, holders, and seals, don't forget about also getting document frames you can hang on the wall or freestanding desktop frames for display. Fun Presentation Present certificates in style with linen certificate covers and sleek certificate jackets that let recipients store or display their awards as desired. Adorn your certificate with attention-getting seals for increased visual impact.", "parent_text": "Paper", "keyword_density": {"certificates": "4.5", "awards certificates holders": "5.1", "awards": "3.9", "seals": "2.2"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 20, "level": -1, "url": "http://www.staples.com/Filler-Paper/cat_CL161811", "text": "Filler Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Filler Paper", "parent_url": "http://www.staples.com/Notebooks-Notepads/cat_CG1234", "keyword_count": {"paper": 3, "filler paper": 1}, "description_wc": 81, "description_text": "We have a wide variety of loose leaf paper with both wide-ruled and college-ruled line spacing. Choose from reinforced options to recycled options so that you are always prepared to take notes at work or at school. Choose from college ruled paper for higher word capacity or wide ruled for more space to write. Convenient for taking thoughtful notes and staying organized with a three ring binder. Choose from durable and recycled filler paper from Ampad and Staples brands.", "parent_text": "Notebooks / Notepads", "keyword_density": {"paper": "3.7", "filler paper": "2.5"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 5, "level": -1, "url": "http://www.staples.com/Columnar-Pads/cat_CL100500", "text": "Columnar Pads", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Columnar Pads", "parent_url": "http://www.staples.com/Notebooks-Notepads/cat_CG1234", "keyword_count": {"pads": 4, "columnar": 3, "columnar pads": 2}, "description_wc": 105, "description_text": "High-quality accounting paper is critical for organizing information, creating data tables, and keeping clean, accurate records. Consider the following features when shopping for accounting/columnar pads: Page Format \u2013 Accounting pads come in single, double, or triple page formats to best suit your needs. Hole Punch Format \u2013 Pads are punched to fit either three-ring binders, standard ledgers, or post binders. Line Accents \u2013 With some columnar pad brands, get accents on every fifth line for quicker referencing among data sets. Choose from a variety of low-priced accounting paper at Staples. With several great choices, we make finding long-lasting, high-quality columnar pads easy.", "parent_text": "Notebooks / Notepads", "keyword_density": {"pads": "3.8", "columnar": "2.9", "columnar pads": "3.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 58, "level": -1, "url": "http://www.staples.com/Journals-Diaries/cat_CL166390", "text": "Journals / Diaries", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Journals / Diaries", "parent_url": "http://www.staples.com/Notebooks-Notepads/cat_CG1234", "keyword_count": {"journals": 3, "diaries": 3}, "description_wc": 65, "description_text": "Staples\u00ae has an assortment of journals and diaries with a wide variety of formats to suit any type of planning needs. Whether you are looking for daily or undated designs, our collection of journals and diaries are perfect for keeping track of tasks and notes. With the flexible format of journals and diaries, they are perfect for staying organized in any work or home environment.", "parent_text": "Notebooks / Notepads", "keyword_density": {"journals": "4.6", "diaries": "4.6"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 36, "level": -1, "url": "http://www.staples.com/Colored-Paper/cat_CL140679", "text": "Colored Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Colored Paper", "parent_url": "http://www.staples.com/Paper/cat_CG10", "keyword_count": {"colored paper": 1, "paper": 2}, "description_wc": 45, "description_text": "Whether you need to create eye-catching flyers, brochures, memos, or presentations that pop, Staples has the colored paper for you. Check for compatibility with ink/laser printers Choose from 20 lb to 28 lb paper Large variety of colors and tones Recycled options available", "parent_text": "Paper", "keyword_density": {"colored paper": "4.4", "paper": "4.4"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 31, "level": -1, "url": "http://www.staples.com/Message-Memo-Pads/cat_CL100602", "text": "Message / Memo Pads", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Message / Memo Pads", "parent_url": "http://www.staples.com/Notebooks-Notepads/cat_CG1234", "keyword_count": {"memo": 5, "message": 10, "pads": 7, "memo pads": 3}, "description_wc": 132, "description_text": "Find memo pads with plenty of writing space so you never miss an important message. At Staples, we offer a variety of message and memo pads: Message Books \u2013 Stay organized when you record names, phone numbers, and messages. Message books with adhesive pages let you place messages nearly anywhere. Post-it Message Pads \u2013 Post-it messages make it easy to take quick notes from important calls. Call Registers \u2013 With space for thousands of entries, a call register helps you record all the information you need. Scratch Pads \u2013 For easy note-taking, blank scratch pads and memo slips are clean and convenient. Whether you need phone message slips or everyday memo pages, Staples carries a wide assortment of message pads. Save money when you purchase more memo pads at our everyday low prices.", "parent_text": "Notebooks / Notepads", "keyword_density": {"memo": "3.8", "message": "7.6", "pads": "5.3", "memo pads": "4.5"}, "department_id": 30}
