{"department_text": "Office Supplies", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Wide-Format-Paper/cat_CL167942", "text": "Wide Format Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Wide Format Paper", "parent_url": "http://www.staples.com/Wide-Format-Printing-Paper-Rolls/cat_DP2263", "keyword_count": {"wide format paper": 1, "paper": 6}, "description_wc": 147, "description_text": "Wide-format paper is a great extra to have on hand in the office. You can make larger posters and printouts with it, and fadeless styles won't lose their colors over time. Packs of 60 assorted colors are available, so you can make multicolored projects. Unique Size If you have projects to print, you may use different styles of printer paper . This paper is 12 inches x 18 inches, so it suits larger printers and projects. Fadeless Your projects won't lose their colors over time when you use fadeless paper. The paper resists fading from the sun and other elements, so printouts of rules, coupons, and more will always look fresh. Assorted Colors With assorted colors of paper available, you'll have plenty of colors to choose from when you decide to print. From blues to yellows, there are colors to suit any project.", "parent_text": "Wide Format Printing Paper Rolls", "keyword_density": {"wide format paper": "2.1", "paper": "4.1"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Thermal-Fax-Paper/cat_CL163109", "text": "Thermal Fax Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Thermal Fax Paper", "parent_url": "http://www.staples.com/Computer-Paper-POS-Rolls-Fax-Paper/cat_DP1464", "keyword_count": {"fax": 6, "paper": 4, "thermal fax paper": 3}, "description_wc": 134, "description_text": "Staples brand thermal fax paper rolls fit a variety of machines and create clear, crisp facsimile images. Choose from a variety of lengths depending upon your office needs. We offer half-inch and 1-inch core rolls. Save on Faxes Because Staples thermal fax paper rolls fit a variety of fax machines , you won't spend as much money on paper costs. Stock up your supply closet with both half-inch and 1-inch-core rolls. Low Curl Our thermal fax paper rolls produce quality facsimiles with minimum curl. You won't need to weigh down copies to flatten them before storing or filing them away. Imaging Film We also carry imaging film for your fax machine. Sharp transfer imaging film delivers crisp clear images with a yield of up to 165 pages.", "parent_text": "Computer Paper / POS Rolls / Fax Paper", "keyword_density": {"fax": "4.5", "paper": "3.0", "thermal fax paper": "6.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 17, "level": -2, "url": "http://www.staples.com/Computer-Paper/cat_CL140684", "text": "Computer Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Computer Paper", "parent_url": "http://www.staples.com/Computer-Paper-POS-Rolls-Fax-Paper/cat_DP1464", "keyword_count": {"computer paper": 2, "paper": 4}, "description_wc": 102, "description_text": "Computer paper has a large variety of potential uses depending on what kind you purchase. Besides the ordinary printing on computer paper, here are some other uses: Carbon copies \u2013 If you have important documents that are needed by both the customer and the company\u2019s records, carbon copies are an affordable way to accomplish this. Colored bars \u2013 When looking at a lot of numbers in accounting, budgeting, or anything else, having colored stripes helps to differentiate between lines for faster reading. Recycled \u2013 If you don\u2019t have any need for very sturdy paper, consider recycled paper to save money and reduce waste.", "parent_text": "Computer Paper / POS Rolls / Fax Paper", "keyword_density": {"paper": "3.9", "computer paper": "3.9"}, "department_id": 30}
