{"department_text": "Office Supplies", "nr_products": 262, "level": -2, "url": "http://www.staples.com/Card-Stock/cat_CL140680", "text": "Card Stock", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Card Stock", "parent_url": "http://www.staples.com/White-Copy-Printer-Paper/cat_DP5027", "keyword_count": {"card": 2, "card stock": 1, "stock": 3}, "description_wc": 87, "description_text": "Card stock and cover stock are both useful for making your poster, presentation, or menu stand out and attract the eye. There are varying grades of quality for different uses. When purchasing card and cover stock, consider the following: Color availability \u2013 Every package has a different variation of colors and shades. Consider how whatever you are placing on the paper might look on any of the colors in the package. Weight - There are different weights of paper that help determine the durability and feel of the paper.", "parent_text": "White Copy / Printer Paper", "keyword_density": {"card stock": "2.3", "card": "2.3", "stock": "3.4"}, "department_id": 30}
{"nr_products": 53, "level": -2, "url": "http://www.staples.com/Color-Printing-Paper/cat_CL164300", "text": "Color Printing Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/White-Copy-Printer-Paper/cat_DP5027", "parent_text": "White Copy / Printer Paper", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 94, "level": -2, "url": "http://www.staples.com/Laser-Paper/cat_CL140783", "text": "Laser Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Laser Paper", "parent_url": "http://www.staples.com/White-Copy-Printer-Paper/cat_DP5027", "keyword_count": {"laser": 5, "paper": 7, "laser paper": 4}, "description_wc": 125, "description_text": "Make presentations and reports that pop. Staples helps you find great value in laser paper at everyday low prices. Consider the following when choosing from brands like HammerMill, HP, and Xerox: Size \u2013 We offer 8.5\"x11\", 8.5\"x14\", and 11\"x17\" paper sizes so you can find the best option for creating attractive documents. Weight \u2013 With weights that range from 20 to 34 lbs., Staples makes it easy to find the laser printer paper you need. Glossy Paper \u2013 Several brands offer glossy laser paper for vibrant color brochures, pamphlets, or newsletters. Whether you need laser paper for text copies, photos, or professional documents, it's easy to find what you need at Staples. Browse our selection for the best value in laser paper.", "parent_text": "White Copy / Printer Paper", "keyword_density": {"laser paper": "6.5", "paper": "5.7", "laser": "4.1"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 9, "level": -2, "url": "http://www.staples.com/Inkjet-Paper/cat_CL140781", "text": "Inkjet Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Inkjet Paper", "parent_url": "http://www.staples.com/White-Copy-Printer-Paper/cat_DP5027", "keyword_count": {"paper": 7, "inkjet paper": 3, "inkjet": 4}, "description_wc": 90, "description_text": "Save on high-quality inkjet paper from trusted brands. Choose from Xerox, HammerMill, HP, or Staples Branded paper. When shopping for inkjet paper, consider the following specifications: Brightness \u2013 Brighter paper produces bold rich colors and crisp black text. Sources \u2013 Staples offers inkjet paper brands that are endorsed by the Rainforest Alliance and/or made from post-consumer content. For ultra white inkjet printer paper that gives you vibrant colors and solid black text, check out the wide selection at Staples. We offer reams and cases of the paper you need.", "parent_text": "White Copy / Printer Paper", "keyword_density": {"paper": "7.8", "inkjet paper": "6.7", "inkjet": "4.4"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 91, "level": -2, "url": "http://www.staples.com/Copy-Multipurpose-Paper/cat_CL140691", "text": "Copy & Multipurpose Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Copy & Multipurpose Paper", "parent_url": "http://www.staples.com/White-Copy-Printer-Paper/cat_DP5027", "keyword_count": {"copy": 2, "paper": 3, "multipurpose paper": 1}, "description_wc": 71, "description_text": "We have a large selection of copy paper and multipurpose paper to match any of your needs with brands like HammerMill, HP, Xerox, and our own Staples brand. Choose from 20 lb to 28 lb for heavier ink coverage. Select letter, legal or ledger You will also get crisp images thanks to brightness ratings from 90 to 98 US. Buy copy paper by the case, carton, ream or in bulk quantities.", "parent_text": "White Copy / Printer Paper", "keyword_density": {"paper": "4.2", "copy": "2.8", "multipurpose paper": "2.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 13, "level": -2, "url": "http://www.staples.com/Thermal-Paper-Rolls/cat_CL140672", "text": "Thermal Paper Rolls", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Thermal Paper Rolls", "parent_url": "http://www.staples.com/Computer-Paper-POS-Rolls-Fax-Paper/cat_DP1464", "keyword_count": {"paper": 6, "thermal paper rolls": 1, "thermal paper": 3}, "description_wc": 103, "description_text": "Thermal paper rolls are used in a variety of organizations like restaurants, retail stores, banks, and convenient stores. The paper is infused with chemicals that respond to heat by changing the color of the paper. Some common uses for the paper are: Lottery ticket \u2013 That\u2019s why these tickets have a smooth texture and a reflective surface. Don\u2019t leave it out in the sun too long though. Calculators \u2013 Thermal paper can also be found in the desktop calculators that print the math as you go along. Receipts \u2013 Most commonly, thermal paper is used for receipts and will stay in better condition longer.", "parent_text": "Computer Paper / POS Rolls / Fax Paper", "keyword_density": {"paper": "5.8", "thermal paper rolls": "2.9", "thermal paper": "5.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 39, "level": -2, "url": "http://www.staples.com/Paper-POS-Rolls/cat_CL140671", "text": "Paper & POS Rolls", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Paper & POS Rolls", "parent_url": "http://www.staples.com/Computer-Paper-POS-Rolls-Fax-Paper/cat_DP1464", "keyword_count": {"paper": 2, "rolls": 2}, "description_wc": 87, "description_text": "Paper rolls have a variety of uses and come in either one part or two parts depending on their use. They can be used in calculators, registers, ATMs, gas stations, and more. Here are a few things to consider when choosing a paper roll: One or two parts \u2013 Depending on your needs, you have the options of printing two copies of one transaction at the same time. Quality vs. Quantity - Different machines have different quality needs. A gas station would need different rolls than a desktop calculator.", "parent_text": "Computer Paper / POS Rolls / Fax Paper", "keyword_density": {"paper": "2.3", "rolls": "2.3"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Waterproof-Wide-Format-Paper/cat_CL168972", "text": "Waterproof Wide Format Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Waterproof Wide Format Paper", "parent_url": "http://www.staples.com/Wide-Format-Printing-Paper-Rolls/cat_DP2263", "keyword_count": {"wide format": 3, "paper": 5, "waterproof wide format paper": 2, "waterproof": 3}, "description_wc": 201, "description_text": "Waterproof wide-format paper is strong and durable, resisting tears and chemicals to give you a great accessory for creating signs. Use the paper with your office laser printer to create dynamic prints that'll grab the attention of your clients and coworkers. The long-lasting paper is a great alternative to laminating your materials. Easier Than Laminating Perfect for the cost-conscious office, waterproof wide-format paper will resist chemicals and grease, making it a fine choice for your important signs or documents. When you need a permanent sign or menu, printing it out on one of these sheets is easier than going through the lamination process. Compatible with Your Standard Laser Printer Use your office laser printer to create bold documents that'll catch the eye with this waterproof paper. The ink will stay intact even in wet conditions, giving you a great image that'll work for your outdoor signage. Durable and Long-Lasting If your office is on a budget and are looking for a long-term solution to your important signs, these wide-format sheets will get the job done. Choose between a number of sizes and create a document that'll resist tears and chemicals.", "parent_text": "Wide Format Printing Paper Rolls", "keyword_density": {"waterproof": "1.5", "paper": "2.5", "wide format": "3.0", "waterproof wide format paper": "4.0"}, "department_id": 30}
{"nr_products": 118, "level": -2, "url": "http://www.staples.com/Wide-Format-Inkjet-Machines-w-Aqueous-Inks/cat_CL206114", "text": "Wide Format Inkjet Machines w/ Aqueous Inks", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/Wide-Format-Printing-Paper-Rolls/cat_DP2263", "parent_text": "Wide Format Printing Paper Rolls", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 6, "level": -2, "url": "http://www.staples.com/PM-Company-Wide-Format-Paper/cat_CL142872", "text": "PM Company Wide Format Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "PM Company Wide Format Paper", "parent_url": "http://www.staples.com/Wide-Format-Printing-Paper-Rolls/cat_DP2263", "keyword_count": {"pm company wide format paper": 3, "wide": 6, "paper": 6, "pm company": 4, "wide format paper": 5}, "description_wc": 151, "description_text": "PM Company offers a range of wide format papers for your copying needs. Compatible with any xerographic copier in your office, Amerigo wide format papers produce smooth images that are great for blueprints, charts, and more. Various Sizes The Amerigo brand of PM Company wide format papers is available in a wide variety of sizes to suit your needs. From small rolls that are great for an occasional project to larger rolls designed for daily use, we carry sizes to see you through any job. Dust-Free and Smooth Surface Copy with confidence, knowing that the end result will be unmarred by paper fiber or dust. PM Company wide format papers are also scratch and mark resistant, for perfect results every time. Compatible PM Company wide format papers are compatible with virtually any xerographic copier . It's a cost effective way to copy large charts and graphs at low cost.", "parent_text": "Wide Format Printing Paper Rolls", "keyword_density": {"pm company wide format paper": "10.0", "wide": "4.0", "paper": "4.0", "pm company": "5.3", "wide format paper": "10.0"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 4, "level": -2, "url": "http://www.staples.com/Epson-Wide-Format-Paper/cat_CL158843", "text": "Epson Wide Format Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Epson Wide Format Paper", "parent_url": "http://www.staples.com/Wide-Format-Printing-Paper-Rolls/cat_DP2263", "keyword_count": {"wide": 5, "epson wide format paper": 3, "paper": 5, "epson wide format": 4}, "description_wc": 140, "description_text": "Epson wide format paper is perfect for oversized jobs that won't fit on standard 8-inch copy paper. With options from rolls to single sheets at 11 to 17 inches wide, you can print virtually at any length. With matte, premium and photo finishes, you'll be assured of professional results. Dries Quickly Epson wide format paper dries quickly so you'll be able to handle your documents from nearly the minute they leave the printer. Bright White The bright white background of Epson wide format matte, premium, and photo papers creates the perfect backdrop to make colors pop. Print reproductions of photographs with confidence. Heavyweight and High Resolution Epson wide format paper offers heavyweight base stock that's excellent for laminating or framing. With a high resolution compatibility of 1440 dpi, you'll never worry about results again.", "parent_text": "Wide Format Printing Paper Rolls", "keyword_density": {"wide": "3.6", "epson wide format paper": "8.6", "paper": "3.6", "epson wide format": "8.6"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Canon-Wide-Format-Paper/cat_CL162582", "text": "Canon Wide Format Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Canon Wide Format Paper", "parent_url": "http://www.staples.com/Wide-Format-Printing-Paper-Rolls/cat_DP2263", "keyword_count": {"wide format paper": 3, "canon wide format paper": 2, "paper": 10, "canon": 3}, "description_wc": 186, "description_text": "Canon wide-format paper is ideal for your business projects, especially if you want to print larger images or text than usual. The premium bond paper is 24 inches in height, and the 150-inch length makes it easy to use it for banners and long printouts. The bonded paper isn't coated, so it can be used for drafting, spreadsheets, and more. Unique Size If you normally print small items, you might want to use printer paper in a conventional size, but for larger projects, Canon wide-format paper is the best tool for the job. This paper is 150 inches long, so you can make large banners and tall posters, and the 24-inch height is ideal for most poster-sized frames. Multiple Uses Canon premium bond paper is not coated, so you can use it for drafting. You might also use it for schedules, tables, and large spreadsheets. Heavy Weight This wide-format paper is 75 g/m2, so it is durable and won't bend as easily as thinner papers. The paper comes on a roll to keep it in good condition.", "parent_text": "Wide Format Printing Paper Rolls", "keyword_density": {"wide format paper": "4.8", "canon wide format paper": "4.3", "paper": "5.4", "canon": "1.6"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 14, "level": -2, "url": "http://www.staples.com/HP-Wide-Format-Paper/cat_CL142870", "text": "HP Wide Format Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "HP Wide Format Paper", "parent_url": "http://www.staples.com/Wide-Format-Printing-Paper-Rolls/cat_DP2263", "keyword_count": {"paper": 13, "hp wide format paper": 4, "wide format": 5}, "description_wc": 177, "description_text": "With HP wide-format paper, you can print your own designs, posters, and retail displays without the need for expensive printing services. Rolls come in a variety of sizes, so you can always find the right fit for your printer. With photo paper, bond paper, and several other varieties to choose from, you're sure to find the right paper for your printing needs. Premium Photo Paper With HP wide-format paper, you can easily find high-quality photo paper for printing posters, displays, and other sales materials. These papers help you produce sharp, clear images for a professional look without the professional cost. Bond and Tracing Papers HP wide-format paper is also available in universal bond and tracing paper. These papers make it easy to print CAD designs and blueprints right from your office using a wide-format printer . Multiple Sizes HP wide-format paper comes in a variety of sizes. Whether you need long rolls for huge printing jobs or short rolls for multiple projects, you're sure to find what you need.", "parent_text": "Wide Format Printing Paper Rolls", "keyword_density": {"paper": "7.4", "hp wide format paper": "9.1", "wide format": "5.7"}, "department_id": 30}
