{"department_text": "Office Supplies", "nr_products": 127, "level": -1, "url": "http://www.staples.com/Composition-Notebooks/cat_CL141396", "text": "Composition Notebooks", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Composition Notebooks", "parent_url": "http://www.staples.com/Notebooks-Notepads/cat_CG1234", "keyword_count": {"composition notebooks": 2}, "description_wc": 80, "description_text": "Composition notebooks are a convenient and inexpensive way to keep track of important notes and appointments. Staples has many of the top brands like National Brand, Oxford, Staples brand, and Earthwise. Choose between wide-ruled paper, for larger hand-writing and more space, or college-ruled paper, for smaller hand-writing. Ideal for keeping a personal or business journal, staying organized with notes, and keeping records. Composition notebooks are bound together with a durable cover for regular use and travel.", "parent_text": "Notebooks / Notepads", "keyword_density": {"composition notebooks": "5.0"}, "department_id": 30}
