{"department_text": "Office Supplies", "nr_products": 20, "level": -1, "url": "http://www.staples.com/Steno-Memo-Notebooks/cat_CL140571", "text": "Steno / Memo Notebooks", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Steno / Memo Notebooks", "parent_url": "http://www.staples.com/Notebooks-Notepads/cat_CG1234", "keyword_count": {"memo": 2, "steno": 2, "memo notebooks": 1}, "description_wc": 57, "description_text": "Staples has a large variety of Steno and Memo pads for portable and easy note taking on the fly. We have many top brands like Tops, Staples brand, Mead, and Ampad. Choose from different sizes like 6x9, 7x5, and 4x8. Choose from recycled options of steno and memo notebooks. Choose from several different designs, colors, and patterns.", "parent_text": "Notebooks / Notepads", "keyword_density": {"memo": "3.5", "steno": "3.5", "memo notebooks": "3.5"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Pencils/cat_DP1102", "text": "Pencils", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Pencils", "parent_url": "http://www.staples.com/Pens-Pencils-Markers/cat_CG11", "keyword_count": {"pencils": 1}, "description_wc": 129, "description_text": "Whether you\u2019re taking notes or writing that first draft, a reliable pencil is always good to have on hand. With a range of traditional and mechanical options in several different price ranges and styles, it\u2019s easy to find the option that works for you. Simple and reliable : Choose a classic and sturdy #2 wood pencil and you\u2019re sure to get the job done well. Sharpen quickly : Try a battery or electric pencil sharpener. Or, forget sharpening all together : Choose from a variety of well-designed mechanical pencils with refillable lead and superior grips. High quality lead : Sturdy, reliable lead refills in stock for every model of mechanical pencil. We\u2019ll help you stock up so your pencil will be ready to go when you need it.", "parent_text": "Pens / Pencils / Markers", "keyword_density": {"pencils": "0.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 4, "level": -1, "url": "http://www.staples.com/Graph-Paper/cat_CL166629", "text": "Graph Paper", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Graph Paper", "parent_url": "http://www.staples.com/Notebooks-Notepads/cat_CG1234", "keyword_count": {"graph": 7, "paper": 4, "graph paper": 3}, "description_wc": 193, "description_text": "Graph paper is designed to give you a precise grid to draw on, ensuring exact measurements and images. Waterproof ink makes sure your graph isn't washed away in the event of a liquid spill, and the blue lines won't show up if you want a grid-free copy. Standard 8.5-inch-by-11-inch paper lets your completed drawing slip easily into most folders, notebooks, and files.. Draw the Graph You Need Whether you need to graph a complex linear equation, plot out your next business expansion, or give a visual representation of your company's finance, graph paper is available in both quadrille and cross-sectional orientations and a variety of sizes to suit your needs. Take Your Graphs with You Graph paper with a three-hole-punched margin makes it easy to slip individual sheets or whole pads into your three-ring binder or briefcase. Throw some pens or colored pencils in too, and you're all set. Keep on Drawing Don't worry about accidental miscalculations or stray pen marks. Pads come in both 100- and 200-sheet sizes, so you can complete your project in one sitting.", "parent_text": "Notebooks / Notepads", "keyword_density": {"graph": "3.6", "paper": "2.1", "graph paper": "3.1"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 17, "level": -1, "url": "http://www.staples.com/Correction-Supplies/cat_CL168286", "text": "Correction Supplies", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Correction Supplies", "parent_url": "http://www.staples.com/Pens-Pencils-Markers/cat_CG11", "keyword_count": {"correction": 7, "correction supplies": 2}, "description_wc": 101, "description_text": "Browse our assortment of correction supplies for a unique correction solution that fits your needs. Take care of those embarrassing typographical or written errors with accuracy and speed. Inexpensive and fast : Choose classic correction fluid you know you can trust. Precise correction : With correction pens from top names like Presto! and BIC, correct even the smallest errors with little spillover to nearby text. No drying : Try correction tape and skip the drying time altogether. From big errors to small ones, having the right correction supplies in your desk drawer will help you finish your projects efficiently without losing that professional feel.", "parent_text": "Pens / Pencils / Markers", "keyword_density": {"correction": "6.9", "correction supplies": "4.0"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 295, "level": -1, "url": "http://www.staples.com/Notebooks/cat_CL142104", "text": "Notebooks", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Notebooks", "parent_url": "http://www.staples.com/Notebooks-Notepads/cat_CG1234", "keyword_count": {"notebooks": 1}, "description_wc": 93, "description_text": "We have a large selection of notebooks with all of the top notebook brands like Mead, Staples brand,Black N\u2019 Red, Martha Stewart Home Office, and Ampad. Choose from a large variety of colors, sizes,designs, and paper types. Choose between flexible, durable, and hardbound covers to match your needs. Choose between multiple sizes and paper weights from 15lb. to 20lb. Perforated and micro-perforated paper make it simple and convenient to tear cleanly out of your notebook. Perforated paper has small holes and micro-perforated paper has even smaller holes for the cleanest tear.", "parent_text": "Notebooks / Notepads", "keyword_density": {"notebooks": "1.1"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Markers/cat_DP1101", "text": "Markers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Markers", "parent_url": "http://www.staples.com/Pens-Pencils-Markers/cat_CG11", "keyword_count": {"markers": 5}, "description_wc": 132, "description_text": "Whether you\u2019re working out a complex problem on a white board or preparing for a poster presentation, it\u2019s important to have the right marker for every type of project. At Staples, we carry a wide array of markers in all shapes and sizes to meet every need. Make a long-lasting mark on a wide range of surfaces : Try a permanent marker, available in many different colors and various tips for everything from the most precise writing to the most difficult of materials. Top names in markers : Sharpie, Bic and Expo. Go green : AP certified non-toxic markers and many allergy-free markers in stock. Solve a problem, brainstorm solutions or track a calendar : Try dry erase markers, kits and accessories. A warehouse of tools for a warehouse of projects.", "parent_text": "Pens / Pencils / Markers", "keyword_density": {"markers": "3.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 69, "level": -1, "url": "http://www.staples.com/Writing-Bulk-Shop/cat_CL168947", "text": "Writing Bulk Shop", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Writing Bulk Shop", "parent_url": "http://www.staples.com/Pens-Pencils-Markers/cat_CG11", "keyword_count": {"shop": 3, "writing bulk shop": 2, "bulk": 7, "writing": 5}, "description_wc": 82, "description_text": "Maximize your savings when shopping for writing instruments at Staples by buying in BULK. We offer bulk pack sizes with prices starting as low as $.01 per pen! Incredible Savings: Staples Writing Bulk Shop offers bulk pack sizes starting as low as $.01 per pen! Famous Brands: Staples carries all of the top brands in bulk writing like Bic, Paper Mate, Pentel, Pilot, Sharpie and more! Bulk Writing Instrument Types: Choose from Mechanical Pencils, Pens, Markers & Highlighers within our Writing Bulk Shop!", "parent_text": "Pens / Pencils / Markers", "keyword_density": {"shop": "3.7", "writing bulk shop": "7.3", "bulk": "8.5", "writing": "6.1"}, "department_id": 30}
