{"department_text": "Office Supplies", "nr_products": 72, "level": -1, "url": "http://www.staples.com/Notepads/cat_CL140569", "text": "Notepads", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Notepads", "parent_url": "http://www.staples.com/Notebooks-Notepads/cat_CG1234", "keyword_count": {"notepads": 3}, "description_wc": 153, "description_text": "Notepads are perfect for jotting down quick notes, writing to-do lists, or keeping track of items to pick up at the grocery store. Not only are notepads versatile, but they\u2019re also convenient. If you\u2019re in a rush, just slip a note pad in your back pocket or purse to use on the go. It\u2019s also a good idea to keep a few writing or legal pads in your desk drawer just in case you need to take notes while on the phone or in a meeting. Many writing pads feature perforated pages to make tearing off sheets quick and easy. Staples carries more then basic white or yellow notepads - whether you need a custom personalized notepad, recycled, or a specific color, we have the selection you need. Staples also has a wide selection of legal pads and writing pads in assorted sizes, colors, and styles to suit every task.", "parent_text": "Notebooks / Notepads", "keyword_density": {"notepads": "2.0"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 260, "level": -1, "url": "http://www.staples.com/Fine-Writing/cat_CL167080", "text": "Fine Writing", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Fine Writing", "parent_url": "http://www.staples.com/Pens-Pencils-Markers/cat_CG11", "keyword_count": {"fine writing": 4, "writing": 5}, "description_wc": 125, "description_text": "Whether you're trying to accessorize yourself with an elegant writing instrument, or looking for ideal gift ideas for any client, colleague, boss or employee you can be assured that you will find what you are looking for with our large selection of fine writing instruments at Staples\u00ae. Pen Style - Choose from Ballpoint pens, Rollerball pens, Gel pens or Fountain style pens within our fine writing assortment. Famous Brands - Browse our selection of fine writing from brands like Cross, Parker, Pilot, Sheaffer and more! Ready to give - Your fine writing instrument is pre-packaged in beautiful boxes so your gift is ready to please. Do several tasks at once - Multi-function pens available for easy alternation between multiple projects requiring a pen or pencil.", "parent_text": "Pens / Pencils / Markers", "keyword_density": {"fine writing": "6.5", "writing": "4.0"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Pens/cat_DP1100", "text": "Pens", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Pens", "parent_url": "http://www.staples.com/Pens-Pencils-Markers/cat_CG11", "keyword_count": {"pens": 5}, "description_wc": 141, "description_text": "At Staples, we love pens just as much as you do. That\u2019s why we carry a variety stock of pens that are sure to satisfy every kind of preference. Let us help find the perfect pen for you! Stop losing pen caps : Try a retractable ballpoint pen from top brands like BIC, uni-ball and Pilot. A professional look for your front desk : Choose a chic yet function countertop pen that will impress customers. Let the words glide across the page : Take your pick of elegant gel ink pens in vibrant colors. Precision and variety : Try our felt and porous pens for precise writing and detailed art projects. Simple and inexpensive options available : Try a ballpoint stick pen to get the job done right, always. With Staples on your side, you\u2019ll always have the right pen for the job.", "parent_text": "Pens / Pencils / Markers", "keyword_density": {"pens": "3.5"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Large-Catalog-Envelopes/cat_DP2189", "text": "Large Catalog Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Large Catalog Envelopes", "parent_url": "http://www.staples.com/Envelopes/cat_CG23", "keyword_count": {"large": 5, "large catalog envelopes": 4, "envelopes": 7}, "description_wc": 159, "description_text": "Keep your business mailings looking great by using large catalog envelopes. These envelopes let you prepare flat mailings instead of having to fold items to fit in a standard envelope. Clasp, self-sealing, and gummed closures provide an assortment of options to best prepare your business mail. Padded mailers are also available in large sizes for extra insurance against damage during shipping. Easy Closing Use the self-sealing types of large catalog envelopes to make it quick and easy to close envelopes when you're preparing bulk mailings. Address your shipping labels using your computer for added convenience. Extra Protection Padded mailers protect items during shipping. These types of large catalog envelopes feature a self-sealing strip for easy closing and a pull-tab tear strip for fast and safe opening. Ecofriendly Options If you're concerned about the environment, large catalog envelopes made with 20 percent postconsumer content are available. These ecofriendly envelopes are processed without using chlorine.", "parent_text": "Envelopes", "keyword_density": {"large": "3.1", "large catalog envelopes": "7.5", "envelopes": "4.4"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Specialty-Envelopes/cat_DP2190", "text": "Specialty Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Specialty Envelopes", "parent_url": "http://www.staples.com/Envelopes/cat_CG23", "keyword_count": {"specialty envelopes": 3, "envelopes": 10}, "description_wc": 183, "description_text": "You don't have to restrict your business mailings to standard-size envelopes. The assortment of specialty envelopes lets you mail all kinds of oddly shaped items, such as CDs, DVDs, and invitations. Keep a wide selection in your office supply cabinet so that you have everything you need for your next bulk mailing, and explore personalized and specialized options, all in one, with our selection of custom envelopes . Convenient Interdepartmental Mailing Using interdepartmental envelopes is the economical way to transmit mail from one department to another. These specially designed, reusable envelopes ensure documents are delivered to the right person. Safe Media Mailing Specialty envelopes ensure your multimedia presentations make it through the mail in great shape. CD and DVD envelopes are the right size for mailing media disks, so you don't have to worry about envelope damage due to a poor fit. Print address labels using your computer to neatly prepare your mailings. Reusable Envelopes Transparent and reusable poly envelopes offer easy viewing and economy. These specialty envelopes are available with top and side openings to suit your business needs.", "parent_text": "Envelopes", "keyword_density": {"specialty envelopes": "3.3", "envelopes": "5.5"}, "department_id": 30}
