{"department_text": "Office Supplies", "nr_products": 67, "level": -1, "url": "http://www.staples.com/Fashion-Colored-Duct-Tape/cat_CL167765", "text": "Fashion / Colored Duct Tape", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Fashion / Colored Duct Tape", "parent_url": "http://www.staples.com/Tape-Glue-Adhesives/cat_DP100", "keyword_count": {"fashion": 1, "tape": 5, "duct tape": 4}, "description_wc": 52, "description_text": "Do you wonder how to make a duct tape wallet? Does the question \u201cwhat is duck tape\u201d cross your mind? Staples\u00ae has all the duck brand duct tape and Scotch\u00ae brand duct tape you need. We have solid colors, licensed and fashion designs. Let Staples\u00ae be your destination for duct tape crafts!", "parent_text": "Tape / Glue / Adhesives", "keyword_density": {"fashion": "1.9", "tape": "9.6", "duct tape": "15.4"}, "department_id": 30}
