{"department_text": "Office Supplies", "nr_products": 78, "level": -2, "url": "http://www.staples.com/Wood-Pencils/cat_CL110200", "text": "Wood Pencils", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Wood Pencils", "parent_url": "http://www.staples.com/Pencils/cat_DP1102", "keyword_count": {"pencils": 2}, "description_wc": 32, "description_text": "See our large pencil assortment for all your home, office or classroom needs. Choose from number 2 pencils for everyday use or specialty pencils with unique leads ideal for projects and presentations.", "parent_text": "Pencils", "keyword_density": {"pencils": "6.2"}, "department_id": 30}
