{"department_text": "Office Supplies", "nr_products": 4, "level": -2, "url": "http://www.staples.com/Overhead-Markers/cat_CL110102", "text": "Overhead Markers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Overhead Markers", "parent_url": "http://www.staples.com/Markers/cat_DP1101", "keyword_count": {"overhead markers": 3, "markers": 4}, "description_wc": 121, "description_text": "Shop our wide selection of Expo overhead markers for the vibrant style that will retain your audience\u2019s attention, whether in the classroom or during a big presentation. We carry a diverse range of styles to satisfy your preferences. For more ideas, check out our research centers. Various colors : Find every color you need to make your notes and ideas come to life. Simple mistake correction : Our wet-erase markers are easily and fully erasable. Buy in bulk : Try a 4-pack or 8-pack for the greatest variety and value. Write in good health : Our overhead markers are all AP Certified Non-toxic. A quick look at our vivid collection of overhead markers will bring you to a colorful solution.", "parent_text": "Markers", "keyword_density": {"overhead markers": "5.0", "markers": "3.3"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 37, "level": -2, "url": "http://www.staples.com/Art-Markers/cat_CL110501", "text": "Art Markers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Art Markers", "parent_url": "http://www.staples.com/Markers/cat_DP1101", "keyword_count": {"art": 6, "art markers": 2, "markers": 4}, "description_wc": 121, "description_text": "Art markers are among the most unique tools on the market. Browse our diverse selection of Crayola, Mr. Sketch and Dixon artist markers and get your project jump started. For more great ideas. please visit our research centers. Wide variety : Our art pens and design markers vary in tip size from very fine to thick so you can work with the smallest details or in the greatest breadth. Various colors and features : Find all the colors of the rainbow, all safe, non toxic and washable so you can work without worry. Affordable : Try one of our variety packs for several different options in one package. Browse our art markers today and make those art projects and color books come to life.", "parent_text": "Markers", "keyword_density": {"art": "5.0", "art markers": "3.3", "markers": "3.3"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 21, "level": -2, "url": "http://www.staples.com/Specialty-Markers/cat_CL140898", "text": "Specialty Markers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Specialty Markers", "parent_url": "http://www.staples.com/Markers/cat_DP1101", "keyword_count": {"specialty markers": 2, "specialty": 3, "markers": 5}, "description_wc": 131, "description_text": "Browse our specialty markers and find a unique look for your poster, presentation or art project. With a host of options, you\u2019ll find just what you\u2019re searching for. Visit our research centers for more information. A range of styles in various colors : Try china or paint markers for distinctive and colorful writing and drawing on glass, plastic, cellophane or wood. Make a permanent mark : Find a range of permanent and laundry markers in various tip sizes and clearly label any fabric or cloth. For the most intense conditions, try industrial markers, built to sustain chemical washes, UV light and extreme heat and to write on a variety of surfaces. The top brands : Specialty markers from Dixon, Sanford and Sharpie. Try a specialty marker today for a unique writing experience.", "parent_text": "Markers", "keyword_density": {"specialty markers": "3.1", "specialty": "2.3", "markers": "3.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 19, "level": -2, "url": "http://www.staples.com/Tank-Style-Highlighters/cat_CL158889", "text": "Tank-Style Highlighters", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Tank-Style Highlighters", "parent_url": "http://www.staples.com/Highlighters/cat_DP1484", "keyword_count": {"style": 2, "tank style highlighters": 1}, "description_wc": 32, "description_text": "Tank style highlighters\u00a0are available in chisel tip for broad line highlighting or fine\u00a0underlining.\u00a0We have a wide assortment of colors, styles, sizes\u00a0that will make highlighting those important documents easy!", "parent_text": "Highlighters", "keyword_density": {"style": "6.2", "tank style highlighters": "9.4"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 127, "level": -2, "url": "http://www.staples.com/Gel-Ink-Pens/cat_CL140899", "text": "Gel-Ink Pens", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Gel-Ink Pens", "parent_url": "http://www.staples.com/Pens/cat_DP1100", "keyword_count": {"gel ink": 1, "gel": 5, "pens": 5, "ink": 2}, "description_wc": 128, "description_text": "Browse our wide selection of gel pens for a smooth, precise writing experience. With leading names like Bic, Pentel, Pilot, uni-ball and Zebra, our pens are of the highest quality. For more information, please visit our research centers. Various colored inks : Our colored gel pens come in many different colors so your notes and letters will really stand out. Take your pick of point sizes : From fine to bold, we have a point size that\u2019s right for the task. Nurture your fingers : We carry gel pens with comfortable grips for all grip types. Reusable : Stay green with a recycled and refillable gel ink pen you can use for years to come. Browse our wide selection of single and value pack gel pens and get writing today!", "parent_text": "Pens", "keyword_density": {"ink": "1.6", "gel": "3.9", "pens": "3.9", "gel ink": "1.6"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 2, "level": -2, "url": "http://www.staples.com/Ship-Lite-Envelopes/cat_CL167833", "text": "Ship-Lite Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Ship-Lite Envelopes", "parent_url": "http://www.staples.com/Specialty-Envelopes/cat_DP2190", "keyword_count": {"ship": 6, "ship lite envelopes": 5, "envelopes": 7}, "description_wc": 171, "description_text": "With Ship-Lite envelopes, you can ship papers, books, catalogs, and even some bulky items quickly and conveniently. The Ship-Lite envelopes come in a variety of sizes, so you can easily find the right envelope to fit your needs. You can choose flat envelopes for mailing standard paper or expandable envelopes for sending books or other bulky items. Reinforced Paper The Ship-Lite envelopes are made from paper that is reinforced with mesh-screen polyfibers, so they'll remain secure, even with rough handling. You can be confident that whatever you send will arrive safely and securely. Self Sealing Ship-Lite envelopes are also self sealing, making it easy for you to handle large mailing lists without the need to seal each envelope manually. To save even more time, print your mailing list addresses on convenient address labels. Moisture Resistant These Ship-Lite envelopes are moisture resistant, so whatever you send will remain protected, even in wet conditions. Your papers will remain dry, even when the mail carrier gets wet.", "parent_text": "Specialty Envelopes", "keyword_density": {"ship": "3.5", "envelopes": "4.1", "ship lite envelopes": "8.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 6, "level": -2, "url": "http://www.staples.com/Letter-Openers/cat_CL10500", "text": "Letter Openers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Letter Openers", "parent_url": "http://www.staples.com/Business-Envelopes/cat_DP2188", "keyword_count": {"letter openers": 2, "openers": 3, "letter": 7}, "description_wc": 158, "description_text": "Letter openers come in both standalone and handheld designs. Both designs are equally adept at freeing documents without damaging key text on letters. A powerful letter opener can open thousands of letters per hour or make quick work of an otherwise tricky padded envelopes . Quick Opening Letter openers make opening large numbers of letters easy. Just slide the envelope through the opener or vice versa to free your mail without spending undue time or getting paper cuts. Precise Cutting Openers feature carefully measured blades and often have slots that align envelope edges for even greater precision cuts. If you need precision tools for aligning text on an envelope or deciphering return addresses, check out magnifiers. Preserve Envelopes Stamp collectors aren't the only ones who want to preserve envelopes. A clean cut letter opener allows your business to store the envelope without damaging key text and to retain the information on exactly when and where it originated.", "parent_text": "Business Envelopes", "keyword_density": {"letter openers": "2.5", "openers": "1.9", "letter": "4.5"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Custom-Envelopes/cat_CL167716", "text": "Custom Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Custom Envelopes", "parent_url": "http://www.staples.com/Business-Envelopes/cat_DP2188", "keyword_count": {"custom envelopes": 2, "envelopes": 6, "custom": 4}, "description_wc": 178, "description_text": "Custom envelopes allow you to personalize how you send your mail and messages. They have clear areas where you can easily read the address and different box sizes provide quantities of up to five hundred, so you'll always have envelopes when you need them. Easy Mailing White custom envelopes are easy to print on, so you can address and mail them quickly. Labels are great for those who need to address multiple envelopes, since you don't need to rewrite the address on every piece of mail. Clear Address Box You can print an address on a billing statement or document easily. Thanks to the clear address box on each custom envelope, you'll be able to use the address on the document instead of rewriting it on the envelope. Different Quantities Whether your business is large or small, mailing is part of your work. Boxes of five hundred envelopes are perfect for mass mailing or single bill payments. If you are looking for a custom sized envelope for media, browse our selection of CD envelopes .", "parent_text": "Business Envelopes", "keyword_density": {"custom envelopes": "2.3", "envelopes": "3.4", "custom": "2.3"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 7, "level": -2, "url": "http://www.staples.com/Recycled-Envelopes/cat_CL164400", "text": " Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": " Envelopes", "parent_url": "http://www.staples.com/Business-Envelopes/cat_DP2188", "keyword_count": {"envelopes": 9}, "description_wc": 183, "description_text": "Recycled envelopes from Staples are made with a percentage of recycled postconsumer paper, so you can minimize your ecological footprint. The envelopes are available in a variety of colors, shapes, and styles, allowing you to select the option that is best for your business. Each envelope offers the same aesthetic value and strength as nonrecycled envelopes. Recycled Content Each of Staples' recycled envelopes is made with a minimum of 30 percent recycled postconsumer paper; some envelopes are made with 100 percent recycled paper. If you need extra space to store your envelopes and mailing supplies, check out our mail carts. Multiple Sizes Our recycled envelopes come in a variety of sizes and styles. Whether you need a standard, letter-sized envelope or a security-tinted option, you'll find one to meet your requirements. Easy Closure All of the recycled envelopes at Staples are made with gummed closures. This way, you can streamline the mailing process and ensure that each envelope is securely closed. If you want to stay green but need to ship media, consider our wide selection of CD envelopes .", "parent_text": "Business Envelopes", "keyword_density": {"envelopes": "4.9"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 8, "level": -2, "url": "http://www.staples.com/Finger-Pads-Moisteners/cat_CL141635", "text": "Finger Pads / Moisteners", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Finger Pads / Moisteners", "parent_url": "http://www.staples.com/Business-Envelopes/cat_DP2188", "keyword_count": {"finger pads": 4, "finger": 9, "moisteners": 5}, "description_wc": 197, "description_text": "Reviewing documents and preparing mail is a cinch when you have a supply of envelope moisteners and envelope finger pads. Cosco and Lee, along with other manufacturers, offer a wide selection of products that keep your fingers tacky and make it easy to moisten envelope adhesives. These products include fingertip moisteners, envelope finger pads, and sponge moisteners. They are great for getting your mail ready to send but we also have a wide letter opener selection for incoming mail. Hygienic Protection Envelope Moisteners & finger pads make it unnecessary to put your fingers in your mouth to achieve enough tackiness to turn pages or to lick envelopes to close them. Using these convenient products prevent you from developing unsanitary habits. Hassle-Free Bulk Mailing Sponge moisteners and moistener pens and pencils enable you to seal hundreds of envelopes before you need to refill. Preparing bulk mailings is a breeze when you have the right tools on hand. Reusable Protection Protect your fingers from nicks and cuts and flip through stacks of documents with ease when you use finger pads and gel grips. These fingertip protectors are durable and can be washed, so they'll provide long-lasting protection.", "parent_text": "Business Envelopes", "keyword_density": {"finger pads": "4.1", "finger": "4.6", "moisteners": "2.5"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 75, "level": -2, "url": "http://www.staples.com/Rollerball-Pens/cat_CL110007", "text": "Rollerball Pens", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Rollerball Pens", "parent_url": "http://www.staples.com/Pens/cat_DP1100", "keyword_count": {"rollerball": 4, "rollerball pens": 2}, "description_wc": 139, "description_text": "For an elegant, smooth writing experience, try a quick-drying rollerball pen. We carry retractable rollerball pens of many different shapes and sizes so you\u2019ll be sure to find the right writing utensil for you. For this and more ideas, take a look through our research centers. The highest quality at affordable prices : With a range of quick-drying, fadeproof and waterproof options, your writing will look great and stick around. Select a value pack and get the most for your money. Various colored inks : Make your writing pop off the page with a variety of colors. The best styles and brands : Try a recycled and refillable retractable rollerball pen in various point sizes with ergonomic grips from Bic, Pilot, uni-ball, Pentel and Staples. Our rollerball pens are the best on the market. Browse our selection today.", "parent_text": "Pens", "keyword_density": {"rollerball": "2.9", "rollerball pens": "2.9"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 16, "level": -2, "url": "http://www.staples.com/Window-Envelopes/cat_CL142681", "text": "Window Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Window Envelopes", "parent_url": "http://www.staples.com/Business-Envelopes/cat_DP2188", "keyword_count": {"window": 3, "window envelopes": 2}, "description_wc": 49, "description_text": "Window envelopes are the standard for businesses and they are excellent for home use as well. Staples features a complete line of single- and double-window versions with security tints for secure mailing. Your invoice, payment, payroll and announcement documents demand the crisp, professional look that window envelopes provide.", "parent_text": "Business Envelopes", "keyword_density": {"window": "6.1", "window envelopes": "8.2"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 43, "level": -2, "url": "http://www.staples.com/Tinted-Security-Envelopes/cat_CL142680", "text": "Tinted Security Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Tinted Security Envelopes", "parent_url": "http://www.staples.com/Business-Envelopes/cat_DP2188", "keyword_count": {"tinted security envelopes": 4, "envelopes": 9}, "description_wc": 193, "description_text": "Tinted security envelopes are a good choice for sending confidential company correspondence, such as payroll stubs, account statements, or client billing statements. They come with a variety of window and sealing options, so you can easily choose the best design for your needs. You'll feel confident knowing that whatever you send will arrive safely and securely, and for bulkier mailing items you want to protect, consider our padded envelopes & mailers . Windows or No Windows Tinted security envelopes are available with one or two windows, so you can print statements and send them without the need for additional address labels. Envelopes are also available without windows so that you can send them using traditional address labels. Multiple Sealing Options Tinted security envelopes also come with a variety of sealing options. You can choose typical gummed labels, which require moistening to seal, or you can select one of the self-sealing options for easy sealing without the need for a moistener. Assorted Sizes Tinted security envelopes are available in a variety of sizes. You can choose standard #10 envelopes, smaller envelopes for use as inserts, or check-sized envelopes specifically for mailing checks.", "parent_text": "Business Envelopes", "keyword_density": {"tinted security envelopes": "6.2", "envelopes": "4.7"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 32, "level": -2, "url": "http://www.staples.com/Plain-Envelopes/cat_CL162973", "text": "Plain Business Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Plain Business Envelopes", "parent_url": "http://www.staples.com/Business-Envelopes/cat_DP2188", "keyword_count": {"plain business envelopes": 4, "envelopes": 8, "business": 5, "plain": 5}, "description_wc": 201, "description_text": "Plain business envelopes offer a convenient option for mailing all your standard business correspondence. Whether you're sending out company notices, paying bills, or mass mailing the latest company sales flyer, these envelopes make mailing easy. A variety of options lets you get just the right envelope to fit your needs. Convenient Sealing Options Plain business envelopes are available in a selection of sealing options. You can choose the standard gummed labels for occasional letters or choose one of the self-sealing options for more convenient use with mass mailing projects. Address labels are also available to make mass mailing easier. Plain or Security Envelopes Plain business envelopes are available with or without the internal security printing, so you can choose the right security options for your mailing needs. They come in a variety of colors, letting you make just the right impression with your correspondence. New or Recycled Materials Plain business envelopes made with recycled materials help you contribute to a healthy environment when you use these envelopes for regular mailing. You can also choose from standard materials, if they're more suited to your needs or preferences, or to better protect what you ship, we recommend padded envelopes .", "parent_text": "Business Envelopes", "keyword_density": {"plain business envelopes": "6.0", "business": "2.5", "envelopes": "4.0", "plain": "2.5"}, "department_id": 30}
{"nr_products": 50, "level": -2, "url": "http://www.staples.com/Foldover-Cards/cat_CL211129", "text": "Foldover Cards", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/Specialty-Envelopes/cat_DP2190", "parent_text": "Specialty Envelopes", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Custom-Catalog-Envelopes/cat_CL167718", "text": "Custom Catalog Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Custom Catalog Envelopes", "parent_url": "http://www.staples.com/Large-Catalog-Envelopes/cat_DP2189", "keyword_count": {"catalog": 6, "custom catalog envelopes": 3, "envelopes": 8, "catalog envelopes": 5}, "description_wc": 217, "description_text": "With custom catalog envelopes from Staples, you can design and produce mailing supplies tailored to your postal needs. Send a professional impression with envelopes that display your company's images and fonts. Each order includes a minimum of five hundred custom catalog envelopes-an affordable solution for bulk mailings. Easy Design Tool Create custom catalog envelopes that match your existing company materials with a user-friendly design tool that allows you to upload your logo and browse a large collection of fonts. Choose white or kraft paper catalog envelopes made from heavy-duty material, and decide exactly where you want to position your business address. Choice of Envelope Sizes Avoid unnecessary bulk by choosing the best size for your correspondence materials. Your options range from medium-sized 6 inch x 9 inch envelopes for lightweight booklets to large 10 inch x 13 inch envelopes for heavier catalogs. A snug fit keeps your marketing materials crisp and unbent while preventing excess mail weight from raising your postal expenses. Convenient Closure Options Select the closure format that fits your budget. Staples offers pregummed catalog envelopes as a standard feature, so there's no need for tape or glue. For additional cost, some envelope sizes are upgradable to a peel-and-stick flap, which you can seal instantly without water.", "parent_text": "Large Catalog Envelopes", "keyword_density": {"catalog": "2.8", "custom catalog envelopes": "4.1", "envelopes": "3.7", "catalog envelopes": "4.6"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 19, "level": -2, "url": "http://www.staples.com/Padded-Envelopes-Mailers/cat_CL141633", "text": "Padded Envelopes / Mailers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Padded Envelopes / Mailers", "parent_url": "http://www.staples.com/Large-Catalog-Envelopes/cat_DP2189", "keyword_count": {"padded": 5, "mailers": 2, "padded envelopes": 3, "envelopes": 8}, "description_wc": 153, "description_text": "Padded envelopes make it easy to ship your items without breakage. Bubbles on the inside protect objects from drops or bumps, and recycled options are great for the environment. Also called padded mailers, some feature quick pull tabs that open them with no hassle after they are sealed. Easy Mailing For small items, you'll be able to use padded envelopes for easy mailing. Longer items and odd shapes may be best in a mailing tube. Self-Sealing Envelopes Some padded envelopes are self-sealing envelopes. This means you won't have to use tape or adhesives. Different Sizes Economical designs make these padded mailers and envelopes perfect for sending small items, breakable items, and clothing in the mail. You can find different sizes of envelopes to suit your needs, and if you are sending media you'd like to protect, our \" CD envelopes will do a perfect job at the lowest price!", "parent_text": "Large Catalog Envelopes", "keyword_density": {"padded": "3.3", "mailers": "1.3", "padded envelopes": "3.9", "envelopes": "5.2"}, "department_id": 30}
{"nr_products": 50, "level": -2, "url": "http://www.staples.com/Cellophane-Sleeves-Envelopes/cat_CL211130", "text": "Cellophane Sleeves / Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/Specialty-Envelopes/cat_DP2190", "parent_text": "Specialty Envelopes", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 4, "level": -2, "url": "http://www.staples.com/Coin-Envelopes/cat_CL164397", "text": "Coin Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Coin Envelopes", "parent_url": "http://www.staples.com/Specialty-Envelopes/cat_DP2190", "keyword_count": {"coin": 4, "envelopes": 6, "coin envelopes": 3}, "description_wc": 123, "description_text": "Coin envelopes are a great choice for handling transfers of office keys and similar small items. They can hold your promos and business cards with ease, and durable construction helps them last for some time in storage. Secure Seals Most envelopes feature either a gummed or self-adhesive seal. Self-adhesive seals are a great choice for when you need to send many envelopes or don't want to risk contamination. Durable Standard coin envelopes feature durable constructions that help protect the contents from both prying eyes and the elements. For even greater protection, try poly envelopes. Versatile Coin envelopes aren't just for holding coins. Antimicrobial versions are excellent for businesses that regularly transfer small pills or capsules between labs or departments.", "parent_text": "Specialty Envelopes", "keyword_density": {"coin": "3.3", "coin envelopes": "4.9", "envelopes": "4.9"}, "department_id": 30}
{"nr_products": 234, "level": -2, "url": "http://www.staples.com/Cardstock-Envelopes/cat_CL211128", "text": "Cardstock Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/Large-Catalog-Envelopes/cat_DP2189", "parent_text": "Large Catalog Envelopes", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 7, "level": -2, "url": "http://www.staples.com/Inter-Departmental-Envelopes/cat_CL142692", "text": "Inter-Departmental Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Inter-Departmental Envelopes", "parent_url": "http://www.staples.com/Specialty-Envelopes/cat_DP2190", "keyword_count": {"inter departmental envelopes": 3, "inter departmental": 4, "inter": 5, "envelopes": 5}, "description_wc": 199, "description_text": "You can save resources by repurposing inter-departmental envelopes to send documents to different employees. Each envelope has designated lines for the recipient's information. A resealable design keeps the envelope intact for frequent use. Simplify Inter-Departmental Mail Cut costs on internal mail with inter-departmental envelopes that are preprinted with sections explaining who the correspondence is for, the department, and the delivery time. Brands like Staples and Quality Park offer two-sided envelopes with space to write on the fronts and backs.Many products also feature punched holes along the body, so the recipient can quickly check that all contents have been removed. Reseal and Reuse Once the envelope is delivered, the recipient can cross out the previous correspondence information and fill in the next line to reuse the mailer. Choose inter-departmental envelopes with Velcro closures, gumming, or the classic button-and-string flap to open and reclose the package without damaging the material. Security Features When authorization is crucial, use confidential envelopes to make sure the contents are only viewed by the intended recipient. Security tinting prevents others from seeing through the envelope, so important documents are protected in communal areas, such as mail-sorting stations.", "parent_text": "Specialty Envelopes", "keyword_density": {"inter departmental envelopes": "4.5", "inter departmental": "4.0", "inter": "2.5", "envelopes": "2.5"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 105, "level": -2, "url": "http://www.staples.com/Poly-Envelopes/cat_CL164398", "text": "Poly Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Poly Envelopes", "parent_url": "http://www.staples.com/Specialty-Envelopes/cat_DP2190", "keyword_count": {"poly": 5, "envelopes": 7, "poly envelopes": 4}, "description_wc": 195, "description_text": "Poly envelopes are crafted from durable engineered plastic that can withstand various environmental conditions. The tough material stops liquids from reaching your papers and resists natural wear. Poly envelopes are a safe mailing option and can be reused as protective coverings. Ship Fragile Documents Poly mailer envelopes keep delicate shipments, such as magazines and brochures, from being torn or stained during transport. The plastic material is resilient, water resistant, and tear resistant but features a smooth texture that won't snag on your documents. Mailers are made with one transparent side along with an opaque backing where you can clearly write out the shipment details. Multiple Formats and Sizes Stock your supply closet with different types of poly envelopes to suit multiple tasks. Staples offers several sizes, and you'll find both top- and side-opening envelopes for easy access to documents in shelf or cabinet filing arrangements. Secure Closure Choose string-and-button closure or self-seal poly envelopes for safe mailing and storage. Self-seal products remain closed when bumped and jostled during travel, while traditional string closures can be opened quickly when you use these sturdy plastic envelopes as everyday file folders.", "parent_text": "Specialty Envelopes", "keyword_density": {"envelopes": "3.6", "poly": "2.6", "poly envelopes": "4.1"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 6, "level": -2, "url": "http://www.staples.com/Recycled-Catalog-Envelopes/cat_CL164401", "text": " Catalog Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": " Catalog Envelopes", "parent_url": "http://www.staples.com/Large-Catalog-Envelopes/cat_DP2189", "keyword_count": {"envelopes": 5, "catalog envelopes": 4}, "description_wc": 154, "description_text": "Use recycled catalog envelopes when you need to send out large amounts of marketing materials, such as course listings or upcoming products. The material won't tear when packed with heavy documents, and the recycled paper preserves natural resources. Multiple Sizes Secure magazines, booklets, and bulky paperwork in recycled catalog envelopes made from durable paper that can support bulky weight. Select different envelope sizes from brands such as Quality Park and Staples to match your business projects. Recycled Materials Postconsumer materials are incorporated in every product, so choosing recycled catalog envelopes promotes an ecofriendly workspace. Your shipping labels clearly stand out against the brown catalog envelopes, making addresses distinct and readable. Adhesive Closure Whether you prefer clasps or self-adhesive strips, the envelopes feature gummed flaps for secure closure. Once the adhesive is uncovered or moistened, the flap firmly adheres to the envelope, helping to prevent your important documents from becoming lost or damaged.", "parent_text": "Large Catalog Envelopes", "keyword_density": {"envelopes": "3.2", "catalog envelopes": "5.2"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 8, "level": -2, "url": "http://www.staples.com/DVD-CD-Envelopes/cat_CL142689", "text": "DVD / CD Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "DVD / CD Envelopes", "parent_url": "http://www.staples.com/Specialty-Envelopes/cat_DP2190", "keyword_count": {"dvd": 4, "envelopes": 8, "cd": 4}, "description_wc": 204, "description_text": "CD and DVD envelopes are sized to fit standard disks, providing a safe way for you to store your important data. Whether you intend to mail your disks or store them at your business, Staples offers envelopes made from resilient materials that prevent breakage. Convenient window cutouts allow you to identify disks without removing them from their sleeves. Organize Your Disks Give loose disks a home with CD and DVD envelopes that are perfect for replacing missing cases and storing your recordable disk media. Standard-sized disks will fit snugly in these envelopes without shifting or sliding, preventing damaging cracks and breaks. Closure flaps keep your disks from sliding out of the envelopes. Damage-Resistant Design Mail your CDs and DVDs without worries by using sturdy disk mailers with reinforced construction. These travel-ready envelopes are made from highly durable materials like fiberboard that provide firm support to prevent disks from snapping during postal transport. Easy Sorting and Retrieval Windowed disk envelopes are available from brands like Tyvek and Quality Park and feature circular cutouts that display the printed or written name on the front of your disk. You can also write directly on the CD and DVD envelopes for easy identification and filing.", "parent_text": "Specialty Envelopes", "keyword_density": {"dvd": "2.0", "envelopes": "3.9", "cd": "2.0"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 7, "level": -2, "url": "http://www.staples.com/Document-and-Booklet-Envelopes/cat_CL142691", "text": "Document and Booklet Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Document and Booklet Envelopes", "parent_url": "http://www.staples.com/Specialty-Envelopes/cat_DP2190", "keyword_count": {"document": 6, "envelopes": 5, "document and booklet": 4, "document and booklet envelopes": 3}, "description_wc": 137, "description_text": "Document and booklet envelopes offer a professional look for shipping your important papers. The sturdy design protects documents in transit, and side and top slots allow you to easily insert paperwork without bending corners or ripping edges. Secure Transport Self-adhesive and gummed seals on document and booklet envelopes help keep your key paperwork secure. This helps prevent loss in transit. Effective The document and booklet design allows the envelopes to cradle paperwork and helps prevent bent edges or similar damage. When you're sending other media with your documents, try CD and DVD envelopes. Professional Look When you're sending a manuscript to a publisher or agent, a professional look has the potential to move mountains. Document and booklet envelopes deliver a measure of your sense of professionalism before the recipient even looks at the contents.", "parent_text": "Specialty Envelopes", "keyword_density": {"document": "4.4", "document and booklet": "8.8", "envelopes": "3.6", "document and booklet envelopes": "8.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 15, "level": -2, "url": "http://www.staples.com/Tyvek-Plastic-Catalog-Envelopes/cat_CL142687", "text": "Tyvek & Plastic Catalog Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Tyvek & Plastic Catalog Envelopes", "parent_url": "http://www.staples.com/Large-Catalog-Envelopes/cat_DP2189", "keyword_count": {"tyvek plastic catalog envelopes": 4, "catalog": 8, "envelopes": 9}, "description_wc": 192, "description_text": "Tyvek plastic catalog envelopes provide a convenient and durable alternative to mailing your catalogs without envelopes. You can ensure that your catalogs and other sales materials arrive in good condition so that your customers won't toss them in the trash at first glance. These durable envelopes stand up to damp conditions and rough handling, so you can trust that they'll arrive safely. Multiple Sizes Tyvek plastic catalog envelopes come in a variety of sizes, so you can send booklets, brochures, and even full-sized catalogs with ease. Most of the envelopes offer self-sealing options, so they are convenient to use for mass mailings. Staples also provides a wide variety of address labels to make mailing even easier. Extra Durable Tyvek plastic catalog envelopes are made from durable materials that make them much stronger than standard paper envelopes. The envelopes can stand up to rough handling and still arrive in excellent condition. Water Resistant Most Tyvek plastic catalog envelopes are also water resistant, so your catalogs and other sales materials will remain dry even in damp conditions. You'll never have to worry about bad weather ruining your sales materials.", "parent_text": "Large Catalog Envelopes", "keyword_density": {"tyvek plastic catalog envelopes": "8.3", "catalog": "4.2", "envelopes": "4.7"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 766, "level": -2, "url": "http://www.staples.com/Invitation-Envelopes/cat_CL142690", "text": "Invitation Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Invitation Envelopes", "parent_url": "http://www.staples.com/Specialty-Envelopes/cat_DP2190", "keyword_count": {"invitation envelopes": 4, "envelopes": 6, "invitation": 8}, "description_wc": 186, "description_text": "With fancy invitation envelopes at your disposal, you can make sure that yours stand out and draw attention. You'll never have to worry about your invitation being tossed in the trash without being read. With plenty of sizes and colors to choose from, you can select just the right envelope to fit your style. To add a personal touch, consider purchasing some custom envelopes as well! Multiple Colors Invitation envelopes come in a variety of colors, from standard white to pastels or vivid colors, so your invitations are sure to be noticed every time. You can address your envelopes by hand or print address labels from your computer. Assorted Sizes Invitation envelopes are available in multiple sizes. You can send small letter-sized invitations, or you can mail out greeting card invitations and photos. Just choose the envelope that fits your needs. New or Recycled Materials Invitation envelopes can be made from new materials, or you can choose to purchase ones made from recycled materials to contribute to a healthy environment. Whatever choice you make, you're sure to find what you need at Staples.", "parent_text": "Specialty Envelopes", "keyword_density": {"invitation envelopes": "4.3", "envelopes": "3.2", "invitation": "4.3"}, "department_id": 30}
{"nr_products": 96, "level": -2, "url": "http://www.staples.com/Gummed-Envelopes/cat_CL142683", "text": "Catalog Gummed Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/Large-Catalog-Envelopes/cat_DP2189", "parent_text": "Large Catalog Envelopes", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 37, "level": -2, "url": "http://www.staples.com/Self-Sealing-Envelopes/cat_CL142686", "text": "Catalog Self-Sealing Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Catalog Self-Sealing Envelopes", "parent_url": "http://www.staples.com/Large-Catalog-Envelopes/cat_DP2189", "keyword_count": {"catalog": 5, "self sealing": 4, "envelopes": 7}, "description_wc": 206, "description_text": "Self-sealing catalog envelopes offer the durability you need to send document packets and bulky items like magazines and business manuals. Heavyweight paper supports your documents and reduces their visibility, protecting the contents of your mailings. Use the attached adhesive seal to securely close each envelope. Safely Send Documents Prevent damage to your important mailings with sturdily constructed self-sealing catalog envelopes made from heavy 28-pound paper. Choose from reliable brands like Staples and Quality Park that design tear-resistant catalog envelopes made of woven kraft paper and other durable materials. Your envelopes will remain structurally intact, ensuring they protect large documents at every step of the postal process. Sealable Flaps Speed up the mail preparation process with self-sealing catalog envelopes that don't require water to activate the adhesive. Simply remove the protective covering from the adhesive strip and fold the closure flap to permanently secure the envelope for transport. With the self-sealing method, you can quickly pack, seal, and weigh your mailings to ensure they're ready for pickup. Confidential Mailings Staples offers a range of security-tinted catalog envelopes that shield the details of your documents. The envelopes feature interior patterns that camouflage the papers inside to prevent unauthorized viewing.", "parent_text": "Large Catalog Envelopes", "keyword_density": {"catalog": "2.4", "self sealing": "3.9", "envelopes": "3.4"}, "department_id": 30}
