{"department_text": "Office Supplies", "nr_products": 11, "level": -2, "url": "http://www.staples.com/Counter-Top-Pens/cat_CL140764", "text": "Counter Top Pens", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Counter Top Pens", "parent_url": "http://www.staples.com/Pens/cat_DP1100", "keyword_count": {"top": 1, "counter": 6, "pens": 10}, "description_wc": 141, "description_text": "Elegant and secure, our counter pens allow you to provide your customers with the writing utensils they need while preventing misplacement. Browse our wide selection of counter pens for a diverse range of solutions. Still looking for ideas? Visit our research centers for more information. Coil or chain bank pens and security pens : Choose from both coil pens and chain pens either secured or not to match your counter\u2019s style. Stay healthy, stay clean : Public pens invite a public\u2019s germs. Prevent the spread of colds and other nasty viruses with our antimicrobial counter pens. Guard against counterfeit activity : Our money detector pens are easy to use and compatible with both US and new currency. Top brands : MMF, Dri Mark, Staples and PM Company. Search through our counter pens today and provide your business with the writing utensils it needs.", "parent_text": "Pens", "keyword_density": {"top": "0.7", "counter": "4.3", "pens": "7.1"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 28, "level": -2, "url": "http://www.staples.com/Felt-Porous-Point-Pens/cat_CL110003", "text": "Felt & Porous Point Pens", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Felt & Porous Point Pens", "parent_url": "http://www.staples.com/Pens/cat_DP1100", "keyword_count": {"felt": 4, "pens": 3, "porous point pens": 1, "point": 4}, "description_wc": 109, "description_text": "Felt pens provide the vibrancy of colored markers with the precision of a pen to spice up your documents and files. Find the best brands, including Paper Mate, Sharpie, Pilot and Pentel. For more information, please visit our research centers. Various ink colors : From black to pink, find the colors you seek. Diverse point sizes : Our felt tipped pens and porous point pens range from the finest points to medium points so you can mark those files and pages with precision. The quality you deserve in eco-friendly style : Choose a recycled felt tip pen and cut down on waste. Try a felt pen for a unique blended experience.", "parent_text": "Pens", "keyword_density": {"felt": "3.7", "pens": "2.8", "porous point pens": "2.8", "point": "3.7"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 9, "level": -2, "url": "http://www.staples.com/Art-Pens/cat_CL140735", "text": "Art Pens", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Art Pens", "parent_url": "http://www.staples.com/Pens/cat_DP1100", "keyword_count": {"art": 8, "pens": 9, "art pens": 4}, "description_wc": 120, "description_text": "Get a jump on your next art project or presentation with task-specific art pens. We carry a wide selection of disposable and recycled art pens to meet your needs. Visit our research centers for further ideas about artist pens and more. Artist pens for every project : Browse our drawing pens, colored pens and marker pens to find art pens with the right ink and textures for you. A variety of point sizes and styles : We carry extra-fine, felt tip, and fountain art pens in various colors for the most precise and bold projects. High quality brands : From Paper Mate to Pentel and Pilot, we carry only the best. Browse Staples.com and find the right art pen for you.", "parent_text": "Pens", "keyword_density": {"pens": "7.5", "art": "6.7", "art pens": "6.7"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 120, "level": -2, "url": "http://www.staples.com/Ballpoint-Retractable-Pens/cat_CL110000", "text": "Ballpoint Retractable Pens", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Ballpoint Retractable Pens", "parent_url": "http://www.staples.com/Pens/cat_DP1100", "keyword_count": {"retractable pens": 2, "ballpoint": 3, "retractable": 5, "pens": 4, "ballpoint retractable pens": 1}, "description_wc": 127, "description_text": "It\u2019s important to have a retractable pen you know will perform. Browse our wide selection of Bic, Paper Mate, Pilot and Zebra ballpoint pens in a variety of ink colors and styles for a retractable pen that meets your needs. For more ideas, visit our research centers. Find your preferred point sizes : From medium to bold, precision writing to block lettering, our selection of ballpoint retractable pens will have the right point size for the task. Various ink colors : Our retractable pens come in all the colors of the rainbow. Go green : We carry many high quality recycled and refillable pens so you can stay eco-conscious while making your purchasing decisions. Whatever your desire, we have a retractable ballpoint pen that will work for you.", "parent_text": "Pens", "keyword_density": {"retractable pens": "3.1", "ballpoint": "2.4", "retractable": "3.9", "ballpoint retractable pens": "2.4", "pens": "3.1"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 33, "level": -2, "url": "http://www.staples.com/Pen-Style-Highlighters/cat_CL158890", "text": "Pen-Style Highlighters", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Pen-Style Highlighters", "parent_url": "http://www.staples.com/Highlighters/cat_DP1484", "keyword_count": {"pen style highlighters": 1, "pen": 7}, "description_wc": 130, "description_text": "Highlighter pens combine the precision and grip of a pen with the eye-catching colors of a highlighter. Try a full and pocket sized pens for the perfect hybrid experience. For more information, please visit our research centers. Long-lasting, diverse and easy to use : With retractable tips, a wide array of ink colors and a grip that\u2019s designed for your fingers, you\u2019ll find all the features you need. Eco-friendly affordability : Try one of our recycled highlighter pen value packs for a wide range of options at prices that can\u2019t be beat. Top brands : We carry Sharpie, Bic, Pentel and Pilot highlighter pens, the quality names you trust. When you\u2019re taking notes or preparing for a presentation, pen style highlighters are the way to go.", "parent_text": "Highlighters", "keyword_density": {"pen style highlighters": "2.3", "pen": "5.4"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 9, "level": -2, "url": "http://www.staples.com/Liquid-Highlighters/cat_CL158891", "text": "Liquid Highlighters", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Liquid Highlighters", "parent_url": "http://www.staples.com/Highlighters/cat_DP1484", "keyword_count": {"liquid": 4, "liquid highlighters": 2}, "description_wc": 123, "description_text": "Shop our liquid highlighters for a vibrant way to make keywords and important information jump off the page in a range of assorted colors. Try a value pack for more unique colors for your money. Visit our research centers for more information. Easy refilling : We carry all the visible refill ink you need, so you\u2019ll never be left in the lurch. Design that feels good and does more : Our liquid highlighters come with ergonomic grips that gently guide your fingers into an optimal position. Try our double sided markers for an extra dose of color. Top names : Search all of your favorite brands for fully recycled liquid markers, including Sharpie, Bic, Zebra and Staples. Study better with a liquid highlighter from Staples.", "parent_text": "Highlighters", "keyword_density": {"liquid": "3.3", "liquid highlighters": "3.3"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 8, "level": -2, "url": "http://www.staples.com/Dry-Erase-Accessories/cat_CL158958", "text": "Dry-Erase Accessories", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Dry-Erase Accessories", "parent_url": "http://www.staples.com/Markers/cat_DP1101", "keyword_count": {"dry erase accessories": 1, "erase": 2}, "description_wc": 34, "description_text": "Shop our Dry-Erase Accessories for your cleaners, erasers and other tools essential for the brainstorming session, classroom or home to-do list. We have all the tools to make your meetings more productive!", "parent_text": "Markers", "keyword_density": {"dry erase accessories": "8.8", "erase": "5.9"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 96, "level": -2, "url": "http://www.staples.com/Ballpoint-Stick-Pens/cat_CL110001", "text": "Ballpoint Stick Pens", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Ballpoint Stick Pens", "parent_url": "http://www.staples.com/Pens/cat_DP1100", "keyword_count": {"ballpoint stick pens": 1}, "description_wc": 26, "description_text": "Ballpoint Stick pens are economical, efficient & dependable. Shop our wide assortment of colors & styles or look for the retractable version for a more professional writing experience.", "parent_text": "Pens", "keyword_density": {"ballpoint stick pens": "11.5"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 45, "level": -2, "url": "http://www.staples.com/Clasp-Envelopes/cat_CL142682", "text": "Catalog Clasp Envelopes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Catalog Clasp Envelopes", "parent_url": "http://www.staples.com/Large-Catalog-Envelopes/cat_DP2189", "keyword_count": {"catalog": 4, "clasp": 4, "envelopes": 8}, "description_wc": 203, "description_text": "Clasp catalog envelopes provide the heavyweight structure you need to send weighty papers and booklets in the mail. Thick kraft paper keeps the envelopes in tact for travel or reuse. Choose clasp catalog envelopes in several sizes and colors to fit your document project. Storage and Postal Envelopes Take advantage of the convenient dual closure system, made up of a metal clasp and an adhesive flap. The closure flaps are heavily gummed to keep envelopes tightly closed while in transport. Use the metal fastener for temporary closure when you need a quick storage method for personal documents, such as sales receipts and business forms. Durable Structure Whether you choose top- or side-open envelopes, your business documents will remain protected by sturdy walls made of 24- to 32-pound kraft paper stock. The Staples brand features a variety of envelope sizes, so your documents will fit comfortably and won't slide around during travel. Express Your Professional Personality No two businesses are the same, so your clasp catalog envelopes should reflect your atmosphere and client base. Top brands like Quality Park offer bright assorted colors for businesses with playful spirits, while crisp gray or white catalog envelopes are suited for more conservative occasions.", "parent_text": "Large Catalog Envelopes", "keyword_density": {"catalog": "2.0", "envelopes": "3.9", "clasp": "2.0"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 11, "level": -2, "url": "http://www.staples.com/Dry-Erase-Marker-Kits/cat_CL142401", "text": "Dry-Erase Marker Kits", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Dry-Erase Marker Kits", "parent_url": "http://www.staples.com/Markers/cat_DP1101", "keyword_count": {"dry erase marker kits": 1, "erase": 2}, "description_wc": 30, "description_text": "Dry-Erase Marker Kits contain everything you need for effective, colorful presentations. Choose from assorted pack sizes with options such as erasers, cleaners & lots of bold and vibrant color assortments.", "parent_text": "Markers", "keyword_density": {"dry erase marker kits": "13.3", "erase": "6.7"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 48, "level": -2, "url": "http://www.staples.com/Dry-Erase-Markers/cat_CL110103", "text": "Dry-Erase Markers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Dry-Erase Markers", "parent_url": "http://www.staples.com/Markers/cat_DP1101", "keyword_count": {"dry erase": 6, "dry erase markers": 3, "markers": 4}, "description_wc": 137, "description_text": "Dry-erase markers are the perfect writing tool when you\u2019re looking to think visually. Draw out your thoughts, take brainstorming notes in various colors or organize your office with public whiteboard charts. Visit our research centers for more ideas. A variety of features : Try a dry erase pen with a retractable tip or choose from thin to thick tip sizes. Our dry-erase markers are fully erasable, so you won\u2019t have to worry about leaving confusing marks behind. Assorted ink colors : From grey to bright yellow, find your ideal marker in a full color palette. Write in health : All whiteboard markers and dry erase pens are AP Certified Non Toxic. The top names : We carry Quartet, Expo, Staples and Bic. Browse our full stock of dry-erase markers and start thinking the dry-erase way.", "parent_text": "Markers", "keyword_density": {"dry erase": "8.8", "dry erase markers": "6.6", "markers": "2.9"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 18, "level": -1, "url": "http://www.staples.com/3M-Command-Adhesives/cat_CL166024", "text": "3M\u2122 Command\u2122 Adhesives", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "3M\u2122 Command\u2122 Adhesives", "parent_url": "http://www.staples.com/Tape-Glue-Adhesives/cat_DP100", "keyword_count": {"command": 3, "3m command": 1}, "description_wc": 70, "description_text": "Want to redecorate but don\u2019t want the stress of ruining your walls? With 3M\u2122 Command\u2122 Adhesive products you can take decorating from stress-full to stress-free. Staples\u00ae carries a wide selection of Command\u2122 products such as wall hooks, picture hangers and hanigng strips. Decorating for the holidays, or even every day, has never been easier. Now with the new Command\u2122 Clear line of adhesivies our options are endless.", "parent_text": "Tape / Glue / Adhesives", "keyword_density": {"command": "4.3", "3m command": "2.9"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 74, "level": -2, "url": "http://www.staples.com/Permanent-Markers/cat_CL140896", "text": "Permanent Markers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Permanent Markers", "parent_url": "http://www.staples.com/Markers/cat_DP1101", "keyword_count": {"permanent markers": 5, "markers": 6}, "description_wc": 140, "description_text": "Permanent markers are the way to go when you\u2019re looking to make a mark that lasts. Label your child\u2019s toys, put a final touch on that report or mark a piece of fabric with permanent markers from Sharpie, Bic, Avery and Staples. For more information, please visit our research centers. Various colors : Find all the colors of the rainbow sold individually or in an affordable variety pack. Endurance : Indelible markers last many wash cycles and can survive other harsh conditions. Choose from a range features : Find recycled, retractable and double sided permanent markers that are versatile and eco-friendly. Widely applicable : Use your permanent markers in a wide range of thin and thick tip sizes on almost any surface, material or fabric for a distinguishable mark, every time. Browse our selection of permanent markers and make your mark.", "parent_text": "Markers", "keyword_density": {"permanent markers": "7.1", "markers": "4.3"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 106, "level": -2, "url": "http://www.staples.com/Mechanical-Pencils/cat_CL110201", "text": "Mechanical Pencils", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Mechanical Pencils", "parent_url": "http://www.staples.com/Pencils/cat_DP1102", "keyword_count": {"mechanical pencils": 1, "mechanical": 2}, "description_wc": 32, "description_text": "Mechanical pencils are great for precise and effortless writing, drafting or drawing. With features such automatic lead advance, comfort grips, and refillable barrels, we have the right mechanical pencil for your needs.", "parent_text": "Pencils", "keyword_density": {"mechanical pencils": "6.2", "mechanical": "6.2"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 114, "level": -1, "url": "http://www.staples.com/Glue-Adhesive-Products/cat_CL10000", "text": "Glue & Adhesive Products", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Glue & Adhesive Products", "parent_url": "http://www.staples.com/Tape-Glue-Adhesives/cat_DP100", "keyword_count": {"adhesive": 2, "adhesive products": 1, "glue": 10, "products": 2, "glue adhesive": 1}, "description_wc": 119, "description_text": "Staples has over a dozen putty, super glue, adhesive, rubber cement and other glue products for your home or office. We have paste and glue from affordable and quality brands like Elmers, Avery, OIC, 3m, Scotch, and Glue Dots. For a variety of materials . Whether you need to glue cardboard, fabrics, paper, photos, or anything else, our glues have a large variety of applications to match your project. Broad selection . Staples has a broad selection of glue and adhesive products like spray, tape, liquid, stick, tube, pen, permanent, and reusable. Heavy duty glue . For heavy duty projects, we have a selection of super-glue and hot glue that can be used on wood, metal, and plastic.", "parent_text": "Tape / Glue / Adhesives", "keyword_density": {"adhesive": "1.7", "adhesive products": "1.7", "glue": "8.6", "products": "1.7", "glue adhesive": "1.7"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 116, "level": -1, "url": "http://www.staples.com/Mounting/cat_CL10001", "text": "Mounting", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Mounting", "parent_url": "http://www.staples.com/Tape-Glue-Adhesives/cat_DP100", "keyword_count": {"mounting": 1}, "description_wc": 102, "description_text": "Mounting tape is a great way to mount photos, posters, whiteboards, and other objects to any surface. We have products from brands like 3m and Scotch for use on refrigerators, pin boards, cubicle walls, and other vertical surfaces. Double sided tape . Double sided tape is a convenient and simple way to post pictures and posters on any vertical surface. Multiple types and uses . We have many different types of tape like foam tape, poster tape, drafting tape, film tape, and photo tape. Reusable tape . Alternative to tacs and nails for hanging objects on the wall without effecting the tape.", "parent_text": "Tape / Glue / Adhesives", "keyword_density": {"mounting": "1.0"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 45, "level": -1, "url": "http://www.staples.com/Tape-Dispensers/cat_CL10003", "text": "Tape Dispensers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Tape Dispensers", "parent_url": "http://www.staples.com/Tape-Glue-Adhesives/cat_DP100", "keyword_count": {"dispensers": 9, "tape dispensers": 3}, "description_wc": 101, "description_text": "Tape dispensers provide a clean and precise cut for simple and effective use. We have a variety of handheld and desktop tape dispensers from basic, to heavy duty, to high heel dispensers. Staples carries affordable brands like Scotch, 3M, and Staples. Fun dispensers . Bring some fun to your home or office with shoe and high heal tape dispensers. Handheld dispensers . Handheld dispensers are useful for wrapping presents, hanging posters, or any other taping job away from the desk. Desktop dispensers . Desktop dispensers are compact so that they don\u2019t take up a lot of space on your desk.", "parent_text": "Tape / Glue / Adhesives", "keyword_density": {"dispensers": "9.2", "tape dispensers": "6.1"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 39, "level": -1, "url": "http://www.staples.com/Tape/cat_CL10002", "text": "Tape", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Tape", "parent_url": "http://www.staples.com/Tape-Glue-Adhesives/cat_DP100", "keyword_count": {"tape": 9}, "description_wc": 107, "description_text": "We have an assortment of Scotch\u00ae magic tape, transparent tape, and invisible tape that is used for repairing tears in paper and hanging pictures discretely. We have various lengths and sizes of tape dispensers, rolls, and refills. For more tape options, browse our packaging & shipping tape. Conveniently transparent . Transparency allows the tape to be applied without effecting the integrity of the document or picture. Various sizes to get the job done . We have many different lengths and sizes of clear tape for whatever project you may have. Dispensers for simple use . Tape dispensers make tearing off the right length a simple and precise process.", "parent_text": "Tape / Glue / Adhesives", "keyword_density": {"tape": "8.7"}, "department_id": 30}
{"nr_products": 1, "level": -1, "url": "http://www.staples.com/Custom-Sticky-Notes/cat_CL167725", "text": "Custom Sticky Notes", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_wc": 0, "parent_url": "http://www.staples.com/Post-it-Stickies-Notes-Flags/cat_DP4736", "parent_text": "Post-it\u00ae / Stickies\u2122 Notes & Flags", "department_text": "Office Supplies", "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 5, "level": -1, "url": "http://www.staples.com/Post-it-Writing-Instruments/cat_CL165758", "text": "Post-it\u00ae Writing Instruments", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Post-it\u00ae Writing Instruments", "parent_url": "http://www.staples.com/Post-it-Stickies-Notes-Flags/cat_DP4736", "keyword_count": {"post": 7, "post it writing instruments": 2, "post it writing": 3}, "description_wc": 152, "description_text": "Get the best value in Post-it writing instruments. At Staples , we carry highlighters, ball point pens, gel pens, and markers made especially for use with your Post-it flags. All Post-it writing instruments include Post-it flags and flag dispensers to help you keep track of important documents and stay organized. We carry the following Post-it writing products: Flag Highlighters \u2013 When you highlight a passage in a book or document, flag it so it's easy to locate later. Flag Ball Point Pens \u2013These medium point, 1.0 mm pens offer a comfort grip. Flag Gel Pens \u2013 With gel pens, create neat, orderly lines whenever you mark an important document. Flag Markers \u2013 Post-it flag markers provide an ultra-fine tip that helps you make notes in small spaces. With the low prices and great selection at Staples, we make it easy to find your favorite Post-it products.", "parent_text": "Post-it\u00ae / Stickies\u2122 Notes & Flags", "keyword_density": {"post": "4.6", "post it writing instruments": "5.3", "post it writing": "6.0"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 11, "level": -1, "url": "http://www.staples.com/Post-it-Easel-Pads-Bulletin-Boards/cat_CL165759", "text": "Post-it\u00ae Easel Pads & Bulletin Boards", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Post-it\u00ae Easel Pads & Bulletin Boards", "parent_url": "http://www.staples.com/Post-it-Stickies-Notes-Flags/cat_DP4736", "keyword_count": {"easel": 8, "boards": 5, "post it easel pads": 2, "easel pads": 6, "post": 6, "bulletin boards": 2}, "description_wc": 136, "description_text": "At Staples, you'll find high-quality Post-it easel pads and bulletin boards that help you create clear, attractive presentations. Choose from our wide selection of wall and table-top easel pads and adhesive-mount cork boards. Staples offers great value and variety in the following Post-it products: Wall-Mounted Easel Pads \u2013 Adhesive strips keep easel paper secure against the wall. 18 lb. paper keeps ink from bleeding through. Table-Top Easel Pads \u2013 With no easel needed, use Post-it table-top easel pads in virtually any room. Sticky Cork Boards \u2013 Post-it cork boards offer a self-stick surface in addition to pushpin-ready cork displays. Whether you're giving a presentation, making a sketch, or posting notices around the office, Staples carries the Post-it easel pads and bulletin boards you need.", "parent_text": "Post-it\u00ae / Stickies\u2122 Notes & Flags", "keyword_density": {"easel": "5.9", "boards": "3.7", "post it easel pads": "5.9", "easel pads": "8.8", "post": "4.4", "bulletin boards": "2.9"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 10, "level": -1, "url": "http://www.staples.com/Post-it-Bonus-Packs/cat_CL165760", "text": "Post-it\u00ae Bonus Packs", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Post-it\u00ae Bonus Packs", "parent_url": "http://www.staples.com/Post-it-Stickies-Notes-Flags/cat_DP4736", "keyword_count": {"post it bonus packs": 1, "post": 10, "post it bonus": 2, "packs": 3}, "description_wc": 137, "description_text": "Get better value from Post-it products when you purchase Post-it bonus packs at Staples. With a Post-it value pack, you get more notes and flags at lower prices. Find just what you're looking for with our Post-it bonus pack choices: Included Dispensers \u2013 Many value packs come with designer pop-up or top-loading Post-it dispensers so it's easier to grab and use notes and flags. Post-it Notes and Flags \u2013 Whether you use Post-it notes for leaving messages around the office or flags for organizing and sorting critical documents, Staples carries Post-it value packs to meet all your needs. Choose a Post-it value pack to save money and maintain office inventory. At Staples, we offer excellent variety and style in the Post-it products you use most.", "parent_text": "Post-it\u00ae / Stickies\u2122 Notes & Flags", "keyword_density": {"post it bonus packs": "2.9", "post": "7.3", "post it bonus": "4.4", "packs": "2.2"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 48, "level": -1, "url": "http://www.staples.com/Post-it-Stickies-Flags-Tabs/cat_CL165756", "text": "Post-it\u00ae / Stickies\u2122 Flags & Tabs", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Post-it\u00ae / Stickies\u2122 Flags & Tabs", "parent_url": "http://www.staples.com/Post-it-Stickies-Notes-Flags/cat_DP4736", "keyword_count": {"tabs": 6, "flags tabs": 1, "stickies": 2, "flags": 9, "stickies flags": 1, "post": 4}, "description_wc": 114, "description_text": "Post-it flags and tabs help you organize and locate documents via labels and notes. With a wide assortment of Post-it and Stickies flags and tabs, Staples offers the styles and colors you're looking for. Get value and variety from Post-it and Stickies products like these: Flags & Tabs \u2013 Find Post-it flags in various colors and sizes. Choose from standard flags, arrow flags, and flags with printed messages. Dispensers \u2013 Make it easier to use your tabs with a convenient dispenser you keep at the ready. Staples offers a variety of flags and tabs for editing and labeling your important documents. Extra-sturdy, name-brand flags and tabs help you stay organized.", "parent_text": "Post-it\u00ae / Stickies\u2122 Notes & Flags", "keyword_density": {"tabs": "5.3", "flags tabs": "1.8", "stickies": "1.8", "flags": "7.9", "stickies flags": "1.8", "post": "3.5"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Storage-Cabinets-Modular-Storage/cat_DP4724", "text": "Storage Cabinets /  Modular Storage", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Storage Cabinets /  Modular Storage", "parent_url": "http://www.staples.com/Storage-Boxes-Bins-Cabinets/cat_CG1077", "keyword_count": {"storage cabinets": 1, "cabinets": 3, "storage": 5}, "description_wc": 101, "description_text": "Staples has a large variety of storage solutions like lockers and cabinets with top brands like HON, Ameriwood, Sandusky, Basyx, and more. Stay organized and add extra storage space in your home or office with permanent and mobile storage cabinets. Storage for employees. Storage lockers can be used for a personal space for employees, students, or athletes. Pick your size and color. Choose from a large selection of sizes and colors to find the cabinet that fits your needs. Secure your property. For important documents that you need to protect and keep confidential, choose cabinets that come with locks for security.", "parent_text": "Storage / Boxes / Bins / Cabinets", "keyword_density": {"storage cabinets": "2.0", "cabinets": "3.0", "storage": "5.0"}, "department_id": 30}
