{"department_text": "Office Supplies", "nr_products": 2, "level": -1, "url": "http://www.staples.com/Book-Rings/cat_CL168287", "text": "Book Rings", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Book Rings", "parent_url": "http://www.staples.com/Clips-Tacks-Rubber-Bands/cat_CG1036", "keyword_count": {"book rings": 3}, "description_wc": 53, "description_text": "Staples\u00ae offers book rings in a variety of sizes and colors. Choose from 1\", 1.5\", and 2\" sizes and assorted colors. Book rings are perfect for holding together keys, swatches, loose leaf sheets, memos, and invoices. Book rings are simple, yet handy tools to consolidate your items and to stay organized.", "parent_text": "Clips / Tacks / Rubber Bands", "keyword_density": {"book rings": "11.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 7, "level": -1, "url": "http://www.staples.com/Fasteners/cat_CL163582", "text": "Fasteners", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Fasteners", "parent_url": "http://www.staples.com/Clips-Tacks-Rubber-Bands/cat_CG1036", "keyword_count": {"fasteners": 2}, "description_wc": 45, "description_text": "Staples\u00ae offers an assortment of fasteners that keeps papers and documents easily secured. No need to worry about your papers falling out of your file folders because at Staples\u00ae, we carry a variety of sizes, capacities, and finishes of fasteners to suit any need.", "parent_text": "Clips / Tacks / Rubber Bands", "keyword_density": {"fasteners": "4.5"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 105, "level": -2, "url": "http://www.staples.com/Storage-Cabinets/cat_CL140910", "text": "Storage Cabinets", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Storage Cabinets", "parent_url": "http://www.staples.com/Storage-Cabinets-Modular-Storage/cat_DP4724", "keyword_count": {"storage cabinets": 3, "cabinets": 4, "storage": 8}, "description_wc": 200, "description_text": "Storage Cabinets allow you to take paperwork, files, supplies, and more, storing it cleanly and efficiently with a higher level of organization. Paired with our organization products, file folders, bins and other office supplies, a storage cabinet can make all the difference in storage space in your home or office. There are so many ways to efficiently utilize them as well. Free Space - Our storage cabinets have the most free storage space available, which allows you to really use every section and crevice to get neat and tidy and with the documents and supplies you need to keep. Professional Organization - Storage cabinets are great for personal organization, but they are really designed to maximize professional organization. They set the standard for how to keep and easily access what you need at the office. Expanded Selection - Our expanded selection of cabinets offers the right match for any cabinet type, whether lateral, vertical, storage, mobile or fire resistant. We offer more than the competition, so you have more choices. Purchase a storage cabinet that will drive results and personal or professional organization today. Be sure to get everything you need for your new cabinet, like file cabinet locks & accessories , at Staples.com.", "parent_text": "Storage Cabinets /  Modular Storage", "keyword_density": {"storage cabinets": "3.0", "cabinets": "2.0", "storage": "4.0"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 5, "level": -2, "url": "http://www.staples.com/File-Fasteners/cat_CL140741", "text": "File Fasteners", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "File Fasteners", "parent_url": "http://www.staples.com/Fasteners/cat_DP4955", "keyword_count": {"fasteners": 5, "file fasteners": 4, "file": 6}, "description_wc": 131, "description_text": "File fasteners keep your important papers from being blown away or knocked off your desk. Pull a paper from the bottom of the stack without messing up the order with clip-style fasteners. Folder dividers and retention jackets give you even more file storage options. Self Adhesive Self-adhesive file fasteners make regular folders work harder. Instantly create a secure storage area for papers, files, and other documents. Space Saving Stop carrying around bulky binders. File fasteners can organize the same number of papers in less space than a traditional three-ring binder. Fast Organization File fasteners make it easy to get your papers in and out when you need them. Undo the fastener, remove the paper, and then just push the fastener back in place to protect the remaining pages.", "parent_text": "Fasteners", "keyword_density": {"fasteners": "3.8", "file fasteners": "6.1", "file": "4.6"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 13, "level": -1, "url": "http://www.staples.com/Specialty-Clips/cat_CL10105", "text": "Specialty Clips", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Specialty Clips", "parent_url": "http://www.staples.com/Clips-Tacks-Rubber-Bands/cat_CG1036", "keyword_count": {"clips": 8, "specialty clips": 1}, "description_wc": 97, "description_text": "Staples\u00ae has a variety of specialty clips for the home and office from quality brands like Staples\u00ae, Acco\u00ae, and OIC\u00ae. Our office clips have a wide range of applications, such as hanging papers from the cubicle wall or clamping paper work together. Magnetic clips . Magnetic clips conveniently stick to metal surfaces, allowing them to be flexible and used in many places. Wall clips . Hang pictures, keys, leashes, and more with our durable hanging wall clips. Bulldog clips . For heavy duty clipping, bulldog clips clamp tightly to prevent paper from sliding out.", "parent_text": "Clips / Tacks / Rubber Bands", "keyword_density": {"clips": "8.8", "specialty clips": "2.2"}, "department_id": 30}
