{"department_text": "Office Supplies", "nr_products": 9, "level": -2, "url": "http://www.staples.com/Adhesive-Tabs/cat_CL158856", "text": "Adhesive Tabs", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Adhesive Tabs", "parent_url": "http://www.staples.com/Index-Tab-Dividers/cat_DP3721", "keyword_count": {"tabs": 5, "adhesive tabs": 4}, "description_wc": 156, "description_text": "Adhesive tabs allow you to organize and tag information, so you can quickly flip to what you need. Create business reports for your next meeting, and make it easy for attendees to follow along from section to section. College students can impress professors with neatly organized reports that make it easy to explore the theses. Multiple Colors Adhesive tabs come in a variety of colors. You can easily color coordinate your reports or study materials to make it easy to spot the section you need. Multiple Sizes Adhesive tabs also come in a variety of sizes. You can use small sticky tabs to highlight research notes and materials, or you can use larger sizes to label folders and reports. Printable Many of the adhesive tabs are printable, so you can produce clear labels for your reports and sales materials. Use them with report covers to create professional materials that are sure to impress bosses and clients.", "parent_text": "Index Tab Dividers", "keyword_density": {"tabs": "3.2", "adhesive tabs": "5.1"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 4, "level": -2, "url": "http://www.staples.com/Untabbed-Dividers/cat_CL158857", "text": "Untabbed Dividers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Untabbed Dividers", "parent_url": "http://www.staples.com/Index-Tab-Dividers/cat_DP3721", "keyword_count": {"dividers": 6, "untabbed dividers": 3}, "description_wc": 139, "description_text": "Untabbed dividers make it easy to organize your paperwork. Each divider can be placed between folders or papers in a binder, so you can easily find each section of your work. The dividers come in different forms, from those that are heavyweight to those that are recycled. Simple Organization Many people use binders to stay organized, and untabbed dividers can help keep even bulky files in order. Double-pocketed dividers can hold extra papers too. Different Materials You can find untabbed dividers made with many materials, from heavyweight cardstock to buff paper. Some forms even have recycled sources, so you can be happy about being a green businessperson. Easy to Use These dividers are simple to use in your binder or folder. Each one has three holes punched, so you can easily pop one into your three-ring binder.", "parent_text": "Index Tab Dividers", "keyword_density": {"dividers": "4.3", "untabbed dividers": "4.3"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 14, "level": -2, "url": "http://www.staples.com/Legal-Index-Tab-Dividers/cat_CL162762", "text": "Legal Index Tab Dividers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Legal Index Tab Dividers", "parent_url": "http://www.staples.com/Index-Tab-Dividers/cat_DP3721", "keyword_count": {"legal index tab dividers": 1, "tab dividers": 3, "dividers": 4, "tab": 6, "legal": 2}, "description_wc": 138, "description_text": "Whether you practice law or head up a busy real estate office, keeping files organized and documents properly labeled and categorized is important. We carry tab dividers from such trusted names as Avery and Allstate with alphabetized and numerical tabs, so you'll always present a polished set of documents. Your Documents, Your Way Whether you wish to organize your documents by alphabet or number, we offer sets that take care of both. Collated edges let you find important pages quickly. Reinforced Tabs Many of our legal tab dividers offer reinforced tabs with printing on both sides; leaving the guesswork out of your presentations. Compatibility These high-quality individual and collated sets of legal index tab dividers are compatible with a large number of binding systems. Choose the binding system that works for you, and match your dividers.", "parent_text": "Index Tab Dividers", "keyword_density": {"legal index tab dividers": "2.9", "tab dividers": "4.3", "dividers": "2.9", "legal": "1.4", "tab": "4.3"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 39, "level": -2, "url": "http://www.staples.com/Insertable-Write-on-Tab-Dividers/cat_CL158855", "text": "Insertable & Write-on Tab Dividers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Insertable & Write-on Tab Dividers", "parent_url": "http://www.staples.com/Index-Tab-Dividers/cat_DP3721", "keyword_count": {"dividers": 2, "insertable": 1, "tab": 3}, "description_wc": 48, "description_text": "Available in an assortment of options, Avery Plastic Dividers and Paper Dividers can be written on for customized labeling. Insertable Tab Divider options allow for easy customization of both the front and back of the tabs; choose this system for a simple yet versatile way to manage documents.", "parent_text": "Index Tab Dividers", "keyword_density": {"dividers": "4.2", "insertable": "2.1", "tab": "6.2"}, "department_id": 30}
