{"department_text": "Office Supplies", "nr_products": 89, "level": -2, "url": "http://www.staples.com/Lateral-File-Cabinets/cat_CL70401", "text": "Lateral File Cabinets", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Lateral File Cabinets", "parent_url": "http://www.staples.com/Filing-Cabinets/cat_DP4719", "keyword_count": {"cabinets": 7, "lateral": 8, "file cabinets": 4, "lateral file cabinets": 2, "file": 11, "lateral file": 5}, "description_wc": 251, "description_text": "The Lateral File Cabinet - When Basic Is Best. A lateral file cabinet offers the highest capacity per square foot for document and record storage needs. Staples offers a selection of durable, high-volume lateral file cabinets from top brands including HON, Staples, Office Dimensions, and Basyx. We have a great 4 drawer, 3 drawer, and 2 drawer file cabinet selection and the finest materials make our wooden and metal file cabinets both durable and aesthetic. Choose Your Materials - Staples allows you to really customize lateral filing cabinets by carrying both wood and metal file cabinets to match your home office or work environment. Choose Size and Color - Pick between a 3, 4, or 2 drawer file cabinet in brown, putty, white, and black. Many of our lateral file cabinets are available in multiple widths, including 30\u201d, 36\u201d and 42\u201d. Durability - A lateral file cabinet is designed for a variety of uses, from light duty home use to daily use in high volume offices. Choosing the right lateral cabinet depends upon drawer suspension type, size of the folders to be stored and the construction on the cabinet. Need help? Ask our experts! Lateral filing cabinets will transform your work environment from a bit cluttered to nice, neat and clean, so shop our selection today! To store even more, be sure to check out our storage cabinets , or choose a mobile rolling file cabinet so you can move your files with you throughout your home, office or place of work.", "parent_text": "Filing Cabinets", "keyword_density": {"cabinets": "2.8", "lateral": "3.2", "file cabinets": "3.2", "lateral file cabinets": "2.4", "file": "4.4", "lateral file": "4.0"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 30, "level": -2, "url": "http://www.staples.com/Vertical-File-Cabinets/cat_CL70400", "text": "Vertical File Cabinets", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Vertical File Cabinets", "parent_url": "http://www.staples.com/Filing-Cabinets/cat_DP4719", "keyword_count": {"file": 7, "file cabinets": 4, "vertical file": 5, "vertical": 7, "vertical file cabinets": 3}, "description_wc": 155, "description_text": "Vertical File Cabinets - Going Vertical Goes Great. Vertical file cabinets are the ideal storage option for space constrained offices. A vertical file cabinet offers a great amount of storage capacity in a small footprint. Whether you want a 4 drawer file cabinet or a different size, these models are a great way to keep your information organized and your work area clutter-free. Top Brands - We offer the best vertical file cabinet selection from brands including Staples, HON, Basyx, Office Designs, Hirsh and more. Durability - Vertical File cabinets are designed for a variety of uses, from light duty home use to daily use in high volume offices. Choosing the right vertical cabinet depends upon drawer suspension type and the construction on the cabinet. Need help? Ask our experts! Choose your size and color - Staples offers 5, 2, 3 and 4 drawer file cabinets in a variety of colors including putty, gray, charcoal, black, and graphite.", "parent_text": "Filing Cabinets", "keyword_density": {"vertical": "4.5", "file cabinets": "5.2", "vertical file": "6.5", "file": "4.5", "vertical file cabinets": "5.8"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 11, "level": -1, "url": "http://www.staples.com/Pins-Tacks/cat_CL10103", "text": "Pins & Tacks", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Pins & Tacks", "parent_url": "http://www.staples.com/Clips-Tacks-Rubber-Bands/cat_CG1036", "keyword_count": {"pins": 5, "tacks": 2}, "description_wc": 93, "description_text": "Whether you are hanging posters at home or announcements on a pin board, Staples\u00ae has a variety of thumb tacks and push pins to meet your needs. We have quality products from brands like Staples\u00ae and OIC\u00ae. Various colors . We have an assortment of colors of pins and tacks to match your preferences and style. Map pins . Map pins are useful for pinning key locations on a map or picture of any kind. Jumbo mixed pack . Save with a bundled pack of push pins, paper clips, and binder clips.", "parent_text": "Clips / Tacks / Rubber Bands", "keyword_density": {"pins": "5.6", "tacks": "2.2"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 20, "level": -2, "url": "http://www.staples.com/Preprinted-Tab-Dividers/cat_CL141802", "text": "Preprinted Tab Dividers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Preprinted Tab Dividers", "parent_url": "http://www.staples.com/Index-Tab-Dividers/cat_DP3721", "keyword_count": {"preprinted tab dividers": 1, "tab": 2}, "description_wc": 45, "description_text": "Great options for any standard project, Avery Preprinted Tab Dividers offer an attractive and simple organizational option. Divider sets come in all different sizes of tab quantities and with a variation of standard labels, so you can choose the ones that best fit your project.", "parent_text": "Index Tab Dividers", "keyword_density": {"preprinted tab dividers": "6.7", "tab": "4.4"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 18, "level": -2, "url": "http://www.staples.com/Printable-Tab-Dividers/cat_CL140573", "text": "Printable Tab Dividers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Printable Tab Dividers", "parent_url": "http://www.staples.com/Index-Tab-Dividers/cat_DP3721", "keyword_count": {"dividers": 3, "printable tab dividers": 1, "tab": 3}, "description_wc": 47, "description_text": "For the convenience and clarity of having printed labels onto your dividers, look no further. Avery Label Dividers come in a range of tab sets, so a project of any size can be accommodated. Printable Tab Dividers are a great choice for quick, yet professional-looking organization.", "parent_text": "Index Tab Dividers", "keyword_density": {"dividers": "6.4", "printable tab dividers": "6.4", "tab": "6.4"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 41, "level": -1, "url": "http://www.staples.com/Rubber-Bands/cat_CL163579", "text": "Rubber Bands", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Rubber Bands", "parent_url": "http://www.staples.com/Clips-Tacks-Rubber-Bands/cat_CG1036", "keyword_count": {"rubber": 5, "rubber bands": 2}, "description_wc": 63, "description_text": "Staples\u00ae offers an assortment of rubber bands that includes economy, premium, and oversized rubber bands. We carry multiple band sizes and rubber strengths for any organizational need. Economy . Perfect for everyday use and available in multiple sizes, ranging from size #16 to size #84. Premium . Higher rubber content and increased rubber strength. Oversized . Great for securely holding together larger items.", "parent_text": "Clips / Tacks / Rubber Bands", "keyword_density": {"rubber": "8.3", "rubber bands": "6.7"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 25, "level": -1, "url": "http://www.staples.com/Paper-Clips/cat_CL10102", "text": "Paper Clips", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Paper Clips", "parent_url": "http://www.staples.com/Clips-Tacks-Rubber-Bands/cat_CG1036", "keyword_count": {"clips": 5, "paper clips": 4, "paper": 5}, "description_wc": 80, "description_text": "Staples\u00ae has a large selection of paper clips in assorted colors, sizes, and materials. We have large pack size options, as well as smaller quantities of metal and plastic paper clips. Assorted colors . We offer a variety of colors of paperclips to keep your home or office colorful and fresh. Recycled . Staples has recycled paper clips made with 50% post consumer content. Various sizes . We have several different sizes of paper clips from small up to jumbo.", "parent_text": "Clips / Tacks / Rubber Bands", "keyword_density": {"clips": "6.5", "paper clips": "10.4", "paper": "6.5"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 49, "level": -1, "url": "http://www.staples.com/Printing-Calculators/cat_CL90001", "text": "Printing Calculators", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Printing Calculators", "parent_url": "http://www.staples.com/Calculators/cat_DP900", "keyword_count": {"printing": 5, "printing calculators": 3}, "description_wc": 142, "description_text": "Printing Calculators: The right choice for your presentational needs. Experience the convenience of computing and printing capabilities all in one machine with our printing calculators. They're perfect for a variety of accounting functions, for record keeping, tax preparation as well as many other home, school,\u00a0and work tasks. If you are a\u00a0small business owner we suggest trying a premium commercial model to create receipts with a professional look. Check out our assortment of desktop & digital printing calculators with clock and calendar functions to help that busy professional increase efficiency. The right variety ensures that your calculations can easily be converted into presentational materials and help drive decisions, or simply make things a bit clearer. Be sure to shop Staples and choose among the very best. For a similar calculator but without the printing capability, check out our basic calculator selection.", "parent_text": "Calculators", "keyword_density": {"printing": "3.5", "printing calculators": "4.2"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 11, "level": -1, "url": "http://www.staples.com/Binder-Clips/cat_CL10100", "text": "Binder Clips", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Binder Clips", "parent_url": "http://www.staples.com/Clips-Tacks-Rubber-Bands/cat_CG1036", "keyword_count": {"binder": 7, "binder clips": 6}, "description_wc": 105, "description_text": "Staples\u00ae has a large selection of binder clips in assorted colors and sizes from brands like Staples\u00ae and OIC\u00ae. Whether you need to buy in bulk or just buy a few, we have the binder clips to get the job done. For multiple uses . Binder clips are useful for holding together a large stack of papers or hanging documents and photography. Micro to large binder clips . Depending on how much paper you need to clip together, we have from micro to large binder clip sizes. Colored binder clips . Spice up your home or office with an assortment of colored binder clips.", "parent_text": "Clips / Tacks / Rubber Bands", "keyword_density": {"binder": "6.9", "binder clips": "11.9"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 8, "level": -1, "url": "http://www.staples.com/Calculator-Accessories/cat_CL166103", "text": "Calculator Accessories", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Calculator Accessories", "parent_url": "http://www.staples.com/Calculators/cat_DP900", "keyword_count": {"calculator accessories": 6, "calculator": 14}, "description_wc": 197, "description_text": "Graphing Calculator Accessories- Quick, Convenient Charging. Calculator accessories, such as rechargeable batteries and docking stations, provide convenient options for charging and programming your graphing or financial calculator . They ensure that a student always has a functional calculator handy for classwork and exams. Our graphing & other calculator accessories also make it easier for teachers to provide materials to students. For a more basic calculator , browse our impressive selection. Convenient Graphing Calculator Charging - Graphing calculator accessories include docking stations, which allow teachers to keep multiple calculators charged in a single location. This lets them keep extra calculators handy for students who need them. Rechargeable Batteries - Calculator accessories also include handy rechargeable batteries, so people will always have extra batteries available when needed. The Texas Instruments rechargeable batteries work well on their own, or they can be used with alkaline AAA batteries for extra convenience. Graphing Calculator Document Transfer - Graphing calculator accessories make it easy for teachers to provide students with the data and documents they need for homework or exams. With the docking station, a teacher can easily load documents to multiple student calculators at once, ensuring that all students have the same data to work with.", "parent_text": "Calculators", "keyword_density": {"calculator accessories": "6.2", "calculator": "7.2"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Binder-Extras-Accessories/cat_DP3970", "text": "Binder Accessories", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Binder Accessories", "parent_url": "http://www.staples.com/Binders-Pocket-Folders-Report-Covers/cat_CG2860", "keyword_count": {"binder accessories": 3, "binder": 9, "accessories": 4}, "description_wc": 171, "description_text": "Binder accessories let you get your project in perfect shape. From keeping papers all in one place to sorting and identifying different categories, these dividers, media pockets, index tabs, and other accessories work together to enhance binder organization. The wide array of binder accessories available ensures that you can find exactly what you need to make your bound project look just as you envisioned. Sorting Tools Labels and tabs let you easily identify what's in each section of your binder. Filler paper lets you add and rearrange your handwritten notes as needed. Punched Pockets Punched pockets make it simple to slip new materials into your binder quickly. Pockets designed to hold everything from business cards to magazines provide the perfect slot for holding whatever media you need to keep in your binder. Mini Binder Compatible If your project involves a mini binder measuring 5.5\" x 8.5\" in size, mini binder accessories are a must. Index dividers, filler paper, and sheet protectors all come in multiple sizes to suit your project.", "parent_text": "Binders / Pocket Folders / Report Covers", "keyword_density": {"binder accessories": "3.5", "binder": "5.3", "accessories": "2.3"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Sheet-Protectors/cat_DP4635", "text": "Sheet Protectors", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Sheet Protectors", "parent_url": "http://www.staples.com/Binders-Pocket-Folders-Report-Covers/cat_CG2860", "keyword_count": {"sheet protectors": 2, "protectors": 7}, "description_wc": 155, "description_text": "Sheet protectors keep you files, records, and other important paperwork safe. From polypropylene to vinyl, these protectors are available in a variety of weights and materials, so you can pick the one that's right for your office's needs. Staples even offers protectors that have a prepunched edge, letting you leave your papers intact. Cut the Glare Semiclear and nonglare protectors ensure you can see your text and pictures clearly, even in direct light. Full-color protectors and those with a color strip on the edge make it easy to keep track of your papers. No Lost Papers Top-loading protectors make it easy to organize your papers quickly. Flaps ensure nothing falls out if you need to take your binder with you. Keep Pages Pristine Don't worry about the ink coming off of your paper with acid-free, archival-safe sheet protectors. Heavy-duty vinyl options are also available for extra durability.", "parent_text": "Binders / Pocket Folders / Report Covers", "keyword_density": {"sheet protectors": "2.6", "protectors": "4.5"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 95, "level": -1, "url": "http://www.staples.com/Basic-Calculators/cat_CL90000", "text": "Basic Calculators", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Basic Calculators", "parent_url": "http://www.staples.com/Calculators/cat_DP900", "keyword_count": {"calculators": 4, "basic calculators": 2, "basic": 5}, "description_wc": 116, "description_text": "A basic calculator can come in several forms; desktop, handheld and more, but Staples has the most complete selection available. Choose from basic calculators that perform simple equations effortlessly or portable handheld calculators for on-the-go calculating. Either way, we have what you need. The desktop basic calculator is perfect for workplace tasks, and our wide assortment also includes basic math and compact folding calculators. In today's world it's pretty difficult to move at a quick pace without some kind of calculator. Basic calculators are ideal for everything from balancing your checkbook to helping your child with homework, and with our selection, there's no reason to turn anywhere else to find yours.", "parent_text": "Calculators", "keyword_density": {"calculators": "3.4", "basic calculators": "3.4", "basic": "4.3"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Report-Covers/cat_DP1305", "text": "Report Covers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Report Covers", "parent_url": "http://www.staples.com/Binders-Pocket-Folders-Report-Covers/cat_CG2860", "keyword_count": {"report": 3, "report covers": 2}, "description_wc": 58, "description_text": "We know that you work hard to produce the best possible business reports, so when it comes time to share them, you want them to look perfect and be protected. At Staples, we offer a wide-range of clear front report covers and presentation books to showcase your work and pressboard report covers to protect your hard work.", "parent_text": "Binders / Pocket Folders / Report Covers", "keyword_density": {"report": "5.2", "report covers": "6.9"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 14, "level": -1, "url": "http://www.staples.com/Financial-Calculators/cat_CL140514", "text": "Financial Calculators", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Financial Calculators", "parent_url": "http://www.staples.com/Calculators/cat_DP900", "keyword_count": {"financial calculators": 1, "financial": 4}, "description_wc": 158, "description_text": "A financial calculator is ideal for busy professionals. They are the perfect tools for everything from calculating loans to converting interest rates; they simplify calculations that can be time consuming and frustrating and make them easy, and most importantly, accurate. The best financial calculator will save anyone time, and they save most people from math-based headaches. If you were without one this tax season, browse our financial calculators now and get prepared for next year; one of these models can almost serve as your own personal, pocket-sized CFO. It is an investment that will pay for itself by next April, at the latest. Whether you are an accountant, real estate agent or business student, shop our professional financial calculator selection today and by any calculation, you will come out ahead. Alternatively, a scientific calculator makes similar complex calculations but is better suited to an academic environment; between these two model types, we have your needs covered.", "parent_text": "Calculators", "keyword_density": {"financial calculators": "1.3", "financial": "2.5"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 25, "level": -1, "url": "http://www.staples.com/Scientific-Calculators/cat_CL90002", "text": "Scientific Calculators", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Scientific Calculators", "parent_url": "http://www.staples.com/Calculators/cat_DP900", "keyword_count": {"calculators": 2, "scientific calculators": 1, "scientific": 4}, "description_wc": 131, "description_text": "Our scientific calculator selection offers the latest technology platform; these models feature pre-loaded apps, built-in USB ports, high operating speeds and expansive memory. A scientific calculator will take your work and more complicated complications to the next level, and our selection is second to none. You will be amazed by what this set of products are capable of, even if you are no stranger to making calculations. Whether you need to solve basic equations or tackle complex mathematical problems, we have the scientific calculators to make your work easier. These specialized calculators are a must for students and people who need to move beyond a simple basic calculator . Find the best model for you among our large scientific calculator selection and get right to work with maximum efficiency.", "parent_text": "Calculators", "keyword_density": {"calculators": "1.5", "scientific calculators": "1.5", "scientific": "3.1"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 23, "level": -1, "url": "http://www.staples.com/Graphing-Calculators/cat_CL90003", "text": "Graphing Calculators", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Graphing Calculators", "parent_url": "http://www.staples.com/Calculators/cat_DP900", "keyword_count": {"graphing calculators": 1, "graphing": 4}, "description_wc": 103, "description_text": "A graphing calculator is the cutting edge in handheld mathematics. Also called a graph calculator, they are perfect for everything from pre-algebra to advanced calculus. Alternatively, for the most complex mathematical problems, a scientific calculator offers multi-functional graphing features for advanced equation solving. The graphing calculator is an absolute must for any student at the middle or high school level, as well as college students and many different kinds of professionals. So whether it's for professional or classroom use, we have the graphing calculators for all your mathematical needs, no matter the complexity or the scope. Shop our selection today!", "parent_text": "Calculators", "keyword_density": {"graphing calculators": "1.9", "graphing": "3.9"}, "department_id": 30}
{"department_text": "Office Supplies", "level": -1, "url": "http://www.staples.com/Binders/cat_DP8323", "text": "Binders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Binders", "parent_url": "http://www.staples.com/Binders-Pocket-Folders-Report-Covers/cat_CG2860", "keyword_count": {"binders": 3}, "description_wc": 142, "description_text": "At Staples, we understand that you work hard on your presentations, so we work hard to bring you a selection of binders that will keep them looking good. From Avery, Cardinal, and Samsill, to our own Staples brand, we\u2019ve got your presentation and storage\u00a0needs covered. Ring type - Our 3 ring view binders come in a variety of ring styles and ring sizes for efficient and consistent page-turning and page viewability. Binder Color - With a plethora of color options, you\u2019ll always be able to find the presentation you\u2019re looking for. Sheet Capacity - Whether it\u2019s a small brief or a comprehensive report, you\u2019ll find the right size of binder to meet your needs. Recycled - If you have an eye on being eco-conscious, you\u2019ll be happy with our large selection of binders made from recycled materials.", "parent_text": "Binders / Pocket Folders / Report Covers", "keyword_density": {"binders": "2.1"}, "department_id": 30}
{"level": -1, "url": "http://www.staples.com/Gaming-Accessories/cat_DP5270", "text": "Gaming Accessories", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_wc": 0, "parent_url": "http://www.staples.com/Gaming/cat_CG1403", "parent_text": "Gaming", "department_text": "TV | Home Entertainment", "department_id": 13}
{"department_text": "TV | Home Entertainment", "level": -1, "url": "http://www.staples.com/Playstation-Vita/cat_DP5266", "text": "Playstation Vita", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Playstation Vita", "parent_url": "http://www.staples.com/Gaming/cat_CG1403", "keyword_count": {"playstation vita": 2, "playstation": 3, "vita": 7}, "description_wc": 155, "description_text": "The PlayStation Vita is the newest PlayStation console, and it makes it easy to play video games you enjoy while traveling. The Vita is slim, so it fits in a book bag or purse, and accessories are available to keep it safe from harm. You can find carrying cases and more to suit the Vita so that you can keep everything together. Play Your Favorite Games If you have PS Vita video games, you'll want the PlayStation Vita console. The games come in almost any genre, so you can play games you'll enjoy. Built-In Controls The Vita has built-in controls for easy access. You won't need to carry an extra controller with this system. Smaller Size The Vita has a large screen for viewing your games, but the system is small enough to travel with. It is powered with batteries, so it won't need to be plugged in constantly.", "parent_text": "Gaming", "keyword_density": {"playstation vita": "2.6", "playstation": "1.9", "vita": "4.5"}, "department_id": 13}
