{"department_text": "Office Supplies", "nr_products": 339, "level": -1, "url": "http://www.staples.com/Planners/cat_CL166388", "text": "Planners", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Planners", "parent_url": "http://www.staples.com/Calendars-Planners/cat_CG12", "keyword_count": {"planners": 1}, "description_wc": 79, "description_text": "Staples\u00ae understands the importance of having a dependable planner to help you stay organized. Choose a daily, weekly, monthly, weekly/monthly, or undated format from our expansive assortment of planners. With a wide variety of sizes and designs, Staples\u00ae has the perfect planner that will suit your lifestyle and workspace. Keep it simple with a classic solid color planner, or dress it up with a colorful fashion print planner. Whatever type of planner you desire, Staples\u00ae has you covered.", "parent_text": "Calendars / Planners", "keyword_density": {"planners": "1.3"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 455, "level": -1, "url": "http://www.staples.com/Wall-Calendars/cat_CL166389", "text": "Wall Calendars", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Wall Calendars", "parent_url": "http://www.staples.com/Calendars-Planners/cat_CG12", "keyword_count": {"wall": 7, "wall calendars": 6}, "description_wc": 111, "description_text": "Staples\u00ae has a wide variety of wall calendars to suit any home or office setting. If you are going for a more relaxed environment, try a scenic nature wall calendar. Or if you are looking for more specific themes, Staples\u00ae also carries wall calendars geared towards individual interests, from classic cars to animal scenes. In addition to these themed wall calendars, Staples\u00ae has erasable wall calendars. Erasable wall calendars are perfect for viewing the entire year ahead, and give the flexibility to easily make changes to your schedule. Staples\u00ae has the wall calendars to provide you with endless solutions to all your planning needs in the days, months, and year ahead.", "parent_text": "Calendars / Planners", "keyword_density": {"wall": "6.3", "wall calendars": "10.8"}, "department_id": 30}
