{"department_text": "Office Supplies", "nr_products": 20, "level": -2, "url": "http://www.staples.com/Report-Covers/cat_CL130501", "text": "Report Covers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Report Covers", "parent_url": "http://www.staples.com/Report-Covers/cat_DP1305", "keyword_count": {"report": 7, "report covers": 5}, "description_wc": 144, "description_text": "We know that you work hard to produce the best possible business reports, so when it comes time to share them, you want them to look perfect. At Staples, we offer a selection of report covers\u2014from report covers with windows to sliding bar report covers\u2014to ensure that you always find the best one for the job. Eco-conscious -Many of our report covers are made from recycled material so you can feel good while also staying organized. Sheet Capacity -Whether you need a report cover to hold a little or a one that will hold a lot, we carry a range of sizes that will meet your needs. Variety -We know that your presentation means a lot to you, so we carry a variety of color, and clear report covers to make sure you always find the one that looks just right.", "parent_text": "Report Covers", "keyword_density": {"report": "4.9", "report covers": "6.9"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 7, "level": -2, "url": "http://www.staples.com/5-1-2-inch-x-8-1-2-inch-Mini-Binder-Accessories/cat_CL166093", "text": "5-1/2\" x 8-1/2\" Mini Binder Accessories", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "5-1/2\" x 8-1/2\" Mini Binder Accessories", "parent_url": "http://www.staples.com/Binder-Extras-Accessories/cat_DP3970", "keyword_count": {"1 2": 2, "5 1 2 x 8 1 2": 1, "mini binder accessories": 1}, "description_wc": 96, "description_text": "Sometimes your reports come in smaller sizes, so with that in mind, Staples stocks a full array of mini-binder accessories in the 5-1/2\" x 8-1/2\" size. With top brands like Martha Stewart, Avery, and our own Staples brand, you\u2019re sure to find the design that fits your needs. Paper -We carry both college-ruled and plain filling paper to meet any purpose. Organization - We offer multi-color dividers to help making organizing your notes a snap. Sheet Protectors -These clear inserts are perfect for keeping your documents safe and organized.", "parent_text": "Binder Accessories", "keyword_density": {"1 2": "4.2", "5 1 2 x 8 1 2": "7.3", "mini binder accessories": "3.1"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 10, "level": -2, "url": "http://www.staples.com/Job-Ticket-Holders/cat_CL164355", "text": "Job Ticket Holders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Job Ticket Holders", "parent_url": "http://www.staples.com/Sheet-Protectors/cat_DP4635", "keyword_count": {"job ticket": 2, "job": 3, "job ticket holders": 1, "ticket": 3, "ticket holders": 2}, "description_wc": 106, "description_text": "When a big order is on the line, it\u2019s important to have a job ticket holder you can trust. Shop our selection for a wide range of practical and reliable features. For more information, please visit our Learning Center. Many Useful Features : Our shop ticket holders can accommodate documents of many sizes, are available with adhesive for security, and are heavy duty for maximum durability. Easy to Use : Job jackets are clear on both side, allowing double sided use. Top Notch Names : Including C-Line and Staples. Shop our selection of job ticket holders today for a solution that\u2019s sure to work for you.", "parent_text": "Sheet Protectors", "keyword_density": {"job ticket": "3.8", "job": "2.8", "job ticket holders": "2.8", "ticket": "2.8", "ticket holders": "3.8"}, "department_id": 30}
