{"department_text": "Office Supplies", "nr_products": 6, "level": -2, "url": "http://www.staples.com/Pressboard-Report-Covers/cat_CL140676", "text": "Pressboard Report Covers", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Pressboard Report Covers", "parent_url": "http://www.staples.com/Report-Covers/cat_DP1305", "keyword_count": {"pressboard report covers": 2, "report covers": 3, "pressboard": 3, "covers": 5}, "description_wc": 80, "description_text": "Pressboard report covers are a timeless classic office supply. On top of that, many of them are made from recycled materials and are eco-conscious. We carry a variety of press board report covers by Esselte and Oxford. Size - Whether you\u2019re looking for legal, letter, or tabloid sizes, we\u2019ve got the pressboard covers to meet your needs. Covers with Fasteners - Our pressboard report covers with fasteners come in top hinge, top-fastening, and the standard side hinge options.", "parent_text": "Report Covers", "keyword_density": {"pressboard report covers": "7.5", "report covers": "7.5", "pressboard": "3.8", "covers": "6.2"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 16, "level": -2, "url": "http://www.staples.com/Specialty-Sheet-Protectors/cat_CL141499", "text": "Specialty Sheet Protectors", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Specialty Sheet Protectors", "parent_url": "http://www.staples.com/Sheet-Protectors/cat_DP4635", "keyword_count": {"sheet protectors": 3, "protectors": 6}, "description_wc": 112, "description_text": "When the cards and newspaper clippings sit in towers atop your desk, it\u2019s time to shop our selection of card protectors. Get organized and protect the documents that matter most. For more information, please browse our Learning Center. A Wide Range of Functions : We carry photo protectors, tabbed sheet protectors and 11x17 sheet protectors that can store holiday cards, business cards, photos, other media, coupons and more. Sturdy and Eye-Catching : Find the heavy duty sheet protectors you seek, available in a wide range of colors, sizes and capacities. The Brands You Trust : Including Staples, Avery, Wilson Jones. With card protectors from Staples, keep those memories and contacts safe and secure.", "parent_text": "Sheet Protectors", "keyword_density": {"sheet protectors": "5.4", "protectors": "5.4"}, "department_id": 30}
{"department_text": "Office Supplies", "nr_products": 26, "level": -2, "url": "http://www.staples.com/Sheet-Protectors/cat_CL141498", "text": "Sheet Protectors", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Sheet Protectors", "parent_url": "http://www.staples.com/Sheet-Protectors/cat_DP4635", "keyword_count": {"sheet": 5, "sheet protectors": 3, "protectors": 4}, "description_wc": 106, "description_text": "Keep your papers pristine with sheet protectors from top brands. Easy to access and store, plastic sheets protect in style. For more information, please visit our Learning Center. Easy to Store : Our heavy duty, lightweight page protectors are hole-punched, making them easy to slip into a three-ringed binder or portfolio. Functional Storage : Top loading, clear sheet protectors enable you to view and access sheets easily, so you can protect and store without sacrificing functionality. The Brands You Trust : Including Avery, Martha Stewart, Staples and C-Line. Try our sheet protectors in a wide range of sizes and find a solution that works for you.", "parent_text": "Sheet Protectors", "keyword_density": {"sheet": "4.7", "sheet protectors": "5.7", "protectors": "3.8"}, "department_id": 30}
