{"department_text": "Office Supplies", "nr_products": 12, "level": -2, "url": "http://www.staples.com/Presentation-Books/cat_CL162165", "text": "Presentation Books", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Presentation Books", "parent_url": "http://www.staples.com/Report-Covers/cat_DP1305", "keyword_count": {"presentation": 5, "presentation books": 1}, "description_wc": 123, "description_text": "Presentation folders are a great way to get organized. Use presentation binders to organize your child\u2019s homework or to present documents at a big meeting. For more information, please visit our Learning Center. Sturdy and Reliable : Our presentation books can hold from 6 to 24 sleeves and are made from sturdy, recycled materials that will keep papers and brochures crisp, clean and easy to find. A Wide Range of Styles : Find presentation covers in all the colors of the rainbow, with textured or smooth and moisture resistant sleeves with easy to access thumb-cut fronts. Top-Notch Brands : Including Staples, Oxford, Cardinal, Wilson Jones and C-Line. Whatever your style and needs, we have a presentation portfolio that\u2019s right for you.", "parent_text": "Report Covers", "keyword_density": {"presentation books": "1.6", "presentation": "4.1"}, "department_id": 30}
