{"department_text": "Office Supplies", "nr_products": 132, "level": -2, "url": "http://www.staples.com/View-Binders/cat_CL167205", "text": "View Binders", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "View Binders", "parent_url": "http://www.staples.com/Binders/cat_DP8323", "keyword_count": {"binders": 3, "view binders": 2, "view": 3}, "description_wc": 142, "description_text": "At Staples, we understand that you work hard on your presentations, so we work hard to bring you a selection of clear view binders that will keep them looking good. From Avery, Cardinal, and Samsill, to our own Staples brand, we\u2019ve got your presentation needs covered. Ring type - Our 3 ring view binders come in a variety of ring styles and ring sizes for efficient and consistent page-turning and page viewability. Binder Color - With a plethora of color options, you\u2019ll always be able to find the presentation you\u2019re looking for. Sheet Capacity - Whether it\u2019s a small brief or a comprehensive report, you\u2019ll find the right size of binder to meet your needs. Recycled - If you have an eye on being eco-conscious, you\u2019ll be happy with our large selection of binders made from recycled materials.", "parent_text": "Binders", "keyword_density": {"binders": "2.1", "view binders": "2.8", "view": "2.1"}, "department_id": 30}
