{"department_text": "Office Supplies", "nr_products": 15, "level": -2, "url": "http://www.staples.com/3-Hole-Punched-Pockets/cat_CL162164", "text": "3 Hole Punched Pockets", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "3 Hole Punched Pockets", "parent_url": "http://www.staples.com/Binder-Extras-Accessories/cat_DP3970", "keyword_count": {"hole": 1, "pockets": 3}, "description_wc": 94, "description_text": "We know that sometimes you want to keep things organized with your binders without punching holes in them, so we carry a wide selection of binder pockets by Cardinal, Esselte, and JM to ensure that you find the one that meets your needs. Variety - Whether you\u2019re looking for a pocket binder to hold a CD or one for loose papers, this is where you\u2019ll find them. Pockets -We know that not all of your storage needs are the same, so we carry zipper/slash pocket inserts, envelope dividers, and 4 sliding pockets.", "parent_text": "Binder Accessories", "keyword_density": {"hole": "1.1", "pockets": "3.2"}, "department_id": 30}
{"level": -1, "url": "http://www.staples.com/Nintendo-DS/cat_DP5342", "text": "Nintendo DS", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_wc": 0, "parent_url": "http://www.staples.com/Gaming/cat_CG1403", "parent_text": "Gaming", "department_text": "TV | Home Entertainment", "department_id": 13}
{"department_text": "TV | Home Entertainment", "level": -1, "url": "http://www.staples.com/Wii/cat_DP5267", "text": "Wii", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Wii", "parent_url": "http://www.staples.com/Gaming/cat_CG1403", "keyword_count": {"wii": 7}, "description_wc": 141, "description_text": "Make gaming a social event with the Nintendo Wii. The intuitive Wiimotes let you box, run, and more without getting injured. Play by yourself or encourage others to join in. Easy to Use The motion-detecting Wiimotes ensure that learning to play is easy. Simply do the action in the game as you would in real life. Get Fit Getting fit is simple when you grab some of the optional games and accessories. Whether you use the Wii-Fit board to monitor your progress or use the Wiimotes to show how fast you can run, the wide variety of games makes getting fit fun. Multiple Accessories If you want to drive like Mario or handle a lightsaber like a Jedi (or Sith), tons of Wii accessories are available. Don't forget a docking port for easy charging of your Wiimotes.", "parent_text": "Gaming", "keyword_density": {"wii": "5.0"}, "department_id": 13}
{"department_text": "TV | Home Entertainment", "level": -1, "url": "http://www.staples.com/Nintendo-3DS/cat_DP5268", "text": "Nintendo 3DS", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Nintendo 3DS", "parent_url": "http://www.staples.com/Gaming/cat_CG1403", "keyword_count": {"nintendo 3ds": 1, "3ds": 5}, "description_wc": 224, "description_text": "With the Nintendo 3DS, you can access the Internet on the go and snap 3D photos with the built-in camera. Remote file sharing and system transfers allow you to communicate quickly between multiple devices. Find challenging 3DS games and practical accessories from brands like Activision, DreamGEAR, and PowerA. Connect, Share, and Play The 3DS provides well-rounded entertainment for any age group with tools for 3D photo capture, Web browsing, sharing files with other players, and making fast software purchases. Whether you cater to young clients or need test products on the sales floor, the device's compact size is easy for big or small hands to manage and takes up minimal space in your facilities. Play Games in 3-D Find entertaining options for every type of gamer, from mind-boggling puzzle games that build problem-solving skills to fast-paced adventure games that require cleverness and quick action. The screen is designed to display a 3-D effect, so you can enjoy any compatible game without needing special eyewear. Protect Your Device Never leave home without essential accessories for safeguarding your device and simplifying operation. Purchase extra flash memory cards to expand storage space or a charging station to avoid low batteries. Equip your device with a colorful padded 3DS case or a 3DS stylus to reduce wear on sensitive components.", "parent_text": "Gaming", "keyword_density": {"3ds": "2.2", "nintendo 3ds": "0.9"}, "department_id": 13}
{"department_text": "TV | Home Entertainment", "level": -1, "url": "http://www.staples.com/Playstation-3/cat_DP5265", "text": "Playstation 3", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Playstation 3", "parent_url": "http://www.staples.com/Gaming/cat_CG1403", "keyword_count": {"3": 6, "playstation 3": 3}, "description_wc": 195, "description_text": "The PlayStation 3 is not just a video game device but a comprehensive entertainment system that's great for your break room or living room. In addition to its plethora of high-quality games, the PS3 has storage space for your office photos or videos. The console can be easily set up with your audio and visual equipment. Plenty of Games If you're looking for a great way to relax, play one of the many games available for the PlayStation 3. Whether it's a first-person shooter or a sports game, you'll find something that is both appropriate and fun for your home or office. Watch Movies and Edit Video Not only can you play video games on the PlayStation 3 but you can also watch your favorite comedy or drama on Blu-ray or DVD. The PS3 also comes with video editing software, so you can put the finishing touches on your latest client presentation. Simple Navigation Your PS3 has a built-in menu that organizes your programs and files by type. Use the included controller to peruse through your files, navigate the Internet, or play music right from your machine.", "parent_text": "Gaming", "keyword_density": {"3": "3.1", "playstation 3": "3.1"}, "department_id": 13}
{"department_text": "TV | Home Entertainment", "level": -1, "url": "http://www.staples.com/Xbox-360/cat_DP5264", "text": "Xbox 360", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Xbox 360", "parent_url": "http://www.staples.com/Gaming/cat_CG1403", "keyword_count": {"xbox 360": 3, "xbox": 4}, "description_wc": 161, "description_text": "The Xbox 360 is one of the premier gaming systems and a must-have for the serious video game player. The powerful triple-core processor combats lag and keeps your game running smoothly. Multiplayer functions and built-in Wi-Fi make it stand out among the competition. High-Capacity Hard Drives The Xbox 360 comes standard with a 250 GB hard drive. You can also select a limited edition 320 GB hard drive gaming bundle if you need more memory. Games From action and adventure to sports and outdoors categories, our catalog features games for everyone in the family. Use your body as the controller and watch your character on the TV when you play real-motion games with the Xbox 360 Kinect. Accessories Grab a new gaming headset for your Xbox Live account or pick up a few extra controllers for when friends come over to play. Starter and expansion accessory kits are also available for players just starting out.", "parent_text": "Gaming", "keyword_density": {"xbox 360": "3.7", "xbox": "2.5"}, "department_id": 13}
{"department_text": "Office Supplies", "nr_products": 27, "level": -2, "url": "http://www.staples.com/Binder-Accessories/cat_CL20006", "text": "Binder Accessories", "department_url": "http://www.staples.com/Office-Supplies/cat_SC1", "description_title": "Binder Accessories", "parent_url": "http://www.staples.com/Binder-Extras-Accessories/cat_DP3970", "keyword_count": {"binder accessories": 2, "binder": 6}, "description_wc": 114, "description_text": "We know that a well-organized office is the key to an office that runs smoothly. So here at Staples, we do our best to help your office stay orderly by stocking all of the binder accessories you might need. Whether its 3 ringer binder accessories, insert calendars, or ring reinforcements, you\u2019ll find all of them right here. Binder Dividers - When you need to keep your documents sorted, our selection of binder tabs, dividers with pockets and pouches, and multi-colors will make staying organized a snap. Binders Inserts - Our selection of binder spine inserts, insert calendars, and zippered pocket inserts will help ensure that you can keep track of every document easily.", "parent_text": "Binder Accessories", "keyword_density": {"binder accessories": "3.5", "binder": "5.3"}, "department_id": 30}
{"nr_products": 76, "level": -1, "url": "http://www.staples.com/MP3-Cases-Cables/cat_CL163866", "text": "MP3 Cases & Cables", "department_url": "http://www.staples.com/Apple/cat_SC1949", "description_wc": 0, "parent_url": "http://www.staples.com/iPod-Accessories/cat_DP8131", "parent_text": "iPod\u00ae Accessories", "department_text": "Apple\u00ae", "department_id": 1}
{"department_text": "Apple\u00ae", "nr_products": 693, "level": -1, "url": "http://www.staples.com/Headphones/cat_CL162357", "text": "Headphones", "department_url": "http://www.staples.com/Apple/cat_SC1949", "description_title": "Headphones", "parent_url": "http://www.staples.com/iPod-Accessories/cat_DP8131", "keyword_count": {"headphones": 4}, "description_wc": 166, "description_text": "The best headphones let you block out the world while you listen to your favorite music, podcasts, and audiobooks. Some sets include a microphone to use during phone calls. Beats by Dre , Monster headphones and other great models from Skullcandy, Soul, Klipsch, Audio-Technica and more offer a wide range of options for the discriminating audio consumer. Stereo Sound Stereo headphones provide the ultimate listening experience by delivering different dimensions of sound to each ear. Choose a top quality noise-cancelling set to reduce exterior sounds that could distract you from the music. Wireless Units The best wireless headphones connect to your computer, phone, or MP3 player via Bluetooth technology, so you can listen to your favorite music or sounds from your favorite movies and TV shows without getting tangled up in cords. In-Ear Convenience Earbuds slip into your ear to deliver quality sound without the bulk. From sporty earbuds to fashionable in-ear models, you can find a style to suit your needs.", "parent_text": "iPod\u00ae Accessories", "keyword_density": {"headphones": "2.4"}, "department_id": 1}
