{"department_text": "Accounting | Forms | Security", "level": 0, "url": "http://www.staples.com/Shredders-Oil-Bags/cat_CG1103", "text": "Shredders / Oil / Bags", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Shredders / Oil / Bags", "parent_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "keyword_count": {"shredders": 2}, "description_wc": 114, "description_text": "Paper shredders are critical for protecting against identity theft and can help keep confidential personal, financial and business information safe. When shopping for a paper shredder, consider the following important features: Sheet capacity - Higher sheet capacities provide additional power to save you time and money with frequent use or large jobs. Cut style - Strip-cut for basic security, cross-cut for enhanced security and micro-cut for the maximum level of security. Run time - Minutes of continuous shredding before a shredder must cool down. Staples carries the brands you trust including Fellowes\u00ae, GBC\u00ae, Swingline\u2122, HSM\u00ae and Staples\u00ae brand paper shredders. With Staples it's easy to find the shredder you need.", "parent_text": "Accounting | Forms | Security", "keyword_density": {"shredders": "1.8"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "level": 0, "url": "http://www.staples.com/Safes-Fire-Chests/cat_CG1022", "text": "Safes / Fire Chests", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Safes / Fire Chests", "parent_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "keyword_count": {"fire": 2, "chests": 1, "safes": 15}, "description_wc": 148, "description_text": "From company files to petty cash and electronics, our wide range of home and office safes from Sentry\u00ae Safes and Mesa\u2122 Safes will protect your valuables in times of need. 1. Security in Adverse Conditions - We carry security safes, home safes and office safes that can also function as fire safes and waterproof safes. 2. A Number of Uses - Our safes and vaults, fire safes, heavy duty depository safes, cash boxes, file storage security chests, and traveling compact safes will get the job done. 3. Choose Your Features - Available in a wide range of storage capacities with key pads, combination dials, and keys. 4. A Range of Sizes - From wall safes that can hold laptop and prescription bottles to executive safes with five shelves, we carry a safe that will fit your office and needs. Browse our safes today for a solution that\u2019s right for your office.", "parent_text": "Accounting | Forms | Security", "keyword_density": {"fire": "1.4", "chests": "0.7", "safes": "10.1"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "level": 0, "url": "http://www.staples.com/Retail-Packaging-Supplies/cat_CG2901", "text": "Retail Packaging Supplies", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Retail Packaging Supplies", "parent_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "keyword_count": {"packaging": 3, "supplies": 3, "retail": 4, "retail packaging supplies": 2}, "description_wc": 139, "description_text": "Staples has the retail packaging supplies your store needs. Whether you are looking for food packaging or shopping bags and tissue paper, Staples offers a wide selection of store boxes, retail bags and gift wrap so you can show off your business\u2019 unique style. Choose from Staples selection of everyday retail packaging supplies like holiday gift wrap and seasonal bags & boxes. Select from our natural Kraft shopping bags and boxes for a coordinated look at your boutique or from the large selection of wraphia, curling ribbon and splendorette bows for the final touch on your packages. Coordinating a large event? We offer specialty favor boxes and bags for weddings, baby showers, holidays and more. So whether your'e looking for retail packing supplies to dress up your store or plan for an event, you'll find it at Staples.", "parent_text": "Accounting | Forms | Security", "keyword_density": {"packaging": "2.2", "supplies": "2.2", "retail": "2.9", "retail packaging supplies": "4.3"}, "department_id": 25}
