{"department_text": "Accounting | Forms | Security", "level": 0, "url": "http://www.staples.com/Accounting-Forms/cat_CG1283", "text": "Accounting / Forms", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Accounting / Forms", "parent_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "keyword_count": {"forms": 2}, "description_wc": 51, "description_text": "Looking for business, tax, or health care forms? Staples has just what you need for professional and personal use. Whether you need to report employee wages for your small business, or patient consent forms, you will find dozens of options with user-friendly templates to help you save time and money.", "parent_text": "Accounting | Forms | Security", "keyword_density": {"forms": "3.9"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "level": 0, "url": "http://www.staples.com/Computer-Software/cat_CG5", "text": "Computer Software", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Computer Software", "parent_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "keyword_count": {"software": 4, "computer": 3, "computer software": 1}, "description_wc": 179, "description_text": "Our computer software selection is varied and extensive so you can find all the essentials for your home or office computers or laptops from top brands like Microsoft, Adobe, Norton, Intuit, Electronic Arts, and more. No matter how you want to purchase, download or install software, Staples has a convenient solution to get the job done - with over 2,500 titles available to purchase through download, box, or subscription for your PC or Mac, we make it easy. Finance, Accounting, & Tax Solutions File your taxes from home or balance your payroll at the office with QuickBooks, Quicken, TurboTax and more. Staples has the latest versions of all the financial software you need to keep you business and personal finances on track. Reliable Antivirus Protection Keep your computer and data safe with trusted names like Norton and McAfee. Whether you have a PC, phone, or tablet, Staples carries the antivirus protection that you need. Office & Productivity Keep your productivity on track and your office working hard with all the popular installable or downloadable software from leaders like Microsoft, Adobe, and Dragon.", "parent_text": "Accounting | Forms | Security", "keyword_density": {"computer": "1.7", "computer software": "1.1", "software": "2.2"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "level": 0, "url": "http://www.staples.com/Cash-Registers-POS-Systems/cat_DP2235", "text": "Cash Registers / POS Systems", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Cash Registers / POS Systems", "parent_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "keyword_count": {"cash registers": 1, "pos": 5, "cash": 2, "pos systems": 1}, "description_wc": 149, "description_text": "For the smoothest customer experience, it\u2019s important to have POS technology you can rely on. We stock the latest cash management system technology from the best brands. Shop our selection for a solution you know will work. We have all the Point of Sale equipment you need. We carry cash registers, credit card terminals, barcode scanners, paper rolls, ribbons and other payment processing equipment and accessories that will get the job done right, every time. Here at Staples, we don\u2019t just stock the hardware, we stock the software your POS system needs too, so we can be your one stop shop for POS equipment. We carry the top\u00a0skus\u00a0from Sharp and Casio and\u00a0we have point of sale products from the names you trust most. Whether you seek POS systems or POS supplies, we\u2019ve got everything you need to get set up and running well!", "parent_text": "Accounting | Forms | Security", "keyword_density": {"cash registers": "1.3", "pos systems": "1.3", "pos": "3.4", "cash": "1.3"}, "department_id": 25}
{"department_text": "Retail Store Supplies", "level": 0, "url": "http://www.staples.com/Backroom-Retail-Supplies/cat_CG2897", "text": "Backroom Retail Supplies", "department_url": "http://www.staples.com/Retail-Store-Supplies/cat_SC5421", "description_title": "Backroom Retail Supplies", "parent_url": "http://www.staples.com/Retail-Store-Supplies/cat_SC5421", "keyword_count": {"backroom": 2, "retail supplies": 2, "backroom retail supplies": 1}, "description_wc": 104, "description_text": "Backroom retail supplies are the underemphasized essentials your store needs. Every small business struggles with finding a place to store a vacuum, garment steamer or step ladder, never mind finding a place to hide the extra fixturing essentials.\u00a0Store excess product in overhead storage shelves or display\u00a0them on our eco-friendly cube storage. Shop our extensive assortment of wooden, plastic and metal hangers to\u00a0hide or display your clothing. Rid your backroom of germs with our wide assortment of cleaning products. So whether your looking for hangers, dressing room essentials, storage or cleaners, you'll find all your retail supplies here at Staples.", "parent_text": "Retail Store Supplies", "keyword_density": {"backroom": "1.9", "retail supplies": "3.8", "backroom retail supplies": "2.9"}, "department_id": 3}
{"department_text": "Accounting | Forms | Security", "nr_products": 49, "level": 0, "url": "http://www.staples.com/Cash-Drawers-Boxes/cat_CL141449", "text": "Cash Drawers & Boxes", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Cash Drawers & Boxes", "parent_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "keyword_count": {"cash drawers": 2, "cash": 8}, "description_wc": 112, "description_text": "From petty cash to fundraising events, you need a cash drawer that combines portability with security. Browse our wide selection for the cash box that\u2019s right for your office. 1. Keep Money Safe - Choose a steel money box with a security or combination lock for maximum security. 2. The Latest Technology - Our cash drawers are available with cash slots that allow for direct deposit of money without opening the drawer. 3. Top Brands - We carry cash drawers from Advantage&trade, MMF Industries\u2122, VAL-u Line\u2122 and STEELMASTER\u00ae so you know you know your cash will be secure. When you choose a cash drawer from Staples, you choose convenience and security.", "parent_text": "Accounting | Forms | Security", "keyword_density": {"cash drawers": "3.6", "cash": "7.2"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 25, "level": -1, "url": "http://www.staples.com/Shredder-Oil-Bags/cat_CL158967", "text": "Shredder Oil & Bags", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Shredder Oil & Bags", "parent_url": "http://www.staples.com/Shredders-Oil-Bags/cat_CG1103", "keyword_count": {"shredder oil": 1, "oil": 2, "shredder": 4}, "description_wc": 45, "description_text": "Staples offers shredder oil and lubricating sheets for all of your maintenance needs. Proper maintenance of your paper shredder will ensure reliable performance over time. Shredders used more often or those with higher security levels, such as micro-cut paper shredders, require more frequent oiling.", "parent_text": "Shredders / Oil / Bags", "keyword_density": {"shredder oil": "4.4", "oil": "4.4", "shredder": "8.9"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "level": -1, "url": "http://www.staples.com/Gift-Wrap-Tissue-Paper/cat_DP8429", "text": "Gift Wrap & Tissue Paper", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Gift Wrap & Tissue Paper", "parent_url": "http://www.staples.com/Retail-Packaging-Supplies/cat_CG2901", "keyword_count": {"gift": 6, "tissue": 5, "paper": 5, "tissue paper": 4, "wrap": 7, "gift wrap": 5}, "description_wc": 138, "description_text": "Gift Wrapping is not just for holiday packages when you are a retailer. Gift wrap transforms a gift box into a work of art in a matter of minutes. The wide selection of wrapping paper ranges from Christmas and holiday motifs all the way to wedding themed gift wrap. The assortment also contains multiple sizes of gift wrap from jewelers roll to half ream gift wrap rolls to make them work for any application. Tissue Paper is one of the most versatile and must have items for any retailer. If you are wrapping up collectibles or completing the perfect package presentation Staples has what every retailer needs. From colored tissue paper to Kraft tissue and even bulk tissue paper, no matter what your need for tissue paper might be, the option can be found in this vast assortment.", "parent_text": "Retail Packaging Supplies", "keyword_density": {"gift": "4.3", "tissue": "3.6", "paper": "3.6", "tissue paper": "5.8", "wrap": "5.1", "gift wrap": "7.2"}, "department_id": 25}
