{"department_text": "Accounting | Forms | Security", "nr_products": 15, "level": -1, "url": "http://www.staples.com/Tagging-Guns-Fasteners/cat_CL209035", "text": "Tagging Guns & Fasteners", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Tagging Guns & Fasteners", "parent_url": "http://www.staples.com/Pricing-Tagging-Guns/cat_CG2900", "keyword_count": {"tagging guns": 3}, "description_wc": 43, "description_text": "Price tagging guns are the go to pricing gun in the clothing industry. Tagging guns allow the retailer to neatly attach the price tag without damaging the product. Tagging guns are also versatile and can be used in furniture or home retail applications.", "parent_text": "Pricing & Tagging Guns", "keyword_density": {"tagging guns": "14.0"}, "department_id": 25}
