{"department_text": "Retail Store Supplies", "level": -1, "url": "http://www.staples.com/Cleaning-Supplies-Equipment/cat_DP8178", "text": "Cleaning Supplies & Equipment", "department_url": "http://www.staples.com/Retail-Store-Supplies/cat_SC5421", "description_title": "Cleaning Supplies & Equipment", "parent_url": "http://www.staples.com/Backroom-Retail-Supplies/cat_CG2897", "keyword_count": {"equipment": 2, "cleaning supplies": 2, "cleaning": 5}, "description_wc": 179, "description_text": "We\u2019re here to help you make clean-up easy. Use cleaning supplies and equipment to keep your business environment free of dirt and dust. Keeping your office or facility clean can also prevent the spread of disease. Whether you're wiping up spills in the break room or sanitizing your desk area before starting your day, with brands like 3M , Mr. Clean and Swiffer , we have the products to help you maintain a comfortable work space. Sanitary Surfaces Sponges, wipes, and scrubs let you easily clean surfaces such as desks, counters, tables, and carts. Use spray cleaners to ensure a thorough cleaning. General Cleaning Sanitize floors, dust appliances, and clean windows with general cleaning supplies and equipment. Keep squeegees, dusters, brooms, mops, and dustpans at hand to ensure you always have the right tools for the job. Cleaning Accessories Accessories such as step stools and utility carts can help keep you organized and efficient when you clean. Don't forget to also stock up on trash bags to keep your office clean and free of clutter.", "parent_text": "Backroom Retail Supplies", "keyword_density": {"equipment": "1.1", "cleaning supplies": "2.3", "cleaning": "2.8"}, "department_id": 3}
