{"department_text": "Accounting | Forms | Security", "nr_products": 8, "level": -1, "url": "http://www.staples.com/Credit-Card-Terminals/cat_CL161346", "text": "Credit Card Terminals", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Credit Card Terminals", "parent_url": "http://www.staples.com/Cash-Registers-POS-Systems/cat_DP2235", "keyword_count": {"credit card": 6, "credit card terminals": 1, "terminals": 3, "card": 8}, "description_wc": 152, "description_text": "Make payments fast and easy with a credit card machine. We carry only the best credit card processors from the industry\u2019s most trusted brands for a secure transaction, every time. Shop our selection today. Choose Your Station Style Go wireless or corded, find the integrated USB you need to sync your credit card terminal smoothly, and direct your most savvy customers to use your smart card interface A Wide Range of Features From an easy to use pin pad to a high speed thermal printer, our wireless credit card terminals and point of sale terminals have all the features you need Ample Memory Size Choose a Hypercom terminal or a P credit card processing terminal for unlimited inventory, purchasing and tracking of customers Brands You Can Trust Including Merchant Warehouse, Veriphone and Hypercom Our POS terminals and wireless credit card machines are just what you need. Search our card terminal today", "parent_text": "Cash Registers / POS Systems", "keyword_density": {"credit card": "7.9", "credit card terminals": "2.0", "terminals": "2.0", "card": "5.3"}, "department_id": 25}
