{"department_text": "Accounting | Forms | Security", "nr_products": 28, "level": -1, "url": "http://www.staples.com/Pricing-Guns-Labels/cat_CL209033", "text": "Pricing Guns & Labels", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Pricing Guns & Labels", "parent_url": "http://www.staples.com/Pricing-Tagging-Guns/cat_CG2900", "keyword_count": {"labels": 3, "pricing": 8, "pricing guns": 2}, "description_wc": 112, "description_text": "Pricing Guns are an essential tool for any small retailer. No matter what you sell in your store, having an efficient and reliable pricing gun saves you both time and the hassle of hand writing out price tags. Staples has the most trusted brands in pricing guns, Avery and Garvey, as well as all the brand named accessories. Pricing labels make pricing and repricing your retail location easier than traditional handwritten price tags. Pricing gun labels come in a multitude of pack sizes and quantities. Staples offers both branded price labels as well as staples own to give the retailer the opportunity to select which pricing label is best for their business.", "parent_text": "Pricing & Tagging Guns", "keyword_density": {"labels": "2.7", "pricing": "7.1", "pricing guns": "3.6"}, "department_id": 25}
