{"department_text": "Retail Store Supplies", "nr_products": 15, "level": -1, "url": "http://www.staples.com/Step-Stools-Ladders/cat_CL142174", "text": "Step Stools & Ladders", "department_url": "http://www.staples.com/Retail-Store-Supplies/cat_SC5421", "description_title": "Step Stools & Ladders", "parent_url": "http://www.staples.com/Backroom-Retail-Supplies/cat_CG2897", "keyword_count": {"ladders": 5, "step stools": 5, "step": 8}, "description_wc": 219, "description_text": "Step stools and ladders come in a variety of heights and configurations, from short one-step models to extendable ladders that let you get onto the roof. Models from manufacturers such as Advantus, Rubbermaid, Louisville Ladder, and Cramer give you the reach you need. Whether you need access to something on a high shelf indoors or are doing roof or dormer repairs, step stools and ladders can help. Get a Little Lift Small step stools give you one or two extra steps of height, so you can easily reach things on high shelves or access the top of a small structure without having to pull out a big ladder. Choose from simple and lightweight plastic models or heavy-duty commercial models with a capacity of up to 300 pounds. Ceiling and Roof Access When you need to reach even higher, rely on a step ladder or extension ladder. Fiberglass and steel models give you long-lasting durability and reliability. Easy to Transport Folding step stools and ladders are easy to transport and store, because you can just fold them up and toss them in a truck bed or trunk to head to the worksite. For safety, look for step stools and ladders with handrails on the side and remember to wear a hardhat while working at a construction site.", "parent_text": "Backroom Retail Supplies", "keyword_density": {"ladders": "2.3", "step stools": "4.6", "step": "3.7"}, "department_id": 3}
