{"department_text": "Retail Store Supplies", "nr_products": 38, "level": -2, "url": "http://www.staples.com/Garment-Steamers-Irons/cat_CL166373", "text": "Garment Steamers & Irons", "department_url": "http://www.staples.com/Retail-Store-Supplies/cat_SC5421", "description_title": "Garment Steamers & Irons", "parent_url": "http://www.staples.com/Sewing-Tailoring/cat_DP8479", "keyword_count": {"irons": 3}, "description_wc": 173, "description_text": "With so many irons to choose from, it is easy to find the right model to keep your workforce looking neat and tidy. When your uniform or work attire has the look of a wrinkled prune, a dry or steam iron will make your clothes crisp. Using one of these wrinkle-defeating accessories is a great way to stay sharp for incoming customers or clients. Shuts Off Automatically Some irons are designed with an automatic shut-off designed to prevent accidents. Just finish up your ironing and leave the room, and your device will shut down within a few minutes. Steam or Dry Many of the irons from Panasonic feature a steam or dry option. Consider which is better for your ironing needs before you begin de-wrinkling your pants or shirt. Retractable Cord If your ironing board is far from the wall socket, find an iron with a retractable cord. The cord will let you have a bit of freedom while ironing, and when you're finished, it retracts into its slot.", "parent_text": "Sewing & Tailoring", "keyword_density": {"irons": "1.7"}, "department_id": 3}
