{"department_text": "Retail Store Supplies", "nr_products": 118, "level": -2, "url": "http://www.staples.com/Paper-Towels/cat_CL141826", "text": "Paper Towels", "department_url": "http://www.staples.com/Retail-Store-Supplies/cat_SC5421", "description_title": "Paper Towels", "parent_url": "http://www.staples.com/Cleaning-Supplies-Equipment/cat_DP8178", "keyword_count": {"paper towels": 7, "towels": 9}, "description_wc": 205, "description_text": "Paper towels are always a necessity, providing an uncomplicated way for any staff member to handle minor messes on the spot. Softer paper towels are gentle for use on skin, while heavy-duty rolls provide thick and absorbent wipes for your janitorial employees. Choose between perforated and nonperforated varieties from leading brands such as Scott, Bounty, and Kleenex. Multipurpose Towels From drying damp hands to wiping smudgy windows, paper towels are widely effective at absorbing liquid and picking up messy substances. Staples carries every format you need for a hygienic workplace, ranging from hard-wound paper towels for industrial cleanup to multifold hand towels for individual use. Flexible Setup Enjoy multiple options for arranging your paper towels, including convenient dispensers that portion out the sheets economically. Products such as pop-up dispensers and center-pull paper towels store and distribute the sheets all in one place, eliminating the need for special installation. Folded varieties are packaged in neat stacks that can be kept right beside the sink. Value Sizes Save money by stocking up on bulk products that features several cases of durable paper towels. You can also find recycled products for ecofriendly office cleanup and perforated rolls with different sheet sizes to reduce waste.", "parent_text": "Cleaning Supplies & Equipment", "keyword_density": {"paper towels": "6.8", "towels": "4.4"}, "department_id": 3}
{"department_text": "Retail Store Supplies", "nr_products": 45, "level": -2, "url": "http://www.staples.com/Wipers/cat_CL159267", "text": "Wipers", "department_url": "http://www.staples.com/Retail-Store-Supplies/cat_SC5421", "description_title": "Wipers", "parent_url": "http://www.staples.com/Cleaning-Supplies-Equipment/cat_DP8178", "keyword_count": {"wipers": 6}, "description_wc": 212, "description_text": "Wipers give you a convenient way to clean up minor messes and spills while on the job. Whether you need wet wipes or dry wipes, you're sure to find the right wipe for the task at hand. Ensuring that you have wipes on hand for your workers at all times will keep your environment clean and protect your employees from exposure to vapors and chemical splashes. Absorb Leaks and Spills Wipers are a convenient way to quickly clean up leaks and spills so that chemicals and other messes don't spread and cause problems. When you use wipers in conjunction with regular industrial cleaners , you can ensure that your work environment remains safe and clean. Reduce Chemical Exposure By keeping wipers available at all times, you can ensure that messes are cleaned up quickly, reducing exposure to harmful chemicals and vapors. A clean environment reduces the possibility of illnesses and injuries caused by contaminated air or slippery surfaces. Convenient Portable Containers Most wipers come in convenient portable containers, so you can stash them in a supply closet, store them in a company truck, or place them around the job site for easy access. It's easy to make sure you always have wipers handy for quick cleanups on the job.", "parent_text": "Cleaning Supplies & Equipment", "keyword_density": {"wipers": "2.8"}, "department_id": 3}
