{"department_text": "Retail Store Supplies", "nr_products": 28, "level": -2, "url": "http://www.staples.com/Trash-Bags/cat_CL141923", "text": "Trash Bags", "department_url": "http://www.staples.com/Retail-Store-Supplies/cat_SC5421", "description_title": "Trash Bags", "parent_url": "http://www.staples.com/Cleaning-Supplies-Equipment/cat_DP8178", "keyword_count": {"bags": 7, "trash": 8, "trash bags": 2}, "description_wc": 215, "description_text": "Great selection of paper & plastic\u00a0Trash Bags in hundred of sizes for the household supplies, office,\u00a0industrial or job site, health & personal care. Free shipping available on\u00a0tall kitchen bags, contractor bags. Whether you have a two-person office or a much larger staff, trash is an inescapable part of the work environment. Your individual needs will depend on the type of business you run. Staples carries garbage bags from all the top manufacturers, so you can choose the best trash bag for your workplace. Environmentally Friendly Add an extra green factor to your business by choosing trash bags made from recycled content. There are also specially designed compostable garbage bags available that are still strong enough to contain particularly heavy or sharp objects. Multiple Sizes One size doesn't fit all when it comes to your trash needs, so it's important to choose the right sized bag for the job. Whether you have a small trash can for your own personal use or a large outdoor can, Staples has a trash bag to fit the job. Special Needs For those who want a little extra with their garbage disposal methods, scented bags and insect-repellant liners are available. Trash liners for appliances like paper shredders are also available to streamline the cleanup process.", "parent_text": "Cleaning Supplies & Equipment", "keyword_density": {"bags": "3.3", "trash": "3.7", "trash bags": "1.9"}, "department_id": 3}
