{"department_text": "Retail Store Supplies", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Spray-Bottles-Pumps/cat_CL204491", "text": "Spray Bottles & Pumps", "department_url": "http://www.staples.com/Retail-Store-Supplies/cat_SC5421", "description_title": "Spray Bottles & Pumps", "parent_url": "http://www.staples.com/Cleaning-Supplies-Equipment/cat_DP8178", "keyword_count": {"spray": 8, "pumps": 2, "spray bottles": 3}, "description_wc": 141, "description_text": "Use spray bottles and pumps to apply chemicals, water, or other fluids to any surface. Use them to administer fertilizer or herbicides outside, wash down equipment, or help clean the office kitchen or bathroom. Long Tube Lengths Long tube lengths on spray bottles and pumps make it easy to get every last drop of liquid out. If you're using your spray bottle with potentially harmful chemicals, don't forget to wear protective cleaning gloves while you work. Hand Sprayers When you need to spray small amounts of liquid, spray bottles in a convenient 32-ounce size are easy to carry and operate. A trigger release lets you control how much liquid gets released. Drum Systems Large applications of fluid require a large spray system, and sprayers that connect to 15-, 30-, or 55-gallon drums fit the bill.", "parent_text": "Cleaning Supplies & Equipment", "keyword_density": {"spray": "5.8", "pumps": "1.4", "spray bottles": "4.3"}, "department_id": 3}
{"department_text": "Retail Store Supplies", "nr_products": 8, "level": -2, "url": "http://www.staples.com/Squeegies/cat_CL168327", "text": "Squeegies", "department_url": "http://www.staples.com/Retail-Store-Supplies/cat_SC5421", "description_title": "Squeegies", "parent_url": "http://www.staples.com/Cleaning-Supplies-Equipment/cat_DP8178", "keyword_count": {"squeegies": 3}, "description_wc": 157, "description_text": "Squeegies fit on handles of all shapes and sizes to make dusting and wiping simple and easy. A variety of different construction materials to choose from ensures you will have the right option for the task at hand. The choice of curved or straight designs allows you to get into corners or cover more floor area as needed. Wipe Away Spills Rubber squeegies allow you to brush away spills with ease. The solid construction of each piece provides the leverage needed to remove dirt and debris in the same pass. Reach Around Corners and Behind Desks Curved designs let you easily clean hard-to-reach places. Check out the selection of cleaning wipes for spaces that require an even more precise touch. Interchangeable Heads The ability to swap out squeegee heads lets you replace the rubber component without needing an entirely new piece. Some squeegies even offer a handy flip-top design for use with disposable heads.", "parent_text": "Cleaning Supplies & Equipment", "keyword_density": {"squeegies": "1.9"}, "department_id": 3}
{"department_text": "Retail Store Supplies", "nr_products": 4, "level": -2, "url": "http://www.staples.com/Cleaning-Gloves/cat_CL167163", "text": "Cleaning Gloves", "department_url": "http://www.staples.com/Retail-Store-Supplies/cat_SC5421", "description_title": "Cleaning Gloves", "parent_url": "http://www.staples.com/Cleaning-Supplies-Equipment/cat_DP8178", "keyword_count": {"cleaning gloves": 4, "gloves": 8, "cleaning": 5}, "description_wc": 141, "description_text": "Cleaning gloves let you clean with confidence and help you keep your hands protected no matter what cleaning chemicals you use. Manufacturers such as Mr. Clean offer gloves in a variety of materials and sizes. Wear cleaning gloves every time you wash dishes, counters, or appliances to keep your hands soft and smooth. Reusable Convenience Reusable cleaning gloves can be used over and over again, so they save you money. Some even come with printed cuffs that keep you looking stylish as you clean. Comfortable Fit Choose your size from small, medium, and large options to ensure a comfortable fit. Gloves with plush linings offer even more comfort. Full Hand Protection Cleaning gloves with extra-long cuffs protect your wrists, lower arms, and hands. If you're handling chemicals or fluids that could stay on your gloves, try disposable gloves instead.", "parent_text": "Cleaning Supplies & Equipment", "keyword_density": {"cleaning gloves": "5.7", "gloves": "5.7", "cleaning": "3.5"}, "department_id": 3}
{"department_text": "Retail Store Supplies", "nr_products": 27, "level": -2, "url": "http://www.staples.com/Dusters-Dustpans/cat_CL165592", "text": "Dusters / Dustpans", "department_url": "http://www.staples.com/Retail-Store-Supplies/cat_SC5421", "description_title": "Dusters / Dustpans", "parent_url": "http://www.staples.com/Cleaning-Supplies-Equipment/cat_DP8178", "keyword_count": {"dustpans": 4, "dusters": 4}, "description_wc": 193, "description_text": "Prevent a buildup of dust or grime with these dusters and dustpans. From feather dusters to heavy-duty dustpans, you'll be able to find the right accessory to clean those tough-to-reach spots. Essential to any supply closet, these cleaning supplies are small enough to fit nicely in your office or workplace without taking up too much room. Work in a Dust-Free Environment Dusters and dustpans are made to keep your workspace clean. Whether you choose a dusting cloth or some dusting gloves, a quick once-over will help cut down on allergies and general grime around the office. Refills Available Keep those dusters and dustpans fresh and ready for work with the many refill options available. Packages from UNISAN or Swiffer offer refill kits that'll ensure your supply closet stays prepared for the inevitable dust bunny attack. Dustpan and Brush Packages Companies such as OXO Good Grips offer a dustpan and brush package, so you can wipe up that dust and toss it in your trashcan . Many of these devices have firm rubber handles that'll give you a solid grip on the dustpan while you clean.", "parent_text": "Cleaning Supplies & Equipment", "keyword_density": {"dustpans": "2.1", "dusters": "2.1"}, "department_id": 3}
