{"department_text": "Retail Store Supplies", "nr_products": 27, "level": -2, "url": "http://www.staples.com/Mops-Sponges-Buckets/cat_CL142819", "text": "Sponges / Scrubs", "department_url": "http://www.staples.com/Retail-Store-Supplies/cat_SC5421", "description_title": "Sponges / Scrubs", "parent_url": "http://www.staples.com/Cleaning-Supplies-Equipment/cat_DP8178", "keyword_count": {"sponges": 4, "scrubs": 4}, "description_wc": 201, "description_text": "Sponges and scrubs can remove grease and dirt from a wide variety of surfaces. Choose scrubbing tools with the right texture to clean your dishes and furniture without causing damage. Brands like Scotch-Brite and 3M even offer products with built-in cleansers and antibacterial properties for added protection. Heavy-Duty Scouring Power For the most stubborn dirt buildup, scouring pads and heavy-duty scrubbers increase friction to break down particles in sticky or grimy substances, such as grease. When made from durable materials like steel wool, your sponges and scrubs can withstand frequent rubbing and tension. Stain and Smudge Removal Eliminate unsightly marks from counters, walls, and whiteboards with stain-erasing sponges and scrubs. Whether you're cleaning conference room boards or working with crayon-wielding children, brands like Mr. Clean have designed nonabrasive scrubbers that erase stains without scratching or wearing away paint and surface coating. Disinfectant Ingredients Don't let bacteria settle on your dishware and furniture. Buy sponges and scrubs that are pretreated with cleaning chemicals and antimicrobial protection to fight the spread of germs on cookware, dishes, and furniture frequently used by the public. For even more cleaning power, check out Staples selection of disinfectants .", "parent_text": "Cleaning Supplies & Equipment", "keyword_density": {"scrubs": "2.0", "sponges": "2.0"}, "department_id": 3}
