{"department_text": "Accounting | Forms | Security", "nr_products": 7, "level": -1, "url": "http://www.staples.com/Cash-Register-Rolls/cat_CL142793", "text": "Cash Register / Rolls", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Cash Register / Rolls", "parent_url": "http://www.staples.com/Cash-Registers-POS-Systems/cat_DP2235", "keyword_count": {"register rolls": 2, "cash register": 2, "register": 4, "rolls": 9, "cash register rolls": 1}, "description_wc": 126, "description_text": "There\u2019s little worse than running out of receipt paper in the middle of a transaction. We carry the cash register paper, calculator paper and credit card paper rolls you\u2019re sure to need. Stock up on rolls of paper today and never be without. Receipt Paper Rolls in a Variety of Sizes and Styles From 1 to 2-ply thermal paper to 1 to 2 part rolls, our receipt rolls will satisfy the demands of your technology POS Paper Rolls That Work With Your Device Whether you seeking thermal cash register rolls or POS rolls, we carry register rolls compatible with your calculator, register or terminal Reliable Brands Including Staples and Sharp Shop our receipt paper today for fast, easy results you can count on.", "parent_text": "Cash Registers / POS Systems", "keyword_density": {"register rolls": "3.2", "register": "3.2", "cash register rolls": "2.4", "rolls": "7.1", "cash register": "3.2"}, "department_id": 25}
