{"department_text": "Accounting | Forms | Security", "nr_products": 356, "level": -1, "url": "http://www.staples.com/POS-Accessories/cat_CL164019", "text": "POS Accessories", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "POS Accessories", "parent_url": "http://www.staples.com/Cash-Registers-POS-Systems/cat_DP2235", "keyword_count": {"pos": 11}, "description_wc": 131, "description_text": "At Staples, we carry the best POS printers for your convenience and ease. Whether you\u2019re printing a label or a receipt, our POS equipment and POS supplies will get the job done and get it done right. Shop our selection today. The Extra POS Items You Need From POS cash drawers to stands, POS receipt printers, POS keyboards and cables, we have point of sale supplies to supplement all of your point of sale equipment Easy to Read Point of Sale Displays Ensure your customers will always be able to read POS displays with a POS pole display from Logic Top Notch Brands Ingram, Wasp and Logic controls pole display Find point of sale printers, POS cash drawers and POS sale displays to suit your needs right here at Staples.", "parent_text": "Cash Registers / POS Systems", "keyword_density": {"pos": "8.4"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 35, "level": -1, "url": "http://www.staples.com/POS-Systems/cat_CL164022", "text": "POS Systems", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "POS Systems", "parent_url": "http://www.staples.com/Cash-Registers-POS-Systems/cat_DP2235", "keyword_count": {"pos": 9, "systems": 7, "pos systems": 6}, "description_wc": 142, "description_text": "We carry the best POS systems on the market, ready and waiting to ring up sales and track inventory. No matter what your industry, our point of sale systems will meet your needs. Shop our selection today. POS Software and Hardware We carry the latest Quickbooks point of sale software that can work on a range of POS systems so your hardware will always be up to date Solutions for Every Industry From POS systems for restaurants to retail POS systems, our POS machines and point of sale Quickbooks software will meet your industry-specific demands Top Notch Brands for Retail and Restaurant POS Systems From PCAmerica to Quickbooks, we\u2019ve got you covered Whether you\u2019re searching for a POS system for a new restaurant or for your decades old boutique, our POS systems will provide just the fix you seek.", "parent_text": "Cash Registers / POS Systems", "keyword_density": {"pos systems": "8.5", "pos": "6.3", "systems": "4.9"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 299, "level": -1, "url": "http://www.staples.com/Barcode-Scanners-Readers/cat_CL141846", "text": "Barcode Scanners & Readers", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Barcode Scanners & Readers", "parent_url": "http://www.staples.com/Cash-Registers-POS-Systems/cat_DP2235", "keyword_count": {"barcode scanners": 4, "barcode": 8, "scanners": 7}, "description_wc": 129, "description_text": "Whether you work in the medical industry or retail, experience fast and accurate scanning with a barcode scanner, from Staples. We carry the software and hardware you need to get things done. Browse our selection for your new bar code scanner today. Choose Your Barcode Reader Style and Format We carry handheld scanners, USB barcode scanners, wireless barcode scanners, laser scanners, pen scanners and wasp barcode scanners that work how you do All the Best Features Handheld barcode scanners and barcode scanner pens come with a base included, are fully rechargeable and have Bluetooth technology so you can scan from up to 160 feet away Trusted Brands Wasp, Honeywell and Motorola Whether it\u2019s wireless or laser technology you seek, shop our barcode scanner for the quality you deserve.", "parent_text": "Cash Registers / POS Systems", "keyword_density": {"barcode scanners": "6.2", "barcode": "6.2", "scanners": "5.4"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 19, "level": -1, "url": "http://www.staples.com/Cash-Registers/cat_CL140563", "text": "Cash Registers", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Cash Registers", "parent_url": "http://www.staples.com/Cash-Registers-POS-Systems/cat_DP2235", "keyword_count": {"cash registers": 4, "cash": 9}, "description_wc": 135, "description_text": "Process customer purchases quickly and efficiently with a cash register you know will do the job right. We carry a wide range of cash register machine brands and styles that will suit your needs. Shop our selection today. Multiple Styles Whether you seek an electronic cash register with an LED screen, a high memory capacity and a number of buttons, a POS cash register with an LED screen, or a cash register with a barcode scanner, our range of options provide easy, customizable user interfaces Sync Easily with Other Payment Technology Electronic cash registers come with PC link SD cards for easy syncing with the rest of your payment technology The Best Brands Including Sharp cash registers and Casio cash registers We stock only the best cash registers in the industry for our discerning customers.", "parent_text": "Cash Registers / POS Systems", "keyword_density": {"cash registers": "5.9", "cash": "6.7"}, "department_id": 25}
