{"department_text": "Accounting | Forms | Security", "level": -1, "url": "http://www.staples.com/Business-Software/cat_DP1440", "text": "Business Software", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Business Software", "parent_url": "http://www.staples.com/Computer-Software/cat_CG5", "keyword_count": {"business software": 2, "business": 4, "software": 3}, "description_wc": 105, "description_text": "Staples has a full range of business software to suit any ones needs. Starting from operating systems (and upgrades) through to business suites and specialty software for legal and medical purposes, you'll find what you need. For small business software, we have a range of options that will help you run your operations better, cut costs and reduce paper processes. We recommend starting with the Microsoft Office package and going from there. If you're unsure what you need, start by browsing the categories listed here \u2013 they'll guide you through the different options available until you find the package that suits your business.", "parent_text": "Computer Software", "keyword_density": {"business software": "3.8", "business": "3.8", "software": "2.9"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "level": -1, "url": "http://www.staples.com/Accounting-Finance/cat_DP1437", "text": "Accounting & Finance Software", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Accounting & Finance Software", "parent_url": "http://www.staples.com/Computer-Software/cat_CG5", "keyword_count": {"finance software": 1, "software": 6, "accounting": 4}, "description_wc": 140, "description_text": "Accounting software is a time saving tool for personal and commercial use. Find user friendly task managers to monitor cash flow, manage employees, write tax reports, track sales, check inventories and more. When choosing accounting software, keep these important factors in mind: Quick View - Personal finance software such as Quicken and accounting software can interpret a wide range of data and present it in a variety of easy-to-read formats. Calendar - Documents, data and important tasks are organized in calendars making it easy to find invoices, bills and to-do lists, past or present. Compatibility - Financial software can work alongside other major management tools such as Outlook or ACT. Staples stocks the brands you know and trust, including QuickBooks and PeachTree, at great value prices. With a wide range of accounting software packages on offer, Staples makes bookkeeping simple.", "parent_text": "Computer Software", "keyword_density": {"accounting": "2.9", "finance software": "1.4", "software": "4.3"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 3, "level": -1, "url": "http://www.staples.com/Software-Training/cat_CL164476", "text": "Software Training", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Software Training", "parent_url": "http://www.staples.com/Computer-Software/cat_CG5", "keyword_count": {"software": 2}, "description_wc": 26, "description_text": "Visit the new Software Research Center to learn about all our top-selling business software titles. Compare versions, learn about features, watch helpful videos, and more!", "parent_text": "Computer Software", "keyword_density": {"software": "7.7"}, "department_id": 25}
