{"department_text": "Accounting | Forms | Security", "nr_products": 3, "level": -1, "url": "http://www.staples.com/Antivirus-Internet-Security/cat_CL140492", "text": "Antivirus Security & Identity Protection", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Antivirus Security & Identity Protection", "parent_url": "http://www.staples.com/Computer-Software/cat_CG5", "keyword_count": {"protection": 2, "antivirus": 4}, "description_wc": 113, "description_text": "There is a wide range of antivirus software options available to people looking to protect their computers from malware. The best antivirus software will help prevent, find and remove all kinds of threats, including viruses, phishing, spyware, adware and trojans. As you shop for virus protection from our wide selection, consider the following: Speed : Lighter antivirus software is available to help you maintain performance on your computer. Mobile : Don't forget to protect your mobile and other browsing devices from malware. More Protection : Decide whether you need your antivirus software to also backup your computer. Licenses : If you're buying for an office, don't forget to check how many users you require.", "parent_text": "Computer Software", "keyword_density": {"protection": "1.8", "antivirus": "3.5"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 40, "level": -1, "url": "http://www.staples.com/Web-Design-Programming/cat_CL167779", "text": "Web Design/Programming", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Web Design/Programming", "parent_url": "http://www.staples.com/Computer-Software/cat_CG5", "keyword_count": {"web": 6, "design": 11, "web design": 4}, "description_wc": 147, "description_text": "From beginning designers to seasoned experts, we carry a wide range of web design software to suit every level of user. When shopping for website design software, there are a few things to consider: Powerful Tools: Whether you\u2019re laying out a new design in master pages or simply choosing from quick, easy to use templates, our web design software offers powerful, responsive tools and formats that provide the design solutions you need. Streamlined Designing: The best website design software provides a backbone structure, a simple user interface and easy to access tutorials so you can spend more time getting creative and less time navigating the system. Trusted Names: When it comes to web design software, turn to one of our many top brands for design tools you can count on. Browse our web design software today for the best in the industry at a reasonable price.", "parent_text": "Computer Software", "keyword_density": {"web": "4.1", "design": "7.5", "web design": "5.4"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 144, "level": -1, "url": "http://www.staples.com/Photo-Graphics-Visual-Design/cat_CL167778", "text": "Photo/Graphics/Visual Design", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Photo/Graphics/Visual Design", "parent_url": "http://www.staples.com/Computer-Software/cat_CG5", "keyword_count": {"photo": 3, "design": 7, "graphics": 1}, "description_wc": 133, "description_text": "Whether you\u2019re designing a clean, compelling logo for a client or simply editing those family photos, our powerful graphic design software will get the job done. Multi-Faceted Design Software: Lighten dark photos with photo editing software. Play with filters. Quickly produce mock-ups with diverse templates. Learn CAD. Our multi-faceted graphic design software is up for wide range of jobs. Right for All Expertise Levels: Whether you\u2019re just dipping your toes into design or are a true expert, we offer a graphic design software solution that\u2019s right for you. Top Brands: We carry top graphics software brands brands like Adobe and Corel, so you can trust you\u2019ll get the highest quality results. Shop our selection of graphic design software today and bring your creative visions to life.", "parent_text": "Computer Software", "keyword_density": {"photo": "2.3", "design": "5.3", "graphics": "0.8"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 11, "level": -1, "url": "http://www.staples.com/Personal-Interest/cat_CL167741", "text": "Personal Interest", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Personal Interest", "parent_url": "http://www.staples.com/Computer-Software/cat_CG5", "keyword_count": {"interest": 6, "personal interest": 5}, "description_wc": 129, "description_text": "Our personal interest titles include the latest genealogy software, scrapbooking applications, and more. From wedding planning to dieting, Staples carries a wide variety of personal interest software at everyday low prices. Here\u2019s what you\u2019ll find when browsing our selection of personal interest software: Genealogy Software \u2013 Research family history and organize your family tree with the most complete, up-to-date genealogy applications. Scrapbooking & Crafts \u2013 Design beautiful scrapbooks with cutting-edge editing and design software that includes themes for every occasion. Excellent Variety \u2013 Our personal interest titles also include health & nutrition, food & drink, recreation, and religion-related software. Staples helps you find the most useful software for every hobby and interest. Check out our wide assortment of personal interest options to find exactly what you\u2019re looking for.", "parent_text": "Computer Software", "keyword_density": {"interest": "4.7", "personal interest": "7.8"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 7, "level": -2, "url": "http://www.staples.com/PDF-Software/cat_CL141665", "text": "PDF Software", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "PDF Software", "parent_url": "http://www.staples.com/Photo-Media-Design-Software/cat_DP1438", "keyword_count": {"pdf": 11, "pdf software": 4, "software": 5}, "description_wc": 110, "description_text": "PDF software helps you create PDFs, convert other file formats into searchable PDF files, and edit or annotate existing PDF documents. When browsing our wide selection of PDF software, look for these features: 1. Microsoft Office Compatibility \u2013 Convert Microsoft Word and other Microsoft Office files into standard PDF documents. 2. PDF Modification \u2013 Add notes, edit text, or annotate words and graphics for more effective PDF collaboration. 3. Cloud Connectivity \u2013 Access PDF documents and other files wherever you are with software that connects to the cloud. Staples makes it easy to find the best PDF software for your needs. Choose great titles from our wide variety of professional PDF software products.", "parent_text": "Photo, Media & Design Software", "keyword_density": {"pdf": "10.0", "pdf software": "7.3", "software": "4.5"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 112, "level": -1, "url": "http://www.staples.com/System-Utilities-Maintenance/cat_CL167780", "text": "System Utilities/Maintenance", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "System Utilities/Maintenance", "parent_url": "http://www.staples.com/Computer-Software/cat_CG5", "keyword_count": {"maintenance": 1}, "description_wc": 139, "description_text": "In today\u2019s data-centric world, backup software is an essential part of every office and home. At Staples.com, we carry all of the top brands, for solutions you can trust. Simple Computer Backup: Choose from a wide range of one-click and automatic backup solutions, so you can just set it and forget it. And when you choose online backup, you\u2019ll be able to access your data wherever you are. Fix Data Problems: If your computer is running slowly or crashing frequently, it may be time for PC Tune-Up, a top notch computer maintenance program that recovers memory space and improves speed. Effective Recovery: Computer crashed? Don\u2019t lose hope. Shop for powerful data recovery software to restore what you\u2019ve lost. Browse our wide selection of backup software today and guard your most important data.", "parent_text": "Computer Software", "keyword_density": {"maintenance": "0.7"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 2, "level": -2, "url": "http://www.staples.com/Web-Design-Development-Software/cat_CL141672", "text": "Web Design & Development Software", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Web Design & Development Software", "parent_url": "http://www.staples.com/Photo-Media-Design-Software/cat_DP1438", "keyword_count": {"web": 7, "design": 7, "web design": 3, "software": 5}, "description_wc": 124, "description_text": "Assemble professional websites with web design software from trusted brands like Microsoft. At Staples, we offer a wide assortment of web design products including Adobe Dreamweaver for varied skill sets. Look for Web creation software based on the following features: 1. Design Tools \u2013 Choose from products that help you design pages, add video, and modify scalable web graphics. 2. Interface \u2013 For beginners and experienced designers, find software with an interface that fits your skill level. 3. Graphics \u2013 Photo editing and vector design capabilities help you create the right look. Build interactive, standards-based websites with the web design software available at Staples. Whether you need a product for business or personal use, we'll help you find great value in industry-standard creative software.", "parent_text": "Photo, Media & Design Software", "keyword_density": {"web": "5.6", "design": "5.6", "web design": "4.8", "software": "4.0"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Personal-Finance-Investing/cat_CL140488", "text": "Personal Finance & Investing", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Personal Finance & Investing", "parent_url": "http://www.staples.com/Accounting-Finance/cat_DP1437", "keyword_count": {"personal finance": 4, "finance": 6}, "description_wc": 165, "description_text": "Personal finance software helps you to keep track of your finances and stay in control of your incomings and outgoings each week, each month and each year. With a range of user friendly tools, accounting has never been so simple. When looking for personal finance software, take time to consider these features: Quick View Organization - Personal finance software can collate data from different credit and debit cards and present it in an easy-to-view format all in one place, allowing you to get a clearer picture of your finances across the board. Categorization - Use automated settings to split spending into different categories and see where money is going and where it might be saved. Security - In built security mechanisms allow for the safe import and export of data from all accounts and computers. Staples offers a wide range of great value software, including popular brands like Quicken , making it easier than ever to find the right programs for your personal finance management needs.", "parent_text": "Accounting & Finance Software", "keyword_density": {"personal finance": "4.9", "finance": "3.7"}, "department_id": 25}
