{"department_text": "Accounting | Forms | Security", "nr_products": 7, "level": -2, "url": "http://www.staples.com/Graphics-Software/cat_CL165576", "text": "Graphics Software", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Graphics Software", "parent_url": "http://www.staples.com/Photo-Media-Design-Software/cat_DP1438", "keyword_count": {"graphics": 5, "graphics software": 3, "software": 5}, "description_wc": 114, "description_text": "Use graphics software to create original illustrations, edit photos, draw web graphics, and make vectors for a range of applications. Staples carries graphic design software with the following features: 1. Digital Content \u2013 Find high-quality clip art, photographs, and templates to use in creative graphics-based projects. 2. File Compatibility \u2013 Easily import and export files in a variety of common formats like PDF, JPG, PNG, TIFF, and PSD. 3. Video Tutorials \u2013 Gain insights from design experts who will help you get the most out of your graphics software interface. Enjoy these features and more with the variety of graphics software at Staples. Shop with us to find the best value in graphic design software.", "parent_text": "Photo, Media & Design Software", "keyword_density": {"software": "4.4", "graphics software": "5.3", "graphics": "4.4"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Digital-Photography-Imaging-Software/cat_CL140490", "text": "Digital  Photography & Imaging Software", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Digital  Photography & Imaging Software", "parent_url": "http://www.staples.com/Photo-Media-Design-Software/cat_DP1438", "keyword_count": {"imaging software": 2, "digital photography": 1, "software": 4, "digital": 2}, "description_wc": 118, "description_text": "Take photo editing to a new level with digital photography and imaging software from trusted brands like Adobe. With a wide range of photo editing software for a variety of applications, Staples makes it easy to find the right product. Choose from the following: 1. Adobe Photoshop Products \u2013 Staples carries industry-standard Adobe products like Photoshop CS5 and Photoshop Lightroom. 2. Photo Organizing \u2013 Import and organize photos from your digital camera with a variety of easy-to-use products. 3. Photo Painting \u2013 Add stunning colors and enhancements to make your favorite photographs shine. Find lots of choices and great prices with our selection of high-quality imaging software. Staples makes shopping for the best photo editing software easy.", "parent_text": "Photo, Media & Design Software", "keyword_density": {"imaging software": "3.4", "digital photography": "1.7", "digital": "1.7", "software": "3.4"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 22, "level": -1, "url": "http://www.staples.com/Operating-Systems/cat_CL167740", "text": "Operating Systems", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Operating Systems", "parent_url": "http://www.staples.com/Computer-Software/cat_CG5", "keyword_count": {"operating": 5, "operating systems": 1}, "description_wc": 144, "description_text": "Keep your PC up to date with the best operating system software. At Staples, you\u2019ll find the latest versions of Microsoft operating systems, helpful data transfer and installation tools, and comprehensive teaching materials.Look for the following products in our operating system software selection: Microsoft Windows 8 - Upgrade your Windows 8 , Windows 7, or Windows Vista PC to Windows 8 Pro.\u00a0Reserve today and be the first to receive it as early as 10/26/12. Training Tools and Transfer Kits \u2013 Understand your operating system inside and out with training materials from Microsoft and others. Windows 7 transfer kits from John Wiley & Sons ensure you won\u2019t lose any data when upgrading to the latest operating system. Microsoft Windows 7 \u2013 If your office is not ready for a big OS switch, we also offer a full range of Windows 7 software and products.", "parent_text": "Computer Software", "keyword_density": {"operating": "3.5", "operating systems": "1.4"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 217, "level": -1, "url": "http://www.staples.com/Office-Productivity/cat_CL167739", "text": "Office/Productivity", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Office/Productivity", "parent_url": "http://www.staples.com/Computer-Software/cat_CG5", "keyword_count": {"productivity": 1, "office": 5}, "description_wc": 140, "description_text": "Save time and money with office and productivity software. With a full line of essential programs from leading brands like Microsoft and Adobe. Simplify Daily Tasks Say hello to your new office with Microsoft Office 2013 . For the first time ever your favorite Office is available as a subscription that is PC and Mac compatible.\u00a0Powerful Office Suites will allow you to creating stunning documents, powerful presentations, and insightful spread sheets. Microsoft\u2019s tried-and-true reputation provides the features you expect and the cutting-edge performance you need. Create More Free Time Dictation software allows you to spend less time typing and more time on other important tasks. Dragon NaturallySpeaking from Nuance is a trusted diction program that allows you to speak documents instead of typing them, vocally command your business programs, and respond to emails in seconds.", "parent_text": "Computer Software", "keyword_density": {"productivity": "0.7", "office": "3.6"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 49, "level": -1, "url": "http://www.staples.com/Financial-Accounting-Tax/cat_CL167738", "text": "Financial/Accounting/Tax", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Financial/Accounting/Tax", "parent_url": "http://www.staples.com/Computer-Software/cat_CG5", "keyword_count": {"tax": 3, "financial": 5, "accounting": 5}, "description_wc": 139, "description_text": "Choose from the best accounting software products at everyday low prices. At Staples, we make it easy to find the tax software, financial software, and personal accounting software that fits your needs and keeps you on top of important financial decisions. Here are some things to look for when browsing our assortment of accounting software: Leading Titles \u2013 Find the latest versions of trusted products like Quickbooks, Quicken, TurboTax, and Versacheck. Product Variety \u2013 With the most up-to-date business accounting software, tax preparation software, and more, Staples offers outstanding variety in financial computer applications. Personal & Business Software \u2013 Whether you need financial software for business or personal use, our selection offers products in every category. Make managing your finances easier with leading-edge accounting software available at Staples. We\u2019ll help you find the products that match your financial objectives.", "parent_text": "Computer Software", "keyword_density": {"financial": "3.6", "tax": "2.2", "accounting": "3.6"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 207, "level": -1, "url": "http://www.staples.com/Learning-Education-Training/cat_CL167771", "text": "Learning/Education/Training", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Learning/Education/Training", "parent_url": "http://www.staples.com/Computer-Software/cat_CG5", "keyword_count": {"education": 4, "learning": 1}, "description_wc": 147, "description_text": "With the wide variety of educational software products at Staples, it\u2019s easy to find the titles you\u2019re looking for. Our selection includes everything from supplemental software for schoolchildren to solutions for the working professional. Here\u2019s what you\u2019ll find while browsing our educational software: Language Learning Software \u2013 Choose from the leading names in language software like Rosetta Stone and Berlitz. Mapping Software \u2013 Staples carries all of Microsoft\u2019s latest mapping applications, complete with GPS locators. Resume Software \u2013 Build resumes with cutting-edge resume software designed for the job-seeking professional. Homework Help \u2013 Need extra practice or help with homework? Our educational software includes titles for schoolchildren of all ages. With hundreds of educational options to choose from, Staples is the best place to shop for a variety of software products. We\u2019ll help you locate the titles that put you on track for success.", "parent_text": "Computer Software", "keyword_density": {"education": "2.7", "learning": "0.7"}, "department_id": 25}
