{"department_text": "Accounting | Forms | Security", "nr_products": 30, "level": -1, "url": "http://www.staples.com/Email-Chat-Communications/cat_CL167737", "text": "Email/Chat/Communications", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Email/Chat/Communications", "parent_url": "http://www.staples.com/Computer-Software/cat_CG5", "keyword_count": {"communications": 4, "email": 7}, "description_wc": 133, "description_text": "From email software to business translators, Staples offers the best in email and communications software. Choose from trusted email software products like Microsoft Outlook and phone call management applications like Axon Virtual PBX.Here\u2019s what to look for when shopping for communications software at Staples: Email software \u2013 With the lowest prices for leading email service software, Staples is the best place to stay on the cutting-edge of email communications. Phone software \u2013 Turn your PC into a full-featured business call center with voicemail, faxing, and call management software products. Office translators \u2013 Get accurate, business-class translations with advanced software designed for language professionals. When it comes to communications software, there\u2019s no better place to shop than Staples. Browse our wide assortment of software products for the titles that fit your needs.", "parent_text": "Computer Software", "keyword_density": {"communications": "3.0", "email": "5.3"}, "department_id": 25}
