{"department_text": "Accounting | Forms | Security", "level": -1, "url": "http://www.staples.com/HR-Forms/cat_DP4524", "text": "HR Forms", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "HR Forms", "parent_url": "http://www.staples.com/Accounting-Forms/cat_CG1283", "keyword_count": {"hr": 2, "forms": 4, "hr forms": 1}, "description_wc": 88, "description_text": "Find all of your HR forms at Staples with a variety of employee reports like payroll, time sheets, expense reports, vacation request, and many more. We carry many of the top brands like Adams and Tops to keep your human resource paperwork organized. Choose from multiple ComplyRight compliance forms and posters for equal opportunity, job safety, wage information, and employee rights. Find many forms for easy tracking of payroll, timesheets, attendance, and employee records. Pick between many HR products like jackets, carbonless forms, templates, posters, and form books.", "parent_text": "Accounting / Forms", "keyword_density": {"hr": "2.3", "forms": "4.5", "hr forms": "2.3"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 252, "level": -1, "url": "http://www.staples.com/Audio-Video-Multimedia/cat_CL167735", "text": "Audio/Video/Multimedia", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Audio/Video/Multimedia", "parent_url": "http://www.staples.com/Computer-Software/cat_CG5", "keyword_count": {"video": 4, "multimedia": 4, "audio video": 1, "audio": 5}, "description_wc": 133, "description_text": "With the latest audio, multimedia, and video editing software, you can create professional-quality videos from your home PC. Find a great selection of audio editing software and movie editing software right here on Staples.com.Here\u2019s what Staples offers when it comes to audio, visual, and multimedia software: Assortment \u2013 From the latest audio recording software to video software, our selection includes all the best titles. Leading brands \u2013 Get cutting-edge multimedia software from brands like Adobe, Corel, Cakewalk, and others. OS Compatibility \u2013 We carry software for PC and Mac, so you can enjoy the best audio/video products no matter which operating system you use. Browse our selection for excellent multimedia products at everyday low prices. At Staples, we make it easy to find the best software titles for professionals and hobbyists alike.", "parent_text": "Computer Software", "keyword_density": {"audio video": "1.5", "multimedia": "3.0", "video": "3.0", "audio": "3.8"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "level": -1, "url": "http://www.staples.com/Business-Forms/cat_DP1002", "text": "Business Forms", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Business Forms", "parent_url": "http://www.staples.com/Accounting-Forms/cat_CG1283", "keyword_count": {"forms": 4, "business forms": 2}, "description_wc": 70, "description_text": "Find all of your business forms at Staples with easy access to dozens of common forms for invoices, purchasing, auto mileage & expenses, sales, leasing & rental, and many more. Pick from a variety of brands like Adams, Tops, and Rediform. Staples has multiple copy products including two and three part carbonless forms with varying colors. Simplify many paperwork tasks with unified and consistent business forms for expenses, inventory, receipts, and compliance.", "parent_text": "Accounting / Forms", "keyword_density": {"forms": "5.7", "business forms": "5.7"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 60, "level": -1, "url": "http://www.staples.com/Anti-Virus-Security-Privacy/cat_CL167734", "text": "Anti-Virus/Security/Privacy", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Anti-Virus/Security/Privacy", "parent_url": "http://www.staples.com/Computer-Software/cat_CG5", "keyword_count": {"virus": 5, "anti": 4, "security": 2}, "description_wc": 135, "description_text": "Get the most effective antivirus software for your computer or mobile device. We offer the latest, most up-to-date virus protection titles, so you can rest assured that your computer is safe from hackers and malicious software.At Staples, we deliver all of the following in computer security software: Trusted brands \u2013 Find the most robust antivirus applications from trusted names like Norton, Kaspersky, and others. Mobile protection \u2013 Secure all of your devices with software that protects mobile devices in addition to desktop and laptop computers. Protection for Windows and Mac \u2013 Enjoy the best protection no matter what operating system you use. Staples carries antivirus software for PC and Mac. Shield your devices from harm with the best computer and internet security software. We make it easy to find the antivirus protection you\u2019re looking for.", "parent_text": "Computer Software", "keyword_density": {"virus": "3.7", "anti": "3.0", "security": "1.5"}, "department_id": 25}
