{"department_text": "Accounting | Forms | Security", "nr_products": 104, "level": -1, "url": "http://www.staples.com/Security-Fire-Water-Safes/cat_CL158854", "text": "Security / Fire / Water Safes", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Security / Fire / Water Safes", "parent_url": "http://www.staples.com/Safes-Fire-Chests/cat_CG1022", "keyword_count": {"fire": 4, "water": 4, "security": 3, "safes": 14}, "description_wc": 137, "description_text": "When it\u2019s time to protect company cash, documents, data and valuables, you want a safe you can trust in your office. At Staples\u00ae we carry a wide variety for fireproof safes, waterproof safes, security safes, and gun safes. 1. A Range of Sizes - From wall safes that can hold laptop and prescription bottles to executive safes with five shelves, we carry office safes that will fit all of your needs. 2. Protect against theft, water and fire with our selection of fireproof and waterproof safes. With solid, durable steel, bolt-down hardware and programmable locks, you can safeguard all of the office\u2019s most important investments. 3. Trusted Brands \u2013 Sentry\u00ae Safes and Mesa\u2122 Safes. Browse our home and office safes, fire safes, waterproof safes, and security safes today for a solution that fits your security needs.", "parent_text": "Safes / Fire Chests", "keyword_density": {"fire": "2.9", "water": "2.9", "security": "2.2", "safes": "10.2"}, "department_id": 25}
{"department_text": "Accounting | Forms | Security", "nr_products": 87, "level": -1, "url": "http://www.staples.com/Commercial-Industrial-Shredders/cat_CL206061", "text": "Commercial / Industrial Shredders", "department_url": "http://www.staples.com/Accounting-Forms-Security/cat_SC1688", "description_title": "Commercial / Industrial Shredders", "parent_url": "http://www.staples.com/Shredders-Oil-Bags/cat_CG1103", "keyword_count": {"commercial": 2, "shredders": 2}, "description_wc": 55, "description_text": "Commercial office shredders are powerful and robust solutions that bring reliability and speed to your shredding needs, ensuring time spent shredding is kept to a minimum. Commercial office paper shredders are designed for a shared use environment with more than 10 users and feature continuous duty run times and expanded volume wastebaskets to collect waste.", "parent_text": "Shredders / Oil / Bags", "keyword_density": {"commercial": "3.6", "shredders": "3.6"}, "department_id": 25}
{"department_text": "Retail Store Supplies", "level": 0, "url": "http://www.staples.com/Point-of-Sale-Systems-Cash/cat_CG2899", "text": "Point of Sale Systems / Cash", "department_url": "http://www.staples.com/Retail-Store-Supplies/cat_SC5421", "description_title": "Point of Sale Systems / Cash", "parent_url": "http://www.staples.com/Retail-Store-Supplies/cat_SC5421", "keyword_count": {"point of sale systems": 1, "point of sale": 2, "cash": 2}, "description_wc": 132, "description_text": "A large looming question for any new business owner is \u201cwhat is point of sale\u201d and which system is right for me? As such, the selection of the right POS system can often be the most daunting of tasks in starting your business or upgrading from your old cash register or cash handling processes to something new. Knowing what works for your specific business type and what will meet your specific needs can be overwhelming. Staples is here to help make that process much easier. Search for a wide array of point of sale systems from leading manufactures like, HP, APG, Star, Epson and Zebra. Use our resource center to answer questions concerning how the numerous varieties of peripherals all work together and what is currently trending in the marketplace and why.", "parent_text": "Retail Store Supplies", "keyword_density": {"point of sale systems": "3.0", "point of sale": "4.5", "cash": "1.5"}, "department_id": 3}
