{"department_text": "Paper | Notebooks | Post-it &reg", "level": 0, "url": "http://www.staples.com/Stationery-Invitations/cat_DP1422", "text": "Stationery / Invitations", "department_url": "http://www.staples.com/Paper-Notebooks-Post-it/cat_SC1676", "description_title": "Stationery / Invitations", "parent_url": "http://www.staples.com/Paper-Notebooks-Post-it/cat_SC1676", "keyword_count": {"stationery": 4, "invitations": 1}, "description_wc": 135, "description_text": "Getting married? Graduating? Just want to thank your neighbor for a potluck well done? At Staples, we have all the right stationery to get the job done. Customize Your Look - We have a wide array of designs in stock, specially crafted for each occasion. Celebrate the changing seasons with autumn stationery, or purchase a wedding invitation kit to cover all of your needs. Wide Range of Sizes - Our invitations and cards come in all shapes and sizes, printed on thick quality stock. Spice Up Your Work - Got a big school report or family newsletter and want to add a little color and play? Our decorative desktop stationery will be just the right thing. Or send a unique postcard from wherever you are! We\u2019ve got all the right materials for all of your stationery needs.", "parent_text": "Paper | Notebooks | Post-it &reg", "keyword_density": {"stationery": "3.0", "invitations": "0.7"}, "department_id": 5}
{"department_text": "Paper | Notebooks | Post-it &reg", "level": 0, "url": "http://www.staples.com/Index-Card-Index-Card-Storage/cat_DP2227", "text": "Index Card / Index Card Storage", "department_url": "http://www.staples.com/Paper-Notebooks-Post-it/cat_SC1676", "description_title": "Index Card / Index Card Storage", "parent_url": "http://www.staples.com/Paper-Notebooks-Post-it/cat_SC1676", "keyword_count": {"index card": 6, "card": 8}, "description_wc": 113, "description_text": "Have a recipe you\u2019d like to jot down? Preparing for that big test? There\u2019s no better way to get on track than with notecards. Get Organized - Categorize information with a palette of colors that will make your flashcards really pop. Ruled and Tabbed Index Cards - Easily access names and numbers with tabbed index card guides. Keep your notes neat with ruled lines. Stylish Spiral Index Card Holders - Choose from a variety of spiral bound and stylish index card holders, which can fit right on top of your desk for easy access. With our sturdy, thick index cards and index card holders from the brands you trust, you\u2019ll stay on top", "parent_text": "Paper | Notebooks | Post-it &reg", "keyword_density": {"index card": "10.6", "card": "7.1"}, "department_id": 5}
{"department_text": "Filing | Binders | Organizers", "level": 0, "url": "http://www.staples.com/File-Folder-Labels/cat_DP1518", "text": "File Folder Labels", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "File Folder Labels", "parent_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "keyword_count": {"labels": 12, "file folder labels": 4, "file": 9}, "description_wc": 180, "description_text": "Arrange your files by using file folder labels so that they're easy to access and identify. Choose from permanent or removable file labels to suit your needs. You can even find ecofriendly recycled labels for your environmentally responsible office. Printable Labels You can write or print anything you want on file folder labels so that you can arrange your files in any way you'd like. Arrange files by date, name, number, or category and make everything easier to find in your filing cabinet or storage box. Color-Coded Convenience For instant identification of categories and groupings, choose color-coded file folder labels. Pre-printed labels include numbers or letters, which make organization even easier, and mailing labels are specifically made for your shipping needs. End-Tab Labels End-tab labels provide a smaller profile for wrap-around convenience. They're self-adhesive, so you don't need to worry about them accidentally falling off like other file folder labels. Also consider custom labels for jobs that require a personal touch. At Staples, we have your labeling needs covered!", "parent_text": "Filing | Binders | Organizers", "keyword_density": {"labels": "6.7", "file folder labels": "6.7", "file": "5.0"}, "department_id": 6}
