{"department_text": "Filing | Binders | Organizers", "nr_products": 1, "level": -1, "url": "http://www.staples.com/Alpha-Filing-Labels/cat_CL141305", "text": "Alpha Filing Labels", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "Alpha Filing Labels", "parent_url": "http://www.staples.com/File-Folder-Labels/cat_DP1518", "keyword_count": {"alpha": 4, "labels": 6, "filing": 4, "alpha filing labels": 3}, "description_wc": 170, "description_text": "With alpha filing labels, you can organize folders into color-coded groups. The labels' wide, wraparound design makes them visible from the front or back. Secure adhesive keeps these durable labels from slipping off. Organize Your Records Locate the files you need in record time with tab-style labels you can apply directly to binders and file folders. The alphanumeric coding enables quick categorization by letter, making this label set ideal for organizing contracts, order histories, and patient files. Readable Design When you buy multiple sets of alpha filing labels, brightly colored backgrounds distinguish each letter. The large white lettering contrasts perfectly with the colorful backgrounds for maximum visibility. Easily spot the folders you need without sacrificing precious time. Apply in Seconds You don't need to buy specific tab folders to use alpha filing labels. Choose the best folders for your business from Staples' extensive range of products, and simply attach the sticky backing to the paper surface. The strong adhesive can hold up to long-term filing conditions.", "parent_text": "File Folder Labels", "keyword_density": {"alpha": "2.4", "labels": "3.5", "filing": "2.4", "alpha filing labels": "5.3"}, "department_id": 6}
