{"department_text": "Paper | Notebooks | Post-it &reg", "nr_products": 2, "level": -1, "url": "http://www.staples.com/Index-Card-Guides/cat_CL142771", "text": "Index Card Guides", "department_url": "http://www.staples.com/Paper-Notebooks-Post-it/cat_SC1676", "description_title": "Index Card Guides", "parent_url": "http://www.staples.com/Index-Card-Index-Card-Storage/cat_DP2227", "keyword_count": {"index": 4, "index card": 2, "guides": 1, "card": 3}, "description_wc": 84, "description_text": "Index card dividers provide a convenient way to keep your index and note cards and records organized in alphabetical order. Pick from multi-color or single-color indexed tab guide sets from brands like Oxford and Smead. Alphabetical tab guide sets. : Organize your notes or records in alphabetical order for easy storage and retrieval. Quality material : Both the pressboard and the manila tab guides sets are durable and light weight. Choose your size: Pick between various index card sizes like 3x5, 4x6, and 5x8.", "parent_text": "Index Card / Index Card Storage", "keyword_density": {"index": "4.8", "index card": "4.8", "guides": "1.2", "card": "3.6"}, "department_id": 5}
