{"department_text": "Filing | Binders | Organizers", "nr_products": 8, "level": -1, "url": "http://www.staples.com/File-Folder-Labels/cat_CL140960", "text": "File Folder Labels", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "File Folder Labels", "parent_url": "http://www.staples.com/File-Folder-Labels/cat_DP1518", "keyword_count": {"folder": 8, "labels": 8, "file folder labels": 4, "file": 11, "file folder": 7}, "description_wc": 211, "description_text": "File folder labels make it easy to keep your client files and important business papers neat, organized, and easy to locate. Whether you choose to handwrite your labels or print them on your printer, you can easily find the right label that meets your needs. Labels are available in plain white or in multiple colors, so you can choose to alphabetize your files, color code them, or both. Permanent Labeling File folder labels are available with permanent adhesive, so you can depend on them to stay where you put them. You never have to worry about labels falling off your file folders, making it difficult to locate the files you need. Removable Labels File folder labels also come in removable styles, making it easy to reuse file folders for as long as you need them. You don't have to waste a good file folder when you can easily remove the old label and attach a new one without damaging the folder. Multiple Sizes and Colors File folder labels come in a variety of sizes and colors, so you can easily find the right size to fit your needs. With a variety of colors to choose from, you can also color code your files, making it easy to keep them organized.", "parent_text": "File Folder Labels", "keyword_density": {"folder": "3.8", "labels": "3.8", "file folder labels": "5.7", "file": "5.2", "file folder": "6.6"}, "department_id": 6}
{"department_text": "Paper | Notebooks | Post-it &reg", "nr_products": 11, "level": -1, "url": "http://www.staples.com/Index-Cards/cat_CL100604", "text": "Index Cards", "department_url": "http://www.staples.com/Paper-Notebooks-Post-it/cat_SC1676", "description_title": "Index Cards", "parent_url": "http://www.staples.com/Index-Card-Index-Card-Storage/cat_DP2227", "keyword_count": {"cards": 7, "index": 6, "index cards": 4}, "description_wc": 116, "description_text": "Whether you are looking for note cards to jot down ideas for that big presentation, or simply taking notes at your desk, Staples has the index and note cards you need. Pick from a selection of index and note cards with reliable brands like Oxford and Staples Ruled or unruled: Staples has several choices for both ruled and unruled index cards in different sizes and colors. Spiral and ring options : Keep your notes organized and easily accessible for presentations or studying with spiral-bound index cards or rings. Print-ready index cards: Simplify notes with print ready index cards and print in large quantities with little effort. Printing your notes will keep them clean and organized.", "parent_text": "Index Card / Index Card Storage", "keyword_density": {"cards": "6.0", "index": "5.2", "index cards": "6.9"}, "department_id": 5}
{"department_text": "Paper | Notebooks | Post-it &reg", "nr_products": 6, "level": -1, "url": "http://www.staples.com/Index-Card-Files/cat_CL120601", "text": "Index Card Files", "department_url": "http://www.staples.com/Paper-Notebooks-Post-it/cat_SC1676", "description_title": "Index Card Files", "parent_url": "http://www.staples.com/Index-Card-Index-Card-Storage/cat_DP2227", "keyword_count": {"files": 2, "index card files": 1, "index card": 2, "card": 5}, "description_wc": 87, "description_text": "Stay organized with index card files and boxes to categorize and sort important notes or customer files. Staples has top brands like SteelMaster, Globe-Weis, Snap-N-Storage, and Staples brand. Choose capacity: Your index card organizer\u2019s capacity can range from 350-3,000 cards per box. Choose size : The size of your card organizer can range from 3x5 to 4x6 to 5x8. Sturdy construction: Both the 24-guage all-steel and fireboard organizers are sturdy enough to keep your cards protected and organized for frequent use.", "parent_text": "Index Card / Index Card Storage", "keyword_density": {"files": "2.3", "index card files": "3.4", "index card": "4.6", "card": "5.7"}, "department_id": 5}
