{"department_text": "Paper | Notebooks | Post-it &reg", "nr_products": 17, "level": -1, "url": "http://www.staples.com/Wedding-Invitation-Kits/cat_CL163312", "text": "Wedding Invitation Kits", "department_url": "http://www.staples.com/Paper-Notebooks-Post-it/cat_SC1676", "description_title": "Wedding Invitation Kits", "parent_url": "http://www.staples.com/Stationery-Invitations/cat_DP1422", "keyword_count": {"kits": 2, "wedding": 4, "wedding invitation kits": 1, "wedding invitation": 2, "invitation": 4}, "description_wc": 87, "description_text": "Find the perfect wedding invitation kits at Staples with a large variety of designs to choose from. Kits come with both cards and envelopes that are compatible with most inkjet and laser printers. Wedding invitations come from as small as 3.5\u201d x 4.375\u201d to 5.5\u201d x 8.5\u201d. Choose from 62lb and 65lb cover stock place cards with six border place cards per 8.5\u201d x 11\u201d sheet. Many wedding cards for a variety of purposes like thank you notes, invitations to wedding, and invitations to the reception.", "parent_text": "Stationery / Invitations", "keyword_density": {"wedding invitation": "4.7", "kits": "2.3", "wedding invitation kits": "3.5", "invitation": "4.7", "wedding": "4.7"}, "department_id": 5}
