{"department_text": "Paper | Notebooks | Post-it &reg", "nr_products": 44, "level": -1, "url": "http://www.staples.com/Graduation-Stationery/cat_CL164425", "text": "Graduation Stationery", "department_url": "http://www.staples.com/Paper-Notebooks-Post-it/cat_SC1676", "description_title": "Graduation Stationery", "parent_url": "http://www.staples.com/Stationery-Invitations/cat_DP1422", "keyword_count": {"graduation stationery": 1, "graduation": 3}, "description_wc": 80, "description_text": "Graduation is an important time in not only the graduate\u2019s life, but the family\u2019s life as well. Staples\u00ae has a variety of graduation stationery for invitations and annoucements so that all of your loved ones can be a part of this event. Choose from several graduation invitation templates and layouts. Pick from several thank you notes that come with envelopes for convenience. Use address labels that are compatible with laser and inkjet printers for efficient labeling and mailing.", "parent_text": "Stationery / Invitations", "keyword_density": {"graduation stationery": "2.5", "graduation": "3.8"}, "department_id": 5}
{"department_text": "Pens | Tape | Desk Supplies", "level": 0, "url": "http://www.staples.com/Trimmers-Punches-Scissors/cat_CG1249", "text": "Trimmers / Punches / Scissors", "department_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "description_title": "Trimmers / Punches / Scissors", "parent_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "keyword_count": {"scissors": 2, "trimmers": 2, "punches": 2}, "description_wc": 64, "description_text": "For all your paper cutting needs, Staples\u00ae offers a wide variety of paper trimmers, paper punches, and scissors. Whether you are doing arts and crafts, or under taking a large project, Staples\u00ae has you covered for any type of paper cutting. Brands such as Westcott\u00ae, Swingline\u00ae, Staples\u00ae, and Officemate\u00ae make up our wide offering of paper trimmers, paper punches, and scissors.", "parent_text": "Pens | Tape | Desk Supplies", "keyword_density": {"scissors": "3.3", "trimmers": "3.3", "punches": "3.3"}, "department_id": 7}
{"department_text": "Pens | Tape | Desk Supplies", "level": 0, "url": "http://www.staples.com/Correction-Erasers/cat_CG1246", "text": "Correction / Erasers", "department_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "description_title": "Correction / Erasers", "parent_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "keyword_count": {"correction": 5}, "description_wc": 115, "description_text": "Wish your erasing woes goodbye with our wide array of writing correction supplies. If you want to cover something up, or completely wipe your slate clean, we have the solution for you. Correction tape : An easy and dry method for covering up and writing over mistakes. Precise writing correction : Try ergonomically designed correction pens and correct right down to the smallest dot. Erase quickly : For pencil marks, choose a classic eraser or a refillable clic eraser. The biggest brands : When in doubt, choose BIC Wite-Out, or stay close to home with Staples\u2019 own trusted brand. Writing correction is a breeze when you\u2019ve got the right tools from the top name in office supplies.", "parent_text": "Pens | Tape | Desk Supplies", "keyword_density": {"correction": "4.3"}, "department_id": 7}
{"department_text": "Pens | Tape | Desk Supplies", "level": 0, "url": "http://www.staples.com/Staplers-Staples-Removers/cat_CG1417", "text": "Staplers / Staples / Removers", "department_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "description_title": "Staplers / Staples / Removers", "parent_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "keyword_count": {"staplers staples": 1, "staples": 4, "removers": 1}, "description_wc": 50, "description_text": "Staples\u00ae has you covered for all your stapling needs. Whether you are purchasing a stapler, or need a box of staples to fill that stapler, we carry a wide assortment of staplers, staples, and staple removers. Featured brands in our assortment include Staples\u00ae, Swingline\u00ae, and Stanley Bostitch\u00ae.", "parent_text": "Pens | Tape | Desk Supplies", "keyword_density": {"staplers staples": "4.3", "staples": "8.5", "removers": "2.1"}, "department_id": 7}
