{"department_text": "Pens | Tape | Desk Supplies", "nr_products": 45, "level": 0, "url": "http://www.staples.com/Rulers-Measuring-Devices/cat_CL10503", "text": "Rulers & Measuring Devices", "department_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "description_title": "Rulers & Measuring Devices", "parent_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "keyword_count": {"measuring": 2, "rulers": 3}, "description_wc": 98, "description_text": "Staples\u00ae has a variety of measuring products for multiple applications like schoolwork, estimates, calculations, blueprints, and more. Our tape measures and rulers are produced by top brands like Westcott\u00ae, Stanley Bostitch\u00ae, and Staedtler\u00ae. Various lengths . Our measuring tools come in various lengths, starting with a 12\u201d ruler up to a 12\u2019 tape measure. Compact for easy storage . We have a variety of folding rulers and tape measures that are naturally compact for easy storage. Durable and heavy-duty . We have durable plastic, metal, and wood rulers and t-squares for frequent use.", "parent_text": "Pens | Tape | Desk Supplies", "keyword_density": {"measuring": "2.2", "rulers": "3.3"}, "department_id": 7}
{"department_text": "Pens | Tape | Desk Supplies", "nr_products": 24, "level": 0, "url": "http://www.staples.com/Clipboards/cat_CL140606", "text": "Clipboards", "department_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "description_title": "Clipboards", "parent_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "keyword_count": {"clipboards": 5}, "description_wc": 111, "description_text": "Maintain organized notes and an efficient to-do list for maximum productivity with clipboards from brands like OIC\u00ae, Adams\u00ae, Staples\u00ae, and MMF Industries\u2122. Our recycled, plastic, and metal clipboards are durable and affordable. More than just notes . Storage clipboards provide extra functionality in addition to being a sturdy place to take notes, such as pen/pencil holders, calculators, business card pockets, and more. Various sizes . Depending on your preferences and available space, Staples\u00ae has a variety sizes to best meet your needs. Heavy-duty . In addition to standard clipboards, we carry heavy-duty clipboards help protect important documents and notes from damage and loss.", "parent_text": "Pens | Tape | Desk Supplies", "keyword_density": {"clipboards": "4.8"}, "department_id": 7}
