{"department_text": "Pens | Tape | Desk Supplies", "nr_products": 65, "level": -1, "url": "http://www.staples.com/Scissors/cat_CL10504", "text": "Scissors", "department_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "description_title": "Scissors", "parent_url": "http://www.staples.com/Trimmers-Punches-Scissors/cat_CG1249", "keyword_count": {"scissors": 6}, "description_wc": 92, "description_text": "Staples\u00ae has a wide offering of scissors with assorted sizes and handles from Westcott\u00ae brand. Our scissors and shears come both pointed and blunt, made out of materials including titanium and steel. Kid friendly . We have a selection of scissors that are safe for kids to use, minimizing the risk of injury for children. Assorted sizes . Our scissors are available in a variety of sizes to match any hand size with comfort. Blunt and pointed . We have blunt scissors for safety and pointed scissors for a clean, quick cut.", "parent_text": "Trimmers / Punches / Scissors", "keyword_density": {"scissors": "6.7"}, "department_id": 7}
{"department_text": "Pens | Tape | Desk Supplies", "nr_products": 5, "level": -1, "url": "http://www.staples.com/Staple-Removers/cat_CL140862", "text": "Staple Removers", "department_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "description_title": "Staple Removers", "parent_url": "http://www.staples.com/Staplers-Staples-Removers/cat_CG1417", "keyword_count": {"staple removers": 7, "staple": 17}, "description_wc": 106, "description_text": "Cleanly remove staples without tearing with staple removers from brands like Swingline\u00ae, Stanley Bostitch\u00ae, and Staples\u00ae. Staples\u00ae has several types of staple removers like heavy duty staple removers, flat staple removers, and claw staple removers. Magnetic staple collector . Remove staples with ease with a built in magnet staple collector. Simple flat and claw . For a convenient and portable solution to removing staples, flat and claw staple removers are easy to store away and smoothly lift staples without tearing the paper. Heavy duty staple remover . Heavy duty staple removers remove all heavy duty, thick staples with a durable all-metal construction.", "parent_text": "Staplers / Staples / Removers", "keyword_density": {"staple removers": "14.0", "staple": "17.0"}, "department_id": 7}
{"department_text": "Pens | Tape | Desk Supplies", "nr_products": 46, "level": -1, "url": "http://www.staples.com/Paper-Punches/cat_CL160904", "text": "Paper Punches", "department_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "description_title": "Paper Punches", "parent_url": "http://www.staples.com/Trimmers-Punches-Scissors/cat_CG1249", "keyword_count": {"paper": 3, "paper punches": 1, "punches": 4}, "description_wc": 120, "description_text": "Staples\u00ae carries a wide variety of paper punches to suit any organizational need. Whether you need 1-Hole, 2-Hole, or 3-Hole punches, we\u2019ve got that covered. For larger projects and frequent use, Staples\u00ae also carries heavy-duty and electric hole punches. Featured brands include Staples\u00ae and Swingline\u00ae and are perfect for both light and heavy paper punching. 1-Hole, 2-Hole, and 3-Hole . Perfect for organizing papers and note cards with individual book rings or 3-ring binders. Heavy-Duty . With 160 sheet capacity, heavy-duty punches are perfect for large scale projects for both personal and professional use. Electric . No physical effort with precision punching for the perfect hole punch every time.", "parent_text": "Trimmers / Punches / Scissors", "keyword_density": {"paper punches": "1.7", "paper": "2.6", "punches": "3.4"}, "department_id": 7}
