{"department_text": "Pens | Tape | Desk Supplies", "nr_products": 19, "level": -1, "url": "http://www.staples.com/Staples/cat_CL10704", "text": "Staples", "department_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "description_title": "Staples", "parent_url": "http://www.staples.com/Staplers-Staples-Removers/cat_CG1417", "keyword_count": {"staples": 5}, "description_wc": 94, "description_text": "For all of your premium, standard, and heavy duty staple needs, Staples\u00ae has products from brands like Staples\u00ae, Swingline\u00ae, and Stanley Bostitch\u00ae. Browse our assortment for staples that are compatible with your stapler. Choose sheet capacity . If you need to staple large stacks of paper, you may need heavy duty staples with a capacity of 100 sheets. If you only use staples occasionally, a lower capacity of 60 sheets will suffice. Increased precision . High carbon steel and sharp chisel points provide better penetration and reduce jamming for simpler stapling.", "parent_text": "Staplers / Staples / Removers", "keyword_density": {"staples": "5.6"}, "department_id": 7}
{"department_text": "Pens | Tape | Desk Supplies", "nr_products": 84, "level": -1, "url": "http://www.staples.com/Staplers/cat_CL10700", "text": "Staplers", "department_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "description_title": "Staplers", "parent_url": "http://www.staples.com/Staplers-Staples-Removers/cat_CG1417", "keyword_count": {"staplers": 7}, "description_wc": 112, "description_text": "For all of your stapler needs, browse our large variety of dozens of electric, heavy duty, specialty, and mini staplers. Our durable staplers are made by professional quality brands like Staples\u00ae, Swingline\u00ae and Stanley Bostitch\u00ae. Portable and convenient . Whether you are trying to reduce occupied desk space or need a stapler on the go, mini staplers are portable and convenient without taking up much space. Desktop and specialty staplers . Browse a variety of staplers made specifically for desktop and handheld use. Heavy duty and electric staplers . For more frequent stapling needs, heavy duty and electric staplers make it easy to streamline the process with higher page capacity.", "parent_text": "Staplers / Staples / Removers", "keyword_density": {"staplers": "6.5"}, "department_id": 7}
{"department_text": "Pens | Tape | Desk Supplies", "nr_products": 19, "level": -1, "url": "http://www.staples.com/Paper-Trimmers/cat_CL10501", "text": "Paper  Trimmers", "department_url": "http://www.staples.com/Pens-Tape-Desk-Supplies/cat_SC1678", "description_title": "Paper  Trimmers", "parent_url": "http://www.staples.com/Trimmers-Punches-Scissors/cat_CG1249", "keyword_count": {"paper": 4, "paper trimmers": 1}, "description_wc": 117, "description_text": "Whether you are a designer, an engineer, or a teacher, Staples\u00ae has a wide variety of paper trimmers to suit any of your needs from brands like Swingline\u00ae, Westcott\u00ae, X-acto\u00ae, and more. We have products with various paper sizes and sheet capacity for all types of projects. Perfect alignment . Precision cutting is made simple with tools like a laser light cutting guide and an adjustable stack clamp. For large and small projects . Whether you need to cut 20 sheets at a time or 200, we have the paper cutter machines to meet your needs. Various sizes . Choose the paper trimmer size that fits your project from 12\u201d to 24\u201d.", "parent_text": "Trimmers / Punches / Scissors", "keyword_density": {"paper": "3.6", "paper trimmers": "1.8"}, "department_id": 7}
