{"department_text": "Filing | Binders | Organizers", "nr_products": 3, "level": -1, "url": "http://www.staples.com/Index-Tabs/cat_CL163169", "text": "Index Tabs", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "Index Tabs", "parent_url": "http://www.staples.com/Binding-Machines-Spines-Covers/cat_DP1301", "keyword_count": {"tabs": 5, "index": 7, "index tabs": 4}, "description_wc": 129, "description_text": "Organize your projects or documents with a wide range of eye-catching index tabs in many colors. Whether you\u2019re seeking solutions for a stack of notes or just trying to separate one type of information from another, we\u2019ve got tab dividers that will work for you. Shop our selection today. Custom Index Tabs with a Host of Features Choose the number of tabs you would like for your index tab dividers, or colored index tabs to set each section of your document apart Printable Index Tabs for Neat Organization Forget sloppy handwriting. Most tab dividers are fully printable for neat organization, with a table of contents page included Top Names in Index Dividers Including Fellowes and GBC Get your papers in order with tab indexes, from Staples.", "parent_text": "Binding Machines / Spines / Covers", "keyword_density": {"tabs": "3.9", "index": "5.4", "index tabs": "6.2"}, "department_id": 6}
{"department_text": "Filing | Binders | Organizers", "nr_products": 19, "level": -1, "url": "http://www.staples.com/ID-Badge-Printers-and-Accessories/cat_CL210812", "text": "ID Badge Printers and Accessories", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "ID Badge Printers and Accessories", "parent_url": "http://www.staples.com/Label-Makers-Printers-Tapes-Labels/cat_DP904", "keyword_count": {"badge printers": 3, "badge printers and accessories": 1, "accessories": 2, "id badge printers": 2, "id badge": 6, "badge": 7, "id": 10}, "description_wc": 93, "description_text": "Staples now provides all-in-one solutions for all small businesses in need of ID Badges. Why go to a professional studio when you can bring the studio to you? The IDville badge printers and accessories bring top of the line quality to all small business customers. IDville is one of the top brands for ID badge printers. Choose from any of our top ID badge printers. Already have an ID Badge printer? Shop our ID Badge accessories for all that you need, whether they are ID cards, lanyards or ID badge clips.", "parent_text": "Label Makers / Printers / Tapes / Labels", "keyword_density": {"badge printers": "6.5", "badge printers and accessories": "4.3", "accessories": "2.2", "id badge printers": "6.5", "id badge": "12.9", "badge": "7.5", "id": "10.8"}, "department_id": 6}
{"department_text": "Filing | Binders | Organizers", "nr_products": 7, "level": -1, "url": "http://www.staples.com/Thermal-Binding-Covers/cat_CL166302", "text": "Thermal Binding Covers", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "Thermal Binding Covers", "parent_url": "http://www.staples.com/Binding-Machines-Spines-Covers/cat_DP1301", "keyword_count": {"thermal binding covers": 3, "thermal binding": 4, "thermal": 6, "binding": 5, "binding covers": 4}, "description_wc": 124, "description_text": "Thermal binding covers provide a fast and effective solution for giving your manual or report a durable, heavy duty, professional feel. Get it done well and get it done fast with thermal binding covers, from Staples. Browse our selection today. Find Your Style Thermal book binding covers come in a variety of colors and sizes, including white, navy, red and green Work with Your Project, Whatever the Demands Choose a thermal bind cover with a sheet capacity that will fit your project, no matter how big or small The Most Trusted Brand We carry Fellowes thermal binding covers that you can trust Try a thermal binding cover for one of the quickest routes to a professional grade bound document available on the market today.", "parent_text": "Binding Machines / Spines / Covers", "keyword_density": {"thermal binding covers": "7.3", "thermal binding": "6.5", "thermal": "4.8", "binding": "4.0", "binding covers": "6.5"}, "department_id": 6}
