{"department_text": "Filing | Binders | Organizers", "nr_products": 21, "level": -1, "url": "http://www.staples.com/Cold-Laminating-Supplies/cat_CL142545", "text": "Cold Laminating Supplies", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "Cold Laminating Supplies", "parent_url": "http://www.staples.com/Laminators-Pouches-Sheets/cat_DP2148", "keyword_count": {"cold": 6, "cold laminating": 4}, "description_wc": 112, "description_text": "Cold laminating is an efficient, effective way to give your documents the professional look they deserve. Forget the heating time and try cold lamination today. A range of sizes Cartridge roll length and width for our cold laminating film is widely varied to suit a range of document sizes and products. The highest quality Our cold laminating rolls are of the highest grade so you can rest assured your most important documents will stay protected and looking great for years to come. Top brands With cold lamination film from 3M and Esselte, you know you\u2019ll get the best results. Browse our wide selection of lamination solutions and try cold laminating today.", "parent_text": "Laminators / Pouches / Sheets", "keyword_density": {"cold": "5.4", "cold laminating": "7.1"}, "department_id": 6}
{"department_text": "Filing | Binders | Organizers", "nr_products": 32, "level": -1, "url": "http://www.staples.com/Laminating-Machines/cat_CL142540", "text": "Laminating Machines", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "Laminating Machines", "parent_url": "http://www.staples.com/Laminators-Pouches-Sheets/cat_DP2148", "keyword_count": {"laminating machines": 1, "laminating": 2}, "description_wc": 118, "description_text": "Protect important documents or projects with a laminator, from Staples. Our selection of thermal and cold laminating machines are easy to set up and use and will give your documents a professional feel. Pouch laminators for a range of needs We carry both thermal laminators and cold laminators capable of laminating pouches up to 5 mil in thickness and papers with a range of widths. Quick warm up times Our thermal office laminators are ready in seven minutes or less so you can spend less time waiting and more time doing. Trusted brands We carry laminators from both Fellowes and Staples, names you can rely on. For the right job every time, try one of our laminators today", "parent_text": "Laminators / Pouches / Sheets", "keyword_density": {"laminating machines": "1.7", "laminating": "1.7"}, "department_id": 6}
