{"department_text": "Filing | Binders | Organizers", "nr_products": 45, "level": -1, "url": "http://www.staples.com/Thermal-Laminating-Supplies/cat_CL142543", "text": "Thermal Laminating Supplies", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "Thermal Laminating Supplies", "parent_url": "http://www.staples.com/Laminators-Pouches-Sheets/cat_DP2148", "keyword_count": {"thermal laminating": 1, "thermal": 2, "laminating supplies": 1, "laminating": 6, "supplies": 2}, "description_wc": 109, "description_text": "Protect, store and easily access your documents with our wide selection of laminating pouches and laminating supplies. We carry a wide stock of solutions you won\u2019t want to miss. A range of pouch sizes Whether you\u2019re looking to give that wall calendar a glossy finish or make your business cards look extra professional, we have thermal laminating pouches that will accommodate most of your documents. Widely compatible Our thermal pouches work with a range of laminating machines for easy compatibility. High quality brands With laminating machine supplies from Fellowes and Staples, you know you can expect reliable results. Browse our laminating pouches today for that professional feel.", "parent_text": "Laminators / Pouches / Sheets", "keyword_density": {"thermal laminating": "1.8", "thermal": "1.8", "laminating": "5.5", "laminating supplies": "1.8", "supplies": "1.8"}, "department_id": 6}
{"department_text": "Filing | Binders | Organizers", "nr_products": 14, "level": -1, "url": "http://www.staples.com/Self-Laminating-Supplies/cat_CL142542", "text": "Self-Laminating Supplies", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "Self-Laminating Supplies", "parent_url": "http://www.staples.com/Laminators-Pouches-Sheets/cat_DP2148", "keyword_count": {"self": 5, "self laminating": 3, "laminating": 4}, "description_wc": 117, "description_text": "Self-laminating is easy with our wide range of self-laminating pouches and sheets from top brands like 3M, Duck, Fellowes and Scotch. We carry easy to use products that will have you on your way in no time. A wide range of pouch sizes Our thermal laminating pouches range from big to small so you can protect and store all of your most important documents, no matter what their dimensions. Quick and easy self-lamination Pair our self-laminating sheets with a cold or thermal laminator for no hassle, easy lamination. Get that glossy look Laminate business cards and ID tags for a professional feel. Self-lamination is easy with a variety of solutions from Staples.", "parent_text": "Laminators / Pouches / Sheets", "keyword_density": {"self": "4.3", "self laminating": "5.1", "laminating": "3.4"}, "department_id": 6}
{"department_text": "Filing | Binders | Organizers", "nr_products": 28, "level": -1, "url": "http://www.staples.com/Binding-Covers/cat_CL140547", "text": "Binding Covers", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "Binding Covers", "parent_url": "http://www.staples.com/Binding-Machines-Spines-Covers/cat_DP1301", "keyword_count": {"binding": 12, "covers": 8, "binding covers": 7}, "description_wc": 133, "description_text": "No project would be complete without a binding cover, from Staples. Whether you\u2019re printing a technical manual or preparing to teach next semester\u2019s course, we\u2019ve got a binding cover that will work for you. Shop our selection today. The Right Binding Cover for a Range of Projects We carry clear binding covers, book binding covers, binding report covers, comb binding covers and plastic binding covers that will get the job done Come in Various Colors and Sizes Our binding covers come in many different styles and materials, are known for their durability, have a high sheet capacity, and can be punched/un-punched Choose Your Favorite Brand GBC binding covers and Fellowes binding covers No matter what the job, we\u2019ve got a binding cover that\u2019s right for you.", "parent_text": "Binding Machines / Spines / Covers", "keyword_density": {"binding": "9.0", "covers": "6.0", "binding covers": "10.5"}, "department_id": 6}
{"department_text": "Filing | Binders | Organizers", "nr_products": 49, "level": -1, "url": "http://www.staples.com/Binding-Spines/cat_CL159938", "text": "Binding Spines", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "Binding Spines", "parent_url": "http://www.staples.com/Binding-Machines-Spines-Covers/cat_DP1301", "keyword_count": {"spines": 5, "binding spines": 4, "binding": 9}, "description_wc": 120, "description_text": "Collect information and keep it in one place with binding combs. Whether you\u2019re producing a course manual or presenting technical information to big investors, our plastic binding combs will give you the look and functionality you crave. Shop our selection today. Binding Spines in Multiple Sizes & Colors From a \u00bc\u201d book spine for 20 sheets to a 1\u201d spine for 200 sheets, we carry a binding spine that will work for your project. A Wide Range of Styles Our selection of ProClick Spines, GBC binding spines, wire binding spines and plastic binding spines provide a variety of styles and solutions. Binding Combs from the Brands You Trust Fellowes, GBC, Staples Get that professional feel with a binding comb, from Staples.", "parent_text": "Binding Machines / Spines / Covers", "keyword_density": {"spines": "4.2", "binding spines": "6.7", "binding": "7.5"}, "department_id": 6}
{"department_text": "Filing | Binders | Organizers", "nr_products": 18, "level": -1, "url": "http://www.staples.com/Binding-Machines/cat_CL161082", "text": "Binding Machines", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "Binding Machines", "parent_url": "http://www.staples.com/Binding-Machines-Spines-Covers/cat_DP1301", "keyword_count": {"binding machines": 7, "binding": 10}, "description_wc": 136, "description_text": "For a guaranteed professional look, browse our wide range of binding machines. With solutions from the brands you trust like Fellowes and GBC, you\u2019ll get the job done fast and still have time to spare. You can expect these many features and more when your shop our selection. A Range of Binding Styles We carry book binding machines, comb binding machines, coil binding machines, wire binding machines and thermal binding machines that will work with many different project demands Work How You Prefer Our binding machines come in electric, manual and thermal models, including ProClick manual binding style and wire Varied Sheet Capacity and Timing Options Choose a light or heavy duty option and punch anywhere from 7 sheets to 500 at once With a binding machine from Staples, bind quickly and well every time.", "parent_text": "Binding Machines / Spines / Covers", "keyword_density": {"binding machines": "10.3", "binding": "7.4"}, "department_id": 6}
