{"department_text": "Filing | Binders | Organizers", "nr_products": 38, "level": -1, "url": "http://www.staples.com/Label-Makers/cat_CL90400", "text": "Label Makers", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "Label Makers", "parent_url": "http://www.staples.com/Label-Makers-Printers-Tapes-Labels/cat_DP904", "keyword_count": {"label makers": 5, "label": 9}, "description_wc": 129, "description_text": "Whether you\u2019re printing mailing addresses or updating your files, label makers are a fast and efficient way to get the task done. Browse our selection of label printers from Brother and Dymo for an easy solution. The latest technology We carry P-touch label makers, Brother label makers and Dymo label makers with touchscreens and large displays for simple navigation. A variety of choices Our memory-packed handheld label makers can produce a variety of fonts, patterns, label sizes and widths to accommodate and remember a range of styles and needs. Easy portability Bring your label maker where it\u2019s needed with an adaptor and case for easy transport and set up. Get organized and take care of every day office tasks with a label maker, from Staples.", "parent_text": "Label Makers / Printers / Tapes / Labels", "keyword_density": {"label makers": "7.8", "label": "7.0"}, "department_id": 6}
