{"department_text": "Filing | Binders | Organizers", "nr_products": 204, "level": -1, "url": "http://www.staples.com/Label-Maker-Tapes/cat_CL140557", "text": "Label Maker Tapes", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "Label Maker Tapes", "parent_url": "http://www.staples.com/Label-Makers-Printers-Tapes-Labels/cat_DP904", "keyword_count": {"label maker": 2, "label": 7}, "description_wc": 109, "description_text": "Find the right label tape for your electronic label making system right here at Staples. With our wide and diverse stock of supplies, we make label maker refills easy. Refills for many different models Whether you\u2019re seeking P-touch tape or any other kind, we have labeling tape that will get your tape label maker up and running again. A variety of styles Our wide range of labeler tape comes in various colors and widths so you can spruce up your filing or get organized with color coding. Top brands Including Brother and Dymo. Browse our label tape today and get that office organized and ready to go.", "parent_text": "Label Makers / Printers / Tapes / Labels", "keyword_density": {"label maker": "3.7", "label": "6.4"}, "department_id": 6}
{"department_text": "Filing | Binders | Organizers", "nr_products": 64, "level": -1, "url": "http://www.staples.com/Label-Printers/cat_CL140802", "text": "Label Printers", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "Label Printers", "parent_url": "http://www.staples.com/Label-Makers-Printers-Tapes-Labels/cat_DP904", "keyword_count": {"label printers": 2, "label": 5}, "description_wc": 46, "description_text": "Staying organized and keeping track of important documents, files, and paperwork is made easy with easy to use label writers. Staples carries the best label printer brands like the Dymo labelwriters, Brother label printers, and more. Label printers can be used for a variety of purposes:", "parent_text": "Label Makers / Printers / Tapes / Labels", "keyword_density": {"label printers": "8.7", "label": "10.9"}, "department_id": 6}
