{"department_text": "Filing | Binders | Organizers", "nr_products": 19, "level": -2, "url": "http://www.staples.com/Storage-Lockers/cat_CL140907", "text": "Storage Lockers", "department_url": "http://www.staples.com/Filing-Binders-Organizers/cat_SC1677", "description_title": "Storage Lockers", "parent_url": "http://www.staples.com/Storage-Cubes-Cabinets/cat_DP1492", "keyword_count": {"lockers": 5, "storage": 4, "storage lockers": 2}, "description_wc": 141, "description_text": "Using storage lockers helps ensure that all employees can secure their items from unauthorized use or accidental loss. Heavy-gauge steel units are durable enough to withstand everyday use. Choose units with individual locks to ensure security. Tall Single Units Individual single-tier lockers provide plenty of space for uniforms and accessories that your employees need to keep on hand at work. Link multiple units together to increase storage capacity at your facility. Multiple-Tier Units Multiple-tier storage lockers maximize space by providing a spacious yet compact area for employees to store their stuff. For a more polished look, you may want to opt for a storage cabinet instead of locker units. Box Lockers Box lockers offer plenty of small compartments where you can store items or accessories for the whole office. Raised units provide space underneath for added ventilation.", "parent_text": "Storage Cubes / Cabinets", "keyword_density": {"lockers": "3.5", "storage": "2.8", "storage lockers": "2.8"}, "department_id": 6}
