{"department_text": "Printers | Shredders | Machines", "level": 0, "url": "http://www.staples.com/Projectors-Screens-Pointers/cat_DP1446", "text": "Projectors / Screens / Pointers", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "Projectors / Screens / Pointers", "parent_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "keyword_count": {"screens": 5, "projectors": 1}, "description_wc": 323, "description_text": "Staples carries a large assortment of Projectors and Projector Accessories to ensure we carry the right solution for you. Here are a couple of things to consider when purchasing\u00a0your new\u00a0Projector. Choose the Right Projector Brand: We carry a wide variety of Projector brands from Epson, 3M, Qumi, NEC, Optoma, Viewsonic and many more. Choose the Right Projector: Consider the Following Projector Display technologies: Choose between a 3LCD projector, LCD projector, LED projector and DLP projector which are slightly different. Each has their own strengths - brightness contrast, image quality, footprint, power efficiency, and ease of use features. Projector Brightness: This is by far the most important feature, so it\u2019s important to understand that there are two brightness measurements: Color Brightness (color light output) and White Brightness (white light output). Brilliant image quality requires high Color Brightness because it measures the brightness of colors in a projected image, not just the brightness of white. Choose the Right Projector Screen: Portable projection screens Make your presentations mobile with portable projector screens and motorized projector screens that go where you go. A range of screen sizes and screen types Choose from portable, mounted, pull down, motorized, tripod and tabletop screens to fit the dimensions and requirements your presentation room requires. Solutions for interactive presentations Write directly onto your presentation with one of our whiteboard projector screens and make that information really pop Choose either Wall or Ceiling Projector Mount: Will you be attaching the projector to a wall or a ceiling? With some wall mounts the projector height can be adjusted. Ceiling mounts are ideal when room space is limited.Mounting a projector on the ceiling also reduces heat and noise near the conference table. Choose the Right Projector Accessories: Choose the best products for your projector. Choose between a great laser pointer, wireless adapters, remotes and speakers. Staples carries a wide range of projector accessories to help you succeed in the presentation room.", "parent_text": "Printers | Shredders | Machines", "keyword_density": {"screens": "1.6", "projectors": "0.3"}, "department_id": 11}
{"department_text": "Printers | Shredders | Machines", "level": 0, "url": "http://www.staples.com/Copiers-Fax/cat_CG51", "text": "Copiers / Fax", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "Copiers / Fax", "parent_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "keyword_count": {"copiers": 1, "fax": 3}, "description_wc": 125, "description_text": "Your office is only as good as its people and its office equipment. Browse our wide catalog of office equipment to get your office running as smoothly as possible. Need more ideas? Take a look through our research centers for more information. Fast duplication : Our reliable, affordable copiers will get the job done, big or small. Efficient faxing : Browse a wide range of fax machines for the latest technology. One machine, many functions : Try one of our state of the art all-in-one printers and alternate between faxing, scanning and copying with the touch of a button. The top names : From Brother to Canon to HP, we\u2019ve got the brands you trust most. At Staples, we have all the office equipment you need.", "parent_text": "Printers | Shredders | Machines", "keyword_density": {"copiers": "0.8", "fax": "2.4"}, "department_id": 11}
