{"department_text": "Printers | Shredders | Machines", "level": 0, "url": "http://www.staples.com/Printers-All-in-Ones/cat_CG44", "text": "Printers", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "Printers", "parent_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "keyword_count": {"printers": 5}, "description_wc": 122, "description_text": "With a large variety of printers, finding the right match for your home, small business or large office is easy at Staples. We carry major printer brands like HP, Brother, Epson,Canon, Lexmark, Xerox, Samsung and Oki and are the #1 choice for all printing needs. Pick your printer \u2013 Pick from inkjets, color laser printers, and wireless models . Choose your features \u2013 Choose features like faxing, scanning, or an all-in-one. Organize with accessories \u2013 Make your home or office comfortable and convenient with printer accessories like stands, carts, and paper trays. Find the right printer and accessories for your home, small business or large office. We've got color laser printers , color all-in-one printers , and inkjet printers .", "parent_text": "Printers | Shredders | Machines", "keyword_density": {"printers": "4.2"}, "department_id": 11}
