{"department_text": "Printers | Shredders | Machines", "nr_products": 51, "level": -1, "url": "http://www.staples.com/Digital-Projector-Accessories/cat_CL166546", "text": "Digital Projector Accessories", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "Digital Projector Accessories", "parent_url": "http://www.staples.com/Projectors-Screens-Pointers/cat_DP1446", "keyword_count": {"projector accessories": 2}, "description_wc": 90, "description_text": "For the smoothest presentations, browse our selection of projector accessories. Our innovative and reliable selection of products will help you concentrate on the content, not the technology. Control your presentation from afar Try an Optoma remote control for easy presentation navigation from wherever you are. Long life An Optoma battery is long lasting so you can rely on it to deliver in a pinch. High powered Optoma batteries are also high-powered, meaning you\u2019re sure to get the right results. With Optoma and InFocus projector accessories, present with confidence.", "parent_text": "Projectors / Screens / Pointers", "keyword_density": {"projector accessories": "4.4"}, "department_id": 11}
{"department_text": "Printers | Shredders | Machines", "nr_products": 19, "level": -1, "url": "http://www.staples.com/Fax-Machines/cat_CL165742", "text": "Fax Machines", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "Fax Machines", "parent_url": "http://www.staples.com/Copiers-Fax/cat_CG51", "keyword_count": {"fax": 10, "fax machines": 2}, "description_wc": 128, "description_text": "Fax machines are an essential part of any busy office. Browse our selection of auto fax, business fax, color fax, hybrid fax printers and laser fax machines for the latest technology. Please visit our research centers for more great ideas. Set it and forget it : Select an auto feeder fax machine with a high paper capacity and speed so you can load your job and move on to other tasks. Top-notch print resolution : With inkjet, laser and color options, you\u2019ll be sure to retain the quality of the original sheet. All your favorite features : Choose a fax system with a modml and 2 trays from Brother, Canon or HP for the fastest faxing on the market. Get the latest technology with a fax machine from Staples.", "parent_text": "Copiers / Fax", "keyword_density": {"fax": "7.8", "fax machines": "3.1"}, "department_id": 11}
{"department_text": "Printers | Shredders | Machines", "nr_products": 11, "level": -1, "url": "http://www.staples.com/Copiers/cat_CL90200", "text": "Copiers", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "Copiers", "parent_url": "http://www.staples.com/Copiers-Fax/cat_CG51", "keyword_count": {"copiers": 2}, "description_wc": 155, "description_text": "Whether you seek a single or multi-function machine, we carry copiers that will suit your needs. Browse our extensive catalog for a wide range of sizes, styles and capabilities. For more solutions, please visit our research centers. Multifunction : Try a color copier, laser copier or fax copier for the highest quality and most versatile duplication. Or bundle it all together in a multi-function machine with a fax, copier, printer and scanner all in one. Print your way : Both laser and inkjet options available with up to 50-sheet paper capacity. Try duplex options for two-sided printing on most copy machines. For the whole office or just for you : We carry network copier machines and personal copiers for big and home offices alike. Solutions from top names : Brother and Canon models available. Your copier should be as diverse as your needs. Search our copy machines today for one that\u2019s right for you.", "parent_text": "Copiers / Fax", "keyword_density": {"copiers": "1.3"}, "department_id": 11}
