{"department_text": "Printers | Shredders | Machines", "nr_products": 104, "level": -1, "url": "http://www.staples.com/Wireless-Printers/cat_CL164737", "text": "Wireless Printers", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "Wireless Printers", "parent_url": "http://www.staples.com/Printers-All-in-Ones/cat_CG44", "keyword_count": {"wireless printers": 1}, "description_wc": 44, "description_text": "Whether at home or in the office, excessive wiring can create clutter and detract from a productive environment. Wireless printers are convenient with the capability of mobile printing and the versatility to fit in more places without having to be next to the computer.", "parent_text": "Printers", "keyword_density": {"wireless printers": "4.5"}, "department_id": 11}
