{"department_text": "Mobile Phones | Accessories", "level": -1, "url": "http://www.staples.com/Nokia-Mobile-Phone-Accessories/cat_DP8309", "text": "Nokia Mobile Phone Accessories", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "Nokia Mobile Phone Accessories", "parent_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_CG6", "keyword_count": {"phone": 3, "nokia mobile phone accessories": 2, "accessories": 3}, "description_wc": 66, "description_text": "Nokia mobile phone accessories let you extend the battery life of your device, protect it from damage, and extend when and where you can use it. Accessories include docks and mounts, protective cases, and adapters. Whether you want to use your cell phone at home, in the car, or while on a walk, there are plenty of Nokia mobile phone accessories to help you stay connected.", "parent_text": "Mobile Phone Accessories", "keyword_density": {"phone": "4.5", "nokia mobile phone accessories": "12.1", "accessories": "4.5"}, "department_id": 12}
