{"department_text": "Phones | Cameras | Electronics", "nr_products": 55, "level": -1, "url": "http://www.staples.com/Audio-Visual-Carts-Stands/cat_CL140817", "text": "Audio/Visual Carts/Stands", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Audio/Visual Carts/Stands", "parent_url": "http://www.staples.com/Projectors-Screens-Pointers/cat_DP1446", "keyword_count": {"carts": 5, "stands": 3, "audio visual carts": 1}, "description_wc": 155, "description_text": "Experience sturdy, mobile support for all of your presentation technology with a utility cart, from Staples. Shop our supply today for a solution that works for you. Presentation carts to suit a range of needs We carry AV carts, computer stands, projector stands, media carts and audio visual carts for every type of device. Or, keep it all in one with a multimedia cart, which can accommodate multiple devices. Available in multiple sizes Our utility carts can suit a wide range of spaces and come with fully adjustable shelves and drawers. Protection for valuable equipment Locking cabinet doors are available on most models. A variety of features Choose a Balt, Amplivox or Safco utility cart with extra features like lecterns and stands for easy notecard storage. Whether you\u2019re searching for something as specific as an AV stand or as versatile as a multimedia cart, we carry the utility cart that\u2019s right for you.", "parent_text": "Projectors / Screens / Pointers", "keyword_density": {"carts": "3.2", "stands": "1.9", "audio visual carts": "1.9"}, "department_id": 14}
