{"department_text": "Phones | Cameras | Electronics", "nr_products": 17, "level": -1, "url": "http://www.staples.com/Overhead-Projector-Supplies/cat_CL140550", "text": "Overhead Projector Supplies", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Overhead Projector Supplies", "parent_url": "http://www.staples.com/Projectors-Screens-Pointers/cat_DP1446", "keyword_count": {"projector": 2, "projector supplies": 1}, "description_wc": 92, "description_text": "Demonstrate key concepts during presentations or lectures with transparency film. Our wide selection of transparency sheets is compatible with most copiers for easy printing. Rich images Our transparency film produces crisp, sharp images for clear communication. All the projector supplies you need Browse our selection of projector carrying cases for easy transport. The latest technology Try a PAPERSHOW interactive notepad and instantly display those handwritten notes on a screen during a presentation. Brands you can trust 3M and Apollo. With transparency film from Staples, your presentations will stand out from the crowd.", "parent_text": "Projectors / Screens / Pointers", "keyword_density": {"projector": "2.2", "projector supplies": "2.2"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 213, "level": -1, "url": "http://www.staples.com/Projector-Lamps/cat_CL140813", "text": "Projector Lamps", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Projector Lamps", "parent_url": "http://www.staples.com/Projectors-Screens-Pointers/cat_DP1446", "keyword_count": {"projector lamps": 2, "lamps": 3, "projector": 7}, "description_wc": 149, "description_text": "Replacement projector lamps are designed to fit into your overhead projector precisely. Choose lamps from leading brands such as InFocus, Optima, Apollo, 3M, and Mitsubishi. Whether you're a frequent presenter or about to lead your first meeting, having a reliable projector lamp can make a difference in how well your presentation succeeds. Long Life Enjoy up to 6,000 hours of usable life with a long-lasting projector lamp when used in economy mode. Lamp Bulbs Don't forget to keep lamp bulbs in stock to ensure that your projector lamp continues to shine brightly through your most important presentations. You'll also need a reliable projector screen whenever you have to present something. Easy to Install Modern projector lamps are designed to be easy to install, so you just need to slip out the old lamp and slip in the replacement. You can also change the bulbs yourself.", "parent_text": "Projectors / Screens / Pointers", "keyword_density": {"projector lamps": "2.7", "lamps": "2.0", "projector": "4.7"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 5, "level": -1, "url": "http://www.staples.com/Interactive-Presentation-Tools/cat_CL165838", "text": "Interactive Presentation Tools", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Interactive Presentation Tools", "parent_url": "http://www.staples.com/Projectors-Screens-Pointers/cat_DP1446", "keyword_count": {"interactive presentation tools": 1, "presentation": 8, "interactive": 3, "presentation tools": 4}, "description_wc": 91, "description_text": "Take your presentations up to the next level with presentation tools, from Staples. Shop our diverse selection of interactive presentation tools for creative solutions that work for you. Papershow for teachers Make your lesson plans or presentation interactive with innovative presentation tools from Canson PAPERSHOW. Present right from your notebook Sync a digital pen, paper and notepad with projection equipment for an interactive Powerpoint presentation and natural writing experience. Work with your system Products are Mac and PC-compatible. Our cutting edge presentation tools are sure to make your presentations pop.", "parent_text": "Projectors / Screens / Pointers", "keyword_density": {"presentation tools": "8.8", "interactive presentation tools": "3.3", "presentation": "8.8", "interactive": "3.3"}, "department_id": 14}
{"department_text": "Mobile Phones | Accessories", "nr_products": 24, "level": -2, "url": "http://www.staples.com/Blackberry-Mobile-Phone-Chargers-Adapters/cat_CL205940", "text": "Blackberry Mobile Phone Chargers & Adapters", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "Blackberry Mobile Phone Chargers & Adapters", "parent_url": "http://www.staples.com/Blackberry-Mobile-Phone-Accessories/cat_DP8305", "keyword_count": {"chargers": 1, "adapters": 1, "blackberry": 2}, "description_wc": 53, "description_text": "Use Blackberry chargers and adapters to help you maintain your connectivity at any time of night or day. Charge your Blackberry device at home, in your car, or just about anywhere else. You can even use your device while it's charging so that you don't lose a single minute of productivity.", "parent_text": "Blackberry Mobile Phone Accessories", "keyword_density": {"chargers": "1.9", "adapters": "1.9", "blackberry": "3.8"}, "department_id": 12}
{"department_text": "Mobile Phones | Accessories", "nr_products": 4, "level": -2, "url": "http://www.staples.com/Blackberry-Mobile-Phone-Screen-Protectors/cat_CL206091", "text": "Blackberry Mobile Phone Screen Protectors", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "Blackberry Mobile Phone Screen Protectors", "parent_url": "http://www.staples.com/Blackberry-Mobile-Phone-Accessories/cat_DP8305", "keyword_count": {"phone": 3, "screen": 3, "blackberry mobile phone screen protectors": 2}, "description_wc": 43, "description_text": "With BlackBerry mobile phone screen protectors, you can cover delicate screens to prevent wear and tear. The thin film applies evenly and won't interfere with your phone's operation. Avoid harmful glare with BlackBerry mobile phone screen protectors that counteract light reflection.", "parent_text": "Blackberry Mobile Phone Accessories", "keyword_density": {"phone": "7.0", "screen": "7.0", "blackberry mobile phone screen protectors": "23.3"}, "department_id": 12}
{"department_text": "Mobile Phones | Accessories", "nr_products": 20, "level": -2, "url": "http://www.staples.com/Blackberry-Mobile-Phone-Cases/cat_CL168849", "text": "Blackberry Mobile Phone Cases", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "Blackberry Mobile Phone Cases", "parent_url": "http://www.staples.com/Blackberry-Mobile-Phone-Accessories/cat_DP8305", "keyword_count": {"phone": 2, "blackberry mobile phone cases": 1}, "description_wc": 47, "description_text": "Blackberry mobile phone cases are functional, sharp, and built to last. Protect your cellular device from impact damage, dust, and scratches without losing your signal or your signature style. Go from black tie to boiler suit: you'll find cellphone covers for every occasion and any location.", "parent_text": "Blackberry Mobile Phone Accessories", "keyword_density": {"phone": "4.3", "blackberry mobile phone cases": "8.5"}, "department_id": 12}
