{"department_text": "Mobile Phones | Accessories", "nr_products": 19, "level": -2, "url": "http://www.staples.com/Nokia-Mobile-Phone-Chargers-Adapters/cat_CL205973", "text": "Nokia Mobile Phone Chargers & Adapters", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "Nokia Mobile Phone Chargers & Adapters", "parent_url": "http://www.staples.com/Nokia-Mobile-Phone-Accessories/cat_DP8309", "keyword_count": {"chargers": 3, "adapters": 1, "nokia mobile phone chargers": 1, "phone": 2}, "description_wc": 46, "description_text": "Nokia mobile phone chargers and adapters come in styles designed for use in the car or home. You can also find solar-powered chargers and battery backups to keep your phone charged when electrical power is limited. For added convenience, try wireless chargers or charging stations.", "parent_text": "Nokia Mobile Phone Accessories", "keyword_density": {"chargers": "6.5", "adapters": "2.2", "nokia mobile phone chargers": "8.7", "phone": "4.3"}, "department_id": 12}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 3, "level": -1, "url": "http://www.staples.com/Overhead-Projectors/cat_CL140543", "text": "Overhead Projectors", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Overhead Projectors", "parent_url": "http://www.staples.com/Projectors-Screens-Pointers/cat_DP1446", "keyword_count": {"overhead projectors": 1, "overhead": 5}, "description_wc": 100, "description_text": "Browse our selection of overhead projectors for the tried and true method for projecting examples and notes. In the classroom and in the boardroom, communicate complex information effectively. Crisp projection 2,000 and 3,000 lumen models available as well as the double fresnel lenses, expect the sharpest projection. Suitable for a range of spaces Projection distance on most overhead projection units can accommodate a wide range or room sizes. Take your overhead projector on the go Try a lightweight Accor or Apollo overhead projector for easy portability. When you\u2019ve got a Staples\u2019 projector overhead, you know you\u2019ve got quality.", "parent_text": "Projectors / Screens / Pointers", "keyword_density": {"overhead projectors": "2.0", "overhead": "5.0"}, "department_id": 14}
{"department_text": "Mobile Phones | Accessories", "nr_products": 12, "level": -2, "url": "http://www.staples.com/Nokia-Cell-Phone-Cases/cat_CL205972", "text": "Nokia Mobile Phone Cases", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "Nokia Mobile Phone Cases", "parent_url": "http://www.staples.com/Nokia-Mobile-Phone-Accessories/cat_DP8309", "keyword_count": {"phone": 3, "cases": 3, "nokia mobile phone cases": 1, "mobile phone": 2}, "description_wc": 43, "description_text": "Nokia mobile phone cases are the perfect accessories for mobile phones. These cases come in vertical or horizontal designs. Some cases clip on, and others can be placed in a purse or handbag to help keep your phone safe from scratches or bumps.", "parent_text": "Nokia Mobile Phone Accessories", "keyword_density": {"phone": "7.0", "cases": "7.0", "nokia mobile phone cases": "9.3", "mobile phone": "9.3"}, "department_id": 12}
