{"department_text": "Phones | Cameras | Electronics", "level": -1, "url": "http://www.staples.com/Surge-Protectors/cat_DP1915", "text": "Surge Protectors", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Surge Protectors", "parent_url": "http://www.staples.com/Batteries-Power/cat_CG75", "keyword_count": {"surge protectors": 3, "surge": 7}, "description_wc": 166, "description_text": "Safeguard the health of all of your devices with a surge protector you can trust. We carry a range of products that will suit your needs. For more information, please visit our research centers. Power more at once : Whether you\u2019re seeking a 6-outlet power surge protector for your home office or a product that is industrial grade, our multi-outlet surge protectors will help power more devices at once while preventing overload. Protect from surges and spikes : Our surge protectors provide excellent dataline protection and are available in joule capacity ranging from 709 to 3240 and beyond. Better regulate your usage : Convenient power switch access provides a simple way to guard against phantom energy use from devices not currently in use. Easy USB charging : We carry models with USB ports so you can safely plug your devices directly into your surge protector. Dataline protection brands : Tripp Lite, Belkin and Staples. Browse our surge protectors today and find better a solution for your power needs.", "parent_text": "Batteries & Power", "keyword_density": {"surge protectors": "3.6", "surge": "4.2"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 68, "level": -1, "url": "http://www.staples.com/Projector-Mounts/cat_CL142586", "text": "Projector Mounts", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Projector Mounts", "parent_url": "http://www.staples.com/Projectors-Screens-Pointers/cat_DP1446", "keyword_count": {"mounts": 9, "projector mounts": 1, "projector": 17}, "description_wc": 288, "description_text": "Your Digital Projector deserves a quality Projector Mount from Staples. Here are a few things to consider when selecting the proper projector mount Choose the Right Brand: We carry a wide variety of projector mount brands from Epson, Siig, Infocus, NEC, Peerless and many more. Choose either Wall or Ceiling Projector Mount: Will you be attaching the projector to a wall or a ceiling? With some wall mounts the projector height can be adjusted. Ceiling mounts are ideal when room space is limited.Mounting a projector on the ceiling also reduces heat and noise near the conference table. Choose your Projector Mount Design: Some mounts are more visually appealing than others and some have very specific ease of use features \u2022First and foremost, make sure the mount supports the weight of the projector. \u2022Look for low profile and sleek mount designs for the nicest and most flush to the ceiling installation. Some mounts include an extension column for routing cables into the ceiling. \u2022Adjustable arms help make it a snap to change the placement of the projector in the future. Check to see how easy the mount is to install \u2013 how many wall studs does it require? A quick-release feature provides for easy projector access for maintenance purposes. \u2022Consider built-in security features to help prevent theft. Choose a Universal Projector Mount: Affordable and flexible universal mounts can fit nearly any size or brand of projector under a specified weight. Projector Mount Types: Some mounts are created specifically for different projector types or installation environments: Short Throw projector mounts are designed for same wall as screen installation. Adjustable Suspended Ceiling mounts are for use in false or suspended ceiling environments. False Ceiling Plate mounts replace the ceiling tile.", "parent_text": "Projectors / Screens / Pointers", "keyword_density": {"mounts": "3.1", "projector mounts": "0.7", "projector": "5.9"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 6, "level": -1, "url": "http://www.staples.com/Livescribe-Smartpens-Accessories/cat_CL164969", "text": "Livescribe Smartpens & Accessories", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Livescribe Smartpens & Accessories", "parent_url": "http://www.staples.com/Livescribe-Smartpens-Accessories/cat_CG1271", "keyword_count": {"livescribe smartpens": 1}, "description_wc": 7, "description_text": "Never miss a word with Livescribe smartpens.", "parent_text": "Livescribe Smartpens / Accessories", "keyword_density": {"livescribe smartpens": "28.6"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 146, "level": -1, "url": "http://www.staples.com/Projector-Screens/cat_CL141762", "text": "Projector Screens", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Projector Screens", "parent_url": "http://www.staples.com/Projectors-Screens-Pointers/cat_DP1446", "keyword_count": {"screens": 11, "projector screens": 2, "projector": 4}, "description_wc": 127, "description_text": "Projector screens make it easy to show movies, training videos, slideshows, and more to audiences. Choose from fixed screens or pull-down screens depending on your needs and preferences. Your screen should fit your space, so pick a bigger one for a large room. Mountable Screens Mountable projector screens can be attached to walls or ceilings for permanent access. These screens work well for classrooms or meeting rooms with permanently installed digital projectors. Portable Screens A portable projector screen lets you take your presentation with you. Tabletop screens are ideal for small spaces and one-on-one presentations. Whiteboard Screens Whiteboard screens have space to write on with dry-erase markers, so you can be more interactive with your presentations. These screens are designed to reduce glare.", "parent_text": "Projectors / Screens / Pointers", "keyword_density": {"screens": "8.7", "projector screens": "3.1", "projector": "3.1"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 210, "level": -1, "url": "http://www.staples.com/Projectors/cat_CL140542", "text": "Projectors", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Projectors", "parent_url": "http://www.staples.com/Projectors-Screens-Pointers/cat_DP1446", "keyword_count": {"projectors": 4}, "description_wc": 514, "description_text": "Staples carries a large assortment of projectors to ensure we carry the right solution for you. Here are a couple of things to consider when purchasing a projector. Choose the Right Brand : We carry a wide variety of projector brands from Epson, 3M, Qumi, NEC, Optoma, Viewsonic and many more. Display technologies : Choose between a 3LCD projector, LED projector and DLP projector which are slightly different. Each has their own strengths - brightness contrast, image quality, footprint, power efficiency, and ease of use features. Brightness : This is by far the most important feature, so it\u2019s important to understand that there are two brightness measurements: Color Brightness (color light output) and White Brightness (white light output). Brilliant image quality requires high Color Brightness because it measures the brightness of colors in a projected image, not just the brightness of white. Look for two lumens specs, one for Color Brightness, and one for White Brightness, since one measurement is not enough to determine potential image quality differences. This is critically important as most projectors are used for color content and color is a critical component of picture quality. If color brightness is lower than white brightness, images may be dark, dull, details and skin tones poor. A projector with higher color lumens with higher white lumens also provides additional light output to ensure your content is highly visible in bright or lighted rooms. Resolution: This is increasingly important to keep up the pace with high definition displays, televisions and multimedia. There are 3 resolutions to know: SVGA, XGA and WXGA. Think of them as good, better and best, respectively. The higher the resolution, the better the quality. This means your audience sees more detail. WXGA (1280 x 800) or higher is the most popular display resolution today to support widescreen high definition movies and widescreen UXGA (1600 x 1200) or higher display laptops. SVGA (800 x 600) \u2013 is a basic entry level solution perfect for small classrooms, analog TV and DVD playback. XGA (1024 x 768) - is suitable for professional presentations, graphics work and movies. There are many features that make a projector easier to use\u2014which can save you time\u2026 and eliminate hassle. Check that the projector has the input and output connectivity that you will need. Many projectors provide instant setup for both Mac and PC through USB type B and HDMI for all digital audio and high definition video. Wireless projection is the ultimate in convenience allowing you to project content PC-free from computers to mobile devices. Image alignment features are also very important when you don\u2019t have a lot of time (or patience) to setup for meetings. Some projectors have manual or automatic, horizontal, vertical or keystone image correction controls. And look for some time saving features like instant off/on and PC-free slideshows, so you can make a presentation without your laptop. Portability of the projector should also be considered and is determined by the size and weight of a projector. Some may even include a carrying case and remote which will save you some extra costs.", "parent_text": "Projectors / Screens / Pointers", "keyword_density": {"projectors": "0.8"}, "department_id": 14}
