{"department_text": "Phones | Cameras | Electronics", "nr_products": 26, "level": -1, "url": "http://www.staples.com/Presenters-Laser-Pointers/cat_CL165053", "text": "Presenters & Laser Pointers", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Presenters & Laser Pointers", "parent_url": "http://www.staples.com/Livescribe-Smartpens-Accessories/cat_CG1271", "keyword_count": {"presenters": 4, "laser pointers": 5, "laser": 7}, "description_wc": 145, "description_text": "Presenters and laser pointers make it easier to give a great presentation. The bright laser light is easy to see, so your clients or colleagues can follow your pointer. Presenters are often handheld, so you don't have to carry bulky equipment. Easy to Follow With a presentation on your PC , you can use a projector to show the class or room your information. Using presenters or laser pointers makes it easy to follow the section you're speaking about. Bright Laser Laser pointers come in a few different colors, and they are easy to see. Red laser pointers are commonly used and stand out in a dark room. USB Connection Many presenters and laser pointers use USB connections that are wireless. This means you can use your pointer from across the room and it will still be able to interact with your computer.", "parent_text": "Livescribe Smartpens / Accessories", "keyword_density": {"presenters": "2.8", "laser pointers": "6.9", "laser": "4.9"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "level": -1, "url": "http://www.staples.com/Cables/cat_DP1426", "text": "Cables", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Cables", "parent_url": "http://www.staples.com/Batteries-Power/cat_CG75", "keyword_count": {"cables": 8}, "description_wc": 140, "description_text": "Link all of your devices to the network with the right cables from Staples. Whether you\u2019re setting up a sound system, seeking faster file transfer or streamlining your workspace, we have the cables you need. For more information, please visit our research centers. Fast file transfer : Browse our computer cables, USB cables and monster cables to find high speed data transfer. High quality linkage : Connect your audio and video equipment to your computer or TV with audio and video cables and adapters for reliable and quality communication. Set up your workspace : Find all of the supplies you need to get set up, including power supplies, serial, monitor and printer cables, as well as USB hubs to expand your capacity. The names you trust : Belkin, VGA, Tripp Lite, Monster and Staples. At Staples, we have all the cables you need.", "parent_text": "Batteries & Power", "keyword_density": {"cables": "5.7"}, "department_id": 14}
