{"department_text": "Phones | Cameras | Electronics", "level": -1, "url": "http://www.staples.com/Battery-Backup-UPS/cat_DP1916", "text": "Battery Backup/ UPS", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Battery Backup/ UPS", "parent_url": "http://www.staples.com/Batteries-Power/cat_CG75", "keyword_count": {"battery": 8, "battery backup": 6, "backup": 7, "ups": 2}, "description_wc": 130, "description_text": "Work right through disruptions to your power supply with battery backup. Browse a range of options for quick and reliable UPS battery backup and battery replacement. For more information, please visit our research centers. All-in-one battery backup and surge protection : With UPS battery backup, find hybrid backup/outlet options so your devices will be powered and protected at once. Limit disruption : Battery backup options have the output capacity to power your workspace with a runtime ranging from 6 to 21 minutes, so you can continue to work seamlessly or ensure the safety of your essential data. Easy battery replacement : Replacement batteries come in a range of sizes to suit your needs. Reliable brands : Including APC, Tripp Lite and Cyberpower. Experience uninterrupted productivity with battery backup and replacement solutions.", "parent_text": "Batteries & Power", "keyword_density": {"battery": "6.2", "battery backup": "9.2", "backup": "5.4", "ups": "1.5"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "level": -1, "url": "http://www.staples.com/Batteries/cat_DP803", "text": "Batteries", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Batteries", "parent_url": "http://www.staples.com/Batteries-Power/cat_CG75", "keyword_count": {"batteries": 7}, "description_wc": 127, "description_text": "Ensure your devices are always ready to go with the batteries they need. Shop our supply of disposable and rechargeable batteries to meet a diverse range of specifications. Need more information? Browse our research centers for more solutions. Rechargeable batteries for your mobile life : Choose a reliable, rechargeable and long lasting battery for your camera, phone or laptop, available in models that fit a wide range of product lines. Special batteries : Find the special batteries you need for unique items like hearing aids, power tools, radios and wireless printers. Charge with assurance : We carry only the best batteries from Duracell, the top name in battery sales, so you can trust your device will be ready for you to use. Restock your supply today with batteries from Staples.", "parent_text": "Batteries & Power", "keyword_density": {"batteries": "5.5"}, "department_id": 14}
{"department_text": "Mobile Phones | Accessories", "level": -1, "url": "http://www.staples.com/Motorola-Mobile-Phone-Accessories/cat_DP8308", "text": "Motorola Mobile Phone Accessories", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "Motorola Mobile Phone Accessories", "parent_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_CG6", "keyword_count": {"motorola mobile phone accessories": 1}, "description_wc": 36, "description_text": "Amplify your communication solution with a selection of Motorola mobile phone accessories. Find on-the-go power units and protective solutions to suit your budget and your sense of style. Innovation comes standard with every item.", "parent_text": "Mobile Phone Accessories", "keyword_density": {"motorola mobile phone accessories": "11.1"}, "department_id": 12}
{"department_text": "Mobile Phones | Accessories", "level": -1, "url": "http://www.staples.com/HTC-Mobile-Phone-Accessories/cat_DP8306", "text": "HTC Mobile Phone Accessories", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "HTC Mobile Phone Accessories", "parent_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_CG6", "keyword_count": {"phone": 4, "accessories": 2, "htc mobile phone accessories": 1}, "description_wc": 56, "description_text": "HTC mobile phone accessories help you keep your phone working at its best, and Staples has what you need to protect your phone from bumps and scratches. If you want to ensure your battery doesn't die or you need a place to keep your phone safe while you drive, our accessories will get you going.", "parent_text": "Mobile Phone Accessories", "keyword_density": {"phone": "7.1", "accessories": "3.6", "htc mobile phone accessories": "7.1"}, "department_id": 12}
{"department_text": "Mobile Phones | Accessories", "level": -1, "url": "http://www.staples.com/LG-Mobile-Phone-Accessories/cat_DP8307", "text": "LG Mobile Phone Accessories", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "LG Mobile Phone Accessories", "parent_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_CG6", "keyword_count": {"phone": 3, "accessories": 2, "lg mobile phone accessories": 1}, "description_wc": 53, "description_text": "LG mobile phone accessories offer multiple ways to use your device, whether you're in the office or traveling between locations. Use headsets and remote speakerphones to handle important calls while driving. With protective accessories, you can minimize damage from daily wear on your phone and operate the touchscreen without leaving unsightly marks.", "parent_text": "Mobile Phone Accessories", "keyword_density": {"phone": "5.7", "accessories": "3.8", "lg mobile phone accessories": "7.5"}, "department_id": 12}
{"department_text": "Mobile Phones | Accessories", "level": -1, "url": "http://www.staples.com/Samsung-Mobile-Phone-Accessories/cat_DP8304", "text": "Samsung Mobile Phone Accessories", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "Samsung Mobile Phone Accessories", "parent_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_CG6", "keyword_count": {"phone": 3, "samsung mobile phone accessories": 1}, "description_wc": 58, "description_text": "Samsung mobile phone accessories make it easy to protect your phone from damage and daily wear and tear. Plenty of chargers and adapters are available, so you can keep your phone powered up at home and on the road. When you're traveling, use convenient docks and Bluetooth headsets to talk and drive safely at the same time.", "parent_text": "Mobile Phone Accessories", "keyword_density": {"phone": "5.2", "samsung mobile phone accessories": "6.9"}, "department_id": 12}
