{"department_text": "Mobile Phones | Accessories", "level": -1, "url": "http://www.staples.com/Samsung-GS4-Accessories/cat_DP8349", "text": "Samsung GS4 Accessories", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "Samsung GS4 Accessories", "parent_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_CG6", "keyword_count": {"samsung gs4 accessories": 1}, "description_wc": 42, "description_text": "Samsung GS4 accessories are essential for preserving the like-new condition of your smartphone. Protective cases help prevent bumps and scratches from permanently damaging your device, and headsets and chargers give you the freedom to use your smartphone from almost any location.", "parent_text": "Mobile Phone Accessories", "keyword_density": {"samsung gs4 accessories": "7.1"}, "department_id": 12}
