{"department_text": "Phones | Cameras | Electronics", "nr_products": 329, "level": -2, "url": "http://www.staples.com/Surge-Protectors/cat_CL163615", "text": "Surge Protectors", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Surge Protectors", "parent_url": "http://www.staples.com/Surge-Protectors/cat_DP1915", "keyword_count": {"surge protectors": 4, "surge": 6}, "description_wc": 178, "description_text": "Using surge protectors is an effective way to keep your equipment safe from lightning strikes and power spikes. Automatic power management ensures that you won't waste electricity powering unused devices. Some surge protectors plug directly into the wall, while others have power cords that extend their reach. Long Cord Lengths Choose 3-foot cords for keeping your workspace free of extra cables. Alternatively, opt for cords that are 12 feet long or longer when you need to protect a large item located far from an electrical outlet. Industrial Strength Industrial-strength surge protectors have sturdy cases and cables that can withstand extreme conditions. Choose options that offer up to 4,000 joules of surge protection for environments in which power fluctuations are likely. Computer Safety Features If your business uses a lot of computing equipment, dataline protection and USB charging are useful extra features you can find on some surge protectors. Sliding safety covers keep unused outlets covered and protected. For situations where surge protection isn't important, but you need extra outlets, try a power strip instead.", "parent_text": "Surge Protectors", "keyword_density": {"surge protectors": "4.5", "surge": "3.4"}, "department_id": 14}
