{"department_text": "Mobile Phones | Accessories", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Samsung-GS4-Screen-Protectors/cat_CL207704", "text": "Samsung GS4 Screen Protectors", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "Samsung GS4 Screen Protectors", "parent_url": "http://www.staples.com/Samsung-GS4-Accessories/cat_DP8349", "keyword_count": {"screen": 5, "samsung gs4 screen protectors": 1}, "description_wc": 59, "description_text": "Use Samsung GS4 screen protectors so that your screen continues to look great even after hours of swiping and tapping. Your device will continue to maintain a clear, smooth screen for years to come when sealed behind a screen protector. Choose a self-healing model to ensure that your screen protector will last as long as your phone does.", "parent_text": "Samsung GS4 Accessories", "keyword_density": {"screen": "8.5", "samsung gs4 screen protectors": "6.8"}, "department_id": 12}
{"department_text": "Mobile Phones | Accessories", "nr_products": 38, "level": -2, "url": "http://www.staples.com/Samsung-GS4-Cases/cat_CL207702", "text": "Samsung GS4 Cases", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "Samsung GS4 Cases", "parent_url": "http://www.staples.com/Samsung-GS4-Accessories/cat_DP8349", "keyword_count": {"samsung gs4 cases": 1, "cases": 2, "samsung": 2}, "description_wc": 57, "description_text": "When you protect your Samsung Galaxy S4 with one of these Samsung GS4 cases, you don't have to worry if you drop your phone. These sturdy cases protect your phone from cracks, scratches, and smudges. Whether you prefer the flip cover or the bumper cover, you're sure to find a case that fits your style.", "parent_text": "Samsung GS4 Accessories", "keyword_density": {"samsung gs4 cases": "5.3", "cases": "3.5", "samsung": "3.5"}, "department_id": 12}
