{"department_text": "Mobile Phones | Accessories", "nr_products": 41, "level": -2, "url": "http://www.staples.com/Samsung-Mobile-Phone-Screen-Protectors/cat_CL206053", "text": "Samsung Mobile Phone Screen Protectors", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "Samsung Mobile Phone Screen Protectors", "parent_url": "http://www.staples.com/Samsung-Mobile-Phone-Accessories/cat_DP8304", "keyword_count": {"phone": 3, "screen": 3, "protectors": 2, "samsung mobile phone screen protectors": 1, "samsung": 2}, "description_wc": 48, "description_text": "With Samsung mobile phone screen protectors, you can keep your phone's touchscreen pristine even when you use it every day. Protectors are quick and easy to install, and they're available for a variety of Samsung phones. Plus, they won't interfere with your touchscreen's features.", "parent_text": "Samsung Mobile Phone Accessories", "keyword_density": {"phone": "6.2", "screen": "6.2", "samsung": "4.2", "samsung mobile phone screen protectors": "10.4", "protectors": "4.2"}, "department_id": 12}
{"department_text": "Mobile Phones | Accessories", "nr_products": 21, "level": -2, "url": "http://www.staples.com/LG-Mobile-Phone-Chargers-Adapters/cat_CL205944", "text": "LG Mobile Phone Chargers & Adapters", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "LG Mobile Phone Chargers & Adapters", "parent_url": "http://www.staples.com/LG-Mobile-Phone-Accessories/cat_DP8307", "keyword_count": {"adapters": 1, "phone": 2, "lg mobile phone chargers": 1, "chargers": 4}, "description_wc": 61, "description_text": "Get LG mobile phone chargers and adapters that work in your car, at home, or anywhere you need extra battery power. Solar-powered chargers, wireless chargers, and charging stations give you plenty of options to keep your phone running. Stock up on multiple chargers for various situations, and you'll never need to worry about running low on battery power again.", "parent_text": "LG Mobile Phone Accessories", "keyword_density": {"phone": "3.3", "adapters": "1.6", "lg mobile phone chargers": "6.6", "chargers": "6.6"}, "department_id": 12}
{"department_text": "Mobile Phones | Accessories", "nr_products": 28, "level": -2, "url": "http://www.staples.com/LG-Mobile-Phone-Screen-Protectors/cat_CL206104", "text": "LG Mobile Phone Screen Protectors", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "LG Mobile Phone Screen Protectors", "parent_url": "http://www.staples.com/LG-Mobile-Phone-Accessories/cat_DP8307", "keyword_count": {"screen protectors": 2, "lg": 2, "screen": 5, "phone": 3, "lg mobile phone screen protectors": 1}, "description_wc": 49, "description_text": "LG mobile phone screen protectors help reduce glare while keeping dust and debris from messing up your screen. These screen protectors are cut to precisely fit your LG phone so that they're easy to snap into place. Using a screen protector makes your phone's screen last longer.", "parent_text": "LG Mobile Phone Accessories", "keyword_density": {"screen protectors": "8.2", "lg": "4.1", "screen": "10.2", "lg mobile phone screen protectors": "10.2", "phone": "6.1"}, "department_id": 12}
{"department_text": "Mobile Phones | Accessories", "nr_products": 7, "level": -2, "url": "http://www.staples.com/LG-Mobile-Phone-Cases/cat_CL168851", "text": "LG Mobile Phone Cases", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "LG Mobile Phone Cases", "parent_url": "http://www.staples.com/LG-Mobile-Phone-Accessories/cat_DP8307", "keyword_count": {"phone": 3, "cases": 5, "lg mobile phone cases": 1}, "description_wc": 56, "description_text": "LG mobile phone cases provide the protection your phone needs against damage. There are many styles including clip cases, holster cases, shell cases, and others, so you can choose the type that suits your phone and style. Cases come in different colors and materials as well, making it easy to choose one to suit your look.", "parent_text": "LG Mobile Phone Accessories", "keyword_density": {"phone": "5.4", "cases": "8.9", "lg mobile phone cases": "7.1"}, "department_id": 12}
{"department_text": "Mobile Phones | Accessories", "nr_products": 22, "level": -2, "url": "http://www.staples.com/HTC-Mobile-Phone-Chargers-Adapters/cat_CL205942", "text": "HTC Mobile Phone Chargers & Adapters", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "HTC Mobile Phone Chargers & Adapters", "parent_url": "http://www.staples.com/HTC-Mobile-Phone-Accessories/cat_DP8306", "keyword_count": {"phone": 2, "htc mobile phone": 1, "htc": 2, "adapters": 1}, "description_wc": 46, "description_text": "Don't miss a business beat. Ensure you're always equipped with a way to charge your HTC device, no matter where you are. With a gadget to suit every gizmo, this range of HTC mobile phone changers and adapters will please the savviest smartphone aficionado.", "parent_text": "HTC Mobile Phone Accessories", "keyword_density": {"phone": "4.3", "htc mobile phone": "6.5", "htc": "4.3", "adapters": "2.2"}, "department_id": 12}
{"department_text": "Mobile Phones | Accessories", "nr_products": 92, "level": -2, "url": "http://www.staples.com/Samsung-Mobile-Phone-Cases/cat_CL205913", "text": "Samsung Mobile Phone Cases", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "Samsung Mobile Phone Cases", "parent_url": "http://www.staples.com/Samsung-Mobile-Phone-Accessories/cat_DP8304", "keyword_count": {"phone": 3, "samsung mobile phone cases": 1}, "description_wc": 44, "description_text": "Use Samsung mobile phone cases to keep your phone protected from accidents. Models with flip covers keep the front plate of your phone safe while it's in your bag or pocket. Choose from a variety of colors and styles to suit your personality.", "parent_text": "Samsung Mobile Phone Accessories", "keyword_density": {"phone": "6.8", "samsung mobile phone cases": "9.1"}, "department_id": 12}
{"department_text": "Mobile Phones | Accessories", "nr_products": 54, "level": -2, "url": "http://www.staples.com/HTC-Mobile-Phone-Screen-Protectors/cat_CL206101", "text": "HTC Mobile Phone Screen Protectors", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "HTC Mobile Phone Screen Protectors", "parent_url": "http://www.staples.com/HTC-Mobile-Phone-Accessories/cat_DP8306", "keyword_count": {"htc mobile phone screen protectors": 1, "phone": 4, "screen": 5, "mobile phone": 2}, "description_wc": 71, "description_text": "If you have a mobile phone with a touchscreen or large screen area, you know how hard it can be to use one with scratches. Fortunately, HTC mobile phone screen protectors are able to protect the screen from damage, so you can use your phone for longer. The protective screen is easy to apply and remove, and you can still use other accessories with your phone when it is in place.", "parent_text": "HTC Mobile Phone Accessories", "keyword_density": {"htc mobile phone screen protectors": "7.0", "phone": "5.6", "screen": "7.0", "mobile phone": "5.6"}, "department_id": 12}
{"department_text": "Mobile Phones | Accessories", "nr_products": 81, "level": -2, "url": "http://www.staples.com/HTC-Mobile-Phone-Cases/cat_CL168850", "text": "HTC Mobile Phone Cases", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "HTC Mobile Phone Cases", "parent_url": "http://www.staples.com/HTC-Mobile-Phone-Accessories/cat_DP8306", "keyword_count": {"phone": 2, "htc mobile phone cases": 1}, "description_wc": 43, "description_text": "These high-quality HTC mobile phone cases get your company smartphone ready for the business battle and are built to protect your cellular devices from scratches, impacts, and dust. Negotiate your next big corporate deal wirelessly-on the road or in the office.", "parent_text": "HTC Mobile Phone Accessories", "keyword_density": {"phone": "4.7", "htc mobile phone cases": "9.3"}, "department_id": 12}
{"department_text": "Mobile Phones | Accessories", "nr_products": 21, "level": -2, "url": "http://www.staples.com/Motorola-Mobile-Phone-Chargers-Adapters/cat_CL205946", "text": "Motorola Mobile Phone Chargers & Adapters", "department_url": "http://www.staples.com/Mobile-Phones-Accessories/cat_SC5308", "description_title": "Motorola Mobile Phone Chargers & Adapters", "parent_url": "http://www.staples.com/Motorola-Mobile-Phone-Accessories/cat_DP8308", "keyword_count": {"chargers": 4, "motorola mobile phone chargers": 1, "adapters": 1, "phone": 3}, "description_wc": 67, "description_text": "Motorola mobile phone chargers and adapters make it easy to keep your phone charged wherever you are. Use one of the standard wall chargers for charging at home or at the office, and keep one of the handy car chargers in your vehicle for charging your phone on the road. You can even toss one of the combo chargers into your briefcase or luggage for flexible charging.", "parent_text": "Motorola Mobile Phone Accessories", "keyword_density": {"chargers": "6.0", "motorola mobile phone chargers": "6.0", "adapters": "1.5", "phone": "4.5"}, "department_id": 12}
