{"department_text": "Phones | Cameras | Electronics", "nr_products": 232, "level": -2, "url": "http://www.staples.com/HDMI-Cables/cat_CL163884", "text": "HDMI Cables", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "HDMI Cables", "parent_url": "http://www.staples.com/Cables/cat_DP1426", "keyword_count": {"cables": 5, "hdmi": 3, "hdmi cables": 2}, "description_wc": 161, "description_text": "HDMI cables give you the best in high-speed connectivity, so you can enjoy your shows, movies, and games the way they were meant to be watched. Signal extenders help you get the most of your HDMI signal. Adapters with swivel-capabilities are also available, so you don't have to worry about trying to connect cables in awkward or tight spaces. Large or Small Spaces Choose from a variety of different length options, from 3-foot to 100-foot cables. This lets you cross as much space as you need while reducing the risk of tripping over extra cord. Superior Conductivity HDMI cables and adapters with 24k gold connectors keep your signal smooth. They are also corrosion resistant. 3D Video and 4K Cinema Compatible Connect your Blu-ray players and gaming consoles to your 3D TV and experience incredible picture quality and surround sound. Super thin cables are less noticeable than their traditional counterparts, keeping the focus on the screen.", "parent_text": "Cables", "keyword_density": {"cables": "3.1", "hdmi": "1.9", "hdmi cables": "2.5"}, "department_id": 14}
