{"department_text": "Phones | Cameras | Electronics", "nr_products": 370, "level": -2, "url": "http://www.staples.com/Audio-Video-Cables/cat_CL142812", "text": "Audio/Video Cables", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Audio/Video Cables", "parent_url": "http://www.staples.com/Cables/cat_DP1426", "keyword_count": {"cables": 5, "audio": 3, "video": 3, "audio video cables": 2}, "description_wc": 157, "description_text": "Audio/video cables are necessary accessories for both the novice and professional a/v technicians. They are available in various lengths, from under 3-foot long to over 16 foot long. This lets you find right-sized cable for your work space. Splitters Headset splitter cables let you connect two different sets of headphones to one jack, so two people can listen to the same portable audio device at the same time. Two-way video splitters are also available to increase your connection options. Replacement Power Cords Keep a few replacement power cords on hand for your most-used electronic devices. If one breaks, just plug in the new one and keep the entertainment going. Extension Cables These audio/video cables give you the freedom to put your monitor or other electronic device where it suits you best, instead of just where the cord reaches. Convenient thumb screws on the monitor extensions cables ensure a secure connection.", "parent_text": "Cables", "keyword_density": {"video": "1.9", "audio": "1.9", "cables": "3.2", "audio video cables": "3.8"}, "department_id": 14}
