{"department_text": "Printers | Shredders | Machines", "level": -1, "url": "http://www.staples.com/HP-Officejet-Pro-X-Series/cat_DP8153", "text": "HP Officejet Pro X Series", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "HP Officejet Pro X Series", "parent_url": "http://www.staples.com/Printers-All-in-Ones/cat_CG44", "keyword_count": {"hp officejet pro x": 2, "hp officejet pro x series": 1}, "description_wc": 42, "description_text": "Introducing the HP Officejet Pro X series, the world\u2019s fastest desktop printers.(1) With up to twice the speed and half the printing cost of color lasers (2,3), the HP Officejet Pro X sets a new standard for business printing.", "parent_text": "Printers", "keyword_density": {"hp officejet pro x": "19.5", "hp officejet pro x series": "12.2"}, "department_id": 11}
{"department_text": "Printers | Shredders | Machines", "nr_products": 12, "level": -1, "url": "http://www.staples.com/Dot-Matrix-Printers/cat_CL40302", "text": "Dot Matrix Printers", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "Dot Matrix Printers", "parent_url": "http://www.staples.com/Printers-All-in-Ones/cat_CG44", "keyword_count": {"dot matrix printers": 1}, "description_wc": 41, "description_text": "Dot matrix printers print through multi-part forms in a single pass, which makes them ideal for printing documents like invoices and shipping forms. Staples is the #1 choice for small business printing with the top brands like Epson and Oki.", "parent_text": "Printers", "keyword_density": {"dot matrix printers": "7.3"}, "department_id": 11}
{"department_text": "Printers | Shredders | Machines", "nr_products": 9, "level": -1, "url": "http://www.staples.com/Cube-3D-Printers-Accessories/cat_CL205651", "text": "Cube 3D Printers / Accessories", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "Cube 3D Printers / Accessories", "parent_url": "http://www.staples.com/Printers-All-in-Ones/cat_CG44", "keyword_count": {"3d": 2, "printers": 3, "cube": 8, "accessories": 2, "cube 3d printers": 1}, "description_wc": 153, "description_text": "Cube 3D printers and accessories help you get your sketches out of your mind and into your hands. Create everyday objects or unique designs. 3D Printing The standard Cube printer can produce objects up to 5.5 inches square, while the CubeX can print larger designs up to the size of a basketball. Both printers come with all of the equipment and software you need to start bringing your ideas to life. Vivid Color With a wide range of color cartridges available, Cube printers give your objects extra flair. The CubeX even lets your print multicolor designs, giving you the freedom to fully customize your models. Convenient Accessories You can also purchase replacement items for your Cube printer, so you always have what you need on hand. From print pads and CubeSticks to replacement tubes and power supplies, everything you need to keep your Cube printer ready for action is just a click away.", "parent_text": "Printers", "keyword_density": {"cube 3d printers": "2.0", "cube": "5.2", "printers": "2.0", "accessories": "1.3", "3d": "1.3"}, "department_id": 11}
{"department_text": "Printers | Shredders | Machines", "nr_products": 69, "level": -1, "url": "http://www.staples.com/Inkjet-Printers/cat_CL40300", "text": "Inkjet Printers", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "Inkjet Printers", "parent_url": "http://www.staples.com/Printers-All-in-Ones/cat_CG44", "keyword_count": {"inkjet printers": 2, "inkjet": 5, "printers": 4}, "description_wc": 109, "description_text": "Inkjet printers are an essential part of any office that provides an economical solution to printing high-quality text and great color images. Finding the best inkjet printer for your home or office is easy with Staples selection of brands like HP, Brother, Epson Canon, Lexmark, and more. Choose from single function or all-in-one wide-format or mobile inkjet printers. Wireless printer options that are convenient and take up less space. Products ranging from all-in-one printers with multiple features to economical printers. Check out customer inkjet printer reviews to learn more. And, pick up your inkjet printer cartridge while you\u2019re here for easy shopping.", "parent_text": "Printers", "keyword_density": {"printers": "3.7", "inkjet": "4.6", "inkjet printers": "3.7"}, "department_id": 11}
{"department_text": "Printers | Shredders | Machines", "nr_products": 344, "level": -1, "url": "http://www.staples.com/All-Printers/cat_CL167883", "text": "All Printers", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "All Printers", "parent_url": "http://www.staples.com/Printers-All-in-Ones/cat_CG44", "keyword_count": {"printers": 8}, "description_wc": 181, "description_text": "All printers put ink on a page, but they are not all created equal. We have printers that can handle high-volume jobs and machines that can produce high-quality photos and graphics. Our inkjet, laser, and solid ink printers come in a range of price points to suit your budget. Multifunction Machines All printers create documents, but a multifunction machine lets your print, fax, copy, and scan, consolidating devices and saving space. Wi-Fi printers give you even more freedom, letting you work in another room and send your documents to a communal printer. Quality Photos If your business requires you to print out a high number of photos or graphics, you want a machine that is built for the job. Some top models even have automatic red-eye correction and let you print in black and white or sepia tones for that extra special touch. Laser Printers Laser printers are faster than most traditional inkjet printers, perfect for offices that go through a lot of paper. Try one of the ENERGY STAR qualified models for an added green benefit.", "parent_text": "Printers", "keyword_density": {"printers": "4.4"}, "department_id": 11}
{"department_text": "Printers | Shredders | Machines", "nr_products": 146, "level": -1, "url": "http://www.staples.com/All-in-One-Printers/cat_CL161518", "text": "All-in-One Printers", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "All-in-One Printers", "parent_url": "http://www.staples.com/Printers-All-in-Ones/cat_CG44", "keyword_count": {"one": 8, "printers": 1}, "description_wc": 228, "description_text": "The right all-in-one printer is an important part of completing projects for work, school, or pleasure. Decide whether you need a printer that creates high-quality glossy photo prints, a sturdy machine for heavy-duty printing, or a device with other useful features. For a versatile machine that fits a variety of needs, choose the perfect all-in-one printer. Print - Print page after page of color or black-and-white text and images. Choose a printer that creates double-sided copies and collates to save time and paper. Copy - Copy text and images with the touch of a button. This feature is ideal for teachers, managers, and anyone else who has to communicate with a group. Scan - Import images and documents to all laptops quickly with an all-in-one printer. Choose different images resolutions for the right blend of speed, quality, and efficiency. Fax - When you need to send a document quickly, faxing can be a hassle-free choice. An all-in-one printer lets you choose the best way to manage your documents and images. With one of these top quality printers, you will be able to handle any job quickly and easily. Make sure to get all the printer ink cartridges & toner for your new printer in advance; you will find exactly what you need easily with our simple Ink & Toner Finder.", "parent_text": "Printers", "keyword_density": {"printers": "0.4", "one": "3.5"}, "department_id": 11}
