{"department_text": "Printers | Shredders | Machines", "nr_products": 180, "level": -1, "url": "http://www.staples.com/Laser-Printers/cat_CL142044", "text": "Laser Printers", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "Laser Printers", "parent_url": "http://www.staples.com/Printers-All-in-Ones/cat_CG44", "keyword_count": {"laser": 4, "laser printers": 3, "printers": 8}, "description_wc": 155, "description_text": "Laser printers from manufacturers such as Canon, Samsung, Brother, and Xerox give you faster print speeds and better printout quality compared to traditional inkjet printers. Choose from efficient single-use printers or convenient multifunction devices. Staples's selection of black & white / color laser printers are ideal for large-volume print jobs and high-frequency printing. Black-and-White Printing Produce monochrome documents at extremely fast speeds of up to 40 pages per minute with black-and-white laser printers. Look for automatic document feeding and automatic duplexing to make printing even more efficient. Network-Ready Printers Network-ready printers let you connect multiple devices so you can share resources. Choose a wireless printer if you want to limit cords and cables in your workspace. Multifunction Units Multifunction printers combine a color laser printer with a scanner, copier, and fax machine. Using an all-in-one machine maximizes space in the office and provides added functionality.", "parent_text": "Printers", "keyword_density": {"laser": "2.6", "laser printers": "3.9", "printers": "5.2"}, "department_id": 11}
{"department_text": "Printers | Shredders | Machines", "nr_products": 6, "level": -2, "url": "http://www.staples.com/HP-Officejet-Pro-X-Series/cat_CL169182", "text": "HP Officejet Pro X Series", "department_url": "http://www.staples.com/Printers-Shredders-Machines/cat_SC1681", "description_title": "HP Officejet Pro X Series", "parent_url": "http://www.staples.com/HP-Officejet-Pro-X-Series/cat_DP8153", "keyword_count": {"hp officejet pro x": 5, "hp officejet pro x series": 3, "hp": 10, "officejet pro x series": 4, "officejet pro x": 6, "x": 11, "pro": 7}, "description_wc": 281, "description_text": "Introducing the HP Officejet Pro X series, the world\u2019s fastest desktop printers.(1) With up to twice the speed and half the printing cost of color lasers (2,3), the HP Officejet Pro X sets a new standard for business printing. Thanks to breakthrough HP PageWide Technology, the HP Officejet Pro X multifunction and single function printers deliver professional printing at up to 70 pages per minute in general office mode for 50% less cost per page than color laser printers.(2,3) With a printhead that spans the width of a page, HP PageWide Technology simultaneously delivers four colors of Original HP pigment ink onto a moving sheet of paper. And because the paper moves while the printhead doesn\u2019t, HP Officejet Pro X series printers can print quietly and fast. The HP Officejet Pro X series printers use up to 50% less energy than color lasers (4) too, while automatic two-sided printing further reduces waste. And a 500-sheet main paper tray is standard for fewer printing interruptions. HP Original cartridges for the Officejet Pro X series print up to four times more than other XL ink cartridges. The 970 XL ink cartridge prints up to 9,200 pages, and the 971 XL cartridges each print up to 6,600 pages \u2013 which save time through less frequent cartridge changes. 1 Based on published fastest print speeds for the HP X551dw and X576dw models compared to laser and inkjet color desktop MFPs 2 Cost per page (CPP) based on majority of color laser MFPs 3 Comparison based on manufacturers\u2019 published specs of fastest available color mode as of Mar 2012. Includes color laser MFPs 4 Compares majority of color laser printers", "parent_text": "HP Officejet Pro X Series", "keyword_density": {"hp officejet pro x": "7.1", "hp officejet pro x series": "5.4", "hp": "3.6", "officejet pro x series": "5.7", "officejet pro x": "6.4", "x": "3.9", "pro": "2.5"}, "department_id": 11}
{"department_text": "Phones | Cameras | Electronics", "level": 0, "url": "http://www.staples.com/GPS-Accessories/cat_CG59", "text": "GPS / Accessories", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "GPS / Accessories", "parent_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "keyword_count": {"accessories": 1, "gps": 7}, "description_wc": 149, "description_text": "Know where you\u2019re going and when you\u2019ll get there with a top of the line GPS. Our GPS come with a range of features designed with you in mind. For more information, please visit our research centers. Ready to use : All GPS are packaged with maps pre-loaded so you can plug it in and be ready to go. Expandable maps available as well. Avoid traffic snarls : Choose a GPS with up to the minute traffic updates and avoid problem areas. Hands free : Try a model with the latest in voice recognition and control so you can keep your eyes and your attention where they need to be. Find all of your accessories : From GPS mounts to chargers, we\u2019ve got all of the extras. Find the top names : We carry Garmin, Magellan and TomTom GPS. A full range of GPS options available right here at Staples.", "parent_text": "Phones | Cameras | Electronics", "keyword_density": {"accessories": "0.7", "gps": "4.7"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "level": 0, "url": "http://www.staples.com/Telephones-Headsets-Cords/cat_CG14", "text": "Telephones / Headsets / Cords", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Telephones / Headsets / Cords", "parent_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "keyword_count": {"telephones": 2}, "description_wc": 122, "description_text": "Whether you\u2019re shopping for the office or the home, Staples has a telephone that will work for you. Browse our variety of styles and customizable options. Please visit our research centers for more information. Greater mobility : Try an expansion telephone headset for greater range. Or, combine one of our standard corded telephones with 25 feet of extra cord and stretch as far as you like. High volume and high capacity : We carry multi-line and conference telephones for large volumes of calls and big meetings. Identify callers : Caller ID and call waiting available on most phones. Trusted brands : Take a look through the Panasonic RCA, Plantronics and AT&T phones you love best. Purchasing a telephone from Staples.com means purchasing quality.", "parent_text": "Phones | Cameras | Electronics", "keyword_density": {"telephones": "1.6"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "level": 0, "url": "http://www.staples.com/E-Readers-Accessories/cat_DP2258", "text": "E-Readers / Accessories", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "E-Readers / Accessories", "parent_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "keyword_count": {"e readers": 2, "e": 79}, "description_wc": 126, "description_text": "Take hundreds of books wherever you go, all in one sleek e-reader. E-readers use electronic paper technology, so you feel just like you\u2019re reading from a magazine or a book. Choose from several different e-readers for access to the most well-stocked book stores in the world and many libraries. The world\u2019s best stories and reporting, available at the touch of a fingertip. An eReader can hold hundreds of books - how many can you read before needing a charge and how long will you take to read classics like The Lord of the Rings or War and Peace? Check your reading speed on this fun ereader interactive infographic and challenge your friends and co-workers to a battle of the mind.", "parent_text": "Phones | Cameras | Electronics", "keyword_density": {"e": "62.7", "e readers": "3.2"}, "department_id": 14}
{"department_text": "PCs | Drives | Accessories", "level": 0, "url": "http://www.staples.com/Headsets/cat_CG1215", "text": "Headsets", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Headsets", "parent_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "keyword_count": {"headsets": 1}, "description_wc": 14, "description_text": "Choose from our large assortment of Plantronics\u00ae, GE, Motorola, Jabra and Logitech headsets.", "parent_text": "PCs | Drives | Accessories", "keyword_density": {"headsets": "7.7"}, "department_id": 9}
{"department_text": "Phones | Cameras | Electronics", "level": 0, "url": "http://www.staples.com/Cameras-Camcorders-Accessories/cat_CG43", "text": "Cameras / Camcorders / Accessories", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Cameras / Camcorders / Accessories", "parent_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "keyword_count": {"accessories": 1}, "description_wc": 162, "description_text": "Special moments with friends and family are times you'll want to treasure forever. Camera brands such as Canon, Nikon, and Fuji provide quality and durability. Accessories, including lenses, memory cards, and cases, make capturing memories a snap. Models for Everyone Whether you're just starting out or are a more advanced photographer, you'll find the camera model you need for perfect pictures every time. Use a compact digital camera to take family photos or just capture everyday moments. If you really want to produce amazing photographs, consider a DSLR camera . Storage Solutions You'll want a place to keep your camera safe when you're not using it. Find cases and bags to fit every digital camera . or camcorder. Display Memories Digital frames make sharing your photographs easy, allowing you to change your display as often as you like. Memory cards let you store and share those moments with friends and family, even when they're miles away.", "parent_text": "Phones | Cameras | Electronics", "keyword_density": {"accessories": "0.6"}, "department_id": 14}
