{"department_text": "PCs | Drives | Accessories", "level": 0, "url": "http://www.staples.com/PCs-Laptops-Tablets/cat_CG71", "text": "PCs / Laptops / Tablets", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "PCs / Laptops / Tablets", "parent_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "keyword_count": {"laptops": 1, "tablets": 1}, "description_wc": 67, "description_text": "Staples carries a wide selection of laptops , desktop computers, and tablets to meet everyone\u2019s needs. Whether you need a laptop for your home office, a tablet for checking email, or a fully equipped business computer we have a great solution to meet your needs and budget. With the best products from top brands like HP, Dell, ASUS, Acer, Lenovo, and Toshiba \u2013 Staples has you covered.", "parent_text": "PCs | Drives | Accessories", "keyword_density": {"laptops": "1.5", "tablets": "1.5"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "level": 0, "url": "http://www.staples.com/Computer-Stands-Carts/cat_DP1570", "text": "Computer Stands / Carts", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Computer Stands / Carts", "parent_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "keyword_count": {"carts": 1, "computer": 5, "stands": 2}, "description_wc": 157, "description_text": "Experience increased mobility and ergonomics in the office with a computer stand from Staples. Shop our creative solutions for laptops and desktops. For more information, please visit our research centers. Streamline your desk space : With a computer cart or laptop cart, CPU stand or printer stand, devote your desktop to the essentials while maintaining easy access to your computer and its devices. Comfortable laptop use : Use your laptop like a desktop at the office or home by pairing a laptop stand or mount and adjustable notebook riser with an ergonomic keyboard and mouse. Or, take comfort on the go with a a cooling or heat shielding lap desk, as functional as it is portable. Prevent poor posture and eye strain : Browse our monitor arms and make your monitor adjust to you. Computer holders and stands from trusted brands : Allsop, Fellowes, Antec and 3M. With computer carts and stands, establish the accessible and ergonomic work station you crave.", "parent_text": "PCs | Drives | Accessories", "keyword_density": {"carts": "0.6", "computer": "3.2", "stands": "1.3"}, "department_id": 9}
{"department_text": "TV | Home Entertainment", "level": 0, "url": "http://www.staples.com/Movies-TV-Shows/cat_CG1406", "text": "Movies & TV Shows", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Movies & TV Shows", "parent_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "keyword_count": {"movies": 6, "tv shows": 4}, "description_wc": 209, "description_text": "Movies and TV shows provide a great way of entertaining or instructing staff and clients, or relaxing at home. With choices from popular film companies like Disney, Sony, and Paramount, you'll find a wide selection of movie genres, including drama, action, comedy, fitness, and documentaries. Compare movies and TV shows by checking the descriptions, ratings, and duration of appealing products. Satisfy Your Audience Thousands of movies and TV shows are available in well-known genre categories, so you can easily pick the right titles for your environment and viewers. Buy adventure, comedy, and children's movies to provide pleasant distraction for health-care patients or keep educational, health, and documentary titles close by as learning tools for your staff. Check Ratings Standardized rating info is displayed for most movies, allowing you to quickly find stories suited for your target age group. You can also check the runtime or read descriptions of movies and TV shows to learn more about each story, special features, and extra footage before making your purchase. Enjoy Multiple Media Formats Choose either DVD or Blu-ray formats to match your media player. If you're anticipating a future switch to a Blu-ray player, you can use both video formats with the upgraded device.", "parent_text": "TV | Home Entertainment", "keyword_density": {"movies": "2.9", "tv shows": "3.8"}, "department_id": 13}
{"department_text": "TV | Home Entertainment", "level": 0, "url": "http://www.staples.com/Audio/cat_CG1265", "text": "Audio", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Audio", "parent_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "keyword_count": {"audio": 6}, "description_wc": 223, "description_text": "Find audio devices that improve digital content production and delivery throughout your business. Whether you need crisp, reliable sound for video presentations or options for taking music on the go, Staples carries large-scale and portable sound systems with accurate output from brands such as JVC and Pyle. Develop and play your own digital media with instruments for producing and mixing music and top of the line studio headphones from Beats by Dre . Enjoy Clear Sound and Consistent Playback Ensure your business broadcasts are audible and undistorted with high-quality audio devices made to offer clarity and range without adding noise interference. Integrate sound bars or entertainment system speakers and stereos throughout your business for audio playback from flat-screen TVs, computers, and more. Choose Compact or Portable Devices When size matters, buy audio equipment you can set up and store in small spaces, such as mini stereos, combination stereos, and speaker docks that connect to your MP3 player. With portable options such as MP3 players, headphones, and hand-held radios, you can quickly pack up and go when it's time to switch locations. Create and Manipulate Audio Devoted audiophiles and producers can develop professional-quality media with equipment and accessories for playing music, including turntables, equalizers, and mixers. With production components, you can design custom soundboards for your music studio.", "parent_text": "TV | Home Entertainment", "keyword_density": {"audio": "2.7"}, "department_id": 13}
{"department_text": "TV | Home Entertainment", "level": 0, "url": "http://www.staples.com/TV-Accessories/cat_DP5317", "text": "TV Accessories", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "TV Accessories", "parent_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "keyword_count": {"tv": 6, "tv accessories": 3}, "description_wc": 243, "description_text": "TV accessories improve your broadcast capabilities by enabling features such as 3-D viewing and analog conversion. With tools for enhancing the signal and range of your electronics, you can easily make inexpensive technology upgrades. Keep your A/V equipment in good condition, and purchase the right cable formats and lengths for your business environment from brands like Belkin and Tripp Lite. Cables, Cords, and Splitters Whether you need to broadcast tablet media on big screen televisions or connect two network-ready devices, find universal HDMI cables, speakers cables, and network cables to support your add-on electronics. Extension cords and splitters offer more flexibility when setting up electronics, allowing you to position devices away from the power source. Remote TV Control Simplify TV operation by purchasing universal remotes you can quickly program and use between multiple units. Centralize device controls by choosing remotes that also work with DVD players, video game consoles, and more. Surge Protection With surge protectors, you can organize multiple plugs in one unit without fear of power surges and shortages that reduce productivity. Find protective TV accessories with extended cords and more than ten outlets for tech-heavy rooms, such as computer labs. Digital Conversion A digital antenna can accurately convert an analog signal to the digital format to comply with the moat common broadcast standards. These convenient TV accessories can upgrade older analog models, so you don't have to make a costly transition to digital TVs.", "parent_text": "TV | Home Entertainment", "keyword_density": {"tv": "2.5", "tv accessories": "2.5"}, "department_id": 13}
{"department_text": "Phones | Cameras | Electronics", "level": -1, "url": "http://www.staples.com/GPS-Accessories/cat_DP2202", "text": "GPS Accessories", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "GPS Accessories", "parent_url": "http://www.staples.com/GPS-Accessories/cat_CG59", "keyword_count": {"gps": 7, "gps accessories": 2, "accessories": 3}, "description_wc": 123, "description_text": "Make sure your GPS is ready to go with GPS accessories from top brands like Garmin, Magellan and TomTom. Our GPS parts and navigation accessories feature many cutting edge functions. Browse our selection and check out our research centers for more information. Protect your device : We carry screen protectors and cases in a wide range of colors and styles so your GPS can serve you for years to come. Power while you go : Search our widely compatible adapters and chargers so you can power as you navigate. Reliable setup : Our GPS extras include sturdy mounts that will keep your device and all GPS components in place and ready to use. GPS accessories are essential to an optimal navigation experience. Browse our selection today.", "parent_text": "GPS / Accessories", "keyword_density": {"accessories": "2.4", "gps accessories": "3.3", "gps": "5.7"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 152, "level": -1, "url": "http://www.staples.com/All-GPS/cat_CL163323", "text": "All GPS", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "All GPS", "parent_url": "http://www.staples.com/GPS-Accessories/cat_CG59", "keyword_count": {"gps": 9}, "description_wc": 132, "description_text": "With GPS tracking devices, spend more time at your destination and less time figuring out how to get there. We carry a wide range of portable GPS and car GPS from Garmin, Magellan and TomTom that will meet your needs. For more information, please visit our research centers. Pre-loaded maps : All GPS systems are ready to go right out of the box. Voice recognition : Try a GPS tracking device with voice control for a safe, hands free navigation experience. On the go : Take your portable GPS with you to the deepest canyons or highest mountains with a GPS two-way radio. Precise maps and data : Keep up to date with traffic and construction and avoid time eating snarls. Our GPS products are the best in GPS navigation. Browse our selection today.", "parent_text": "GPS / Accessories", "keyword_density": {"gps": "6.8"}, "department_id": 14}
