{"department_text": "Phones | Cameras | Electronics", "nr_products": 59, "level": -1, "url": "http://www.staples.com/Screen-Cleaners/cat_CL142035", "text": "Screen Cleaners", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Screen Cleaners", "parent_url": "http://www.staples.com/E-Readers-Accessories/cat_DP2258", "keyword_count": {"cleaners": 4, "screen": 7, "screen cleaners": 3}, "description_wc": 127, "description_text": "Keep that screen sharp and easy to read with safe and effective screen cleaner. Browse our wide selection of computer screen cleaners and laptop screen cleaners from Staples, Antec and Dust-Off and get cleaning. For more ideas, please visit our research centers. Remove dust and fingerprints : Try our biodegradable screen wipes for eco-friendly dust and fingerprint removal. All that you need, in one kit : Browse our selection of cleaning kits and find the screen cleaner spray and microfiber wipes cloth you need in one easy to use package. Keep card readers clean : We carry presaturated card cleaners for quick card reading cleaning. Just swipe the card through the reader and you\u2019re ready to go! For the best in screen cleaners, shop our selection today.", "parent_text": "E-Readers / Accessories", "keyword_density": {"cleaners": "3.1", "screen": "5.5", "screen cleaners": "4.7"}, "department_id": 14}
