{"department_text": "Phones | Cameras | Electronics", "nr_products": 33, "level": -1, "url": "http://www.staples.com/Expansion-Telephone-Handsets/cat_CL142391", "text": "Expansion Telephone Handsets", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Expansion Telephone Handsets", "parent_url": "http://www.staples.com/Telephones-Headsets-Cords/cat_CG14", "keyword_count": {"handsets": 2, "expansion": 3}, "description_wc": 124, "description_text": "Make sure everybody is on the conversation with one of our expansion handsets. Search our stock for a simple solution for your office or home. Browse our research centers for more great ideas. Work with what you have : Whether you have one line or multiple lines, our expandable headsets match your capabilities. A range of features : We carry Energy Star expansion headsets with caller ID and speaker phone available. Talk where you like : With a cordless expansion handset, you can stay in the same room with other people who are on the line or spread out amongst several. That\u2019s the freedom of cordless technology. Our expandable handsets are easy to set up and ready to go. Try one today for an expanded experience.", "parent_text": "Telephones / Headsets / Cords", "keyword_density": {"handsets": "1.6", "expansion": "2.4"}, "department_id": 14}
