{"department_text": "TV | Home Entertainment", "nr_products": 15, "level": -1, "url": "http://www.staples.com/Beats-by-Dre-Headphones/cat_CL210844", "text": "Beats by Dre Headphones", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Beats by Dre Headphones", "parent_url": "http://www.staples.com/Audio/cat_CG1265", "keyword_count": {"beats by dre headphones": 2}, "description_wc": 54, "description_text": "Beats by Dre headphones, beatboxes, and portable speakers deliver crisp, clear sound for serious music lovers. Advanced features like battery-powered noise cancellation, digital amplifiers, and rotating ear cups give you professional quality at an affordable price. Choose from both in-ear and over-ear Beats By Dre headphones designs, depending on your preference.", "parent_text": "Audio", "keyword_density": {"beats by dre headphones": "14.8"}, "department_id": 13}
