{"department_text": "PCs | Drives | Accessories", "nr_products": 152, "level": -2, "url": "http://www.staples.com/Hard-Drive-Accessories/cat_CL165255", "text": "Hard Drive Accessories", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Hard Drive Accessories", "parent_url": "http://www.staples.com/Hard-Drive-Accessories/cat_DP4674", "keyword_count": {"hard drive accessories": 2, "hard drive": 4}, "description_wc": 133, "description_text": "Protect or expand your hard drive capacity with hard drive accessories from Staples. Whether you\u2019re backing up your phone contacts or are looking for a faster connection, we\u2019ve got the solution for you. For more ideas on backing up your data, head on over to our research center where you can learn about how you can: Protect your hard drive with a durable nylon case from Case Logic or an impact-resistant rugged case from Western Digital Backup quickly with a USB 3.0 upgrade cable from Seagate, backward compatible with USB 2.0 Access or share your music, photos, movies or other digital files remotely with a Seagate Freeagent GoFlex NetMedia sharing device With hard drive accessories, you can backup and access your data when you want to, how you want to.", "parent_text": "Hard Drive Accessories", "keyword_density": {"hard drive accessories": "4.5", "hard drive": "6.0"}, "department_id": 9}
{"department_text": "TV | Home Entertainment", "nr_products": 4, "level": -1, "url": "http://www.staples.com/3D-Glasses/cat_CL168305", "text": "3D Glasses", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "3D Glasses", "parent_url": "http://www.staples.com/TV-Accessories/cat_DP5317", "keyword_count": {"3d glasses": 2, "3d": 3, "glasses": 8}, "description_wc": 146, "description_text": "Wear 3D glasses and change the way you watch TV forever. These glasses are compatible with a variety of 3D TVs, depending on the brand, and are battery powered for freedom of movement. With ergonomic designs and light weights, these glasses stay comfortable even during extended periods of use. Glasses Compatible Those who already wear glasses can still join in on the action. Specially designed models with temple hooks fit over regular eyeglasses without feeling bulky. Rechargeable 3D glasses powered by rechargeable batteries help you cut down on costs, even when you watch for long periods of time. Consider buying an extra set of batteries, so you can have one in the glasses and one on the charger at all times. Stylish Don't be limited by basic black. Choose a pair with bright blue frames or different colored lenses to showcase your personality and style.", "parent_text": "TV Accessories", "keyword_density": {"3d glasses": "2.7", "glasses": "5.5", "3d": "2.1"}, "department_id": 13}
