{"department_text": "TV | Home Entertainment", "nr_products": 27, "level": -1, "url": "http://www.staples.com/TV-Antennas/cat_CL168253", "text": "TV Antennas", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "TV Antennas", "parent_url": "http://www.staples.com/TV-Accessories/cat_DP5317", "keyword_count": {"tv": 5, "antennas": 4, "tv antennas": 2}, "description_wc": 145, "description_text": "Use TV antennas to get connected to the programs that matter to you. These accessories make it easy to watch broadcast programming, including high-definition shows. Choose from indoor and outdoor models from manufacturers such as Supersonic, Quantum, and Philips. Rotating Antennas Rotating TV antennas move around to capture the best possible signal every time. Models that hook up to multiple televisions at once make it easy to share shows and special events. Digital Systems When high definition is important, choose a digital TV antenna that gives you the best picture possible. These compact systems can also boost your signal to give you more reach. Indoor Antennas An indoor TV antenna can be installed without having to use a ladder or climb up onto the roof. TV accessories can even be installed in an RV or on a boat for mobile access to local programming.", "parent_text": "TV Accessories", "keyword_density": {"tv": "3.4", "antennas": "2.8", "tv antennas": "2.8"}, "department_id": 13}
