{"department_text": "TV | Home Entertainment", "nr_products": 187, "level": -2, "url": "http://www.staples.com/Speaker-Docks/cat_CL163398", "text": "Speaker Docks", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Speaker Docks", "parent_url": "http://www.staples.com/Bluetooth-Speakers-Docks/cat_DP4506", "keyword_count": {"speaker": 1}, "description_wc": 140, "description_text": "Docking stations are the perfect way to enhance and power your mp3 player, iPod, iPad or any other tablet. Search a variety of options from quality brands like Jensen, Memorex, Altec Lansing, Creative Labs and iHome for a mobile docking station that works for you. For more information, please visit our research centers. Multi-function : Your iPod docking station can serve as a charger and a speaker for your personal music library and favorite radio stations. Bluetooth technology : With your charging station, dock your iPhone, iPod, iPad and other mobile devices for seamless remote access. Bring your docking station with you wherever you go : iPod dock stations are highly portable, so you can bring it with you to the office or to that after hours celebration. Shop our docking stations today for greater access to your music wherever you are.", "parent_text": "Bluetooth Speakers / Docks", "keyword_density": {"speaker": "0.7"}, "department_id": 13}
{"department_text": "TV | Home Entertainment", "nr_products": 21, "level": -2, "url": "http://www.staples.com/MP3-Players/cat_CL162859", "text": "MP3 Players", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "MP3 Players", "parent_url": "http://www.staples.com/MP3-Radios-Accessories/cat_DP5251", "keyword_count": {"mp3": 7, "mp3 players": 4}, "description_wc": 131, "description_text": "At Staples, we carry the best mp3 players with a variety of cutting edge technologies. Choose from the best brands, including Sony, Coby and Match Speed Technologies, Inc. for an mp3 player that\u2019s right for you. For more information, please visit our research centers. Easy syncing : Take advantage of easy USB port syncing. Choose your capacity : Store and easily access your music and all of your media with mp3 players ranging in capacity from 2GB to 8GB. Multi-purpose : Use your flash mp3 player as an mp3 music player, voice recorder or flash drive to store or transfer your extra files. Touch screen technology : Sleek touch control on all of our touch screen mp3 players for fast and intuitive browsing. Browse our mp3 players today for better listening and storing.", "parent_text": "MP3 / Radios / Accessories", "keyword_density": {"mp3": "5.3", "mp3 players": "6.1"}, "department_id": 13}
