{"department_text": "PCs | Drives | Accessories", "nr_products": 1, "level": -1, "url": "http://www.staples.com/Printer-Stands/cat_CL141950", "text": "Printer Stands", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Printer Stands", "parent_url": "http://www.staples.com/Computer-Stands-Carts/cat_DP1570", "keyword_count": {"printer stands": 3, "printer": 6}, "description_wc": 105, "description_text": "Open up space on your desk with a printer stand. Our printer stands can accommodate a range of printers, are tested, reliable and ready for easy set up. For more information on this and other space saving solutions, please browse our research centers. Sturdy : Our printer stands are reliable and have a high weight capacity so you\u2019ll be sure to find a solution that works with what you have. Stylish : Chic looks are the norm for our printer stands, which will fit in nicely with your office furniture. Top brands : Allsop, a name you can trust. Free up space with a printer stand today.", "parent_text": "Computer Stands / Carts", "keyword_density": {"printer stands": "5.7", "printer": "5.7"}, "department_id": 9}
