{"department_text": "PCs | Drives | Accessories", "nr_products": 58, "level": -1, "url": "http://www.staples.com/Laptop-Stands-Risers/cat_CL165071", "text": "Laptop Stands/Risers", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Laptop Stands/Risers", "parent_url": "http://www.staples.com/Computer-Stands-Carts/cat_DP1570", "keyword_count": {"risers": 1, "laptop": 12, "stands": 2, "laptop stands": 1}, "description_wc": 151, "description_text": "Work more comfortably from your laptop with a laptop stand. Link a keyboard, mouse and other extras to your laptop for more ergonomic use on your desktop and adjust your laptop like you would your monitor. Our laptop stands and vertical risers offer a range of solutions. For more great ideas, visit our research centers. Adjustable viewing : Stop craning your neck and straining your eyes. Try a laptop arm or notebook riser to adjust your laptop screen for easier viewing. Bring all the extras along : Read, write or copy content from printed texts more easily with copyholder clips that attach directly to your notebook stand or laptop riser stand. Comfortable cooling : Protect your skin with laptop computer stands from Fellowes and 3M that have cushions and cooling vents. Whether you settle on an adjustable laptop stand or a laptop riser, we have a way to make your laptop experience more comfortable.", "parent_text": "Computer Stands / Carts", "keyword_density": {"risers": "0.7", "laptop": "7.9", "stands": "1.3", "laptop stands": "1.3"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 5, "level": -1, "url": "http://www.staples.com/Lap-Desks/cat_CL165070", "text": "Lap Desks", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Lap Desks", "parent_url": "http://www.staples.com/Computer-Stands-Carts/cat_DP1570", "keyword_count": {"lap desks": 1, "lap": 11}, "description_wc": 146, "description_text": "For comfortable, ergonomic laptop use, consider purchasing a lapdesk. Choose from our diverse selection of styles and features for a laptop desk that suits your needs. For more ideas, please visit our research centers. Computer lap desks reduce heat buildup : Anti-slip microbead and wood surfaces protect and conform to your skin while also promoting cooling. Built with ergonomics in mind : Try a lap desk pillow or a bean bag lap desk with a built-in wrist rest and prevent cramping and pain. High quality fabrics : Choose a lapdesk made from furniture-like upholstery for unique and stylish protection while you work in your bed, on the couch or in a chair. Extra storage : Choose a lapdesk from Belkin and Lapdesk with extra side storage compartments and keep your mouse and other accessories nearby. Browse our lapdesk selection today for a better experience with your laptop.", "parent_text": "Computer Stands / Carts", "keyword_density": {"lap desks": "1.4", "lap": "7.5"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "level": -1, "url": "http://www.staples.com/Computer-Cleaners/cat_DP1742", "text": "Computer Cleaners", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Computer Cleaners", "parent_url": "http://www.staples.com/PCs-Laptops-Tablets/cat_CG71", "keyword_count": {"computer": 11}, "description_wc": 142, "description_text": "There\u2019s no better way to keep your computer looking and functioning great than with computer cleaner. We have a variety of effective and economical computer cleaning solutions on hand from top brands like Dust-Off, Falcon, Memorex and Staples. For more information, please visit our research centers. Deal with dust effectively : Browse our selection of computer dusters, wipes, spray, and cloths to safely and effectively remove dust. Cut further down on computer cleaning and laptop cleaning time with dust covers, customized to fit your computer. Targeted cleaning : Pinpoint problem areas with computer vacuum cleaner, featuring a concentrator and anti-flare nozzle. DVD/CD drive maintenance : Cleaning computers just got easier with DVD/CD cleaning kits, complete with wipes and sprays for safe cleaning. Avoid unnecessary computer maintenance by keeping your computer as clean as can be. Browse our computer cleaner today.", "parent_text": "PCs / Laptops / Tablets", "keyword_density": {"computer": "7.7"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 23, "level": -1, "url": "http://www.staples.com/CPU-Stands-Holders/cat_CL141951", "text": "CPU Stands & Holders", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "CPU Stands & Holders", "parent_url": "http://www.staples.com/Computer-Stands-Carts/cat_DP1570", "keyword_count": {"cpu": 11}, "description_wc": 107, "description_text": "Support your CPU and expand your desk space with a CPU stand. We carry CPU carts with a variety of options from brands you trust, including mobile CPU carts from Allsop, Fellowes and Antec. For more information, please visit our research centers. Portable CPU carts : For greater mobility, choose a CPU stand with wheels. Stability : We carry CPU caddies with long wheel bases and locking casters so you can be sure your CPU will stay where you put it. Fully adjustable : Try a CPU caddy for an option that fits almost all CPU sizes. Browse our CPU carts today and find the solution you\u2019re looking for.", "parent_text": "Computer Stands / Carts", "keyword_density": {"cpu": "10.3"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "level": -1, "url": "http://www.staples.com/Tablet-Accessories/cat_DP8301", "text": "Tablet Accessories", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Tablet Accessories", "parent_url": "http://www.staples.com/PCs-Laptops-Tablets/cat_CG71", "keyword_count": {"tablet accessories": 1, "accessories": 2, "tablet": 7}, "description_wc": 154, "description_text": "Tablet accessories protect your tablet and make it easier to use. Stylus pens are available to reduce smudges and fingerprints on the screen, and stands and mounts make it easy to watch movies or video chat with coworkers. Multifunction Apps Turn your tablet into a blood pressure monitor, scale, or baby monitor with app accessories. These devices plug straight into your tablet, so you can read credit cards or keep track of your daily fitness all from the same device. Scratch-Free Screen Protect your tablet from scratches, bumps, and accidental drops. A full array or screen protectors, cases, covers, and sleeves are available so you can choose what you need depending on where and how you use your tablet. High-Quality Sound Speakers and docks let you take your tablet's audio to the next level. Listen to your favorite music in premium sound and tap along to the music as you work.", "parent_text": "PCs / Laptops / Tablets", "keyword_density": {"tablet accessories": "1.3", "accessories": "1.3", "tablet": "4.5"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "level": -1, "url": "http://www.staples.com/Business-Computers/cat_DP8277", "text": "Business Computers", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Business Computers", "parent_url": "http://www.staples.com/PCs-Laptops-Tablets/cat_CG71", "keyword_count": {"business computers": 2, "business": 3}, "description_wc": 147, "description_text": "Business computers offer the latest technology, large memory space, and advanced graphics capability, so you can run your business smoothly and efficiently. Available options include traditional desktops, laptops, and tablets. Whether you need to type a lot of documents or work on graphic design projects, we have the computer that's right for you. Office PCs For traditional office environments, desktops can't be beat. Make your workspace fully functional by adding a wireless printer to your setup. Professional-Quality Monitors Choose from top-notch monitors for your business computers, and filter by the size, resolution, and brand you are looking for. LCD and LED technologies give you bright, clear images every time. On-the-Go Efficiency Tablets and laptops make it easy to take your work with you. Maximize your productivity and take advantage of your morning commute and slow times to work on other tasks.", "parent_text": "PCs / Laptops / Tablets", "keyword_density": {"business computers": "2.7", "business": "2.0"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 3, "level": -1, "url": "http://www.staples.com/Google-Chromebooks/cat_CL167985", "text": "Google Chromebooks", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Google Chromebooks", "parent_url": "http://www.staples.com/PCs-Laptops-Tablets/cat_CG71", "keyword_count": {"google": 4, "chromebooks": 1}, "description_wc": 138, "description_text": "The Google Chromebook is a new and cutting edge computer that will revolutionize how you work and play on the go. Powered by the new Chrome OS, a Google Chromebook has cloud storage, security, and Google's best apps and services built in. Our selection continues to grow but we current offer the best Acer & Samsung Chromebooks as well as exciting models from HP. Priced very attractively and with great software and apps for music and film, work and collaboration and playing games, an HP, Acer or Samsung Google Chromebook is the perfect gift for your favorite tech enthusiast or the perfect upgrade for someone who relies on accomplishing a lot while on the move. And of course, Staples has a huge assortment of laptops and tablets if you want a more traditional or purer mobile computing option.", "parent_text": "PCs / Laptops / Tablets", "keyword_density": {"google": "2.9", "chromebooks": "0.7"}, "department_id": 9}
