{"department_text": "PCs | Drives | Accessories", "nr_products": 7, "level": -2, "url": "http://www.staples.com/Computer-Vacuum-Cleaners/cat_CL141480", "text": "Computer Vacuum Cleaners", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Computer Vacuum Cleaners", "parent_url": "http://www.staples.com/Computer-Cleaners/cat_DP1742", "keyword_count": {"computer": 6, "computer vacuum": 4, "vacuum": 8}, "description_wc": 120, "description_text": "Shop our selection of computer vacuums for the most concentrated clean. We carry all of the computer vacuum cleaner accessories you need to keep your product working right. For more information, please visit our research centers. Versatility : Try one of our electric dusters with dual vacuum or blower action, for in the moment versatility. Pair your PC vacuum cleaner with a computer duster and target different problem areas. Supplement your computer vacuum cleaner : We carry all the replacement bags and filters you need. Eco-friendly cleaning : Our selection of computer vacuums are made from recycled materials, so you can clean green. Top brands : Metro Data-Vac and Metropolitan Vacuum. Vacuum your computer with ease. Browse our selection of supplies today.", "parent_text": "Computer Cleaners", "keyword_density": {"vacuum": "6.7", "computer": "5.0", "computer vacuum": "6.7"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 82, "level": -2, "url": "http://www.staples.com/Stylus-Pens/cat_CL166408", "text": "Stylus Pens", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Stylus Pens", "parent_url": "http://www.staples.com/Tablet-Accessories/cat_DP8301", "keyword_count": {"stylus": 5, "stylus pens": 2, "pens": 5}, "description_wc": 178, "description_text": "Stylus pens let your write, draw, and navigate your tablet or other touchscreen devices quickly and easily. The soft, durable tips keep your screen clear of fingerprints and scratches from regular pens, and the comfortable barrels keep your hands from getting tired even during long periods of use. These pens come in a variety of colors and materials so you can show off a little style as you work. One Stylus, Many Devices Universal stylus pens can be used on just about anything that has a touchscreen. Smooth silicone rubber tips make it easy to transition from your tablet to your smartphone without switching implements. Double Duty Pen Pare down your writing instruments and lighten your briefcase with styluses that can do double duty as functional pens. Switch from drawing on your tablet to writing in your notebook with the by just flipping the barrel. Loss Prevention Clip-style caps and included straps help you keep track of your stylus. Attach your favorite one right to your briefcase or purse so you always have it at the ready.", "parent_text": "Tablet Accessories", "keyword_density": {"stylus": "2.8", "stylus pens": "2.2", "pens": "2.8"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 27, "level": -2, "url": "http://www.staples.com/Business-Tablets/cat_CL205281", "text": "Business Tablets", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Business Tablets", "parent_url": "http://www.staples.com/Business-Computers/cat_DP8277", "keyword_count": {"business tablets": 1, "tablets": 3, "business": 2}, "description_wc": 166, "description_text": "Business tablets are designed to be carried with you without the bulk of a laptop. Integrated security features like fingerprint recognition and security chips mean your business information stays protected. Convertible tablets give you the added flexibility of a traditional keyboard when you need to send important emails or type out meeting minutes. Bluetooth Compatible Bluetooth capabilities make it easy to integrate your tablet with the rest of your devices. Wi-Fi and 3G models are available, so you can work wherever you need. Choose Your Operating System We carry tablets with both Windows and Android operating systems, so you can choose your favorite or keep all of your devices on the same system, making it easy to switch between your work desktop, personal laptop, and tablet. Extended Battery Life Your tablet needs to be able to go wherever you do. Batteries that last more than 8.5 hours let you throw your tablet in your bag and know it will be ready when you need it.", "parent_text": "Business Computers", "keyword_density": {"business tablets": "1.2", "tablets": "1.8", "business": "1.2"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 243, "level": -2, "url": "http://www.staples.com/Business-Desktop-Computers/cat_CL205151", "text": "Business Desktop Computers", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Business Desktop Computers", "parent_url": "http://www.staples.com/Business-Computers/cat_DP8277", "keyword_count": {"computers": 4, "business desktop computers": 2, "business": 4, "desktop": 3}, "description_wc": 163, "description_text": "Today's business desktop computers are smaller and more power-efficient than earlier models, giving you a traditional office computer without taking up as much space. Whether you need multiple CD-ROM/DVD drives, superior sound quality, or the fastest processor, these computers are built to help you manage all of your business tasks. Our catalog includes options from the top PC manufacturers, so you can shop with confidence. Power-Saving Features Eco-friendly business computers can use up to 80 percent less power than regular desktops. ENERGY STAR rated options help you reduce your office power bill. Scale It Down Mini PCs are up to 90 percent smaller than regular business desktop computers. Many of these models can also be attached right to your existing monitor. One-Stop Buying All-in-one PCs combine the computer tower and monitor in one streamlined device. This reduces the number of cords you have to deal with and gives you more room at your desk.", "parent_text": "Business Computers", "keyword_density": {"computers": "2.5", "business": "2.5", "business desktop computers": "3.7", "desktop": "1.8"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 174, "level": -2, "url": "http://www.staples.com/Business-Laptop-Computers/cat_CL205279", "text": "Business Laptop Computers", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Business Laptop Computers", "parent_url": "http://www.staples.com/Business-Computers/cat_DP8277", "keyword_count": {"computers": 4, "business laptop computers": 2, "business": 3}, "description_wc": 213, "description_text": "Business laptop computers from top brands like Asus, HP, and Lenovo give you the power and speed you need to complete your tasks and still have time for a round of golf. Intuitive operating systems, fast processors, and convenient portable sizes make for top-performing machines. These sleek models let you show off your style while staying professional enough for the next board meeting. Room for All of Your Programs Business laptop computers have enough hard drive space and RAM to store all of your business programs and applications and keep them running smoothly. Models come preinstalled with Windows 7 or Windows 8, so you choose the one that works for you. Premium Sound and Image Quality If your job involves graphic design, making videos, or taking part in webinars and video conferences, sound and image quality is vital. These computers are built with powerful integrated speakers and graphics cards that give you clear, crisp sound and high-definition pictures. Multitouch Functions Computers with touchscreens give you more freedom to use your device the way you want. Switch apps and send emails with a flick of your wrist or use the traditional keyboard to create policy manuals and update your resume. Plug a regular mouse into the USB slot for even more options.", "parent_text": "Business Computers", "keyword_density": {"computers": "1.9", "business laptop computers": "2.8", "business": "1.4"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 139, "level": -2, "url": "http://www.staples.com/Servers/cat_CL207763", "text": "Servers", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Servers", "parent_url": "http://www.staples.com/Business-Computers/cat_DP8277", "keyword_count": {"servers": 3}, "description_wc": 134, "description_text": "Servers keep your network running smoothly. Green compliance certificates and manufacturer's warranties give you added assurance as you make your purchase, and you can choose from trusted manufacturers like HP, Lenovo, and IBM. Have Enough Hard Drive Store your files and have enough room for all your programs and applications. Servers with large hard drive capacities ensure you have what you need to get the job done. Expand Your Options Multiple expansion bays and slots mean your server is ready for whatever you need, giving you the freedom you want if your business's needs increase or decrease. Stay Flexible Look for servers with CD-ROM if you will need to install additional software. Most models are compatible with more than one operating system, so they're ready to go with your computer.", "parent_text": "Business Computers", "keyword_density": {"servers": "2.2"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 17, "level": -2, "url": "http://www.staples.com/App-Accessories/cat_CL166409", "text": "App Accessories", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "App Accessories", "parent_url": "http://www.staples.com/Tablet-Accessories/cat_DP8301", "keyword_count": {"app": 4, "app accessories": 2}, "description_wc": 147, "description_text": "App accessories transform your tablet, smartphone, or other compatible electronic device into a whole new machine. Plug-and-play technology makes these products easy to use right out of the box, and many come with social media capabilities, helping you stay connected. Stay Healthy Monitor your sleep habits, weight, blood pressure, and fitness activities with health-inspired apps. Save all of your measurements to your device, so you have your stats on hand at your next doctor's appointment. Write Freely Always be ready to jot down notes on real paper with notepads designed specifically for the most popular tablets. Microperforated pages make it easy to tear out your sketches or writing when you're done. Get Paid Turn your tablet into a point-of-sale device with credit card reader app accessories. Accept payments from major credit cards, PayPal, and even checks with these handy devices.", "parent_text": "Tablet Accessories", "keyword_density": {"app": "2.7", "app accessories": "2.7"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 90, "level": -2, "url": "http://www.staples.com/Business-Computer-Monitor-Displays/cat_CL205280", "text": "Business Computer Monitor Displays", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Business Computer Monitor Displays", "parent_url": "http://www.staples.com/Business-Computers/cat_DP8277", "keyword_count": {"monitor": 7, "business computer monitor displays": 2}, "description_wc": 164, "description_text": "Business computer monitor displays give you crystal-clear images in stunning color, so you can make sure your presentations and videos look just right. Cutting edge LCD and LED technology keeps your photos from appearing pixelated, and a range of screen sizes, from 8 inches to 47 inches, lets your pick the monitor that's best for your office. Smart Technology The latest business computer monitor displays can automatically adjust your screen's backlighting, giving you high-contrast images and graphics. HDMI ports give you even more options, transforming your monitor a multifunction piece of office equipment. 3-D Experience Monitors that are 3-D ready let you bring your pictures to life, making it seem like they are jumping off of the screen. Upgrade your desktop instantly when you hook up one of these monitors. Widescreen Display Watch presentations and stream movies the way they were meant to be seen with widescreen monitors. Fast response times ensure smooth playback without worrying about lags.", "parent_text": "Business Computers", "keyword_density": {"monitor": "4.3", "business computer monitor displays": "4.9"}, "department_id": 9}
