{"department_text": "PCs | Drives | Accessories", "nr_products": 24, "level": -2, "url": "http://www.staples.com/Air-Dusters/cat_CL142034", "text": "Air Dusters", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Air Dusters", "parent_url": "http://www.staples.com/Computer-Cleaners/cat_DP1742", "keyword_count": {"air dusters": 4}, "description_wc": 130, "description_text": "Shop our selection of air dusters for a highly targeted method for removing dust from the most sensitive areas of your computer and gaming equipment. We offer a variety of safe, tested and effective air dusters and duster spray. For more information, please visit our research centers. Get that dust off : Try spray duster for reliable cleaning of keyboards, CPUs and laptops. Bundled solution : Combo packs come with both computer duster wipes and cleaning duster so you will always have the right product for every part of your computer. Different air dusters for different needs : For a solution specially formulated for gaming gear, try Dust-Off Gaming Gear Duster in a convenient disposable can. More great solutions from Memorex and Staples. Get that dust off with air dusters from Staples.", "parent_text": "Computer Cleaners", "keyword_density": {"air dusters": "6.2"}, "department_id": 9}
