{"department_text": "PCs | Drives | Accessories", "nr_products": 8, "level": -1, "url": "http://www.staples.com/Ultrabooks/cat_CL166724", "text": "Ultrabooks", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Ultrabooks", "parent_url": "http://www.staples.com/PCs-Laptops-Tablets/cat_CG71", "keyword_count": {"ultrabooks": 4}, "description_wc": 157, "description_text": "Ultrabooks combine the convenient size of a netbook or small laptop with the full power and functionality of a premium computer. Sizes ranges from 11.6 inches to 15.6 inches, ensuring you can easily fit your ultrabook in your backpack or briefcase. Choose from top brands including Acer, Asus, and Toshiba. Fully Functional Ultrabooks have comparable hard drive and RAM capacities as traditional laptops. They have the graphics capabilities to run video games, come preinstalled with the most current Windows OS, and can be used seamlessly with your Wi-Fi printer. Touchscreen Technology Ultrabooks with touchscreen capabilities give the latest technology in a convenient, portable package. Browse the Internet and organize your files with a swipe of your finger. Long Battery Life These computers feature unibody chassis that can accommodate larger batteries without adding extra bulk to the ultrabooks design. Charge it up and take it on the road to school, to work, or on your next adventure.", "parent_text": "PCs / Laptops / Tablets", "keyword_density": {"ultrabooks": "2.5"}, "department_id": 9}
