{"department_text": "PCs | Drives | Accessories", "nr_products": 50, "level": -1, "url": "http://www.staples.com/Tablets/cat_CL204449", "text": "Tablets", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Tablets", "parent_url": "http://www.staples.com/PCs-Laptops-Tablets/cat_CG71", "keyword_count": {"tablets": 3}, "description_wc": 263, "description_text": "Staples has all the best tablets to meet your needs from brands like Samsung, Asus, Google, Microsoft, Acer, Lenovo and more. Want a great new standard or the best convertible tablet PC, or just looking for something top of the line or at the best price? We've got them all! Browse our great selection of Android-powered models from the big brands and peruse their comprehensive features and specs to find the best fit for you. Whether you need to catch up on email, read books, watch movies, or surf the web - Staples has the best tablets to suit your needs. Most models have cameras so you can easily take pictures or video chat with ease, so you\u2019ll never be out of touch with your friends and family. Many also feature extensive battery life so you can be sure that no matter how much you want to work or play, you\u2019ll have the power to get the job done. With the top Acer, Asus & Samsung tablets , you can ensure you get what you want and not pay extra for what you don't. Staples also carries a large selection of tablet accessories such as iPad cases & covers in addition to top accessories for many other models. This includes all types of cases and covers, screen protectors and stylus pens and screen protectors in a variety of styles and colors, all designed to protect your favorite new devices. So whatever brand or model you choose, you are sure to find the right accessories that will protect and preserve your tablet.", "parent_text": "PCs / Laptops / Tablets", "keyword_density": {"tablets": "1.1"}, "department_id": 9}
