{"department_text": "PCs | Drives | Accessories", "nr_products": 18, "level": -1, "url": "http://www.staples.com/Touchscreen-Laptops-Computers/cat_CL168350", "text": "Touchscreen Computers", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Touchscreen Computers", "parent_url": "http://www.staples.com/PCs-Laptops-Tablets/cat_CG71", "keyword_count": {"touchscreen": 2, "computers": 2, "touchscreen computers": 1}, "description_wc": 224, "description_text": "Touch screen laptops & computers put you in the driver's seat when it comes to controlling your device. These models are designed to go with you on your business travels, so you can keep productivity high. Our touch screen laptops are also compatible with Windows 8, so you can enjoy the latest technology in both software and hardware. Choose from a variety of color options, including black, gray, and silver, for a sleek, modern look. The Latest Technology Control your touch screen computer with a flick of your wrist and the touch of your finger. Use these multifunction touchscreens to take control of your computer applications and give your typing fingers a rest. Large Memory When you need to store movies, pictures, or large quantities of other data, you need a computer with enough memory to handle the job. Choose from touch screen laptop / computer models with RAM ranging from 2 GB to 9 GB. Fast Processors Touchscreen computers feature Intel Core and AMD technologies. These lightning-fast processors let you download files, edit documents, and send images to your printer quickly. Get a touch screen laptop or computer today and upgrade your work, play, or gaming station to the latest and greatest, or if you are interested in a great touch screen tablet, check out the newest models of the Microsoft Surface .", "parent_text": "PCs / Laptops / Tablets", "keyword_density": {"touchscreen": "0.9", "computers": "0.9", "touchscreen computers": "0.9"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 135, "level": -1, "url": "http://www.staples.com/Laptops/cat_CL167289", "text": "Laptops", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Laptops", "parent_url": "http://www.staples.com/PCs-Laptops-Tablets/cat_CG71", "keyword_count": {"laptops": 3}, "description_wc": 214, "description_text": "The best laptops deals from HP and other brands like Dell, Toshiba and Acer are easy to find at Staples because of our great selection. We have an impressive variety of Netbooks and Ultrabooks, plus touch screen & gaming models. Our amazing new laptop computers will save you money and we offer the lowest prices on refurbished models as well. Consider the following when browsing our expanded selection: Full-Featured to Light and Simple \u2013 Whether you need 12GB of memory or rely on cloud storage and small hard drive capacity, Staples has the top product selection from which to choose. Brands you Trust \u2013 Get the latest models from your favorite brands like HP, Toshiba, Acer, ASUS, Lenovo Dell Laptops and more. The best new laptop computer deals, with Windows 8 if desired, are at your fingertips. Operating System \u2013 Load up and get going for business with Microsoft Professional, Windows 8 or Home Premium and enjoy every advantage provided by the finest in home productivity and entertainment. Whether you want small / mini laptops or Windows 8 or gaming is the hobby driving your purchase, at Staples, we offer the ultimate assortment with all the important features you need. We have over 140 of the fastest, sleekest, most powerful models available, and our selection is always growing.", "parent_text": "PCs / Laptops / Tablets", "keyword_density": {"laptops": "1.4"}, "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 113, "level": -1, "url": "http://www.staples.com/Solid-State-Drives-SSD/cat_CL163882", "text": "Solid State Drives (SSD)", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Solid State Drives (SSD)", "parent_url": "http://www.staples.com/Drives-Memory-Storage/cat_CG104", "keyword_count": {"solid state": 14, "solid state drives": 13, "drives": 17, "ssd": 9, "solid state drives ssd": 1}, "description_wc": 1010, "description_text": "Staples offers a large selection of Solid State Drives (SSD), backed by our price match guarantee, including internal solid state drives from Samsung, Crucial and OCZ to ensure we carry the right solution for you. Customers often ask\u00a0the question, what is an SSD drive? Below is a brief overview of the overall benefits of solid state drives\u00a0and some distinctive features to consider when making your purchase. BENEFITS Speed Is Key: Solid state drives\u00a0are significantly faster and access data at greater speeds than traditional hard drives . When time is important, this means less waiting for everything from booting up your computer to transferring files. Less Power Means Longer Battery Life: Solid state drives\u00a0do not require very much power to operate, and it is substantially less than a traditional hard drive. You\u2019ll save on your monthly electric bill, but most importantly you will\u00a0extend the battery life of your laptop \u2013 great news for all road warriors. Light As A Feather: Solid state drives\u00a0utilize flash based memory to operate, similar to what you might find in a USB thumb drive. Installing an SSD in your laptop reduces the overall weight significantly, saving much need energy for that next great presentation. Durability & Reliability: Solid state drives\u00a0have no moving mechanical parts, unlike standard hard disk drives, that have spinning platters. If you are a little rough with your laptop in the security line, or have kids, you will appreciate\u00a0vibration and shock resistance features. Solid state drives are built to last, and most importantly to keep your data safe and sound. FEATURES Interface: Solid state drives\u00a0are manufactured with several different types of interfaces. The interface required is dependent primarily on your computer system and your needs. The most common form of interface is SATA (Serial ATA), and is the standard for most consumer desktop computers and laptops . There are currently two versions of SATA today in the market. SATA III (6 Gb/s) and SATA II (3 Gb/s). SATA II (3 Gb/s) is a second generation SATA interface supporting a bandwidth throughput of 300MB/s. SATA III (6 Gb/s) is the third and latest generation of the SATA interface supporting a bandwidth throughput of 600MB/s. SATA III (6 Gb/s) is also backwards compatible with the SATA II (3 Gb/s) interface, and should be the primary choice for most consumer due to improved throughput and compatibility. Speed: Speed is an important consideration factor when making your purchase, especially if you want to maximize the benefits of your new SSD drive. Speed can be summarized through for key specifications, random read (4KB Random Read), random write (4KB Random Write), sequential read (Max Sequential Read) and sequential write (Max Sequential Write). Random read and write specifications generally indicate data access speeds for small files, the higher the number, the greater the speed. Sequential read and write specifications generally indicate sustained data access speeds for large files. If you primarily work with large files, you will want to favor higher sequential speeds over random speeds. If you rarely work with large files, you should favor higher random speeds over sequential speeds. Understanding this, you will also want to ask yourself whether you are primarily reading and opening files or are you frequently creating, copying and moving files. Capacity: Offered in a variety of storage capacities, solid state drives are typically smaller than traditional hard drives and intended to support higher data access speeds when working with your operating system (OS) and resident programs or applications. Unlike external hard drives , an SSD is not intended to provide large amounts of storage for backing up or archiving files. When deciding on an appropriate storage capacity needs, it is important to consider the requirements of your operating system (e.g. Windows, Mac OS, Linux) in addition to any programs or applications you want to use (e.g. Microsoft Word, Adobe Photoshop). You should factor in not only your storage capacity needs for today, but also in the future. The most popular capacity in the market today is 120GB and 128GB models, which is sufficient for most consumers and their needs. Form Factor: Solid state drives are manufactured in several different form factors, 2.5\u201d, 3.5\u201d and mSATA. The most common form factor is 2.5\u201d, which is a standard format for most laptops that offer a 2.5\u201d housing for a hard drive. The\u00a02.5\u201d form factor is also compatible with desktop computers, utilizing simple brackets that allow the 2.5\u201d SSD drive to be mounted into 3.5\u201d desktop hard drive housing. Many manufacturers offer included\u00a0upgrade kits where the brackets are provided with the drive. The\u00a03.5\u201d form factor\u00a0is\u00a0intended to be used primarily in desktops, and are not compatible with standard internal laptop installations. mSATA is a fairly new form factor. Compact laptops and ultrabooks, frequently utilize the mSATA form factor. Some laptops also include a traditional 2.5\u201d hard drive slot, with an optional mSATA slot. In this scenario, customers utilize the mSATA SSD as a boot drive, and utilize the additional 2.5\u201d hard drive slot for additional storage with the benefit of enhanced data access rates that a solid state drive provides. Upgrade Kits: Some SSD manufacturers offer solid state drives with included upgrade kits. Upgrade kits help simplify the process of upgrading your desktop or laptop computers hard drive by transferring existing data onto your new drive. This is typically done with an included cable and cloning software. Some manufacturers even include an external enclosure to allow you to continue to utilize your old hard drive in the future as an external hard drive, either for archiving purposes or additional storage. The best solid state drives available today are the Samsung 840 series and the Crucial M4 series. Whatever SSD you choose, you can shop with confidence from brands you can trust including Samsung, OCZ, Crucial, Kingston, Intel, SanDisk, Patriot and\u00a0Corsair. These brands offer the best value and are quality tested for reliable and optimal performance.", "parent_text": "Hard Drives", "keyword_density": {"solid state": "2.8", "solid state drives ssd": "0.4", "drives": "1.7", "ssd": "0.9", "solid state drives": "3.9"}, "department_id": 9}
{"nr_products": 130, "level": -1, "url": "http://www.staples.com/Computers/cat_CL167288", "text": "Computers", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_wc": 0, "parent_url": "http://www.staples.com/PCs-Laptops-Tablets/cat_CG71", "parent_text": "PCs / Laptops / Tablets", "department_text": "PCs | Drives | Accessories", "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 311, "level": -1, "url": "http://www.staples.com/Hard-Drives/cat_CL160403", "text": "External Hard Drives", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "External Hard Drives", "parent_url": "http://www.staples.com/Drives-Memory-Storage/cat_CG104", "keyword_count": {"hard": 36, "hard drives": 21, "external hard": 25, "external hard drives": 15, "drives": 25, "external": 31}, "description_wc": 1192, "description_text": "Staples offers a large selection of external hard drives at guaranteed low prices, including portable hard drives and desktop hard drives, from Western Digital, Seagate, Toshiba, G-Tech, Lacie, ioSafe and more. To help you determine which product\u00a0to purchase, below is brief overview of the overall benefits and some distinctive features for consideration to ensure you select the best external hard drive for your needs. Benefits Expanded Storage Capacity: External hard drives provide a convenient and easy way to instantly add large amounts of storage capacity to store your data. As we continue to capture, store and share digital media such as music, photos and videos, data storage capacity requirements continue to grow. When reaching your existing data storage capacity limits, you can simply add an additional external hard drive or upgrade to a higher capacity, making external hard drives ideal for ongoing storage needs. Single drive capacities continue to grow. Staples now offers capacities up to 4TB on single drive external desktop hard drives and up to 2TB on single drive external portable hard drives. Data Protection & Backup: Our data often represents irreplaceable and priceless ideas, information and life\u2019s precious moments we want to hold on to forever. Every physical hard drive is susceptible to potential hardware failure, in addition to software based threats posed by viruses and operating system crashes. External hard drives provide an ideal solution for protecting and backing up your data, as they provide a secondary physical hard drive on which to store copies of your data. Many external hard drives also provide software that allows a user to establish password protected encryption in addition to allowing configurable fully automated backups of your system and files. Portability & Mobility: Sometimes you need to take your data with you to share your latest business presentation or enjoy videos of the latest family vacation. External hard drives offer much larger capacities than USB flash drives, so you don\u2019t have to worry about transferring or copying the data you want to take with you. Though all external hard drives can be considered portable, portable external hard drives provide the most convenience as they are offered a more compact physical size and do not require the use of a separate power adapter for operation. Features Capacity: Storage capacity is probably the most important consideration when purchasing hard drives. It is recommended that you purchase the highest capacity external hard drive that you can afford to ensure you have adequate space for your needs not only today, but also in the future. At a minimum, you should ensure you external hard drive storage capacity is greater than the total capacity of your current computer. This will allow you to effectively backup your entire system to your external hard drive. If you plan on backing up multiple computers, you will also need to factor in space requirements for those devices into your required total storage capacity needs for your external hard drive as well. As a final consideration, you should determine whether or not you intend to use your external hard drive to store data you wish to access on a regular basis. Many backup applications save data in a format that does not allow access to individual files External Interface: The interface of the external hard drive you need will depend on how you intended to use your device, the data transfer speeds that you desire and compatibility with your computing device. The most common interfaces available in the market today are USB, FireWire and the newly emerging Thunderbolt interface. USB 3.0 is the latest generation of the USB standard and is backward compatible with USB 2.0 and USB 1.0 interfaces. USB ports are widely available on both PC and Mac based computing hardware. USB 3.0 supports data transfer rates up to 5 Gb/s, while USB 2.0 support rates up to 480 Mb/s. FireWire 800 is the lastest generation of the FireWire standard and is backward compatible with FireWire 400. FireWire ports are typically found on Mac based computers. You can also daisy chain devices, extending cables from one peripheral to the next. FireWire 800 supports data transfer rates up to 800 Mb/s, while FireWire 400 supports up to 400 Mb/s. Thunderbolt represents the latest generation data transfer interface for external peripherals on the market. Thunderbolt parts are widely available on the latest generation Mac laptops and desktops. PC manufacturers have also begun to adopt the thunderbolt standard, and ports are now widely available on most of the latest generation PC desktops and laptops . Thunderbolt is capable of support data transfer rates up to 10 Gb/s, and like FireWire supports daisy chaining multiple external peripherals. Most users will want to choose between USB 3.0 and Thunderbolt interfaces, depending on compatibility with your computer. Form Factor: External hard drives are offered in several different form factors, portable, desktop and RAID arrays. Portable external hard drives come in the most compact physical size and are ideal for laptop based users or users who plan to frequently use data on the go. They also provide a unique feature of being powered over the same cable that supports data transfer, so no additional power adapter is required. Desktop external hard drives are often larger in terms of physical size, though they provide much larger storage capacities than their portable counterparts. Since they require the use of power adapter in addition to the data transfer cable, desktop external hard drives are ideal for large capacity needs where mobility is not as important. Finally, external hard drives are offered in RAID arrays, which mean they provide additional bays for supporting multiple hard drives. RAID arrays can be configured to span storage capacities across multiple physical drives or can be configured to mirror data across multiple physical drives providing an ideal solution for backups in the event of a drive failure. Software: Basic entry level drives such as WD Elements, Seagate Expansion or Toshiba Basics do not offer any included software that provide features such as automated backup and password based security encryption. This is important to many users, so you should consider purchasing an external hard drive that includes automatic backup software. Provided software is typically very intuitive and helps to simplify the process of backing up or protecting sensitive data. Wireless Access: There are a few external hard drives available on the market today that provide wireless of WiFi access to your data stored on the drive. These devices are also compatible with mobile devices such as tablets and smartphones, and they offer feature rich applications for accessing, transfer or streaming data over one or multiple devices. The best external hard drives on the market today include the WD My Passport, WD My Book and Seagate Backup Plus. Whichever external hard drive you decide to purchase, you can shop with confidence knowing Staples offers a price match guarantee and offers only the best brands available. And if you're looking for a hard drive that fits in the palm of your hand and doesn't require an external power source, enjoy a fun and portable USB Flash Drive .", "parent_text": "Hard Drives", "keyword_density": {"external hard drives": "3.8", "hard drives": "3.5", "external hard": "4.2", "hard": "3.0", "drives": "2.1", "external": "2.6"}, "department_id": 9}
{"department_text": "Phones | Cameras | Electronics", "level": -1, "url": "http://www.staples.com/Camera-Camcorder-Accessories/cat_DP1599", "text": "Camera & Camcorder Accessories", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Camera & Camcorder Accessories", "parent_url": "http://www.staples.com/Cameras-Camcorders-Accessories/cat_CG43", "keyword_count": {"camera": 7, "camcorder accessories": 3}, "description_wc": 199, "description_text": "Camera and camcorder accessories from brands like Bower, Rokinon, and SanDisk improve the functionality of your device. Augment the existing image, storage, and use of your camera with add-on components, charging kits, and file-transfer devices. Protective gear allows you to preserve the lifespan of your investment. Add New Functionality Make sure you get the perfect shot with alternate camera lenses for shooting at a wide angle or zooming in, as well as filters that reduce the effects of UV light on the image. You can also attach your camera to a tripod for level shots and to easily adjust angles. With the right camera and camcorder accessories, your device can be adapted to various environments. On-the-Go Maintenance Traveling with your camera is safe when you have the right protective cases and bags for storage. Many products are fitted with extra compartments for holding essential camera and camcorder accessories, such as rechargeable batteries and charging kits. Expand Memory Storage Instantly upgrade your storage capacity with memory cards that can hold hundreds or thousands of photo files. Use a universal reader to transfer files to your computer before uploading them to your preferred photo editing software .", "parent_text": "Cameras / Camcorders / Accessories", "keyword_density": {"camera": "3.5", "camcorder accessories": "3.0"}, "department_id": 14}
