{"department_text": "Phones | Cameras | Electronics", "nr_products": 5, "level": -1, "url": "http://www.staples.com/Digital-Frames/cat_CL163473", "text": "Digital Frames", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Digital Frames", "parent_url": "http://www.staples.com/Cameras-Camcorders-Accessories/cat_CG43", "keyword_count": {"frames": 2, "digital frames": 1, "digital": 2}, "description_wc": 65, "description_text": "Gone are the days when you had to wait for your photos to come back from the developer in order to display them. With digital frames, view your photos instantly and in crystal clear colors. Show off full albums without having to choose a favorite print. Digital picture frames will save you money and give you full access to your special memories at any time.", "parent_text": "Cameras / Camcorders / Accessories", "keyword_density": {"frames": "3.1", "digital frames": "3.1", "digital": "3.1"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 145, "level": -1, "url": "http://www.staples.com/Digital-Cameras/cat_CL140465", "text": "Digital Cameras", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Digital Cameras", "parent_url": "http://www.staples.com/Cameras-Camcorders-Accessories/cat_CG43", "keyword_count": {"digital cameras": 1, "cameras": 7}, "description_wc": 169, "description_text": "Modern digital cameras make taking great-looking photos simple. Whether you're recording an important life milestone or taking casual shots at the company picnic, the right camera can make capturing great images or video much easier. Choose from pocket-sized cameras for when you're on the go or more complex models to get more artistic control. Long-Range Zoom Use a camera with a long-range zoom to get up-close shots while remaining unobtrusive. For even more control over your shots, choose a high-performance DSLR camera . Compact Models Compact and point-and-shoot cameras are small enough to take anywhere. These conventional film cameras are ideal for on-site shooting, and you can leave them in your car, so you always have a camera handy. Instant Film Cameras Instant cameras use film to produce prints on the spot, so there's no waiting. Disposable cameras make it easy to get candid shots because you can hand them out at events and let everyone participate.", "parent_text": "Cameras / Camcorders / Accessories", "keyword_density": {"digital cameras": "1.2", "cameras": "4.2"}, "department_id": 14}
