{"department_text": "Phones | Cameras | Electronics", "nr_products": 51, "level": -1, "url": "http://www.staples.com/Digital-SLR-Cameras/cat_CL167969", "text": "Digital SLR Cameras", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Digital SLR Cameras", "parent_url": "http://www.staples.com/Cameras-Camcorders-Accessories/cat_CG43", "keyword_count": {"cameras": 4, "digital slr cameras": 2, "digital slr": 4}, "description_wc": 140, "description_text": "Digital SLR cameras are ideal for those who love to take high-quality photos. These cameras have detachable lenses that can be changed and upgraded, so you can use the right one for the shot. From Canon to Nikon, there are plenty of choices available when it comes to your entry-level, intermediate, or professional photography needs. High-Quality Images Digital SLR cameras generally produce higher quality images than normal point-and-shoot cameras, and you can switch lenses , add filters, or select a file format to increase the potential of your photos. The pictures in your printed ads, brochures, or other material can really shine when taken with a digital SLR. Learning Curve A digital SLR's auto functions make it a breeze to use, but you can also use manual settings for more control over the image.", "parent_text": "Cameras / Camcorders / Accessories", "keyword_density": {"cameras": "2.9", "digital slr": "5.8", "digital slr cameras": "4.3"}, "department_id": 14}
