{"department_text": "Phones | Cameras | Electronics", "nr_products": 24, "level": -1, "url": "http://www.staples.com/Camcorders/cat_CL142823", "text": "Camcorders", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Camcorders", "parent_url": "http://www.staples.com/Cameras-Camcorders-Accessories/cat_CG43", "keyword_count": {"camcorders": 5}, "description_wc": 208, "description_text": "Keep reliable camcorders on-site to record and broadcast business events, film commercials and tutorials, or capture footage outdoors. High-definition recording produces detailed and crisp resolution for professional-quality videos. Decide what features you need for your business, such as enhanced zoom functionality or built-in editing software, and choose from brands like Polaroid and Samsung. High-Definition Video Whether your videos are for internal purposes or public viewing, HD camcorders boast high image resolutions for clear and accurate rendering of the smallest details. Some camcorders offer additional quality-control features, such as smart detection settings that automatically adjust to the subject and environment you're filming. Filming Made Simple Choose the best features to streamline your filming experience, including viewing screens for on-the-go video playback. Choose camcorders with memory card storage and plug-and-play capabilities for quick file transfers. Opt for wide-angle or long-zoom models when you regularly record footage of extended landscapes or far-off scenes. Weather-Resistance For professionals who work outdoors or require action footage, wearable camcorders can be mounted in convenient locations, such as helmets and bike handlebars. These cameras will be able to withstand the elements and video quality won't be affected by constant movement.", "parent_text": "Cameras / Camcorders / Accessories", "keyword_density": {"camcorders": "2.4"}, "department_id": 14}
