{"department_text": "Phones | Cameras | Electronics", "nr_products": 89, "level": -2, "url": "http://www.staples.com/Tripods-Accessories/cat_CL141716", "text": "Tripods & Miscellaneous Accessories", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Tripods & Miscellaneous Accessories", "parent_url": "http://www.staples.com/Camera-Camcorder-Accessories/cat_DP1599", "keyword_count": {"tripods": 6, "accessories": 4, "miscellaneous accessories": 3}, "description_wc": 238, "description_text": "Use tripods and miscellaneous accessories on the job to produce detailed and focused images. Whether you're a professional or novice photographer, Staples offers enhancement tools for your lenses, printouts, batteries, and more. Choose high-quality calibration, mounting, and charging equipment from leading brands like Bower and Pelican. Tripods for Every Environment No matter where you're shooting, tripods create a stable base for your camera, preventing blurriness and helping you test different angles. Find tripods and miscellaneous accessories that are easily adaptable for different environments, including models with adjustable heights and repositionable camera bases. Bendable tripods allow you to adjust individual leg joints for an unlimited number of angles. Produce Finer Images Tweak your shooting conditions to achieve the highest image quality with accessories that automatically filter light, adjust color calibration, and correct the focus of your lens. Brands like Datacolor offer flexible calibration equipment that can be integrated with a range of digital devices so that images are rendered uniformly on different screens. Once you get your shot, use professional-quality photo paper and ink for flawless printouts. Efficient Performance Tripods and miscellaneous accessories like lens caps and camera straps keep your camera performing at its best by reducing wear, simplifying transport, and extending capabilities. Staples offers accessory dividers for carrying delicate photography supplies, including lid organizers. You can also find compatible battery grips that connect to your camera, so you can spend less time recharging.", "parent_text": "Camera & Camcorder Accessories", "keyword_density": {"tripods": "2.5", "accessories": "1.7", "miscellaneous accessories": "2.5"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 13, "level": -2, "url": "http://www.staples.com/Camcorder-Cases-Bags/cat_CL165649", "text": "Camcorder Bags", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Camcorder Bags", "parent_url": "http://www.staples.com/Camera-Camcorder-Accessories/cat_DP1599", "keyword_count": {"bags": 3, "camcorder": 6, "camcorder bags": 2}, "description_wc": 171, "description_text": "Camcorder bags can help you keep your expensive equipment safe. Each style of bag is suited for a specific need, so you can choose a thin protective case for travel or one that can handle heavy-duty situations. Make sure your camcorder is protected whether you're at your office, home, or on the go. Easy Carrying With a variety of types available, camcorder bags are great for carrying your camcorder , cords, and other accessories you need when you work. A long-strap style lets you sling the bag over your shoulder for convenience. Sleek Designs Store your camcorder in style by choosing a bag or case with a sleek design. These types of bags can fit in tighter spaces, so you don't need to worry about finding a place to stow them while traveling. Protective Casing Camcorder cases are perfect for keeping your equipment safe. Soft padding protects against drops and bumps. Choose from different fabrics and metals to get the right amount of protection for your needs.", "parent_text": "Camera & Camcorder Accessories", "keyword_density": {"bags": "1.8", "camcorder": "3.5", "camcorder bags": "2.4"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 97, "level": -2, "url": "http://www.staples.com/SLR-Lenses-Flash/cat_CL141629", "text": "SLR Lenses & Flash", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "SLR Lenses & Flash", "parent_url": "http://www.staples.com/Camera-Camcorder-Accessories/cat_DP1599", "keyword_count": {"slr lenses": 2, "flash": 2, "lenses": 6, "slr": 3}, "description_wc": 136, "description_text": "SLR lenses help you capture the perfect shot when you're creating art for your business or taking photos professionally. High-quality lenses can make all the difference in the end product of a photo shoot. Many lenses are interchangeable between camera models by different manufacturers. Distance Photography Telephoto SLR lenses help you capture images or videos at longer ranges. This is especially helpful for shots of landscapes or far-off subjects. High-Quality Shots Quality lenses make it easier to capture the perfect photo in stunning definition. When you're ready to upgrade to the latest film and still-shot technology, check out digitial SLR cameras . Excellent Lighting Flashes may be combined with lenses for various effects. The right flash can help ensure you have the perfect lighting for both image and video capture.", "parent_text": "Camera & Camcorder Accessories", "keyword_density": {"slr lenses": "3.0", "flash": "1.5", "slr": "2.2", "lenses": "4.4"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 347, "level": -2, "url": "http://www.staples.com/Camera-Cases-Bags/cat_CL141626", "text": "Camera Bags", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Camera Bags", "parent_url": "http://www.staples.com/Camera-Camcorder-Accessories/cat_DP1599", "keyword_count": {"bags": 6, "camera": 10}, "description_wc": 185, "description_text": "Camera cases and bags safeguard your photography equipment when you travel or are on the job. Protective linings absorb impacts from minor bumps, preventing costly damage. Choose bags with additional pockets to keep your important accessories close at hand. Easy to Carry Convenient carrying straps make it easy to transport your camera cases and bags during trips and on special occasions. Smaller cases feature thin straps you can wear around your wrist, while bags for larger cameras are equipped with thick, durable straps to prevent accidents. Choose the Right Case for Your Camera Cases vary in size and style to accommodate different types of cameras. Point-and-shoot camera cases are lightweight and fitted for everyday travel. SLR camera cases and camcorder bags are spacious, reinforced with sturdy materials, and incorporate extra padding to protect bulkier equipment. Store Camera Accessories Make sure you have all the accessories you need on your travels with built-in pockets. Camera cases and bags from brands such as Case Logic and Lowepro feature extra compartments and zippered pockets to secure batteries, memory cards, and other essential camera accessories .", "parent_text": "Camera & Camcorder Accessories", "keyword_density": {"bags": "3.3", "camera": "5.4"}, "department_id": 14}
{"nr_products": 30, "level": -1, "url": "http://www.staples.com/Gaming-Headsets/cat_CL167923", "text": "Gaming Headsets", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_wc": 0, "parent_url": "http://www.staples.com/Headsets/cat_CG1215", "parent_text": "Headsets", "department_text": "PCs | Drives | Accessories", "department_id": 9}
{"department_text": "PCs | Drives | Accessories", "nr_products": 278, "level": -1, "url": "http://www.staples.com/Telephone-Headsets/cat_CL140300", "text": "Telephone Headsets", "department_url": "http://www.staples.com/PCs-Drives-Accessories/cat_SC3", "description_title": "Telephone Headsets", "parent_url": "http://www.staples.com/Headsets/cat_CG1215", "keyword_count": {"headsets": 5, "telephone headsets": 1}, "description_wc": 113, "description_text": "With a phone headset, handle a high volume of calls more privately and ergonomically. Browse our selection of the latest telephone headsets and VOIP headsets for higher quality calling. For more information, please visit our research centers. Natural voice quality : Our wideband frequency, noise canceling headsets ensure your voice sounds natural and full, so you can be sure you\u2019ll be heard. Headset style and earpiece style that work for you : We carry both VOIP corded and wireless office headsets. Our cordless headsets have wide wireless range and lengthy talk time. The leading names : Choose from Jabra, Plantronics, AT&T and GN Netcom. Call better, call today with a phone headset from Staples.", "parent_text": "Headsets", "keyword_density": {"headsets": "4.4", "telephone headsets": "1.8"}, "department_id": 9}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 2, "level": -1, "url": "http://www.staples.com/Sony-eReader-Accessories/cat_CL165528", "text": "Sony eReader Accessories", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Sony eReader Accessories", "parent_url": "http://www.staples.com/E-Readers-Accessories/cat_DP2258", "keyword_count": {"sony ereader accessories": 2, "sony ereader": 3}, "description_wc": 78, "description_text": "Love your Sony eReader? Love it even more with these Sony eReader accessories. Read from clear, crisp text at any time of the day with a lightweight, clip-on light. Power up wherever you are with a convenient, portable charger. Protect your e-reader from scratches, dings and worse with a sleek and stylish sleeve. Sony eReader accessories will bring your reading experience to another level and ensure that it stays that way for many years to come.", "parent_text": "E-Readers / Accessories", "keyword_density": {"sony ereader accessories": "7.7", "sony ereader": "7.7"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 7, "level": -1, "url": "http://www.staples.com/NOOK-Accessories/cat_CL166290", "text": "NOOK Accessories", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "NOOK Accessories", "parent_url": "http://www.staples.com/E-Readers-Accessories/cat_DP2258", "keyword_count": {"nook accessories": 2, "nook": 4}, "description_wc": 79, "description_text": "No reading experience on the Nook would be complete without these Nook Accessories. Protect your Nook from scrapes and drops with a fashionable cover or jacket. Read under the blankets with a clip-on light. Protect your screen with a lightweight guard that won\u2019t inhibit your reading experience. Charge up for the road with a portable power kit. No matter where you are or what time it is, these Nook Accessories will keep you reading long past bedtime.", "parent_text": "E-Readers / Accessories", "keyword_density": {"nook accessories": "5.1", "nook": "5.1"}, "department_id": 14}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 67, "level": -1, "url": "http://www.staples.com/Kindle-Accessories/cat_CL165529", "text": "Kindle Accessories", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Kindle Accessories", "parent_url": "http://www.staples.com/E-Readers-Accessories/cat_DP2258", "keyword_count": {"kindle": 4, "kindle accessories": 2}, "description_wc": 77, "description_text": "Show your Kindle how much you care by giving it the gift of Kindle Accessories. Read anytime and anywhere with a clip-on booklight. Protect your screen from unsightly scratches and stains with a clear screen protector. Dress your Kindle up and keep it safe at the same time with a trendy jacket. With Kindle Accessories, your e-reader will be sure to deliver the best reading experience wherever you go and for many years to come.", "parent_text": "E-Readers / Accessories", "keyword_density": {"kindle": "5.2", "kindle accessories": "5.2"}, "department_id": 14}
{"department_text": "TV | Home Entertainment", "level": 0, "url": "http://www.staples.com/Home-Entertainment-Furniture/cat_CG1404", "text": "Home Entertainment Furniture", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Home Entertainment Furniture", "parent_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "keyword_count": {"home": 4, "home entertainment furniture": 2, "home entertainment": 3}, "description_wc": 176, "description_text": "Keep clutter from taking over your office or home by storing your media on the shelves of a home entertainment center or TV cart. If you don't have time for organization but need a spot to store toys or documents, opt for a model with doors or drawers. Play or Work Comfortably Battling bad guys in your favorite video game or typing up business proposals as you hunch over your laptop is hardly ideal. Give your legs a break by choosing a chair specifically designed for people who spend long hours behind a desk, and set your laptop on a gaming desk. This home entertainment furniture gives you plenty of room for work and play. Free up Space You don't need a large room to take advantage of the features offered by home entertainment furniture. When you have limited space to work with, consider hanging your flat-screen television from a TV mount. Keeping a universal remote at hand helps ensure that you never get stuck watching a show that doesn't interest you.", "parent_text": "TV | Home Entertainment", "keyword_density": {"home": "2.3", "home entertainment": "3.4", "home entertainment furniture": "3.4"}, "department_id": 13}
{"department_text": "TV | Home Entertainment", "level": 0, "url": "http://www.staples.com/TV-Home-Theater/cat_CG1402", "text": "TV & Home Theater", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "TV & Home Theater", "parent_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "keyword_count": {"tv": 4, "home theater": 2}, "description_wc": 188, "description_text": "TV and home theater equipment from big name brands like Panasonic, Samsung, and Pyle gives you high-definition picture and crisp sound. Our catalog offerings range from TVs and speakers to wireless networking solutions and projectors. Shop by brand, features, or price point to quickly find the devices you need within your budget. Audio and Visual Equipment Find the right TV for your space by sorting models based on resolution, screen size, or display type. Grab a receiver if you need to hook up multiple devices to one television, and select the right speakers and sound bars to help your audio come through loud and clear. Stay Connected Whether you are looking for a wireless router or network attached storage devices, our networking solutions help you stay connected. Adapters, media players, and recorders are all available, so you can stream your favorite shows or keep up with the latest industry news and trends. Professional Presentations TV and home theater equipment isn't just for entertainment. Professional-quality digital projectors, mounts, and screens give you the confidence to pitch your next idea without having to worry about equipment failure.", "parent_text": "TV | Home Entertainment", "keyword_density": {"tv": "2.1", "home theater": "2.1"}, "department_id": 13}
{"department_text": "Phones | Cameras | Electronics", "nr_products": 242, "level": -1, "url": "http://www.staples.com/Telephone-Accessories/cat_CL140301", "text": "Telephone Accessories", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "Telephone Accessories", "parent_url": "http://www.staples.com/Telephones-Headsets-Cords/cat_CG14", "keyword_count": {"accessories": 2}, "description_wc": 144, "description_text": "Upgrade your calling experience with phone accessories from Staples. Browse a range of simplifying solutions and visit our research centers for even more unique ideas. Expand your capabilities : Try one of our extra-length phone cords, routers or splitters and add more people to the conversation. Increased mobility : With a Bluetooth microphone, experience hands free calling. Replace or install your phone : We carry a range of phone parts, from phone jacks to phone batteries, adapters, microphones and answering machines so you can be sure to have what you need when you need it. Never miss a word : Interviewing a client and need to catch every detail? Try one of our high quality phone recorders. Go ergonomic : Be kind to your neck with a shoulder rest. With phone accessories from top names like Plantronics, Jabra, GE, Polycam and Softalk, you can expect the highest quality.", "parent_text": "Telephones / Headsets / Cords", "keyword_density": {"accessories": "1.4"}, "department_id": 14}
