{"department_text": "Phones | Cameras | Electronics", "nr_products": 12, "level": -1, "url": "http://www.staples.com/E-Readers/cat_CL164364", "text": "E-Readers", "department_url": "http://www.staples.com/Phones-Cameras-Electronics/cat_SC1682", "description_title": "E-Readers", "parent_url": "http://www.staples.com/E-Readers-Accessories/cat_DP2258", "keyword_count": {"e": 70, "readers": 3}, "description_wc": 116, "description_text": "Experience reading like never before with anti-glare screens and text as crisp as an autumn morning with Ebook readers These e-book readers are portable, light, and easy to fit in a bag or purse.. From the classics to the latest bestsellers, electronic book readers will bring a world of books and magazines right to your fingertips. An eReader can hold hundreds of books - how many can you read before needing a charge and how long will you take to read classics like The Lord of the Rings or War and Peace? Check your reading speed on this fun ereader interactive infographic and challenge your friends and co-workers to a battle of the mind.", "parent_text": "E-Readers / Accessories", "keyword_density": {"e": "60.3", "readers": "2.6"}, "department_id": 14}
