{"department_text": "TV | Home Entertainment", "level": -1, "url": "http://www.staples.com/Projectors-Screens/cat_DP5338", "text": "Projectors & Screens", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Projectors & Screens", "parent_url": "http://www.staples.com/TV-Home-Theater/cat_CG1402", "keyword_count": {"screens": 3, "projectors": 4}, "description_wc": 174, "description_text": "Projectors and screens are integral parts of your presentation, making or breaking your picture quality. Shop with confidence when you browse our selection of projectors and screens from brands including BenQ, Optima, and Vivitek. Sort by aspect ratio, display technology, or price point, so you can quickly find the device for your office's needs. Keep it Portable When you need to take your presentation on the road, pocket-size projectors are the perfect solution. Available in a range of colors, there projectors pack a powerful punch in a compact size and are compatible with you smartphone, netbook, or tablet. Perfect Your Presentation Present a professional proposal or presentation by making sure that your picture quality is the best it can be. Choose from a variety of projector screens in different sizes, aspect ratios, and materials. Be Prepared Keep a few extra replacement lamps on hand, so you can keep going with your presentation, even if the projector bulb burns out. Extend the life of your lamp by operating in economy mode whenever possible.", "parent_text": "TV & Home Theater", "keyword_density": {"screens": "1.7", "projectors": "2.3"}, "department_id": 13}
