{"department_text": "TV | Home Entertainment", "nr_products": 160, "level": -1, "url": "http://www.staples.com/TV-Carts-Stands/cat_CL163569", "text": "TV Carts / Stands", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "TV Carts / Stands", "parent_url": "http://www.staples.com/Home-Entertainment-Furniture/cat_CG1404", "keyword_count": {"tv": 4, "carts": 5, "tv carts": 2, "stands": 4}, "description_wc": 179, "description_text": "Use TV carts and stands to highlight your television and make it the centerpiece of the room. These furniture pieces also provide space to store media devices and accessories. Look for carts and stands from reliable manufacturers such as Office Star, Sauder, South Shore, and Bush. Rolling Carts A rolling TV cart lets you easily move your television from one room to another while keeping all of the components of your system together. Carts are ideal for medical, educational, and retail facilities, where quick and convenient access to prerecorded media is essential. Flat-Panel Stands Flat-panel TV carts and stands feature mounting arms to hold up your screen and make viewing easier. Whether your system includes a wide-screen plasma television or an LCD screen, you can find a TV stand to suit your television. Entertainment Centers Entertainment centers provide extra storage for all of your devices, so you can keep DVD players, cable boxes, game systems, and more on hand for use with your television. Some models are even designed to fit into your existing furniture scheme.", "parent_text": "Home Entertainment Furniture", "keyword_density": {"tv": "2.2", "carts": "2.8", "tv carts": "2.2", "stands": "2.2"}, "department_id": 13}
