{"department_text": "Envelopes | Labels | Mailing", "level": -1, "url": "http://www.staples.com/Postal-Scales-Postage-Meters/cat_DP2184", "text": "Postal Scales / Postage Meters", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Postal Scales / Postage Meters", "parent_url": "http://www.staples.com/Postal-Scales-Letter-Folders/cat_CG1281", "keyword_count": {"postage": 2, "postal": 2, "postal scales": 1, "scales": 3}, "description_wc": 79, "description_text": "Staples\u00ae has the postal scales to meet the needs of your home or business. We carry great brands such as Dymo and Salter that offer a range of postage scales. We make mailing and shipping easy with our digital scales that give you exact postage amounts, allow for portability and remote display and have USB capabilities.Get an entire package that will give you the postal scale and label printer you need and limit your time at the post office.", "parent_text": "Postal Scales / Letter Folders", "keyword_density": {"postage": "2.5", "postal": "2.5", "scales": "3.8", "postal scales": "2.5"}, "department_id": 8}
