{"department_text": "TV | Home Entertainment", "level": -1, "url": "http://www.staples.com/Home-Networking/cat_DP5319", "text": "Home Networking", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Home Networking", "parent_url": "http://www.staples.com/TV-Home-Theater/cat_CG1402", "keyword_count": {"home": 6, "networking": 7, "home networking": 5}, "description_wc": 127, "description_text": "Home networking products enable you to set up an internet network in your home or office. Each product is designed to provide easy management, high speeds, and a minimal footprint. Whether you're looking to boost your network storage capacity or create a system for streaming media, home networking equipment can streamline the process. Easy Networking With home networking devices such as wireless routers and network attached storage devices, you can set up a fast, robust system. Convenient Adapters Wireless adapters and wireless display adapters let you increase your computer's capabilities. For maximum portability, check out home networking devices like the wireless nano adapters. Improved Performance For slow or interrupted Internet service, check out home networking products such as power line adapters or wireless networking accessories.", "parent_text": "TV & Home Theater", "keyword_density": {"home": "4.7", "networking": "5.5", "home networking": "7.9"}, "department_id": 13}
{"department_text": "TV | Home Entertainment", "level": -1, "url": "http://www.staples.com/Home-Audio/cat_DP5070", "text": "Home  Audio", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Home  Audio", "parent_url": "http://www.staples.com/TV-Home-Theater/cat_CG1402", "keyword_count": {"home": 7, "audio": 5, "home audio": 3}, "description_wc": 213, "description_text": "The right home audio equipment takes your home theater experience to the next level. Choose from a combination of speakers, receivers, and sound bars to create the perfect sound system for your office's needs. You can even add some retro charm to your workspace with modern takes on the classic record player and juke box. Home Theater Systems and Accessories From full home theater systems to converters, media plates, and remote controls, home audio equipment helps make sure your sound is the best it can be. Choose from leading brands like Pyle and Samsung, ensuring you get quality equipment and clear audio. Speakers and Sound Bars Make sure everyone in the room can hear with the right combination of speakers and sound bars or add some extra oomph with a new amp or subwoofer. Choose from wireless, weatherproof, and portable speakers, depending on your needs. Receivers We carry everything from basic wireless converters for your iPhone to AM/FM receivers and wireless A/V transmitters. Some models are even compatible with camcorders, so they can double as low-tech security systems. Whatever your home audio needs are, Staples has you covered, and you can still enjoy robust audio at home during quieter hours with a set of Beats by Dre headphones .", "parent_text": "TV & Home Theater", "keyword_density": {"home": "3.3", "audio": "2.4", "home audio": "2.8"}, "department_id": 13}
{"department_text": "TV | Home Entertainment", "level": -1, "url": "http://www.staples.com/Gaming-Furniture/cat_DP5275", "text": "Gaming Furniture", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Gaming Furniture", "parent_url": "http://www.staples.com/Home-Entertainment-Furniture/cat_CG1404", "keyword_count": {"gaming furniture": 2, "furniture": 4}, "description_wc": 163, "description_text": "Gaming furniture includes desks, towers, and media centers to keep your organized and playing hard. You can also find stylish and comfortable seating, so you and your competition can play for hours without suffering from backaches. Choose from classic, modern, and minimalist designs to match your existing furnishings. Multifunction Desks Multifunction desks are the perfect solution for small spaces, where you need your furniture to do double duty. These models include features like pull-out filing systems, small bookcases, and space for both your console and your computer. Media Storage Keep your games and accessories organized in media towers and hubs by console type or genre. This makes it easy to find the game you want quickly and easily, so you spend less time hunting through stacks and more time playing. Comfortable Seating Gaming furniture should be functional and stylish. Choose from high-quality high-back executive chairs for premium comfort and support or furniture without armrests for a full range of motion.", "parent_text": "Home Entertainment Furniture", "keyword_density": {"gaming furniture": "2.5", "furniture": "2.5"}, "department_id": 13}
{"department_text": "TV | Home Entertainment", "nr_products": 36, "level": -1, "url": "http://www.staples.com/DVD-Blu-Ray-Players/cat_CL168297", "text": "DVD & Blu-Ray Players", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "DVD & Blu-Ray Players", "parent_url": "http://www.staples.com/TV-Home-Theater/cat_CG1402", "keyword_count": {"blu ray": 4, "dvd": 8, "blu ray players": 3}, "description_wc": 191, "description_text": "DVD and Blu-ray players are perfect for distributing employee training videos. Choose from professional-quality models that include cameras for a security system or put a basic model in the break room. This lets employees enjoy their favorite shows during scheduled down time, increasing worker satisfaction and morale. Convenient and Energy Efficient The latest DVD and Blu-ray players let you play content from a variety of formats, including DVDs, Blu-rays, CDs, CD-RW, and more. ENERGY STAR rated models give the added comfort of knowing you are doing everything you can to keep your office as green as possible. Compact and Portable Slim-design DVD and Blu-ray players provide the same features and functionality as full-size models but take up less space. Portable options are perfect for when you need to stay productive on business trips or flights. Record Your Own DVDs DVD recorders let you create your own promotional materials or training videos while still offering normal DVD playback capabilities. You can view content from existing DVDs, CDs, or the device's hard drive. Protect your investment with a surge protector to prevent electrical damage.", "parent_text": "TV & Home Theater", "keyword_density": {"blu ray": "4.2", "dvd": "4.2", "blu ray players": "4.7"}, "department_id": 13}
