{"department_text": "TV | Home Entertainment", "nr_products": 68, "level": -1, "url": "http://www.staples.com/Televisions/cat_CL142471", "text": "Televisions", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Televisions", "parent_url": "http://www.staples.com/TV-Home-Theater/cat_CG1402", "keyword_count": {"televisions": 3}, "description_wc": 185, "description_text": "Staples has a large selection of televisions to meet every need and budget. TVs are perfect for your living room, break room, or even your home office. You can also use televisions to present employee training materials, show popular programs and movies for customer events, or display your own product ads to encourage customers to buy more. Staples carries a wide selection of TVs from Magnavox, Coby, Panasonic, Samsung, and other major manufacturers to provide plenty of options. Large Screens Modern televisions come in screen sizes up to 60 inches diagonally, so you get plenty of surface area to watch the action in high definition. Full-range speakers add to the intensity of the viewing experience. Versatile Options Choose from LCD, LED, or plasma screens to get the right balance between picture quality and price. Hook your new television to a Blu-ray or DVD player to enhance your system even more. 3-D Systems Move into the future of television technology with a 3-D TV that lets you experience movies and presentations as though you were right in the middle of the action.", "parent_text": "TV & Home Theater", "keyword_density": {"televisions": "1.6"}, "department_id": 13}
{"level": 0, "url": "http://www.staples.com/Shipping-Boxes/cat_CG1274", "text": "Shipping Boxes", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_wc": 0, "parent_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "parent_text": "Envelopes | Labels | Mailing", "department_text": "Envelopes | Labels | Mailing", "department_id": 8}
{"department_text": "TV | Home Entertainment", "nr_products": 8, "level": -2, "url": "http://www.staples.com/Sound-Bars/cat_CL167929", "text": "Sound Bars", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Sound Bars", "parent_url": "http://www.staples.com/Home-Audio/cat_DP5070", "keyword_count": {"sound": 5, "sound bars": 2}, "description_wc": 190, "description_text": "Sound bars are the perfect complement to your existing home theater system or your office surround sound system. From convenient all-in-one designs to models with built-in subwoofers, you can find just what you need. Show you commitment to professionalism and attention to detail with one of these quality audio systems. Convenience All-in-one models provide the convenience of a focused sound station. These systems come loaded with features like TruTone equalization technology, so you can make sure your settings are just right for the type of music you prefer. You can also hook up your MP3 player to listen to your own playlists. Customization Our catalog includes one-, two-, and three-speaker systems, so you can choose a design that complements the size of your office. Expandable models provide a custom fit for small spaces, so you can keep your sound system out of plain view. Versatility Sound bars give you the best in versatility, with slim-design models and output powers ranging from 15 to 400 watts. Choose a multipositional system, so you can create the optimal speaker layout for your office space.", "parent_text": "Home  Audio", "keyword_density": {"sound": "2.7", "sound bars": "2.1"}, "department_id": 13}
{"department_text": "TV | Home Entertainment", "nr_products": 394, "level": -2, "url": "http://www.staples.com/Speakers/cat_CL167256", "text": "Speakers", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Speakers", "parent_url": "http://www.staples.com/Home-Audio/cat_DP5070", "keyword_count": {"speakers": 9}, "description_wc": 177, "description_text": "Speakers give you a high-quality listening experience, whether you're streaming the latest top-ten hits on your laptop or listening to recorded podcasts on your MP3 player. Manufacturers such as Supersonic, Samsung, Panasonic, and Yamaha have turned decades of experience into the latest technologies for listening. Whether you like classic rock, modern bounce, bestselling audiobooks, or talk radio, speakers fill your room with the sounds you want to hear. Wireless Speakers Wireless speakers extend your reach so you can listen across the room from your music-playing device. These speakers use Bluetooth technology to spread the audio far and wide. Weatherproof Units If you're playing music poolside, at a garden party, or out back on the deck, weatherproof speakers ensure that your audio keeps playing even if the weather turns bad. Leave them outdoors full-time so you always have speakers available. Amplifiers Amplifiers boost your audio signal so there's more to send to the speakers. Hook amplifiers and speakers into your home theater system to get superb audio while watching movies, too.", "parent_text": "Home  Audio", "keyword_density": {"speakers": "5.1"}, "department_id": 13}
{"department_text": "TV | Home Entertainment", "nr_products": 30, "level": -2, "url": "http://www.staples.com/Retro-Audio/cat_CL167928", "text": "Retro Audio", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Retro Audio", "parent_url": "http://www.staples.com/Home-Audio/cat_DP5070", "keyword_count": {"retro": 6, "retro audio": 3}, "description_wc": 173, "description_text": "Use retro audio devices to listen to your favorite music or programs while enjoying the classic style that reminds you of yesteryear. If your business focuses on capturing an old-time feel, it's easy to find ways to make everyone reminiscent for the airwaves of old. You can also use these fun pieces for themed events around your home or office. Retro Radios Retro radios include portable models you can take with you and standalone radios. Pair your device with vintage-style headphones to complete your retro audio experience. Record Players Enjoy the superior sound of old vinyl records with a retro turntable. You can also find turntables in some modern stereo systems. Classic Jukeboxes The look of a classic jukebox will make customers and clients feel nostalgic, but modern versions offer the option of using CDs or MP3s instead of traditional records. Load it up with some classic rock and roll, or juxtapose retro audio and modern sound by filling the queue with a blend of big band and current pop.", "parent_text": "Home  Audio", "keyword_density": {"retro": "3.5", "retro audio": "3.5"}, "department_id": 13}
