{"department_text": "TV | Home Entertainment", "nr_products": 43, "level": -1, "url": "http://www.staples.com/Entertainment-Centers/cat_CL168091", "text": "Entertainment Centers", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Entertainment Centers", "parent_url": "http://www.staples.com/Home-Entertainment-Furniture/cat_CG1404", "keyword_count": {"entertainment centers": 3}, "description_wc": 151, "description_text": "Entertainment centers from manufacturers such as Bush, Sauder, South Shore, and Office Star blend style and convenience. Choose from elaborate models with room for all of your accessories or trimmed-down units that maximize your available space. Traditional Units Traditional-style entertainment centers blend in visually with classic decors. Their detailing and designs may be reminiscent of older furnishings, but these units are sturdy enough to handle modern flat panel televisions. Modern Design Modern entertainment centers offer a clean contemporary look that maximizes space while minimizing distractions. Tempered glass, metal, and other modern materials are supportive and attractive. Television Mounts When you don't have room for a large piece of furniture in the space where you want to display your flat panel television, a television wall mount is a convenient alternative. These brackets attach your display directly to the wall and can be adjusted to get just the right angle.", "parent_text": "Home Entertainment Furniture", "keyword_density": {"entertainment centers": "4.0"}, "department_id": 13}
{"department_text": "TV | Home Entertainment", "nr_products": 11, "level": -2, "url": "http://www.staples.com/Gaming-Centers-Desks/cat_CL168090", "text": "Gaming Centers & Desks", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Gaming Centers & Desks", "parent_url": "http://www.staples.com/Gaming-Furniture/cat_DP5275", "keyword_count": {"gaming": 3, "gaming centers": 2, "desks": 3}, "description_wc": 197, "description_text": "Gaming centers and desks keep your games, consoles, controllers, and other accessories organized. Choose a model that features a built-in cable management system for a clutter-free appearance. Whether you need a desk that blends in with the your white walls or want to add a pop of color to your space, we have what you're looking for. Hubs Slim-design storage hubs allow you to keep all of your games and accessories neatly arranged. With built-in shelves and dedicated hooks for your guitar controllers, these stations keep everything in its place. Desks Whether you need a fully functional desk that can handle work, school, and gaming tasks or are looking for a space-saving model for smaller areas, our catalog has something for everyone. Gaming centers and desks are available in a variety of frame materials and finishes, so you can find the furniture that fits your personality. Towers Media towers are perfect for rooms that can accommodate larger pieces of furniture or the gamer who needs to store more than one console type. You can wheel it wherever you need it, and then lock the wheels in place for stability and security.", "parent_text": "Gaming Furniture", "keyword_density": {"gaming": "1.5", "desks": "1.5", "gaming centers": "2.0"}, "department_id": 13}
