{"department_text": "TV | Home Entertainment", "nr_products": 200, "level": -2, "url": "http://www.staples.com/Home-Theatre/cat_CL167255", "text": "Home Theatre", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Home Theatre", "parent_url": "http://www.staples.com/Home-Audio/cat_DP5070", "keyword_count": {"home": 3}, "description_wc": 218, "description_text": "A home theater setup can become your own personal cinema with just a few gadgets, such as a remote control or lighting controls. A home theater system can help you add surround sound to your room, so you will feel immersed in the film. DVD and Blu-ray players can also be used to play all your favorite movies across the room through a television set up or a projector and screen. Versatile If you want to set up a home theater system with your television, you'll be able to watch all your favorite movies with surround sound and more on the big screen. You can also use projectors, screens, and white walls to create larger images that you can enjoy. Speakers for Volume and Immersion Getting the volume up is a major part of feeling like you're participating in a film, and a channel speaker system can help. Many of these systems include four or more speakers, so you can spread them out around the room for bold surround sound. Light Sensors When you're ready for your movie, don't waste time by having to get up to switch off the lights. A light sensor kit can be used with a remote, so you can switch off or dim the lights from your seat.", "parent_text": "Home  Audio", "keyword_density": {"home": "1.4"}, "department_id": 13}
{"department_text": "TV | Home Entertainment", "nr_products": 94, "level": -2, "url": "http://www.staples.com/Receivers/cat_CL167927", "text": "Receivers", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "Receivers", "parent_url": "http://www.staples.com/Home-Audio/cat_DP5070", "keyword_count": {"receivers": 2}, "description_wc": 174, "description_text": "Receivers, transmitters, and converters can increase productivity by providing background music. You can also use these devices for your office's technology needs, from presentations to video conference calls. Convenient wireless technology ensures you won't be tripping over cords or trying to hide clutter from cables and wires. Convenience Use a wireless converter to play music from your iPhone or iPod all through your office. With a range of up to 33 feet, these devices help you can stay motivated even as you move from your desk to the copy machine. Wireless Wireless audio/visual transmitters let you send an A/V signal from a variety of devices, including your satellite, computer, DVD player, or TiVo, to your television. This gives your the freedom to present training videos or pitch your next proposal without having to worry about extension cords or outlets. Karoke Fun Get ready for the office holiday party with receivers than can double as karaoke machines. Just plug in up to two microphones, and get ready to have some fun.", "parent_text": "Home  Audio", "keyword_density": {"receivers": "1.1"}, "department_id": 13}
