{"department_text": "Envelopes | Labels | Mailing", "level": 0, "url": "http://www.staples.com/Inventory-Shipping-Tags/cat_CG2839", "text": "Tags", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Tags", "parent_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "keyword_count": {"tags": 8}, "description_wc": 124, "description_text": "Inventory tags and shipping tags are an often forgotten supply accessory, but they guarantee that information is easily readable and they closely adhere to whatever you need to tag or label like envelopes , ensuring great organization. Staples tags, including a large assortment of shipping tags, will help you accomplish these goals for the most competitive possible price. We have a great selection of tags to help you organize your inventory in addition to a wide assortment of shipping tags, including manila, colored and Tyvek tags . With the low cost of using tags well but all the benefits they bring to an office, home, or any organized environment, they are a great asset to any office supplies closet or home office desk drawer.", "parent_text": "Envelopes | Labels | Mailing", "keyword_density": {"tags": "6.6"}, "department_id": 8}
