{"department_text": "TV | Home Entertainment", "nr_products": 226, "level": -2, "url": "http://www.staples.com/NAS-Network-Attached-Storage/cat_CL164718", "text": "NAS (Network Attached Storage)", "department_url": "http://www.staples.com/TV-Gaming-Home-Entertainment/cat_SC1786", "description_title": "NAS (Network Attached Storage)", "parent_url": "http://www.staples.com/Home-Networking/cat_DP5319", "keyword_count": {"network attached storage": 2, "storage": 4, "network": 4}, "description_wc": 93, "description_text": "For fast data access, easy administration and simple configuration, nothing beats network attached storage. For a full primer on how you can best take advantage of this solution, take a look through our research center. Here are just a few features you can expect with network storage: RAID migration and capacity expansion Fully Mac- and PC-compatible Hard drive capacity of up to 4TB Remote access for personal and networked cloud technology Centralized storage for multiple PCs Up to 4 drives to ensure full and secure backups Network attached storage: the safe solution.", "parent_text": "Home Networking", "keyword_density": {"network attached storage": "6.5", "storage": "4.3", "network": "4.3"}, "department_id": 13}
