{"department_text": "Teaching | Drafting | Art", "level": 1, "url": "http://www.staples.com/Teaching-Drafting-Art/cat_SC1686", "text": "Teaching | Drafting | Art", "department_url": "http://www.staples.com/Teaching-Drafting-Art/cat_SC1686", "description_title": "Teaching | Drafting | Art", "keyword_count": {"teaching": 1, "art": 3, "drafting": 1}, "description_wc": 104, "description_text": "No classroom would be complete without a cupboard full of art supplies. Be ready for any art project with colorful construction paper, markers and crayons. Find all the chalk you need for a sidewalk art show, get one of the best backpacks for kids, travel , school and more, and stay organized with our stylish pencil boxes. Have presentations scheduled? Keep poster board on hand so every student can get that A+. We have plenty of drafting supplies available too, including the best compasses and triangular scales. At Staples we\u2019ve got all the teaching supplies you\u2019re looking for so browse away!", "keyword_density": {"teaching": "1.0", "art": "2.9", "drafting": "1.0"}, "department_id": 23}
