{"department_text": "Boards | Easels | Dry-Erase", "level": 1, "url": "http://www.staples.com/Boards-Easels-Dry-Erase/cat_CG101", "text": "Boards | Easels | Dry-Erase", "department_url": "http://www.staples.com/Boards-Easels-Dry-Erase/cat_CG101", "description_title": "Boards | Easels | Dry-Erase", "keyword_count": {"dry erase": 1, "boards": 5, "easels": 2}, "description_wc": 95, "description_text": "When you need new boards for your office, we\u2019re the first place to look. We have a wide range of dry erase boards and easels, so whatever your needs we\u2019ll have what you\u2019re searching for. What\u2019s more, our boards and easels and other office products are always available at great prices. And you won\u2019t need to look far for the necessary accessories - we\u2019ve got easel pads and markers right here as well. And don\u2019t think we\u2019ve forgotten about chalkboards - they\u2019re right here alongside the display boards!", "keyword_density": {"dry erase": "2.1", "boards": "5.3", "easels": "2.1"}, "department_id": 22}
{"department_text": "Furniture | Chairs | Cabinets", "level": 1, "url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "text": "Furniture | Chairs | Cabinets", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Furniture | Chairs | Cabinets", "keyword_count": {"chairs": 5, "cabinets": 1, "furniture": 4}, "description_wc": 144, "description_text": "Want to give your office a modern look without sacrificing comfort? We have just the right office furniture for you. Our office chairs come in all varieties, from ergonomic chairs for the active worker to impressive executive chairs for the busy CEO. Or pick your own fabric, color and frame with one of our custom chairs. We also carry several styles of bookcases in a variety of colors and our assortment of desks and tables is inclusive enough to encompass all of your office or home needs. Our storage, media and file cabinets will have your rooms organized in no time, and our accent chairs and deluxe furniture will add a unique touch to any room. With Staples furniture, you are guaranteed to get just what you are looking for, you just need to explore a bit to find the best furniture for you!", "keyword_density": {"chairs": "3.5", "cabinets": "0.7", "furniture": "2.8"}, "department_id": 19}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 2, "level": -1, "url": "http://www.staples.com/Postage-Meter-Labels/cat_CL140852", "text": "Postage Meter Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Postage Meter Labels", "parent_url": "http://www.staples.com/Labels/cat_CG24", "keyword_count": {"labels": 7, "postage meter labels": 2}, "description_wc": 182, "description_text": "Use postage meter labels to quickly and easily address packages and envelopes without having to handwrite each address. You can also use these labels to organize and keep track of packages and documents in-house. Print everything from bar codes to product names for everything in your office, shop, or warehouse. For Packing and Shipping Ship boxes, padded envelopes, large envelopes, and more with postage meter labels that attach securely to any surface. Choose a large roll of labels to help make mailing multiple packages more efficient. Post Office Friendly Printed labels are easier to read than handwritten addresses, so your mail is more likely to make it safely to its destination. You can also print out and attach your return address in case the post office has to send your mail back to you. Works with Label Makers These rolls work with standard label makers, so you can simply refill your device when you need to make more labels. It's easy to install your labels in a compatible device and simple to remove the empty roll when you're done.", "parent_text": "Labels", "keyword_density": {"labels": "3.8", "postage meter labels": "3.3"}, "department_id": 8}
