{"department_text": "Apple\u00ae", "nr_products": 52, "level": -1, "url": "http://www.staples.com/iPad-Stands-Mounts/cat_CL166415", "text": "iPad Stands / Mounts", "department_url": "http://www.staples.com/Apple/cat_SC1949", "description_title": "iPad Stands / Mounts", "parent_url": "http://www.staples.com/iPad-Accessories/cat_DP5151", "keyword_count": {"mounts": 5, "stands": 3}, "description_wc": 148, "description_text": "Keep your hands free with stands and mounts for tablets, smartphones, and e-readers. Mount your phone on your car's windshield or prop up your tablet on a stand in the kitchen. Intuitive designs give you easy access to all of your device's primary functions. Multiposition Stands Adjustable stands and mounts let you move your smartphone or tablet to the best viewing angle without taking it out. Switch from landscape to portrait mode with the flick of a wrist. Universal Compatibility Keep just one mount on hand for all of your tablets. Easily expandable and adjustable mounts let you customize the fit, no matter what size tablet or device you have. On-the-Go Mounts Cup holder and windshield mounts let you take your electronics with you safely. Heads-up displays and hands-free capabilities let you keep your eyes and hands where they should be.", "parent_text": "iPad\u00ae Accessories", "keyword_density": {"mounts": "3.4", "stands": "2.0"}, "department_id": 1}
