{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 16, "level": 0, "url": "http://www.staples.com/Furniture-Polish-Cleaners/cat_CL142820", "text": "Furniture Polish & Cleaners", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Furniture Polish & Cleaners", "parent_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "keyword_count": {"furniture polish": 1, "cleaners": 5, "furniture": 6, "polish": 3}, "description_wc": 202, "description_text": "Furniture cleaners help you maintain a sanitary workplace while protecting the quality of your furnishings. Whether you need to polish wooden, vinyl, metal or marble items, Staples offers cleaning products for use on a variety of different surfaces. You can select effective furniture cleaners with fragrant aromas from popular brands like Pledge and Old English. Restore Natural Shine Remove layers of dust, dirt, and fingerprints with furniture polish designed to prevent wood-based decor from drying out. Anyone can apply these easy spray-on cleaning formulas, which penetrate wood to bring out its natural luster and give your office furniture a neat, polished appearance. Eliminate Bacteria With loads of traffic coming in and out of your business, multisurface cleaners provide the flexibility to clean up bacteria and allergens on everything from chair arms and countertops to windows and computer keyboards. When you need to quickly tidy up your office, try wiper-style furniture cleaners moistened with cleaning solution. No Irritating Scents or Buildup Furniture cleaners should enhance your decor, so choose products that apply smoothly without leaving behind waxy residue. You can also find cleaning solutions with appealing scents like lemon and vanilla to ensure your workspace is always fresh and inviting.", "parent_text": "Furniture | Chairs | Cabinets", "keyword_density": {"furniture polish": "1.0", "furniture": "3.0", "polish": "1.5", "cleaners": "2.5"}, "department_id": 19}
