{"department_text": "Furniture | Chairs | Cabinets", "level": -1, "url": "http://www.staples.com/Wastebaskets-Recycle-Bins/cat_DP1490", "text": "Trash Cans", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Trash Cans", "parent_url": "http://www.staples.com/Trash-Cans-Recycling-Bins/cat_CG1321", "keyword_count": {"cans": 5, "trash cans": 4}, "description_wc": 93, "description_text": "When you need to shop for kitchen and breakroom necessities, staples.com offers hundreds of trash cans and lids for the workplace. Our selection includes plastic and metal receptacles in a variety of shapes and finishes that range from bright red to stainless steel. With quality trash cans for great value, we have you covered with brands like Honey Can Do , iTouchless , Rubbermaid , Brighton Professional , and Safco. We also offer a variety of automatic sensor cans, fire safe trash cans, smoking receptacles, medical waste receptacles, and outdoor commercial trash cans.", "parent_text": "Trash Cans / Recycling Bins", "keyword_density": {"cans": "5.6", "trash cans": "9.0"}, "department_id": 19}
