{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 9, "level": -1, "url": "http://www.staples.com/Humidifiers/cat_CL165542", "text": "Humidifiers", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Humidifiers", "parent_url": "http://www.staples.com/Heating-Cooling-Air-Quality/cat_DP4952", "keyword_count": {"humidifiers": 4}, "description_wc": 124, "description_text": "Humidifiers keep air humidity at the perfect level. Dry air can lead to dry throats and soreness in an office setting. Humidifiers can also disperse scents or herbal remedies to ease symptoms commonly associated with colds. Keep Humidity Up Keeping humidity at the right level ensures that dry, itchy throats won't interfere with small business presentations or meetings. High humidity can also make the skin feel moist and rejuvenated. Increase Air Quality Many humidifiers include an air filter that eliminates many common contaminants. Check out the selection of air purifiers for even greater enhanced air quality. Deliver Medicinal Comfort Modern humidifiers can vaporize aromatherapy scents for additional comfort. Many vapor products contain methanol, a chemical that has the benefit of soothing away soreness.", "parent_text": "Heating / Cooling / Air Quality", "keyword_density": {"humidifiers": "3.2"}, "department_id": 19}
