{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 90, "level": -1, "url": "http://www.staples.com/Heaters/cat_CL80001", "text": "Heaters", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Heaters", "parent_url": "http://www.staples.com/Heating-Cooling-Air-Quality/cat_DP4952", "keyword_count": {"heaters": 2}, "description_wc": 134, "description_text": "Heaters are effective at maintaining temperatures year-round. Smaller units are perfect for home or corner offices. Larger units can help ensure that plants in a greenhouse or customers in a shopping area feel warm and secure. Provide a Place to Warm Up Heaters let you provide your customers with a warm place to come into, out of the cold. A sign announcing the warmth indoors might be just what you need to help turn passers-by into shoppers. Keep Temperatures Just Right Ensure that your office is warm all winter with a quality heater. For the warmer months, check out the selection of air conditioners . Protect Plants from Frost Frost can kill outdoor plants that bring so much life into your office. Bring them inside and keep them warm with your heater.", "parent_text": "Heating / Cooling / Air Quality", "keyword_density": {"heaters": "1.5"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 18, "level": -1, "url": "http://www.staples.com/Air-Purifiers/cat_CL140858", "text": "Air Purifiers", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Air Purifiers", "parent_url": "http://www.staples.com/Heating-Cooling-Air-Quality/cat_DP4952", "keyword_count": {"air purifiers": 3, "air": 5}, "description_wc": 79, "description_text": "Breathe easy with our air purifiers from leading brand names like HEPAtec, Fellowes, Honeywell, and Ionic Pro. Our products feature HEPA-grade filters to help remove airborne allergens, germs, mold, odor, bacteria\u00a0and humidity. The use of air purifiers in an office can lead to better breathing conditions by reducing allergens and harmful particles in odors that can lead to sickness.\u00a0Air purifiers are especially important to people who suffer from asthma, allergies, or other sensitivities to air pollutants.", "parent_text": "Heating / Cooling / Air Quality", "keyword_density": {"air purifiers": "7.6", "air": "6.3"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 38, "level": -1, "url": "http://www.staples.com/Fans/cat_CL80002", "text": "Fans", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Fans", "parent_url": "http://www.staples.com/Heating-Cooling-Air-Quality/cat_DP4952", "keyword_count": {"fans": 4}, "description_wc": 164, "description_text": "Circulate healthy air in your office with our wide variety of fans here at staples.com. Our selection features desk, table, box, window, floor, wall-mountable, convertible clip-on, standing, and tower fans. With name brands like Black & Decker , Holmes , Lasko , and SoleusAir , the options for keeping your workplace cool are endless. Direct Air Flow Where You Need It Energy-efficient models with tilting heads let you aim the air flow at a specific area of the room. Choose a unit with up to three speeds to adjust the flow even more. Mountable Anywhere Use a wall-mountable fan when you need to direct air to a certain location that table or floor units can't reach. Clip-on models let you attach fans directly to your desk or a shelf. Versatile Full-Room Coverage Oscillating fans move continuously to give you full-room air coverage throughout the day. If you need even more airflow, try a portable air conditioner .", "parent_text": "Heating / Cooling / Air Quality", "keyword_density": {"fans": "2.5"}, "department_id": 19}
