{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 46, "level": -1, "url": "http://www.staples.com/Air-Conditioners-Dehumidifiers/cat_CL162664", "text": "Air Conditioners & Dehumidifiers", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Air Conditioners & Dehumidifiers", "parent_url": "http://www.staples.com/Heating-Cooling-Air-Quality/cat_DP4952", "keyword_count": {"dehumidifiers": 4, "air": 10, "air conditioners": 4}, "description_wc": 198, "description_text": "Air conditioners and dehumidifiers cool the air and reduce humidity in the room to give you a more comfortable workspace. Models from SoleusAir include those with just air cooling capability and those with both functions. Whether you are in an office, a retail setting, or a different type of workspace, air conditioners and dehumidifiers will keep you productive through the warm summer months. Operate From Across the Room Remote-control-operated air conditioners and dehumidifiers let you control the temperature and humidity level of the room from your desk instead of having to get up and change the settings. Remotes are small enough to keep in your desk drawer or pocket. Turn It On and Forget It Getting a unit with automatic shutoff ensures that you won't accidentally leave it on overnight. Programmable settings let you schedule when temperature shifts occur in your office. Pair it with an air purifier to ensure clean air in your office. Move It Wheels on air conditioners and dehumidifiers let you position a unit exactly where you need it most. If you have to work in a different location, you can easily transport your appliance to wherever you need to go.", "parent_text": "Heating / Cooling / Air Quality", "keyword_density": {"air conditioners": "4.0", "dehumidifiers": "2.0", "air": "5.1"}, "department_id": 19}
