{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 18, "level": -2, "url": "http://www.staples.com/Outdoor-Trash-Cans/cat_CL169176", "text": "Outdoor Trash Cans", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Outdoor Trash Cans", "parent_url": "http://www.staples.com/Wastebaskets-Recycle-Bins/cat_DP1490", "keyword_count": {"outdoor trash cans": 1, "outdoor": 4, "trash cans": 2, "cans": 8, "outdoor trash": 3, "trash": 8}, "description_wc": 204, "description_text": "Outdoor trashcans are made from durable, ruggedized materials that can withstand frequent use and weather exposure. The access openings are strategically positioned for quick disposal in high-traffic settings. With heavy-duty brands like Safco, you can choose trashcans capable of holding several gallons of waste between maintenance checks. Concealed Waste Disposal Your business's exterior appearance makes the first impression on visitors, so present a clean environment with garbage cans that hide unpleasant waste. Outdoor trash cans frequently feature neutral colors and lids that completely cover your trash bags to keep your grounds looking professional. Heavy-Duty Construction Durable materials like high-density plastic protect outdoor trashcans from common types of erosion, including liquid damage. Other built-in protection, such as powder coating, texturized panels, and UV inhibitors prepare your trashcans for daily exposure to outdoor conditions, extending the life of your investment. Easy Germ-Free Access Find top or side-opening trashcans with large access holes that can accommodate food containers, cups, and other common waste while leaving plenty of space between your hands and the receptacle. With multiple openings and sizes up to 45 gallons, these high-capacity trash cans enable several passersby to dispose of garbage simultaneously without spreading bacteria.", "parent_text": "Trash Cans", "keyword_density": {"outdoor trash cans": "1.5", "outdoor": "2.0", "trash cans": "2.0", "cans": "3.9", "outdoor trash": "2.9", "trash": "3.9"}, "department_id": 19}
