{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 10, "level": -2, "url": "http://www.staples.com/Smoking-Receptacles/cat_CL141927", "text": "Smoking Receptacles", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Smoking Receptacles", "parent_url": "http://www.staples.com/Wastebaskets-Recycle-Bins/cat_DP1490", "keyword_count": {"smoking": 3, "receptacles": 3, "smoking receptacles": 2}, "description_wc": 161, "description_text": "Smoking receptacles are a terrific way to keep the entryway to your business clear and inviting for smokers and nonsmokers alike. We offer receptacles from manufacturers that include Eagle, Safco, and Ex-Cell in a variety of styles to match your style. Choose between standard ashtrays or those that incorporate both an ashtray and a trashcan. Fire-safe Construction You can pick up a smoking receptacle constructed of heavy-duty steel, polyethylene, and other materials. Rest assured that these ashtrays are fire-safe, eliminating accidental fires from smoldering cigarettes. Dual Design Choose between a standard urn or a tube-style, smoke-free receptacle in varying capacities to keep up with your needs. You can even match your existing trashcans for a cohesive look. Multiple Uses Use these smoking receptacles wherever you notice cigarette butts gathering. Put one near your office breezeway, so customers can stub their cigarettes out as they walk in, and place another in an outdoor employee break area.", "parent_text": "Trash Cans", "keyword_density": {"smoking": "1.9", "receptacles": "1.9", "smoking receptacles": "2.5"}, "department_id": 19}
