{"department_text": "Furniture | Chairs | Cabinets", "level": 0, "url": "http://www.staples.com/Bookcases/cat_CG31", "text": "Bookcases", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Bookcases", "parent_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "keyword_count": {"bookcases": 2}, "description_wc": 59, "description_text": "Bookcases provide the perfect organization piece for your home or office. Staples has bookcases in wood, laminate, metal or even glass. Whether your style is traditional, contemporary or somewhere in between, you can find your bookcase here. Storing books or binders, displaying photos or awards, or any other kind of bookcase solution you need is just a click away.", "parent_text": "Furniture | Chairs | Cabinets", "keyword_density": {"bookcases": "3.4"}, "department_id": 19}
