{"department_text": "Furniture | Chairs | Cabinets", "level": 0, "url": "http://www.staples.com/Chair-Mats-Floormats-Rugs/cat_CG93", "text": "Chair Mats / Floormats / Rugs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Chair Mats / Floormats / Rugs", "parent_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "keyword_count": {"chair mats": 4, "chair": 5, "mats": 10, "rugs": 4}, "description_wc": 165, "description_text": "Whether you are looking to protect your flooring or decorate your space, Staples\u00ae carries a wide variety of Chair Mats, Floor Mats and Rugs for you. From residential to commercial, industrial to office, the proper floor covering can protect not only your floors but your employees and family. Chair Mats: Chair Mats give you a protective surface to save your flooring from excessive wear and tear, as well as allow your chair to roll more smoothly. Chair mats can be used on a variety of carpets, as well as hard floor surfaces like hardwood, laminate and tile floors. Floor Mats: Floor mats run the range from entrance mats to anti-fatigue mats. Staples\u00ae has floor mats for use indoors or outdoors to provide increased safety for customers and employees alike. Rugs: Rugs provide a splash of color to accent any space. From solid colors to ornate patterned rugs, they not only give you a touch of style, but help protect the flooring surface beneath them.", "parent_text": "Furniture | Chairs | Cabinets", "keyword_density": {"rugs": "2.4", "chair mats": "4.8", "chair": "3.0", "mats": "6.1"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "level": 0, "url": "http://www.staples.com/Furniture-Collections/cat_CG97", "text": "Furniture Collections", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Furniture Collections", "parent_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "keyword_count": {"furniture collections": 1, "furniture": 4}, "description_wc": 175, "description_text": "From traditional to modern designs, furniture collections let you choose a decor theme for your office that matches your personal style. Pick all of your pieces from one collection, like Regency, HON, or Martha Stewart, if you want a pulled-together look. Those with eclectic tastes can mix and match styles to suit their preferences. All-in-One Convenience If you want a complete office quickly, office bundles let you buy everything you need for one price. These systems include workstations outfitted with bookcase, file drawers, and plenty of space for your computer. Preassembled Preassembled furniture lets you get right to work as soon as the pieces are delivered. Desks and file cabinets come ready to use in a range of finishes and designs, letting you pick and choose what you need for a cohesive office decor. Durable Whether your office is in an industrial space or you just want your furniture to last through bumps, scratches, and spills, commercial office furniture is made to last. Look for wear-resistant finishes and reinforced file drawers.", "parent_text": "Furniture | Chairs | Cabinets", "keyword_density": {"furniture collections": "1.1", "furniture": "2.3"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "level": 0, "url": "http://www.staples.com/Desks/cat_CG33", "text": "Desks", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Desks", "parent_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "keyword_count": {"desks": 4}, "description_wc": 136, "description_text": "Your workspace should be as unique as you are. Browse our large selection of home and office desks for just the look you need. We carry table and writing desks as well as technology and computer desks for office or home use that are stylish and modern and have all the space you need to stay organized and get work done. Place an L-shaped desk in an office corner to free up space, or try one specially made with a pull-out surface for your laptop. We have both glass and wood desks, available in dark and light laminate finishes. Whether you\u2019re a busy parent looking to organize your family\u2019s affairs or you telecommute from your home office, all units are ready to assemble and ready to work just as hard as you.", "parent_text": "Furniture | Chairs | Cabinets", "keyword_density": {"desks": "2.9"}, "department_id": 19}
{"nr_products": 57, "level": -2, "url": "http://www.staples.com/Decorative-Accents/cat_CL168957", "text": "Decorative Accents", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_wc": 0, "parent_url": "http://www.staples.com/Wall-Clings-Decals/cat_DP5602", "parent_text": "Wall Clings & Decals", "department_text": "Furniture | Chairs | Cabinets", "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "level": 0, "url": "http://www.staples.com/Chairs/cat_CG32", "text": "Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Chairs", "parent_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "keyword_count": {"chairs": 9}, "description_wc": 180, "description_text": "Chairs are as important and necessary as furniture gets; whatever it is you do, you need a chair and the support and comfort it provides to make accomplishments possible. And if you're looking for the very best chairs, this is the best place to start. Our office chairs are built for real people doing real work. Big & Tall Chairs are precision engineered to support larger frames up to 500 lbs. And if you want to be kind to your frame, our Ergonomic Chairs provide a robust solution for busy environments for up to 24 hours at a time. If you'd like, you can even choose to customize one of our chairs and pick colors and textures that best fit your office. We have fun and unconventional seating like sofas, accent chairs and bean bag chairs , and we also have folding and stacking chairs that can transform a hall into an auditorium or banquet room. If seating is what you need, and really, everyone does, shop Staples and find the perfect seating option for any and all settings.", "parent_text": "Furniture | Chairs | Cabinets", "keyword_density": {"chairs": "5.0"}, "department_id": 19}
