{"department_text": "Furniture | Chairs | Cabinets", "level": 0, "url": "http://www.staples.com/File-Cabinets/cat_CG34", "text": "File Cabinets", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "File Cabinets", "parent_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "keyword_count": {"cabinets": 8, "file cabinets": 3, "file": 8}, "description_wc": 156, "description_text": "Staples has the right file cabinets for any situation, whether you need to store file folders, records, paper or other documents. We carry metal and wood filing cabinets, storage cabinets as well as vertical and lateral file cabinets . Variety - Pick from a range of file cabinet types including: lateral, vertical, mobile, flat file storage cabinets for drawings and blueprints, and fire resistant filing cabinets for your most important documents. Quality - Choose products from brands you trust like Staples, FireKing, HON, Basyx, Hirsh and Office Designs Security - Protect your data by purchasing a file cabinet that includes a lock or by adding a lock to your existing filing cabinets. The perfect file cabinet for your needs can be found here at Staples. Whether it's file cabinets, storage, or accessories, this is the place to explore the finest assortment and select one that will transform your productivity and make working and organizing easier than ever before.", "parent_text": "Furniture | Chairs | Cabinets", "keyword_density": {"cabinets": "5.2", "file cabinets": "3.9", "file": "5.2"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "level": -1, "url": "http://www.staples.com/Commercial-Office-Furniture-Collections/cat_DP8389", "text": "Commercial Office Furniture Collections", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Commercial Office Furniture Collections", "parent_url": "http://www.staples.com/Furniture-Collections/cat_CG97", "keyword_count": {"commercial": 2, "office": 1, "furniture": 4}, "description_wc": 63, "description_text": "The demands of a business environment call for sturdier constructed furniture. Commercial furniture is designed to meet those needs with features that range from scratch- and wear-resistant surfaces to reinforced file drawers. Staples\u00ae assortment of Commercial Furniture meets or exceeds ANSI/BIFMA furniture test standards to give you desks, files and and accessory pieces that can handle today's intensive office environment.", "parent_text": "Furniture Collections", "keyword_density": {"commercial": "3.2", "office": "1.6", "furniture": "6.3"}, "department_id": 19}
