{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 21, "level": -1, "url": "http://www.staples.com/Metal-Bookcases/cat_CL166209", "text": "Metal Bookcases", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Metal Bookcases", "parent_url": "http://www.staples.com/Bookcases/cat_CG31", "keyword_count": {"metal bookcases": 2}, "description_wc": 52, "description_text": "Metal bookcases are ideal for organizing areas where you need extra strong storage. Staples has a variety of sizes and colors to fit your home or office, even warehouse and industrial environments.. Whatever your storage needs are, from supplies to boxes to books, metal bookcases give you a heavy duty storage solution.", "parent_text": "Bookcases", "keyword_density": {"metal bookcases": "7.7"}, "department_id": 19}
