{"department_text": "Furniture | Chairs | Cabinets", "level": -1, "url": "http://www.staples.com/Small-Office-Home-Office-Furniture-Collections/cat_DP8326", "text": "Small Office / Home Office Furniture Collections", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Small Office / Home Office Furniture Collections", "parent_url": "http://www.staples.com/Furniture-Collections/cat_CG97", "keyword_count": {"small office home office": 1, "home office": 3, "collections": 2, "office": 5, "home": 4}, "description_wc": 85, "description_text": "Staples offers a wide range of solutions for your home office with our Small Office/Home Office (SOHO) Collections. Whether you are looking for a single Desk or a complete suite for your home or office, you can find it here; styles from traditional to contemporary and all points in between. There are options in wood, laminate, even metal and glass. For an extra added touch of style, we have signature collections such as Martha Stewart Home Office\u00ae and Ka thy Ireland\u00ae by Bush .", "parent_text": "Furniture Collections", "keyword_density": {"small office home office": "4.8", "home office": "7.1", "collections": "2.4", "office": "6.0", "home": "4.8"}, "department_id": 19}
