{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 8, "level": -1, "url": "http://www.staples.com/Treadmill-Desks/cat_CL207647", "text": "Treadmill Desks", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Treadmill Desks", "parent_url": "http://www.staples.com/Desks/cat_CG33", "keyword_count": {"treadmill desks": 2, "treadmill": 4, "desks": 3}, "description_wc": 68, "description_text": "Treadmill desks go well beyond a run of the mill computer desk by bringing health and happiness to your workday. Blending corporate and cardio, working and wellness, you can maintain a healthy lifestyle by combining your workload and your workout at a treadmill desk. Staples offers both complete treadmill desks and stand-alone treadmills and consoles designed to work with most standing height desks. Upgrade your workstation today!", "parent_text": "Desks", "keyword_density": {"treadmill desks": "5.9", "desks": "4.4", "treadmill": "5.9"}, "department_id": 19}
