{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 160, "level": -1, "url": "http://www.staples.com/Commercial-Office-Desks/cat_CL164550", "text": "Commercial Office Desks", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Commercial Office Desks", "parent_url": "http://www.staples.com/Desks/cat_CG33", "keyword_count": {"commercial office desks": 2, "commercial": 3, "office": 5, "desks": 8}, "description_wc": 224, "description_text": "Commercial office desks are designed to stand up to the wear and tear of industrial environments without sacrificing style. They are available in a range of finish options, so you can decide whether you want cherry or gray steel. Fold-and-stow and height-adjustable desks give you added organization freedom, so you can change up your space whenever you need. Built-In Organization Commercial office desks are available with built-in file cabinets, drawers, and pull-out shelves for your keyboard. Split-level desks give you a separate space for your computer monitor, making them great computer desks, so you have room for your technology, plus all of your papers and files, without feeling crowded. Just the Right Size Whether you need a minimalist-design desk to fit a smaller office or a full executive desk, options are available from less than 40 inches to more than 55 inches wide. Folding desks can be the perfect option if you don't need a dedicated workspace every day. Wear Resistant Commercial settings create a special set of challenges your desk will have to withstand. Durable scratch-resistant and spill-proof materials keep your office looking great day after day. For desks with the quality demanded by an office but built more simply for an educational environment, check out our selection of student desks .", "parent_text": "Desks", "keyword_density": {"desks": "3.6", "commercial": "1.3", "office": "2.2", "commercial office desks": "2.7"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 32, "level": -1, "url": "http://www.staples.com/School-Student-Desks-Study-Carrels/cat_CL164560", "text": "School Student Desks & Study Carrels", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "School Student Desks & Study Carrels", "parent_url": "http://www.staples.com/Desks/cat_CG33", "keyword_count": {"school": 2, "student desks": 3, "study": 1, "student": 6, "desks": 7}, "description_wc": 190, "description_text": "Students need good workspaces conducive to efficiency and creativity as much as anyone, and Staples has the best selection of student desks for school and education. Our assortment meets any set of needs and can accommodate any environment- from your room to the family's home office, we have a student desk or study carrel that\u2019s right for every workspace. We carry a wide variety of styles from streamlined mobile units to multi-functional student desks and credenzas. There are the ideal school desks designed to be used outside the classroom. Many desks come equipped with filing and supply drawers, so you can keep your most important materials organized and readily accessible. These student desks come in wood, laminate and glass, with a full spectrum of light and dark finishes. Expand your work surface and get additional storage by adding a credenza. Whatever your needs, we\u2019ve got a solution for you. For students looking for a more grown up workspace, browse our selection of computer desks, and for a glimpse into the future of desks and multi-use furniture, check out an awesome fitness-oriented treadmill desk .", "parent_text": "Desks", "keyword_density": {"study": "0.5", "school": "1.1", "student desks": "3.2", "student": "3.2", "desks": "3.7"}, "department_id": 19}
