{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 16, "level": -1, "url": "http://www.staples.com/File-Cabinet-Locks-Accessories/cat_CL163960", "text": "File Cabinet Locks/ Dividers/ Accessories", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "File Cabinet Locks/ Dividers/ Accessories", "parent_url": "http://www.staples.com/File-Cabinets/cat_CG34", "keyword_count": {"file cabinet locks": 2, "file cabinet": 6, "accessories": 4, "file cabinet locks dividers": 1, "locks": 3, "file": 9, "dividers": 2}, "description_wc": 133, "description_text": "File Cabinet locks, dividers, rails and accessories are a great way to keep your important files and records safe and organized for personal use or at the office. Necessary Accessories - Choose from file cabinet accessories like double hanging file racks, hanging file-folder frames, and file cabinet dividers, rails and movers. Effective Locking - Each file cabinet lock comes with two keys so that you have an extra key for a backup in case you lose the first one. Your locks will always work perfectly, and you will never be locked out of your own work. At Staples, not only will you get the best price, you can choose from the best file cabinet locks from the best high-security brands and enjoy top file cabinet accessories as well. Shop our great selection today!", "parent_text": "File Cabinets", "keyword_density": {"file cabinet locks": "4.5", "file cabinet": "9.0", "accessories": "3.0", "file cabinet locks dividers": "3.0", "locks": "2.3", "file": "6.8", "dividers": "1.5"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "level": -1, "url": "http://www.staples.com/Fire-Resistant-File-Cabinets/cat_DP1539", "text": "Fire Resistant File and Storage Cabinets", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Fire Resistant File and Storage Cabinets", "parent_url": "http://www.staples.com/File-Cabinets/cat_CG34", "keyword_count": {"storage cabinets": 2, "cabinets": 12, "fire": 24, "fire resistant file": 6, "fire resistant": 9, "file": 15}, "description_wc": 313, "description_text": "Fire Resistant File Cabinets - Protection When Things Heat Up. A fire safe or fire resistant file cabinet can protect your important documents and other valuables by storing them in an environment designed to survive high temperatures and stress. FireKing and Sentry products are designed and tested to ensure they meet UL fire and drop test requirements. Our cabinets have the highest level of fire protection and security of any you will find. Our top cabinet models are almost fireproof file cabinet grade, but as time renders any cabinet vulnerable to fire, we brand our fire protection cabinets \"Fire Resistant.\" In fact, almost all fireproof file cabinets are actually fire resistant file cabinets. But verbiage aside, you can be confident that your valuables are safe when you store them in a Staples fire safe file cabinet. More than just fire resistant - Fire resistant file cabinets provide protection against impacts so they protect your files from fire, falling objects, explosions and wall collapse. Although no retailer can truly offer fireproof file cabinets, our fire resistant file cabinet models are as close as it gets. Drawers Galore - Choose from 2 and 4 drawer fire safe cabinets in vertical or lateral configurations in a variety of depths and widths, as well as fire safe storage cabinets. Color variety - You have your option of fire resistant file cabinets in a multitude of colors, including black, white, putty, parchment, gray, and more. No need to get confused over the distinction between a fireproof file cabinet, which is a misleading term, and the fire resistant or fire safe file cabinet, which is the only level of real protection that cabinets offer. You just need to know that Staples carries the very best. And to store even more files and supplies, browse our excellent selection of storage cabinets , or choose a more standard cabinet type, a lateral file cabinet .", "parent_text": "File Cabinets", "keyword_density": {"storage cabinets": "1.3", "cabinets": "3.9", "fire": "7.7", "fire resistant file": "5.8", "fire resistant": "5.8", "file": "4.8"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 34, "level": -1, "url": "http://www.staples.com/Drafting-and-Specialty-Files/cat_CL140949", "text": "Drafting and Specialty Files", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Drafting and Specialty Files", "parent_url": "http://www.staples.com/File-Cabinets/cat_CG34", "keyword_count": {"drafting and specialty files": 4}, "description_wc": 204, "description_text": "Drafting and Specialty Files- Easy Organization When you want to stay organized, drafting and specialty files are ideal for your office space. They're made of durable and long-lasting fiberboard, wire, or other materials, and the variety of sizes helps you store anything you need to keep nearby. Easy Categorization - You can use labels or inserts on these boxes to keep yourself organized. With different shapes and sizes, they're easy to recognize. Varied Sizes - Varied sizes make it simpler to keep your things organized in drafting and specialty files without taking up too much space. Thin drawers are great for pencils, and wire frames are perfect for papers. Different Models - Wire frames might be your style, or you might want to look for a lighter alternative if you need to move your drafting and specialty files often. Fiberboard and cardboard are just two of the many other options. You'll find the best file cabinets here at Staples.com. And be sure to browse our file cabinet locks, extras and other accessories to ensure your cabinet is fully functional as soon as it is shipped to you, free of charge. At Staples, we make shopping for the best office supplies and furniture easy.", "parent_text": "File Cabinets", "keyword_density": {"drafting and specialty files": "7.8"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 46, "level": -1, "url": "http://www.staples.com/Mobile-Rolling-File-Cabinets/cat_CL158897", "text": "Mobile / Rolling File Cabinets", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Mobile / Rolling File Cabinets", "parent_url": "http://www.staples.com/File-Cabinets/cat_CG34", "keyword_count": {"mobile rolling file cabinets": 2, "mobile": 10, "mobile rolling file": 5, "file cabinets": 5, "file": 20, "rolling": 6}, "description_wc": 240, "description_text": "Mobile Rolling File Cabinets - Store Files Conveniently. With rolling mobile file cabinets, you can store your files in an out-of-the-way place and only take them out when needed. A mobile rolling file cabinet provides convenient storage for small offices and home offices. With a variety of colors, sizes, and materials to choose from, you can easily pick the best mobile rolling file cabinet to meet your needs. Multiple Sizes Available - Mobile file cabinets come in a variety of sizes, so you can store letter-sized files, legal-sized files, or both. You can also choose from single-drawer or two- and three-drawer mobile file cabinets so that you have the right amount of storage space you need for all your file folders. Sturdy Casters - Each cabinet comes with sturdy casters to make it easy to move, even when loaded down with files. With brands like HON and basyx to choose from, you can choose a mobile file cabinet that you can depend on to be durable and well constructed. Lockable - Most of the mobile rolling file cabinets come with built-in locks to keep your files secure. You'll never have to worry about your files falling into the wrong hands. A mobile rolling file cabinet makes file storage as easy as it gets. See our assortment for all your new mobile file cabinet needs, like file cabinet locks and more , right here at Staples.com.", "parent_text": "File Cabinets", "keyword_density": {"mobile rolling file cabinets": "3.3", "mobile": "4.2", "mobile rolling file": "6.3", "file cabinets": "4.2", "file": "8.4", "rolling": "2.5"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "level": -1, "url": "http://www.staples.com/Chair-Extras-Accessories/cat_DP1532", "text": "Chair Extras & Accessories", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Chair Extras & Accessories", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"chair": 14, "chair extras": 1, "accessories": 4}, "description_wc": 186, "description_text": "Accessories for Office Chairs- Durable and Comfortable. Chair extras and accessories let you customize your office chairs for greater comfort and lasting durability. Casters, arms, and other accessories are often interchangeable between chairs, letting you choose the right fit for your office. Enhanced comfort may lead to enhanced productivity among employees. Ergonomic Designs - Ergonomic designs in some chair accessories can help cut down on the chance of workers developing repeated motion injuries. Chair mats and cushions often feature ergonomic constructions and are of the highest quality. Added Comfort - Cushions and quality casters can help enhance the comfort of your office chairs. When it comes time to replace chairs outright, check out our ottomans and club chairs for even greater comfort. Replacement Parts - Replacement casters and arms can help keep your otherwise comfortable office chairs in service for longer. This eliminates the need to replace the entire chair and helps keep costs down. We have your chair needs covered way beyond just the basics. And if your chair is situated on a hardwood floor, be sure to choose a chair floor mat to ensure the best match.", "parent_text": "Chairs", "keyword_density": {"chair": "7.5", "chair extras": "1.1", "accessories": "2.2"}, "department_id": 19}
