{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 7, "level": -1, "url": "http://www.staples.com/Student-School-Chairs/cat_CL168922", "text": "Student / School Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Student / School Chairs", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"chairs": 10, "school": 7, "student school chairs": 3, "student": 12, "school chairs": 6}, "description_wc": 286, "description_text": "Student / School Chairs: Durable Seating with a Built-in Writing Surface. Student / school chairs with incorporated desks help cut costs when you need affordable seating and a surface for writing. Use these versatile student chairs in the workplace, classrooms, or any other area where multiple furnishings are required. With brands like Belnick and Flash Furniture available, you can also find convenient features well-designed into these school chairs for students, like under-chair storage and ergonomic backrests. Comfort for Students - Choose the student chairs built for school that are best suited to your classroom environment, such as ergonomic designs that provide back support when your students are seated for lengthy periods. Simplify storage and transportation between rooms with folding school chairs. For art studios with drafting or light tables, drafting stools offer height adjustability and convenient footrest bars. Attached Writing Platform - Attached writing tablets give students space to read or copy information from projection screens and blackboards. Both right- and left-orientation desks are available to ensure all students can write comfortably. Students can reposition the platforms of hinged writing tablets to easily exit their chairs. Basket Storage - Place textbooks and notepads underneath the seats, in their built-in storage baskets. The sturdy wire design can hold heavy books without straining the furniture. Durable Construction - Whether you opt for metal or plastic student school chairs, you can expect high-quality construction to withstand rigorous daily use. Design features like powder coating, cross-rail support, and laminate finishing reinforce these chairs against scuffing, impact, and everyday wear. Keep your students on the edge of their seats, but comfortable, with our school chairs. And for a lab environment, our selection of versatile stools offers even more seating variety.", "parent_text": "Chairs", "keyword_density": {"chairs": "3.5", "school": "2.4", "student": "4.2", "student school chairs": "3.1", "school chairs": "4.2"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 109, "level": -1, "url": "http://www.staples.com/Parsons-Chairs/cat_CL166181", "text": "Dining Room Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Dining Room Chairs", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"chairs": 3, "dining room": 3, "dining room chairs": 2}, "description_wc": 55, "description_text": "Dining Room chairs provide a comfortable solution for primary seating or as an accent chair. Parsons chairs can be used in the dining room, the office, or anywhere else you need a seat that is both stylish and comfortable. Staples also has counter (24\u201d high) and bar stool (30\u201d high) height dining room chairs available.", "parent_text": "Chairs", "keyword_density": {"chairs": "5.5", "dining room": "10.9", "dining room chairs": "10.9"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 271, "level": -1, "url": "http://www.staples.com/Banquet-Restaurant-Chairs/cat_CL168923", "text": "Banquet & Restaurant Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Banquet & Restaurant Chairs", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"chairs": 6, "banquet": 6, "banquet restaurant chairs": 5, "restaurant": 7}, "description_wc": 142, "description_text": "Banquet & Restaurant Chairs- Durable and Effective. Banquet & restaurant chairs are an excellent and versatile choice for additional seating. They work equally well whether you'll be using them in your office meeting space or in a restaurant. Restaurant / banquet chairs provide great comfort and are very versatile; they\u2019re the perfect accessory in most any office. Durable - Banquet & restaurant chairs are built to last. Their sturdy construction helps ensure that your seating can withstand the rigors of daily use. Versatile - The versatile design of banquet & restaurant chairs makes them a great choice for small to medium gatherings. If you're looking for high quality setup for even more guests, consider one of our luxurious sofas . Comfortable - Comfort is paramount in gathering areas. Banquet & restaurant chairs feature additional padding that can enhance comfort when guests are seated for long periods of time.", "parent_text": "Chairs", "keyword_density": {"chairs": "4.3", "banquet": "4.3", "banquet restaurant chairs": "10.6", "restaurant": "5.0"}, "department_id": 19}
