{"department_text": "Furniture | Chairs | Cabinets", "level": -1, "url": "http://www.staples.com/Reception-Guest-Chairs/cat_DP1534", "text": "Waiting / Reception Seating", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Waiting / Reception Seating", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"seating": 1, "reception": 3}, "description_wc": 63, "description_text": "Reception chairs make your guest and visitors feel comfortable. Versatile, stylish seating is here in the form of our reception and guest chairs. They will make the trip to your office or place of business and the time spent there both positive and pleasant. \u00a0And to add a true centerpiece to your reception area, consider adding one of our comfortable, plush futons .", "parent_text": "Chairs", "keyword_density": {"seating": "1.6", "reception": "4.8"}, "department_id": 19}
