{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 5, "level": -2, "url": "http://www.staples.com/Fire-Resistant-Storage/cat_CL162922", "text": "Fire Resistant Storage", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Fire Resistant Storage", "parent_url": "http://www.staples.com/Fire-Resistant-File-Cabinets/cat_DP1539", "keyword_count": {"fire": 10, "storage": 8, "fire resistant storage": 6}, "description_wc": 161, "description_text": "Fire Resistant Storage is the key to ensuring that your most valued documents and supplies survive a fire or heat-oriented disaster. Fire resistant storage cabinets from Staples are the best in fire safe storage of any models on the market, guaranteed to stand up to the wilting pressure and damaging potential of high temperatures. Fire resistant storage cabinets are spacious enough to protect a significant portion of what matters to you, and fire safe storage is crucial because you never know when circumstances you cannot control can potentially affect your livelihood. The right fire resistant storage cabinet will fit nicely in your room, blend well aesthetically with its surroundings, and obviously offer the very best in fire protection. Staples has your fire resistant storage cabinet needs covered in spades. Browse our selection today for what you'll need for great fire resistant storage cabinets, but also much needed accessories such as file cabinet locks and dividers, right here at Staples.com.", "parent_text": "Fire Resistant File and Storage Cabinets", "keyword_density": {"fire": "6.2", "fire resistant storage": "11.2", "storage": "5.0"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 16, "level": -1, "url": "http://www.staples.com/Logo-Sports-Chairs/cat_CL166457", "text": "Logo / Sports Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Logo / Sports Chairs", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"chairs": 6, "sports chairs": 3, "logo": 7, "logo sports chairs": 1, "sports": 8}, "description_wc": 167, "description_text": "Sports Chairs with Team Logos- The Best in Comfortable and Expressive Seating. Logo & Sports chairs let you show off your love for your favorite team in your office. Each sports chair features the logo of one of one hundred different MLB baseball, NFL football, NHL hockey, or NCAA collegiate teams. Our leather team, sports, and logo chairs provide excellent comfort with long-lasting construction. Show Your Love - Many sports fans wear ties and other business apparel to show support for their favorite teams. Sports logo chairs provide a lasting and vivid demonstration that helps set your seat apart from the others. Comfortable Construction - Sports chairs with logos feature the same comfortable materials and design elements found in many similar executive chair models. For a great alternative in seating featuring the most comfortable materials, give a bean bag chair a try. Ergonomic Design - The ergonomic design of many sports logo chairs lets you sit comfortably while working. Ergonomic considerations can help reduce the likelihood of repetitive motion injuries.", "parent_text": "Chairs", "keyword_density": {"chairs": "3.6", "sports chairs": "3.6", "sports": "4.8", "logo sports chairs": "1.8", "logo": "4.2"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 7, "level": -2, "url": "http://www.staples.com/Fire-Resistant-Lateral-Files/cat_CL162923", "text": "Fire Resistant Lateral Files", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Fire Resistant Lateral Files", "parent_url": "http://www.staples.com/Fire-Resistant-File-Cabinets/cat_DP1539", "keyword_count": {"fire": 7, "lateral": 5, "fire resistant lateral": 4}, "description_wc": 149, "description_text": "Fire Resistant Lateral File Cabinets are the standard way to protect your important documents and supplies from fire and excessive heat. A fire resistant lateral file cabinet is perfect for your office or even your home; wherever you need the highest level of protection for what it important to you. Fire Resistant lateral file cabinets are made of the highest quality fire safe materials and are the best suited equipment to ensure that what you want to keep for a lifetime stays yours, without compromise. Now that you have discovered our selection of fire resistant lateral file cabinets, the hardest part is simply picking your favorite. We cover all of your security-based fire safe lateral file cabinet needs, as well as other furniture you may be interested in, and for maximum storage capability, our wide storage cabinet selection will provide numerous top of the line models to consider.", "parent_text": "Fire Resistant File and Storage Cabinets", "keyword_density": {"fire": "4.7", "lateral": "3.4", "fire resistant lateral": "8.1"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 12, "level": -2, "url": "http://www.staples.com/Fire-Resistant-Vertical-Files/cat_CL162924", "text": "Fire Resistant Vertical Files", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Fire Resistant Vertical Files", "parent_url": "http://www.staples.com/Fire-Resistant-File-Cabinets/cat_DP1539", "keyword_count": {"files": 1, "fire": 7, "fire resistant vertical": 4, "vertical": 5}, "description_wc": 163, "description_text": "Fire Resistant Vertical File Cabinets are a great method of protecting crucial supplies and documents from dangerous heat and fire. A fire resistant vertical file cabinet is ideal for either home or office; wherever you need to protect what it important to you with the maximum level of security. Fire resistant vertical file cabinets are made of the best materials; they're absolutely the top equipment to prevent disaster from striking. With our selection of fire resistant vertical file cabinets, the easy part is done- you found the best place to go to meet your needs. The hard part is just choosing your model. Staples has all your security-based fire safe vertical file cabinet necessities covered, and we also carry a lot of other great furniture and room accompaniments. If you are more inclined to value mobility over fire resistance, choose a rolling mobile file cabinet so your files are able to accompany you as you move around in your work environment.", "parent_text": "Fire Resistant File and Storage Cabinets", "keyword_density": {"files": "0.6", "fire": "4.3", "vertical": "3.1", "fire resistant vertical": "7.4"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 159, "level": -1, "url": "http://www.staples.com/Club-Chairs-Ottomans/cat_CL161807", "text": "Club Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Club Chairs", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"club": 6, "chairs": 6, "club chairs": 5}, "description_wc": 221, "description_text": "Club Chairs and Ottomans: The Best in Cushioned Support. Club chairs and ottomans bring comfort to your personal workspace. The padded frames support your back and limbs, preventing soreness as you sit and work for long hours. You can also add these versatile furnishings to your reception area for clients. Reduce Stress During Work Hours - Club chairs and ottomans help you perform at your best by equipping your workspace with furnishings that cushion your body and promote healthy circulation. They soothe the body from every angle with padded seats, backrests, and armrests and an elevated platform for resting your legs. Pair these cozy club chairs with a magazine rack or nice sofa to accommodate employees and visitors in your break room or waiting room. Bonus Comfort Features - Choose club chairs and ottomans with relaxing design features. A reclining club chair's adjustable angles reduce strain on your back, knees, and legs. With brands like Flash Furniture available, Staples also offers massage chairs that you can easily operate by remote. Storage Options - Save money and space with this dual-purpose furniture. Storage ottomans from brands like Office Star contain spacious interior compartments where you can store magazines, books, and office supplies. Depending on your storage needs, you can choose from small models with deep compartments or bench-size furnishings with wide interiors.", "parent_text": "Chairs", "keyword_density": {"club": "2.7", "chairs": "2.7", "club chairs": "4.5"}, "department_id": 19}
{"nr_products": 9, "level": -2, "url": "http://www.staples.com/Chair-Dolly-Dollies/cat_CL210321", "text": "Chair Dolly / Dollies", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_wc": 0, "parent_url": "http://www.staples.com/Chair-Extras-Accessories/cat_DP1532", "parent_text": "Chair Extras & Accessories", "department_text": "Furniture | Chairs | Cabinets", "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 10, "level": -2, "url": "http://www.staples.com/Chair-Accessories/cat_CL167946", "text": "Chair Accessories", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Chair Accessories", "parent_url": "http://www.staples.com/Chair-Extras-Accessories/cat_DP1532", "keyword_count": {"chair": 9, "chair accessories": 4}, "description_wc": 99, "description_text": "Chair Accessories: Everything You Need for Your Chair Chair accessories are the sometimes forgotten product assortment that will keep your favorite share in top shape for years. Staples' Chair accessories include chair backrests, carts and color kits that will make sitting for longer periods of time a luxury instead of an inconvenience. Our chair backrests are of the utmost comfort, our chair carts make storage and mobility easy and a fabric or upholstery color kit will bring your chair to life. Browse our selection now and ensure that you treat yourself to the chair accessories that best suit you.", "parent_text": "Chair Extras & Accessories", "keyword_density": {"chair": "9.1", "chair accessories": "8.1"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 23, "level": -2, "url": "http://www.staples.com/Footrests/cat_CL161892", "text": "Footrests", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Footrests", "parent_url": "http://www.staples.com/Chair-Extras-Accessories/cat_DP1532", "keyword_count": {"footrests": 3}, "description_wc": 304, "description_text": "Footrests: Adjustable Lower-Body Support to Rest Your Feet. A footrest give you the flexibility to comfortably extend or elevate your legs when you're sitting upright at a desk. The perfect footrest can mean the difference between a nice environment and discomfort in your chair. The right one will support your lower body and keep you feeling fresh and spry throughout the day; by repositioning your legs and feet, you can easily relieve stress on other areas of the body. Brands like Fellowes and Safco offer customizable positions, allowing for a range of relaxing setups. Choose Your Own Position - Set up a comfortable work space with an adjustable footrest, which you can simply reposition to limit pressure on your frame. Depending on the type, you can modify the height or angle of the platform, allowing you to control how much you bend, raise, and straighten your legs, feet, or joints. If you choose a gliding model, you can use your feet to guide the platform into different positions without leaving your office chair. Ergonomic Design - Ergonomic footrests are crafted with two major benefits in mind: convenient transitioning and reduced stress on the body's most overworked joints and muscles. Subtle design features, such as inclined platforms, built-in massage balls, and rockers, are made to accommodate common sitting positions and deliver optimal comfort. High-Quality Materials - Staples offers several footrest models made from sturdy metal or resilient plastic materials, ensuring the durability and lifespan of each product. You'll find additional safeguards on many items, ranging from nonskid surfaces to locking mechanisms that secure your desired position. Our full selection of footrests has your needs covered, and they work great with stools too. Our selection of additional chair accessories, like chair mats , will make your favorite chair a great place to be.", "parent_text": "Chair Extras & Accessories", "keyword_density": {"footrests": "1.0"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 7, "level": -2, "url": "http://www.staples.com/Furniture-Pads-Protectors/cat_CL140914", "text": "Furniture Pads & Protectors", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Furniture Pads & Protectors", "parent_url": "http://www.staples.com/Chair-Extras-Accessories/cat_DP1532", "keyword_count": {"pads": 4, "furniture": 17, "furniture pads": 3, "protectors": 5}, "description_wc": 250, "description_text": "Furniture Pads and Protectors: Protect and Repair Your Chairs With a great selection of furniture pads and protectors on hand, you can easily move office furniture without worrying about dings or scrapes. Furniture sliders make moving bulky pieces of furniture a breeze, while self-adhesive clear surface furniture protectors ensure your glass tabletops survive the move without a scratch. If you accidentally tear one of your leather sofas, a leather repair kit can painlessly fix the damage. Easy Chip Repair - Wear and tear doesn't have to affect the look of your office furniture if you pad and protect it. Choose repair kits for furniture to keep your wood desks, tables, and bookcases looking brand new. Do-It-Yourself Convenience - Furniture pads and protectors help you take charge of keeping your office furniture looking presentable. You don't have to spend money on replacements or call in a professional when you have furniture protection and repair supplies in your utility closet. Reliable Protection - Our furniture protection category contains items such as sliders that can help you plan your next office move, so you don't damage your furniture in the process. Items like furniture polish make it easy to clean off surfaces and add a protective finish before and after the move. Furniture protectors and pads help keep your finest furniture and chairs feeling great and looking new. And for furniture options that require minimal effort but offer maximum comfort, browse our excellent variety of great bean bag chairs .", "parent_text": "Chair Extras & Accessories", "keyword_density": {"pads": "1.6", "protectors": "2.0", "furniture pads": "2.4", "furniture": "6.8"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 16, "level": -2, "url": "http://www.staples.com/Chair-Arms/cat_CL141105", "text": "Chair Arms", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Chair Arms", "parent_url": "http://www.staples.com/Chair-Extras-Accessories/cat_DP1532", "keyword_count": {"chair": 13, "arms": 7, "chair arms": 4}, "description_wc": 176, "description_text": "Chair Arms: Durable and Effective Support Chair arms are a key element in office ergonomics. Our unique yet universally comfortable chair arms provide great support for the elbows and shoulders of your employees or coworkers. This can lead to a more relaxed and productive work environment. Durable Construction - Standalone chair arms feature exceptional durability. They can be used to replace a worn or broken chair arm set and restore your office chairs back to working order. Extra Comfort - Adding arms to a chair or replacing lost or broken arms can allow the chair to provide extra padding and support. For even more comfort, try a pillow-like chair cushion. Ergonomic Design - Many chair arm sets feature ergonomic designs that help eliminate stress on the arms and shoulders. This can help posture and reduce the likelihood of stress injuries. Like with all chair extras and accessories, Staples has your arm and support needs covered. And if your chair is situated on a hardwood floor, be sure to choose a chair floor mat to ensure the best match.", "parent_text": "Chair Extras & Accessories", "keyword_density": {"chair": "7.4", "arms": "4.0", "chair arms": "4.5"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 29, "level": -2, "url": "http://www.staples.com/Chair-Cushions-Pads/cat_CL141955", "text": "Chair Cushions & Pads", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Chair Cushions & Pads", "parent_url": "http://www.staples.com/Chair-Extras-Accessories/cat_DP1532", "keyword_count": {"cushions": 9, "chair cushions pads": 2, "chair": 17, "pads": 3, "chair cushions": 5}, "description_wc": 241, "description_text": "Seat / chair cushions & pads transform the standard back support for office chairs into your own personal comfort zone. These plush, luxurious chair cushions fit snugly on any of your existing office chair seat / chair cushions or pads, bridging the uncomfortable gap between your body and its sometimes tenuous chair support system. Your spinal column will be soothed throughout the day, preventing a sore body and encouraging back support for office chairs, and all chairs, even if you'll be sitting for hours. Secure Support Straps - Save money on business furnishings with office chair seat cushions that add ergonomic lumbar support and upgrade your basic chairs, guaranteeing your chair back support will be plush and stable. Secure straps fit around your chairs' backrests to hold cushions firmly in place. Massage Technology - Avoid stiffness and soreness with massage back seat cushions that soothe sensitive muscles. Choose from a range of massage formats, including heat, cold packs, vibration, and pressure technology. Comfortable Padding - Seat / chair cushions & pads promote healthy alignment with extra padding that prevents slumped postures. Brands like Fellowes and Safco use pliable padding and offer the best in chair back support, such as memory foam back cushions, to make surfaces that conform to the shape of your lower back and spinal column. Chair Cushions soothe your spine with back support for office chairs. And if you plan to purchase a cushion, you might consider another key seat accessory- a chair mat .", "parent_text": "Chair Extras & Accessories", "keyword_density": {"cushions": "3.8", "chair cushions pads": "2.5", "chair cushions": "4.2", "chair": "7.1", "pads": "1.2"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 11, "level": -2, "url": "http://www.staples.com/Sofas-Collections/cat_CL210813", "text": "Sofas & Collections", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Sofas & Collections", "parent_url": "http://www.staples.com/Reception-Guest-Chairs/cat_DP1534", "keyword_count": {"collections": 1}, "description_wc": 66, "description_text": "Your Reception Area gives your customers their first impression of your business. Whether you are looking for a stylish single sofa or a coordinating seating group for 20, Staples\u00ae Couches & Collections will give you the options to create a waiting room area unique to your needs. Durable Leather and faux leather, stylish fabrics, accent pieces ranging from wood to glass are all just a click away.", "parent_text": "Waiting / Reception Seating", "keyword_density": {"collections": "1.5"}, "department_id": 19}
