{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 283, "level": -2, "url": "http://www.staples.com/Guest-Waiting-Room-Chairs/cat_CL70203", "text": "Reception / Waiting Room Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Reception / Waiting Room Chairs", "parent_url": "http://www.staples.com/Reception-Guest-Chairs/cat_DP1534", "keyword_count": {"chairs": 7, "waiting room": 3, "room": 4, "reception": 3, "waiting room chairs": 1}, "description_wc": 120, "description_text": "Guest chairs, also referred to as reception chairs or waiting room reception chairs, provide stylish lobby seating. When you need extra seating for your office or conference room, Staples\u00ae guest and waiting room chairs are an easy solution. Whether you choose a standalone style or one with coordinating office seating, we have a waiting room or guest chair for you. Choose leather, fabric or faux leather guest chairs in a variety of color options and frames. If it\u2019s style, comfort, durability or all three you are looking for, Staples gives you the answer. And if our guest reception chairs may not be enough seating for your busy office, consider one of our plush sofas or bean bag chairs .", "parent_text": "Waiting / Reception Seating", "keyword_density": {"chairs": "5.9", "waiting room": "5.0", "room": "3.4", "reception": "2.5", "waiting room chairs": "2.5"}, "department_id": 19}
