{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 12, "level": -2, "url": "http://www.staples.com/Casters/cat_CL140715", "text": "Casters", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Casters", "parent_url": "http://www.staples.com/Chair-Extras-Accessories/cat_DP1532", "keyword_count": {"casters": 10}, "description_wc": 200, "description_text": "Chair Casters: Repair Office Chairs Chair casters come in a variety of types, so you can get just the right casters to fit your needs. Whether your chairs roll across hard floors or chair mats, the right type of chair caster can keep your seat rolling smoothly. Staples provides many of the best chair casters from top brands such as Master Caster. Soft-Wheel Casters - Soft-wheel casters are ideal for use on chair mats and flat carpeting. This variety of chair caster allows for smooth rolling that won't damage your floors. Hard-Wheel Casters - A great hard-wheel chair caster provides smooth rolling on hard surfaces such as concrete and hardwood. They frequently have internal brakes to prevent the chair from rolling away as you sit down. Dual-Wheel Casters - Dual-wheel casters combine the best features of the hard- and soft-wheel casters for strength and durability in a variety of circumstances. They're an excellent choice for typical office chairs or home furniture. You will find the perfect caster for your chair here, and if your chair is situated on a hardwood floor, be sure to choose a chair floor mat to ensure the best match.", "parent_text": "Chair Extras & Accessories", "keyword_density": {"casters": "5.0"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 359, "level": -1, "url": "http://www.staples.com/Bar-Stools/cat_CL166182", "text": "Bar Stools", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Bar Stools", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"bar": 5, "bar stools": 4}, "description_wc": 123, "description_text": "Bar stools are a great choice for restaurants, home bars, and small offices because they blend trendy and luxurious so uniquely; they fit neatly in small spaces while providing comfortable seating. Many different colors and shapes of bar stools are available to fit your needs. Elegant Designs -Bar stools feature a wide selection of designs. This lets you match them to your existing decor more easily and helps ensure a pleasing aesthetic for any room. Comfortable and Durable - Bar stools are often constructed from heavy-duty metal or wooden materials. This ensures they remain sturdy even with regular use. Use one to create comfortable, cosmopolitan seating in almost any setting. For even greater comfort and an informal ambiance, try bean bag chairs .", "parent_text": "Chairs", "keyword_density": {"bar": "4.1", "bar stools": "6.6"}, "department_id": 19}
{"nr_products": 150, "level": -1, "url": "http://www.staples.com/Sofas-Benches/cat_CL163750", "text": "Sofas / Benches", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_wc": 0, "parent_url": "http://www.staples.com/Chairs/cat_CG32", "parent_text": "Chairs", "department_text": "Furniture | Chairs | Cabinets", "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 18, "level": -1, "url": "http://www.staples.com/Futons/cat_CL165808", "text": "Futons", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Futons", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"futons": 4}, "description_wc": 125, "description_text": "Futons: Great Seating for Busy Days & Plush Comfort Delivered in Spades. Futons bring a touch of informal comfort to an office setting, but still maintain a professional appearance. Staples has futons that you can use just about anywhere in your house or office. Most are multi-position and can convert from a sofa to lounger or a sleeper. Choose from many small and large futon sizes and rich colors. Our futons come complete with cushions and frames and some include pillows too. For a more formal group seating option, check out of excellent selection of sofa and benches ,or if a the large futon size is not the best fit for your office needs, consider a small but equally comfortable option, a Parsons chair .", "parent_text": "Chairs", "keyword_density": {"futons": "3.2"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 127, "level": -1, "url": "http://www.staples.com/Stools/cat_CL166357", "text": "Stools", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Stools", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"stools": 4}, "description_wc": 135, "description_text": "Stools provide a great seating solution for a variety of situations and setups. When chairs don't seem to pain perfectly with the room of your choice, Staples\u00ae stools come in a variety of shapes, sizes and colors that enhance your options. They can be used in applications such as medical offices, industrial and manufacturing facilities, retail and administrative settings, or anywhere else you can think of where additional seating is needed. You can easily find the stools you need here, and with rotating bases, your choice of back support and a large selection of styles and models, there's no reason to settle for anything less than the perfect seating arrangement. And for higher altitude seating or for more social and conversational environments, Staples has an excellent assortment of stylish bar stools as well.", "parent_text": "Chairs", "keyword_density": {"stools": "3.0"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 52, "level": -1, "url": "http://www.staples.com/Drafting-Chairs-Stools/cat_CL166264", "text": "Drafting Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Drafting Chairs", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"drafting chairs": 4, "drafting": 5}, "description_wc": 90, "description_text": "The Staples range of drafting chairs and drafting stools are designed for engineers, draftsmen, laboratory workers, technicians and others who require height adjustable and swivel seating. Drafting chairs are designed to help maintain focus for long periods of time. Controls to raise and lower our drafting chairs are within reach at all times and require little effort to operate. Nylon casters and solid engineering make Staples drafting chairs perfect for everyday use, but even if you are looking for more standard high-quality stools , we still have you covered.", "parent_text": "Chairs", "keyword_density": {"drafting chairs": "9.0", "drafting": "5.6"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 12, "level": -1, "url": "http://www.staples.com/Bean-Bag-Chairs/cat_CL165807", "text": "Bean Bag Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Bean Bag Chairs", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"bean bag": 5, "bean bag chairs": 4, "chairs": 5}, "description_wc": 128, "description_text": "Bean Bag Chairs: Plush Comfort, Casual Style. Bean bag chairs are really as fun as a chair can get. They come in fabulous fabrics and sizes that offer the perfect fit to any room and the ideal solution to your creative seating needs. Our bean bag chairs are unique- choose from several types of materials and colors from the classics to animal prints to hot lips. With our full selection, we have at least one bean bag chair that is perfect for you! Whatever seating setup you are looking to accomodate, Staples a chair that will really tie the room together. And if bean bag chairs are a bit too casual for your office setting or room theme, we recommend browsing our selection of comfortable Parsons chairs .", "parent_text": "Chairs", "keyword_density": {"bean bag": "7.9", "bean bag chairs": "9.4", "chairs": "3.9"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 352, "level": -1, "url": "http://www.staples.com/Stackable-Chairs/cat_CL166358", "text": "Stackable Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Stackable Chairs", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"chairs": 7, "stackable chairs": 2}, "description_wc": 108, "description_text": "Stackable Chairs: Great Mobile Seating When You Need It. When you need temporary seating, stacking chairs may be the answer for you. These chairs are easy to move and place, and stack for convenient storage. Stackable chairs can be used in theater and meeting applications, restaurant and banquet settings, or any other role where you need extra seating. Staples\u00ae can provide solutions ranging from padded to unpadded stacking chairs in materials such as fabric, faux leather or even mesh. Some collections even have chair carts to make it even easier to move your chairs. For a more exciting seating solution, browse our selection of bean bag chairs .", "parent_text": "Chairs", "keyword_density": {"chairs": "6.5", "stackable chairs": "3.7"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 63, "level": -1, "url": "http://www.staples.com/Big-and-Tall-Chairs/cat_CL166254", "text": "Big & Tall Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Big & Tall Chairs", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"chairs": 5, "big tall": 2}, "description_wc": 93, "description_text": "At Staples we know that one size does not fit all. Our Big & Tall office chairs are designed to support those of us with larger frames, providing comfort throughout the working day. Key features of these chairs include a heavy duty base and a steel frame. Easy to reach controls mean our Big & Tall office chairs can be fine-tuned for optimum user comfort and efficiency while providing support for up to 500 lbs. For a more diverse set of the most supportive and comfortable chairs, browse our assortment of club chairs .", "parent_text": "Chairs", "keyword_density": {"chairs": "5.4", "big tall": "4.3"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 237, "level": -1, "url": "http://www.staples.com/Folding-Chairs/cat_CL70204", "text": "Folding Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Folding Chairs", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"chairs": 6, "folding chairs": 4, "folding": 6}, "description_wc": 122, "description_text": "Folding Chairs: Pleasing Temporary Seating Made Easy. Folding chairs are the perfect solution for those occasions where additional seating is required. You may need a folding chair or two at the table for the holidays, or you may need to temporarily fill a gymnasium or auditorium. Staples\u00ae can provide folding chairs with metal or padded seats, molded plastic or upholstered fabric seats from brands like Samsonite, Cosco and more. When you need something easy to move and put up and take down, folding chairs provide the answer. For a fun additional temporary seating option, browse our selection of super comfortable bean bag chairs . Or for temporary seating that's more similar to a folding chair, check out our stacking chairs .", "parent_text": "Chairs", "keyword_density": {"chairs": "5.0", "folding chairs": "6.7", "folding": "5.0"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 137, "level": -1, "url": "http://www.staples.com/Accent-Chairs/cat_CL168925", "text": "Accent Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Accent Chairs", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"chairs": 5, "accent chairs": 4}, "description_wc": 211, "description_text": "Accent chairs from brands like Office Star add hints of style to your work environment. Soft padding provides a cozy place for visitors to sit, boosting their comfort levels as you interact. You can choose colors, styles, and fabrics that make sense for your office and clientele. Express Your Style - Accent chairs, futons , and other luxury decor work together to set the tone for your business and make strong impressions about your company culture. You may prefer traditional chair shapes and simple solid colors for conservative offices, while bright hues and contemporary patterned chairs will stand out in creative or artistic environments. Variety of Chair Shapes - Choose accent chairs that offer the most functional value for your business. Chaise lounges provide space to stretch out, and sectional-style furnishings offer flexibility for creating different arrangements. If body support tops your list of features, select chair models with armrests, contoured backrests, and thick seat cushions. Durable Upholstery - Upholstered accent chairs last longer when placed in the right environment. Low-maintenance fabrics like high-performance mesh and vinyl are made to maintain their durable condition when exposed to heavy use or when used in businesses that cater to children. Indulge in rich leather and plush materials for upscale lobbies and waiting rooms.", "parent_text": "Chairs", "keyword_density": {"chairs": "2.4", "accent chairs": "3.8"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 99, "level": -1, "url": "http://www.staples.com/Ergonomic-Chairs/cat_CL166253", "text": "Ergonomic Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Ergonomic Chairs", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"chairs": 6, "ergonomic chairs": 3, "ergonomic": 10}, "description_wc": 136, "description_text": "Ergonomic Chairs: Where Science & Performance Meet Comfort. Ergonomics is the science of human performance, and our great ergonomic chairs are built for optimal support and performance. Staples ergonomic office chairs are fully adjustable so that you can adjust your chair to fit you perfectly; they have controls and levers that are easy to operate and easy to reach. The level of support for your back, arms, and legs that an ergonomic office chair or an ergonomic desk chair can provide ensures that sitting for long periods of time will not be uncomfortable any longer. Sit back and relax into your work or favorite project with our fabulous ergonomic chairs. Whether you choose one of our deluxe ergonomic office chairs , ergonomic desk chairs or an ergonomic chair for your computer setup, Staples has your needs covered.", "parent_text": "Chairs", "keyword_density": {"chairs": "4.4", "ergonomic chairs": "4.4", "ergonomic": "7.4"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "level": -1, "url": "http://www.staples.com/Chair-Mats/cat_DP4478", "text": "Chair Mats", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Chair Mats", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"chair": 15, "mats": 8, "chair mats": 6}, "description_wc": 263, "description_text": "Chair Mats: Safeguard Delicate Floors. Chair mats help to preserve the quality of your business's floors by reducing wear from chair casters. Staples offers clear chair mats that display the underlying floor surface. The bottom of each chair mat is appropriately textured to match different types of flooring. No-Slip Design - If your office chairs have wheels, protect the floors with durable Staples chair mats that remain secured in one place. Depending on the type of flooring you have, each mat features a specific texture to prevent friction and grip the floor without scratching it. You can move around in the chair without causing it to slip or slide. Customized for Different Flooring - Choose the mat that matches your flooring, whether you have carpets or a hard surface. To ensure your floors are protected from damage, Staples carpet chair mats are customized for the pile size of your rug, ranging from thinner, flat carpeting to thick 1-inch piles. Ramped or Straight Edges - Because our mats are slightly inclined along the edges, you can safely roll most any chair on or off the mat without snagging the casters, allowing you to smoothly ease the chair wheels off the mat and onto the surrounding floor or carpet. Staples hard-floor chair mats, however, feature straight edges for a more consistent transition between flat surfaces. Our selection of mats are not just for chairs; they are perfect for stools too . And if your chair is situated on a hardwood floor, be sure to choose a chair floor mat to ensure the best match.", "parent_text": "Chairs", "keyword_density": {"chair": "5.7", "mats": "3.1", "chair mats": "4.6"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "level": -1, "url": "http://www.staples.com/Office-Chairs/cat_DP4972", "text": "Office Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Office Chairs", "parent_url": "http://www.staples.com/Chairs/cat_CG32", "keyword_count": {"chairs": 16, "office chairs": 4, "office": 8}, "description_wc": 214, "description_text": "Office chairs give you a variety of seating options, from desk chairs to task or computer chairs. If you are looking for an office chair or a desk chair for the busy executive or even something comfortable to use at home, Staples\u00ae can provide the perfect solution. Executive Chairs - These office chairs are normally designed with higher backs and extra padding. Executive Chairs are both comfortable and stylish; they work for most any office situation and can serve as ideal computer chairs for more leisurely productivity at home. Managers Chairs - With a variety of sizes and styles, managers chairs take office chairs and the benefits they offer to the next level. They cover a broad range of uses from desk chairs to computer chairs, and they're so comfortable that you may confuse sitting in one for relaxing in your favorite recliner. Task Chairs - Smaller scales and greater mobility are the hallmark of task chairs. There are styles with or without arms, making these ideal for your office, computer or desk chair. Get the perfect office chairs for you at Staples. And if you would like greater comfort, browse our selection of chair cushions . If you want a sturdier type of office chair for maximum support, see our big and tall chairs .", "parent_text": "Chairs", "keyword_density": {"chairs": "7.5", "office chairs": "3.8", "office": "3.8"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 62, "level": -1, "url": "http://www.staples.com/L-Desks/cat_CL164556", "text": "Corner / L Desks", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Corner / L Desks", "parent_url": "http://www.staples.com/Desks/cat_CG33", "keyword_count": {"l desks": 3, "corner l desks": 1, "corner": 4, "l": 36, "desks": 6}, "description_wc": 172, "description_text": "Corner / L-Desks offer the best in both worlds in office furniture. From a simple computer desk to a multifunctional cube desk with built-in hutch, your corner desk can be both stylish and functional. Choose from desktop materials like glass, wood, or laminate depending on how durable you want your desk to be. Match Your Style A small office doesn't have to be a bland office. L-Desks are available in a variety of designs, from traditional to contemporary, and finishes, giving you executive office style in a compact package. Maximize Your Space When you are working in a small or home office, every bit of space counts. Choose from desk shapes including U-desks, L-desks, and corner desks to best fit your office. Add more organization possibilities with a file cabinet or bookcase. Stay Green Environmentally friendly office furnishings let you amp up your office's sustainability practices. Corner desks made from recycled materials or those that are eco-certified help you keep your businesses carbon footprint down.", "parent_text": "Desks", "keyword_density": {"l desks": "3.5", "corner l desks": "1.7", "l": "20.9", "desks": "3.5", "corner": "2.3"}, "department_id": 19}
