{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 294, "level": -1, "url": "http://www.staples.com/Home-Computer-Desks/cat_CL210795", "text": "Home / Computer Desks", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Home / Computer Desks", "parent_url": "http://www.staples.com/Desks/cat_CG33", "keyword_count": {"home": 1, "computer desks": 2, "computer": 4, "desks": 3}, "description_wc": 141, "description_text": "The right computer desk is all you need to be efficient, organized and comfortable at work or at home. Our selection of computer desks is second to none, with a wide assortment of wooden and glass desks in different shapes and colors. Built to serve as the ideal workstation, our computer desks have plenty of drawers and storage space to keep your files and resources handy and more than enough surface space to ensure that everything you need can be neatly kept right in front of you. Whether you want a simple computer desk or a corner desk with hutches and extra storage space, Staples has your desk needs covered. And for the cutting edge in desk and exercise technology, try a brand new treadmill desk and stay physically fit while you give your mind a workout at the same time.", "parent_text": "Desks", "keyword_density": {"home": "0.7", "computer desks": "2.8", "computer": "2.8", "desks": "2.1"}, "department_id": 19}
{"department_text": "Furniture | Chairs | Cabinets", "level": -1, "url": "http://www.staples.com/Assembled-Commercial-Office-Furniture-Collections/cat_DP8434", "text": "Assembled Commercial Office Furniture Collections", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Assembled Commercial Office Furniture Collections", "parent_url": "http://www.staples.com/Furniture-Collections/cat_CG97", "keyword_count": {"assembled": 2, "furniture": 1}, "description_wc": 69, "description_text": "Today's business environment puts demands on everyone's schedules. With assembled furniture, we take the assembly proces out of the equation. Staples has a variety of options from assembled in the box all the way to White Glove\u00ae service, where all you do is open the door and tell them where you want it. If time or mechanical ability is a constraint, we have a solution for you.", "parent_text": "Furniture Collections", "keyword_density": {"assembled": "2.9", "furniture": "1.4"}, "department_id": 19}
