{"department_text": "Boards | Easels | Dry-Erase", "level": 0, "url": "http://www.staples.com/Magnets-Pins-Tacks/cat_DP2079", "text": "Magnets / Pins / Tacks", "department_url": "http://www.staples.com/Boards-Easels-Dry-Erase/cat_CG101", "description_title": "Magnets / Pins / Tacks", "parent_url": "http://www.staples.com/Boards-Easels-Dry-Erase/cat_CG101", "keyword_count": {"pins tacks": 1, "pins": 4, "tacks": 2, "magnets": 2}, "description_wc": 96, "description_text": "Whether you are hanging papers on a whiteboard or on a cork board, Staples\u00ae has you covered with our assortment of pins, tacks, and magnetic accessories. Staples\u00ae offers magnetic push pins, heavy-duty magnets, and colorful bubble magnets that stick to whiteboards and other metal surfaces. Or, choose from our wide selection of magnetic tapes, magnetic card holders, and write-on/wipe-off magnetic strips to add to your whiteboard. Additionally, if you are looking to hang papers and pictures on your cork board, choose from our wide selection of push pins, map pins, and tacks.", "parent_text": "Boards | Easels | Dry-Erase", "keyword_density": {"pins tacks": "2.1", "pins": "4.2", "tacks": "2.1", "magnets": "2.1"}, "department_id": 22}
