{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 36, "level": -2, "url": "http://www.staples.com/Bush-Westfield-Collection-Fully-Assembled/cat_CL209029", "text": "Bush\u00ae Westfield Collection, Fully Assembled", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Bush\u00ae Westfield Collection, Fully Assembled", "parent_url": "http://www.staples.com/Assembled-Commercial-Office-Furniture-Collections/cat_DP8434", "keyword_count": {"bush westfield": 1, "collection": 1}, "description_wc": 61, "description_text": "Bush Westfield is a modular furniture collection that can be configured to meet your exact needs. L-Desks, Executive Stations and even a unique Reception Desk are all available. Choose one of our preconfigured workstations or design you own. Thermal fused melamine worksufraces with PVC edge banding give you commercial grade quality that will hold up to the most demanding environments.", "parent_text": "Assembled Commercial Office Furniture Collections", "keyword_density": {"bush westfield": "3.3", "collection": "1.6"}, "department_id": 19}
