{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 382, "level": -2, "url": "http://www.staples.com/Task-Chairs/cat_CL166220", "text": "Task Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Task Chairs", "parent_url": "http://www.staples.com/Office-Chairs/cat_DP4972", "keyword_count": {"chairs": 7, "task chairs": 5, "task": 6}, "description_wc": 128, "description_text": "Task chairs are perfect for everyday use in your work or home office. Task chairs provide great ergonomic support, stylish finishes, and versatile use. Functional Task chairs are not only comfortable, but functional too. Task chairs can be used in traditional office environments, or even around your home. Adjustable heights and wheeled feet make these chairs capable of being used nearly anywhere. Pair a task chair with a mobile workstation to work comfortably anywhere. Comfortable It can be difficult to stay comfortable if you\u2019re sitting for extended periods of time. Luckily, Staples has a wide selection of comfortable task chairs to help you get through a long day of sitting. Most chairs have a variety of adjustments and settings to ensure a perfect fit for your body.", "parent_text": "Office Chairs", "keyword_density": {"chairs": "5.5", "task chairs": "7.8", "task": "4.7"}, "department_id": 19}
