{"department_text": "Gifts | Gift Cards", "level": 0, "url": "http://www.staples.com/Edible-Gifts-Desserts/cat_CG1252", "text": "Edible Gifts / Desserts", "department_url": "http://www.staples.com/Gifts-Gift-Cards/cat_SC1699", "description_title": "Edible Gifts / Desserts", "parent_url": "http://www.staples.com/Gifts-Gift-Cards/cat_SC1699", "keyword_count": {"gifts": 5, "desserts": 1, "edible gifts": 1}, "description_wc": 109, "description_text": "No matter what the occasion, Staples has the gourmet dessert gifts that are sure to be appreciated and enjoyed. We have a variety of edible gifts and gift baskets with cakes, cookies, and other desserts from brands like Mrs. Fields and Bake Me a Wish. Assorted flavors - Choose from a large selection of tasty cookie and cake flavors like triple chocolate cake, peanut butter cookies, chocolate chip cookies, and many more. Packaged ready gifts - Mrs. Fields original cookies and dessert gift baskets come packaged and gift-ready. Variety pack gifts - Variety dessert gifts are great to give for people whose likes and dislikes you might not be familiar with.", "parent_text": "Gifts | Gift Cards", "keyword_density": {"gifts": "4.6", "desserts": "0.9", "edible gifts": "1.8"}, "department_id": 28}
{"department_text": "Gifts | Gift Cards", "level": 0, "url": "http://www.staples.com/Gifts-Games-Accessories/cat_DP5203", "text": "Gifts, Games & Accessories", "department_url": "http://www.staples.com/Gifts-Gift-Cards/cat_SC1699", "description_title": "Gifts, Games & Accessories", "parent_url": "http://www.staples.com/Gifts-Gift-Cards/cat_SC1699", "keyword_count": {"gifts": 4, "games": 2, "accessories": 2, "gifts games": 1}, "description_wc": 163, "description_text": "Our gifts, games, and accessories category provides you with a wide variety of products that are suited for the professional world. Whether you want to send the more upscale humidors and figurines or are looking for custom apparel and novelty gifts, we have what you need for every occasion. Executive Gifts Whether you are giving your supervisor a birthday gift or want to reward one of your employees on an achievement or promotion, executive gifts are work appropriate. Choose from shaving sets, business card cases, shoes care accessories, and more. Jewelry and Cuff Links If you want a gift that is a bit more personal, check out the selection of jewelry boxes and cases, cuff links, and flasks. Wearing a wardrobe accessory is a great way for your recipient to remember you on a daily basis. Games Want to please the free-spirited person or competitive strategist in your life? Try a backgammon set from Bey-Berk Brands or a remote-controlled helicopter.", "parent_text": "Gifts | Gift Cards", "keyword_density": {"gifts": "2.5", "games": "1.2", "accessories": "1.2", "gifts games": "1.2"}, "department_id": 28}
{"department_text": "Furniture | Chairs | Cabinets", "nr_products": 537, "level": -2, "url": "http://www.staples.com/Manager-Executive-Chairs/cat_CL166219", "text": "Manager / Executive Chairs", "department_url": "http://www.staples.com/Furniture-Chairs-Cabinets/cat_SC2", "description_title": "Manager / Executive Chairs", "parent_url": "http://www.staples.com/Office-Chairs/cat_DP4972", "keyword_count": {"chairs": 5, "manager": 5, "manager executive chairs": 4}, "description_wc": 115, "description_text": "Manager / Executive chairs are perfect for everyday use in your home or office. Staples has a wide selection of manager / executive chairs to help you and your employees stay comfortable and productive. Large Selection Staples has a variety of manager\u2019s chairs to suit your needs. Choose from a large selection of colors, fabrics, and materials from brands like Safco, Hon, Boss, and many others. No matter what chair you choose, you\u2019ll be sure to love it. Comfortable Manager / executive chairs are a great choice for those who are sitting at their desk for extended periods of time. Manager / executive chairs offer superior comfort and personalization so that you can remain focused and productive.", "parent_text": "Office Chairs", "keyword_density": {"chairs": "4.3", "manager": "4.3", "manager executive chairs": "10.4"}, "department_id": 19}
{"department_text": "Gifts | Gift Cards", "nr_products": 4, "level": 0, "url": "http://www.staples.com/Custom-Photo-Gifts/cat_CL168343", "text": "Custom Photo Gifts", "department_url": "http://www.staples.com/Gifts-Gift-Cards/cat_SC1699", "description_title": "Custom Photo Gifts", "parent_url": "http://www.staples.com/Gifts-Gift-Cards/cat_SC1699", "keyword_count": {"photo": 9, "custom photo": 2, "custom": 3}, "description_wc": 154, "description_text": "Receiving a custom photo gift is sure to brighten anyone's day. Just select a regular-sized photo print of a cherished memory and get ready to take your picture to the next level. Enlargements Transform your family pictures into works of art by creating photo enlargements. You can choose the mounting, laminating, and size you want, ensuring your piece is one of a kind. Sports, Canvas, and Art Prints Staples EasyCanvas prints are printed on textured photo paper, so you get lightweight yet professional-looking art you can hang in your home or office. The sports and art prints are produced on HP Photo Gloss paper if you want something with a bit more shine. Photo Mugs Take the reins and design your own custom photo gift when you choose one of the photo mugs. Customize it with photos from your camera , print messages, or both to make it all your own.", "parent_text": "Gifts | Gift Cards", "keyword_density": {"photo": "5.9", "custom": "2.0", "custom photo": "2.6"}, "department_id": 28}
{"department_text": "Gifts | Gift Cards", "nr_products": 49, "level": 0, "url": "http://www.staples.com/E-Gift-Cards/cat_CL168827", "text": "E-Gift Cards", "department_url": "http://www.staples.com/Gifts-Gift-Cards/cat_SC1699", "description_title": "E-Gift Cards", "parent_url": "http://www.staples.com/Gifts-Gift-Cards/cat_SC1699", "keyword_count": {"e gift cards": 1, "cards": 2, "e gift": 4, "e": 71}, "description_wc": 134, "description_text": "Purchase an e-gift card to get variety, convenience, and quick delivery all in one. Whether you forgot a birthday or ran out of time before a special occasion, an e-gift card is sure to put a smile on the face of the special person in your life. Wide Selection No matter who you are shopping for or what the occasion is, we have the right e-gift card for you. Try Spafinder, Land's End, Nordstrom, or Sephora cards for the women in your life, while men are sure to appreciate selections including Home Depot, Lowes, Outback, and Cabela's. Quick Delivery E-gift cards are delivered via email. This gives you the added convenience of not having to pay postage or worry about things getting lost or stolen in the mail.", "parent_text": "Gifts | Gift Cards", "keyword_density": {"e gift cards": "2.2", "cards": "1.5", "e gift": "6.0", "e": "53.0"}, "department_id": 28}
