{"department_text": "Gifts | Gift Cards", "nr_products": 124, "level": 0, "url": "http://www.staples.com/Gift-Cards/cat_CL166326", "text": "Gift Cards", "department_url": "http://www.staples.com/Gifts-Gift-Cards/cat_SC1699", "description_title": "Gift Cards", "parent_url": "http://www.staples.com/Gifts-Gift-Cards/cat_SC1699", "keyword_count": {"gift cards": 8, "gift": 13}, "description_wc": 283, "description_text": "Gift cards offer convenience when you don't know what to get someone or you don't have the time to shop. Whether you are looking for an end-of-year gift for your child's teacher or need to send along congratulations, Staples gift cards are available with a variety of images to fit your occasion. You can also choose from our catalog of gift cards from various outside retailers, letting you personalize your purchase to the hobbies, taste preferences, or entertainment activities. Choose gift cards from businesses, such as Regal Cinemas or Dave n' Busters. Traditional gift cards are available to be sent through the mail, or you can choose to have your gift card delivered by email. Special Occasions When you need a gift for Mother's Day, Father's Day, or your anniversary, choose from popular retailers like Michael's, JC Penny, Kohls, Nike, Gamestop, and Texas Roadhouse. If you are celebrating a birthday or a similar occasion, consider treating your recipient to Cold Stone Creamery or California Pizza Kitchen. Congratulations Gift cards are the perfect substitute for the more impersonal gift of cash. Treat a recent graduate to a free coffee or movie with gift cards from Starbucks, Subway, Fandango, and AMC. If someone you know just received a promotion or other professional recognition, consider giving a Staples gift card for office supplies or one for a department store like Nordstrom for business attire. Just Because You don't have to have a reason to show your appreciation or love for someone. Our selection of gift cards is available whenever the mood strikes, and the range of amounts lets you decide whether you want to save or splurge.", "parent_text": "Gifts | Gift Cards", "keyword_density": {"gift cards": "5.7", "gift": "4.6"}, "department_id": 28}
