{"department_text": "Envelopes | Labels | Mailing", "level": -1, "url": "http://www.staples.com/Foil-Labels/cat_DP8255", "text": "Foil Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Foil Labels", "parent_url": "http://www.staples.com/Labels/cat_CG24", "keyword_count": {"labels": 8, "foil labels": 2}, "description_wc": 178, "description_text": "Foil\u00a0labels accommodate your creative projects and company mailings. Use your own printer to design shipping-ready postage, scannable codes, and washable images. Keep your printouts in usable condition with protective holders. Control Your Inventory Running a business is simpler with foil labels that allow you to rapidly produce everyday supplies ranging from employee name badges to bar codes. Conveniently format products like dot matrix labels and fabric transfers with computer software so that you can design the layout and print as many or as few labels as you need. Efficient Shipping Preparation For businesses with a steady stream of outgoing mail, use postal specialty labels to print professional shipping labels and stamps accepted by all major carriers. Mail pickups are quick and efficient when your packages are organized and ready for the receivers. Protect Your Projects Safeguard printouts that will be used daily with plastic label holders from top brands like Avery and Pan Co. Avoid damage by using durable labels sized for specific uses, including nametags, binder pockets, business cards, CD labels and CD inserts .", "parent_text": "Labels", "keyword_density": {"labels": "4.5", "foil labels": "2.3"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "level": -1, "url": "http://www.staples.com/Bar-Code-Labels/cat_DP2207", "text": "Bar Code (Thermal) Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Bar Code (Thermal) Labels", "parent_url": "http://www.staples.com/Labels/cat_CG24", "keyword_count": {"thermal labels": 2, "bar code": 5, "labels": 10, "thermal": 4, "bar code thermal labels": 1}, "description_wc": 179, "description_text": "With bar code labels, you can create high volumes of printed product tags. Thermal techniques enable fast printing when you only need basic content and limited color. A variety of labels will be compatible with your printing device. Easy Product Identification Simplify product management by using bar code labels to create scannable tags. Staples carries products that support two industry-leading techniques: direct thermal labels and thermal transfer labels. Heat-activated printing produces crisp images your scanner can easily detect. Plentiful Resources, Minimal Space Bar code labels are available in large quantities, so you can avoid shortages and readily produce more printouts. Bar code labels are sold in compact rolls and folded sheets, allowing you to stock thousands of tags in a small space. Tailored to Your Business Get the most value out of labels that offer wear-resistance and long-lasting print quality and that have an extended lifespan. Enjoy the ease of using universally compatible bar code thermal labels or choose product labels designed for point-of-sale printers from major brands like Intermec, Sato, and Zebra.", "parent_text": "Labels", "keyword_density": {"thermal labels": "2.2", "bar code": "5.6", "labels": "5.6", "thermal": "2.2", "bar code thermal labels": "2.2"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 2, "level": -1, "url": "http://www.staples.com/Personalized-Custom-Labels/cat_CL167717", "text": "Personalized / Custom Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Personalized / Custom Labels", "parent_url": "http://www.staples.com/Labels/cat_CG24", "keyword_count": {"custom labels": 4, "labels": 6, "custom": 14}, "description_wc": 215, "description_text": "Custom labels are perfect when you need to add a distinct touch to your office projects. This category of customized labeling options includes seals that can be attached to envelopes and cardstock for announcements, invitations and bumper stickers that can be designed to convey a message or company motto. There's no need to rely on generic labels when you have custom labels and their endless options. Custom Message Ensure that your next business event is properly branded with customized envelope seals that add a unique touch from the very first mailer. Your invitation envelopes are sure to catch the attention of customers when you use customization to show your attention to detail. Versatile Options Custom labels can be printed to suit your latest business project. Finishing options such as smooth, matte, and glossy help you design a custom piece that will impress your customers. Portable Messaging Let your customers and constituents spread your message out in the community with custom bumper stickers. These stickers are a gift as well as an astute marketing piece. Use custom labels for a special personal touch that will leave an impression instead of a blank. We also have you covered on customizable stickers for discs with our great selection of DVD & CD labels and DVD / CD inserts .", "parent_text": "Labels", "keyword_density": {"custom": "6.5", "labels": "2.8", "custom labels": "3.7"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 2, "level": -1, "url": "http://www.staples.com/Mailing-Seals/cat_CL163143", "text": "Mailing Seals", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Mailing Seals", "parent_url": "http://www.staples.com/Labels/cat_CG24", "keyword_count": {"mailing": 5, "mailing seals": 3, "seals": 6}, "description_wc": 126, "description_text": "Make a good impression with attractive mailing seals that hold your envelopes closed. Seal certificates, important letters, or daily correspondence with these seals. Choose from multiple colors and sizes to suit your mailing and presentation needs. Permanent Adhesive The permanent adhesive on these seals ensures that your letter- or legal-sized envelopes will stay closed. Self-adhesive mailing seals don't require sponges or water to apply. Attractive Mailing Recipients will appreciate the extra touch of style when they see these adhesive mailing seals. Choose a shiny seal for extra attention. Precise Application Choose seals with folding perforations to get just the right symmetry when you apply each seal over the edge of an envelope. These can also be used over the edge of folded brochures.", "parent_text": "Labels", "keyword_density": {"mailing seals": "4.8", "mailing": "4.0", "seals": "4.8"}, "department_id": 8}
{"nr_products": 167, "level": -1, "url": "http://www.staples.com/Inventory-Labels/cat_CL210061", "text": "Inventory Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_wc": 0, "parent_url": "http://www.staples.com/Labels/cat_CG24", "parent_text": "Labels", "department_text": "Envelopes | Labels | Mailing", "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 45, "level": -1, "url": "http://www.staples.com/Waterproof-Labels-Tags-Decals/cat_CL168967", "text": "Waterproof Labels Tags & Decals", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Waterproof Labels Tags & Decals", "parent_url": "http://www.staples.com/Labels/cat_CG24", "keyword_count": {"waterproof labels tags": 4, "waterproof": 5, "labels": 6, "decals": 6, "labels tags": 5, "tags": 6}, "description_wc": 206, "description_text": "If you need waterproof labels, tags, and decals that can be printed with your laser printer are the perfect solutions - Staples is the answer. Low-tack vinyl decals, permanent and removable labels, and hang tags from brands such as REVLAR make creating in-house custom signage a breeze. Save time and money by printing waterproof labels, tags, and decals only when needed. Quick Solutions Waterproof labels, tags, and decals that can be printed on your laser printer enable you to create signs and markers on an as-needed basis. You don't have to meet a minimum print requirement or spend money on more copies than you need to get the job done. Quality Output With various available paper finishes, such as clear gloss, matte, and frosted, your waterproof labels, tags, and decals will look like they were printed right at a print shop. You don't have to sacrifice professionalism with this in-house print option. Easy Customization These labels, tags, and decals can be used with a black-and-white or color laser printer to increase your customization options. Print signs and markers in sharp black-and-white or brilliant color and benefit from waterproof surfaces that ensure your printed items stay looking great.", "parent_text": "Labels", "keyword_density": {"waterproof labels tags": "5.8", "tags": "2.9", "labels": "2.9", "decals": "2.9", "waterproof": "2.4", "labels tags": "4.9"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 30, "level": -1, "url": "http://www.staples.com/Martha-Stewart-Home-Office-Labels/cat_CL204864", "text": "Martha Stewart Home Office Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Martha Stewart Home Office Labels", "parent_url": "http://www.staples.com/Labels/cat_CG24", "keyword_count": {"home": 2, "martha stewart home office labels": 1, "labels": 9, "office": 3, "martha stewart": 4}, "description_wc": 231, "description_text": "With Martha Stewart home/office labels, you'll have everything you need to organize every space in your home and your office. From labeling the canisters in your kitchen to organizing the files in your office, you'll be able to find just the right label to fit your needs. Dozens of shapes, sizes, and styles are available from which to choose, so you can express your personality while keeping your spaces neat and organized. Organized Kitchen Martha Stewart labels come in a variety of shapes and sizes for labeling shelves, jars, canisters, and more. With these labels, you'll always know where everything is in your kitchen, so you can always find what you need quickly and easily while making your favorite recipes. Convenient Mailing Whether you're mailing out invitations to a birthday party or sending out your latest small business brochures, Martha Stewart labels provide a variety of options from which to choose. You can choose fancy designs for a touch of flair or plain labels for a business-like appearance. Even weatherproof labels are available, so you can ensure that your labels will remain legible even in bad weather. Color-Coding Martha Stewart labels also come in a variety of colors, so you can easily color code your file folders for easy reference. With these labels, you can locate files easily just by looking at the colors.", "parent_text": "Labels", "keyword_density": {"home": "0.9", "martha stewart home office labels": "2.2", "labels": "3.9", "office": "1.3", "martha stewart": "3.5"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 17, "level": -1, "url": "http://www.staples.com/Product-Labels/cat_CL204863", "text": "Product Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Product Labels", "parent_url": "http://www.staples.com/Labels/cat_CG24", "keyword_count": {"product labels": 3, "product": 7, "labels": 9}, "description_wc": 195, "description_text": "Product labels are small details with big branding potential. Staples carries a wide range of printable products from brands like Avery, allowing you to display company labels or messages on shipped products, promotional gifts, and more. Choose the paper color and shape that fits your company logo designs. Easy Custom Label Creation Distinguish your business with product labels that reflect your brand and give customers a glimpse of your company culture. You can design custom labels any time and produce more from your inkjet or laser printer when your current stock runs low. Specialty Designs Use product labels to enhance your products and promotions with specialty designs, shapes, and textures that match your marketing materials, such as ovals, circles, kraft paper, and embossed texture. Clear labels are ideal for use on colorful or patterned mailers, while square labels are convenient for creating promotional QR bar codes and mailing labels are perfect for all your shipping needs. Print-to-Edge Capabilities Make sure your designs look clean and professional with labels that can be printed all the way to the edge. Edge-to-edge designs maximize printing space and bring attractive continuity to the final product.", "parent_text": "Labels", "keyword_density": {"product labels": "3.1", "product": "3.6", "labels": "4.6"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 10, "level": -1, "url": "http://www.staples.com/Non-Machine-Labels/cat_CL167943", "text": "Non-Machine Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Non-Machine Labels", "parent_url": "http://www.staples.com/Labels/cat_CG24", "keyword_count": {"labels": 9, "non machine labels": 4}, "description_wc": 179, "description_text": "With non-machine labels, you can easily find labels that are preprinted for immediate use. Whether you need alpha and numeric labels for coding your files or standard messages for labeling paperwork for clients, you're sure to find what you need. You can also get blank ones, so you can print your own labels from any laser or inkjet printer. Self-Adhesive Non-machine labels are self-adhesive for easy peel-and-stick use. With these labels, you can quickly and easily label hundreds of file folders with minimal effort. Convenient Preprinted Messages Non-machine labels come with a variety of preprinted messages that are commonly used by businesses. Whether you're marking client bills with past due notices or labeling paperwork by the year, these labels can make your job easier. Color-Coded Many of the alpha and numeric non-machine labels provide different colors for each letter and number, making files easy to color code. With color-coding, groups of files are easy to recognize, allowing you to locate the files you need quickly and easily.", "parent_text": "Labels", "keyword_density": {"labels": "5.0", "non machine labels": "6.7"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 66, "level": -1, "url": "http://www.staples.com/Shipping-Mailing-Labels/cat_CL164491", "text": "Shipping / Mailing Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Shipping / Mailing Labels", "parent_url": "http://www.staples.com/Labels/cat_CG24", "keyword_count": {"labels": 11, "shipping mailing labels": 4, "shipping": 7}, "description_wc": 181, "description_text": "Avery and Staples blank shipping & mailing labels are for creating sender and return address labels for letters and packages. Impress customers and avoid costly shipping mistakes by creating custom address labels for shipping materials. Use them with printable postage sheets to save time by avoiding the busy post office. For Letters and Packages The different shipping & mailing labels sizes allow you to create labels for envelopes and shipping boxes right from your computer. Print only what you need when you need it. Environmentally Friendly Complete the circle by using shipping & mailing labels made from 100 percent recycled paper. Specially designed labels hide handwriting and other preprinted labels, allowing you to reuse tubes, boxes, and envelopes. Customizable Labels designed for use with color printers have a matte white coating that makes colors pop. Create a lasting impression by designing custom shipping & mailing labels that include the company's logo. Weather Resistant Weatherproof labels repel moisture and resist tears and smudges, so addresses remain clear and easy to read. The strong adhesive ensures each label clings tightly to its package when in transit.", "parent_text": "Labels", "keyword_density": {"labels": "6.1", "shipping mailing labels": "6.6", "shipping": "3.9"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 25, "level": -1, "url": "http://www.staples.com/Identification-Labels-Pads/cat_CL141304", "text": "Identification Labels / Pads", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Identification Labels / Pads", "parent_url": "http://www.staples.com/Labels/cat_CG24", "keyword_count": {"labels": 10, "identification labels": 4}, "description_wc": 172, "description_text": "Identification labels eliminate confusion by clearly designating different items and storage contents. Adhesive designs allow you to stick labels directly onto products, folders, name badges, and more. With industry leaders like Avery designing these durable products, your identification labels are sure to withstand frequent contact or environmental changes. Labels for Every Task Without labeling tools, your business supplies would be chaotic and difficult to track down. Identification labels are the easy, inexpensive way to categorize everything in your office, including project binders, CDs, key cards, or information about new interns. Choose extra-durable permanent labels for category designations that won't need updating. Residue-Free Removal Avoid unattractive residue with removable labels that detach cleanly and that won't damage your folders or supply bins. Replace the identification labels as often as you like without sticky buildup standing in your way. Writable or Printable Fill out your labels with printed or handwritten text. Printable designs can be formatted on your computer for professional mailings, and handwritten labels are ideal for personal organization.", "parent_text": "Labels", "keyword_density": {"labels": "5.8", "identification labels": "4.7"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 18, "level": -1, "url": "http://www.staples.com/Color-Coding-Labels/cat_CL158984", "text": "Color Coding Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Color Coding Labels", "parent_url": "http://www.staples.com/Labels/cat_CG24", "keyword_count": {"color": 7, "labels": 10, "color coding labels": 4}, "description_wc": 180, "description_text": "Use color-coding labels to identify different groups of items or files. Whether you choose round or rectangular colored label styles, the labels feature bright finishes to simplify navigation. Apply labels to folders for tab division or use them to mark dates or instructions you don't want to overlook. Organize Your Work When your management skills need backup, use color-coding labels to simply and effectively organize documents, daily planners, and products. The vibrant label colors instantly draw your attention, quickly guiding you to the correct categories or reminding you of upcoming events. Print Labels in Bulk Writing out lengthy labeling projects can be excessively time consuming. Speed up the process with printable colored labels you can prepare using your computer. Format your color-coding labels with publishing software to ensure text fits neatly in the provided spaces. Keep Labels Intact Label pads conveniently store sheets of labels in compact form, so you can easily carry them to different locations. Your color-coding labels are safely held between the protective covers to prevent bending or exposure of the adhesive.", "parent_text": "Labels", "keyword_density": {"color": "3.9", "labels": "5.6", "color coding labels": "6.7"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 54, "level": -1, "url": "http://www.staples.com/Pre-Printed-Labels/cat_CL141636", "text": "Pre-Printed Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Pre-Printed Labels", "parent_url": "http://www.staples.com/Labels/cat_CG24", "keyword_count": {"pre": 6, "labels": 9, "printed labels": 4, "printed": 6}, "description_wc": 195, "description_text": "With preprinted labels, you can ensure that all your packages are shipped and handled properly. Whether you're shipping fragile merchandise or chemical supplies that could be hazardous, these labels let everyone know how to handle your package with care. You can feel confident that your package will arrive safely and that both the contents and the handlers will be protected from injury. Bold Colors Preprinted labels are printed with bold colors and vivid print, so they'll stand out and be noticed by everyone who handles the boxes or containers. Printed warnings are bold and easy to read, so you don't have to worry that your package will be handled improperly. Pressure-Sensitive Labels These preprinted labels are typically pressure sensitive, so you can peel and stick them quickly and easily. You don't need moisteners, heat, or anything else to adhere the label to your packages. Bulk Quantities Preprinted labels from brands such as Tape Logic typically come in rolls of five hundred labels, so you'll have plenty of labels for all your shipping needs. Simply attach the labels to your shipping boxes and they'll be all set to go.", "parent_text": "Labels", "keyword_density": {"pre": "3.1", "labels": "4.6", "printed labels": "4.1", "printed": "3.1"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 15, "level": -2, "url": "http://www.staples.com/Roll-Labels/cat_CL142724", "text": "Roll Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Roll Labels", "parent_url": "http://www.staples.com/Bar-Code-Labels/cat_DP2207", "keyword_count": {"roll labels": 4, "labels": 14}, "description_wc": 177, "description_text": "Roll labels function properly only when used with specially designed thermal transfer printers. However, they allow you to print barcodes, packaging labels, and other thermal labels quickly and easily. These labels stand up to heat, sunlight, and other abuses without becoming blurred, smudged, or faded. Long-Lasting Labels Roll labels for thermal transfer printer are designed to print labels that need to last for a long time. These labels are perfect for printing barcodes and package labels for products that may sit on shelves for months or years. Durable Results Roll labels are also durable, able to stand up to the rigorous conditions of shipping and handling. These labels remain clear and legible, even if they're exposed to high temperatures, bright sunshine, and rough handling. Multiple Sizes Roll labels come in a variety of sizes, so you can easily choose the label that best fits your needs. Whether you need small labels for printing simple barcodes or larger labels for printing detailed shipping information, you'll find just the right label to get the job done.", "parent_text": "Bar Code (Thermal) Labels", "keyword_density": {"roll labels": "4.5", "labels": "7.9"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 10, "level": -2, "url": "http://www.staples.com/Zebra-Labels/cat_CL142725", "text": "Zebra Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Zebra Labels", "parent_url": "http://www.staples.com/Bar-Code-Labels/cat_DP2207", "keyword_count": {"zebra labels": 3, "labels": 13, "zebra": 5}, "description_wc": 181, "description_text": "Pair Zebra labels with a Zebra brand printer to get the highest label quality. Use the convenient thermal technology to generate long-lasting label images for professional processing. Choose the labels you need for different types of content; both tickets and product labels are available. Definite Compatibility With so many point-of-sale systems on the market, buying Zebra labels ensures your paper media will fit perfectly inside your Zebra POS printers. Whether you choose fanfold stacks or machine roll labels , the labels will smoothly pass through your print engine without time-consuming interruptions. Labels for Every Application If your business uses thermal labels for multiple projects, stock up on different Zabra labels sizes. Enjoy the wide spacing of 4 x 8-inch labels for large price cards with barcodes or choose 4 x 3-inch labels for standard-size staff badges. Adhesive Options Zebra labels are available with either permanent or removable adhesive. Permanent adhesive is essential for long-term labeling needs, such as filing closets, while removable labels allow you to easily update inventory shelves or product tags.", "parent_text": "Bar Code (Thermal) Labels", "keyword_density": {"zebra labels": "3.3", "labels": "7.2", "zebra": "2.8"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 13, "level": -2, "url": "http://www.staples.com/Warehouse-Labels/cat_CL167814", "text": "Warehouse Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Warehouse Labels", "parent_url": "http://www.staples.com/Foil-Labels/cat_DP8255", "keyword_count": {"warehouse labels": 4, "labels": 8}, "description_wc": 172, "description_text": "With warehouse labels, you can display pricing, product details, and file categories on shelf fronts or storage containers. The labels are easy to attach and remove for frequent updating. Choose durable wear-resistant tabs or protect labels with plastic holders. Remove and Reuse Take the guesswork out of navigating inventory shelves with warehouse labels you can attach directly to the racks. With multiple brands like Slip Strip and Open-Edge available, you'll find self-adhesive, snap-on, and magnetic labels that can be reused. Use products with dry-erase surfaces for quick relabeling. Flexible Formats and Sizing Find compatible warehouse labels for different types of shelving, including standard C-channel card holders you can fill with slide-in inserts. Larger vinyl envelopes provide the space to share essential product information, such as discounted prices, bar codes, model numbers, and more. Customize the Length Rolls of warehouse labels offer flexibility when you need multiple sizes. Simply roll out the desired amount of material and trim the labels to any size you prefer.", "parent_text": "Foil Labels", "keyword_density": {"warehouse labels": "4.7", "labels": "4.7"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 19, "level": -2, "url": "http://www.staples.com/Intermec-Compatible-Labels/cat_CL142727", "text": "Intermec Compatible Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Intermec Compatible Labels", "parent_url": "http://www.staples.com/Bar-Code-Labels/cat_DP2207", "keyword_count": {"labels": 7, "intermec": 6, "intermec compatible": 4, "intermec compatible labels": 3}, "description_wc": 191, "description_text": "With a wide assortment of Intermec-compatible labels, organizing your inventory system has never been easier. These thermal bar code labels come in white and an array of colors, so you can create the type of product marker that works best with your system. This category includes Intermec-compatible labels that range in width from two to thirteen inches, so you can create bar codes that fit the size of each product appropriately. Versatile Options Intermec-compatible labels come in permanent- and removable-adhesive varieties, making it easy to choose the best label for the job. With the right Intermec printer, these labels can identify products in a wide range of business situations. Bulk Output Each Intermec-compatible label roll offers thousands of individual labels, so you can print bar codes in bulk. You can save time and money by not having to print each label on an individual sheet. Enhanced Mobility These thermal bar code labels fit in desktop and mobile Intermec printers, giving you enhanced options for working with your inventory. Products can be easily tagged when they come in the door or as they sit on the shelf.", "parent_text": "Bar Code (Thermal) Labels", "keyword_density": {"labels": "3.7", "intermec compatible": "4.2", "intermec compatible labels": "4.7", "intermec": "3.1"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 32, "level": -2, "url": "http://www.staples.com/Sato-Compatible-Labels/cat_CL142726", "text": "Sato Compatible Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Sato Compatible Labels", "parent_url": "http://www.staples.com/Bar-Code-Labels/cat_DP2207", "keyword_count": {"sato compatible labels": 2, "labels": 9, "sato": 3}, "description_wc": 160, "description_text": "Use Sato-compatible labels to print out product details or barcodes for use on products for sale or on office inventory. Simply slip a roll into your Sato label printer and start printing right away. Choose from a variety of colors and sizes to suit your needs. Multiple Color Options If you need your labels to stand out, choose labels in pink, yellow, orange, blue, or green. White labels are available for times when you need classic standardization. Size Compatibility Choose the right size label for your needs, including large 4\"x 6\" labels and smaller 3\"x 2\" labels. These labels can be used for labeling shipping boxes and corrugated mailers. Multipack Convenience These Sato-compatible labels come in packs of two or four to a carton, so you'll have extra rolls handy when your first roll runs low. Rolls contain up to 1,000 labels each, so you won't have to worry about changing them too often.", "parent_text": "Bar Code (Thermal) Labels", "keyword_density": {"sato compatible labels": "3.8", "labels": "5.6", "sato": "1.9"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 17, "level": -2, "url": "http://www.staples.com/Thermal-Transfer-Labels/cat_CL160011", "text": "Thermal Transfer Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Thermal Transfer Labels", "parent_url": "http://www.staples.com/Bar-Code-Labels/cat_DP2207", "keyword_count": {"transfer": 5, "thermal": 5, "labels": 9, "thermal transfer labels": 4}, "description_wc": 212, "description_text": "Use thermal transfer labels with a compatible printer to create durable adhesive tags you can use to identify your products. Each sheet is perforated, allowing you to neatly tear off individual labels. Staples carries these labels in multiple sizes to accommodate your printing needs. Long-Lasting Print Quality Thermal transfer labels are known for their resistance to discoloration, tearing, and other types of damage. These durable labels are made to withstand frequent customer traffic, making them ideal for creating resilient bar codes and product tags. Do-It-Yourself Production When paired with a thermal printer, the printed content is permanently transferred by using heat to melt resin- or wax-based ink directly onto the paper. Thermal transfer labels display crisp images that remain clear indefinitely so that labels can be viewed and scanned quickly. Flexible and Organized Choose the right label size for your products, such as smaller tags for compact items and spacious tags for bulkier items. Each set is organized into folded sheets that are easy to stack. Thanks to convenient perforations, it is easy to remove a single label without damaging the sheet or losing track of unused labels. Thermal transfer labels are perfect for a wide variety of uses, and Staples has you covered with a complete selection.", "parent_text": "Bar Code (Thermal) Labels", "keyword_density": {"transfer": "2.4", "thermal": "2.4", "labels": "4.2", "thermal transfer labels": "5.7"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 5, "level": -2, "url": "http://www.staples.com/Direct-Thermal-Labels/cat_CL160010", "text": "Direct Thermal Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Direct Thermal Labels", "parent_url": "http://www.staples.com/Bar-Code-Labels/cat_DP2207", "keyword_count": {"labels": 11, "direct thermal labels": 4}, "description_wc": 216, "description_text": "Direct thermal labels offer one of the least expensive printing methods for producing large quantities of bar codes, package labels, and other items that need to be scanned. Heat activates the specially treated paper to produce a crisp black image that your scanner can read effortlessly. Buy these labels in convenient rolls or fanfold sheets. Self-Contained Design Direct thermal labels don't require ink during the printing process. Chemicals contained within the paper cause the surface to darken in specific areas, generating your desired image. The image lifespan is ideal for cost-effective printing of short-term labels, such as visitor badges, patient tags, shipping labels, and bar codes on food products. Find the Right Size Size is important when you need extra space for product or patient information. Choose from several sizes of direct thermal labels, and neatly detach individual stickers along the perforated guidelines. Peel and Adhere Once your direct thermal labels are formatted and printed, you can immediately attach them to your envelopes, products, wristbands, and other surfaces of your choice. Simply separate the labels from their backings and apply the adhesive sides to your chosen items. These labels are perfect for all of your bar code labeling needs, and for point of sale, check out our selection of roll labels .", "parent_text": "Bar Code (Thermal) Labels", "keyword_density": {"labels": "5.1", "direct thermal labels": "5.6"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 8, "level": -2, "url": "http://www.staples.com/Shipping-Damage-Indicators/cat_CL167832", "text": "Shipping Damage Indicators", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Shipping Damage Indicators", "parent_url": "http://www.staples.com/Foil-Labels/cat_DP8255", "keyword_count": {"indicators": 6, "damage indicators": 3, "shipping damage indicators": 2, "damage": 4, "shipping": 4}, "description_wc": 167, "description_text": "Shipping damage indicators let you know when your business packages were exposed to harmful conditions. Adhesive backing secures the labels to your boxes during transport. Shipping damage indicators detect conditions such as tilting and impact, so receivers know when to be extra careful with the package contents. Multiple Detection Levels Safeguard your shipping boxes with indicator labels that provide different detection levels, depending on the package type. Shock indicators reveal signs of impact damage, while tilt indicators inform you that boxes were stored upside down or at other unsafe angles. Straightforward Instructions Purchase matching instruction labels to make sure receivers know how to handle and troubleshoot shipping issues. With easily understandable instructions and brightly colored indicators, receivers will immediately recognize that your package is high priority and should be treated with care. Reusable Design Choose resettable damage indicators from brands like Drop-N-Tell to reuse your labels on multiple packages. With products that offer as many as fifty uses, protecting your packages can be cost efficient.", "parent_text": "Foil Labels", "keyword_density": {"indicators": "3.6", "damage indicators": "3.6", "shipping damage indicators": "3.6", "damage": "2.4", "shipping": "2.4"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 9, "level": -2, "url": "http://www.staples.com/Label-Holders/cat_CL141336", "text": "Label Holders", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Label Holders", "parent_url": "http://www.staples.com/Foil-Labels/cat_DP8255", "keyword_count": {"holders": 8, "label holders": 4, "label": 9}, "description_wc": 157, "description_text": "Label holders are designed to protect the labels you've written so that they won't smear. Magnetic holders that work well on metal file cabinets and bookcases are available, and you can also use the holders on individual files. Label holders can even be used to hold badges and nametags, which you can use to identify employees. Protect Your Labels First, you'll want to find labels, you like; of course, you should be concerned about their durability. Label holders help protect your labels from smearing, water damage, and more. Magnetic Backing If you like to place labels on metal cabinets, refrigerators, or other areas, you'll love being able to use magnetic holders. These can be used on any magnetic surface. Nametags Made Simple Simply slip nametags inside holders and distribute them to your employees. These label holders come in multiple sizes, so you can choose the nametag size that works best for your needs.", "parent_text": "Foil Labels", "keyword_density": {"holders": "5.1", "label holders": "5.1", "label": "5.7"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "level": -1, "url": "http://www.staples.com/Avery-Labels/cat_DP8585", "text": "Avery\u00ae Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Avery\u00ae Labels", "parent_url": "http://www.staples.com/Labels/cat_CG24", "keyword_count": {"avery labels": 4, "labels": 8}, "description_wc": 171, "description_text": "Avery labels are designed to help you tackle a variety of office jobs from labeling inventory to mailing advertisements. Strong adhesive backing ensures you don't have to constantly replace the labels, and quality paper provides a high-contrast background so your text is clearly visible. Efficient Organization Avery labels make labeling and keeping track of inventory easy with labels for file folders, magazine holders, and other products. There are also color-coded options, letting your organize your office so you can find what you need at a glance. Quicker Mailing Address and shipping labels streamline the office mailroom. Whether you are sending out a bulk mailing, advertising a special promotion, or just need a form signed, Avery labels get your papers off your desk and in the mail without having to hand address every envelope. Easy Identification Name tag labels are a low-cost way to make introductions painless at the next company meeting. These Avery labels are also perfect for use as temporary ID badges for visitors or volunteers.", "parent_text": "Labels", "keyword_density": {"avery labels": "4.7", "labels": "4.7"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 5, "level": -2, "url": "http://www.staples.com/Dot-Matrix-Labels/cat_CL167987", "text": "Dot Matrix Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Dot Matrix Labels", "parent_url": "http://www.staples.com/Foil-Labels/cat_DP8255", "keyword_count": {"dot matrix labels": 4, "labels": 5, "dot matrix": 5}, "description_wc": 171, "description_text": "The versatility of dot matrix labels allows you to print and categorize anything from file boxes to messy wires. The low-cost printing technique saves resources while producing basic text and images accurately. The bright white surface provides the perfect contrast for dark text so that you can easily read each label. Sharp Print Quality Present your products professionally by using dot matrix labels to create retail tags and bar codes. When run through compatible dot matrix printers, multiple labels are printed rapidly by using tiny wire tips that precisely form each letter. Low-Cost Categorization Whether you need to ship orders, organize inventory shelves, or identify computer parts, dot matrix labels provide a quick method for categorizing important items. The adhesive backing sticks to most surfaces and remains intact over time, preventing confusion and disorder in your stock room. Nonslip Design With textured backing, these printable dot matrix labels move through your device without snagging and slipping. Select the best label size to fit your machine and avoid cramped printing.", "parent_text": "Foil Labels", "keyword_density": {"dot matrix labels": "7.0", "labels": "2.9", "dot matrix": "5.8"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Desktop-Postal-Center/cat_CL164918", "text": "Desktop Postal Center", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Desktop Postal Center", "parent_url": "http://www.staples.com/Foil-Labels/cat_DP8255", "keyword_count": {"desktop postal center": 2, "postal": 5}, "description_wc": 178, "description_text": "With the Desktop Postal Center, you can have postage or mailing labels ready before your packages are picked up. Print out different sizes for boxes and envelopes by using an inkjet or laser printer. Calculate the correct postage and produce corresponding stamps. User-Friendly Software Take advantage of on-site postal preparation with Desktop Postal Center tools created by Avery and Stamps.com. The starter software helps you choose the right shipping labels for your USPS packages, whether you need scannable bar codes for your shipping boxes or separate sender and recipient address labels for envelopes. Fewer Post Office Trips Make better use of the time you normally spend running postal errands. With convenient templates, you can design and print new labels quickly and get back to more important tasks. Your business can use the same services offered at official USPS locations, such as international mail and parcel post. Reduce Postage Costs Optimize your resources by printing out exactly the right postage values for your packages. The starter kit includes a postal scale, so you can obtain precise measurements.", "parent_text": "Foil Labels", "keyword_density": {"desktop postal center": "3.4", "postal": "2.8"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Foil-Labels/cat_CL204872", "text": "Foils & Transfers", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Foils & Transfers", "parent_url": "http://www.staples.com/Foil-Labels/cat_DP8255", "keyword_count": {"transfers": 5, "foils": 4}, "description_wc": 220, "description_text": "Foils and transfers are great ways to record progress, decorate papers and posters and even create personalized T-shirts and other items such as achievement awards. Whether you're a company tracking sales goals or a teacher trying to encourage students, you can find plenty of creative ways to keep things organized and keep people motivated. Creating personalized shirts and hats as rewards can encourage teamwork and motivate progress. One-of-a-Kind Items Foils and transfers make it easy to create one-of-a-kind items and gifts that every recipient will treasure. With a package of fabric transfers, a computer, and a printer, you can create original artwork, print it onto a transfer, and then create hats, T-shirts, aprons, and other unique items. Reward Behaviors Foils and transfers include star stickers, which are great rewards to give young kids for good behavior or successful completion of assignments. You can easily create charts on poster board and track progress over time, offering bigger rewards when a certain number of stars are acquired. Boost Creativity Foils and transfers can be used for a variety of arts and craft projects. Both kids and adults will have fun creating designs that are uniquely their own, especially when they can transfer their art to items they can proudly wear day after day.", "parent_text": "Foil Labels", "keyword_density": {"transfers": "2.3", "foils": "1.8"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 41, "level": -1, "url": "http://www.staples.com/Address-Labels/cat_CL140955", "text": "Address Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Address Labels", "parent_url": "http://www.staples.com/Labels/cat_CG24", "keyword_count": {"labels": 10, "address labels": 4}, "description_wc": 176, "description_text": "Address labels are always in demand, and you can produce them on the spot with printable products. Select professional labels to enhance your mailings or to clearly display important messages. Find products for every occasion and recipient from major brands like Avery. Print High Quantities Quickly Customize your address labels to fit your businesses projects by incorporating your chosen fonts and logos. Prepare labels on your computer and send them straight to the on-site printer. With copier labels, you can conveniently save your master layouts and produce hundreds of sheets in minutes. Extra Visibility Your recipients won't overlook essential instructions or promotional details when you use high-visibility address labels. Whether you choose a white or color variety, these eye-catching labels feature a higher brightness level and provide sharp text contrast. Permanent Adhesive Make sure address labels stay where they belong with durable adhesives. Your labels will remain firmly fixed so that packages reach your clients safely. You can also find repositionable labels that won't damage your mailers when you remove them.", "parent_text": "Labels", "keyword_density": {"labels": "5.7", "address labels": "4.5"}, "department_id": 8}
