{"department_text": "Envelopes | Labels | Mailing", "nr_products": 19, "level": -2, "url": "http://www.staples.com/Avery-Shipping-Mailing-Labels/cat_CL210826", "text": "Avery\u00ae Shipping / Mailing Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Avery\u00ae Shipping / Mailing Labels", "parent_url": "http://www.staples.com/Avery-Labels/cat_DP8585", "keyword_count": {"labels": 8, "mailing labels": 2, "shipping": 6, "avery shipping": 2}, "description_wc": 167, "description_text": "Avery shipping and mailing labels are designed to meet your business's shipping needs and your budget. Use traditional white labels for a classic look, colored options to add pizzazz, or brown for a flawless, professional finish on shipping boxes. These labels are compatible with most printers, so you can quickly create as many or as little as you need. Correct Errors Quickly Repositionable labels come off cleanly and still have enough stick left to securely label your packages. Don't worry about accidentally labeling the wrong side of envelopes or boxes. Don't Worry about the Weather Weatherproof shipping labels are designed to stand up to rainy conditions and keep your ink from running. These durable labels won't curl or lift, despite stormy weather. Repurpose and Reuse Avery shipping and mailing labels up your office's green factor by making it easy to repurpose or reuse packaging and shipping materials. TrueBlock technology ensure that anything underneath the label, including old labels, is completely covered up.", "parent_text": "Avery\u00ae Labels", "keyword_density": {"labels": "4.8", "shipping": "3.6", "mailing labels": "2.4", "avery shipping": "2.4"}, "department_id": 8}
