{"department_text": "Envelopes | Labels | Mailing", "nr_products": 17, "level": -2, "url": "http://www.staples.com/Avery-Product-Labels/cat_CL210825", "text": "Avery\u00ae Product Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Avery\u00ae Product Labels", "parent_url": "http://www.staples.com/Avery-Labels/cat_DP8585", "keyword_count": {"product": 4, "labels": 7, "avery product labels": 2}, "description_wc": 155, "description_text": "Avery product labels are designed with both function and style in mind. Easy-peel technology ensures the labels go on right the first time without curling or bending, and the variety of shapes, including arched labels, let you choose a label shape that fits the style and packaging of your product. No More Ugly Margins You don't have to have a margin around your label when you use options that let your print to the edge. Create a custom border or a high-contrast label with a color background. Complete Coverage TrueBlock technology ensures your labels completely cover the surface of your product or its packaging, creating an professional, opaque appearance. These kinds of labels are especially suitable for use on brightly colored or dark surfaces. Easy Printing Avery product labels are compatible with both inkjet and laser printers. This makes it easy to print off labels from your office whenever you need to.", "parent_text": "Avery\u00ae Labels", "keyword_density": {"product": "2.6", "labels": "4.5", "avery product labels": "3.9"}, "department_id": 8}
