{"department_text": "Envelopes | Labels | Mailing", "nr_products": 13, "level": -2, "url": "http://www.staples.com/Avery-Name-Badges-Holders/cat_CL210830", "text": "Avery\u00ae Name Badges / Holders", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Avery\u00ae Name Badges / Holders", "parent_url": "http://www.staples.com/Avery-Labels/cat_DP8585", "keyword_count": {"holders": 4, "avery name badges": 2, "name": 5, "badges": 4}, "description_wc": 192, "description_text": "Avery name badges and holders help you add extra security to your workplace. Whether you use the holders for plain name tags or need to give employees a safe place to store their keycards, these holders reduce the risk of lost or stolen IDs. Make sure restricted areas are protected by supplying an ID and holder to each worker. Create Temporary IDs Make it easy to remember everyone's name or create temporary guest badges with self-adhesive labels. Customize each blank label with a permanent marker or print out several volunteer or visitor passes at once. Laminate On the Go Self-laminating name tags let you create a professional looking ID quickly, even if you don't have laminating equipment in your office. The included clips let you print, laminate, and have the ID ready to use right away. Keep Badges Secure Supplying you workers with Avery name badges and holders makes it easy for them to keep their IDs handy at all times. Whether you select a clip-, pin-, or hanging-style badge holder, the clear plastic and accessible design ensures IDs are at the ready when needed.", "parent_text": "Avery\u00ae Labels", "keyword_density": {"holders": "2.1", "avery name badges": "3.2", "name": "2.6", "badges": "2.1"}, "department_id": 8}
