{"department_text": "Envelopes | Labels | Mailing", "nr_products": 5, "level": -2, "url": "http://www.staples.com/Avery-Color-Coding-Labels/cat_CL210828", "text": "Avery\u00ae Color Coding Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Avery\u00ae Color Coding Labels", "parent_url": "http://www.staples.com/Avery-Labels/cat_DP8585", "keyword_count": {"color": 5, "color coding": 3, "avery color coding labels": 2, "labels": 7}, "description_wc": 170, "description_text": "Avery color-coding labels help you create an instant organizing system without the need for lots of writing. Choose colors that match certain themes, like green for financial records, so you instantly know which drawer, file, or binder to pull. These labels can also be printed or written on, giving you even more flexibility. Organize and Reorganize Change your color-coding system on a whim or repurpose old file folders with removable and repositionable Avery color-coding labels. These labels come off easily and don't leave behind traces of paper or sticky residue. Printer Compatible If you need a lot of labels and don't want to write them all by hand, options that work with both laser and inkjet prints save you time. Printing labels also creates a uniform, professional look. Transparent Labeling See-through labels let you color-code and organize without covering up vital information on products and files. Keep two different sizes in the office supply closet, so you can label small and large items.", "parent_text": "Avery\u00ae Labels", "keyword_density": {"color": "2.9", "color coding": "3.5", "avery color coding labels": "4.7", "labels": "4.1"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 7, "level": -2, "url": "http://www.staples.com/Avery-File-Folder-Labels/cat_CL210829", "text": "Avery\u00ae File Folder Labels", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Avery\u00ae File Folder Labels", "parent_url": "http://www.staples.com/Avery-Labels/cat_DP8585", "keyword_count": {"avery file folder labels": 2, "labels": 8, "file folder": 4, "file": 5}, "description_wc": 177, "description_text": "Avery file folder labels turn your filing cabinet into an organizer's dream. Streamline your routine and save minutes looking for important papers or employee files by making sure that each one is clearly labeled with the contents. Minisheets of labels are perfect for when you need more labels than you want to handwrite. Dependable Adhesive Permanent labels feature a strong adhesive that won't curl or lift at the corners. Hanging file folder tabs that are bend and tear resistant ensure you never lose a label again. Temporary Labeling Removable labels let your organize without worrying about needing to make changes to your system later. They stick as long as you need them to but come off cleanly with a quick peel, making it easy to repurpose your file folders. Ecofriendly Options Ecofriendly Avery file folder labels add to your office's green factor while still giving you the quality labels you need. Chlorine-free paper and soy-based ink make these labels perfect for the Earth-conscious workplace, and they are also 100 percent recyclable.", "parent_text": "Avery\u00ae Labels", "keyword_density": {"avery file folder labels": "4.5", "labels": "4.5", "file folder": "4.5", "file": "2.8"}, "department_id": 8}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 13, "level": -2, "url": "http://www.staples.com/Avery-Identification-Labels-Pads/cat_CL210827", "text": "Avery\u00ae Identification Labels / Pads", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Avery\u00ae Identification Labels / Pads", "parent_url": "http://www.staples.com/Avery-Labels/cat_DP8585", "keyword_count": {"avery identification labels": 2, "pads": 3, "labels": 9}, "description_wc": 150, "description_text": "Avery identification labels and pads come in a variety of sizes and colors, so you can get exactly what you need for each labeling job. Multipurpose labels have enough room for several lines of text, while color labels lend instant organization to any task. Notarial labels are also available for certificates or special mailing projects. Always Have Enough Label pads make it easy to perform both handwritten and print bulk labeling jobs quickly. Pin-fed continuous form labels let you print hundreds off at once. Switch Things Up Erasable labels let you change the contents of a folder without changing the label. Permanent marker erases with a regular white eraser, so you can re-label again and again. Keep It Clear Avery identification labels and pads are designed to keep ink where it's supposed to be. These labels are smudge and smear proof, creating professional-looking labels every time.", "parent_text": "Avery\u00ae Labels", "keyword_density": {"avery identification labels": "4.0", "pads": "2.0", "labels": "6.0"}, "department_id": 8}
