{"department_text": "Envelopes | Labels | Mailing", "nr_products": 9, "level": -1, "url": "http://www.staples.com/Fashion-Packaging-Tape/cat_CL167974", "text": "Fashion Packaging Tape", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Fashion Packaging Tape", "parent_url": "http://www.staples.com/Packaging-Tape-Shipping-Tape/cat_DP1427", "keyword_count": {"fashion packaging tape": 2, "tape": 4, "packaging tape": 3}, "description_wc": 79, "description_text": "Ever wonder how you can make that dull package more fun and energetic? Does it ever cross your mind to dress up your shipping packages or even make moving a little bit more fun? Now Staples\u00ae can help with, Scotch\u00ae fashion packaging tape and Duck Tape\u00ae Brand fashion packaging tape. With the new fun patterns, from blue leaf to pink polka dot, cinnamon snow to tie dye, you can take decorative packaging tape where it\u2019s never gone before.", "parent_text": "Packaging Tape / Shipping Tape", "keyword_density": {"fashion packaging tape": "7.6", "tape": "5.1", "packaging tape": "7.6"}, "department_id": 8}
