{"department_text": "Envelopes | Labels | Mailing", "nr_products": 35, "level": -1, "url": "http://www.staples.com/Adhesive-Transfer-Tape/cat_CL163817", "text": "Adhesive Transfer Tape", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Adhesive Transfer Tape", "parent_url": "http://www.staples.com/Packaging-Tape-Shipping-Tape/cat_DP1427", "keyword_count": {"adhesive": 2, "adhesive transfer tape": 1, "transfer tape": 5}, "description_wc": 99, "description_text": "Transfer tape is an easy way to splice, bond, and fix a variety of materials like paper, metal, rubber, and many more. Staples offers adhesive transfer tape from affordable and quality brands like Staples and Scotch. Heavy duty and general purpose transfer tape . We have transfer tape products ranging from general purpose to heavy duty for strong adhesive requirements. Various sizes . Every project is different. We offer clear and solid transfer tape from 2 mil to 3\u201d thick. Heat and solvent resistant . Our acrylic paints are designed to be heat and solvent resistant for many applications.", "parent_text": "Packaging Tape / Shipping Tape", "keyword_density": {"adhesive": "2.1", "adhesive transfer tape": "3.1", "transfer tape": "10.4"}, "department_id": 8}
