{"department_text": "Envelopes | Labels | Mailing", "nr_products": 33, "level": -1, "url": "http://www.staples.com/Filament-Tape/cat_CL163805", "text": "Filament Tape", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Filament Tape", "parent_url": "http://www.staples.com/Packaging-Tape-Shipping-Tape/cat_DP1427", "keyword_count": {"tape": 5, "filament tape": 2}, "description_wc": 91, "description_text": "Staples carries industrial and fiberglass filament tape of varying types and grades, from \u00bd\u201d to 2\u201d in width with up to 131 tensile strength. Whether you\u2019re bundling or packaging boxes or you\u2019re looking for a tape that can adhere to steel, filament tape is up for the job. Strong and flexible, this is the right choice for those looking to resist abrasion and moisture. With tape from brands like 3M, Intertape & Scotch available in quantity packs, you can be sure you\u2019re getting the best value for the best materials", "parent_text": "Packaging Tape / Shipping Tape", "keyword_density": {"tape": "5.5", "filament tape": "4.4"}, "department_id": 8}
{"department_text": "Coffee | Water | Snacks", "level": 1, "url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "text": "Coffee | Water | Snacks", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Coffee | Water | Snacks", "keyword_count": {"water": 2, "coffee": 3, "coffee water": 1, "snacks": 2}, "description_wc": 136, "description_text": "Coffee, water, and snacks are the key to a great breakroom. Is your breakroom looking a little depleted? If so, we\u2019ve got everything you need to restock. Try out a fabulous Keurig coffee maker , or enjoy delicious beverage brands like our Keurig K-Cups , Folgers coffee ,\u00a0Starbucks,\u00a0Green Mountain\u00a0or Maxwell House. Freshen up before that big meeting with gum and mints and get all the snacks you need to keep office and desk visitors happy. Also, stay cool with crystal clear bottled water. Enjoy holiday food gifts, a nice gift basket from Mrs. Fields, and a wide range of gift cakes and desserts, all on our classy plates and cutlery. With our kitchen appliances, beverages and even catering to aid you, your breakroom will soon be the envy of all others.", "keyword_density": {"water": "1.5", "coffee": "2.3", "coffee water": "1.5", "snacks": "1.5"}, "department_id": 18}
{"department_text": "Safety Supplies", "level": 1, "url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "text": "Safety Supplies", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Safety Supplies", "keyword_count": {"safety supplies": 1, "safety": 5}, "description_wc": 105, "description_text": "Keep your employees safe and maintain regulatory compliance with Staples\u2019 large selection of high-quality and dependable safety supplies. We have products for all of your safety needs whether you are a small business, construction firm, health service provider, or a retail store. Protect your employees. Browse thousands of products for employees\u2019 personal protection like safety gloves, ear and eye protectors, masks, and back supports. Protect your building. Minimize the risk and damage of fire with smoke detectors, safety signage, safety lighting, early warning, and fire extinguishers. Protect your property. Keep your building and possessions locked up and under appropriate surveillance to secure your property.", "keyword_density": {"safety supplies": "1.9", "safety": "4.8"}, "department_id": 16}
{"department_text": "Cleaning | Facilities | Tools", "level": 1, "url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "text": "Cleaning | Facilities | Tools", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Cleaning | Facilities | Tools", "keyword_count": {"cleaning": 4}, "description_wc": 114, "description_text": "Keeping a clean and healthy office is essential, but it doesn\u2019t have to be expensive. With the top cleaning supply brands at everyday low prices, Staples provides your cleaning supply closet with everything it needs to keep your office running smoothly. Our featured weekly deals offer additional savings on the best cleaning products. Whether you're looking for paper products, including napkins, towel rolls, bathroom tissue or other cleaning supplies such as sponges, mops, trash bags or disinfectant spray, you'll find it here. We also have an extensive assortment of personal protective equipment such as safety gloves, eye and ear protection, head and face protection and more to keep your employees safe.", "keyword_density": {"cleaning": "3.5"}, "department_id": 15}
{"department_text": "Envelopes | Labels | Mailing", "nr_products": 23, "level": -1, "url": "http://www.staples.com/Hot-Melt-Packaging-Tape/cat_CL163784", "text": "Hot Melt Packaging Tape", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Hot Melt Packaging Tape", "parent_url": "http://www.staples.com/Packaging-Tape-Shipping-Tape/cat_DP1427", "keyword_count": {"hot melt": 2, "tape": 6, "hot melt packaging tape": 1}, "description_wc": 118, "description_text": "When you\u2019re storing or shipping boxes, having the right hot melt packaging tape on hand is important for protecting your sensitive documents or objects. Strong clear packing tape is also essential for around the office projects. With tape from brands like Scotch, Duck & 3M, Staples carries hot melt adhesive tape that can withstand both heat and water, and that\u2019s strong enough to be split and burst resistant as well. Staples makes it easy to choose box tape that\u2019s just right the job, carrying tape that ranges from 1.6 - 3.43 ml thickness and 19 - 69 lb tensile strength, available with easy grip dispensers for simple application. Buy in single, three- or six-packs for maximum value.", "parent_text": "Packaging Tape / Shipping Tape", "keyword_density": {"hot melt": "3.4", "tape": "5.1", "hot melt packaging tape": "3.4"}, "department_id": 8}
