{"department_text": "Envelopes | Labels | Mailing", "nr_products": 21, "level": -1, "url": "http://www.staples.com/Acrylic-Packaging-Tape/cat_CL163783", "text": "Acrylic Packaging Tape", "department_url": "http://www.staples.com/Envelopes-Labels-Mailing/cat_SC1679", "description_title": "Acrylic Packaging Tape", "parent_url": "http://www.staples.com/Packaging-Tape-Shipping-Tape/cat_DP1427", "keyword_count": {"acrylic": 2, "tape": 6, "acrylic packaging tape": 1}, "description_wc": 100, "description_text": "Whether you\u2019re packing up old files for storage or shipping an important item overseas, find the strength and security you can rely on with the wide range of tape on offer at Staples. Acrylic packaging tape will stay strong in humid, dry, cold and warm conditions, making it the right choice for boxes headed to garages and storage facilities. Ship with assurance when you choose sturdy carton sealing tape and clear tape to seal boxes for transport. You\u2019ll find acrylic adhesive and clear tape from brands like Duck, Scotch and Intertape, the most trusted brands in the businesses.", "parent_text": "Packaging Tape / Shipping Tape", "keyword_density": {"acrylic": "2.0", "tape": "6.0", "acrylic packaging tape": "3.0"}, "department_id": 8}
