{"department_text": "Coffee | Water | Snacks", "level": 0, "url": "http://www.staples.com/Catering-Food-Service/cat_CG1400", "text": "Catering/Food Service", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Catering/Food Service", "parent_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "keyword_count": {"food": 9, "food service": 4, "catering": 4}, "description_wc": 198, "description_text": "Your catering and food service business depends on the right supplies and packaging to get your food prepared right and packaged properly so your customers keep coming back for more. Get sturdy and convenient tables and carts, and keep enough trays, packaging supplies, and food handling supplies on hand so you'll never run out during a big job. Organization and Presentation Containers and serving trays help you keep the food you serve organized and in prime condition until your catering and food service customers are ready to eat it. Choose from a wide selection that includes takeout and pizza containers, drink trays, and bulk beverage carriers. Health and Safety You need disposable food handling gloves to ensure your business meets the standards for safety and cleanliness that are expected of any catering and food service enterprise. Oven mitts protect your hands when you take piping-hot pans and dishes out of your oven. Make Serving Easier Food carts and serving tables make it easy to serve guests when your catering and food service company gets an order to cater for a large event. You'll find everything you need to clean up your serving equipment at Staples.", "parent_text": "Coffee | Water | Snacks", "keyword_density": {"food": "4.5", "food service": "4.0", "catering": "2.0"}, "department_id": 18}
{"department_text": "Cleaning | Facilities | Tools", "level": 0, "url": "http://www.staples.com/Power-Strips-Cords-Plugs/cat_CG1375", "text": "Power Strips / Cords / Plugs", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Power Strips / Cords / Plugs", "parent_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "keyword_count": {"plugs": 4, "cords": 4, "power strips": 3, "power strips cords": 2}, "description_wc": 170, "description_text": "Power strips, cords, and plugs from trusted brands such as Fellowes and GE provide an easier way to use electronics and office equipment. They also make it safer to use electrical devices in areas that have an inadequate number of outlets. Several power strips, cords, and plugs are compact enough to transport in a suitcase when traveling. Convenience Power strips are typically a must for any business office setting. They are available in many different configurations. For added convenience, many come standard with a three-prong grounded wall plug and electrical outlets that accommodate most new office machines. Versatility Regular extension cords are designed for indoor use only. Cord covers help to keep them flat on the floor. Heavy-duty cords, available for outside use, are safe to employ in inclement weather. Safety There are many types of plugs to choose from. GFCI plugs are among the most popular. Designed to stop working immediately when coming in contact with humidity or water, they are often used in kitchen and bathrooms.", "parent_text": "Cleaning | Facilities | Tools", "keyword_density": {"plugs": "2.4", "power strips": "3.5", "cords": "2.4", "power strips cords": "3.5"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "level": 0, "url": "http://www.staples.com/Personal-Care/cat_CG1313", "text": "Personal Care", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Personal Care", "parent_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "keyword_count": {"personal care": 2, "care": 3}, "description_wc": 184, "description_text": "Personal care products from trusted brands like Burt's Bees and Conair make it easier to get dressed and ready to face the day. Whether you're spending a relaxing day at home or going out on the town, you'll always feel confident and refreshed with personal care products. Stock up on these products today so that you'll always have them on hand. Hair Care Show your sense of adventure while trying out different hair styles with the help of a new blow dryer, a curling iron, and your favorite hairspray . There's no need to waste time and money at the salon when you can achieve the same results at home. Lips and Nails Some climates wreak havoc on lips and nails. Don't let Mother Nature get you down. Keep your lips soft and your nails looking great with top-quality lip balms and cuticle products. Travel Light When packing for a trip, save room in your suitcase by choosing travel-size products to take with you. They're lightweight and convenient and don't take up much space.", "parent_text": "Cleaning | Facilities | Tools", "keyword_density": {"personal care": "2.2", "care": "1.6"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "level": 0, "url": "http://www.staples.com/Paint-Paint-Supplies/cat_CG1374", "text": "Paint / Paint Supplies", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Paint / Paint Supplies", "parent_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "keyword_count": {"paint": 17, "paint supplies": 3, "supplies": 4}, "description_wc": 165, "description_text": "Paint and paint supplies include everything from the brushes and rollers to the primer and paint you need to finish the job. Don't forget to include paint trays and cleanup supplies. Whether you're painting a house or retouching an old piece of furniture, stock up on paint and paint supplies before you start. Add Color to Your Home Primer helps you prepare the area before you start to paint. Add a layer of color with a variety of paints from manufacturers such as Industrial Choice and Krylon. Get Complete Coverage Paint rollers and paint brushes give you the ability to cover large surfaces or do small detailed painting. Sprayers provide a quick way to completely cover an area with paint. Mark Any Surface Aerosol spray paints and paint supplies let you make your mark on any surface, from metal to concrete. Choose fluorescent colors or metallic tones to make your markings stand out. Paint strippers can help you remove existing paint if needed.", "parent_text": "Cleaning | Facilities | Tools", "keyword_density": {"paint": "10.3", "paint supplies": "3.6", "supplies": "2.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "level": 0, "url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "text": "Kitchen Appliances", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Kitchen Appliances", "parent_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "keyword_count": {"appliances": 3, "kitchen appliances": 1, "kitchen": 6}, "description_wc": 112, "description_text": "Small kitchen appliances are perfect for your company\u2019s break room or kitchen. With the extensive range of appliances that Staples has to offer, you can be sure to find the appliances that your kitchen needs. We offer everything you need to make shopping as easy as possible. Kitchen Basics: Refrigerators, toaster ovens, and microwaves, Staples makes sure that all of your kitchen accessories are all right here. Assortment: We also go above and beyond to offer you an assortment of grills, mixers and blenders to complete your shopping experience. Best Brands: Keurig, Oster, and Brita are some of the names you\u2019ll see when stocking up on kitchen supplies from Staples.", "parent_text": "Cleaning | Facilities | Tools", "keyword_density": {"kitchen appliances": "1.8", "appliances": "2.7", "kitchen": "5.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 2, "level": -1, "url": "http://www.staples.com/Fuses/cat_CL167222", "text": "Fuses", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Fuses", "parent_url": "http://www.staples.com/Power-Strips-Cords-Plugs/cat_CG1375", "keyword_count": {"fuses": 4}, "description_wc": 167, "description_text": "Fuses are an integral part of product design, and they will help protect you from harm. Fuses can be replaced in many items, so it's important to have the right tools for the job. Fuse pullers are easy to use and come in a variety of sizes. Protection If your items don't have fuses, you'll need power strips to prevent electrical currents from burning out your appliances. A fuse makes it easy to plug an appliance straight into the wall without the need for corded power strips, but you'll need fuse pullers to remove them in some cases. Varied Sizes Fuse pullers are necessary when you want to remove some types of fuses. If you're removing a fuse in a car or truck, pullers can help you pull out small or large pieces that are stuck. Durable Design With a durable design, fuse pullers are ideal for electrical work. Made with polypropylene and filled with glass, they are protected from electrical currents.", "parent_text": "Power Strips / Cords / Plugs", "keyword_density": {"fuses": "2.4"}, "department_id": 15}
{"department_text": "Coffee | Water | Snacks", "nr_products": 10, "level": -1, "url": "http://www.staples.com/Table-Covers/cat_CL167776", "text": "Table Covers", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Table Covers", "parent_url": "http://www.staples.com/Catering-Food-Service/cat_CG1400", "keyword_count": {"table covers": 3, "table": 13}, "description_wc": 145, "description_text": "Table covers from manufacturers such as Tablemate, Creative Converting, and Hoffmaster keep tables clean during your event. Choose from rectangular or circular table coverings to fit your tables. Table covers with decorative designs let you show off your sense of style. Coordinated Look Classic white table covers work well for most events. Alternately, choose from a variety of colors to match your theme. Protective Surface Spills and splashes aren't a problem with a tablecloth made of paper, polyester, or plastic. Get a banquet roll to handle a long table, or pick up a pack of tablecloths to cover a large number of tables. Easy Cleanup When it's time to clean up, simply roll up the table covering and dispose of it or send it for cleaning. Your banquet tables are clean and ready to be used again immediately or stored for future use.", "parent_text": "Catering/Food Service", "keyword_density": {"table covers": "4.1", "table": "9.0"}, "department_id": 18}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 13, "level": -1, "url": "http://www.staples.com/Plugs-Receptacles/cat_CL167174", "text": "Plugs & Receptacles", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Plugs & Receptacles", "parent_url": "http://www.staples.com/Power-Strips-Cords-Plugs/cat_CG1375", "keyword_count": {"plugs": 5, "receptacles": 4}, "description_wc": 121, "description_text": "Plugs and receptacles are a major part of your toolkit. When you have the right plugs, you'll be able to power your devices more easily. With a variety of choices available, you can select the devices that will handle the energy you'll be using. Protect Your Devices Like power strips , plugs and receptacles may have grounding to protect your devices. Select from Cooper, CCI, and Tri-Source items to help ensure your business stays in good condition. Varying Sizes Plugs and receptacles come in different sizes. Different voltage, amperage, and conductor sizes are available. Durable Build Metal and plastic forms of plugs and receptacles are ideal for different purposes. Choose the right one to complete your project properly.", "parent_text": "Power Strips / Cords / Plugs", "keyword_density": {"plugs": "4.2", "receptacles": "3.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 74, "level": -1, "url": "http://www.staples.com/Power-Strips-Extension-Cords-and-Adapters/cat_CL142194", "text": "Power Strips / Adapters", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Power Strips / Adapters", "parent_url": "http://www.staples.com/Power-Strips-Cords-Plugs/cat_CG1375", "keyword_count": {"adapters": 1, "strips": 4, "power strips": 3}, "description_wc": 175, "description_text": "Power strips, extension cords, and adapters from popular brands like GE provide a safer way to use your electrical devices. They also make it more convenient to use electronics in spaces with limited outlets. Many of these products are compact enough to use when traveling. Power Strips Power strips are available in many configurations. The majority feature a three-prong grounded wall plug and outlets for additional safety. Some are designed with GFCI plugs, which allow the strips to be used in humid environments without difficulty or fear of injury. Extension Cords Extension cords are suitable for use with most types of office equipment, including copiers, fax machines, and computers. Always consider the purchase of cord covers , when using this type of cord. They keep each cord lying flat on the floor and are especially suited for high-traffic areas. Outlet Timers Outlet timers are available in digital or mechanical models. They allow you to choose the exact time to turn lights or equipment on and off when you are away from the office.", "parent_text": "Power Strips / Cords / Plugs", "keyword_density": {"power strips": "3.4", "strips": "2.3", "adapters": "0.6"}, "department_id": 15}
