{"department_text": "Cleaning | Facilities | Tools", "nr_products": 3, "level": -1, "url": "http://www.staples.com/Spray-Guns/cat_CL167173", "text": "Spray Guns", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Spray Guns", "parent_url": "http://www.staples.com/Paint-Paint-Supplies/cat_CG1374", "keyword_count": {"spray": 7, "spray guns": 4}, "description_wc": 158, "description_text": "Spray guns make it easy for you to maintain your fleet's engines in-house. Any employee can operate an engine cleaning gun to spray solvents that clean engines and other machinery. Accessories like tank liners and spray socks ensure the gun operator does a professional job. Easy to Use Spray guns are designed for easy use by anyone who knows how to use a garden hose. The 10-inch-long nozzle allows the gun operator to remain at a distance, so there is little chance of getting sprayed by solvent. Use a pair of safety glasses to protect your eyes while using the gun. Convenient Adjustments Adjustable pressure settings ensure spray guns can be used for a variety of purposes. The pressure valve can also be adjusted easily by hand. Useful Accessories Invest in accessories that are designed to make using spray guns more convenient. These accessories protect your body and make it easier to handle solvents.", "parent_text": "Paint / Paint Supplies", "keyword_density": {"spray": "4.4", "spray guns": "5.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 40, "level": -1, "url": "http://www.staples.com/Extension-Power-Cords/cat_CL167221", "text": "Extension / Power Cords", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Extension / Power Cords", "parent_url": "http://www.staples.com/Power-Strips-Cords-Plugs/cat_CG1375", "keyword_count": {"cords": 6, "power cords": 3, "power": 6, "extension": 3}, "description_wc": 163, "description_text": "Extension and power cords let you extend the reach of your power tools. Manufacturers such as CCI, Woods, and Tri-Source make models that are up to 100 feet long. Whether you are working on a major building site or simply need a bit of extra reach to operate yard equipment in the backyard, extension and power tools let you get electricity where you need it. Safe to Use Extension and power cords are insulated to protect them from environmental damage. These cords are also protected from oil, grease, and chemicals by a tough outer coating. Convenient Access Power cords let you access areas where there is no electrical outlet, including the roof, yard, or across a worksite. Use a model with a cord reel to easily roll it up for storage once your job is completed. Versatile Placement The lightweight, flexible cords can be maneuvered around corners or over scaffolding. Add a power strip to plug multiple cords into the same outlet.", "parent_text": "Power Strips / Cords / Plugs", "keyword_density": {"cords": "3.7", "power cords": "3.7", "extension": "1.8", "power": "3.7"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 1, "level": -1, "url": "http://www.staples.com/Paint-Trays-Liners/cat_CL167171", "text": "Paint Trays & Liners", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Paint Trays & Liners", "parent_url": "http://www.staples.com/Paint-Paint-Supplies/cat_CG1374", "keyword_count": {"paint": 16, "paint trays": 4, "liners": 6, "trays": 5}, "description_wc": 169, "description_text": "Paint trays and liners are indispensable tools for completing your next paint job. Whether you are planning a DIY office makeover or handle paint jobs for clients, paint trays and liners enable you and your helpers to work from one container of paint. Get your painting done more efficiently with a selection of painting accessories from this category. Saves Paint Paint trays and liners help you work economically with your paint supplies. You can portion out just the amount of paint you need to complete the job. Easy Cleanup Disposable paint tray liners make it easy to clean up after your day of painting is over. Make it just as easy to clean yourself up after working by using a pair of disposable gloves , because paint can be hard to remove from hands. Increased Portability A supply of paint trays and liners lets you keep your paint with you as you move around a room. Trays and liners also make it easier to wet your brush while working.", "parent_text": "Paint / Paint Supplies", "keyword_density": {"paint": "9.5", "paint trays": "4.8", "liners": "3.6", "trays": "3.0"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 32, "level": -1, "url": "http://www.staples.com/Paints/cat_CL167172", "text": "Paints", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Paints", "parent_url": "http://www.staples.com/Paint-Paint-Supplies/cat_CG1374", "keyword_count": {"paints": 4}, "description_wc": 131, "description_text": "Paints can help an office or retail building retain its shine for years. Enamel and acrylic paints offer lasting protection from the elements. Paints in aerosol cans can make painting even easier. Make a Good First Impression Buildings with a fresh or clean coat of paint tend to stand out to customers. Brilliant colors catch the eye. Make a good impression on potential guests and clients by keeping your building's exterior looking its best. Make Painting Simple Aerosol cans and snap-on tools for paint make painting simple. Check out the wide variety of paintbrushes for more precise work on buildings or art-style projects. Protect Your Investment Many paints are designed to help surfaces withstand the elements. Choose a paint that protects your office from both sun and rain.", "parent_text": "Paint / Paint Supplies", "keyword_density": {"paints": "3.1"}, "department_id": 15}
{"nr_products": 2, "level": -1, "url": "http://www.staples.com/Washers-Dryers/cat_CL211088", "text": "Washers & Dryers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "parent_text": "Kitchen Appliances", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 114, "level": -1, "url": "http://www.staples.com/Vacuum-Cleaners/cat_CL140733", "text": "Vacuum Cleaners", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Vacuum Cleaners", "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "keyword_count": {"cleaners": 3, "vacuum": 6, "vacuum cleaners": 2}, "description_wc": 190, "description_text": "Keep one of our vacuum cleaners where your employees can get to it easily, encouraging them to take the initiative in keeping your office looking great. Whether you need a large-capacity vacuum or a small hand-held for quick spills, we have what you need. Accessories like replacement bags and filters are also available, so you can stock up your office supply closet. Traditional or Bagless Design Vacuum cleaners are available with easy-change bags and allergen filters are available, giving you a classic look with modern convenience. Bagless models make it easy to just dump the canister in the trash and go on with your day. Cordless Convenience If you want to cover a lot of area at once or need to vacuum awkward areas like stairs, cordless vacuums give you the freedom to move around without getting tangled up in or running out of cord. Hand-held models make it quick cleanups fast and easy. Steam Clean Workspaces sometimes need more than a quick vacuum. Our selection of steam cleaners lets you choose a model that will get down deep into your carpet for a thorough cleaning.", "parent_text": "Kitchen Appliances", "keyword_density": {"cleaners": "1.6", "vacuum cleaners": "2.1", "vacuum": "3.2"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 58, "level": -1, "url": "http://www.staples.com/Specialty-Appliances/cat_CL166370", "text": "Specialty Appliances", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Specialty Appliances", "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "keyword_count": {"specialty": 1}, "description_wc": 44, "description_text": "Staples\u2019 selection of kitchen accessories goes far beyond your company\u2019s basic cooking needs. We have numerous specialty items that guarantee you\u2019ll find what you\u2019re looking for. We carry brand names from Onyx, Masterbuilt and Butterball, carrying frothers, deep\u00a0fryers, and smokers.", "parent_text": "Kitchen Appliances", "keyword_density": {"specialty": "2.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 20, "level": -1, "url": "http://www.staples.com/Roasters-Slow-Cookers/cat_CL166369", "text": "Roasters & Slow Cookers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Roasters & Slow Cookers", "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "keyword_count": {"roasters": 2, "slow": 3, "slow cookers": 2}, "description_wc": 167, "description_text": "Roasters and slow cookers are the ultimate in convenience cooking. Just throw all of your meal's ingredients in the crock, turn it on, and go about the rest of your day. Smudge-proof finishes and stainless-steel models ensure your appliances stand up to the wear and tear of office environments and still look great. Convenient Cleanup Roasters and slow cookers with nonstick crocks make it easy to clean your cookware after the meal is over. Dishwasher-safe models let you leave the scrubbing to the dishwasher, leaving you more time to catch up on emails or enjoy a little downtime. Variable Cooking Capacity Our catalog includes 1.5-quart all the way up to 7-quart options, including crockpots that accommodate different-sized crocks. This lets you decide whether you want to slow-cook your main dish or just prepare a complementary side. Easy Leftovers Removable crocks make keeping and serving leftovers easy. Just pull out the whole crock and put it in the office refrigerator.", "parent_text": "Kitchen Appliances", "keyword_density": {"roasters": "1.2", "slow": "1.8", "slow cookers": "2.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 23, "level": -1, "url": "http://www.staples.com/Rice-Cookers-Steamers/cat_CL166368", "text": "Rice Cookers & Steamers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Rice Cookers & Steamers", "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "keyword_count": {"rice": 4, "cookers": 4, "steamers": 2, "rice cookers": 2}, "description_wc": 165, "description_text": "Ensure a well-rounded office kitchen when you have pressure cookers, rice cookers, and steamers on hand. Cook up a healthy side of veggies for a quick snack. This keeps your employees for hitting the vending machines or snacking in front of the computers. Convenient Cleanup Nonstick linings let you cook without worrying about cleaning burnt-on messes at the end. Glass lids make it easy to check on the progress of your meal without letting the heat and steam out. Large Cooking Capacity Our pressure cookers, rice cookers, and steamers have a 5-cup capacity, based off of uncooked rice. This lets you make as little or as much as you need, for yourself or your coworkers. Prepare a main dish in your crockpot for a balanced meal. Automatic Convenience Digital programming features and 24-hour preset timers let you start cooking with the push of a button. Don't worry about your rice burning when you choose a model that has automatic shutoff.", "parent_text": "Kitchen Appliances", "keyword_density": {"rice": "2.4", "steamers": "1.2", "rice cookers": "2.4", "cookers": "2.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 27, "level": -1, "url": "http://www.staples.com/Coolers-Chests/cat_CL167098", "text": "Coolers & Chests", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Coolers & Chests", "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "keyword_count": {"chests": 3, "coolers": 5}, "description_wc": 195, "description_text": "Coolers and chests are a must-have for office get-togethers that take place outside. Whether you need a cooler for your homemade lemonade or an ice chest to keep bottled water cold, these models are built for convenience and durability. You can shop with confidence, knowing you're getting the best of the best from brands like Gatorade, Igloo, and Rubbermaid. Easy Dispensing Look for coolers with built-in spigots to reduce the risk of spills when filling up your cup. Some models also have cup dispensers, so you can create a drink station and keep messes all in one place. More Than Enough Whether you just want to pack enough for yourself or need to provide refreshments for the whole office, we have coolers in a variety of sizes. Choose from small 1-gallon coolers all the way up to 12-gallon ice chests, depending on your office's needs. Be Prepared Our selection of accessories and replacement parts help you make sure your coolers and ice chests work when you need them to. Wire racks are also available, so you can take your cooler with you without worry about it tipping over.", "parent_text": "Kitchen Appliances", "keyword_density": {"chests": "1.5", "coolers": "2.6"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 16, "level": -1, "url": "http://www.staples.com/Kitchen-Tools-Gadgets/cat_CL166366", "text": "Kitchen Tools & Gadgets", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Kitchen Tools & Gadgets", "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "keyword_count": {"gadgets": 1, "kitchen tools": 1, "kitchen": 5}, "description_wc": 121, "description_text": "Putting the finishing touches on your company\u2019s kitchen all comes down to the details. With our kitchen tools and gadgets, Staples make sure that you have everything for your office kitchen needs. Celebrating a colleagues birthday and hoping to open a bottle of sparkling cider? We have various bottle opening accessories perfect for the occasion. Our wine accessories also make the perfect present for a colleague or boss, including a selection of wine breathers, wine stoppers, wine preservers and savers. We want your kitchen to be as complete as you could possibly hope for, so take the time to check out our bottle and can openers so that you don\u2019t have to skimp on your kitchen\u2019s final touches.", "parent_text": "Kitchen Appliances", "keyword_density": {"gadgets": "0.8", "kitchen tools": "1.7", "kitchen": "4.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 23, "level": -1, "url": "http://www.staples.com/Mixers-Food-Processors/cat_CL166367", "text": "Mixers & Food Processors", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Mixers & Food Processors", "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "keyword_count": {"food": 3, "mixers": 2, "food processors": 2}, "description_wc": 149, "description_text": "Mixers and food processors let you chop, dice, blend, and even juice fruits and vegetables, making meal prep a cinch. Whether you need a simple chopper or a full-function food processor, you can choose the options that best fit your office's needs. Some models can even double as blenders for your morning smoothie or afternoon protein shake. One-Touch Convenience Crush ice and blend tough ingredients with one-touch pulse control. Keep paper plates and bowls on hand to make cleanup just as easy. Custom Consistency Multiple blending and chopping speeds help your mixers and food processors get it right the first time. Some models feature Smartspeed Technology, automatically adjusting the blade speed to produce your desired consistency. Complete Kitchen Systems For those that need to save space, a kitchen system acts as several appliances in one. Use it to chop, juice, blend, and even make dough.", "parent_text": "Kitchen Appliances", "keyword_density": {"food": "2.0", "food processors": "2.7", "mixers": "1.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 53, "level": -1, "url": "http://www.staples.com/Cookware/cat_CL166364", "text": "Cookware", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Cookware", "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "keyword_count": {"cookware": 3}, "description_wc": 137, "description_text": "Cookware gives your office kitchen a finished feel and makes it easy for employees to prepare healthy meals. Complete packages include stockpots, saucepans, spoons, lids, and skillets are available. Save time and money by buying a full matching set of pots and pans. Complete Kitchen Whether your employees want to make breakfast, lunch, or dinner, a full set of cookware makes preparing meals easy. Just put the leftovers in the for next time. Dishwasher Safe Don't worry about having to scrub pans after meals with dishwasher-safe cookware. Durable stainless-steel construction ensures your pots and pans look great even after years of use. Hot Water, Fast Get hot water for coffee, tea, or cooking purposes with cordless digital water kettle. Programmable settings and a warm feature ensure you get your water just the right temperature.", "parent_text": "Kitchen Appliances", "keyword_density": {"cookware": "2.2"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 34, "level": -1, "url": "http://www.staples.com/Griddles-Grills-Wafflemakers/cat_CL166365", "text": "Griddles, Grills & Wafflemakers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Griddles, Grills & Wafflemakers", "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "keyword_count": {"grills": 4, "griddles": 1}, "description_wc": 121, "description_text": "Staples\u2019 selection of grills and skillets make choosing the right appliance for your office easy. For your company\u2019s BBQ, we have outdoor grills that are perfect for the occasion. We also have countertop grills that can fit into your small office space. Selection: In addition to grills, we also have skillets and waffle irons, panini presses and griddles, so that no matter what your office\u2019s cooking style or counter-space, you can find it here. Brand names: With names that you can trust, like Oster, George Foreman, and Presto, you\u2019ll know you\u2019re in good hands. Sizes: Staples has options that are perfect for large office gatherings, such as large skillets, and models that can easily be stored.", "parent_text": "Kitchen Appliances", "keyword_density": {"grills": "3.3", "griddles": "0.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 17, "level": -1, "url": "http://www.staples.com/Water-Dispensers-Filtration/cat_CL140865", "text": "Water Dispensers & Filtration", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Water Dispensers & Filtration", "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "keyword_count": {"water": 10, "dispensers": 1, "filtration": 2}, "description_wc": 114, "description_text": "Keeping hydrated throughout the work day is necessary for a healthy and happy office, making water filtration and dispensers an important part of your company\u2019s space. Filtered water removes any solids in your tap water and makes it taste great. We have a wide selection of water coolers, faucet water filters, and water filtration systems. Variety: Everything from basic water filters that can fit into your fridge to free standing hot/cold water cooler options. Quality: We sell all of the lines you know the best: Pur, Brita, Sunbeam and many more. Maintenance: Filtered water is only as good as the filter maintenance. Keep up your supply of Brita and Zero Water Filters.", "parent_text": "Kitchen Appliances", "keyword_density": {"water": "8.8", "dispensers": "0.9", "filtration": "1.8"}, "department_id": 15}
{"nr_products": 2, "level": -1, "url": "http://www.staples.com/Dishwashers/cat_CL165541", "text": "Dishwashers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "parent_text": "Kitchen Appliances", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 19, "level": -1, "url": "http://www.staples.com/Blenders-Juicers/cat_CL166363", "text": "Blenders & Juicers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Blenders & Juicers", "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "keyword_count": {"blenders": 3, "juicers": 2}, "description_wc": 154, "description_text": "Blenders and juicers let you custom make your own frozen or blended drinks right at the office. This eliminates trips to the specialty coffee or smoothie store and helps you save money. Consider stocking your kitchen with more than one model, so your employees don't have to wait in line. Make Your Own Pick out your favorite in-season produce and whip up a blended drink in no time. A supply of disposable cups keeps employees from having to take time away from work to wash the dishes. Crush Ice If you want a smooth, even consistency to you frozen drink, the ice-crushing capabilities of your blenders and juicers are important. Look for options with a pulse feature for custom control. Keep Pulp Out Check out our blenders that have special containers for pulp, keeping it out of your drink. Safety locks ensure there are no spills or messes while you juice.", "parent_text": "Kitchen Appliances", "keyword_density": {"blenders": "1.9", "juicers": "1.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 27, "level": -1, "url": "http://www.staples.com/Toasters/cat_CL210338", "text": "Toasters", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Toasters", "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "keyword_count": {"toasters": 2}, "description_wc": 133, "description_text": "Toasters can take your breakfast or morning snack to the next level. Toast a bagel or heat up some hash browns for a quick meal that lets you get back to work. Two-, four-, and six-slot models are available, making it easy to choose the size that best fits your office. Adjustable Make sure everyone can fit both English muffins and deluxe bagels in the toaster. Adjustable slots widths ensure even cooking. Easy Cleanup Removable crumb trays make cleaning your toasters fast and easy. Just dump the crumbs straight into the trash. Multifunction A toaster doesn't have to just toast. Toaster ovens are available that can defrost and broil, and there are even options with stove burners, so you can warm up some soup to go with your sandwich.", "parent_text": "Kitchen Appliances", "keyword_density": {"toasters": "1.5"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 67, "level": -1, "url": "http://www.staples.com/Microwaves/cat_CL141070", "text": "Microwaves", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Microwaves", "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "keyword_count": {"microwaves": 3}, "description_wc": 116, "description_text": "At the office, microwaves and toaster ovens have become the go-to for cooking efficiency. Stock your breakroom with the best food prep accessories. We carry a wide selection of stainless steel and energy star appliances to fit your needs. Convenience: Go for ultra-modern with a stainless steel counter top microwave, or save even more space with an under the counter model. Combination appliances: Save space with combination collections of refrigerators and microwaves guaranteed to free up space on your counter for other kitchen accessories [link: http://www.staples.com/Kitchen-Appliances/cat_DP800 ]. Brand names: Staples has all the name brand microwaves and toasters you recognize: Black & Decker, Sunbeam, Panasonic and Avanti to name a few.", "parent_text": "Kitchen Appliances", "keyword_density": {"microwaves": "2.6"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 40, "level": -1, "url": "http://www.staples.com/Refrigerators/cat_CL140861", "text": "Refrigerators", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Refrigerators", "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "keyword_count": {"refrigerators": 4}, "description_wc": 116, "description_text": "Compact refrigerators are perfect for the company kitchen or breakroom. A mini refrigerator is perfect for storing lunches and a selection of drinks. Getting one that is the right fit for a tiny space but that can hold plenty is made easy with our wide range of compact refrigerators. Colors and Models: We offer mini fridges and counter depth refrigerator models in white, black and stainless steel. We even have wine fridges for the most fun offices. Top Brands: Get the best small refrigerators from Microfridge, Preservino, Haier, GPX, Avanti and Sanyo. Energy Star: Compact fridges and wine refrigerators can save you space and money in electricity bills with our wide selection of Energy Star fridges.", "parent_text": "Kitchen Appliances", "keyword_density": {"refrigerators": "3.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 99, "level": -1, "url": "http://www.staples.com/Coffee-Makers/cat_CL140860", "text": "Coffee Makers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Coffee Makers", "parent_url": "http://www.staples.com/Kitchen-Appliances/cat_DP800", "keyword_count": {"coffee": 9, "makers": 1}, "description_wc": 121, "description_text": "Start your morning off right or gain an extra boost in the afternoon with our large variety of single cup and pot espresso and coffee brewers. We have quality residential and commercial coffee maker brands including Jura-Capresso, Mr. Coffee, Coffee Pro, Bunn, Keurig, and Newco. Coffee simplified - We have automatic, digital, and programmable coffee brewers and espresso machines that will have your coffee ready for you when you need it hassle free. Cups per brew - Accommodate any quantity of people whether you are looking for a large pot with a 10 cup brew or a single cup Keurig coffee machine. Brewing options - Brew your coffee or espresso with your favorite machines like grind & brew, percolaters, k-cups, and drip makers.", "parent_text": "Kitchen Appliances", "keyword_density": {"coffee": "7.4", "makers": "0.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 1, "level": -1, "url": "http://www.staples.com/Paint-Strippers/cat_CL167219", "text": "Paint Strippers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Paint Strippers", "parent_url": "http://www.staples.com/Paint-Paint-Supplies/cat_CG1374", "keyword_count": {"paint": 8}, "description_wc": 144, "description_text": "Paint stripers are ideal for those who need to line a soccer field, baseball field, or football turf. You can vary the width of the lines so you can make them the size you need. The rugged design and wheels on the base make it easy to use a striper on the field. Varied Lines Once you've purchased your paints , you'll want to be able to line the field. Use paint stripers to make sure the field has a line that is the approved width. Wheeled for Easy Use The last thing you want to do is to drag a messy paint bucket behind you or spill your paint. With paint stripers, simply load the paint and roll the striper where you want to go. Durable Build Fields can be rough. Paint stripers are built with durable plastics and lightweight steel.", "parent_text": "Paint / Paint Supplies", "keyword_density": {"paint": "5.6"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 22, "level": -1, "url": "http://www.staples.com/Paint-Rollers-Covers/cat_CL167170", "text": "Paint Rollers & Covers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Paint Rollers & Covers", "parent_url": "http://www.staples.com/Paint-Paint-Supplies/cat_CG1374", "keyword_count": {"paint": 10, "paint rollers": 3, "rollers": 4, "covers": 5}, "description_wc": 160, "description_text": "Paint rollers and covers come in multiple sizes so that you can get the coverage you need quickly and efficiently. They are useful for applying primer or paint on interior or exterior walls. Linzer, Rol-Rite, and Rubberset all provide paint rollers and covers you can use no matter the size of your job. Easy to Handle Rollers with plastic grips ensure you can comfortably hold them for hours while painting. The covers are simple to get on and off, making both setup and cleanup simple. Full Paint Coverage Choose from 3-, 4-, or 9-inch widths to effectively cover the surface you are painting. Pair paint rollers and covers with a paintbrush to handle detail work and tight corners. Paint Any Surface Paint covers come in a variety of nap lengths to suit different surfaces. Choose a short nap length of 1/4 inch to handle smooth surfaces and longer nap lengths for rougher walls or ceilings.", "parent_text": "Paint / Paint Supplies", "keyword_density": {"paint": "6.3", "paint rollers": "3.8", "rollers": "2.5", "covers": "3.2"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 23, "level": -1, "url": "http://www.staples.com/Paint-Brushes/cat_CL167169", "text": "Paint Brushes", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Paint Brushes", "parent_url": "http://www.staples.com/Paint-Paint-Supplies/cat_CG1374", "keyword_count": {"paint": 8, "brushes": 5}, "description_wc": 153, "description_text": "Choose from paintbrushes in various sizes and styles to handle your paint job. Whether you are touching up a piece of restored furniture or painting an entire house, there's a brush to suit your needs. Smooth Coverage for Large Jobs Industrial paintbrushes from manufacturers such as Magnolia Brush let you paint large surfaces, machinery, or fixtures quickly and economically. For even more coverage, try a paint roller . Easily Handle Fine Details Chip brushes from Linzer and Anderson let you add varnish or latex paint to just about any small surface. You can also handle touchups with these paintbrushes, so even when you use them for fine details, such as on molding and furniture, your final product will look great. Apply Flux with Ease Applying flux prior to soldering is made simple with a flux brush from Weiler. You can also use these brushes for cleaning or coating small objects or surfaces.", "parent_text": "Paint / Paint Supplies", "keyword_density": {"paint": "5.3", "brushes": "3.3"}, "department_id": 15}
