{"department_text": "Cleaning | Facilities | Tools", "level": 0, "url": "http://www.staples.com/Tools-Flashlights-Cords/cat_CG1244", "text": "Tools / Flashlights / Cords", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Tools / Flashlights / Cords", "parent_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "keyword_count": {"cords": 4, "tools": 12, "tools flashlights": 3}, "description_wc": 185, "description_text": "Whether you are completing a home improvement project or spending the day at a work site, you are likely to need tools, flashlights, and cords. Our wide selection of hand tools, lights, cords, and power tools allows you to accomplish any task in less time. Choose from a variety of products for small jobs, large jobs, and everything in between. Convenient Our tools, flashlights, and cords are convenient and easy to use. Whether you are looking for lawn and garden tools, power tools, or marking tools, you'll have no trouble learning to use them efficiently. Numerous Uses Whether you're working on a gardening project or a small construction project, our tools are versatile enough to fit the bill. Products like work lights, hand tools, and maintenance tools can be used on multiple projects, allowing you to get the most value out of your investment. Wide Selection We carry a wide selection of tools, flashlights, and cords, so you'll find everything you need in one spot. No matter what tools you need, a pair of gloves can keep you safe on the job.", "parent_text": "Cleaning | Facilities | Tools", "keyword_density": {"cords": "2.2", "tools": "6.5", "tools flashlights": "3.2"}, "department_id": 15}
{"department_text": "Coffee | Water | Snacks", "nr_products": 10, "level": -1, "url": "http://www.staples.com/Food-Beverage-Carts/cat_CL167772", "text": "Food & Beverage Carts", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Food & Beverage Carts", "parent_url": "http://www.staples.com/Catering-Food-Service/cat_CG1400", "keyword_count": {"carts": 4, "beverage carts": 3, "beverage": 5}, "description_wc": 158, "description_text": "Beverage carts offer storage space for all of your drink needs and let you move drink supplies around easily. Manufacturers such as Safco offer various options, from basic models to elaborate beverage carts. These compact refreshment centers work for everything from major functions to daily in-office beverage service. High Capacity Choose from beverage carts with two or three shelves, or opt for one with a two-door cabinet to hold everything you need. These carts offer ample space for everything from mixed drink supplies to cold cups and straws. Show Off Your Style Basic metal or polycarbonate models let you serve drinks without the frills. Wood models give your beverage service a classy look. Make Drinks Anywhere Rolling casters make it easy to get your drink supplies where they are needed, whether that's to your break room or across a banquet hall. Locking wheels keep the cart in place when you need to pour a drink.", "parent_text": "Catering/Food Service", "keyword_density": {"carts": "2.5", "beverage carts": "3.8", "beverage": "3.2"}, "department_id": 18}
