{"department_text": "Cleaning | Facilities | Tools", "level": 0, "url": "http://www.staples.com/Vacuums-Mops-Floor-Care/cat_CG2826", "text": "Vacuums, Mops & Floor Care", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Vacuums, Mops & Floor Care", "parent_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "keyword_count": {"floor": 2, "mops": 1, "care": 1, "vacuums": 1}, "description_wc": 83, "description_text": "With a variety of mops, brooms, buckets, vacuums and sweepers, including the Swiffer Sweeper and the Swiffer Wet Jet , we\u2019re here to help you keep your floors looking their best. Whether you have carpet, linoleum, hardwood, or tile, we offer you top of the line brands and products to suit all of your floorcare needs. Stock up and clean up with some of the best leading brands including Rubbermaid , Mr. Clean , Hoover , Dirt Devil , Electrolux and more.", "parent_text": "Cleaning | Facilities | Tools", "keyword_density": {"vacuums": "1.3", "mops": "1.3", "care": "1.3", "floor": "2.6"}, "department_id": 15}
