{"department_text": "Cleaning | Facilities | Tools", "nr_products": 23, "level": -1, "url": "http://www.staples.com/Travel-Sizes/cat_CL166530", "text": "Travel Sizes", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Travel Sizes", "parent_url": "http://www.staples.com/Personal-Care/cat_CG1313", "keyword_count": {"travel": 5, "travel sizes": 3}, "description_wc": 182, "description_text": "When you need to look and feel your best on the go, travel sizes come to the rescue. Carry these products in your luggage or easily stash them in your desk. Brands such as Herbal Essences and Gillette offer travel-sized products, so you can rest assured these smaller products do not skimp on quality. Discreet and Easy to Transport Travel sizes make it simple and discreet to tuck items into your briefcase so that you are never caught unaware. Add a few essentials like shaving gel and dental floss to your carry-on bag and you'll still be able to travel light. Look Your Best From nail clippers to moisturizing lotion, your essential hygiene products keep you feeling confident all day long. Even when you are at a hotel, you can enjoy your favorite brands of shampoo or hair gel, thanks to these travel sizes. Feel Professional The last thing you need before a big meeting is to feel under the weather. Keeping Pepto-Bismol tablets or eye drops on hand helps you feel prepared, professional, and ready for anything.", "parent_text": "Personal Care", "keyword_density": {"travel": "2.7", "travel sizes": "3.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "level": 0, "url": "http://www.staples.com/Waste-Recycling/cat_CG2827", "text": "Waste / Recycling", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Waste / Recycling", "parent_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "keyword_count": {"waste": 2, "recycling": 5}, "description_wc": 179, "description_text": "Waste and recycling products are a necessity when it comes to cleaning up your office. Staples offers a wide range of trash bags, trash cans and recycling bins to meet all of your waste management needs. You can find quality products at unbeatable prices from name brands including Hefty , Rubbermaid , Glad , Safco , Honey-Can-Do and iTouchless . It's easy to shop for trash bags, trash cans and recycling bins when you search by brand, price range, customer ratings or best sellers. Trash With brands like Glad, Hefty, and Webster offering a variety of densities, gallon capacities and strengths, you\u2019re guaranteed to find the trash bag that\u2019s right for your office. Trash Cans Our selection of trash cans includes plastic and metal receptacles in an assortment of shapes and finishes including stainless steel, plastic, and fire safe coatings. Recycling Bins In today\u2019s eco-conscious world, recycling is important to remember when managing your office. Take advantage of our plastic and stainless steel bins by brands like Rubbermaid, Brighton Professional, and Safco.", "parent_text": "Cleaning | Facilities | Tools", "keyword_density": {"recycling": "2.9", "waste": "1.1"}, "department_id": 15}
