{"department_text": "Coffee | Water | Snacks", "nr_products": 55, "level": -1, "url": "http://www.staples.com/Containers-Serving-Trays/cat_CL167775", "text": "Containers & Serving Trays", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Containers & Serving Trays", "parent_url": "http://www.staples.com/Catering-Food-Service/cat_CG1400", "keyword_count": {"serving trays": 3, "serving": 4, "trays": 5, "containers": 1}, "description_wc": 176, "description_text": "Serving trays and supplies make it easy for your employees or customers to take food and beverages with them on the go. Food trays, beverage boxes, and cutlery bins are only some of the products in this category that make it easier to serve food. Keep a selection of serving trays and supplies on hand to meet all of your food service needs. Easy Portability Food trays help your workers or customers carry a variety of food from the serving area to the dining table. Equip your servers with disposable food-handling gloves to promote sanitary conditions in the food service area. Innovative Packaging Serving trays and supplies include innovative food and beverage containers that preserve the quality of the contents while in transit. Beverage boxes make it easy to deliver a large supply of hot coffee to a remote location. Convenient Organization Cutlery bins help organize plastic cutlery, making it easier for your workers or customers to select the utensils they need to eat their meals. Made of polyethylene, these bins can last for months.", "parent_text": "Catering/Food Service", "keyword_density": {"serving trays": "3.4", "serving": "2.3", "containers": "0.6", "trays": "2.8"}, "department_id": 18}
{"department_text": "Cleaning | Facilities | Tools", "level": 0, "url": "http://www.staples.com/Paper-Towels-Tissues-Napkins/cat_DP1865", "text": "Paper Towels / Tissues / Napkins", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Paper Towels / Tissues / Napkins", "parent_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "keyword_count": {"paper": 11, "paper towels": 5, "tissues": 5, "paper towels tissues": 2, "napkins": 5}, "description_wc": 201, "description_text": "Paper towels, tissues, toilet paper, and napkins are a necessity for personal hygiene and fostering a healthy business environment. Use tissues, toilet paper and paper towels for allergy seasons and sanitary bathroom use, and keep napkins nearby for easy post meal cleanup. Staples offers high-quality paper products and dispensing equipment from trusted brands, such as Kleenex, Charmin, and Brawny. Everyday Office Cleaning Messes won't stick around for long when you maintain a reliable stock of durable paper towels , tissues , and napkins . The absorbent paper is ideal for handling unexpected spills, wiping your hands, and cleaning your business equipment. Freshen Your Environment Every day, a multitude of substances come in contact with surfaces in your business. Give visitors and staff the supplies they need to maintain clean workspaces and prevent the growth of harmful germs. Choose facial tissues and wipers or pair your paper products with disinfectant cleaning fluids. Variety and Convenience Find the right paper towels, tissues, toilet paper, and napkins for your environment, ranging from heavy-duty multifold paper towels to soft dinner napkins. Products are available in small quantities and bulk cases, so your purchases can match the size of your business and budget.", "parent_text": "Cleaning | Facilities | Tools", "keyword_density": {"paper towels": "5.1", "paper": "5.6", "tissues": "2.5", "paper towels tissues": "3.0", "napkins": "2.5"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "level": 0, "url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "text": "Cleaners: Chemicals / Soaps / Wipes", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Cleaners: Chemicals / Soaps / Wipes", "parent_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "keyword_count": {"cleaners chemicals soaps": 2, "wipes": 3}, "description_wc": 153, "description_text": "Use cleaners, chemicals, soaps, and wipes to efficiently clean and disinfect floors, windows, and surfaces. Large product sizes mean you'll always have cleanser on hand when you need it. Antibacterial and disinfecting products reduce the spread of germs in addition to leaving surfaces sparkling clean. Different Formulations Products from reputable brands including Dawn, SoftSoap, and Clorox provide the quality cleaning power you've come to expect for every job. Find cleansers for dishes, hands, countertops, and more. Convenient Bulk Sizes Larger product sizes mean you'll spend less time and money ordering refills of cleaners, chemicals, soaps, and wipes. Keep a stock of sponges available as well so that you'll always be ready to clean. Disinfecting Power Germs can spread quickly in offices, especially during cold and flu season. Disinfecting wipes, hand sanitizers, and other antibacterial products can help curb the spread of germs so that your employees will stay healthy.", "parent_text": "Cleaning | Facilities | Tools", "keyword_density": {"cleaners chemicals soaps": "3.9", "wipes": "2.0"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "level": -1, "url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "text": "Sanding Discs / Wire Brushes / Grinders", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Sanding Discs / Wire Brushes / Grinders", "parent_url": "http://www.staples.com/Tools-Flashlights-Cords/cat_CG1244", "keyword_count": {"discs": 2, "sanding discs": 1, "grinders": 3, "brushes": 2, "wire brushes": 1}, "description_wc": 142, "description_text": "Discs, brushes, and grinders all serve the purpose of making objects smoother or removing materials from otherwise smooth surfaces. Small businesses engaged in the fabrication of parts or restoration of materials are likely to benefit from regular use of these tools. Office-based companies can use the tools to grind down sharp corners to protect customers and employees alike. Grind Away Unwanted Material Sanding discs and grinders let you quickly grind away excess material on different items. These power tools and accessories remove the need for excessive or repetitive motion. Smooth Coarse Surfaces Wire brushes and grinders are also excellent at smoothing rough areas. For even greater precision, check out steel wool pads or strips. Strip Away Rust Rust builds up easily on parts exposed to the weather. These abrasion products quickly strip away rust to leave behind only the bare metal.", "parent_text": "Tools / Flashlights / Cords", "keyword_density": {"sanding discs": "1.4", "grinders": "2.1", "discs": "1.4", "brushes": "1.4", "wire brushes": "1.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "level": -1, "url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "text": "Power Tools: Corded / Cordless", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Power Tools: Corded / Cordless", "parent_url": "http://www.staples.com/Tools-Flashlights-Cords/cat_CG1244", "keyword_count": {"corded": 3, "tools": 5, "power tools": 3, "power": 6, "cordless": 6}, "description_wc": 233, "description_text": "Corded and cordless power tools help you and your workforce complete construction tasks efficiently. Many of these accessories come with several drill bits or parts, so you'll always have the right tool for the job. Items that are cordless come with a charger, so you won't have to worry about picking up a tool only to find out it's out of juice. Quick and Easy When you're on a work site, using one of these corded or cordless power tools will help cut down on the time it takes to finish the job. Whether you're using a drill or disc sander, these tools are made to work effectively and efficiently. Stay Powered Up Corded and cordless power tools do the hard work for you. Unlike the cordless tools of yesterday, today's models pack enough punch for almost any kind of work. If you're using a cordless tool, be sure to charge it when it's not in use, so it's at full power when you need to get back to work. Parts and Accessories Available No matter which type of power tool you're using, you're going to need extra accessories such as drill parts to get the job done. The variety of parts available makes it easier to find the right accessory to take your tool and your business to the next level.", "parent_text": "Tools / Flashlights / Cords", "keyword_density": {"corded": "1.3", "tools": "2.1", "power tools": "2.6", "power": "2.6", "cordless": "2.6"}, "department_id": 15}
