{"department_text": "Cleaning | Facilities | Tools", "nr_products": 52, "level": -1, "url": "http://www.staples.com/Mops-Buckets/cat_CL168326", "text": "Mops / Buckets", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Mops / Buckets", "parent_url": "http://www.staples.com/Vacuums-Mops-Floor-Care/cat_CG2826", "keyword_count": {"buckets": 5, "mops": 11}, "description_wc": 158, "description_text": "Mops and buckets are the most time-honored and indispensable tools for washing floors. You can choose cotton mops, or you can find sponge mops, mops with cleaner dispensers, and mops with other convenient features. Durable stainless-steel pails are available, as are buckets with built-in wringers. Absorbent and Rugged Cotton mops and buckets made of durable metals and plastics are made to last through cleaning after cleaning. Cotton, synthetic, and sponge mop heads absorb water and dirt, so they lift off grime and stains and leave your floor shining. Convenient and Versatile New mops and buckets from manufacturers like Rubbermaid and Magnolia Brush have features like built-in wringing handles that make cleaning much easier. You can also find mops with scrubbing heads and dust mops. Use with Cleaners There are even mops available with built-in floor cleaner dispensers. You can apply your favorite household or institutional all-purpose cleaners with traditional mops and buckets.", "parent_text": "Vacuums, Mops & Floor Care", "keyword_density": {"buckets": "3.2", "mops": "7.0"}, "department_id": 15}
{"nr_products": 10, "level": -1, "url": "http://www.staples.com/Toilet-Seat-Covers-Dispensers/cat_CL210058", "text": "Toilet Seat Covers & Dispensers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Paper-Towels-Tissues-Napkins/cat_DP1865", "parent_text": "Paper Towels / Tissues / Napkins", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Rotary-Hammers/cat_CL167145", "text": "Rotary Hammers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Rotary Hammers", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"rotary hammers": 3, "rotary": 4}, "description_wc": 127, "description_text": "Rotary hammers are far more powerful than conventional drills. This additional power lets them punch through metal and stone with far greater efficiency. The tools are a great addition to any construction site or repairman's arsenal. Create Precision Holes The drill-bit design of rotary hammer tools allows them to create tools with precise measurements. This can help cut down on time spent measuring and aligning components. Break Through Tough Materials Rotary hammers use pistons to drive the bit through while spinning. For tools with a bit more finesse, check out the selection of corded and cordless drills . Optional Attachments Bits on rotary hammers are interchangeable. This ensures that you can swap out parts to get the right hole needed for the work at hand.", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"rotary hammers": "4.8", "rotary": "3.2"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 58, "level": -2, "url": "http://www.staples.com/Wheel-Brushes/cat_CL167160", "text": "Wheel Brushes", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Wheel Brushes", "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "keyword_count": {"wheel": 7, "brushes": 8, "wheel brushes": 6}, "description_wc": 184, "description_text": "Wheel brushes extend the usefulness of your power drill and grinder. The right selection of wire brushes enables you to finish hard-to-reach areas on metal and wood surfaces. Anchor Brand, Dualife, Weiler, and other quality brands offer a wide selection of wheel brushes that can help you complete any project. Durable Construction Wheel brushes are made of stainless and carbon steel, so you can feel confident about using these high-quality brushes to complete heavy-duty jobs. Each brush that you add to your collection will provide finishing options for years. For Every Type of Job With options including stem, wire, and diameter size, you can find wheel brushes that can reach corners and tucked-away spaces. Make sure to wear a pair of safety glasses to protect your eyes from flying debris when you're using wheel brushes with your power tools. Easy to Use Wheel brushes are designed for use with your existing power equipment. Just slot the wheel into your power drill or grinder and you'll have a tool that can clean and smooth all types of surfaces.", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "keyword_density": {"wheel": "3.8", "brushes": "4.3", "wheel brushes": "6.5"}, "department_id": 15}
