{"nr_products": 23, "level": -2, "url": "http://www.staples.com/Finishing-Tools/cat_CL208105", "text": "Finishing Tools", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Power-Tools-Pneumatics/cat_DP8382", "parent_text": "Power Tools: Pneumatics", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Sheet-Sander-Parts-Accessories/cat_CL167249", "text": "Sheet Sander Parts & Accessories", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Sheet Sander Parts & Accessories", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"sheet sander parts": 1, "sander": 4, "accessories": 4, "parts": 5, "sheet sander": 2, "sander parts": 3}, "description_wc": 132, "description_text": "Parts and accessories available for sheet sanders allow you to customize your tool to suit the needs of your business. Interchangeable parts slip on and off easily. This can save you time and money on the job. Pick the Right Pad Different pads have different ratings for their coarse surfaces. Heavy-duty pads work well on strong materials such as metals and stone. Easily Switch Accessories Sheet sander parts and accessories snap on and are easily removed. If you're looking for similar options for your disc sanding device, check out the selection of disc sander parts and accessories . Cut Down on Costs Choosing the right pad and sander parts cuts down on expenses due to wasted materials. Businesses can also save on labor costs when employees have the right tools.", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"sheet sander parts": "2.3", "sander": "3.1", "accessories": "3.1", "parts": "3.8", "sheet sander": "3.1", "sander parts": "4.6"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 11, "level": -2, "url": "http://www.staples.com/Soldering-Guns-Irons/cat_CL167147", "text": "Soldering Guns & Irons", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Soldering Guns & Irons", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"irons": 6, "soldering": 9, "soldering guns": 4, "guns": 5}, "description_wc": 172, "description_text": "Soldering guns and irons enable you to connect pieces of metal by melting a filler metal into the joints. Staples supplies soldering guns for large projects and soldering irons for smaller jobs. Both guns and irons have temperature controls, so you can work the metal with precision. Convenient Operation Soldering irons come in a cordless version that allows you to work on projects without worrying about staying close to a power outlet. Using a pair of welding goggles to protect your eyes is a good idea when you're using a soldering iron or a gun. Easy Portability Soldering guns and irons can be purchased in a complete portable toolkit that includes everything you need to complete a job. The toolkit case is custom designed to hold your gun or iron and the most common accessories. Useful Versatility With replacement soldering tips of different sizes, your soldering guns and irons can handle a variety of tasks. Keep a selection of tips on hand in your soldering toolkit to tackle any metalworking job.", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"irons": "3.5", "soldering": "5.2", "soldering guns": "4.7", "guns": "2.9"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Sanders/cat_CL167247", "text": "Sanders", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Sanders", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"sanders": 3}, "description_wc": 135, "description_text": "Sanders dramatically reduce the amount of time it takes to complete a project. Corded and cordless variants give you the freedom of motion necessary to reach just the right angle when working on a piece. Smooth Rough Areas Powerful sanding discs and flats work to smooth even the roughest of areas with minimum fuss. This is beneficial for small construction companies and artists alike. Easily Upgradable Many sanders are easily upgradable, letting you work on a variety of different projects. When you're looking for the right upgrade for your disc sander, check out the selection of disc sander parts and accessories . Pick the Perfect Sander Many different types and configurations of sanders are available. The wide variety lets you choose the right sander for the job whether you're constructing art or furniture.", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"sanders": "2.2"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Screwdrivers-Corded-Cordless/cat_CL167248", "text": "Screwdrivers: Corded & Cordless", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Screwdrivers: Corded & Cordless", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"screwdrivers": 4, "cordless": 1}, "description_wc": 120, "description_text": "Power screwdrivers let you quickly handle simple repair jobs and tougher construction projects. Small motors turn the screw for you, making adding or tightening screws easy. Modern screwdrivers easily switch between tightening and loosening as needed. Easily Secure Projects Screwdrivers let you quickly and efficiently add screws to secure shelves, table legs, and more. Keep a screwdriver on hand for when you spot loose screws. Be Prepared A power screwdriver can help you stay prepared when emergencies arise. To keep your cordless screwdriver running longer, check out replacement batteries and chargers . Optional Attachments Many screwdrivers can also take a variety of different heads. This includes drill bits for light drill work or attachments for twist ties and similar accessories.", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"screwdrivers": "3.4", "cordless": "0.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 11, "level": -2, "url": "http://www.staples.com/Router-Parts-Accessories/cat_CL167246", "text": "Router Parts & Accessories", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Router Parts & Accessories", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"router": 7, "parts": 3, "router parts": 1, "accessories": 5}, "description_wc": 154, "description_text": "Parts and accessories that can be swapped out allow routers to work on a variety of different projects. Routers can saw through tough materials or make precise cuts for wooden art. Some accessories even allow the router to work on plastics. Easily Saw Lumber Router parts and accessories let you switch quickly between blades for thin planks or thicker lumber pieces. The interchangeable blades and guides simplify readying routers for different tasks. Create Large Works of Art Woodworkers focused on artistic pursuits benefit greatly from having routers with the right accessories to ensure clean and stylish cuts. For smaller projects or those requiring an even higher level of precision, try a set of rotary tools . Use with Plastic Routers with the right accessories may also be used on some plastics. Parts used for cutting plastics either rely on heat for cutting or feature materials designed to cut without accidentally overheating the raw materials.", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"router": "4.6", "parts": "2.0", "router parts": "1.3", "accessories": "3.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 8, "level": -2, "url": "http://www.staples.com/Heat-Guns-Torches/cat_CL167142", "text": "Heat Guns & Torches", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Heat Guns & Torches", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"torches": 5, "heat": 13, "heat guns": 6}, "description_wc": 171, "description_text": "When you are faced with a tough task at home or on the job, heat guns and torches can make it go faster. The high heat causes difficult materials to melt or dissolve, so you can remove them with ease. Whether you are working with large surfaces or small areas, the size of the heat gun or torch has an impact on precision. The Right Size for Every Job Heat guns and torches come in a variety of sizes, so you can select the best option for each job. Choose from large heat guns with table stands, small heat guns, and handheld microtorches. High Heat Our heat guns and torches use high heat, whether you are using a heavy-duty heat gun or a palm-sized model. Prevent accidental burns with high-heat gloves . Convenient Design With convenient contoured handles, our heat guns and torches are designed for easy use. With options from brands like Master Heat Gun and Microtorch, you can select the product that fits into your hand.", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"torches": "2.9", "heat": "7.6", "heat guns": "7.1"}, "department_id": 15}
{"nr_products": 12, "level": -2, "url": "http://www.staples.com/Metal-Detectors/cat_CL211074", "text": "Metal Detectors", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "parent_text": "Power Tools: Corded / Cordless", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 15, "level": -2, "url": "http://www.staples.com/Rotary-Tools/cat_CL167146", "text": "Rotary Tools", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Rotary Tools", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"rotary tools": 4, "tools": 6, "rotary": 5}, "description_wc": 183, "description_text": "Rotary tools can be purchased in a kit or individually to suit your needs. Toolkits include a power hand tool and a variety of bits, sanding implements, and cut-off wheel, so you'll have the most common equipment used to handle a variety of projects. These accessories and more can be purchased individually to complement your existing rotary toolkit or allow you to focus on a single task. Incredible Versatility Rotary tools are designed to enable you to do any job that requires circular force. Interchangeable accessories such as bits and cutters ensure you always have the right tool to get the job done. Easy Use With a variety of cut-off wheels available, your rotary tools can easily cut, groove, and trim all kinds of metal. Make sure you have a pair of safety glasses on hand to protect your eyes when using these tools. Portable Convenience Purchase a convenient kit containing all the rotary tools you need for the most common jobs. The tools come in a handy carrying case that you can easily take with you on the road.", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"rotary tools": "4.4", "tools": "3.3", "rotary": "2.7"}, "department_id": 15}
{"nr_products": 4, "level": -2, "url": "http://www.staples.com/Knockout-Punch-Parts-Accessories/cat_CL208102", "text": "Knockout Punch Parts & Accessories", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "parent_text": "Power Tools: Corded / Cordless", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 4, "level": -2, "url": "http://www.staples.com/Impact-Wrenches/cat_CL167143", "text": "Impact Wrenches", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Impact Wrenches", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"impact": 4, "impact wrenches": 3}, "description_wc": 146, "description_text": "Impact wrenches apply great amounts of power in a turning motion. These tools are excellent for automotive mechanics and engineers who have to work with heavy parts. Small businesses may keep them handy to change tires or to perform other maintenance work. Remove Seized Components Engines and other mechanical components can seize due to contamination or inappropriate use. The power of an impact wrench helps you free these components and get the vehicle back in working order. Tackle a Variety of Tasks Impact wrenches can help with many other tasks, from stripping paint to changing tires. For work on smaller projects, check out the selection of drills . Choose the Right Wrench Impact wrenches are available with a wide variance in power levels. Choosing the one that best fits your needs can help you save money and ensure you have the right tool for the job.", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"impact": "2.8", "impact wrenches": "4.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Hammer-Drill-Bits/cat_CL167244", "text": "Hammer Drill Bits", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Hammer Drill Bits", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"bits": 5, "drill": 7, "hammer drill bits": 3}, "description_wc": 156, "description_text": "When you're working, hammer drill bits can help you finish off even the most trying of masonry projects. With a variety of sizes, you'll be able to drill holes that suit your project without having to purchase more tools. The kits come with multiple bits, so you'll have extras too. Easy To Use When you work with power tools , you'll want to be sure that your hammer drill bits fit well. These easily fit into your drill, so you can work right away. Variety of Sizes Not all projects are the same, so you'll need different tools. With hammer drill bits in multiple sizes, you'll be able to drill any size of a hole that is necessary. Strong Tips With strong rock carbide tips on some bits, like those by DeWalt, you'll have the power to drill even the toughest materials. Each set has the durability to last.", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"bits": "3.2", "hammer drill bits": "5.8", "drill": "4.5"}, "department_id": 15}
{"nr_products": 32, "level": -2, "url": "http://www.staples.com/Pneumatic-Tools/cat_CL208103", "text": "Pneumatic Tools", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "parent_text": "Power Tools: Corded / Cordless", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 66, "level": -2, "url": "http://www.staples.com/Power-Saws/cat_CL167144", "text": "Power Saws", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Power Saws", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"saws": 8, "power saws": 4}, "description_wc": 138, "description_text": "Power saws can cut through wood, plastic, and certain metals with ease. You can select different saw blades based on the type of material or cut desired. Power saws can dramatically cut down on the time it takes your business to complete a project. Quickly Carve Boards Power saws make it easy to carve lumber straight from the yard into planks, boards, and other common shapes. Jigsaws and rotary saws have specialized blades and edges designed to simplify cutting further. Create Stunning Artwork Artists use power saws for carving wood, stone, and ice. Check out the various grinders available if you're interested in creating smooth edges and a beveled look. Easily Carve Complex Patterns Band saws let you quickly cut through wood. Lathe attachments and jigsaws can create complicated patterns on materials in a matter of minutes.", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"saws": "5.8", "power saws": "5.8"}, "department_id": 15}
{"nr_products": 2, "level": -2, "url": "http://www.staples.com/Engravers/cat_CL167140", "text": "Engravers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "parent_text": "Power Tools: Corded / Cordless", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 2, "level": -2, "url": "http://www.staples.com/Vitrified-Abrasives/cat_CL167159", "text": "Vitrified Abrasives", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Vitrified Abrasives", "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "keyword_count": {"abrasives": 5, "vitrified": 3, "vitrified abrasives": 2}, "description_wc": 145, "description_text": "Abrasives that feature vitrified materials stand up well under high temperatures and heavy pressures. This makes them ideal for applications where you need to sand down or round off tougher materials. Choosing the right abrasive can save your business in labor costs and reduce the potential for injury. Break Down Coarse Surfaces Vitrified abrasives allow you to quickly grind away and smooth surfaces. This lets you get a smooth surface that is perfect for construction or art work. Custom Parts Many vitrified abrasives feature interchangeable connectors, letting you make the most of your disc or sheet sander. For projects that require hand-sanding, check out coated sheet abrasives . Picking the Right Abrasive Abrasives usually come in either pad or stone form. Pads fit on wheels and may come premounted for use with disc sanders. Stones let you manually grind down areas with greater precision.", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "keyword_density": {"abrasives": "3.5", "vitrified": "2.1", "vitrified abrasives": "2.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 37, "level": -2, "url": "http://www.staples.com/Grinders/cat_CL167141", "text": "Grinders", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Grinders", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"grinders": 4}, "description_wc": 198, "description_text": "Grinders are used with abrasives and wire wheels to smooth, cut, and clean hard, tough materials, such as concrete, metal, and ceramic. You can use a hand-held grinder to cut tile or stone and prepare metal and masonry surfaces for finishing. A bench grinder is the tool of choice for sharpening drill bits, screwdrivers, and knives. Convenient and Versatile Hand-held grinders are portable, so you can use them anywhere, and they feature comfortable handles to increase maneuverability and control. Choose an angle grinder from top manufacturers like DeWalt and Skil for working with larger surfaces or pieces of building material, and a die grinder for smaller, precision jobs that require a smaller abrasive wheel. Sturdy and Dependable Bench grinders handle the routine tasks you need to carry out to keep your tools and instruments in proper condition. With a wire wheel, a bench grinder can strip away rust on a neglected chisel or file, so you can get right back on the job. The Right Wheels Staples carries a selection of grinding wheels and wire brush wheels for the typical jobs you do with grinders. You can also use your grinder with coated disc abrasives .", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"grinders": "2.0"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 24, "level": -2, "url": "http://www.staples.com/Batteries-Chargers-for-Cordless-Tools/cat_CL167241", "text": "Batteries & Chargers for Cordless Tools", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Batteries & Chargers for Cordless Tools", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"chargers": 6, "batteries": 2, "tools": 4, "chargers for cordless tools": 3}, "description_wc": 170, "description_text": "This selection of battery chargers for cordless tools will ensure that a dead drill doesn't slow you down. With several chargers available to choose from, you can find the right type to fit your needs. These portable batteries will be a huge help on your next job site. Quick Recharge Many battery chargers for cordless tools will recharge your drill within one hour or less, meaning you can easily recharge your tool's battery while on your lunch break. Charge Multiple Batteries at Once Ensure that you're never without power with these battery chargers for cordless tools. Some of these chargers have two slots, so they'll save you even more time because they can recharge multiple tools at once. Light and Ready to Go Companies like XRP offer a lightweight battery charger that will be easy to carry to your work site. Designed to give your battery 40 percent more run-time, these chargers are great for those workers who needs extra power for those big jobs.", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"chargers": "3.5", "batteries": "1.2", "tools": "2.4", "chargers for cordless tools": "7.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Disc-Sander-Parts-Accessories/cat_CL167242", "text": "Disc Sander Parts & Accessories", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Disc Sander Parts & Accessories", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"sander": 9, "disc": 6, "accessories": 6, "disc sander parts": 4}, "description_wc": 180, "description_text": "Disc sander parts and accessories allow you to use a do-it-yourself finishing tool to clean, smooth, and sand a variety of surfaces. Rubber-backing pads, hook-and-loop pads, and adhesive-back pads give your handheld electric sander increased versatility and longevity. Choose the pads that work with your sander model and fit the job. Versatile Use With the correct disc sander parts and accessories, you can increase the usefulness of your sander. You won't have to call in a professional when you have the right accessories on hand to help you make the most of your equipment. Increases Disc Longevity Disc sander parts and accessories protect your sander's disc pad, so your equipment lasts longer without needing a replacement. Pick up a pair of work gloves when you're shopping for sander accessories so that you can protect your hands while operating the machine. Consistent Performance Disc sander parts and accessories are constructed of high-quality material and designed to provide consistent performance. You can expect a material finish that is smooth and swirl free.", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"sander": "5.0", "disc": "3.3", "accessories": "3.3", "disc sander parts": "6.7"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 130, "level": -2, "url": "http://www.staples.com/Drill-Parts-Accessories/cat_CL167139", "text": "Drill Parts & Accessories", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Drill Parts & Accessories", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"drill": 11, "parts": 7, "accessories": 4, "drill parts": 4}, "description_wc": 187, "description_text": "The right drill parts and accessories can keep your drill working well, even on tough jobs. We carry a wide selection of parts, from drill bit extensions to drill chucks. Each piece is designed for precision, so you can get the job right the first time. Maximum Functionality Our drill parts and accessories are designed to give you flexible working options. From coated step drill bits to general-purpose straight shank bits, you can select the perfect tool for any task. Convenience With tools like nut setters and variable pitch hole saws, our drill parts and accessories are designed to make any job more convenient. Whether you're working on a home renovation or building heavy-duty systems at work, we carry top-quality products from companies like Advantage, Irwin, and Hanson to fit your needs. Easy Replacement When one of the parts on your drill wears out, you can count on us to provide replacement drill parts and accessories. Select from options like light-duty drill chucks, countersink drill bits, or bit sharpeners. While you're handling sharp parts, prevent injuries by wearing safety goggles .", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"drill parts": "4.3", "parts": "3.8", "accessories": "2.2", "drill": "5.9"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 17, "level": -2, "url": "http://www.staples.com/Tube-Brushes/cat_CL167158", "text": "Tube Brushes", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Tube Brushes", "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "keyword_count": {"tube": 6, "brushes": 4, "tube brushes": 2}, "description_wc": 135, "description_text": "Tube brushes reach inside tubes to remove accumulated dirt or grime. Steel construction enables them to whisk away even the toughest clogs. The brushes are used by cleaning professionals on a regular basis. Clean Hard-to-Reach Places Each tube brush features a long handle that allows access into pipes or other hard-to-reach areas. The units spin to strip away unwanted material inside the tube. Get the Best Fit A wide selection of diameters is available to ensure you have the right brush for the job at hand. Check out the selection of end brushes for work on the outside of metal or composite tubes. Clean With Less Effort Many tube brushes fit neatly into power drill adapters. This allows you to quickly clean out even the toughest blockage with less elbow grease.", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "keyword_density": {"tube": "4.4", "brushes": "3.0", "tube brushes": "3.0"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 2, "level": -2, "url": "http://www.staples.com/Steel-Wool/cat_CL167157", "text": "Steel Wool", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Steel Wool", "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "keyword_count": {"steel wool": 3}, "description_wc": 148, "description_text": "Steel wool can be used to make basic repairs around the office. A variety of different grains allows the material to be used for different purposes. The pieces are usually far less expensive than sanders or other tools commonly used for the same purpose. Remove Rust Steel wool lets you tackle rust removal with minimum difficulty. Easily grind away stuck-on materials. Smooth Edges The material lets you smooth sharp corners that can pose a physical hazard to employees or customers. For even more grinding power in handheld form, check out coated sheet abrasives . Save Space Steel wool containers are very compact, so you can keep a variety of grits and sizes around the office even if you don't have much space. Keeping a set on hand ensures that you're ready when you spot damaged areas or sharp corners that need to be touched up.", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "keyword_density": {"steel wool": "4.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 38, "level": -2, "url": "http://www.staples.com/Drills/cat_CL167243", "text": "Drills", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Drills", "parent_url": "http://www.staples.com/Power-Tools-Corded-Cordless/cat_DP5140", "keyword_count": {"drills": 3}, "description_wc": 168, "description_text": "Drills from manufacturers such as DeWalt and XRP let you make holes in wood, metal, or other materials. Choose from models with or without cords, depending on whether continuous operation or versatility in where you use the drill is the bigger priority. Drill Holes Anywhere Cordless drills let you create holes even when there isn't an electrical outlet nearby. Whether you're on-site at a job with no electrical power yet or just don't want to run an extension cord from inside, cordless models get the job done. Continuous Operation Corded drills let you continue to work for hours on end without worrying about having to change the battery. An extension cord can help you extend the reach of your power tool so you get both convenience and versatility. Everything You Need A drill kit gives you everything you need to get started with your repairs or building project right away. You'll also get a carrying case to transport your tool to the worksite.", "parent_text": "Power Tools: Corded / Cordless", "keyword_density": {"drills": "1.8"}, "department_id": 15}
{"nr_products": 2, "level": -2, "url": "http://www.staples.com/Non-Woven-Wheel-Abrasives/cat_CL167253", "text": "Non Woven Wheel Abrasives", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 278, "level": -2, "url": "http://www.staples.com/Scratch-Brushes/cat_CL167156", "text": "Scratch Brushes", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Scratch Brushes", "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "keyword_count": {"scratch brushes": 5}, "description_wc": 165, "description_text": "When you are working with old, corroded, or dirty surfaces, scratch brushes can make the job easier. The heavy-duty bristles help you remove years of damage on wood or metal. Scratch brushes come with curved handles in either plastic or wood for a comfortable fit. Strength Scratch brushes from brands like Weiler and Anchor Brand are made with bristles of carbon steel or stainless steel, so they are strong enough to remove even tough corrosion. With a variety of bristle lengths available, you can find a brush for every job. Comfortable Use When you are selecting from the available scratch brushes, you can choose from a number of ergonomic handle styles. From curved wooden handles to wide, block-style handles, the right option can make any job more comfortable. Lightweight Our scratch brushes are available with wooden or plastic handles, both of which are lightweight and easy to hold. To protect your hands during long hours on the job, use high-dexterity gloves .", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "keyword_density": {"scratch brushes": "6.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 21, "level": -2, "url": "http://www.staples.com/End-Brushes/cat_CL167152", "text": "End Brushes", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "End Brushes", "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "keyword_count": {"end brushes": 5, "brushes": 7}, "description_wc": 172, "description_text": "End brushes are the ideal tools for finishing metalworking projects. Choose from a variety of wire configurations, such as crimped wheel and knot hollow, to achieve a perfectly clean and smooth surface. Weiler, Anderson, and other popular manufacturers offer a selection of end brushes to handle any job. Easy to Use End brushes are an easy solution for projects with small areas that need heavy-duty finishing. Just attach the right brush to your power drill , drill press, or die grinder to get the job done. Large Selection With options that include wire type, head and bristle diameter, and trim length, end brushes are available for every conceivable job. Keep a selection of brushes in your equipment arsenal so that you have what you need to finish any surface. Flexible Brushing Action End brushes use flexible wire bristles that adapt to speed and pressure, so brushes can also be used for surfaces that require only a light sweeping action. These finishing tools are versatile enough to handle a range of jobs.", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "keyword_density": {"end brushes": "5.8", "brushes": "4.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 19, "level": -2, "url": "http://www.staples.com/Non-Woven-Disc-Abrasives/cat_CL167153", "text": "Non Woven Disc Abrasives", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Non Woven Disc Abrasives", "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "keyword_count": {"abrasives": 5, "non": 2, "woven disc": 2, "disc": 4, "disc abrasives": 3, "woven disc abrasives": 1}, "description_wc": 132, "description_text": "Nonwoven disc abrasives let you quickly grind down metal parts. Small businesses working in construction or fabrication benefit greatly from the right abrasive surfaces. Others may wish to keep disc abrasives around the office to handle minor repairs or cosmetic touchups. Grind Down Troublesome Areas Disc abrasives let you quickly grind down areas that may be hard to carve. Abrasives attach easily to most power grinders and drills, letting you quickly remove material with a minimum of effort. Smooth Surfaces Fine-grit abrasives let you easily smooth bumpy or coarse surfaces. For greater precision, try steel wool strips. Clear Away Rust Rust accumulation on metal surfaces is no match for a coarse or medium nonwoven disc abrasive. Simply attach the abrasive to your power tool and strip away the rust with ease.", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "keyword_density": {"abrasives": "3.8", "non": "1.5", "woven disc": "3.0", "disc": "3.0", "disc abrasives": "4.5", "woven disc abrasives": "2.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Coated-Sheet-Abrasives/cat_CL167251", "text": "Coated Sheet Abrasives", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Coated Sheet Abrasives", "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "keyword_count": {"abrasives": 5, "coated": 2, "sheet": 7, "coated sheet abrasives": 1, "sheet abrasives": 4}, "description_wc": 144, "description_text": "Sheet abrasives that feature coatings for extra protection are a perfect choice for use in many situations. The coating protects the piece as you use it. This ensures that you get the maximum effectiveness whether you're working on wet or dry projects. Rounding Sharp Corners Sheet abrasives are an excellent choice when you need to blunt sharp corners. Sharp corners can pose a safety hazard, and you can eliminate such a threat quickly and easily with the right abrasive sheet. Sand Down Surfaces Coated sheet abrasives let you quickly sand down many coarse surfaces. For even more heavy-duty sanding work, check out coated disc abrasives . Additional Uses The coating on some sheet abrasives makes it perfect for use on surfaces that must remain oiled at all times. The coating protects the sheet from undue damage while retaining the sheet's efficiency.", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "keyword_density": {"abrasives": "3.5", "coated": "1.4", "coated sheet abrasives": "2.1", "sheet abrasives": "5.6", "sheet": "4.9"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 77, "level": -2, "url": "http://www.staples.com/Resin-Bonded-Abrasives/cat_CL167155", "text": "Resin Bonded Abrasives", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Resin Bonded Abrasives", "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "keyword_count": {"abrasives": 4, "resin bonded abrasives": 3}, "description_wc": 122, "description_text": "Your work will look more professional with resin-bonded abrasives. You can smooth out splinters and hard edges for woodwork that is lovely to touch. Choose from durable abrasives to find the type that you need for your work. Complete Professional Work With sanding discs , making a project look complete is easier than ever. Resin-bonded abrasives can help you smooth out any piece. A Variety of Brands Charger Plus, Green Corps, and CGW are just a few of the brands you've come to enjoy. Find a variety of resin-bonded abrasives from them and others in this section. Massive Selection The right abrasive makes your project easier to complete. Find high-speed discs, coarse and medium discs, and more.", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "keyword_density": {"abrasives": "3.3", "resin bonded abrasives": "7.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Coated-Roll-Abrasives/cat_CL167250", "text": "Coated Roll Abrasives", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Coated Roll Abrasives", "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "keyword_count": {"roll": 7, "coated roll abrasives": 4}, "description_wc": 178, "description_text": "Coated roll abrasives are the convenient solution when you need to smooth or polish surfaces by hand. Easily treat surfaces and apply the finishing touch to wood and metal products with a piece of cloth-backed sandpaper cut from a utility roll. Jumbo rolls save you money and minimize waste. Convenient Bulk Supply Coated roll abrasives come in lengths up to 50 yards, so you'll have enough sandpaper on hand to complete current and future projects. You can give each employee an individual supply of sandpaper conveniently cut from a jumbo roll. Project Versatility With coated roll abrasives available in grits from 60 to 320, you can find supplies appropriate for any job. Match the grit to the amount of sanding needed to achieve a smooth surface. Make sure to use a pair of work gloves to protect your fingers and nails from abrasive particles. Durable and Economical Cloth-backed coated roll abrasives can handle heavy-duty sanding without falling apart. This type of sandpaper lasts longer, so you don't waste as much money on replacements.", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "keyword_density": {"roll": "3.9", "coated roll abrasives": "6.7"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 9, "level": -2, "url": "http://www.staples.com/Non-Woven-Pad-Abrasives/cat_CL167154", "text": "Non Woven Pad Abrasives", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Non Woven Pad Abrasives", "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "keyword_count": {"woven": 2, "non": 2, "pad": 7, "woven pad abrasives": 1, "pad abrasives": 4}, "description_wc": 132, "description_text": "Pad abrasives save you time and money, whether you're trying to create a smooth surface for a project or simply clean damaged or dirty areas in your office. Nonwoven materials trap and lift away imperfections. The pads are equally effective at cleaning dishes and smoothing rough raw materials. Smooth Rough Surfaces Nonwoven pad abrasives let you quickly wear down rough surfaces. The abrasive material scrubs and pulls away coarse material. Excellent Cleaning Pad abrasives make an excellent choice for cleaning tools and kitchen materials. For hard-to-reach places, check out the selection of tube brushes . Pick the Right Pad Abrasives come in a variety of shapes, sizes, and duty ratings. Heavy-duty pads work best for harder materials, while lightweight pads are perfect for softer materials and touchup work.", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "keyword_density": {"pad": "5.3", "non": "1.5", "woven": "1.5", "woven pad abrasives": "2.3", "pad abrasives": "6.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 8, "level": -2, "url": "http://www.staples.com/Coated-Flap-Wheel-Abrasives/cat_CL167150", "text": "Coated Flap Wheel Abrasives", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Coated Flap Wheel Abrasives", "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "keyword_count": {"wheel": 10, "coated flap wheel abrasives": 4, "flap wheel": 8, "coated": 5, "flap": 9}, "description_wc": 202, "description_text": "Coated flap wheel abrasives are the specialty tools that let you finish hard-to-reach areas of your metal, wood, or glass products. The flap wheels are available in a variety of grades from medium to fine, and you can select the one that is appropriate for your project. Each flap includes an abrasive material that gets the job done quickly. Suitable for Various Jobs Coated flap wheel abrasives come in a variety of diameters and thicknesses, so no job is too large or too small. Select a single flap wheel for a specific job or a three-wheel set that can handle multiple projects. Effective Abrasive Action Each flap wheel is coated with a special abrasive solution, such as Alumina, that works with the circular action of the wheel to smooth and polish the material you are working with. Achieving a smooth surface is a breeze with the dual action of coated flap wheel abrasives. Consistent Cutting Action Arranged like a fan around the shaft, coated flap wheel abrasives enable consistent cutting action that won't ruin your work material. Make sure to wear a pair of safety goggles to protect your eyes from flying debris when working with flap wheels.", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "keyword_density": {"wheel": "5.0", "coated flap wheel abrasives": "7.9", "flap wheel": "7.9", "coated": "2.5", "flap": "4.5"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 37, "level": -2, "url": "http://www.staples.com/Cup-Brushes/cat_CL167151", "text": "Cup Brushes", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Cup Brushes", "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "keyword_count": {"brushes": 6, "cup brushes": 3, "cup": 7}, "description_wc": 159, "description_text": "Cup brushes are designed to help you remove corrosive materials like rust or old paint. Their cup-shaped bases and strong bristles can remove almost anything to create a smooth surface. The brushes are available in a variety of styles, including knot cup, crimped cup, and trim cup. Multisurface Compatibility Cup brushes are made with sturdy bristles that are designed for a variety of surfaces. Whether you're preparing cast iron or stainless steel, our brushes will help you get the job done. Durability Our brushes are designed with premium materials like carbon steel and stainless steel, so they will last through even the toughest job. Brands like Anchor Brand, Weiler, and Advance Brush provide you with a variety of durable brush options. A Brush for Every Job Cup brushes are available with multiple bristle lengths, so you can select the one that works for your job. No matter what the job, protect your eyes with safety goggles .", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "keyword_density": {"cup": "4.4", "brushes": "3.8", "cup brushes": "3.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 42, "level": -2, "url": "http://www.staples.com/Coated-Flap-Disc-Abrasives/cat_CL167149", "text": "Coated Flap Disc Abrasives", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Coated Flap Disc Abrasives", "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "keyword_count": {"coated flap disc abrasives": 3, "abrasives": 4}, "description_wc": 141, "description_text": "Sanding your work with coated flap disc abrasives is an important part of woodworking. It helps prevent splinters, and it can help promote the adherence of glues and paints. Find the right abrasives for your project in this section. Easily Finished Woodworking Wire brushes make it easy for you to add texture to a piece. You can smooth out the work and make sure your edges are clean with coated flap disc abrasives. Brands You Can Trust Brands such as POLIFAN, Tiger, and CGW give you a choice of whose products you use. Choose a brand you trust, and enjoy durable tools you can use for your projects. Variety of Choices You have a choice of different sizes of coated flap disc abrasives, so you can finish your project correctly. With different grades of grit available, sanding is easier than ever.", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "keyword_density": {"coated flap disc abrasives": "8.5", "abrasives": "2.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 63, "level": -1, "url": "http://www.staples.com/Carpet-Floor-Care/cat_CL167906", "text": "Carpet & Floor Care", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Carpet & Floor Care", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"carpet": 11, "floor care": 4, "floor": 12}, "description_wc": 200, "description_text": "Carpet and floor care products are available for every type of flooring. Whether you have carpeting, tile flooring, or a combination of both, you'll find just the right product to keep it clean and spotless. Plenty of stain removers are available for cleaning up any unexpected spills, and general cleaning products are also available. Spot and Stain Removers Carpet and floor care products comprise a large selection of spot and stain removers, so leaks and spills won't ruin your carpeting or flooring. Be sure to keep them handy so that you'll always be prepared for the unexpected. Carpet Cleaners For everyday cleaning, our carpet and floor care product selection offers a wide variety of carpet cleaners. You'll have no trouble finding the right carpet shampoo for keeping your carpet fresh, clean, and odor free. Hard Floor Cleaners Carpet and floor care also provide a generous selection of cleaning products for tile and linoleum flooring, including products from brands such as Floor Science and Spic & Span. They make it easy to keep your floors clean and shiny. To protect your carpet and flooring from wear and tear, be sure to use chair mats under your office chairs.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"floor care": "4.0", "floor": "6.0", "carpet": "5.5"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 50, "level": -1, "url": "http://www.staples.com/Computer-Cleaning/cat_CL165628", "text": "Computer Cleaning", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Computer Cleaning", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"computer cleaning": 4, "cleaning": 5}, "description_wc": 198, "description_text": "With computer cleaning products, you can avoid filthy buildup on your office electronics. Effectively cleanse dust and fingerprints from the surfaces of printers, PCs, and laptops with products from brands like 3M and Dust-Off. These chemicals are specifically made for safe use on electronic devices, so your valuable equipment will never be compromised. Sanitize Your Workspace Constant contact means your electronics are vulnerable to dirt and bacteria. Keep a handy supply of computer cleaning tools, such as monitor wipes, on hand to prevent long-term buildup of allergy-inducing dust and germs. Gentle On Electronics Electronics are essential to your daily tasks, and the smallest malfunction can deter your workforce. Computer cleaning accessories use safe, low-contact methods and contain nonabrasive chemicals, ensuring you can protect your electronics and accessories when cleaning them. For example, dust blowers gently remove dirt and dust from the tiny crevices in keyboards and delicate laptops by way of a targeted stream of air. Quick, Simple Application Computer cleaning is easy with handheld accessories that you can use quickly during breaks or between meetings. Straightforward sprays and wipes offer multisurface versatility, allowing you to clean several types of electronics with fewer products.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"computer cleaning": "4.0", "cleaning": "2.5"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 19, "level": -1, "url": "http://www.staples.com/Eco-friendly-Cleaning-Supplies/cat_CL163195", "text": "Green Cleaning Products", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Green Cleaning Products", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"cleaning": 12, "cleaning products": 6, "green cleaning products": 2}, "description_wc": 214, "description_text": "Green cleaning products are available for all your cleaning needs. You can easily find bathroom cleaners, all-purpose cleaners, and even industrial-strength degreasers that clean effectively without the harsh chemicals found in standard cleaning products. You can confidently clean your home and your business without worrying about causing harm to the environment. Nontoxic Ingredients Green cleaning products are made with natural, nontoxic ingredients that are safe for the environment. Because they don't contain harsh chemicals, they are also less damaging to surfaces and are often safe to use on surfaces that would be damaged by normal cleaning products. You can choose from a variety of trusted brands such as Seventh Generation, Sustainable Earth by Staples, and Clorox. Fresh, Clean Scents Ecofriendly cleaning supplies are typically free of ammonias and other chemicals that leave behind strong odors. You'll end up with a clean environment that has a light, fresh scent instead of the sharp, chemical odor of typical cleaning products. Effective Cleaning Ecofriendly cleaning supplies clean just as effectively as regular cleaning products. You can be confident that your home or office is just as clean as it would be if you used a standard cleaning product. Further contribute to your environment by using recycled paper towels for all your cleaning needs.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"cleaning": "5.6", "cleaning products": "5.6", "green cleaning products": "2.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 29, "level": -2, "url": "http://www.staples.com/Coated-Disc-Abrasives/cat_CL167148", "text": "Coated Disc Abrasives", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Coated Disc Abrasives", "parent_url": "http://www.staples.com/Sanding-Discs-Wire-Brushes-Grinders/cat_DP5132", "keyword_count": {"coated disc abrasives": 4, "abrasives": 6, "disc": 6}, "description_wc": 178, "description_text": "Using coated disc abrasives with circular sanding tools is an efficient way to remove rust and corrosion from metal before you prime and paint. Rotary sanding is also ideal for smoothing edges. Choose between alumina, resin, and other abrasives depending on the job at hand. Advanced Abrasive Coatings Coated disc abrasives are made of durable, precision materials such as alumina abrasives and resin backing, which are more rugged and efficient than traditional sandpaper. They sand faster and hold up longer, so you'll get the job done right. Variety of Sizes and Grits You can choose from a wide variety of coated disc abrasives from reliable manufacturers like Rotoc and Weiler. Each size is available in a variety of grips, from the finest for finishing work to the coarsest for removing tough rust from thick surfaces. Easy to Use You can attach a disc to a disc pad and use your drill for rotary sanding or you can use a separate circular sander. The selection of coated disc abrasives at Staples includes wheels for use with grinders .", "parent_text": "Sanding Discs / Wire Brushes / Grinders", "keyword_density": {"coated disc abrasives": "6.8", "abrasives": "3.4", "disc": "3.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 11, "level": -1, "url": "http://www.staples.com/Solvents-Lubricants/cat_CL164890", "text": "Solvents & Lubricants", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Solvents & Lubricants", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"lubricants": 4, "solvents": 4}, "description_wc": 153, "description_text": "Solvents and lubricants can help you quickly resolve problems such as drawers that are difficult to open and adhesive that's stuck to walls or surfaces. Different formulations for solvents and lubricants provide different levels of coverage and strength. Reputable brands help ensure you'll always get the cleaning and lubricating power you need. Remove Adhesive Residue Solvents from companies such as Motsenbocker's Lift-Off are specially formulated to remove the residue that ordinary cleansers can't. Use a solvent alongside an all-purpose cleaner to ensure your surfaces stay clean. Grease Squeaky Hinges Instead of struggling to open stuck drawers or listening to doors that squeak, use lubricants to keep hinges, drawer glides, and more moving smoothly and quietly. A quick spray is often all you need. Multiple Options Choose from liquid, powder, aerosol, and gel solvents and lubricants. Whatever your project, you'll find the right option for your needs.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"lubricants": "2.6", "solvents": "2.6"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 14, "level": -1, "url": "http://www.staples.com/Insect-Control/cat_CL165079", "text": "Insect Control", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Insect Control", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"control": 4, "insect": 8, "insect control": 3}, "description_wc": 214, "description_text": "With insect control solutions from Staples, you can safely eliminate any common pests affecting your work environment, including ants, roaches, and mosquitoes. Brands like Raid and Combat are potent formulas you can apply direct to the source to prevent further infestation. Insect control is easy to dispense and won't cause harm to people at your business. Reliable Pest Control Stamp out insects before they lead to large infestations by using fast-acting chemicals that quickly reach the source. Such chemicals will help eliminate bug populations on your property. Staples offers bug sprays you can apply to affected areas, as well as floor-based ant and roach bait that attract and terminate insects. You'll feel comfortable outdoors thanks to powerful insect repellents that keep mosquitoes, ticks, fleas, and other bugs away from your skin. Safe for Business Properties Make sure your staff and visitors stay protected from insects by using chemicals approved for public environments. You can always use masks, goggles, or gloves to reduce contact with chemicals. Silently Effective Whether you choose bug sprays or bait, insect control can be applied in unobtrusive areas where they won't be instantly noticeable. Insects are silently neutralized out of sight, allowing for quick and easy disposal at a time that's convenient for you.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"control": "1.9", "insect": "3.7", "insect control": "2.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 48, "level": -1, "url": "http://www.staples.com/Dish-Detergents/cat_CL159226", "text": "Dish Detergents", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Dish Detergents", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"dish": 5, "detergents": 2, "dish detergents": 1}, "description_wc": 172, "description_text": "Whether you're washing dishes by hand or in the dishwasher, top dish detergents help you get the job done more effectively and efficiently. Choose from powders, liquids, or tablets to best suit your needs. Brands such as Palmolive, Dawn, and Seventh Generation provide the cleaning power you need. Ecofriendly Options Some cleansers are harsh or toxic, but Staples offers all-natural, ecofriendly options. These detergents are ideal for larger offices where some individuals may have chemical sensitivities. Large Sizes Bulk sizes ensure that you'll need to reorder less frequently and that you'll always have soap on hand for even the toughest messes. Just leave sponges and scrub brushes next to the sink so that your employees can easily clean up after lunch or snacks. Versatile Formulas Utilize economical powder detergent or convenient single-use tablets in dishwashers. Keep liquid dish soap by the sink for smaller jobs and for hand washing. With so many products to choose from, you'll be able to easily accommodate your office's needs.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"dish": "2.9", "detergents": "1.2", "dish detergents": "1.2"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "level": -1, "url": "http://www.staples.com/Laundry/cat_DP5345", "text": "Laundry", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Laundry", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"laundry": 2}, "description_wc": 141, "description_text": "Hampers and hangers make it easy to keep your office attire looking sharp. With laundry detergent and drying racks, you'll be able to keep your clothes looking clean and like new after every use. A variety of products will help you maintain your suits and more. Put Away Dirty Items You know you'll need cleaning supplies for the office, but don't forget a hamper for your dirty clothing. A hamper will help keep your office looking neat when you have to stay overnight. Drying Racks for High-End Clothes Drying racks are ideal for expensive suits and sweaters. Because you don't want to discolor your clothes or shrink them, hang them to dry on a drying rack. Laundry Detergent for Sanitation Dirty clothes can make you uncomfortable. Easily clean them with a variety of soaps and detergents.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"laundry": "1.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 56, "level": -1, "url": "http://www.staples.com/Pre-moistened-Wipes/cat_CL141838", "text": "Wipes", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Wipes", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"wipes": 5}, "description_wc": 186, "description_text": "Premoistened wipes, when used regularly, can reduce the spread of germs and viruses in your office environment. They are safe to use on most surfaces, including frequently handled office equipment such as phones, keyboards, and computer mice. Wipe your equipment and surfaces down frequently to help stop colds and viruses from wiping out your work force. Kills Germs and Viruses Premoistened wipes from companies such as Lysol and Clorox disinfect your surfaces, killing 99.99 percent of all germs and viruses that cause flu and common colds. Make it easy for your employees to keep their work areas clean by providing hand sanitizer for them to use regularly. Fresh Scents Premoistened wipes are available in a variety of fresh scents, so you can keep your office clean and smelling fresh. A fresh environment helps to make working long hours a more pleasant experience. Convenient Containers Premoistened wipes are available in convenient containers, so it's easy to stash them around the office for easy access. By keeping the wipes handy, your employees are more likely to use them, so your office should always be clean and fresh.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"wipes": "2.7"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 62, "level": -1, "url": "http://www.staples.com/Air-Fresheners/cat_CL142818", "text": "Air Fresheners", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Air Fresheners", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"air": 9, "air fresheners": 4, "fresheners": 6}, "description_wc": 242, "description_text": "Using air fresheners is a great way to eliminate stale air and miscellaneous odors from your home or office. There are many types to choose from, including oil warmers, air-sanitizing sprays, and gel fresheners. Whether you need something you can spray quickly or general round-the-clock odor elimination, you will find the right product for your needs. Eliminate Odors Air fresheners eliminate odors and keep your home or office smelling fresh. You can keep sprays close by for handling those unexpected odors and use one of the gels for general freshness every day. With brands like Air Wick, Bright Air, and Febreze to choose from, you'll be sure to find the solution that works for you. Kill Bacteria Some air fresheners also contain disinfectants that clean the air as they eliminate odors. When they are used in conjunction with cleaning products , you can eliminate the bacteria that causes the odors, ensuring that your environment remains clean and clear day after day. Extended Odor Control A variety of air fresheners exists that can be used to provide extended odor control, including plugins and gel fresheners. These allow you to keep your home or office smelling fresh without daily effort on your part. Candles No matter what scent you prefer, Staples has the candles to make your home or office fresh. Not only do candles smell good, but they make a nice addition to the d\u00e9cor of any room.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"fresheners": "2.5", "air fresheners": "3.3", "air": "3.7"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 51, "level": -1, "url": "http://www.staples.com/Hand-Soaps-Dispensers/cat_CL164888", "text": "Hand Soaps", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Hand Soaps", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"hand": 11, "hand soaps": 2, "soaps": 4}, "description_wc": 176, "description_text": "Use hand soaps and dispensers to ensure that hands stay clean and that your workspace stays free of germs. You can choose from unscented or scented soaps in a variety of forms, from liquid to powder to soap bars. Individual units let you place multiple containers of soap around the office, while bulk hand soap offers an economical option. Convenient Pump Action Pump soap dispensers make it easy to dispense just the right amount of hand soap for each application. They're also easy to refill, saving you time and money. Antibacterial Power Choose antibacterial hand soaps for extra germ-killing power whenever you wash your hands. These soaps can be used in the restroom or office kitchen to prevent the spread of bacteria and viruses. Handy Cleaning Options If your work involves chemicals, oil, or grease, deep-cleansing hand soap can help remove stains and embedded debris before you head home for the day. If you don't have water handy, you can use instant hand sanitizers to keep your hands clean throughout the day.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"soaps": "2.3", "hand soaps": "2.3", "hand": "6.2"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 75, "level": -1, "url": "http://www.staples.com/Bathroom-Cleaners/cat_CL141097", "text": "Bathroom Cleaners", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Bathroom Cleaners", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"cleaners": 2, "bathroom": 5, "bathroom cleaners": 1}, "description_wc": 150, "description_text": "Use bathroom cleaners to clean and sanitize restroom fixtures. A clean restroom is more welcoming for employees, clients, and customers, and keeping the bathroom clean helps prevent the spread of germs. Products such as toilet bowl cleaners and multipurpose spray cleansers are essential for maintaining a safe, sanitary restroom. Heavy-Duty Cleansers Heavy-duty cleansers take care of tough stains and messes. In addition to removing dirt, mildew, and mold, these cleansers also kill germs that can cause disease. Multipurpose Products Multipurpose bathroom cleansers let you use a single product to clean walls, floors, and bathroom fixtures. Sponges and scrubs help you get into tight spaces to clean every inch of your office restroom. Spray-On Convenience Bathroom cleansers in a spray bottle make it simple and convenient to clean your office restroom quickly. The spray nozzle lets you precisely control where the product goes so that you avoid waste.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"cleaners": "1.3", "bathroom": "3.3", "bathroom cleaners": "1.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 8, "level": -1, "url": "http://www.staples.com/Hand-Lotions/cat_CL204584", "text": "Hand Lotions", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Hand Lotions", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"hand lotions": 3, "hand": 5, "lotions": 6}, "description_wc": 214, "description_text": "Store hand lotions at your business for skin renewal throughout the day. Whether your skin is frequently in contact with water or sensitive to temperature changes, high-quality hand lotions can reduce dryness and cracking. Staples offers small pocket-sized bottles for travel and personal use or larger pump bottles you can share with the whole office. Repair Dry Skin Continual discomfort from dry, itchy skin can lower your productivity at work. Equip your office with lotion made from powerful hydrating ingredients, which you can quickly apply at any time. Storing lotions and hand sanitizers in your bathroom is an effective way to ensure employees and clients leave with clean, moisturized hands. Accommodate Different Skin Types Choose hand lotions that suit your skin type or that can be safely used by public groups of people. You might prefer lotions made from natural ingredients for yourself or your employees. Fragrance-free, nonallergenic lotions from brands like Aveeno and Lubriderm are perfect for your business bathroom because they won't irritate visitors with sensitive skin. Easy to Dispense Whether you choose bottles with pumps or caps, lotion is released in controlled portions to prevent overuse. You can dispense more lotion when you need to and avoid disposing of excess lotion when small amounts are just enough.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"lotions": "2.8", "hand": "2.3", "hand lotions": "2.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 68, "level": -1, "url": "http://www.staples.com/Soap-Refills-Dispensers/cat_CL204583", "text": "Soap Refills & Dispensers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Soap Refills & Dispensers", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"refills": 5, "soap refills": 4, "dispensers": 8, "soap": 7}, "description_wc": 196, "description_text": "Soap refills and dispensers make hand washing convenient and easy, especially in doctors' offices and food prep areas where cleanliness is important. Frequent hand washing and good hygiene can help prevent the spread of germs and viruses, keeping both employees and customers healthy. Plenty of dispenser designs are available to choose from, so you can find the right dispenser for your needs. Kill Germs Soap refills and dispensers promote good hygiene by making it easy to wash when necessary. Place one in every bathroom and near every sink to make it easy for employees and clients to wash their hands. For areas where there is no access to water, hand sanitizers are also a good option. Sanitary Designs Soap refills and dispensers come with a variety of options. Soaps are available in several difference scents, and you can choose from manual push-button dispensers and automatic touch-free dispensers. Brands such as Brighton Professional and Kimberly-Clark make it easy to find just the right soaps and dispensers for your needs. Save Money Using soap refills and dispensers saves you money. Refills and dispensers cost much less over time than buying individual bottles of hand soap.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"refills": "2.6", "soap refills": "4.1", "dispensers": "4.1", "soap": "3.6"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 54, "level": -1, "url": "http://www.staples.com/Hand-Soaps-Sanitizers-Lotions/cat_CL141836", "text": "Hand Sanitizers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Hand Sanitizers", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"hand sanitizers": 4, "hand": 12}, "description_wc": 179, "description_text": "Hand sanitizers offer a convenient way to keep hands clean without the need for soap and water. You can easily carry them with you or keep them stationed around the office for easy access. By encouraging clean hands, you keep your work environment cleaner and healthier for everyone. Kills Germs Hand sanitizers kill approximately 99.9 percent of all germs and viruses that lead to the flu and common colds. Frequent hand washing, when combined with the use of disinfecting wipes to keep areas clean, can help to reduce the spread of illness year round. With brands such as Purell and Clorox to choose from, you know you'll find a product you can trust. Convenient Use Hand sanitizers are also easy to use. You can quickly wash your hands without the need for access to soap and water. Using hand sanitizer also reduces the need for paper towels. Gentle on Hands Many hand sanitizers use natural ingredients or include moisturizers in the product. Hands stay moisturized, which helps to eliminate dry, cracked skin commonly caused by frequent hand washing.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"hand sanitizers": "4.5", "hand": "6.7"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 28, "level": -1, "url": "http://www.staples.com/Glass-Cleaners/cat_CL164891", "text": "Glass Cleaners", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Glass Cleaners", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"glass": 6, "glass cleaners": 5, "cleaners": 6}, "description_wc": 204, "description_text": "Glass cleaners cut down bacteria buildup on the surfaces used by everyone in your office. The potent solutions dissolve different types of dirt so that germs aren't spread throughout your environment. Staples carries glass cleaners in handheld spray bottles for easy application and large refill bottles that save you money on supplies. Clean Windows and More Glass cleaners are multipurpose products you can safely use on many common surfaces, including plastic and stainless steel. While multipurpose cleaners can certainly produce sparkling glass windows, you can also use these versatile cleaning supplies to sanitize tabletops, keyboards, plastic chairs, whiteboards, and more. Apply and Clean in Minutes Convenient spray cans and bottles make it easy for you to cover the desired surface with solution in seconds and quickly wipe away dust and germs. Simply keep a ready supply of cleaning cloths or paper towels nearby to clear away glass cleaners without leaving streaks. Strong Formulas, Fresh Scents Make sure stubborn germs don't fly under the radar with antibacterial glass cleaners that break down tough substances. A cleaner environment protects visitors from harmful germs and keeps your workforce active. Choose unscented or fresh-scent varieties from brands like Windex and Sparkle to avoid lingering odors.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"glass": "2.9", "glass cleaners": "4.9", "cleaners": "2.9"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 50, "level": -1, "url": "http://www.staples.com/Disinfectants/cat_CL164913", "text": "Disinfectants", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Disinfectants", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"disinfectants": 5}, "description_wc": 213, "description_text": "Disinfectants should always be an important part of your daily cleaning routine. Regular use of disinfecting sprays helps to eliminate germs and bacteria in the air and on surfaces so that you can reduce the spread of cold and flu viruses. They're also an effective way to eliminate odors, keeping your home or office smelling clean and fresh. Kills Germs and Viruses Disinfectants from brands such as Lysol can kill many of the germs and viruses that lead to influenza and common colds. Regular use can help to keep both employees and clients healthier and happier. Regularly using disinfecting wipes to clean surfaces also helps to reduce the spread of germs. Fresher Air Using disinfectants on a daily basis helps to eliminate odors caused by bacteria in the air and on the surfaces around you. Keep disinfectants in the bathroom or in other areas where odors are likely to occur so that you can easily eliminate odors and keep your office smelling fresh and clean. Multiple Sizes Disinfectants come in a variety of sizes, so you can purchase smaller cans to store in your desk or cabinet, or you can buy bulk sizes for complete office cleaning. You will even find that travel sizes for tucking into purses and briefcases are available.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"disinfectants": "2.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 16, "level": -1, "url": "http://www.staples.com/Toilet-Paper-Dispensers/cat_CL165580", "text": "Toilet Paper Dispensers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Toilet Paper Dispensers", "parent_url": "http://www.staples.com/Paper-Towels-Tissues-Napkins/cat_DP1865", "keyword_count": {"toilet paper dispensers": 1, "toilet": 2, "dispensers": 3, "paper": 4}, "description_wc": 130, "description_text": "Durable toilet paper dispensers are a must for busy office restrooms. Paper stays dry and neatly organized when placed in a dispenser. Solid plastic construction is designed to easily endure even heavy usage. Convenient Dispensers allow you to keep paper located in the best location without drops, falls, or spills. Stock up on toilet tissue so that you'll always have a replacement roll available when you need it. Sturdy Design Durable construction keeps your dispenser operational for longer with little or no maintenance. All you ever need to do is change the rolls. Versatile Sizing You'll find similar high-quality dispensers for both standard- and jumbo-size tissue rolls. Whichever type of paper you use, you'll find an ideal dispenser for each restroom stall in the office.", "parent_text": "Paper Towels / Tissues / Napkins", "keyword_density": {"toilet paper dispensers": "2.3", "toilet": "1.5", "dispensers": "2.3", "paper": "3.1"}, "department_id": 15}
{"nr_products": 7, "level": -1, "url": "http://www.staples.com/Baby-Wipes/cat_CL168481", "text": "Baby Wipes", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Paper-Towels-Tissues-Napkins/cat_DP1865", "parent_text": "Paper Towels / Tissues / Napkins", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 83, "level": -1, "url": "http://www.staples.com/All-Purpose-Cleaners/cat_CL80201", "text": "All Purpose Cleaners", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "All Purpose Cleaners", "parent_url": "http://www.staples.com/Cleaners-Chemicals-Soaps-Wipes/cat_CG1238", "keyword_count": {"purpose": 2}, "description_wc": 171, "description_text": "All-purpose cleansers make routine cleaning a breeze. Take one product from walls to surfaces to floors and save space in your supply closet by stocking fewer specialty products. Select from sprays, powders, and foams to get the most efficient cleaning power. Save Money with Refills Rather than replacing spray bottles, refill existing bottles with less expensive refill cleansers and save. Refill jugs allow you to keep a large stock of cleansers on hand without storing multiple bottles. Numerous Formulations Whether you prefer powders, sprays, or foams, you'll find the products you want from top brands like Pine-Sol and Pledge. You can even choose nontoxic or ecofriendly products, which are excellent for use in schools and small offices. Large Sizes By buying in bulk, you'll ensure you always have cleanser when you need it and you'll save time when reordering supplies. Be sure to stock up on multipurpose sponges as well so that you'll be prepared to clean up any mess in a moment's notice.", "parent_text": "Cleaners: Chemicals / Soaps / Wipes", "keyword_density": {"purpose": "1.2"}, "department_id": 15}
{"nr_products": 2, "level": -2, "url": "http://www.staples.com/Lint-Rollers/cat_CL205342", "text": "Lint Rollers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Laundry/cat_DP5345", "parent_text": "Laundry", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 37, "level": -1, "url": "http://www.staples.com/Paper-Towel-Dispensers/cat_CL141830", "text": "Paper Towel Dispensers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Paper Towel Dispensers", "parent_url": "http://www.staples.com/Paper-Towels-Tissues-Napkins/cat_DP1865", "keyword_count": {"paper": 14, "paper towel": 12, "paper towel dispensers": 4, "towel": 14}, "description_wc": 162, "description_text": "Paper towel dispensers are available with either manual or automatic dispensing. Whether you need a dispenser for paper towel rolls, standard c-fold paper towels, or toilet paper, you'll easily find the right one for your needs. When you use a towel dispenser, you control the amount of towel dispensed per use, which saves money and eliminates waste. Sanitary Paper towel dispensers provide hands-free access to paper towels, so hands stay clean, preventing the spread of germs. With easy access to paper towels, employees are more likely to wash their hands, keeping your business environment clean and healthy. Eliminate Waste Paper towel dispensers control the amount of paper towel dispensed per use. This saves you money and eliminates unnecessary paper waste. Convenient Paper towel dispensers can be mounted wherever they are needed, and you can use paper towel rolls or c-fold paper towels . You and your employees can have convenient access to paper towels wherever you need them.", "parent_text": "Paper Towels / Tissues / Napkins", "keyword_density": {"paper towel dispensers": "7.5", "towel": "8.7", "paper": "8.7", "paper towel": "14.9"}, "department_id": 15}
{"nr_products": 8, "level": -1, "url": "http://www.staples.com/Baby-Diapers/cat_CL210534", "text": "Baby Diapers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Paper-Towels-Tissues-Napkins/cat_DP1865", "parent_text": "Paper Towels / Tissues / Napkins", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 20, "level": -1, "url": "http://www.staples.com/Napkins/cat_CL141827", "text": "Napkins", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Napkins", "parent_url": "http://www.staples.com/Paper-Towels-Tissues-Napkins/cat_DP1865", "keyword_count": {"napkins": 7}, "description_wc": 143, "description_text": "Make quick work of crumbs and spills by keeping a supply of paper napkins on hand. Ideal for snacks, parties, meals, and more, paper napkins allow for easy cleanup with little effort. Top brands provide the quality you need even for larger jobs. Easy to Use Instead of fussing with wet washcloths or sponges, simply provide napkins to help diners stay neat during mealtime. Napkins are easy to simply throw away after use, making cleanup a snap. Lots of Patterns Choose from white, colored, or patterned napkins to add a pop of style to any event. Pair decorative napkins with disposable plates to create charming place settings. Quality Brands With options from brands including EasyNap and SCA, you can be assured your napkins are up to the task of keeping messes contained. Plus, large package sizes ensure you'll never run out unexpectedly.", "parent_text": "Paper Towels / Tissues / Napkins", "keyword_density": {"napkins": "4.9"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 39, "level": -1, "url": "http://www.staples.com/Facial-Tissue/cat_CL141828", "text": "Facial Tissue", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Facial Tissue", "parent_url": "http://www.staples.com/Paper-Towels-Tissues-Napkins/cat_DP1865", "keyword_count": {"facial tissue": 2, "tissue": 7}, "description_wc": 161, "description_text": "Convenient facial tissue provides a healthier alternative to sniffling and sneezing into sleeves or hands. Busy offices can benefit from keeping tissues in stock to prevent the spread of cold and flu germs. Large package sizes ensure you'll always have tissues when you need them. Great Brands Facial tissue from top brands such as Puffs and Kleenex delivers the quality you've come to expect. Choose slim-line or square boxes to best suit your office layout and decor. Quick Cleanup Because tissues such as Kleenex can simply be thrown away after use, they won't linger on desks or other surfaces where germs can easily spread. Getting a new tissue is as easy as pulling the next one from the box. Bulk Packaging Buying in bulk helps you keep tissues on hand for employees at all times. For even more protection from germs in the office, stock up on hand sanitizer for workstations, restrooms, and break areas as well.", "parent_text": "Paper Towels / Tissues / Napkins", "keyword_density": {"facial tissue": "2.5", "tissue": "4.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 38, "level": -2, "url": "http://www.staples.com/Laundry-Detergent/cat_CL168322", "text": "Laundry Detergent", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Laundry Detergent", "parent_url": "http://www.staples.com/Laundry/cat_DP5345", "keyword_count": {"laundry detergent": 4, "laundry": 5}, "description_wc": 138, "description_text": "Use laundry detergent to get rid of stains and spots quickly and easily. Choose from powder or liquid versions in a variety of scents. Premeasured packs let you skip the measuring and pouring steps. Brighten Whites White linens and clothing stay looking sharp with laundry detergents designed for light-colored fabric. Chlorox bleach also helps ensure that white fabric stays clean and attractive. Remove Stains Choose a high-powered laundry detergent from Tide, Whisk, or Ajax to get rid of stubborn stains. You can also use stain treatment pens or wipes to take care of little spots before you turn on the washer. Avoid Allergens Choose a laundry detergent that is free of allergens for fabrics used by people with sensitive skin. If you plan to let your laundry dry naturally, you'll need drying racks as well.", "parent_text": "Laundry", "keyword_density": {"laundry detergent": "5.8", "laundry": "3.6"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 64, "level": -1, "url": "http://www.staples.com/Bath-Tissue/cat_CL141829", "text": "Toilet Paper", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Toilet Paper", "parent_url": "http://www.staples.com/Paper-Towels-Tissues-Napkins/cat_DP1865", "keyword_count": {"paper": 8, "toilet paper": 7}, "description_wc": 158, "description_text": "Staples offers a wide variety of toilet paper from top brands like Charmin and Kleenex . Keep your bathroom well stocked with high quality toilet paper to keep employees, customers, and clients happy. Toilet paper is also critical for the home or home office, keep your supply closet well stocked to avoid running out. Staples also carries a wide selection of toilet paper holders and toilet paper dispensers to keep your bath tissue neat and organized. Convenience We sell toilet paper in bundles that meet the needs of home owners, small businesses and large corporations. With many different size options, from small, four-count packs to large cases with nearly 100 rolls each \u2013 Staples makes it easy. Soft and Absorbent Toilet paper is soft and absorbent to meet your needs. Not only is toiler paper a restroom necessity, but it can also be used to clean up spills around the home or office or even wipe down counters.", "parent_text": "Paper Towels / Tissues / Napkins", "keyword_density": {"paper": "5.1", "toilet paper": "8.9"}, "department_id": 15}
{"level": -1, "url": "http://www.staples.com/Plumbing/cat_DP8381", "text": "Plumbing", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Tools-Flashlights-Cords/cat_CG1244", "parent_text": "Tools / Flashlights / Cords", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "level": -1, "url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "text": "Measuring / Leveling Tools", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Measuring / Leveling Tools", "parent_url": "http://www.staples.com/Tools-Flashlights-Cords/cat_CG1244", "keyword_count": {"measuring": 2, "leveling tools": 2}, "description_wc": 142, "description_text": "Measuring and leveling tools let you precisely measure large and small lengths and areas. They are essential for building, drafting, and engineering. Building or completing repairs is easier with measuring and leveling tools such as straight-edge rulers, compasses, tape measures, and squares. Create Perfect Circles Radius markers from Contour and Curv-O-Mark come in various sizes and let you make circles with ease. Protractors help you measure angles in a 180-degree or 360-degree space. Draw Lines Accurately Use a straight-edge ruler to get a perfectly straight line every time. Squares let you draw corners on your draft or blueprint. Account for Natural Variations Levels let you account for natural variations in your building site by letting you determine whether something is truly level. Stud finders let you accurately determine where studs are in your wall, eliminating guessing.", "parent_text": "Tools / Flashlights / Cords", "keyword_density": {"measuring": "1.4", "leveling tools": "2.8"}, "department_id": 15}
{"level": -1, "url": "http://www.staples.com/Maintenance-Parts/cat_DP8380", "text": "Maintenance Parts", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Tools-Flashlights-Cords/cat_CG1244", "parent_text": "Tools / Flashlights / Cords", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 24, "level": -1, "url": "http://www.staples.com/Recycle-Bins/cat_CL141924", "text": "Recycle Bins", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Recycle Bins", "parent_url": "http://www.staples.com/Waste-Recycling/cat_CG2827", "keyword_count": {"bins": 1}, "description_wc": 35, "description_text": "Keep your office green with our selection of reycycling bins at staples.com. Ranging from 7 to 42 gallon capacities, keep up with your recycling from brands like Rubbermaid , Safco , and Brighton Professional .", "parent_text": "Waste / Recycling", "keyword_density": {"bins": "3.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 78, "level": -1, "url": "http://www.staples.com/Brooms-Sweepers/cat_CL141837", "text": "Brooms / Sweepers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Brooms / Sweepers", "parent_url": "http://www.staples.com/Vacuums-Mops-Floor-Care/cat_CG2826", "keyword_count": {"brooms": 4, "sweepers": 4}, "description_wc": 190, "description_text": "Brooms and Sweepers: Cleaning Your Rooms Even Deeper. Find brooms and sweepers for a variety of cleaning purposes, from small hand brushes to large sweepers including Swiffer sweepers that are designed to handle big messes. These tools help you clean your office, garage, or commercial building quickly. Stock up on extra broom handles and brush heads to replace ones that get old or damaged. Handle Large Messes When you've got a big mess or need to thoroughly clean an entire floor space, look to an upright or angled broom or a wire bristle brush. In addition to brooms, mops, and buckets, stock your cleaning supply cabinet with all-purpose cleaners. Clean Tiny Spaces Utility brushes from Anchor Brand let you get into tight spaces to clean. A utility scrub brush helps you handle particularly dirty spots that you can't access with larger brooms or mops. Do a Quick Cleanup Counter dusters from Magnolia Brush get messes off the counter quickly so you can get back to work fast without the need to spend time using a broom. For a rapid floor cleaning, try a Swiffer sweeper or mop.", "parent_text": "Vacuums, Mops & Floor Care", "keyword_density": {"brooms": "2.1", "sweepers": "2.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "level": -1, "url": "http://www.staples.com/Lawn-Garden-Tools/cat_DP5138", "text": "Lawn / Garden Tools", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Lawn / Garden Tools", "parent_url": "http://www.staples.com/Tools-Flashlights-Cords/cat_CG1244", "keyword_count": {"lawn": 4, "tools": 3, "garden": 7, "garden tools": 2}, "description_wc": 178, "description_text": "Lawn and garden tools help you make the most of your yard or garden. From planting flowers and pruning bushes to cleaning up and maintaining the lawn, these tools can keep everything looking green and beautiful. A comprehensive collection of lawn and garden tools includes rakes, hoes, picks, forks, post-hole diggers, pruning shears, shovels, and spades. Maintain a Beautiful Yard Water your lawn with garden hoses , and administer pesticides using sprayers. Pruning shears let you shape bushes and trees to keep them from looking unruly, while weed cutters and rakes help you keep everything tidy. Grow Flowers and Food Shovels and hoes get you into the dirt, so you can plant flowers, trees, and vegetable plants. Grow anything you want from seeds or put starter plants in the garden to get a jump start on spring. Transport Dirt, Plants, and Accessories Wheelbarrows help you move almost anything in the garden, including paving stones for your garden path, dirt for planting, or containers of fertilizer. You can also get extra wheelbarrow wheels in case one goes flat.", "parent_text": "Tools / Flashlights / Cords", "keyword_density": {"lawn": "2.3", "tools": "1.7", "garden": "4.0", "garden tools": "2.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "level": -1, "url": "http://www.staples.com/Hose-Clamps-Cable-Ties-Fasteners/cat_DP5137", "text": "Hose Clamps / Cable Ties / Fasteners", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Hose Clamps / Cable Ties / Fasteners", "parent_url": "http://www.staples.com/Tools-Flashlights-Cords/cat_CG1244", "keyword_count": {"hose clamps cable ties": 1, "clamps": 2, "fasteners": 1, "cable": 2}, "description_wc": 139, "description_text": "Maintenance work can be difficult, so you will want to make sure you have the right tools. This section has everything from hose clamps, cable ties, and fasteners to tie wire and buckles. Look here and find the right tools for your needs. Great Selection There are many types of tools you can use, but you'll be able to find the right ones here. With cable tie guns, banding tools, and more, you'll have what you need to finish the job. Buckling Tools Buckles and clamps ensure your work stays looking great. Add tie wire or clips to make sure it is extra secure. Anchors for Stability Anchor your wires and make sure they don't move out of place with a screw and wedge kit. You can also use rings or pins to secure your materials.", "parent_text": "Tools / Flashlights / Cords", "keyword_density": {"hose clamps cable ties": "2.9", "clamps": "1.4", "fasteners": "0.7", "cable": "1.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "level": -1, "url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "text": "Hand Tools / Tool Storage", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Hand Tools / Tool Storage", "parent_url": "http://www.staples.com/Tools-Flashlights-Cords/cat_CG1244", "keyword_count": {"hand tools": 2, "tool": 13, "storage": 3, "hand": 3, "tool storage": 2, "tools": 8}, "description_wc": 170, "description_text": "Hand tools and tool storage make it easy for you to tackle construction, improvement, and maintenance projects around the workplace. Ordinary tools like hammers and screwdrivers enable you to handle the most common fix-it-up tasks. Specialty tools, such as pipe threaders, make occasional projects accessible to amateurs as well as professionals. Portable Convenience Bags, belts, and pouches make it easy for you to take your tools with you from job to job. The belts and pouches also enable you to work with multiple tools without having to go back to your main tool collection. Accessories for Every Job Accessories extend the usefulness of your standard tools. Chisels, pins, sockets, and other items work with your standard tool set to get the job done. Versatile Options Hand tools and tool storage equipment are designed specifically for your projects and storage solutions and help you get the most out of your tool collection. Invest in a leather bib apron to protect your clothes while you're working with your tools.", "parent_text": "Tools / Flashlights / Cords", "keyword_density": {"hand tools": "2.4", "tool": "7.6", "storage": "1.8", "hand": "1.8", "tool storage": "2.4", "tools": "4.7"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "level": -1, "url": "http://www.staples.com/Flashlights-Lanterns-Work-Lights/cat_DP5136", "text": "Flashlights / Lanterns / Work Lights", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Flashlights / Lanterns / Work Lights", "parent_url": "http://www.staples.com/Tools-Flashlights-Cords/cat_CG1244", "keyword_count": {"flashlights lanterns": 4, "lights": 14, "work": 7, "flashlights": 9, "work lights": 4}, "description_wc": 185, "description_text": "Flashlights, lanterns, and work lights are ideal for illuminating areas where no sunlight or permanent lighting fixture is available. They're also great for troubleshooting or finding a missing part or tool. Choose from battery-powered and electric sources of temporary lighting according to your needs. Find It with a Flashlight When it comes to shedding some quick light on a situation, like a hard-to-see leak or a tool that has fallen into a maze of pipes and wires, battery-powered flashlights are the time-honored choice among flashlights, lanterns, and work lights. Staples has a wide selection of flashlights and batteries . Work Easier with Light Flashlights, lanterns, and work lights for extended use include cordless models that are similar to flashlights and corded models that run on AC current. You can use a clamp lamp or a hanging work light to keep both your hands free to work. Special Temporary Lighting Job-specific and special flashlights, lanterns, and work lights include head lamps, miniature flashlights and penlights, and flexible flashlights. These helpful tools get light right to where you need it.", "parent_text": "Tools / Flashlights / Cords", "keyword_density": {"flashlights lanterns": "4.3", "lights": "7.6", "work": "3.8", "flashlights": "4.9", "work lights": "4.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "level": -1, "url": "http://www.staples.com/Automotive-Maintenance-Repairs/cat_DP5131", "text": "Automotive Maintenance / Repairs", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Automotive Maintenance / Repairs", "parent_url": "http://www.staples.com/Tools-Flashlights-Cords/cat_CG1244", "keyword_count": {"automotive maintenance": 3, "repairs": 3, "maintenance": 5}, "description_wc": 167, "description_text": "Automotive maintenance and repairs are part of life, and you'll need to make sure your vehicle keeps running so you can do your job. Parts like booster cables, fittings, and valves make it easier to repair any broken parts and keep your transportation in good shape. You can use clamps, chargers, and more to keep your vehicle running well. Easy Repair Use flashlights to help you see the part you need to repair. With replacement fittings and more available for automotive maintenance and repairs, we have what you need to get your vehicle back into working order. Maintenance Made Easy Automotive maintenance and repairs are easier than ever with funnels for oil changes and measuring cans for liquids. With tire gauges, tarps, and other accessories, performing routine maintenance and changing your car's oil or other fluids is simpler. Charging Kits When you're on the road, the last thing you want is a dead battery. Booster cables and battery clamps make it easy to recharge.", "parent_text": "Tools / Flashlights / Cords", "keyword_density": {"automotive maintenance": "3.6", "repairs": "1.8", "maintenance": "3.0"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "level": -1, "url": "http://www.staples.com/Chalk-Reels-Marking-Tools/cat_DP5135", "text": "Chalk Reels / Marking Tools", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Chalk Reels / Marking Tools", "parent_url": "http://www.staples.com/Tools-Flashlights-Cords/cat_CG1244", "keyword_count": {"chalk": 8, "chalk reels": 3, "marking": 8, "reels": 4, "marking tools": 6}, "description_wc": 208, "description_text": "Chalk reels and marking tools, including railroad crayon chalk, marking chalk, and paint markers, let you set temporary guidelines on pavement and grass or establish permanent labels on working surfaces. With these marks, you can complete any project with precision and without mistakes. Marking tools come in a variety of colors, so you can pick the color that will show up best against your working surface. Helpful Guidance With the right chalk reels and marking tools, you'll never have to worry about crooked lines. Crayon chalk, line reels, and marking chalk enable you to set temporary guidelines and boundaries for tasks ranging from street painting to building fences. Easy Labeling Paint markers are the perfect tool for labeling almost anything. These marking tools come in a variety of colors and leave permanent marks on metal, plastic, ceramics, and glass, so one marker can help you complete a variety of projects. Portable Convenience Chalk reels and marking tools are designed to go where you go. Markers, such as lumber crayons, can fit in your pocket, so you can always have a marker handy to label items and indicate instructions. Keep a pair of safety glasses on hand to protect your eyes when using chalk and other marking tools.", "parent_text": "Tools / Flashlights / Cords", "keyword_density": {"chalk": "3.8", "chalk reels": "2.9", "marking": "3.8", "reels": "1.9", "marking tools": "5.8"}, "department_id": 15}
{"level": -1, "url": "http://www.staples.com/Equipment-and-Tools/cat_DP1994", "text": "Equipment and Tools", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Tools-Flashlights-Cords/cat_CG1244", "parent_text": "Tools / Flashlights / Cords", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Stud-Finders/cat_CL166988", "text": "Stud Finders", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Stud Finders", "parent_url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "keyword_count": {"stud finders": 3, "finders": 4, "stud": 7}, "description_wc": 169, "description_text": "Magnetic stud finders are perfect for when you need to hang a picture or shelf in your office. Designed to magnetically locate wall studs, these finders are made of metal and will work great with drywall. They locate screws and nails, alerting you to the studs instantly. Magnetized Finder The magnets on these stud finders are made to alert you to the presence of nails in the walls. Made for use over drywall, this device finds the stud, so you can begin putting up your shelving unit without harming the wall. Grooved Base The grooved base on these stud finders will help you mark where your nails are in the wall. Gently mark your wall with the base, and you'll have a great starting point for your next project. Portable This stud finder is small enough for you to take with you. Whether you use it at the office or on the job site, it'll give you a reading on your wall that you can depend on.", "parent_text": "Measuring / Leveling Tools", "keyword_density": {"stud finders": "3.6", "finders": "2.4", "stud": "4.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 4, "level": -2, "url": "http://www.staples.com/Flange-Pins/cat_CL167240", "text": "Flange Pins", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Flange Pins", "parent_url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "keyword_count": {"pins": 5, "flange pins": 3}, "description_wc": 129, "description_text": "Flange pins make it easy to align piping materials. The tools provide precise measurements that help ensure a perfect fit. A proper fit helps prevent leaks in your office or your clients' homes. Line Up Pipes with Ease Flange pins let you quickly ensure that pipes will connect seamlessly. Using the pins can save time and reduce the likelihood of future problems arising from the connection. Precision Measurement Flange pins provide precise measurements perfect for connectors and pipes. To measure the overall size of such connections, check out calipers and dividers . Optional Attachments Some pins feature levels that can help ensure pipes are aligned properly with the wall or floor. Many built-in levels also feature replaceable vials that make it easy to fix the device if needed.", "parent_text": "Measuring / Leveling Tools", "keyword_density": {"pins": "3.9", "flange pins": "4.7"}, "department_id": 15}
