{"department_text": "Cleaning | Facilities | Tools", "nr_products": 115, "level": -2, "url": "http://www.staples.com/Tape-Measures/cat_CL167137", "text": "Tape Measures", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Tape Measures", "parent_url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "keyword_count": {"tape": 8, "tape measures": 3}, "description_wc": 200, "description_text": "Tape measures give you a quick and easy way to measure lengths and widths for your projects. Perfect for the office or construction site, most of these devices come with end hooks, so you can properly take your measurements without losing control of the tape. Some also come with belt clips so you can have your tape on you at all times. Resists Impact Working on a job site can lead to a lot of wear and tear, so it's important to select a tape measure that will hold up. Brands such as Lufkin offer a rubber shell that will keep your accessory from being damaged. Extendable Tape No matter if you're working with a large piece of wall or a tiny picture frame , these tape measures allow you to tackle different sizes and lengths. There's even a locking mechanism that'll keep your tape in place while you measure. Attach It to Your Belt Walking around the job site can lead to loose items falling out of your pouch. Many tape measures feature clips, so you can simply attach yours to your belt and walk around without worrying about it falling out of your pocket.", "parent_text": "Measuring / Leveling Tools", "keyword_density": {"tape": "4.0", "tape measures": "3.0"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 4, "level": -2, "url": "http://www.staples.com/Measuring-Wheels/cat_CL166979", "text": "Measuring Wheels", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Measuring Wheels", "parent_url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "keyword_count": {"measuring": 5, "wheels": 5, "measuring wheels": 4}, "description_wc": 158, "description_text": "Whether you are measuring distances indoors or outdoors, measuring wheels can make the job go faster. Wheels have convenient push handles to avoid back strain. A variety of available wheel sizes makes it easy for you to select the one that is best for a certain job. Easy Operation Our measuring wheels are made with pistol handles, so you can get an easy grip. Models with high-visibility handles make it a simple task to keep an eye on the wheel or find the tool in a crowded shed. Long and Short Ranges Having a selection of measuring wheels in various sizes helps you tackle large or small projects. Make any task more comfortable with high-dexterity gloves . Indoor or Outdoor Use Our measuring wheels can be used indoors or outdoors, giving you maximum flexibility. Smaller wheel diameters are best for indoor projects, while larger wheel diameters give the best measurement estimates on rough or uneven ground.", "parent_text": "Measuring / Leveling Tools", "keyword_density": {"measuring": "3.2", "wheels": "3.2", "measuring wheels": "5.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 32, "level": -2, "url": "http://www.staples.com/Squares/cat_CL166987", "text": "Squares", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Squares", "parent_url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "keyword_count": {"squares": 2}, "description_wc": 136, "description_text": "Squares are essential in carpentry, roofing, and woodworking. Make accurate cuts and determine angles with these handy tools. Manufacturers such as Empire Level, Stanley, and L.S. Starrett make squares in various sizes for all of your needs. Create a Staircase These tools let you determine the correct angles and measurements to create everything from a basic stairway to an elaborate spiral staircase. Use a scientific calculator to help you make sense of the measurements you take. Repair a Roof Measure the roof pitch and slope using a basic square. Choose one with an attached level to account for discrepancies in the house foundation. Portable Convenience When you're at a job site, a handy pivot square is easy to take with you. Look for one with a carrying pouch to keep it protected while in transit.", "parent_text": "Measuring / Leveling Tools", "keyword_density": {"squares": "1.5"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 5, "level": -2, "url": "http://www.staples.com/Tie-Wire/cat_CL167132", "text": "Tie Wire", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Tie Wire", "parent_url": "http://www.staples.com/Hose-Clamps-Cable-Ties-Fasteners/cat_DP5137", "keyword_count": {"tie": 9, "wire": 12, "tie wire": 7}, "description_wc": 199, "description_text": "Tie wire is the multifunctional fastener and connector that helps you complete indoor and outdoor DIY jobs. Made of steel with a stainless or black annealed finish, tie wire fastens items together with a more permanent connection than can be created with plastic ties. The wire is available in 14-, 16-, and 18-gauge thickness, so you can pick the wire with the strength that will best suit your needs. Versatile Tie wire can be used for various projects around the workplace. Once you've bundled a group of items with tie wire, you can be sure that they'll stay bundled until you release the tie using the right tool. Useful Packaging Choose a roll or a spool when selecting tie wire for projects around the workplace. The spools come in 2 to 5 lb weights and can be placed in a tie-wire reel for easy dispensing. Strong Enough for the Job Tie wire comes in sizes up to 18 gauge, so you can feel confident that the wire is strong enough to handle heavy items. Add a wire cutter to your equipment collection to make it easy to cut the wire into useable sections.", "parent_text": "Hose Clamps / Cable Ties / Fasteners", "keyword_density": {"tie": "4.6", "wire": "6.1", "tie wire": "7.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 4, "level": -2, "url": "http://www.staples.com/Plumb-Bobs/cat_CL166985", "text": "Plumb Bobs", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Plumb Bobs", "parent_url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "keyword_count": {"plumb bobs": 6, "bobs": 7, "plumb": 7}, "description_wc": 159, "description_text": "Plumb-bobs make it a breeze to establish vertical lines for your important construction projects. Round and conical plumb-bobs come in different weights, so you can pick the one that is heavy enough to do the job. These bobs tie easily to any length of string or line. Heavy-Duty Construction Plumb-bobs are made of heavy-duty materials, such as steel and brass, so the bob will last for years. Lacquered finishes ensure these plumb-bobs resist corrosion. Versatile Options With selections weighing from eight to twenty ounces, you can find a plumb-bob for your specific job. Keep a variety of plumb-bobs in your tool kit to make sure you have the weighted guide you need to check the vertical lines of any project. Simple Guidance Plumb-bobs are the simplest way to check the vertical integrity of any project. A bob and a length of string is all you need to ensure accurate construction.", "parent_text": "Measuring / Leveling Tools", "keyword_density": {"plumb bobs": "7.5", "bobs": "4.4", "plumb": "4.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 23, "level": -2, "url": "http://www.staples.com/Thermometers/cat_CL167138", "text": "Thermometers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Thermometers", "parent_url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "keyword_count": {"thermometers": 5}, "description_wc": 176, "description_text": "When you need an accurate reading of the temperature on your industrial job, check out these different thermometers. The small, handheld devices can be carried with you wherever your next project is. There are also different types of personal thermometers available, so you can check someone's temperature at the office or in a hospital. Thermometers for Industrial Jobs With several infrared thermometers available, we help you find the right one for that next construction gig. Powered by batteries and featuring an LCD display, these devices include an electronic trigger that'll give you a continuous temperature reading. Available for Personal Use Oral thermometers are great for checking to see if you have the cold or flu. These reusable, latex-free devices are small enough to be stored in your office. Strips also Available If you're in need of a quick temperature scan before a meeting, there are forehead thermometer strips that will give you a reading. Just apply one to your skin, and it'll give you a reading on your current body heat.", "parent_text": "Measuring / Leveling Tools", "keyword_density": {"thermometers": "2.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 55, "level": -2, "url": "http://www.staples.com/Hose-Clamps/cat_CL167131", "text": "Hose Clamps", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Hose Clamps", "parent_url": "http://www.staples.com/Hose-Clamps-Cable-Ties-Fasteners/cat_DP5137", "keyword_count": {"clamps": 7, "hose": 6, "hose clamps": 4}, "description_wc": 172, "description_text": "Hose clamps are versatile accessories that help you complete any job that requires a connection between a hose or tube and another object. From plumbing to auto repair, hose clamps keep connections from leaking or bursting. Combo-Hex, Hy-Gear, and Dixon are only some of the brands that offer a wide selection of clamps for a variety of projects. Easy to Use With the right equipment in your tool kit , hose clamps are easy to use. The tightening mechanism can be turned using common tools, such as a screwdriver. Versatile Options With options that include a variety of clamp capacities, widths, weights, and bolt or screw types, we help you find a hose clamp that can secure any type of attachment. Crimp and worm gear drive clamps are only two of the many available options. Made to Last Hose clamps are made of durable stainless or plated steel, so the connections that the clamps secure will last. You won't have to worry about corrosion with these high-quality fasteners.", "parent_text": "Hose Clamps / Cable Ties / Fasteners", "keyword_density": {"clamps": "4.1", "hose": "3.5", "hose clamps": "4.7"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 15, "level": -2, "url": "http://www.staples.com/Ruler/cat_CL167136", "text": "Ruler", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Ruler", "parent_url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "keyword_count": {"ruler": 6}, "description_wc": 137, "description_text": "Rulers are an excellent choice when you have to make measurements. Precision measurements with rulers can have many benefits for small businesses. Their compact and lightweight design helps ensure that you can have a ruler handy whenever you need it. Cut Down on Waste Savvy entrepreneurs know the mantra of measuring twice and cutting once. Accurate rulers help ensure cuts are made perfectly the first time, reducing loss due to incorrect measurement. Make Precise Measurements Rulers come in a variety of configurations that allow for exceptionally precise measurements. When you need to measure the inside or circumference of an item, check out calipers and dividers . Ensure Projects Remain Level Rulers can be used as impromptu levels. Level shelves and tables hold items more securely and help cut down on the chance of accidents in the workplace.", "parent_text": "Measuring / Leveling Tools", "keyword_density": {"ruler": "4.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 8, "level": -2, "url": "http://www.staples.com/Work-Lights/cat_CL167127", "text": "Work Lights", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Work Lights", "parent_url": "http://www.staples.com/Flashlights-Lanterns-Work-Lights/cat_DP5136", "keyword_count": {"lights": 8, "work": 6, "work lights": 3}, "description_wc": 147, "description_text": "Work lights enable you to get the job done, even if permanent lighting is unavailable. With the right type of temporary lighting, you can keep your workers on the job and prevent a work stoppage. Flashlights, clamp lights, and light strings are portable solutions with features that can handle any dark area. Enhanced Safety Work lights enhance the safety of your workers. Trouble lights can be used to keep others away from a particular area, so no one is injured because of poor light conditions. Portable Convenience Whenever you need extra light in an area, clamp lights can provide a convenient solution. Keep a supply of light bulbs on hand to power your array of work lights. Emergency Help When the lights go out, a battery-operated flashlight can light the way until power is restored. A variety of flashlight models makes illuminating dark spaces a breeze.", "parent_text": "Flashlights / Lanterns / Work Lights", "keyword_density": {"lights": "5.4", "work": "4.1", "work lights": "4.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Temperature-Indicators/cat_CL167224", "text": "Temperature Indicators", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Temperature Indicators", "parent_url": "http://www.staples.com/Chalk-Reels-Marking-Tools/cat_DP5135", "keyword_count": {"temperature": 9, "temperature indicators": 4}, "description_wc": 192, "description_text": "Temperature indicators are indispensable tools to help you keep your welding and heat treatment projects on track. The sticks come in a wide range of temperature points, so you can keep a selection on hand to use with a variety of projects. The results are guaranteed accurate at plus or minus 1 percent of the indicated temperature, ensuring that your metalworking project comes out right. Easy to Use Temperature indicators are incredibly easy to use. Simply pick the indicator stick with the temperature point you need to achieve and mark the heated surface. When the mark melts, you'll know the surface temperature has reached the desired level. Convenient Control With slip-resistant metal exteriors, temperature indicators are easy to hold and control in your hand while you're working around hot surfaces. Invest in a pair of welding gloves to protect your hands in a way that won't affect your ability to control the temperature stick. Portable Information Temperature indicators resemble pens, so you can easily carry one with you in your pocket or bag. You can even carry more than one if you're working with multiple heated surfaces.", "parent_text": "Chalk Reels / Marking Tools", "keyword_density": {"temperature": "4.7", "temperature indicators": "4.2"}, "department_id": 15}
