{"department_text": "Cleaning | Facilities | Tools", "nr_products": 5, "level": -2, "url": "http://www.staples.com/Steel-Hand-Stamp-Sets/cat_CL167124", "text": "Steel Hand Stamp Sets", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Steel Hand Stamp Sets", "parent_url": "http://www.staples.com/Chalk-Reels-Marking-Tools/cat_DP5135", "keyword_count": {"steel": 4, "hand stamp": 6, "stamp": 8, "hand stamp sets": 5, "hand": 7, "sets": 6, "steel hand stamp sets": 3}, "description_wc": 197, "description_text": "Steel hand stamp sets enable you to custom mark an array of materials, including metals, wood, leather, and plastic. Available in collections of numbers or letters, these sets are a quick way to individualize customer purchases by hand. C.H. Hanson and other companies offer a wide variety of hand stamp sets to help you complete any project. Easy Customization Number and letter steel hand stamp sets and a ball pein hammer are all you need to add names, messages, and slogans to your products. Build a collection of hand stamp sets so you have what you need to complete any job. Convenient Variety With options including character size, shank width and length, and shank type available, you can find steel hand stamp sets that you can use to personalize items of various sizes. The wide array of choices gives you added flexibility when offering options to customers. Heavy-Duty Construction These hand stamps are made of heavy-duty steel, and each set is packaged in a durable plastic container designed to last for years. Each individual stamp features a crowned striking surface that makes it easy to ensure full striking force to the middle of the stamp.", "parent_text": "Chalk Reels / Marking Tools", "keyword_density": {"steel": "2.0", "hand stamp": "6.1", "stamp": "4.1", "hand stamp sets": "7.6", "hand": "3.6", "sets": "3.0", "steel hand stamp sets": "6.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 5, "level": -2, "url": "http://www.staples.com/Stencil-Sets/cat_CL167125", "text": "Stencil Sets", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Stencil Sets", "parent_url": "http://www.staples.com/Chalk-Reels-Marking-Tools/cat_DP5135", "keyword_count": {"stencil": 5, "stencil sets": 1}, "description_wc": 122, "description_text": "Stencil sets are commonly made of metal and can last for years. They allow almost anyone to create a visible and clear message on most surfaces. Many businesses rely on stencils for making signs or for marking important structures. Mark Important Structures Stencils let you easily mark structures with building numbers and other designations. Use them for rental units, business departments, and delivery centers. Create Elegant Works of Art Stencils can also assist greatly in the creation of works by artists. For even more options, try a variety of carpentry and art pencils . Repair Old Signs Old signs are less effective when their lettering fades. Replace faded letters using stencils that stand out and catch the eyes of passing potential customers.", "parent_text": "Chalk Reels / Marking Tools", "keyword_density": {"stencil sets": "1.7", "stencil": "4.1"}, "department_id": 15}
