{"department_text": "Cleaning | Facilities | Tools", "nr_products": 6, "level": -2, "url": "http://www.staples.com/Pencils-Welders-Carpenters-Art/cat_CL167122", "text": "Pencils: Welders, Carpenters, Art", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Pencils: Welders, Carpenters, Art", "parent_url": "http://www.staples.com/Chalk-Reels-Marking-Tools/cat_DP5135", "keyword_count": {"pencils": 6, "art": 7, "welders carpenters": 4}, "description_wc": 166, "description_text": "Pencils for welders, carpenters, or art uses are part of the design world. Designed to be used on surfaces that are to be cut, rendered, or analyzed, these pencils come in handy for a variety of art projects. You can find a variety of styles in this section, so you'll have what you need in your toolkit. Selection of Tools Marking tools are a part of many industries, so you're likely to need them. Try pencils for welders, carpenters, or art use and enjoy a variety of mediums that can be semi or fully permanent. Variety of Colors Some processes require special colors for scanning or photographing. Find a variety of pencils for welders, carpenters, or art use in red, silver, gray, and more. Well-Known Brands With well-known brands available, you can be sure these pencils will stand up to the professional world. Try Prismacolor, Red-Riter, or Nissen to find pencils for welders, carpenters, or art uses that suit your project.", "parent_text": "Chalk Reels / Marking Tools", "keyword_density": {"pencils": "3.6", "art": "4.2", "welders carpenters": "4.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 18, "level": -2, "url": "http://www.staples.com/Soapstones-Holders/cat_CL167123", "text": "Soapstones & Holders", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Soapstones & Holders", "parent_url": "http://www.staples.com/Chalk-Reels-Marking-Tools/cat_DP5135", "keyword_count": {"soapstones": 1, "holders": 1}, "description_wc": 128, "description_text": "Soapstones and holders combine to create soapstone markers. The markers can be used to draw on any firm nonporous surface, making them a perfect choice for stoneworkers and carpenters who regularly work with marble and other stones. Create Cut Indicators Carpenters and stoneworkers know to measure twice and cut once. Soapstone markers let you confirm your measurements with carefully placed marks before cutting. Easily Mark Work Areas Soapstone works well for marking construction areas as well. If you need to mark a larger area or use multiple colors for clarity, check out chalk line reels and marking chalk . Cut Down on Costs Careful measurement and marking can cut down on costs by reducing wasted materials. Soapstone marks remain in place for a long time in dry conditions.", "parent_text": "Chalk Reels / Marking Tools", "keyword_density": {"soapstones": "0.8", "holders": "0.8"}, "department_id": 15}
{"nr_products": 21, "level": -2, "url": "http://www.staples.com/Chalk-Line-Reels-Marking-Chalk/cat_CL167118", "text": "Chalk Line Reels & Marking Chalk", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Chalk-Reels-Marking-Tools/cat_DP5135", "parent_text": "Chalk Reels / Marking Tools", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 13, "level": -2, "url": "http://www.staples.com/Tarps-Plastic-Sheeting/cat_CL167116", "text": "Tarps & Plastic Sheeting", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Tarps & Plastic Sheeting", "parent_url": "http://www.staples.com/Automotive-Maintenance-Repairs/cat_DP5131", "keyword_count": {"plastic": 4, "tarps": 5, "plastic sheeting": 3}, "description_wc": 200, "description_text": "Use tarps and plastic sheeting to cover and protect almost anything. Polyethylene tarps by Anchor are heavyweight and can protect valuable equipment from exposure to the elements. Clear Poly-Cover plastic sheets come in a roll and can be used to protect office machines from dirt and dust. Multiple Uses Tarps and plastic sheeting can be used for a variety of purposes, from covering up vulnerable items to protecting the floor while you're painting the walls. Keeping a supply on hand ensures you have a solution available when you need to leave a project in an unfinished state. Duct tape or rope can be used to secure the tarp. Convenient Protection Tarps are sun and fade resistant, making them perfect covers for anything you keep outdoors for an extended length of time. If you have a piece of outdoor equipment that you only use seasonally, a tarp can protect it until you plan to use it again. Reusable and Long-Lasting Made from woven laminated polyethylene, tarps are designed to be reusable and long lasting. Use disposable plastic sheeting when you want to cover an item temporarily, such as when you're moving equipment from one office to another.", "parent_text": "Automotive Maintenance / Repairs", "keyword_density": {"tarps": "2.5", "plastic sheeting": "3.0", "plastic": "2.0"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 5, "level": -2, "url": "http://www.staples.com/Tire-Gauges/cat_CL167117", "text": "Tire Gauges", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Tire Gauges", "parent_url": "http://www.staples.com/Automotive-Maintenance-Repairs/cat_DP5131", "keyword_count": {"tire gauges": 1, "tire": 6}, "description_wc": 129, "description_text": "Tire gauges let you quickly and easily measure the pressure of air inside of your tires. Low air pressure can contribute to increased fuel consumption. Exceptionally low levels can even reduce the safety of driving a vehicle. Keep Your Employees Safe Low tires may blow out under normal operating conditions. Keep your employees safe by ensuring that they have the tools necessary to check tire pressure before heading out. Keep Your Cars Running Great Tire pressure checks are a part of regular maintenance. Check out oil pans and measuring tools to keep your cars' engines running at peak condition. Save Money on Fuel Company cars and those used by small business owners can consume a large amount of fuel over the year. Proper tire pressure helps increase fuel economy.", "parent_text": "Automotive Maintenance / Repairs", "keyword_density": {"tire gauges": "1.6", "tire": "4.7"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 28, "level": -2, "url": "http://www.staples.com/Markers-Metal-Paint-China/cat_CL167121", "text": "Markers: Metal, Paint, China", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Markers: Metal, Paint, China", "parent_url": "http://www.staples.com/Chalk-Reels-Marking-Tools/cat_DP5135", "keyword_count": {"paint": 3, "china": 2, "metal paint": 2, "markers": 7}, "description_wc": 167, "description_text": "Markers for metal, paint, and china come in a wide variety of colors and tip widths. Colors include standard white and black as well as eye-catching red, blue, yellow, orange, and purple. From fine-point tips for detailed projects to jumbo tips for visibility, find markers for metal, paint, and china in whatever size you need. Write on Porous and Nonporous Surfaces Moisture-resistant markers, such as crayon-tip markers from Markal, can write on both porous and nonporous materials. This gives you added versatility, so you don't need to find separate markers for each object you have to mark. Markings Withstand Heat and Weathering Paint markers, such as those from Nissen, give you marks that stay clear and crisp under almost any circumstances. The mark won't peel, chip, fade, or smear no matter what you do. Never Run Out With a marker set, you'll always have a marker on hand when you need it. Sets include multiple markers in one handy container.", "parent_text": "Chalk Reels / Marking Tools", "keyword_density": {"paint": "1.8", "china": "1.2", "markers": "4.2", "metal paint": "2.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 29, "level": -2, "url": "http://www.staples.com/Oil-Drain-Pans-Measuring-Cans-Funnels/cat_CL167113", "text": "Oil Drain Pans, Measuring Cans & Funnels", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Oil Drain Pans, Measuring Cans & Funnels", "parent_url": "http://www.staples.com/Automotive-Maintenance-Repairs/cat_DP5131", "keyword_count": {"pans": 2, "funnels": 2, "oil": 10, "oil drain pans measuring cans": 1, "cans": 2}, "description_wc": 155, "description_text": "Oil drain pans, measuring cans, and funnels make changing oil a snap. Replacing the oil in your vehicle or your company's fleet is an important part of auto maintenance. Whether you're changing your own oil at your home office or work as a mechanic, these tools are an essential part of the job. Keep Your Engine Clean Dirty oil clogs filters and can reduce engine performance. Oil replacement tools make it easier to remove dirty oil. Maintain Fuel Economy Dirty oil can cut down on fuel economy, as well. Changing oil is only part of the solution. Another item that can help ensure you get the most bang for your buck with gasoline mileage is a tire gauge . Pass Emissions Tests Attempting to pass emissions tests with clogged filters or intakes can result in an automatic failure. Use pans, cans, and funnels to replace dirty oil with clean product before emissions testing.", "parent_text": "Automotive Maintenance / Repairs", "keyword_density": {"pans": "1.3", "funnels": "1.3", "oil": "6.5", "oil drain pans measuring cans": "3.2", "cans": "1.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 144, "level": -2, "url": "http://www.staples.com/Fittings/cat_CL167211", "text": "Fittings", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Fittings", "parent_url": "http://www.staples.com/Automotive-Maintenance-Repairs/cat_DP5131", "keyword_count": {"fittings": 6}, "description_wc": 126, "description_text": "Fittings are necessary to ensure that pressures are contained within a vehicle. The right fittings help keep your fleet or personal vehicles running and in top condition. Choosing the correct fitting can save you repair costs over time. Heavy-Duty Transfer Fittings transfer air or fluids between hoses and key components of a vehicle. Picking the right fitting helps prevent blowouts and leaks. Custom Fits Fittings are often constructed with a specific purpose in mind. When you need an even more specialized part, check out available keystocks, shims, and valves . Picking the Right Fitting Choosing the right fitting can reduce the likelihood of major mechanical problems. Fittings often have ratings that gauge the amount of pressure the connection can contain. Correct fittings offer greater reliability.", "parent_text": "Automotive Maintenance / Repairs", "keyword_density": {"fittings": "4.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 6, "level": -2, "url": "http://www.staples.com/Booster-Cables-Battery-Clamps-Chargers/cat_CL167111", "text": "Booster Cables, Battery Clamps & Chargers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Booster Cables, Battery Clamps & Chargers", "parent_url": "http://www.staples.com/Automotive-Maintenance-Repairs/cat_DP5131", "keyword_count": {"battery": 8, "chargers": 4, "clamps": 5, "cables": 4, "booster cables battery clamps": 3}, "description_wc": 193, "description_text": "Booster cables, battery clamps, and chargers are the right tools when you want to keep your fleet of vehicles running. If you have a battery that dies, just recharge it with one of these items. Each accessory is easy to use with a minimum amount of manpower. Give Your Vehicle a Boost Keep that battery humming with these booster cables, battery clamps, and chargers. When your car needs a jump, these items will ensure that you are powered up and ready to hit the pavement. You can even check your battery to make sure it's powered while you're inspecting its fittings, checking the oil, or measuring the tire pressure with a tire gauge . Clamps to Your Battery When you're using these booster cables, battery clamps, and chargers, you can connect them to the top or side terminals. Attach the clamp between your charger or another car and restart your vehicle. Made for Extreme Temperatures Some of these clamps, cables, or chargers are designed to handle adverse weather. If you're out on the road and run into a battery issue, these tools will still be able to help you.", "parent_text": "Automotive Maintenance / Repairs", "keyword_density": {"battery": "4.2", "chargers": "2.1", "clamps": "2.6", "cables": "2.1", "booster cables battery clamps": "6.2"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 75, "level": -2, "url": "http://www.staples.com/Keystocks-Shims-Valves/cat_CL167112", "text": "Keystocks, Shims & Valves", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Keystocks, Shims & Valves", "parent_url": "http://www.staples.com/Automotive-Maintenance-Repairs/cat_DP5131", "keyword_count": {"keystocks": 4, "valves": 5, "keystocks shims": 3, "shims": 4}, "description_wc": 192, "description_text": "Keystocks, shims, and valves come in a variety of materials and sizes, so you can choose the parts that best fit your machinery. Choose parts you can trust from brands such as Precision Brand and Syraco. You'll have no trouble finding the parts you need at cost-effective prices your business can afford. Durable Materials Keystocks, shims, and valves are available in zinc-plated, low-carbon steel, stainless steel, and brass alloy for durability that fits your needs. Whether you need keystocks for driving torque, shims for leveling, or valves for dispensing liquids, you'll find what you need at a cost you can afford. Multiple Sizes Keystocks, shims, and valves are available in different lengths and widths, so you can easily find the appropriate size for your needs. Different thicknesses are also available, so you can choose the durability that best fits the needs of your equipment. Quality Valves With a durable Syraco valve, you can dispense a variety of nonflammable viscous fluids with optimum control. The parts are easy to install, but it's always a good idea to protect your hands with Ergodyne ProFlex gloves for added safety.", "parent_text": "Automotive Maintenance / Repairs", "keyword_density": {"keystocks": "2.1", "shims": "2.1", "keystocks shims": "3.1", "valves": "2.6"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 49, "level": -2, "url": "http://www.staples.com/Wrecking-Pry-Bars/cat_CL166912", "text": "Wrecking & Pry Bars", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Wrecking & Pry Bars", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"pry": 4, "bars": 4, "pry bars": 3, "wrecking pry bars": 1}, "description_wc": 155, "description_text": "Wrecking pry bars give you the leverage you need to tackle the disassembly of large items, such as cars or metal shelves. The sturdy construction ensures the bars do not bend or break under pressure. Chisel tips in a variety of forms can also be used for sculpting and construction purposes. Easily Break Down Structures Sturdy steel construction lets you quickly pry open metal cabinets, doors, and hinges. A variety of designs, including flat, hexagonal, and round tips, ensure you have the right tool for the job. Get Into Hard-to-Reach Places Straight pry bars give you better access to hidden recesses. Hooked designs let you or your employees reach areas around corners and out of sight with ease. Carve Out a Beautiful Design Pry bars make excellent tools for modern art craftsmen and traditional sculptors. Check out the selection of chisels, punches, and pins for help with jobs that require even greater precision.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"wrecking pry bars": "1.9", "bars": "2.6", "pry bars": "3.9", "pry": "2.6"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 13, "level": -2, "url": "http://www.staples.com/Wedges/cat_CL166911", "text": "Wedges", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Wedges", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"wedges": 6}, "description_wc": 149, "description_text": "Whether you are renovating your home or working on a construction site, wedges can make the job easier. They are usually used to lift steel plates or other large objects. Wedges and flanges can also be used to align objects. Heavy Weight Capacity Wedges are designed to hold large amounts of weight, so they help you protect your back. Choose from multiple wedge lengths to handle your specific load. Tough Materials Our wedge manufacturers use only the toughest materials, so they can stand up to tough jobs. With brands like Ampco Safety Tools and Armstrong Tools, you can rest assured that your wedges and flanges will retain their shape. Safe Construction Our wedges are made with materials that resist sparking and have no magnetic properties, so you don't have to worry about dangerous reactions on construction sites. Transport your construction materials and wedges safely with utility carts .", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"wedges": "4.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 30, "level": -2, "url": "http://www.staples.com/Vises/cat_CL166910", "text": "Vises", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Vises", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"vises": 8}, "description_wc": 196, "description_text": "A wide assortment of vises ensures you can find the perfect heavy-duty tool to help you complete a project with just one set of hands. Vise grip models are designed for specific projects, including utility, mechanic's, and chain vises. Manufacturers such as Ridgid and Wilton Tools offer vises with a variety of holding capacities to further customize the tool to the job. Heavy-Duty Construction Steel vises feature a drop-forged construction so the tool can hold large and heavy items. Most vises are pieces of heavy-duty equipment that will last for years. Easy Positioning With its 180-degree swivel base, it's easy to position a vise to accommodate any type of item that needs clamping. Vises feature a lockdown mechanism that immobilizes the base once you've found the perfect position. A pair of mechanics gloves will protect your hands while you're adjusting the vise. Functional Versatility Vises come in a variety of jaw sizes, throat depths, and holding capacities, so you can easily find the right vise for the job. Specialty vises, such as the straight pipe welding vise, help you complete jobs that involve items with unique shapes.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"vises": "4.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 269, "level": -2, "url": "http://www.staples.com/Wrenches/cat_CL166913", "text": "Wrenches", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Wrenches", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"wrenches": 4}, "description_wc": 146, "description_text": "Wrenches enable you to turn small elements like nuts and bolts. They are usually used on objects that are impossible to turn with your hands. The right wrench will give you plenty of leverage, so you can get the job done faster. Maximum Torque Our wrenches are designed with handles that are perfectly proportionate to the head, so you'll have the perfect amount of torque. Whether you need the power of a straight pipe wrench or the accuracy of a small crescent wrench, we have a product to suit your needs. Resist Corrosion Wrenches from companies like Armstrong Tools and Pony are made with corrosion-resistant materials. Select from options like forged alloy steel, aluminum bronze alloy, or vanadium steel. Convenient Use With their ergonomic handles, our wrenches are designed for convenient, comfortable use. Reduce the risk of blisters or scrapes with work gloves .", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"wrenches": "2.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 239, "level": -2, "url": "http://www.staples.com/Flashlights-Lanterns/cat_CL167126", "text": "Flashlights & Lanterns", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Flashlights & Lanterns", "parent_url": "http://www.staples.com/Flashlights-Lanterns-Work-Lights/cat_DP5136", "keyword_count": {"lanterns": 5, "flashlights": 4}, "description_wc": 165, "description_text": "When you are hunting through a supply cabinet or illuminating a safe path when the lights go out, flashlights and lanterns can provide light without sacrificing mobility. Our lights come in a variety of styles, from headlamps to penlights, so you can choose the perfect option for any job. Select from a wide range of brands, including MAG-Lite and Streamlight. Bright Light Our flashlights and lanterns provide just the right amount of light for any situation. From miniature penlights for detail work and tabletop lanterns for camping, you'll find the perfect option. Ensure long-lasting light with extra batteries . Convenient Use Our flashlights and lanterns are convenient to store and use. With options like headlamps, keychain lights, and flashlight holsters, these lights let you enjoy hands-free use. Comfortable Grip Each of our handheld flashlights and lanterns are designed with a comfortable grip, so you can hold them without getting cramps. Textured exteriors and ergonomic surfaces increase traction and reduce accidental slippage.", "parent_text": "Flashlights / Lanterns / Work Lights", "keyword_density": {"lanterns": "3.0", "flashlights": "2.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 46, "level": -2, "url": "http://www.staples.com/Tool-Sets/cat_CL166909", "text": "Tool Sets", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Tool Sets", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"tool": 11, "tool sets": 5, "sets": 8}, "description_wc": 162, "description_text": "Tool sets include a wide variety of all-purpose tools and task-specific tools, so you'll have everything you need in one place. You can choose from general tool sets or sets that are designed for specific jobs, like computer repair. Many sets come with convenient carrying cases for easy organization. Wide Selection Many tool sets come with a variety of tools, from screwdrivers to ratchets and sockets. Choose from sets by Trademark Tools, Great Neck, and Copper Hand Tools Crescent. Convenient Storage and Organization Our tool sets come with sturdy cases, so you can carry them easily. The organized interiors allow you to find the right tool at a glance. Light Duty and Heavy Duty Our tool sets are available in light- and heavy-duty models, so they can be used for everything from small general repairs to large automobile projects. No matter what type of project you're working on, keep your hands safe with high-dexterity gloves .", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"tool": "6.8", "tool sets": "6.2", "sets": "5.0"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 31, "level": -2, "url": "http://www.staples.com/Tool-Boxes-Sheds-Storage/cat_CL166990", "text": "Tool Boxes, Sheds, & Storage", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Tool Boxes, Sheds, & Storage", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"tool": 9, "storage": 4, "boxes": 6, "boxes sheds": 4}, "description_wc": 163, "description_text": "When you own a collection of tools, you can help protect your investment with toolboxes, sheds, and storage units. Each piece is made with strong, durable materials that keep moisture away from your tools. With options from brands such as Jobox, ActionPacker, and Rubbermaid available, it's easy to find the best model for your needs. Secure Our toolboxes, sheds, and storage units are designed to keep your tools safe. Choose from options such as locking trunks, field office boxes, and top-loading tool vaults. Weather Resistant Each of our toolboxes, sheds, and storage compartments is designed to keep the weather out. Many units are made with steel and rubber and sealed for maximum protection. The Perfect Size for Any Collection We offer a wide variety of toolboxes, sheds, and storage units. From small, handheld boxes to heavy-duty utility cabinets, we have the perfect fit for your needs. If you have extra room, add to your collection with additional multipurpose tools .", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"tool": "5.6", "storage": "2.5", "boxes": "3.7", "boxes sheds": "4.9"}, "department_id": 15}
{"nr_products": 6, "level": -2, "url": "http://www.staples.com/Testers-and-Indicators/cat_CL208099", "text": "Testers and Indicators", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "parent_text": "Hand Tools / Tool Storage", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 12, "level": -2, "url": "http://www.staples.com/Staplers-Riveters/cat_CL166908", "text": "Staplers & Riveters", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Staplers & Riveters", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"staplers": 3, "riveters": 3}, "description_wc": 184, "description_text": "Staplers and riveters can help you tack and secure materials in a variety of jobs, from installing carpeting to upholstering furniture. Arrow and other manufactures offer a range of stapling and riveting tools, along with the accessories you need to make the most of your equipment. Pick a junior-sized or heavy-duty stapler or riveter that is appropriate for your project. Jam Resistant Staplers and riveters feature jam-resistant tacking mechanisms, so you don't have to worry about staples and rivets getting stuck in the gun. Keep your tacking equipment in good working order by using a tool box for storage. Easy to Use A convenient, hand-held design makes it easy to use staplers and riveters on flat surfaces or bulky objects. A squeeze of your hand is all that is needed to generate the force to eject staples and rivets into materials like wood or leather. Convenient Packaging Riveting tools are available in rivet tool kits, so you have the tool and a selection of supplies in a convenient carrying case. The case can go with you to remote jobs.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"staplers": "1.6", "riveters": "1.6"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 26, "level": -2, "url": "http://www.staples.com/Shears-Scissors-Snips/cat_CL166906", "text": "Shears, Scissors & Snips", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Shears, Scissors & Snips", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"scissors": 4, "snips": 3, "shears": 3, "shears scissors snips": 1}, "description_wc": 131, "description_text": "Shears, scissors, snips, and similar tools are regularly used by businesses of all sizes. Shears and snips are often designed to cut through harder substances, such as metals. Business owners turn to scissors for cutting paper and cardboard materials. Make Clean Cuts Many companies that work regularly with these types of cutting tools create products that require very clear, crisp cuts. Sharp, quality tools can create edges that are equally suited to construction or fine art. Cut Through Different Materials Scissors and snips are available for materials ranging from paper to metal. When you need to cut even heavier or thicker materials, check out cutters for pipes, wires, and cables . Cut Down Waste Sharp scissors and shears make precision cuts. This cuts down on unnecessary cost due to wasted materials.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"scissors": "3.1", "snips": "2.3", "shears": "2.3", "shears scissors snips": "2.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 45, "level": -2, "url": "http://www.staples.com/Tool-Bags-Belts-Pouches/cat_CL167227", "text": "Tool Bags, Belts & Pouches", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Tool Bags, Belts & Pouches", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"bags": 6, "tool bags belts": 4, "belts": 7, "tool": 13, "tool bags": 5, "pouches": 6}, "description_wc": 187, "description_text": "Tool bags, belts, and pouches let you carry your most important tools for your next job with you wherever you need to go. Hands-free belts and leather pouches let you easily change tools without requiring you to go back to your main collection. Handy tool bags by manufacturers such as Klein Tools and Irwin are designed to hold a selection of tools in customized compartments. Easy Portability Easily take your most important tools with you to your next job using tool bags, belts, and pouches. The bags come with convenient shoulder straps, while the belts and pouches attach to your waist. Stylish Utility Tool bags, belts, and pouches are designed to make you look professional. The tool belts are made of 100 percent leather and offer features such as embossing and heavy-duty construction. Invest in a pair of work boots to complete the look. Designed for the Job Take care of your tools by never leaving them bunched up in a regular bag. Tool bags, belts, and pouches give every tool its own place, making it easy to grab the right one for the job.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"bags": "3.2", "tool bags belts": "6.4", "belts": "3.7", "tool": "7.0", "tool bags": "5.3", "pouches": "3.2"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 18, "level": -2, "url": "http://www.staples.com/Scribers-Pin-Vises-Pick-Sets/cat_CL166905", "text": "Scribers, Pin Vises & Pick Sets", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Scribers, Pin Vises & Pick Sets", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"scribers pin vises": 1, "scribers": 4, "pin": 7, "pin vises": 3, "pick": 1}, "description_wc": 146, "description_text": "Scribers, pin vises, and other sharp instruments let you easily create holes in many different materials. These holes can then hold pieces together with pins or permit other forms of joins and splices. Small businesses may also use scribers for engraving. Create a Seamless Look Using pins to hold metal or plastic parts together secures them without obvious glues or seams. Pin vises enable the creation of a hole that can then be used to hide the pin itself. This creates an elegant look that is perfect for more detailed pieces. Punch through Tough Material Scribers and pin vises can easily punch through tough fabric and thin wood. For more heavy-duty work, try a selection of chisels, punches, and pins . Add Custom Engraving Scribers and picks can be used to create beautiful custom engraving. Customers are likely to enjoy the specialized look engraving allows.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"scribers pin vises": "2.1", "pick": "0.7", "pin vises": "4.1", "pin": "4.8", "scribers": "2.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 47, "level": -2, "url": "http://www.staples.com/Taps-Dies/cat_CL166989", "text": "Taps & Dies", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Taps & Dies", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"dies": 5, "taps": 3}, "description_wc": 141, "description_text": "Tap wrenches and metal dies allow you to carve screw threads into just about any material. The strength of the piece is based on the materials used in its construction. Heavy-duty taps and dies make an excellent addition to any mechanic's toolbox. Create New Threads Create perfect holes for screws using either a tap wrench or a metal die. Both tools can be used separately to create new threads. Clear Threads Taps and dies can also be used to clear out bad threads by chasing material from the thread. If you find yourself often facing poorly created threads, try a selection of pullers and accessories . Additional Applications Taps and dies also provide artists and artisans with the ability to make entirely new screws. Creating threads in a mold is much simpler with precision tap wrenches or metal dies.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"dies": "3.6", "taps": "2.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 151, "level": -2, "url": "http://www.staples.com/Sockets-Accessories/cat_CL166907", "text": "Sockets & Accessories", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Sockets & Accessories", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"sockets": 10, "accessories": 5}, "description_wc": 199, "description_text": "Tightening and removing bolts is easy with sockets, and accessories like adapters and extensions help you use your sockets more easily. Get a socket set so you'll have the right socket and a handy wrench to handle any job or get just the right width and depth of socket you need for a specific task. Choose accessories that help you get sockets into small spaces or adapters that easily fit a socket to your wrench. Sockets for Every Need You can find standard sockets and accessories that fit your socket wrench or reversible drill or you can choose sockets for special jobs. Extra-deep sockets and locking sockets are made for particularly tough work. Rugged and Reliable Sockets and accessories from top manufacturers like Armstrong Tools and Proto are made of the most durable metals. Their inner threads won't strip even after strenuous, repeated use, and their drive shafts maintain proper shape, fit, and size. Be Prepared with Socket Sets A full set that is complete with sockets and accessories is ideal to have on hand for emergency repairs. You can find sets with wrenches or you can buy separate ratchets with the special features you need.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"sockets": "5.0", "accessories": "2.5"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Reamers-Deburring-Tools/cat_CL166986", "text": "Reamers & Deburring Tools", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Reamers & Deburring Tools", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"reamers": 3, "tools": 7, "deburring tools": 5, "deburring": 6}, "description_wc": 191, "description_text": "Reamers and deburring tools ensure the metal that you cut and work is smooth and ready to be turned into a finished project. Deburring blades are sold individually or in 10-pack boxes. Each tool comes with a replacement blade so you always have a sharp instrument that can smooth rough surfaces and jagged edges. Easy Grip Deburring tools in the reamers and deburring tools category come with a 5-inch handle, making it easy for you to grip the tool while you're working to eliminate imperfections. Invest in a pair of industrial work gloves to protect your hands while you're handling hot metal. Quality Craftsmanship Reamers and deburring tools are made of quality materials that ensure the tools will last for years. Aluminum handles and blades made of hardened steel make it easier to get the job done right. Portable Convenience Deburring tools can fit in your pocket like a pen, so you can easily handle imperfections that you spot while you're out inspecting your employees' metalwork projects. These tools are the ideal solution for small problems that don't need a large sanding machine to fix.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"reamers": "1.6", "deburring tools": "5.2", "tools": "3.7", "deburring": "3.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 116, "level": -2, "url": "http://www.staples.com/Screwdrivers/cat_CL166904", "text": "Screwdrivers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Screwdrivers", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"screwdrivers": 4}, "description_wc": 140, "description_text": "Screwdrivers let you safely bind objects with screws. Screws work in a variety of different materials, including metal and wood. Choosing the right screwdriver can help save time and money. Easily Connect Pieces Whether you're assembling shelves at the office or building a home, a screwdriver lets you easily connect key components. Screwdrivers work with a variety of screw types, ensuring a secure fit. Quick Repairs Screws can come loose over time. Keeping a screwdriver handy lets you quickly tighten loose screws and keep things in working order. If you need to keep multiple screwdrivers around for regular repairs, check out available tool boxes and storage units . Pick the Right Tool for the Job Screwdrivers typically come with Philips or standard heads. Choosing the right tip reduces the likelihood of stripping the screw and makes task completion easier.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"screwdrivers": "2.9"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Pullers-Accessories/cat_CL166901", "text": "Pullers & Accessories", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Pullers & Accessories", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"pullers": 4, "accessories": 1}, "description_wc": 146, "description_text": "Pullers and accessories let you quickly get at stuck screws and other components when you want to remove and replace them. The devices can handle great amounts of force. Pullers can be used for heavy construction work or around the office for minor repairs. Repair Products Easily Pullers make it simple to repair broken screws. Just slip the end of the puller into or around the stuck part and allow the tool to lift it out cleanly. Remove Unnecessary Pins Pins can be exceptionally difficult to remove with other tools. Pullers let you firmly grasp the pin even when only a portion of it is available. For more heavy-duty extraction, check out extractor sets designed for the heaviest tasks. Take Care of Emergency Fixes Bad pins and screws can lead to catastrophic structural failures. Take care of these problems quickly before they become major issues.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"pullers": "2.7", "accessories": "0.7"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 15, "level": -2, "url": "http://www.staples.com/Magnetic-Pickups-Retrieving-Tools/cat_CL166899", "text": "Magnetic Pickups & Retrieving Tools", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Magnetic Pickups & Retrieving Tools", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"tools": 4, "magnetic": 3, "retrieving tools": 2, "magnetic pickups": 1, "retrieving": 3}, "description_wc": 171, "description_text": "When you drop a screw in an engine or need to get a ring out of a drain, you'll love having a magnetic pickup nearby. Retrieving tools make your life easier, and with this type of simple device, you'll be able to retrieve items from even the smallest spaces. Available in different lengths and sizes, magnetic pickups are ideal for your tool chest. Longer Lengths You might need flashlights to locate any items that have gone down the drain, but with long magnetic pickup tools, you'll be able to retrieve your belongings quickly and easily. The skinnier tools are ideal for drains and small spaces. Additional Parts If you need a stronger magnet, simply add it to your retrieving tool. Different sizes are available. Flexibility Flexible retrieving tools are great for any time you need to reach something at an angle. Whether you're trying to get something out of an electrical item or a pipe, you'll be able to access the areas you need to reach.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"retrieving tools": "2.3", "magnetic": "1.8", "tools": "2.3", "magnetic pickups": "1.2", "retrieving": "1.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 184, "level": -2, "url": "http://www.staples.com/Pliers/cat_CL166900", "text": "Pliers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Pliers", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"pliers": 7}, "description_wc": 167, "description_text": "Pliers are ideal for almost any job, and they're simple to use. Varying types are available, so you'll be able to use the tool best for the job, whether it's a long pair of needle-nose pliers or a pair of solid joint pliers. Made with strong metal, these durable tools are great for any toolkit. Simple Design Make sure you have flashlights to help you see into tight spaces, so you'll have what you need to make sure you form the right wires with pliers. Pliers come in many shapes and lengths, so you'll find a pair that suits the job. Varied Styles Pliers come in many styles, like needle-nose, long-nose, and solid joint. Each type has a different function that will help you with your work. Well-Known Brands Brands like Cooper Hand Tools, Klein Tools, and VISE-GRIP know the importance of strong and durable tools. Choose from a variety of pliers to make your job easier.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"pliers": "4.2"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 30, "level": -2, "url": "http://www.staples.com/Multi-Purpose-Tools/cat_CL166982", "text": "Multi-Purpose Tools", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Multi-Purpose Tools", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"multi": 5, "tools": 9, "purpose tools": 1, "purpose": 2}, "description_wc": 180, "description_text": "Multi-tools ensure that you have a full set of basic tools whenever you need them. Small businesses working in the field on installation or repair projects benefit greatly from versatile tools. Those with less hands-on revenue streams can still use these types of tools for minor repairs and work around the office. Keep Key Tools Close at Hand Multipurpose tools typically include pliers, screwdriver heads, knives, and a variety of other common tools. Keeping such a versatile collection close by ensures you have a means to tackle almost any impromptu project or repair. Quickly Find the Right Tool for the Job The compact design and integrated functions of the tool make it a great choice for work in the field. Check out our tool bags, belts, and pouches , which allow you to carry even more tools or safely store your multi-tool. Save Time and Space The form factor of a multipurpose tool lets you keep many different tool options available in a very small space. This cuts down on the time needed for organizing multiple tools.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"multi": "2.8", "tools": "5.0", "purpose tools": "1.1", "purpose": "1.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 32, "level": -2, "url": "http://www.staples.com/Ratchets/cat_CL166903", "text": "Ratchets", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Ratchets", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"ratchets": 5}, "description_wc": 212, "description_text": "Ratchets make it easy to tighten screws and bolts without the need for excessive arm strength. The one-directional locking action gives you the upper hand when you have a bolt that won't budge. Proto, Armstrong Tools, Blackhawk, and other quality manufacturers offer a variety of ratchets to meet the needs of any job. Easy to Use Ratchets feature an easy-to-use reverse-switch mechanism that is thumb operated, so you can turn the ratchet even if you're in an awkward position. The socket remains locked in place until it is released with a flick of your thumb. Heavy-Duty Construction Made with high-quality steel, ratchets are designed for heavy-duty, long-term use. These tools feature a surface area that is large enough to disperse torque, so you don't have to worry about snapping the tool in half when you use it to release stubborn fasteners. Versatile Options Ratchets come in a variety of lengths and drive sizes, so you can find the right tool for your project. Variable swing arcs mean that there is a ratchet that will work in even the tightest of spaces. Wear a pair of mechanic's gloves while you're working with your ratchet to prevent wear on your hands.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"ratchets": "2.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 82, "level": -2, "url": "http://www.staples.com/Knives-Blades/cat_CL166898", "text": "Knives & Blades", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Knives & Blades", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"knives": 2, "blades": 6}, "description_wc": 171, "description_text": "Knives and blades from manufacturers such as Stanley, Irwin, and Klein Tools give you the ability to slice through almost any material with ease. Whether you're working in the warehouse or out on a job site, having the right knives and blades can make a difference in your speed and efficiency. Stock up on different blades for different purposes so you're ready to handle any job. Cut Through Anything Cut through linoleum flooring, layers of packing tape, fabric, carpet, or other materials quickly with the right knife. Choose a hook knife blade to prevent damage to things under the material you are cutting. Always Ready With replacement blades designed to fit your knife, you'll always be ready with a fresh, sharp blade. Buy replacement blades singly or stock up with a pack of 100. Safe Disposal Dispose of your knife blades with a blade disposal container that secures the items inside so that no one gets cut accidentally. For safety, use cut resistant gloves when cutting tough materials.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"knives": "1.2", "blades": "3.5"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 22, "level": -2, "url": "http://www.staples.com/Pipe-Threaders/cat_CL167342", "text": "Pipe Threaders", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Pipe Threaders", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"pipe": 10, "threaders": 6, "pipe threaders": 5}, "description_wc": 170, "description_text": "Whether you're conducting a small home improvement project or working on a major plumbing system, pipe threaders allow you to complete the job on-site. Products like small manual pipe threaders and large threading machines enable you to thread pipes of all sizes. Accessories like cutting oil and pump guns can keep your equipment working smoothly. Smooth Operation Our pipe threaders are designed to be easy to operate so you can power through any job. If you need to work quickly, power-drive threading machines from companies like Ridgid can give you the speed and voltage you need. Flexible Capacity Whether you need to thread small, light pipes or large, heavy pipes, we carry pipe threaders to help. For small jobs, use handheld manual threaders. For large jobs, use a pipe-head stand to hold pieces in place. Efficient Function Our pipe threaders are designed to provide precision cutting of any pipe. Protect your hands during the threading process without losing your grip by wearing high-dexterity gloves .", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"pipe": "5.9", "threaders": "3.6", "pipe threaders": "5.9"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 130, "level": -2, "url": "http://www.staples.com/Hex-Keys/cat_CL166897", "text": "Hex Keys", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Hex Keys", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"keys": 7, "hex": 7, "hex keys": 6}, "description_wc": 192, "description_text": "Owning a selection of hex keys makes it easy for you to complete important projects. Hex keys can be purchased individually for specific jobs, like putting together furniture, or in a set that you can keep in your tool arsenal for future projects. Allen Tools, Bondhus, Eklind Tool, and other brands offer a wide variety of hex keys that can help you complete any task. Wide Selection Available Hex keys are available in convenient sets that contain a range of key sizes, so you have the right equipment in your tool set to tackle any job. Choose the set size that complements the types of projects you usually undertake. Heavy-Duty Construction Long- and short-arm hex keys are made of alloy steel with a black-oxide finish. These tools will last for years. The strong construction ensures each key resists rotational distortion and rusting. Portable Options Fold-up hex key sets are attached to a case that enables you to pocket and transport a range of keys when you're on the go. This type of utility set lets you easily carry nine or more hex keys in a compact carrier.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"keys": "3.6", "hex": "3.6", "hex keys": "6.2"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 60, "level": -2, "url": "http://www.staples.com/Putty-Knives-Scrapers/cat_CL166902", "text": "Putty Knives & Scrapers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Putty Knives & Scrapers", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"putty knives": 4, "putty": 7, "scrapers": 3}, "description_wc": 164, "description_text": "Putty knives and scrapers allow you to remove adhesives or place a fresh material down to keep things in place. Construction and repair businesses regularly use these tools. Office workers may also keep putty tools on hand for quick repairs or for display creation. Remove Adhesives The sharp and firm edges of putty knives enable you to pry away adhesives with ease. Whether you're removing old glue from a shelf or grout from a wall, these tools make tasks far simpler. Make Emergency Repairs Putty used to hold important pieces of construction together can sometimes run or fray. Keeping putty knives on hand helps ensure that you're ready to fix these problems as they arise. Keep all of your repair equipment close at hand with tool bags, belts, and pouches . Lay New Putty Knives and scrapers also allow you to lay new putty in an orderly fashion. Scrapers let you gently pry away excess material to create a clean, crisp look.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"putty knives": "4.9", "putty": "4.3", "scrapers": "1.8"}, "department_id": 15}
{"nr_products": 3, "level": -2, "url": "http://www.staples.com/Hand-Pumps/cat_CL208098", "text": "Hand Pumps", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "parent_text": "Hand Tools / Tool Storage", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"nr_products": 52, "level": -2, "url": "http://www.staples.com/Hard-Shell-Tool-Cases/cat_CL207849", "text": "Hard Shell Tool Cases", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "parent_text": "Hand Tools / Tool Storage", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 226, "level": -2, "url": "http://www.staples.com/Hammers-Mallets/cat_CL166895", "text": "Hammers & Mallets", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Hammers & Mallets", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"hammers": 7, "mallets": 4}, "description_wc": 207, "description_text": "You can do most fix-up jobs yourself with the right selection of hammers and mallets in your equipment collection. Choose between curve-claw or ball-pein hammers and add a rubber mallet, so you have what you need for any project. Manufacturers like Stanley, Pony, and Jackson design tools to help you get the work done quickly and easily. Dependable Help Manufacturers of hammers and mallets use high-quality material to ensure your tools can stand up to the toughest jobs. Handles and heads made of premium wood, forged steel, fiberglass, and other quality materials make it easy to trust your equipment not to cause injury because of poor construction. Designed for the Job There is a wide selection of hammers and mallets to choose from, so you can pick the perfect tool for your project. From sledge hammers for knocking down walls to curve-claw hammers for pounding in a nail, you can find a tool designed for your specific task. Add a hand axe to your equipment collection to make big projects even easier. Long-Lasting Reliability Quality hammers and mallets are an investment. High-quality construction using heavy-duty materials ensures that these tools last for years and rarely need to be replaced.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"hammers": "3.4", "mallets": "1.9"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 25, "level": -2, "url": "http://www.staples.com/Handsaws-Blades/cat_CL166896", "text": "Handsaws & Blades", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Handsaws & Blades", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"handsaws": 2, "blades": 2}, "description_wc": 136, "description_text": "Hacksaws, handsaws, and blades are useful when you need to garden or do some landscaping. Each type has a different purpose, so you'll have choices when it comes to your project. Aluminum, steel, and carbon saws are available. Easy Storage Saws are sharp and dangerous, so you'll want tool storage for your tools. You can easily hang most saws by their handles or hooks. Variety of Styles Jab saws, hacksaws, handsaws, and blades are all available in this section. They come in different shapes and sizes and with different teeth and metals, so you'll have a large selection from which to choose. Known Branding Brands like STANLEY, Lenox, and Cooper are available, so you know you'll be receiving the quality you expect. Trust your tools by buying from a company you prefer.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"handsaws": "1.5", "blades": "1.5"}, "department_id": 15}
{"nr_products": 11, "level": -2, "url": "http://www.staples.com/Electrical-Tools-Wire-Pulling-Grips/cat_CL208097", "text": "Electrical Tools: Wire Pulling Grips", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "parent_text": "Hand Tools / Tool Storage", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 17, "level": -2, "url": "http://www.staples.com/Electrical-Tools-Fish-Tape-Meters/cat_CL167226", "text": "Electrical Tools,  Fish Tape & Meters", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Electrical Tools,  Fish Tape & Meters", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"meters": 4, "electrical tools fish tape": 2, "electrical": 4, "tools": 5, "tape": 3}, "description_wc": 148, "description_text": "Electrical tools, fish tape, and meters make your electrical work easier and safer. With tape, you can cover exposed ends. Meters let you measure voltage so you know what precautions to take. With a variety of kits available, you can choose the best meters and tools for your job. Easy Carrying Use a tool box to keep your electrical tools, fish tape, and meters in one place. Boxes come in different sizes for the unique kits you want to have on hand. Brands You Trust When you work on electrical items, you want to make sure your tools are right. With brands like Slug-Buster, Greenlee, and others, you'll know you have professional tools that stand up to your hard work. Helpful Kits Kits include many items that you're likely to use on the job. Each kit differs, so you can match it to your project.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"electrical": "2.7", "electrical tools fish tape": "5.4", "meters": "2.7", "tools": "3.4", "tape": "2.0"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 32, "level": -2, "url": "http://www.staples.com/Extractors-Sets/cat_CL166893", "text": "Extractors & Sets", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Extractors & Sets", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"extractors": 12, "sets": 5}, "description_wc": 192, "description_text": "Screw and bolt extractors and sets of extractors are just what you need to ensure a simple broken or impacted screw doesn't throw a monkey wrench into your entire job. Whether you're in the building field or just like having a set of equipment on your premises for maintenance, you'll find extractors and sets of extractors very useful. Easy to Use All you need is a drill to use most extractors and sets that include a variety of sizes of extractors. Some models, such as those from Proto, can be used with a hand or power hammer. Tough and Efficient Screw and bolt extractors and sets are made from durable metal that grips broken fasteners and grabs onto them so you can easily extract them by reversing your drill or pulling on the extractor. Hanson offers spiral-fluted and multiple-splined extractors for extra grab power. The Right Extractors Choose screw extractors and sets for removing screws and similar fasteners or select different sizes of bolt or pipe extractors to remove broken bolts or embedded pipes. A new reversible drill helps you get the best results from your extractors.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"extractors": "6.2", "sets": "2.6"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 83, "level": -2, "url": "http://www.staples.com/Cutters-Pipe-Wire-Cable/cat_CL166892", "text": "Cutters: Pipe, Wire, Cable", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Cutters: Pipe, Wire, Cable", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"pipe": 5, "pipe wire": 4, "cable": 4, "cutters": 11}, "description_wc": 165, "description_text": "Whether you are fixing a television or updating the plumbing in your office, you'll need pipe, wire, and cable cutters to get the job done. The powerful blades make cutting faster, while the easy-grip handles allow smooth operation. Choose from one-handed, clamp-style, and tabletop cutters from brands such as Greenlee, Imperial Stride Tool, and Morse Starrett. Powerful Cutting Pipe, wire, and cable cutters are made with powerful blades that are designed to cut through specific materials. For small jobs, check out micro shear cutters; for larger projects, steel strap cutters provide maximum force. Easy Operation Our pipe, wire, and cable cutters come in a variety of designs, so you can select the best option for any job. Choose from options such as tabletop pipe cutters, clamp-style tubing cutters, or long-handled industrial cutters. Durable With heavy-duty steel blades, our pipe, wire, and cable cutters are designed to last. Keep your cutters in top working order with industrial lubricant .", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"pipe": "3.0", "pipe wire": "4.9", "cable": "2.4", "cutters": "6.7"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Concrete-Masonry-Tools/cat_CL166890", "text": "Concrete & Masonry Tools", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Concrete & Masonry Tools", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"masonry tools": 3, "concrete": 9}, "description_wc": 124, "description_text": "Concrete and masonry tools let you build or repair concrete structures. Small businesses can use them to patch up visible structural cracks. Construction and gardening companies benefit from being able to work with concrete for a variety of projects. Form Driveways and More Concrete is commonly used in building sidewalks and driveways. A clean and beautiful sidewalk can draw attention to a retail or office building. Create Beautiful Concrete Sculptures Masonry tools let you shape concrete into almost any form. For even greater precision for concrete art, check out chisels, punches, and pins designed specifically for use with concrete. Repair Cracks Cracks in structures are unsightly. Left unrepaired, cracks can lead to leaks and structural damage. Fix cracks easily with concrete and masonry tools.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"masonry tools": "4.8", "concrete": "7.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 87, "level": -2, "url": "http://www.staples.com/Files-Handles/cat_CL166894", "text": "Files & Handles", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Files & Handles", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"files": 8, "handles": 5}, "description_wc": 155, "description_text": "Whether you are working with plastic, metal, or wood, a file can help you create fine detailing. Files are designed with abrasive surfaces that gradually remove material. With the right files and handles, you can enjoy greater control over any job. Abrasive Our files and handles are available with a variety of tooth pattern options, including spiral cut, smooth cut, flat, and double cut. When you select files and handles, it is important to check the pattern to find the most effective abrasive surface for your project. A File for Every Job Our files and handles come from industry-leading brands like Lutz File and Cooper Hand Tools Nicholson. Select from small hand files, large lathe files, or thread restoring files. Comfortable Grip Our file handles offer an ergonomic grip surface, allowing you to stay comfortable during long projects. Reduce the chances of blisters without sacrificing your range of motion with high-dexterity gloves .", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"files": "5.2", "handles": "3.2"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 47, "level": -2, "url": "http://www.staples.com/Clamps-Spreaders/cat_CL166889", "text": "Clamps & Spreaders", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Clamps & Spreaders", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"clamps": 6, "spreaders": 5}, "description_wc": 213, "description_text": "Clamps and spreaders are the extra set of hands that you need to complete your projects. C-clamps, L-clamps, and bar clamp spreaders from quality manufacturers such as Wilton Tools and Quick-Grip ensure you can get the job done, even if your assistant calls in sick. Make sure you have a selection available so you can match the right clamp or spreader to the job. Easy to Use Clamps and spreaders are easy to use. Most versions attach to your worktable or bench, so you don't need to store a special piece of equipment to hold items steady. Prevents Injuries You can forget about asking a worker to hold an item steady by hand and risk injury by having the right clamps and spreaders in your equipment collection. If you miss your target when you're working on an item that is immobilized by a clamp or spreader, you can just keep going. Use a pair of work gloves to keep your hands protected. Various Sizes Available Clamps and spreaders come in a variety of sizes, so you can match the equipment to the job. Picking the right opening size and throat depth ensures you have enough clamping pressure to keep an item steady while you're working on it.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"clamps": "2.8", "spreaders": "2.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 6, "level": -2, "url": "http://www.staples.com/Bits-Hex-Phillips-Torx-Holders/cat_CL167225", "text": "Bits: Hex, Phillips, Torx & Holders", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Bits: Hex, Phillips, Torx & Holders", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"holders": 3, "bits": 5, "bits hex phillips torx": 3}, "description_wc": 168, "description_text": "Every toolbox needs a selection of bits. Hex, Phillips, Torx, and holders tip types ensure your power drill has the versatility to handle any job. Develop your collection of bits so that your workers have the right tools to complete maintenance and improvement projects around the workplace. Easy to Use It's easy to use a variety of bits. Hex, Phillips, Torx, and holders tip types easily slide into the bit slot on your power drill, so you can quickly start a job or change a bit when necessary. Versatile Options With options that include head type, drive size, tip type, and tip size, you can find a bit that will handle any type of job. Make sure to wear safety glasses when you're using your drill to prevent eye injuries. Designed for Safety Ensure the safety of your workers with the right selection of bits. Hex, Phillips, Torx, and holders bits feature a spring or ball lock that secures the connection between the bit and drill.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"holders": "1.8", "bits": "3.0", "bits hex phillips torx": "7.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 5, "level": -2, "url": "http://www.staples.com/Clips-Rings-Pins/cat_CL167130", "text": "Clips, Rings & Pins", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Clips, Rings & Pins", "parent_url": "http://www.staples.com/Hose-Clamps-Cable-Ties-Fasteners/cat_DP5137", "keyword_count": {"clips": 5, "pins": 7, "clips rings": 4, "rings": 6}, "description_wc": 203, "description_text": "Clips, rings, and pins can be used in a variety of construction projects to help you secure and seal metal pieces, bolts, pipes, and other items. Purchase cotter pins, steel roll pins, and o-rings in boxes with an assortment of sizes, so you'll always have the right size for the job. The boxes make it easy to keep these accessories organized. Easy to Use Clips, rings, and pins use plated steel to ensure each item is strong and flexible. While clips and rings can often be positioned by hand, keep a mallet in your equipment kit to make it easy to insert pins where they're needed. Suitable for all Types of Jobs When you need a little something to hold or seal part of a project, you are sure to find the right clips, rings, and pins in this category. The wide variety of widths, lengths, and diameters available ensures that the perfect accessory exists to complete the job. Portable Help You can throw a handful of these clips, rings, and pins in your toolbox for your next job. It's just as easy to take the boxed assortment with you, so you can handle any problem that comes up.", "parent_text": "Hose Clamps / Cable Ties / Fasteners", "keyword_density": {"clips": "2.5", "pins": "3.4", "clips rings": "3.9", "rings": "3.0"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Axes-Hatchets/cat_CL166886", "text": "Axes & Hatchets", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Axes & Hatchets", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"axes": 5, "hatchets": 4}, "description_wc": 193, "description_text": "Axes and hatchets are the right tools for cutting or demolishing wood and other material on big jobs. Take down walls or section off logs with these hand-held bladed instruments. The axes and hatchets are available in a variety of head weights, and you can pick the one that is best suited for your project. Easy to Use When power tools are too cumbersome to use, axes and hatchets can get the job done. These hand-held tools don't require electricity so you can just pick one up and get to work. Heavy-Duty Construction Axes and hatchets feature wood or steel handles and forged-steel heads so they will last for years, even with heavy use. The wooden handles are flame resistant, making an axe or hatchet an ideal tool for working with fire. Invest in a pair of work gloves to protect your hands against chaffing. Designed for Comfort With a vinyl shock-resistant grip, a steel-handle axe makes it easier for you to chop and cut for extended periods of time. The single-piece construction of the head and handle gives these types of axes enhanced balance.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"axes": "2.6", "hatchets": "2.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 15, "level": -2, "url": "http://www.staples.com/Bending-Flaring-Tools/cat_CL166887", "text": "Bending & Flaring Tools", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Bending & Flaring Tools", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"bending": 2, "flaring tools": 2, "tools": 4}, "description_wc": 133, "description_text": "Bending and flaring tools let you create the design that best suits the needs of your space. Small businesses engaged in electrical or plumbing work benefit greatly from having the right tool on hand. Others can make minor repairs at a lower cost than hiring professionals. Strip Wires Tools let you easily strip wires of their coating. This allows you to replace or repair frayed components with ease. Bend Tubes The ability to bend tubes to fit a specific space can keep construction projects organized. Check out our selection of tool boxes and storage units to keep your bending and flaring tools safe and organized. Add Stopping and Ferrules Swaging tools also let you add stopping and ferrules to wire. This creates a sturdy connection perfect for larger projects where strength is important.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"bending": "1.5", "flaring tools": "3.0", "tools": "3.0"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 30, "level": -2, "url": "http://www.staples.com/Crimping-Stripping-Tools/cat_CL166891", "text": "Crimping & Stripping Tools", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Crimping & Stripping Tools", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"stripping tools": 4, "crimping": 6, "tools": 8}, "description_wc": 165, "description_text": "Whether you are rewiring a house or working with computers at the office, crimping and stripping tools can help with the details. Strippers are often used to remove plastic coating from wire, while crimping tools join together two pieces of cable or metal. Choose from a wide selection of tools to find the best option for your job. Comfortable Grip Each of our crimping and stripping tools is designed with a handle that is comfortable to hold and easy to manipulate. Brands like Klein Tools and Western Enterprises often use rubber-coated handles for additional comfort. Powerful Force Our crimping and stripping tools are designed to allow you to exert maximum force with minimum physical effort. Avoid accidental injuries without losing the freedom to move with high-dexterity gloves . Multiple Uses Many of our crimping and stripping tools can be used for more than one purpose. Check out wire strippers that double as cutting tools or look for crimping pliers that have adjustable widths.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"stripping tools": "4.9", "crimping": "3.7", "tools": "4.9"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 72, "level": -2, "url": "http://www.staples.com/Chisels-Punches-Pins/cat_CL166888", "text": "Chisels, Punches & Pins", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Chisels, Punches & Pins", "parent_url": "http://www.staples.com/Hand-Tools-Tool-Storage/cat_DP5134", "keyword_count": {"pins": 5, "chisels punches": 4}, "description_wc": 139, "description_text": "Chisels, punches, and pins are ideal for those who need to work with stone and metal. You can create unique designs, finish sculptures, and complete other projects with the help of these tools. The variety available is wide, so you will find the sizes you need. Easy Storage Store your chisels, punches, and pins in toolboxes to keep them organized. These tools range in size and are easy to keep together, so they'll be ready when you are. Variety Whether your project is large or small, chisels, punches, and pins will help you finish. You can choose from chisel holders, standard-length pins, and more. Recognizable Brands You can choose from a number of recognizable brands of chisels, punches, and pins. Some popular brands include Mayhew Tools, STANLEY, and Proto, all of which focus on well-made tools.", "parent_text": "Hand Tools / Tool Storage", "keyword_density": {"pins": "3.6", "chisels punches": "5.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Cable-Tie-Guns/cat_CL167228", "text": "Cable Tie Guns", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Cable Tie Guns", "parent_url": "http://www.staples.com/Hose-Clamps-Cable-Ties-Fasteners/cat_DP5137", "keyword_count": {"cable tie": 7, "tie": 11, "cable tie guns": 5, "cable": 9}, "description_wc": 182, "description_text": "Cable tie guns are indispensable tools if you want the cable ties on your next installation project to look as professional as possible. Use a cable gun to install ties with the correct tension and trim so that they are flush. Standard and heavy-duty cable tie guns are available, so you can pick the one best suited for the job. Easy to Use Equip your workers with a selection of cable tie guns and a few boxes of cable ties so that they will have the tools they need to work in a neat and organized manner. Just load the gun and squeeze the handle for quick fastening. Adjustable Cable tie guns each have a tension adjustment knob, so you can adjust the tool to the size of the tie. Quick adjustments for small or large ties keep your projects running smoothly. Automatic Cutting Action With an automatic cut-off feature, cable tie guns cut the tie flush to the base of the fastener, eliminating protrusions and sharp edges. Selecting the right gun will make your cable installations safer and neater.", "parent_text": "Hose Clamps / Cable Ties / Fasteners", "keyword_density": {"cable tie": "7.7", "tie": "6.0", "cable tie guns": "8.2", "cable": "4.9"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 110, "level": -2, "url": "http://www.staples.com/Cable-Ties/cat_CL167229", "text": "Cable Ties", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Cable Ties", "parent_url": "http://www.staples.com/Hose-Clamps-Cable-Ties-Fasteners/cat_DP5137", "keyword_count": {"ties": 6, "cable ties": 1, "cable": 7}, "description_wc": 131, "description_text": "Cable ties help organize bundles of cables or wires. Small businesses commonly use the ties to secure wires inside computers or to secure cables at workstations. The ties slip on easily and are secure once in place. Keep Cables Organized Ties let you bundle your cables so that they remain in one place instead of gradually spreading out over the floor or desks. This helps prevent accidental trips or unplug incidents due to wayward cables. Easily Slip Ties into Place Most ties slip easily into place by pulling one end through the clasp. For even more secure clamps, check out the selection of cable tie guns designed specifically for these products. Increase Airflow Computer cooling systems commonly rely on airflow. Proper cabling ensures effective airflow and helps protect electronics from overheating.", "parent_text": "Hose Clamps / Cable Ties / Fasteners", "keyword_density": {"ties": "4.6", "cable ties": "1.5", "cable": "5.3"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 2, "level": -2, "url": "http://www.staples.com/Weed-Cutters/cat_CL167238", "text": "Weed Cutters", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Weed Cutters", "parent_url": "http://www.staples.com/Lawn-Garden-Tools/cat_DP5138", "keyword_count": {"weed cutters": 3, "weed": 7}, "description_wc": 149, "description_text": "Weed cutters are an essential part of your landscaping tool collection. Designed to help you manually eliminate weeds that take hold, these tools help you maintain a tidy lawn or garden. Remove overgrown areas quickly and efficiently with weed cutters from Jackson Professional Tools. Easy to Handle The long handle makes it easy to get rid of weeds without squatting or bending. This lets you work longer without pain, so you'll get more done. Tackle Overgrown Vegetation Weed cutters can handle areas that are too overgrown to pull weeds by hand. The extended reach lets you get back behind bushes and into ditches where you don't want to step. Easy Storage Hang your tool from a hook in the garage or store it with your other garden tools in an outdoor shed. The compact profile of a weed cutter makes it easy to store just about anywhere.", "parent_text": "Lawn / Garden Tools", "keyword_density": {"weed cutters": "4.0", "weed": "4.7"}, "department_id": 15}
{"nr_products": 4, "level": -2, "url": "http://www.staples.com/Anchors-Screw-Wedge/cat_CL167128", "text": "Anchors: Screw & Wedge", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Hose-Clamps-Cable-Ties-Fasteners/cat_DP5137", "parent_text": "Hose Clamps / Cable Ties / Fasteners", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 7, "level": -2, "url": "http://www.staples.com/Wheelbarrows-Accessories/cat_CL167239", "text": "Wheelbarrows & Accessories", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Wheelbarrows & Accessories", "parent_url": "http://www.staples.com/Lawn-Garden-Tools/cat_DP5138", "keyword_count": {"wheelbarrows": 7, "accessories": 2}, "description_wc": 132, "description_text": "Wheelbarrows and accessories make it simple to carry heavy items across any distance. Different types of wheelbarrows are available, like the poly-tray wheelbarrow or platform wheelbarrow. With replacement parts, like wheels, available, you'll feel safe using your wheelbarrow for many projects. Easy Removal When gardening, you may use pruning shears and end up with clippings. Simply put them in your wheelbarrow and move them to your compost pile. Different Designs Available in different colors and designs, wheelbarrows and accessories are ideal for your work. You can choose from platform wheelbarrows, flat-free contractor wheelbarrows, or poly-tray wheelbarrows. Choose a Brand You Trust Popular brands, like Jackson and UnionTools, ensure their wheelbarrows are durable and built to last. The quality of these companies is what you've come to expect.", "parent_text": "Lawn / Garden Tools", "keyword_density": {"wheelbarrows": "5.3", "accessories": "1.5"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 12, "level": -2, "url": "http://www.staples.com/Buckles-Bands-Straps/cat_CL167129", "text": "Buckles, Bands & Straps", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Buckles, Bands & Straps", "parent_url": "http://www.staples.com/Hose-Clamps-Cable-Ties-Fasteners/cat_DP5137", "keyword_count": {"buckles": 5, "bands": 10, "straps": 5, "buckles bands": 3}, "description_wc": 195, "description_text": "Buckles, bands, and straps can be used in an industrial setting to keep equipment tied down to walls and floors on your premises or at job sites. You can also use them to organize and secure cables and hoses, and for packaging purposes. You can open and close some of these versatile fasteners by hand, and other types require banding tools. Sturdy Steel Bands Band-It is one of the leading manufacturers of buckles, bands, and straps, offering durable stainless-steel bands in convenient sizes. You can find bands in regular roll packaging or in a convenient tote package that is ideal for use on job sites. Buckle Them Down When you use buckles, bands, and straps together, you can easily remove bands and straps by just opening the buckle. Buckles also help you organize cables, hoses, and wires, and you can use them along with other cable management products and devices. Securing Bands Use a banding tool, center punch, or band clamp tool to strap steel bands around fixtures, equipment, or assemblies. These powerful hand tools are made specifically for use with bands, buckles, and straps, and they are easy and convenient to use.", "parent_text": "Hose Clamps / Cable Ties / Fasteners", "keyword_density": {"buckles": "2.6", "bands": "5.1", "straps": "2.6", "buckles bands": "3.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 20, "level": -2, "url": "http://www.staples.com/Water-Hoses-Accessories/cat_CL167134", "text": "Water Hoses & Accessories", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Water Hoses & Accessories", "parent_url": "http://www.staples.com/Lawn-Garden-Tools/cat_DP5138", "keyword_count": {"water hoses": 3, "accessories": 2}, "description_wc": 148, "description_text": "With water hoses and accessories, you can ensure that your garden is irrigated thoroughly. A long hose allows easy access to all corners of your yard. Specialized nozzles allow you to grip your hose comfortably. Flexible Our water hoses are made with durable, flexible materials and in lengths of 25, 50, and 100 feet. When you use them in tight spaces or bend them around corners, they will flex instead of breaking. Comfortable Grip With our water hoses and accessories from brands like Flexogen and Gilmour, you can enjoy a firm, comfortable grip. Our nozzles are made to fit easily into your hand, so you can control the flow with ease. Powerful Spray Our nozzles are designed to provide maximum spraying power, allowing you to cover a large surface area in a short period of time. Make the job easier with a pair of comfortable canvas gloves .", "parent_text": "Lawn / Garden Tools", "keyword_density": {"water hoses": "4.1", "accessories": "1.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Pruning-Shears/cat_CL167235", "text": "Pruning Shears", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Pruning Shears", "parent_url": "http://www.staples.com/Lawn-Garden-Tools/cat_DP5138", "keyword_count": {"shears": 6, "pruning shears": 2}, "description_wc": 135, "description_text": "Many small businesses use pruning shears to keep trees and bushes under control. Landscapers and construction workers rely on these tools to make working with thick branches easier. Some artists may also employ sharp shears for a variety of purposes. Trim Back Trees Shears let you quickly trim back trees and bushes to maintain property lines. This is important for landscaping companies and offices that have strict zoning regulations. Easily Remove Offensive Plants Pruning shears can help remove offensive plants, such as weeds and creeping vines. For quick removal of weeds that do not have thick vines or stems, check out our selection of weed cutters . Artistic Uses Shears may also be used for snipping off bits of wood or metal during art projects. Sharp shears can cut through many different materials with ease.", "parent_text": "Lawn / Garden Tools", "keyword_density": {"shears": "4.5", "pruning shears": "3.0"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 80, "level": -2, "url": "http://www.staples.com/Shovels-Scrapers-Spades/cat_CL167237", "text": "Shovels, Scrapers & Spades", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Shovels, Scrapers & Spades", "parent_url": "http://www.staples.com/Lawn-Garden-Tools/cat_DP5138", "keyword_count": {"shovels": 4, "spades": 1, "scrapers": 1}, "description_wc": 154, "description_text": "Shovels and spades let you dig in areas where you need to remove dirt quickly with a minimum of fuss. Different head designs are best on different surfaces or for creating different shaped holes. Scrapers help you remove an accumulation of dirt and debris to ensure your project or office area stays clean and beautiful. Easily Move Earth and Other Materials Shovels can help you quickly organize loose dirt and sand for transport. Deep-backed shovels also make great implements for carrying fertilizer and other materials between areas. Dig Holes for Multiple Purposes A solid shovel can make the creation of holes for new plants and topiaries a simple matter. Check out our selection of post hole diggers for an even more precise cut. Scoop Away Snow Shovels also let you scoop away snow during cold winter months. Shank designs make it easy to chip away ice on sidewalks or other customer-facing areas.", "parent_text": "Lawn / Garden Tools", "keyword_density": {"shovels": "2.6", "spades": "0.6", "scrapers": "0.6"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Post-Hole-Diggers/cat_CL167233", "text": "Post Hole Diggers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Post Hole Diggers", "parent_url": "http://www.staples.com/Lawn-Garden-Tools/cat_DP5138", "keyword_count": {"post hole diggers": 3, "diggers": 6, "hole": 9, "post hole": 4}, "description_wc": 213, "description_text": "Post hole diggers will ensure you create the perfect-sized hole for your fence, mailbox, or flowers. These diggers feature steel blades that make breaking through the dirt an easier process. This easy-to-use device is just what you need to dig holes on your construction or work site. Strong Steel Blades When you need to dig the perfect hole, the strong, steel blade on these post hole diggers is just right. Perfect for building a strong foundation for your fence or mailbox, these diggers feature the kind of blade that will cut through the dirt with ease, making them a fine alternative to a shovel . Long Handle Provides Durability When you need a bit more strength from your post hole digger, find one with a longer handle. There are some that offer a 48-inch handle that will give you the stability and core strength needed to dig the perfect hole. Digging Below the Frost Line Many post hole diggers allow you to create a hole deep enough to go beneath the frost line. With many building codes requiring the foundation to be under the frost line, these diggers will not only keep you within the law but also help prevent any damage to your property due to freezing temperatures.", "parent_text": "Lawn / Garden Tools", "keyword_density": {"post hole diggers": "4.2", "diggers": "2.8", "hole": "4.2", "post hole": "3.8"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 2, "level": -2, "url": "http://www.staples.com/Probes/cat_CL167234", "text": "Probes", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Probes", "parent_url": "http://www.staples.com/Lawn-Garden-Tools/cat_DP5138", "keyword_count": {"probes": 4}, "description_wc": 122, "description_text": "Probes can help you measure the depth of your garden and more, so they're a great tool to have on hand. Their classic design makes them easy to use and insert into the soil. New metal and fiberglass models are built to last. Easy Plant Care Probes, like other garden tools , can help you take care of your plants. Whether you grow crops or ornamental flowers, these tools will help you do it right. Long Lengths These probes come in different lengths, so you can choose the right tool for the depth you need. Lengths start at 48 inches. Durable Design Made with durable materials, probes will last through seasons of hard work. Fiberglass and metal give them sturdy frames.", "parent_text": "Lawn / Garden Tools", "keyword_density": {"probes": "3.3"}, "department_id": 15}
{"nr_products": 4, "level": -2, "url": "http://www.staples.com/Picks-Pick-Handles/cat_CL167232", "text": "Picks & Pick Handles", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Lawn-Garden-Tools/cat_DP5138", "parent_text": "Lawn / Garden Tools", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 25, "level": -2, "url": "http://www.staples.com/Sprayers-Accessories/cat_CL167133", "text": "Sprayers & Accessories", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Sprayers & Accessories", "parent_url": "http://www.staples.com/Lawn-Garden-Tools/cat_DP5138", "keyword_count": {"sprayers": 3, "accessories": 3}, "description_wc": 173, "description_text": "Sprayers and accessories provide a convenient way to evenly distribute fluids exactly where you need them. Choose from portable, handheld, or heavy-duty models from manufacturers such as Gilmour, Flexogen, and Pro-Flow. Whether you are applying herbicides to your lawn or degreasing equipment with a chemical cleaner, sprayers and accessories can help you get the job done right. Convenient to Use Portable and handheld sprayers and accessories let you easily transport and spray your chemicals. Large models hold a few gallons of chemicals so that you don't have to keep refilling the tank. Tailor Your Spray Whether you need a fine mist or a steady stream, an adjustable nozzle helps you get the kind of coverage you want. Don't forget a water hose so you can apply water to your plants, as well as chemical fertilizer and pesticides. Safe Spraying Ribbed tanks keep the contents secure even if the sprayer gets bumped or dropped. A chemical-resistant hose won't rot or degrade even when you're using powerful chemicals.", "parent_text": "Lawn / Garden Tools", "keyword_density": {"sprayers": "1.7", "accessories": "1.7"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 22, "level": -2, "url": "http://www.staples.com/Rakes/cat_CL167236", "text": "Rakes", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Rakes", "parent_url": "http://www.staples.com/Lawn-Garden-Tools/cat_DP5138", "keyword_count": {"rakes": 8}, "description_wc": 182, "description_text": "Rakes help you control clutter in any outdoor area and make it easier to gather leaves and litter or churn the soil for planting grass or a garden. Equip your workers with the right type of rake so that they can complete their tasks more quickly. Bow rakes, leaf rakes, and level-head rakes are available to help you complete special jobs. Comfortable Gripping Rakes feature contoured wood or fiberglass handles that make it easy to keep a grip while you're working. Cover your hands with a pair of work gloves to prevent chaffing. Quality Construction With heads made of forged steel, rakes are designed to last for years. The heads are connected to the handles with a strong steel-based connector, so these rakes can withstand constant daily use. Versatile Options Rakes come in a variety of types, so you can find a rake that is specially designed for your job. Blade and handle length and the number of blade tines are only some of the variable features that enable you to match the tool to the type of work.", "parent_text": "Lawn / Garden Tools", "keyword_density": {"rakes": "4.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 5, "level": -2, "url": "http://www.staples.com/Hoes/cat_CL167231", "text": "Hoes", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Hoes", "parent_url": "http://www.staples.com/Lawn-Garden-Tools/cat_DP5138", "keyword_count": {"hoes": 5}, "description_wc": 172, "description_text": "When you need to break up the dirt in a section of earth, hoes can make the job easier. With their long handles and solid blades, they give you enough leverage to turn up even the hardest soil. Choose from a selection of hoes made for gardening, landscaping, and small construction projects. Steady Grip Most hoes are made with round wooden handles, which allow you to get a steady grip. To reduce the likelihood of blisters, use a pair of leather palm gloves . Powerful Turning Our hoes are made with sturdy metal attachments connecting the blades to the handles, and this allows you to turn the soil with maximum force. Whether you're using a mortar and cotton hoe or a standard garden hoe, you can give all of your power to the process. Sturdy Blades We offer hoes with solid, sturdy blades that are easy to carry yet strong enough to handle difficult soil. Choose from a variety of blade lengths made of materials like steel and chrome-plated steel.", "parent_text": "Lawn / Garden Tools", "keyword_density": {"hoes": "2.9"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Forks-Hooks/cat_CL167230", "text": "Forks & Hooks", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Forks & Hooks", "parent_url": "http://www.staples.com/Lawn-Garden-Tools/cat_DP5138", "keyword_count": {"hooks": 3, "forks": 4}, "description_wc": 141, "description_text": "Fork and hook tools allow farmers and landscapers to easily move large amounts of difficult-to-handle products. This includes straw, hay, and manure. Many hooks can also be used to aerate or till land prior to planting. Easily Lift and Toss Materials The tines of large forks let you easily grab hay and other loose materials. Long handles make tossing the material into bins or onto land easier through the application of leverage. Versatile Application Forks and hooks can serve a variety of applications around a farm or landscaping site. For even greater versatility, check out shovels, scrapers, and spades . Picking the Right Size and Shape Forks are generally larger than most hook tools and have more tines. Smaller tools are better for precision work, and large forks and hooks are best used for moving hay and similar material.", "parent_text": "Lawn / Garden Tools", "keyword_density": {"hooks": "2.1", "forks": "2.9"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 13, "level": -2, "url": "http://www.staples.com/Industrial-Tape/cat_CL166976", "text": "Industrial Tape", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Industrial Tape", "parent_url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "keyword_count": {"tape": 6, "industrial tape": 3}, "description_wc": 131, "description_text": "Industrial tape provides the precise measurements many small businesses need. The tape's heavy-duty construction ensures it will last for years of regular use. Tape can be used both indoors and out for a variety of purposes. Measure Construction Sites Construction requires specific attention to details. Industrial tape allows engineers and workers to measure sites and ensure that everything goes up in the right place. Confirm Distances Engineers regularly need accurate measurements over long distances. For measuring even greater distances, check out precise measuring wheels . Take Depth Readings The heavy-duty materials used in industrial tape allow you to easily gauge the level of fluids in tanks such as oil wells and storage areas. The tape resists damage from exposure to the harsh chemicals often contained in such units.", "parent_text": "Measuring / Leveling Tools", "keyword_density": {"industrial tape": "4.6", "tape": "4.6"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 44, "level": -2, "url": "http://www.staples.com/Levels/cat_CL166978", "text": "Levels", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Levels", "parent_url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "keyword_count": {"levels": 5}, "description_wc": 136, "description_text": "Levels are versatile tools perfect for home office or business use. Traditional levels use a liquid medium to suspend an air bubble that confirms when something is level or flush. Electronic versions simplify this process with laser technology. Ensure Shelves and Desks Lie Flat Tilted shelves or desks can result in materials falling off and becoming lost. Levels help ensure that documents and items stay where they should. Measure Key Angles Some items have to be installed or mounted at just the right angle. Angular levels can help with this. For larger or bulkier items, check out carpenter's squares . Take Simple Measurements Along with angles, modern levels also typically have a built-in ruler for additional measurements. This can help ensure that your new furniture fits in the space available while also sitting level.", "parent_text": "Measuring / Leveling Tools", "keyword_density": {"levels": "3.7"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 1, "level": -2, "url": "http://www.staples.com/Dial-Digital-Indicators/cat_CL167356", "text": "Dial & Digital Indicators", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Dial & Digital Indicators", "parent_url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "keyword_count": {"digital indicators": 4, "dial": 7, "dial digital indicators": 3, "digital": 5}, "description_wc": 159, "description_text": "A selection of dial digital indicators gives your employees the tools they need to inspect your work process. Products in this category, such as the universal back plunger dial test indicator, can confirm the accuracy of small distances and angles. The dial display can uncover small deviations between your final products that can't be distinguished by sight alone. Accurate Measuring Dial digital indicators are specially designed to measure small distances with a high degree of accuracy. A digital test indicator can be used with a dial caliper and other measuring tools to ensure your products meet standards. Reliable Results Dial digital indicators are ruggedly constructed with few moving parts to ensure reliable results. You can count on the high level of accuracy of the dial reading. Simple to Operate Digital indicators are easy to operate. You can assign inspection duty to almost any worker and feel confident that he or she will be able to use the equipment.", "parent_text": "Measuring / Leveling Tools", "keyword_density": {"digital indicators": "5.0", "dial": "4.4", "dial digital indicators": "5.7", "digital": "3.1"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 26, "level": -2, "url": "http://www.staples.com/Inspection-Mirrors-Magnifiers/cat_CL166977", "text": "Inspection Mirrors & Magnifiers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Inspection Mirrors & Magnifiers", "parent_url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "keyword_count": {"inspection mirrors": 4, "magnifiers": 4}, "description_wc": 168, "description_text": "Inspection mirrors and magnifiers give you handy visual access to places that you can't otherwise see, including the inside of engines or electronic devices. Manufactured by companies such as Ullman and General Tools, these visual gadgets are a handy addition to your toolkit. Inspection mirrors and magnifiers are useful for assemblers, mechanics, and inspectors. Easy to Transport Pocket inspection mirrors and magnifiers include clips that let you attach them to your pocket so that you won't lose them. Choose one with a telescoping head to get more reach in tight spaces. Comfortable to Hold A cushioned grip makes hand-held inspection mirrors and magnifiers comfortable to hold throughout the day. A swiveling head means you can adjust the mirror to point exactly where you want it. Attach Anywhere Models with a magnetic base give you the ability to hook the mirror to any metal surface, so you can work hands free. This allows you to dedicate both hands to other tools from your tool set .", "parent_text": "Measuring / Leveling Tools", "keyword_density": {"inspection mirrors": "4.8", "magnifiers": "2.4"}, "department_id": 15}
{"nr_products": 27, "level": -2, "url": "http://www.staples.com/Gauges-Gages/cat_CL166964", "text": "Gauges / Gages", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_wc": 0, "parent_url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "parent_text": "Measuring / Leveling Tools", "department_text": "Cleaning | Facilities | Tools", "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 12, "level": -2, "url": "http://www.staples.com/Compasses-Protractors-and-Markers/cat_CL167135", "text": "Compasses, Protractors and Markers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Compasses, Protractors and Markers", "parent_url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "keyword_count": {"compasses protractors and markers": 3, "markers": 4}, "description_wc": 164, "description_text": "Compasses, protractors, and markers make it easy to get exact measurements for all of your important projects. Whether you're designing products or drafting out building details, these products help you get your project completed efficiently. Scribe Circles in Multiple Sizes Whether you need to scribe tiny circles or ones up to 80 inches in diameter, radius markers from manufacturers such as Contour and Curv-O-Mark can help. Pair your scribe circles with a heavy-duty ruler to get accurate straight lines. Get Unparalleled Accuracy Compasses, protractors, and markers from General and Empire give you precise and accurate measurements you can rely on. Use them when scoring or deep cutting and rest assured that your measurements are correct. Handle Layouts More Quickly Using calibrated compasses, protractors, and markers lets you lay out pipe, joints, or laterals quickly and easily, ensuring your final product won't have leaks. You'll waste fewer materials when cutting, and you'll save time during the preparation stage.", "parent_text": "Measuring / Leveling Tools", "keyword_density": {"compasses protractors and markers": "7.3", "markers": "2.4"}, "department_id": 15}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 44, "level": -2, "url": "http://www.staples.com/Calipers-Dividers/cat_CL166956", "text": "Calipers & Dividers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Calipers & Dividers", "parent_url": "http://www.staples.com/Measuring-Leveling-Tools/cat_DP5139", "keyword_count": {"dividers": 4, "calipers": 6}, "description_wc": 156, "description_text": "Calipers and dividers let you easily measure the outside or diameter of any surface. Just open the calipers to a point wide enough that you can clip them over a surface or object, and then close them tightly, letting them touch whatever you are measuring. Then, read the dial or scale to find the exact measurement. Easy to Read Digital and dial readout calipers and dividers from major manufacturers, including Mitutoyo and General Tools, make it easy to read measurements. Thumb clamp, pocket, and outside calipers have clearly marked scales for your convenience. Accurate Measurements Calipers and dividers measure down to a fraction of an inch. You can find models that also show metric measurements that are essential if you are measuring parts for international automobiles or machines. Wide Measuring Range Calipers and dividers are available for measuring items up to 12 inches. Staples also features a full selection of tape measures for measuring larger subjects.", "parent_text": "Measuring / Leveling Tools", "keyword_density": {"dividers": "2.6", "calipers": "3.8"}, "department_id": 15}
