{"department_text": "Cleaning | Facilities | Tools", "nr_products": 10, "level": -2, "url": "http://www.staples.com/Tampons/cat_CL164396", "text": "Tampons", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Tampons", "parent_url": "http://www.staples.com/Feminine-Care/cat_DP8170", "keyword_count": {"tampons": 2}, "description_wc": 136, "description_text": "Staples helps you find all the feminine hygiene products you need from the brands you trust most. Enjoy great value when you shop Staples for Tampax and Playtex tampons, maxi pads, and more. With our wide selection, it's easy to find the right feminine hygiene items at the right prices. Brands \u2013 Choose tampons from the brands you rely on. Staples carries products from Playtex, Tampax, and Seventh Generation among others. Variety \u2013 Find it all from maxi pads to sanitary napkins to panty liners. At Staples, we make it easy to choose the right feminine hygiene products. Types \u2013 Get individually-wrapped, flushable hygiene products and choose from a great assortment of environmentally-friendly options. We offer excellent value for high-quality feminine care products. Shop with us for great savings on the best feminine hygiene brands.", "parent_text": "Feminine Care", "keyword_density": {"tampons": "1.5"}, "department_id": 15}
{"level": 0, "url": "http://www.staples.com/Machine-Fluids/cat_DP5141", "text": "Machine Fluids", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_wc": 0, "parent_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "parent_text": "Safety Supplies", "department_text": "Safety Supplies", "department_id": 16}
{"department_text": "Safety Supplies", "level": 0, "url": "http://www.staples.com/First-Aid-Wound-Care/cat_CG1424", "text": "First Aid / Wound Care", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "First Aid / Wound Care", "parent_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "keyword_count": {"aid": 6, "wound": 3, "first aid": 5, "care": 3}, "description_wc": 192, "description_text": "First-aid care is an important part of having your office prepared for an emergency. With different types of kits, bandages, disinfectants, and tapes available, you can build yourself a nice first-aid collection for your supply closet. This way, you and your coworkers can quickly address anything from a minor paper cut to a larger wound. Ready for an Emergency Purchasing first-aid care helps your team get ready for any emergency. When you purchase a kit, you'll have the materials you need to treat an injury or wound without spreading germs or causing an infection. Compact Kits Emergency kits come prepackaged with bandages and other medical goods in a small container that fits in your supply closet. You can also keep a kit at your desk or in your vehicle so you're prepared wherever you are. Take Care of Cuts Quickly With a first-aid kit in your office, you'll be ready to quickly bandage up a wound and help cut down on the risk of infection. From Band-Aids to first-aid tape, your office will be prepared to quickly bandage up cuts of any kind.", "parent_text": "Safety Supplies", "keyword_density": {"aid": "3.1", "wound": "1.6", "first aid": "5.2", "care": "1.6"}, "department_id": 16}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 31, "level": -2, "url": "http://www.staples.com/Hair-Appliances/cat_CL166372", "text": "Hair Appliances", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Hair Appliances", "parent_url": "http://www.staples.com/Hair-Care/cat_DP8171", "keyword_count": {"hair": 9}, "description_wc": 136, "description_text": "Hair care tools keep you looking your best. Presentation is very important when you're running a small business. Staying in style helps you make a great impression on customers and employees. Keep Up with the Latest Style Curlers, straighteners, and other tools can help you match the latest fashion trends with your coif. Businesses that offer hair styling services for clients should always strive to have the right tools on hand. Keep Hair Healthy Hairdryers help protect hair from damage that can occur when hair is left wet. Professionals on the go should check out travel sizes of many popular hair care products. Look Sharp All Day Beard and hair trimmers can help you avoid the dreaded five o'clock shadow or unsightly and unkempt mane. Look sharp any time with quality hair care tools.", "parent_text": "Hair Care", "keyword_density": {"hair": "6.6"}, "department_id": 15}
{"level": 0, "url": "http://www.staples.com/Safety-Storage/cat_CG1364", "text": "Safety Storage", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_wc": 0, "parent_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "parent_text": "Safety Supplies", "department_text": "Safety Supplies", "department_id": 16}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 16, "level": -2, "url": "http://www.staples.com/Electric-Shavers/cat_CL166387", "text": "Electric Shavers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Electric Shavers", "parent_url": "http://www.staples.com/Shaving-Grooming/cat_DP8173", "keyword_count": {"shavers": 2}, "description_wc": 143, "description_text": "Shaving tools keep you looking your best. Versatile and lightweight shavers allow you to touch up your appearance throughout the day. Heavy-duty models allow you to get a good shave that lasts all day. Enjoy a Close Shave Shaving tools take much of the effort out of getting a close shave. Rotating heads ensure a clean cut that helps keep your skin looking fresh and rejuvenated. Create a Striking Look Shavers can also be used to help demonstrate your personal style. Those looking for even greater precision cuts for beards and hair should check out the clippers and trimmers that are available. Choosing a Shaver Shaving devices typically come in standard and wet-dry models. Wet-dry models let you save time and reduce effort spent cleaning by shaving in the shower. Standard models may offer more options for settings and heads.", "parent_text": "Shaving & Grooming", "keyword_density": {"shavers": "1.4"}, "department_id": 15}
{"level": 0, "url": "http://www.staples.com/Adhesives-Sealants-Tapes/cat_CG1376", "text": "Adhesives, Sealants & Tapes", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_wc": 0, "parent_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "parent_text": "Safety Supplies", "department_text": "Safety Supplies", "department_id": 16}
