{"level": 0, "url": "http://www.staples.com/Fall-Protection/cat_DP5079", "text": "Fall Protection", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_wc": 0, "parent_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "parent_text": "Safety Supplies", "department_text": "Safety Supplies", "department_id": 16}
{"department_text": "Cleaning | Facilities | Tools", "nr_products": 27, "level": -2, "url": "http://www.staples.com/Clippers-Trimmers/cat_CL166371", "text": "Clippers & Trimmers", "department_url": "http://www.staples.com/Cleaning-Facilities-Tools/cat_SC1683", "description_title": "Clippers & Trimmers", "parent_url": "http://www.staples.com/Shaving-Grooming/cat_DP8173", "keyword_count": {"trimmers": 5, "clippers": 4}, "description_wc": 218, "description_text": "Keep clippers and trimmers in your office so you can look your best before a midday or afternoon meeting or event. You can choose an all-in-one trimmer for a quick and convenient beard and hair trim, or you can get a fully featured electric hair clipper just like the ones barbers use. Small, precision trimmers are also available for shaping beards and cutting nose and ear hair. Versatile and Convenient Panasonic offers an all-in-one trimmer that you can use for head, facial, or body hair, and you can even use this versatile cordless device on wet hair. Conair grooming kits include clippers and trimmers, a selection of trimming and cutting blades, and useful accessories for a precision cut or trim. Professional Quality Clippers and trimmers for personal use give you professional results in the comfort of your home or office. They use the same types of blades and mechanisms that professional barbers and stylists rely upon. Choose Your Look The blades and shaping tools included with clippers and trimmers allow you to choose your look, whether it is a crewcut for a charity athletic event or just a quick trim to round out your beard. Staples also features a selection of men's and women's electric shavers that are convenient for office use.", "parent_text": "Shaving & Grooming", "keyword_density": {"trimmers": "2.3", "clippers": "1.8"}, "department_id": 15}
{"department_text": "Safety Supplies", "level": 0, "url": "http://www.staples.com/Traffic-Safety/cat_DP5085", "text": "Traffic Safety", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Traffic Safety", "parent_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "keyword_count": {"traffic": 1, "safety": 4}, "description_wc": 183, "description_text": "Managing and handling large crowds can be simplified with dependable and quality crowd control supplies. A large and unorganized group of people can present fire hazards, trampling, and general restlessness. Safety signs are an essential part of damage control when there is a spill, pothole, or other potential hazards. Warn customers, guests, and employees of dangerous areas in the work place with safety signs. Improve Efficiency. Connect crowd control posts with rope to direct traffic in an efficient, time-effective, and fair manner. Notify of restricted areas. Place safety tape around restricted and potentially dangerous areas to notify visitors and workers. Durability and flexibility. Safety tape is flexible for applications in almost any environment or shape and durable to last. Spanish and English. Many signs come with both Spanish and English for multi-lingual functionality. Bring awareness to areas of caution. With bright yellow and orange signs and cones, it is easy for people to recognize areas that should be avoided. Portability and convenience. Most signs fold up for easy storage when not in use and a simple setup when an accident happens.", "parent_text": "Safety Supplies", "keyword_density": {"safety": "2.2", "traffic": "0.5"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 1, "level": 0, "url": "http://www.staples.com/Ice-Melt/cat_CL164825", "text": "Ice Melt", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Ice Melt", "parent_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "keyword_count": {"ice": 11, "melt": 7, "ice melt": 4}, "description_wc": 203, "description_text": "When winter weather brings freezing temperatures, Ice Melt will keep your sidewalks and steps clear. Designed to melt ice on contact, this product is great to use around your office or job site before and after any big storm. The odorless and colorless pellets are easy to spread and will create heat quickly. An Alternative to Rock Salt Ice Melt works by combining magnesium chloride and calcium pellets. The mixture of these two substances produces heat--and ice-free sidewalks--quickly. It works so fast that you'll need less product to properly clear a surface than you would with rock salt. Safe for Sidewalks When a nasty storm hits, Ice Melt is a great way to keep your sidewalks, your steps, and any surrounding areas clear. This product is made to quickly melt ice on frozen pavement, so your employees will be able to make it to the office without slipping on their way to the door. Melts Ice in Extreme Temperatures Besides generating heat quickly, Ice Melt will effectively de-ice your pavement in temperatures as low as -15 degrees Fahrenheit. It's the perfect supply for when you need to clear a path and shovel snow early in the morning.", "parent_text": "Safety Supplies", "keyword_density": {"melt": "3.4", "ice": "5.4", "ice melt": "3.9"}, "department_id": 16}
