{"department_text": "Safety Supplies", "nr_products": 55, "level": 0, "url": "http://www.staples.com/Sorbents-Spill-Control/cat_CL165294", "text": "Sorbents & Spill Control", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Sorbents & Spill Control", "parent_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "keyword_count": {"sorbents": 2, "spill control": 1, "spill": 2}, "description_wc": 106, "description_text": "Be prepared for accidents and chemical, oil, or dangerous substance spills with sorbents and spill control from top brands like SPC, 3M, and GreenSorb. Staples sorbent pads and rolls are designed to absorb almost any liquid for easy removal and proper disposal. Dependable and flexible : Rolls, pads, and tubes are effective at absorbing and containing a variety of liquids and are flexible to fit your needs. Choose your size : We offer a variety of sizes of pads and rolls to fit many different buildings and rooms. Clay and granular sorbent : Clay and granular sorbents are useful for absorbing various liquids like oil, gasoline, diesel, and lubricants.", "parent_text": "Safety Supplies", "keyword_density": {"sorbents": "1.9", "spill control": "1.9", "spill": "1.9"}, "department_id": 16}
