{"department_text": "Safety Supplies", "nr_products": 4, "level": -2, "url": "http://www.staples.com/Cotton-Balls/cat_CL168478", "text": "Cotton Balls", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Cotton Balls", "parent_url": "http://www.staples.com/Cotton-Balls-Applicators/cat_DP5382", "keyword_count": {"balls": 5, "cotton": 6, "cotton balls": 4}, "description_wc": 200, "description_text": "Cotton balls are soft and compact medical accessories that are great for cleaning minor scrapes. Whether it's a paper cut or a wound from a power tool, using a cotton ball can cleanly apply antiseptic before you bandage the wounded area. The balls come in large packs, so you'll have plenty for your emergency kit. Sterile or Nonsterile Cotton balls can be sterile or nonsterile, and both are fine options for cleaning a small wound. Whichever you choose, you can use it to gently apply a disinfectant on the injured area to ensure the wound can heal properly. You can also use first-aid tape to secure a cotton ball on a wound to stop bleeding. Large Quantities You'll find packages of up to four thousand cotton balls for your medical or office needs. Store them in your office supply closet for an emergency or in jars for easy access. Multiple Uses Whether you're in a medical center or a business office, having cotton balls nearby gives you the means to clean wounds and stop bleeding. You can also use them to blot up spilt ink or to clean up errant cosmetic spills in your office.", "parent_text": "Cotton Balls / Applicators", "keyword_density": {"cotton balls": "4.0", "balls": "2.5", "cotton": "3.0"}, "department_id": 16}
