{"department_text": "Safety Supplies", "nr_products": 6, "level": -2, "url": "http://www.staples.com/Surgical-Tape/cat_CL162002", "text": "Surgical Tape", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Surgical Tape", "parent_url": "http://www.staples.com/First-Aid-Tape/cat_DP5385", "keyword_count": {"surgical": 4, "surgical tape": 3, "tape": 8}, "description_wc": 169, "description_text": "Surgical tape protects sutures and wounds, and cloth, silk, or paper tape can be of help when patients need to cover stitches or cuts. Most types are hypoallergenic, so patients can rest easy knowing they likely won't have an allergic reaction to it. The tape is comfortable and has a slight adhesive to help it stay in place. Hypoallergenic Tape Keeping a first aid kit is wise, and you'll want to be sure the supplies can help everyone. Hypoallergenic surgical tape is gentle on the skin and doesn't cause allergic reactions. Different Styles From adhesive backing to stretchy cotton, first aid tape comes in many forms. You can choose from silk, cloth, surgical, or paper styles to find one that works for you. Easy to Use Surgical tape is easy to use; you simply wrap it around a wound or cover stitches with adhesive styles. You can purchase transparent or opaque tapes, making it easy to choose whether you can see the wound underneath or not.", "parent_text": "First Aid Tape", "keyword_density": {"surgical": "2.4", "surgical tape": "3.6", "tape": "4.7"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 11, "level": -2, "url": "http://www.staples.com/Hot-Packs/cat_CL168508", "text": "Hot Packs", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Hot Packs", "parent_url": "http://www.staples.com/Hot-Cold-Packs/cat_DP5389", "keyword_count": {"hot": 5, "hot packs": 2, "packs": 4}, "description_wc": 186, "description_text": "If you're suffering from pain from arthritis or other ailments, hot packs can help you feel better. They come in a variety of shapes and sizes, so you can get one that's customized to the body part that hurts or keep a less specialized one on hand. If your skin is sensitive or you have poor circulation, you might prefer a warm pack, which will give you less heat. Instant Packs Some hot compresses, such as those made by Rapid Aid, turn hot immediately when you fold them in half, so you can apply heat to your injured body part right away. These are especially helpful when you are outside and don't have quick access to a microwave to heat them. Heat Your Entire Body While many hot pads or packs are small so that you can apply them to specific body parts, you can also get a spa wrap that's great for your entire body. This wrap helps to keep you warm and comfortable. Latex Free Many hot packs are latex free, so you don't have to worry about allergies.", "parent_text": "Hot & Cold Packs", "keyword_density": {"hot": "2.7", "hot packs": "2.2", "packs": "2.2"}, "department_id": 16}
{"nr_products": 22, "level": -2, "url": "http://www.staples.com/Adhesive-Tape/cat_CL168500", "text": "Adhesive Tape", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_wc": 0, "parent_url": "http://www.staples.com/First-Aid-Tape/cat_DP5385", "parent_text": "First Aid Tape", "department_text": "Safety Supplies", "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 12, "level": -2, "url": "http://www.staples.com/Cold-Packs/cat_CL168504", "text": "Cold Packs", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Cold Packs", "parent_url": "http://www.staples.com/Hot-Cold-Packs/cat_DP5389", "keyword_count": {"cold packs": 5}, "description_wc": 150, "description_text": "Cold packs are an important part of your office first-aid kit. Perfect for bumps on the head or a finger accidentally shut in a drawer, cold packs are the first line of defense to reduce swelling. You can keep one in your briefcase or purse too. Instant Choose from a selection of cold packs that instantly change temperature when they are activated. This lets you start applying ice to the area immediately. Reusable Some cold packs are filled with a cooling gel that allows them to be chilled in the office fridge and used repeatedly. This feature lets you cut down on waste and costs. Sized to Fit Cold packs are available in a wide range of sizes and shapes, so you can have what you need on hand for a sprained thumb or twisted ankle. There are also latex-free options if someone in your office is allergic.", "parent_text": "Hot & Cold Packs", "keyword_density": {"cold packs": "6.7"}, "department_id": 16}
