{"department_text": "Safety Supplies", "nr_products": 9, "level": -2, "url": "http://www.staples.com/Laceration-Trays/cat_CL168518", "text": "Laceration Trays", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Laceration Trays", "parent_url": "http://www.staples.com/Minor-Procedure-Trays/cat_DP5398", "keyword_count": {"laceration trays": 4, "trays": 5}, "description_wc": 196, "description_text": "Laceration trays provide all the tools you need to clean and sterilize wounds in one convenient kit. Whether it's a clean cut that just needs sterilized or a dirty cut that needs to have the debris removed, these trays provide the tools to get the job done. Each tray kit also comes with cloths and drapes, ensuring that you have a clean surface to work on. Latex-Free Materials Laceration trays are made with latex-free materials, so you never have to worry about patients who are sensitive to latex. You can safely use these kits with everyone. Floor-Grade Tools The laceration trays come with a selection of floor-grade tools and other instruments. These tools make it easy to remove debris from cuts before cleaning and bandaging. Be sure to have a supply of bandages nearby, so you can bandage the wound as soon as it's clean. Cloths and Drapes The laceration trays also come with a selection of cloths and drapes, so you can protect your table and your patient from exposure to bacteria and germs. They also make cleanup quick and easy, so you always have a clean, sterile environment.", "parent_text": "Minor Procedure Trays", "keyword_density": {"laceration trays": "4.1", "trays": "2.6"}, "department_id": 16}
