{"department_text": "Safety Supplies", "nr_products": 2, "level": -1, "url": "http://www.staples.com/Ammonia-Inhalants/cat_CL168448", "text": "Ammonia Inhalants", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Ammonia Inhalants", "parent_url": "http://www.staples.com/First-Aid-Wound-Care/cat_CG1424", "keyword_count": {"ammonia inhalants": 2, "ammonia": 3}, "description_wc": 134, "description_text": "Keeping a well-supplied first-aid kit is an important part of running your business safely. Ammonia stimulants are ideal for use to safely revive customers or coworkers who have fainted. Latex-free, these stimulants are perfect to use in any situation. Single-Use Ampules Each ampule is designed for only one use, making them safe, easy, and clean to use. You won't worry about cross contamination of germs from one employee to the next. Latex-Free Latex allergies are serious business. Medline ammonia inhalants come completely latex free, so you won't have to worry about possible reactions when using them on a fainting victim. Stock Your First-Aid Cabinet These ammonia inhalants are a must-have for your first-aid kit . You'll never be caught in a fainting emergency.", "parent_text": "First Aid / Wound Care", "keyword_density": {"ammonia inhalants": "3.0", "ammonia": "2.3"}, "department_id": 16}
