{"department_text": "Safety Supplies", "level": 0, "url": "http://www.staples.com/Fire-Gas-Water-Protection/cat_DP5201", "text": "Fire, Gas & Water Protection", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Fire, Gas & Water Protection", "parent_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "keyword_count": {"fire": 5, "fire gas": 2, "gas": 4, "water protection": 2}, "description_wc": 154, "description_text": "Make sure your office is prepared with fire, gas, and water protection products. Keeping smoke alarms, carbon monoxide detectors, and fire extinguishers in frequently traveled, easy-access spaces ensures your workplace safety procedures can be followed quickly and efficiently if needed. Detect Sensitive smoke alarms with smart hush features let you know about possible fires without going off at the smell of burnt toast. Carbon monoxide detectors are a must for any office or work place that has gas appliances or equipment. Alert Stay proactive by regularly testing your gas lines with high-visibility leak-detecting chemicals. Nontoxic formulas are safe for employees to use and most options can be used on any kind of pipe. Extinguish Fire, gas, and water protection devices can go a long way toward preventing dangerous workplace incidents, but it's important to make sure your office is prepared with approved and regularly inspected fire extinguishers on every floor.", "parent_text": "Safety Supplies", "keyword_density": {"fire": "3.2", "fire gas": "2.6", "gas": "2.6", "water protection": "2.6"}, "department_id": 16}
