{"department_text": "Safety Supplies", "level": 0, "url": "http://www.staples.com/Personal-Protective-Equipment-PPE/cat_CG1398", "text": "Personal Protective Equipment (PPE)", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Personal Protective Equipment (PPE)", "parent_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "keyword_count": {"personal": 1}, "description_wc": 105, "description_text": "Keep your employees safe and maintain regulatory compliance with Staples\u2019 large selection of high-quality and dependable safety supplies. We have products for all of your safety needs whether you are a small business, construction firm, health service provider, or a retail store. Protect your employees. Browse thousands of products for employees\u2019 personal protection like safety gloves, ear and eye protectors, masks, and back supports. Protect your building. Minimize the risk and damage of fire with smoke detectors, safety signage, safety lighting, early warning, and fire extinguishers. Protect your property. Keep your building and possessions locked up and under appropriate surveillance to secure your property.", "parent_text": "Safety Supplies", "keyword_density": {"personal": "1.0"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 18, "level": -1, "url": "http://www.staples.com/Emergency-Kits/cat_CL164832", "text": "Emergency Kits", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Emergency Kits", "parent_url": "http://www.staples.com/First-Aid-Wound-Care/cat_CG1424", "keyword_count": {"kits": 6, "emergency": 4}, "description_wc": 251, "description_text": "Emergency response kits allow you to quickly deal with many common problems, from accidental spills to the outbreak of communicable diseases in your office. Most kits are highly specialized and designed to deal with a specific issue that may arise in the workplace. Making the kits available may or may not be required by your insurance or regulatory agencies, but having them handy can dramatically decrease response times and help deal with problems as they arise. Effective Solutions Whether you need to help fight the flu in your office or provide quick access to cleanup materials for potentially hazardous spills, emergency response kits include effective tools designed to rapidly alleviate or eliminate problems. Common accessories are bandages and masks or towels that rapidly absorb materials and packaging for safe disposal. These provide effective solutions for many problems that can arise in modern workplaces. Quick Response Emergency response kits allow you to respond immediately to many common ailments or problems that may affect your customers or employees. This can dramatically cut down on the risk to those affected by spills or illnesses. Sterile Materials Emergency response kits contain many tools that are packaged in a sterile environment that's carefully monitored to ensure optimal results. Sterile packaging helps prevent the spread of infections due to the potential contamination from viruses of bacteria on the tools themselves. This can greatly help with the healing or cleanup process, because clean, sterile tools are far less likely to introduce or promote the spread of pathogens.", "parent_text": "First Aid / Wound Care", "keyword_density": {"kits": "2.4", "emergency": "1.6"}, "department_id": 16}
{"department_text": "Coffee | Water | Snacks", "level": 0, "url": "http://www.staples.com/Snacks/cat_DP3722", "text": "Snacks", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Snacks", "parent_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "keyword_count": {"snacks": 6}, "description_wc": 117, "description_text": "Satisfy your hunger and stay energized throughout the day with healthy and convenient office snacks from brands including Nature Valley, Planters, Diamond, Quaker, Mrs. Fields, Doritos, Frito Lay, Ritz, Kind, Chex Mix, Anderson, Kashi, and Oreo. Snacks for any time of the day - Browse our breakfast and lunch items for food snacks that are convenient, filling, and healthy. Healthy choices and brands - We have a large selection of smart snacks to satisfy your hunger with low calorie and low fat options. Convenience snacks - We have a variety of easy and quick snacks that you can grab on the go and eat on the commute or at the desk like salty foods, chips, cookies, beef jerky, and more.", "parent_text": "Coffee | Water | Snacks", "keyword_density": {"snacks": "5.1"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "level": 0, "url": "http://www.staples.com/Plates-Cups-Cutlery/cat_DP1621", "text": "Plates / Cups / Cutlery", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Plates / Cups / Cutlery", "parent_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "keyword_count": {"plates cups": 2, "cups": 5, "cutlery": 2, "plates": 3}, "description_wc": 163, "description_text": "Disposable plates, cups, and cutlery let you serve meals on a daily basis or at special events without worrying about cleanup. Choose from paper, plastic, or foam plates and cups from manufacturers such as Solo and Dixie. After your event, save leftovers using food storage bags and containers. Serve Any Kind of Beverage Hot cups designed for beverages such as coffee and tea help keep those at your workplace productive in the mornings. Use cold cups for sodas, punch, water, or other drinks served at meetings or company events. Be Prepared for Unexpected Food Events Whether it's the company potluck lunch or someone has brought in a special dessert, you'll be prepared to serve food anytime when you've got plates, cups, and cutlery on hand. Napkins and paper towels ensure that everything stays clean at mealtime. Little Extras Keep Everyone Happy Packages of condiments let employees or customers customize their meals. Straws and stirrers make mixing and drinking beverages easier.", "parent_text": "Coffee | Water | Snacks", "keyword_density": {"plates cups": "2.5", "cups": "3.1", "cutlery": "1.2", "plates": "1.8"}, "department_id": 18}
{"department_text": "Safety Supplies", "nr_products": 45, "level": -1, "url": "http://www.staples.com/First-Aid-Kits/cat_CL80401", "text": "First Aid Kits", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "First Aid Kits", "parent_url": "http://www.staples.com/First-Aid-Wound-Care/cat_CG1424", "keyword_count": {"kits": 6, "first aid kits": 1, "first aid": 3}, "description_wc": 250, "description_text": "First-aid kits come in many sizes, so you can choose the kit that suits your office, team, or school. From kits that can care for up to ten people to those for twenty-five or more people, these kits make it easy to care for minor injuries that happen on the job. Kit refills are also available, so you can replace items that you use, and that means you'll always be prepared for accidents. Wound Prep Your first aid kit may have alcohol swabs, scissors, tweezers, and more so that you can care for a wound before it is covered. Functional Sizes When you're on the job, you might be working with ten people, or you could be working with twenty-five people. Since situations vary, it's important to choose a first-aid kit that can handle minor injuries that may happen on a daily basis. From scratches to scrapes, these kits come in sizes that can give you all the supplies you need to treat minor injuries. Refills You might find that you've been using bandages more than you thought you would, or the athletic tape may be running low. In those cases, refill kits are important, as you can replace only what you need. Some refill kits come with a little bit of everything, from bandages to antiseptic wipes, and others may contain extra scissors, tweezers, ice packs, and more. With refills, you can easily keep your kit filled and ready for accidents.", "parent_text": "First Aid / Wound Care", "keyword_density": {"kits": "2.4", "first aid kits": "1.2", "first aid": "2.4"}, "department_id": 16}
{"department_text": "Coffee | Water | Snacks", "level": 0, "url": "http://www.staples.com/Candy-Gum-Mint/cat_DP4695", "text": "Candy / Gum / Mint", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Candy / Gum / Mint", "parent_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "keyword_count": {"mint": 2, "candy": 6, "gum": 3}, "description_wc": 92, "description_text": "Satisfy your sweet tooth with our large variety of candies and treats from brands including Hersheys, M&Ms, Jolly Rancher, Dentyne, Orbit, Mentos, Skittles, Tootsie Roll, Twizzlers, Milk Way, Kit Kat, and Starburst. Huge variety - We have a huge variety of candies including hard candy, chocolate, candy bars, fruit candy, chewy candy, sugar free candy, and more. Chewing gum and mints - We have chewing gum, bubble gum, and mints for freshening your breath and pleasure. Popular brands and flavors - We have a large selection of your favorite brands and flavors of candy.", "parent_text": "Coffee | Water | Snacks", "keyword_density": {"mint": "2.2", "gum": "3.3", "candy": "6.5"}, "department_id": 18}
