{"department_text": "Coffee | Water | Snacks", "nr_products": 8, "level": -1, "url": "http://www.staples.com/Straws-Picks-Skewers/cat_CL167777", "text": "Straws/Picks/Skewers", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Straws/Picks/Skewers", "parent_url": "http://www.staples.com/Plates-Cups-Cutlery/cat_DP1621", "keyword_count": {"straws": 5}, "description_wc": 132, "description_text": "Stock up on straws to keep your customers happy. Whether you need sipper versions for cocktails or jumbo versions for extra-large sodas, manufacturers like Berkley Square, Boardwalk, and Dixie have you covered. Choose from colorful varieties or classic translucent straws. Sanitary Drinking Customers enjoy using straws because they are sanitary and convenient. If you serve drinks to go, don't forget to also stock up on slot lids for your cups. Ecologically Friendly Sipping Give customers peace of mind with sanitary and ecofriendly straws made of renewable and compostable corn. They look just like traditional straws but won't damage the environment. Easy Stirring If you typically serve coffee, tea, or other hot beverages, try offering stirrers that can be used for sipping. These stirrers also work well for mixed drinks.", "parent_text": "Plates / Cups / Cutlery", "keyword_density": {"straws": "3.8"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 4, "level": -1, "url": "http://www.staples.com/Jerky-Beef/cat_CL167089", "text": "Jerky & Beef", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Jerky & Beef", "parent_url": "http://www.staples.com/Snacks/cat_DP3722", "keyword_count": {"jerky": 5, "jerky beef": 4, "beef": 5}, "description_wc": 145, "description_text": "Jerky beef is a convenient snack for work or home. It comes in sticks and individual pieces, so you can choose the perfect amount to sate your hunger. Each type has a distinct flavor that hits the spot after a long day. Flavorful Each of our jerky beef options is designed to provide maximum flavor, so you can satisfy your hunger quickly. Choose from flavors including original, teriyaki, and mild. Convenient Packages Our jerky beef products come in convenient packages, so you can eat as much or as little as you want. Select from products like individually packaged beef sticks or organic jerky pieces that come in a resealable bag. Multiple Options Whether you prefer individual bags of jerky beef or large packs, we carry the perfect product for you. No matter which you prefer, you can wash it down with a refreshing soda .", "parent_text": "Snacks", "keyword_density": {"jerky": "3.5", "jerky beef": "5.6", "beef": "3.5"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 15, "level": -1, "url": "http://www.staples.com/Nutrition-Bars/cat_CL166198", "text": "Nutrition Bars", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Nutrition Bars", "parent_url": "http://www.staples.com/Snacks/cat_DP3722", "keyword_count": {"bars": 9}, "description_wc": 108, "description_text": "Curb your hunger and boost your energy with healthy snack options like protein bars, energy bars, and granola bars from brands including Nature Valley, Kind, Kashi, Nutri-Grain, Special K, Fiberplus, Balance Bar, Luna, Clif Bar, and Zone Perfect. Snack bars for every diet - We have snack bars for every diet with varying portions of protein, carbohydrates, and fiber. Flavors for every palate - Our snack bar flavors include strawberry, blueberry, apple cinnamon, oats & honey, peanut butter, chocolate, trail mix, and many more with both chewy and crunchy textures. Bars per box - Our snack bars come packaged with varying quantities from 8 bars to 18 bars in a pack.", "parent_text": "Snacks", "keyword_density": {"bars": "8.3"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 34, "level": -1, "url": "http://www.staples.com/Condiments/cat_CL166263", "text": "Condiments", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Condiments", "parent_url": "http://www.staples.com/Plates-Cups-Cutlery/cat_DP1621", "keyword_count": {"condiments": 3}, "description_wc": 66, "description_text": "Spice up and add flavor to your breakfast, lunch, and dinner meals with our condiments like salt, pepper, ketchup, mustard, and mayonnaise. We offer condiments produced by the Snax brand. Order in bulk - Stock up on common condiments like ketchup and mustard with 200 packet boxes. Easy tear packets - Conveniently add flavor to your meal with 4.5, 7, and 9 gram packets designed for adequate portions.", "parent_text": "Plates / Cups / Cutlery", "keyword_density": {"condiments": "4.5"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 5, "level": -1, "url": "http://www.staples.com/Cup-Dispensers/cat_CL167774", "text": "Cup Dispensers", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Cup Dispensers", "parent_url": "http://www.staples.com/Plates-Cups-Cutlery/cat_DP1621", "keyword_count": {"dispensers": 5, "cup dispensers": 4, "cup": 10}, "description_wc": 164, "description_text": "Cup dispensers are a convenient place to store and organize cups. They offer protection, so you can use cups without worrying about dust or germs. Whether you are supplying an office or a home, choosing the right type of dispenser can make your life easier and more efficient. Protection Our stainless-steel and plastic cup dispensers protect the cups you use for water, coffee, and other beverages. Tube-style dispensers from companies like San Jamar keep dust out, so you can enjoy your drink without grime. Convenience Cup dispensers keep your cups in one place, so you'll always know where to find them. The easy dispensing functions enable family members and employees to grab cups quickly with a single pull. Multiple Mounting Options Our cup dispensers are available with wall-mounting hardware or in tabletop designs, so you can select the best one for your home or office. If it is mounted near a coffee machine, fill your dispenser with hot cups .", "parent_text": "Plates / Cups / Cutlery", "keyword_density": {"dispensers": "3.1", "cup dispensers": "4.9", "cup": "6.1"}, "department_id": 18}
