{"department_text": "Coffee | Water | Snacks", "nr_products": 59, "level": -1, "url": "http://www.staples.com/Gum-Mints-Cough-Drops/cat_CL163188", "text": "Gum / Mints / Cough Drops", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Gum / Mints / Cough Drops", "parent_url": "http://www.staples.com/Candy-Gum-Mint/cat_DP4695", "keyword_count": {"cough drops": 1, "mints": 1, "gum": 9}, "description_wc": 121, "description_text": "For a quick breath freshener and sweet treat, we have a large selection of candy and gum including mints, chewing gum, bubble gum, whitening gum, cough drops, and more. We carry gum and mint brands including Lifesavers, Mentos, Orbit, 5 gum, Dubble Bubble, Trident, Wrigley, Dentyne, Stride, Chiclets, Halls, and Ricola. Chew your way - We have a variety of chewing gum whether you like to chew for the flavor, the bubbles, or as a freshener. Individually wrapped in bulk - Stock up on your favorite gum and candy brands and save by buying individually wrapped pieces and sticks in bulk. Any time, any occasion - Our selection of chewing gum and candies is perfect for hospitality, Halloween, or your own personal sweet tooth.", "parent_text": "Candy / Gum / Mint", "keyword_density": {"cough drops": "1.7", "gum": "7.4", "mints": "0.8"}, "department_id": 18}
