{"department_text": "Coffee | Water | Snacks", "nr_products": 23, "level": -1, "url": "http://www.staples.com/Sugar-Free-Candy/cat_CL166359", "text": "Sugar-Free Candy", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Sugar-Free Candy", "parent_url": "http://www.staples.com/Candy-Gum-Mint/cat_DP4695", "keyword_count": {"sugar free": 3, "sugar": 7}, "description_wc": 121, "description_text": "Have a sweet tooth but need to keep down on the sugar? We have an assortment of low calorie and sugar free gum sticks and pieces to satisfy your cravings without adding sugar to your diet. Our sugar free brands include Dentyne, Mentos, Wrigley, Trident, and Orbit. Freshening flavors - Select from several sugar free gum flavors including cool rush, spearmint, peppermint, arctic chill, pure mint, bubblemint, fresh mint, pure wintergreen, rain, cobalt, and flare. Save buying bulk - Stock up on sugarless gum and save money buying bulk with packaging containing ten to twelve packs per box. Whiten while you chew - Not only are you protecting your teeth by chewing sugarless gum, Trident White gum helps whiten your teeth and prevent stains.", "parent_text": "Candy / Gum / Mint", "keyword_density": {"sugar free": "5.0", "sugar": "5.8"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 104, "level": -1, "url": "http://www.staples.com/Food-Storage-Bags-Supplies/cat_CL142181", "text": "Food Storage Bags & Supplies", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Food Storage Bags & Supplies", "parent_url": "http://www.staples.com/Plates-Cups-Cutlery/cat_DP1621", "keyword_count": {"food": 7, "bags": 3, "food storage": 4, "storage": 6, "storage bags": 1}, "description_wc": 124, "description_text": "Keep food fresh with high-quality food storage containers and resealable plastic bags. Staples carries everything from reusable plastic containers to plastic wrap so you can store food longer and take it with you on the go. Brands \u2013 Find your favorite storage containers from brands like Ziploc, Gladware, and Foodsaver. Variety \u2013 Whether it's plastic containers, vacuum-sealed storage bags, or foil wrap, the wide variety of food storage products at Staples means we have just what you're looking for. Sizes \u2013 Shop for bags and containers in a variety sizes to serve all your food storage needs. At Staples, we make it easy to find the right food storage products. Enjoy even more value with extras like table covers and salt & pepper mills.", "parent_text": "Plates / Cups / Cutlery", "keyword_density": {"food": "5.6", "bags": "2.4", "food storage": "6.5", "storage": "4.8", "storage bags": "1.6"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 170, "level": -1, "url": "http://www.staples.com/Chocolate-Candy/cat_CL165434", "text": "Chocolate Candy", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Chocolate Candy", "parent_url": "http://www.staples.com/Candy-Gum-Mint/cat_DP4695", "keyword_count": {"candy": 2, "chocolate": 4}, "description_wc": 99, "description_text": "Stock up on your favorite chocolate candies individually wrapped and in resealable bags. We have a large variety of chocolate flavors and candies from brands including M&Ms, Snickers, Milk Way, Reeses, Hersheys, Kit Kat, Flipz, Skinny Cow, Three Musketeers, Twix, and Whoppers. Various flavors, sizes, and shapes - Our chewy chocolate candies and candy bars come with a variety of ingredients and flavors including caramel, peanuts, peanut butter, almonds, and more. Packaging and boxes - Our selection of chocolate candies and candy bars come individually wrapped or in resealable bags and come with a dozen or more packs per box.", "parent_text": "Candy / Gum / Mint", "keyword_density": {"candy": "2.0", "chocolate": "4.0"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 100, "level": -1, "url": "http://www.staples.com/Hard-Candy/cat_CL165436", "text": "Hard Candy", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Hard Candy", "parent_url": "http://www.staples.com/Candy-Gum-Mint/cat_DP4695", "keyword_count": {"hard": 5, "candy": 6, "hard candy": 4}, "description_wc": 116, "description_text": "We have a variety of individually wrapped and bulk hard candy perfect for stocking up your home or office. Satisfy your sweet tooth with one of the many brands we carry including Jolly Ranger, Werthers, Tootsie Roll, Dum Dum, Charms, Crunch Time, and Fruitfuls. Long lasting flavors - Choose from a variety of hard candy flavors like peppermint, cherry, grape, sour apple, strawberry, butter,and many more. Hard outside, chewy inside - We have a variety of flavors of blow pops and tootsie roll pops with a hard candy outside and a chewy candy inside. Other hard candy filling includes nuts and almonds. Buy in bulk - Save by buying large quantities of both individually wrapped candy and resealable containers.", "parent_text": "Candy / Gum / Mint", "keyword_density": {"hard": "4.3", "hard candy": "6.9", "candy": "5.2"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 102, "level": -1, "url": "http://www.staples.com/Chewy-Candy/cat_CL165435", "text": "Chewy Candy", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Chewy Candy", "parent_url": "http://www.staples.com/Candy-Gum-Mint/cat_DP4695", "keyword_count": {"chewy candy": 2, "chewy": 4, "candy": 6}, "description_wc": 107, "description_text": "Stock up on your favorite chewy candies including fruity, caramel, chocolate, minty, and many other flavors. We carry the best chewy candy brands like Sour Patch Kids, Starburst, Skittles, Twizzlers, Laffy Taffy, Tootsie Roll, Swedish Fish, Nestle, and Darrell Lea. Sweet or sour - We carry chewy candies for different tastes including sweet candy like gummy bears and sour candy like sour patch kids. Assorted shapes and packaging - We have chewy candy in many different shapes like the Swedish fish, bears, assorted fish, beans, and more. Individually wrapped assortment bags - For a variety of flavors, we have assortment packs of candy that come with individually wrapped candy pieces.", "parent_text": "Candy / Gum / Mint", "keyword_density": {"chewy candy": "3.7", "chewy": "3.7", "candy": "5.6"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 60, "level": -1, "url": "http://www.staples.com/Cutlery/cat_CL142176", "text": "Cutlery", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Cutlery", "parent_url": "http://www.staples.com/Plates-Cups-Cutlery/cat_DP1621", "keyword_count": {"cutlery": 8}, "description_wc": 131, "description_text": "Find high-quality plastic cutlery at everyday low prices. Whether it's for a specific event or just inventory to keep on hand, Staples offers a wide assortment of kitchen cutlery and eating utensils for any use. Consider the following when browsing our selection of disposable cutlery: Weight \u2013 Choose the right cutlery for the occasion. Our selection includes medium weight and heavy-duty cutlery for all kinds of events. Assortment \u2013 Staples carries plastic knives, forks, and spoons so you can find all the plastic flatware items you need. Colors \u2013 From clear plastic to white or black plastic cutlery, we make it easy to choose the right utensils. Shop at Staples when you need quality cutlery at great prices. Our cutlery is available in high-volume packs for the best possible savings.", "parent_text": "Plates / Cups / Cutlery", "keyword_density": {"cutlery": "6.1"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 70, "level": -1, "url": "http://www.staples.com/Paper-Plates-Bowls/cat_CL142178", "text": "Plates & Bowls", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Plates & Bowls", "parent_url": "http://www.staples.com/Plates-Cups-Cutlery/cat_DP1621", "keyword_count": {"plates": 13, "bowls": 2}, "description_wc": 138, "description_text": "Find quality paper plates from the brands you trust most. The excellent variety of paper plates and plastic plates at Staples makes it easy to choose the right plate for your next event. Here's what to look for when browsing our selection of paper plates; Assortment \u2013 Choose from white plates, compostable plates, plastic plates, red plastic plates, party bowls, and more. Sizes \u2013 Find everything from 12 oz. bowls to 7\" and 8.5\" diameter plates. Once you've chosen a product, enjoy even more value when you buy by the pack or the case. Brands \u2013 Staples carries all the brands you trust. Find paper plates and plastic plates from Dixie, Solo, Chinet, and others. Add the right touch to your next event with high-quality paper plates. Let us help you choose the best plates for your needs.", "parent_text": "Plates / Cups / Cutlery", "keyword_density": {"plates": "9.4", "bowls": "1.4"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 71, "level": -1, "url": "http://www.staples.com/Hot-Cups/cat_CL142175", "text": "Hot Cups", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Hot Cups", "parent_url": "http://www.staples.com/Plates-Cups-Cutlery/cat_DP1621", "keyword_count": {"hot cups": 2, "hot": 3, "cups": 12}, "description_wc": 121, "description_text": "Disposable coffee cups keep drinks hot and make it easy to enjoy beverages on the go. Shop Staples for all the disposable coffee cups you need. We even offer accessories like coffee cup sleeves and lids. Variety \u2013 Find styrofoam cups, insulated cups, paper hot cups, and more. Staples carries exactly the coffee cups you're looking for. Sizes \u2013 We carry hot cups in 8, 10, and 12 oz. sizes. Shop for coffee cups by the pack or the case. Extras \u2013 Choose from insulated cups, cups with lids and sleeves, or recycled products. Get the right disposable coffee cups at the volume that fits your needs. Our wide selection makes it easy to find coffee cups for your office or commercial facility.", "parent_text": "Plates / Cups / Cutlery", "keyword_density": {"hot cups": "3.3", "hot": "2.5", "cups": "9.9"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 81, "level": -1, "url": "http://www.staples.com/Cold-Cups/cat_CL164880", "text": "Cold Cups", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Cold Cups", "parent_url": "http://www.staples.com/Plates-Cups-Cutlery/cat_DP1621", "keyword_count": {"cold": 1, "cups": 11}, "description_wc": 130, "description_text": "Paper cups and plastic cups are portable and convenient. Our wide selection of cups makes it easy to choose exactly the product you're looking for. Here are some factors to keep in mind when shopping for paper cups and plastic cups at Staples: Brands \u2013 Find better value for the brands you trust. We carry all your favorite Solo cups and Dixie cups at everyday low prices. Variety \u2013 Whether it's clear plastic cups, eco cold drink cups, or paper cone cups, Staples helps you find exactly what you need. Sizes \u2013 Choose from an assortment of high volume packs for the best value and savings. We offer high-quality paper cups for all settings and occasions. Browse our selection and choose the disposable cup products that best fit your needs.", "parent_text": "Plates / Cups / Cutlery", "keyword_density": {"cold": "0.8", "cups": "8.5"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 35, "level": -1, "url": "http://www.staples.com/Chips-Crackers/cat_CL166197", "text": "Chips & Crackers", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Chips & Crackers", "parent_url": "http://www.staples.com/Snacks/cat_DP3722", "keyword_count": {"crackers": 3, "chips": 5}, "description_wc": 109, "description_text": "Keep everyone in the office happy with all of your favorite snack brands including Doritos, Chex Mix, Cheetos, Pringles, Tostitos, Ritz Crackers, Goldfish, Fritos, Frito Lay, Popchips, Cheez-it, Keebler, Pepperidge Farm, Jack Links, and more. Variety packs - Keep your taste buds excited with variety packs with individual bags of a half dozen different snack flavors. Bite size snacks, grab-and-go bags - Our large selection of snacks and chips are bite size and portioned perfectly to satisfy your hunger. A snack for everyone - We have a snack for everyone including favorites like sun chips, corn chips, cheese crackers, peanut butter crackers, beef sticks, goldfish, potato chips, and more.", "parent_text": "Snacks", "keyword_density": {"crackers": "2.8", "chips": "4.6"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 29, "level": -1, "url": "http://www.staples.com/Cookies/cat_CL163189", "text": "Cookies", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Cookies", "parent_url": "http://www.staples.com/Snacks/cat_DP3722", "keyword_count": {"cookies": 4}, "description_wc": 99, "description_text": "Treat yourself and satisfy your sweet tooth with cookies and treats of all flavors and sizes. We carry all of your favorite cookie brands like Grandmas cookies, Mrs. Fileds, Walker, Nabisco, Rice Krispie, Chips Ahoy, Famous Amos, Oreo, Newtons, and Royal. Enjoy a variety of cookies - We have a large selection of cookie flavors including peanut butter, sugar, chocolate chip, oatmeal, oreo, shortbread, butter, chocolate, wafers, and more. We also have other treats like fig newtons, animal crackers, Pirouline, and rice krispies treats. Convenient snack packs - Our cookies come wrapped conveniently in a portioned snack pack for quick snacking.", "parent_text": "Snacks", "keyword_density": {"cookies": "4.0"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 33, "level": -1, "url": "http://www.staples.com/Popcorn-Pretzels-Nuts/cat_CL163190", "text": "Popcorn / Pretzels / Nuts", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Popcorn / Pretzels / Nuts", "parent_url": "http://www.staples.com/Snacks/cat_DP3722", "keyword_count": {"popcorn": 1, "nuts": 5, "pretzels": 1}, "description_wc": 107, "description_text": "Make meetings more productive with snacks including nuts, sunflower seeds, beef jerky, almonds, walnuts, pretzels, pecans, cashews, trail mix, jack links, mixed nuts, and peanuts. We have snack brands including Emerald, Planters, Anderson, Act II, Pretzel Crisps, Jack Links, Kars, Combos, Diamond, and Davids. Choose your snack type - We have a large selection of convenience snacks to satisfy your hunger whether you like popcorn, nuts, or trail mix. Package sizes - We have snacks in various package sizes to fit your needs like sealable containers and disposable packaging. Healthy and portioned snacks - Browse our low calorie and healthy snack options to satisfy your hunger for your healthy lifestyle.", "parent_text": "Snacks", "keyword_density": {"popcorn": "0.9", "nuts": "4.7", "pretzels": "0.9"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 9, "level": -1, "url": "http://www.staples.com/Lunch/cat_CL163192", "text": "Lunch", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Lunch", "parent_url": "http://www.staples.com/Snacks/cat_DP3722", "keyword_count": {"lunch": 5}, "description_wc": 111, "description_text": "We have a variety of convenient and quick lunch foods and snacks like soup, microwave meals, and crackers with tuna. We have on-the-go and healthy lunch brands like Bumble Bee, Campbells, Kraft, Lipton, and Healthy Choice. Meals in under 5 minutes - Our lunch foods and snacks like ramen noodles, easy mac, and chicken noodle soup are easy to prepare and begin eating in under 5 minutes. Ready to eat meals - Bumble Bee and GoPicnic ready to eat meals are healthy lunch options that require no preparation or appliances. Buy in bulk - Stock up and save at the same time by buying convenient and healthy lunch foods in bulk quantities.", "parent_text": "Snacks", "keyword_density": {"lunch": "4.5"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 46, "level": -1, "url": "http://www.staples.com/Healthy-Snacks/cat_CL163191", "text": "Healthy Snacks", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Healthy Snacks", "parent_url": "http://www.staples.com/Snacks/cat_DP3722", "keyword_count": {"healthy": 5, "healthy snacks": 1, "snacks": 6}, "description_wc": 121, "description_text": "Have a happy and healthy office with convenient finger foods and the best healthy snacks like assorted nuts, granola bars, pretzels, and more. We have smart snacks from brands like Luna, Zone Perfect, Crunch Time, Kars, Planters, Pretzel Crisps, Diamond, Popchips, Welchs, Nabisco, Kind, Quaker, Motts, and Sensible Snacks. Healthy snacking - Feed your hunger and your body with a healthy lifestyle including smart snacks that are low in fat and satisfying. Snack your way - Snacking healthy doesn\u2019t have to be boring or tasteless. Choose from our variety of chips, nuts, cinnamon sticks, trail mix, fruity snacks, and many more. Curb your hunger - Eating reasonable portioned snacks throughout the day helps curb your hunger, boost your metabolism, and restore your energy.", "parent_text": "Snacks", "keyword_density": {"healthy": "4.1", "healthy snacks": "1.7", "snacks": "5.0"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 21, "level": -1, "url": "http://www.staples.com/Breakfast/cat_CL164881", "text": "Breakfast", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Breakfast", "parent_url": "http://www.staples.com/Snacks/cat_DP3722", "keyword_count": {"breakfast": 6}, "description_wc": 106, "description_text": "Start your morning out right on a full stomach with quick and simple office breakfast foods like cereal, oatmeal, pop tarts, and many more. Shop for your favorite breakfast brands like Nature Valley, Pop Tarts, Special K, Carnation, Cheerios, N\u2019 Joy, Nutri Grain, Quaker, and Lucky Charms. Breakfast snacks - For a light breakfast or before lunch snack, we have cereal bars, rice krispies treats, and nutri-grain and nature valley granola bars. Instant breakfast meals - For busy mornings, we have instant breakfast meals like Carnation\u2019s To-Go bottles and Pop-Tarts. Morning favorites - With little preparation, enjoy your morning favorites like cereals and oat meals.", "parent_text": "Snacks", "keyword_density": {"breakfast": "5.7"}, "department_id": 18}
{"department_text": "Safety Supplies", "level": -1, "url": "http://www.staples.com/Footwear-Covers/cat_DP5091", "text": "Footwear & Covers", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Footwear & Covers", "parent_url": "http://www.staples.com/Personal-Protective-Equipment-PPE/cat_CG1398", "keyword_count": {"footwear": 1, "covers": 5}, "description_wc": 188, "description_text": "Protective footwear and covers for shoes include boots that protect you and your employees when you work in wet or cold conditions and covers for shoes that prevent tracking dirt onto clean floors. Choose from boots for working in slush or mud conditions, boots with steel toes to prevent damage from falling objects, or insulated boots for cold weather. Both disposable and reusable covers are available. Protect Your Feet Rubber boots keep water and chemical solutions away from your feet. Insulated rubber boots are made with layers of material that keep your feet warm even in the snow. Protect Your Floors Wear elastic-topped shoe covers from DuPont over your shoes, and keep a supply around for your staff and visitors to keep your floors clean and free of dirt. They are ideal for food service and medical use. Use disinfectants to clean floors and maintain top health standards. Protect Your Shoes Overboots, and leather chaps and spats by Anchor, protect your shoes and pants legs when you're working outdoors. Staples offers traction foot covers that you can wear on your shoes to walk on icy surfaces.", "parent_text": "Personal Protective Equipment (PPE)", "keyword_density": {"footwear": "0.5", "covers": "2.7"}, "department_id": 16}
{"department_text": "Safety Supplies", "level": -1, "url": "http://www.staples.com/Ergonomics/cat_DP5092", "text": "Ergonomics", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Ergonomics", "parent_url": "http://www.staples.com/Personal-Protective-Equipment-PPE/cat_CG1398", "keyword_count": {}, "description_wc": 36, "description_text": "Body and back supports are an economical way to prevent back problems and injuries when sustained or intense labor is required. Reduce injury with ergonomic body and back supports from top brands like Ergodyne and ProGuard.", "parent_text": "Personal Protective Equipment (PPE)", "keyword_density": {}, "department_id": 16}
{"department_text": "Safety Supplies", "level": -1, "url": "http://www.staples.com/Head-Protection/cat_DP5087", "text": "Head Protection", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Head Protection", "parent_url": "http://www.staples.com/Personal-Protective-Equipment-PPE/cat_CG1398", "keyword_count": {"head protection": 1, "head": 3}, "description_wc": 107, "description_text": "Protecting the face, eyes, and head is important for employee safety as well as meeting regulations and standards. Keep your employees protected from falling debris, excessive heat or cold, and other dangers in the workplace with reliable head protection and hats. Protect your face. Pick from many face shields that meet ANSI safety standards with various sizes, colors, materials, and assembly. Protect your head. We have a large selection of hard hats, welding helmets, and hard hat liners. Be prepared for high or low temperatures . For jobs that are frequently outdoors throughout the year, browse through bandanas and winter liners to prepare for extremes in temperature.", "parent_text": "Personal Protective Equipment (PPE)", "keyword_density": {"head protection": "1.9", "head": "2.8"}, "department_id": 16}
{"level": -1, "url": "http://www.staples.com/Ear-Protection/cat_DP5095", "text": "Ear Protection", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_wc": 0, "parent_url": "http://www.staples.com/Personal-Protective-Equipment-PPE/cat_CG1398", "parent_text": "Personal Protective Equipment (PPE)", "department_text": "Safety Supplies", "department_id": 16}
{"department_text": "Safety Supplies", "level": -1, "url": "http://www.staples.com/Face-Protection/cat_DP5080", "text": "Face Protection", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Face Protection", "parent_url": "http://www.staples.com/Personal-Protective-Equipment-PPE/cat_CG1398", "keyword_count": {"face": 3}, "description_wc": 127, "description_text": "Many work environments pose the risk of poor air quality with a shortage of oxygen, harmful dust, various gasses, smoke and fog, and other substances that are unhealthy to inhale. Whether you are grinding, sanding, drilling, welding, or mixing solvents, Staples has top brands like 3M, MSA, Sperian, North Safety, and Moldex to meet your needs. Filter unwanted pollutants . Protect workers in oxygen compromised environments and avoid inhaling unwanted pollutants like airborne particulates, fumes, vapors, and gases. Adjustable and comfortable . We have a large variety of heavy duty and simple face masks and respirators that are adjustable for comfort and convenience. Protect your lungs and eyes . Choose from a large variety of respirators like disposable, full facepiece, half facepiece, particulate, and gas and vapor.", "parent_text": "Personal Protective Equipment (PPE)", "keyword_density": {"face": "2.4"}, "department_id": 16}
