{"department_text": "Safety Supplies", "level": -1, "url": "http://www.staples.com/Gloves/cat_DP5084", "text": "Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Gloves", "parent_url": "http://www.staples.com/Personal-Protective-Equipment-PPE/cat_CG1398", "keyword_count": {"gloves": 5}, "description_wc": 150, "description_text": "Gloves are a crucial workplace accessory. Whether your workers handle harsh chemicals, perform heavy-duty maintenance, or work with infected patients, gloves help to protect their hands from abrasion, irritation, and infection. Coated, high-dexterity, and heat-resistant gloves are all available. Variety Gloves come in a variety of materials, including latex, leather, nitrile, and PVC, so you can find just what you need for your type of business. There is also a range of sizes available to fit all of your workers. Convenient Disposable gloves let you keep a supply handy without having to worry about keeping up with the office laundry, and are an incredibly versatile option. Glove dispensers are also available, to add to the convenience. Latex-Free Your employees or clients may be sensitive to certain materials. Our glove selection includes latex-free and knit options so you can make sure you have something for everyone.", "parent_text": "Personal Protective Equipment (PPE)", "keyword_density": {"gloves": "3.3"}, "department_id": 16}
