{"department_text": "Safety Supplies", "nr_products": 5, "level": -2, "url": "http://www.staples.com/Shoe-Covers/cat_CL167042", "text": "Shoe Covers", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Shoe Covers", "parent_url": "http://www.staples.com/Footwear-Covers/cat_DP5091", "keyword_count": {"shoe covers": 1, "shoe": 5, "covers": 6}, "description_wc": 176, "description_text": "Footwear covers provide a barrier between your shoes and the wet and dirty messes that are often a part of working in places such as warehouses and hospitals. Keep your employees protected by providing elastic shoe covers that they can remove and throw out at the end of the day. Pick a larger size boot cover if your employees regularly wear work boots on the job. Adjustable Fit Footwear covers for shoes and boots come in sizes that range from small to extra large. Elastic openings ensure that each size adjusts to fit a range of shoe styles. Flexible Protection Made of special materials that create a barrier between your footwear and liquids and particles, footwear covers are soft and flexible but strong enough for the messiest work environment. Wear a pair of disposable gloves for the same level of protection for your hands. Versatile Options Footwear covers include options that can also protect your upper and lower legs, such as chaps and leggings. Combine these products with disposable shoe and boot covers for maximum protection.", "parent_text": "Footwear & Covers", "keyword_density": {"shoe covers": "1.1", "shoe": "2.8", "covers": "3.4"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 10, "level": -2, "url": "http://www.staples.com/Welder-Caps-Doo-Rags/cat_CL167016", "text": "Welder Caps & Doo Rags", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Welder Caps & Doo Rags", "parent_url": "http://www.staples.com/Head-Protection/cat_DP5087", "keyword_count": {"welder": 5, "welder caps": 4, "doo rags": 4, "caps": 6}, "description_wc": 135, "description_text": "Welder caps and doo rags make wearing welder's gear more comfortable. Made with cotton or other comfortable materials, they are perfect for tying back your hair and keeping sweat out of your eyes. Made in a variety of styles and colors, these caps are unique and fun. Protect Yourself In construction, you need head protection . Welder caps and doo rags make it easier to keep your skin safe from the heat. Varying Sizes Welder caps and doo rags come in a variety of sizes, so you'll find one that fits. With or without brims, the caps are ideal for use with other welding gear. Comfort Made with cotton and other soft materials, welder caps and doo rags are comfortable to wear during the work day. A choice of designs are available too.", "parent_text": "Head Protection", "keyword_density": {"welder": "3.7", "doo rags": "6.0", "welder caps": "6.0", "caps": "4.5"}, "department_id": 16}
{"nr_products": 15, "level": -1, "url": "http://www.staples.com/Hoists-Winches-Pullers/cat_CL167062", "text": "Hoists, Winches & Pullers", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_wc": 0, "parent_url": "http://www.staples.com/Material-Handling/cat_CG1365", "parent_text": "Material Handling", "department_text": "Safety Supplies", "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 32, "level": -2, "url": "http://www.staples.com/Elbow-Knee-Pads/cat_CL167044", "text": "Elbow & Knee Pads", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Elbow & Knee Pads", "parent_url": "http://www.staples.com/Ergonomics/cat_DP5092", "keyword_count": {"elbow": 2, "knee": 2, "pads": 4}, "description_wc": 149, "description_text": "Knee and elbow pads are typically filled with a foam or gel substance that reduces impact. This can mean the difference between a bruise or broken skin in an accident. Some modern pads combine foam and gel for even greater protection. Sit Comfortably Longer Knee and elbow pads help you remain in position longer when working in awkward positions. This includes when you're adjusting fittings under a sink or spending time working on a vehicle. Decrease Injury from Lifting Some items have to be installed or mounted at just the right angle. Angular levels can help with this. Those who need additional support for heavy lifting or sitting for long periods should check out back supports . Reduce Repetitive Motion Injuries Even when weight isn't a factor, the repetition of certain movements can lead to strains and injuries. Pads and supports help reduce instances of repetitive injuries.", "parent_text": "Ergonomics", "keyword_density": {"elbow": "1.4", "knee": "1.4", "pads": "2.7"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 66, "level": -2, "url": "http://www.staples.com/Welding-Helmet-Parts-Accessories/cat_CL167022", "text": "Welding Helmet Parts & Accessories", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Welding Helmet Parts & Accessories", "parent_url": "http://www.staples.com/Head-Protection/cat_DP5087", "keyword_count": {"helmet": 5, "parts": 5, "accessories": 7, "welding": 5, "welding helmet parts": 4}, "description_wc": 190, "description_text": "Welding helmet parts and accessories enable you to change the safety parameters of your protective headgear to meet the needs of the job at hand. Interchangeable filter plates and magnifier lenses help you customize your standard equipment. Manufactured by leading companies such as Anchor, these parts and accessories are designed for convenient use by professional or amateur welders. Added Protection Selecting the right welding helmet parts and accessories adds another layer of protection when you're working under dangerous conditions. Gold filter plate accessories reflect harmful infrared rays, while polycarbonate magnifying lenses make it easier to see small items. Long-Lasting Use A variety of interchangeable welding helmet parts and accessories ensures your basic headgear lasts for years. These safety- and comfort-based accessories come in handy if a part breaks or if you find your helmet doesn't fit right and needs additional padding. Portable Convenience Use a custom bag to carry all of your welding helmet parts and accessories, so you'll have everything you need for the job. Add a pair of welding gloves to your kit to ensure your hands stay as safe as your head.", "parent_text": "Head Protection", "keyword_density": {"helmet": "2.6", "parts": "2.6", "accessories": "3.7", "welding helmet parts": "6.3", "welding": "2.6"}, "department_id": 16}
