{"department_text": "Safety Supplies", "nr_products": 52, "level": -2, "url": "http://www.staples.com/Welding-Helmets/cat_CL167024", "text": "Welding Helmets", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Welding Helmets", "parent_url": "http://www.staples.com/Head-Protection/cat_DP5087", "keyword_count": {"welding helmets": 4, "welding": 8, "helmets": 5}, "description_wc": 142, "description_text": "Welding helmets are an important safety requirement in workshops that rely on welding. Arc welders and spot welders alike benefit from the protection provided by a helmet. Small construction or repair businesses should have helmets for anyone working with dangerous welding equipment. Shield Your Face Welding helmets shield your face in a manner similar to welding masks. They also feature a hardened cowl that protects your neck and shoulders from exposure to hot metals. Stay Safe in the Workplace Safety is a major concern for many construction businesses. Welding helmets are only part of the solution. Check out hardhats and caps for protection in other areas of the worksite. Protect Your Eyes The light given off during the welding process can lead to ocular damage. Protect your eyes with welding helmets that include special polarized lenses as well as hardened physical protection.", "parent_text": "Head Protection", "keyword_density": {"welding helmets": "5.6", "helmets": "3.5", "welding": "5.6"}, "department_id": 16}
{"nr_products": 43, "level": -2, "url": "http://www.staples.com/Face-Shields-Visors/cat_CL166863", "text": "Face Shields & Visors", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_wc": 0, "parent_url": "http://www.staples.com/Face-Protection/cat_DP5080", "parent_text": "Face Protection", "department_text": "Safety Supplies", "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 12, "level": -2, "url": "http://www.staples.com/Work-Gloves/cat_CL167009", "text": "Work Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Work Gloves", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"work gloves": 3, "work": 7, "gloves": 10}, "description_wc": 160, "description_text": "Slip on some work gloves before you start handling dangerous materials and ensure that your fingers and palms stay well protected. Choose from a variety of materials at a range of prices to get the right kind of protection. When your job involves working with your hands, a good pair of work gloves is essential. Cotton Comfort Cotton work gloves offer both comfort and convenience while you work. These gloves are ideal for outdoor work and situations where you won't typically encounter dangerous chemicals or sharp objects. Protective Materials When you need serious hand protection, opt for gloves made of sturdy polyurethane, Kevlar, or neoprene. These gloves are an important component of safety at construction sites, chemical facilities, and other workplaces. Lightweight and Convenient Lightweight inspector gloves and latex gloves let you manipulate objects with your fingers without your gloves getting in the way. Disposable single-use gloves come in large packs that keep you stocked for a while.", "parent_text": "Gloves", "keyword_density": {"work gloves": "3.8", "work": "4.4", "gloves": "6.2"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 27, "level": -2, "url": "http://www.staples.com/Sleeves-Bibs/cat_CL167047", "text": "Sleeves & Bibs", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Sleeves & Bibs", "parent_url": "http://www.staples.com/Workwear-Rainwear/cat_DP5090", "keyword_count": {"bibs": 5, "sleeves": 5}, "description_wc": 163, "description_text": "Sleeves and bibs prevent messy and unsanitary work conditions from ruining uniforms and endangering your health. Made from nonporous materials that create a barrier between you and liquids, sleeves and bibs are the economical way to stay clean. Anchor Brand and Dupont are only two of the brands that offer a selection of this type of protective gear. Efficient Protection Sleeves and bibs are designed to cover the part of body that will encounter the mess. You don't have to waste time putting on an entire outfit when a sleeve is enough to do the job. Easy Sizing With elastic ends and Velcro closures, sleeves and bibs can fit a wide range of sizes. Pick a size range from small to extra large and adjust your protective gear to your own dimensions. Stay Sanitary Keep a supply of disposable sleeves and bibs on hand for messy jobs where sanitary conditions are important. Use your body covers with disposable gloves for greater protection.", "parent_text": "Workwear & Rainwear", "keyword_density": {"bibs": "3.1", "sleeves": "3.1"}, "department_id": 16}
