{"department_text": "Safety Supplies", "nr_products": 24, "level": -2, "url": "http://www.staples.com/Vinyl-Exam-Gloves/cat_CL168553", "text": "Vinyl Exam Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Vinyl Exam Gloves", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"vinyl exam gloves": 3, "gloves": 7}, "description_wc": 155, "description_text": "Vinyl exam gloves come in different sizes, so medical staff members can use the pairs that fit them best. There are latex-free styles for those with latex allergies, and you can also get disposable gloves that can be thrown away after one use. Protective Qualities In the world of medicine, vinyl exam gloves protect you from touching blood and other fluids. These can be worn before you apply adhesive bandages or dress wounds to keep your body clean and to prevent bacteria from entering the wounds of your patient. Comfortable Sizing The last thing you want to deal with is gloves that don't fit. Fortunately, vinyl exam gloves come in multiple sizes, including small, medium, large, and more. Disposable If you've been touching skin, fluids, or medicines, your gloves may become contaminated. That's why it's important to have gloves on hand that you can simply throw away after each use.", "parent_text": "Gloves", "keyword_density": {"vinyl exam gloves": "5.8", "gloves": "4.5"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 14, "level": -2, "url": "http://www.staples.com/Surgical-Gloves/cat_CL168549", "text": "Surgical Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Surgical Gloves", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"surgical": 4, "gloves": 11, "surgical gloves": 3}, "description_wc": 144, "description_text": "Wear surgical gloves whenever you need to maintain a sterile work space and prevent cross-contamination. These gloves also help you keep a grip on small tools-even under wet conditions. All surgical gloves are sealed to ensure sterility. Classic Latex Classic latex surgical gloves are easy to use and disposable, so you can grab a new pair whenever you need to get to work. Choose from white or colored gloves, or designate specific colors to specific members of your team. Latex-Free Options Gloves made of neoprene or other latex-free materials let you enjoy the same level of protection as latex gloves without worrying about allergic reactions. These gloves fit snugly for safety. Powder Alternatives Choose powdered gloves for added comfort, or opt for powder-free gloves. Pair your gloves with a surgical mask to further maintain the sterility of your environment.", "parent_text": "Gloves", "keyword_density": {"surgical": "2.8", "gloves": "7.6", "surgical gloves": "4.2"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 19, "level": -2, "url": "http://www.staples.com/Welding-Gloves/cat_CL167028", "text": "Welding Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Welding Gloves", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"gloves": 7, "welding gloves": 4, "welding": 6}, "description_wc": 169, "description_text": "Welding gloves are made with different materials, like split cowhide and leather, so you can use the kind that is comfortable for you. The gloves protect you against the heat from welding and from potential damage from tools. They come in different sizes, letting you find a pair that fits well. Safety When you're welding, welding gloves and protective eyewear are just some of the items you need. They keep your skin and body protected, so you can work safely. Color Choice and Materials Welding gloves come in different colors, like red or tan, so that you and your coworkers can have clearly different gloves if you'd prefer. You can get gloves made with leather or split cowhide and those that have high cuffs, short cuffs, and more. Different Sizes There are many sizes of welding gloves, so you can choose a pair that fits. There are small sizes for women and men with smaller hands and large pairs for those who have longer or wider hands.", "parent_text": "Gloves", "keyword_density": {"welding gloves": "4.7", "gloves": "4.1", "welding": "3.6"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 4, "level": -2, "url": "http://www.staples.com/PVC-Gloves/cat_CL167025", "text": "PVC Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "PVC Gloves", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"pvc gloves": 4}, "description_wc": 184, "description_text": "PVC gloves provide a durable layer of protection between your skin and workplace hazards, such as industrial chemicals. The latex-free design won't cause irritation and the gauntlet style offers coverage for your wrists. Brands like Memphis Glove provide several sizes and coating strengths for a comfortable fit and effective damage resistance. Prevent Workplace Accidents Provide the safest work environment for employees with protective equipment that prevents common incidents, including chemical burns and abrasions. PVC gloves are treated with a reliable coating that's resistant to liquids, punctures, temperature changes, and normal wear. Double Coating Provide your staff with double-dipped PVC gloves for tough jobs or frequent exposure to dangerous liquids and objects. The resilient material reduces the risk of serious injuries if workers are accidently poked by sharp materials. Nonslip Finish Choose PVC gloves with rough or sandy finishes to increase friction, preventing your workers from dropping slippery items. A firm grip is essential when carrying oils, acids, and other chemicals that create hazards when dropped. Keep your hands cushioned and avoid moisture buildup with options that feature jersey interior lining.", "parent_text": "Gloves", "keyword_density": {"pvc gloves": "4.3"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 37, "level": -2, "url": "http://www.staples.com/Nitrile-Exam-Gloves/cat_CL168524", "text": "Nitrile Exam Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Nitrile Exam Gloves", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"nitrile": 4, "gloves": 7, "exam": 3, "nitrile exam gloves": 2}, "description_wc": 195, "description_text": "Nitrile exam gloves offer a protective barrier against bodily fluids, giving you peace of mind if you're working in a fast-paced medical environment. They come in a variety of types and sizes, so you can choose the gloves that best fit your needs. You can even choose between sterile and nonsterile options, depending on what you'll be using them for. Latex and Powder Free Avoid the worry that comes from discovering your patient is allergic to latex by choosing a pair of latex-free nitrile exam gloves. You can also choose powder-free gloves designed for those who are sensitive to chemical additives. Extra Sensitivity and Textured Grip Nitrile gloves are thin but durable, so they'll give you the extra sensitivity to work confidently with the protection you need. Many come with textured grips that prevent your instruments from slipping, making your work faster and more efficient. Multiple Packs Nitrile gloves come in multipacks, so you can change them as often as needed. If you need quick access to gloves, you can stow a pack in a glove dispenser , which can be hung on the wall of your exam room.", "parent_text": "Gloves", "keyword_density": {"nitrile": "2.1", "gloves": "3.6", "exam": "1.5", "nitrile exam gloves": "3.1"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 15, "level": -2, "url": "http://www.staples.com/Latex-Exam-Gloves/cat_CL168515", "text": "Latex Exam Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Latex Exam Gloves", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"latex exam gloves": 1, "latex": 3, "gloves": 7, "exam": 3}, "description_wc": 189, "description_text": "Latex gloves are great accessories for cutting down on the transfer of germs while performing a medical examination or cleaning a minor cut or injury. The gloves come in a variety of sizes, with powdered or nonpowdered options available, so you can find the right fit for your needs. Made for single use, the gloves can be safely discarded in your office trash can. Multiple Sizes Whether your hands are small or large, you'll be able to find a pair of latex gloves that fits. Slip the gloves on, and you'll be ready to perform surgery or give an examination without worrying about spreading germs. Easy Fit If you're looking for an easy fit, some brands offer a powdered glove that slips onto your hand with ease. For those with sensitive skin, there are also nonpowdered alternatives available for your medical needs. Prevent the Spread of Germs Latex exam gloves are sterile, making them great for cleaning cuts or performing medical tasks without spreading germs. You can even keep a box of gloves in your office with your first-aid kit in case of an emergency.", "parent_text": "Gloves", "keyword_density": {"latex": "1.6", "gloves": "3.7", "latex exam gloves": "1.6", "exam": "1.6"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 15, "level": -2, "url": "http://www.staples.com/Leather-Palm-Gloves/cat_CL167030", "text": "Leather Palm Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Leather Palm Gloves", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"leather": 6, "gloves": 6, "leather palm gloves": 3}, "description_wc": 146, "description_text": "Wear leather palm gloves while hauling boxes, moving containers, or shifting inventory off pallets in the warehouse. These sturdy gloves protect your hands from cuts, abrasions, and debris. Choose from a variety of sizes to ensure you get a perfect fit. Thick Protective Leather The thick protective leather of these leather palm gloves makes them ideal for industrial or commercial worksites. Fingertip leather pads protect the most sensitive areas of your hands. Secure Cuffs Snug cuffs keep inclement weather and stray splashes out of your gloves, so you can work without worrying about things seeping in to affect your hands. The cuffs are flexible and comfortable, so they don't constrict your wrists either. Large Box These leather palm gloves come in packs designed to outfit everyone on your worksite. Look for boxes of 12 pairs of gloves to ensure that all employees are well protected.", "parent_text": "Gloves", "keyword_density": {"leather": "4.1", "gloves": "4.1", "leather palm gloves": "6.2"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 6, "level": -2, "url": "http://www.staples.com/String-Knit-Gloves/cat_CL167471", "text": "String Knit Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "String Knit Gloves", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"knit": 5, "gloves": 6, "string knit gloves": 4}, "description_wc": 181, "description_text": "String knit gloves offer protective benefits for low-risk tasks when keeping your hands clean and unscratched are top priorities. The lightweight fabric reduces moisture buildup and prevents friction damaging your skin. Avoid messy hands with fitted cuffs that keep out dirt and other particles. Well-Rounded Protection Whether you work in an agricultural setting or on a construction site, string knit gloves can provide extra coverage in uncomfortable temperatures or protect your fingers from dirt, oil, and scrapes. Anchor Brand, Memphis Glove, and other companies design string knit gloves made from soft, lightweight materials that reduce wear on your skin. Enhanced Grip For jobs that require a firmer grip, PVC-dot gloves feature a grid-like pattern of slip-resistant coating. PVC adds durability and increases friction, so you can safely lift and haul boxes or heavy equipment. Multiple Applications Wear string knit gloves under other types of protective gear to absorb sweat buildup under heavy materials. The breathable knit fabric balances the harshness of rubber work gloves, so you don't have to sacrifice comfort in hands-on occupations.", "parent_text": "Gloves", "keyword_density": {"gloves": "3.3", "knit": "2.8", "string knit gloves": "6.6"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 12, "level": -2, "url": "http://www.staples.com/High-Dexterity-Gloves/cat_CL167026", "text": "High Dexterity Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "High Dexterity Gloves", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"high dexterity gloves": 2, "gloves": 7}, "description_wc": 176, "description_text": "High-dexterity gloves will give you the full range of motion needed to work in an industrial area or warehouse. Put the gloves on when you're working on machines and perform the services needed to make repairs without cutting yourself. Many of these gloves are designed to resist abrasions and even feature textured palms to give you a better grip on your tools. Protect Your Hands from Shocks Put on your high-dexterity gloves before doing work and protect yourself from shock. Some brands offer gloves with vio-elastic gel polymer palm pads that'll absorb sudden shocks. Full Motion for Your Hands These gloves are designed with spandex to give you a full range of motion when you work. This way, you can reach into mechanical parts or boxes and grab onto accessories or supplies without being inhibited by your glove. Multiple Sizes No matter what your hand size, you'll be able to find a glove for you. These tear-resistant gloves will protect your hands from cuts or scrapes in the warehouse", "parent_text": "Gloves", "keyword_density": {"high dexterity gloves": "3.4", "gloves": "4.0"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 3, "level": -2, "url": "http://www.staples.com/High-Heat-Gloves/cat_CL167007", "text": "High Heat Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "High Heat Gloves", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"high heat gloves": 3, "high": 4, "heat": 4, "gloves": 6}, "description_wc": 167, "description_text": "Using high-heat gloves when you're working with high temperatures will help protect your hands from harm. You can find these gloves made with fiberglass, Kevlar, or cotton, so you can find the style suited for the temperatures you'll be facing. The gloves have different attributes, like cuffs or double-palmed layers that make them safe. Comfortable When you wear safety equipment , it's important that it's comfortable. These gloves are made with materials like cotton and Kevlar, so your hands will stay covered while feeling unrestricted. Different Sizes No one has hands exactly the same, which is why it's important to find high-heat gloves in your size. There are different sizes, including medium and large, to suit different widths and lengths of hands. Durability Some high-heat gloves have double palms, helping them last longer through long days with hot materials. Fiberglass, Kevlar, and cotton materials are strong against heat, so you can know your hands are protected from harm.", "parent_text": "Gloves", "keyword_density": {"high heat gloves": "5.4", "high": "2.4", "heat": "2.4", "gloves": "3.6"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Glove-Dispensers/cat_CL168501", "text": "Glove Dispensers", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Glove Dispensers", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"glove dispensers": 3, "dispensers": 4, "glove": 12}, "description_wc": 160, "description_text": "Glove dispensers make gloves available to doctors, nurses, and chemists, among others, without having to dig through drawers to find them. They are available as universal designs, wireframes, or clear dispensers, so you can tell which gloves you're choosing. They can be placed on the wall or on tables for your convenience. Gloves within Easy Reach If you're looking for ways to store gloves, the universal glove box holder is perfect for your office. It holds gloves where you can reach them, so you can use them while applying adhesive bandages or treating wounds. Simple Design The simple design of the glove dispensers makes them ideal for boxes of gloves from many brands. The dispenser holds gloves without restricting them, so you can grab a pair quickly. Universal Designs You might have different sizes of gloves for your office, so you need a holder that works with them all. Universal-size glove dispensers help keep your office functional.", "parent_text": "Gloves", "keyword_density": {"glove dispensers": "3.8", "dispensers": "2.5", "glove": "7.5"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 14, "level": -2, "url": "http://www.staples.com/Driver-Gloves/cat_CL167441", "text": "Driver Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Driver Gloves", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"gloves": 6, "driver gloves": 2}, "description_wc": 134, "description_text": "Driver gloves come in many forms, from leather gloves that protect against cuts and scrapes to deerskin gloves for work. These gloves come in different sizes, including large or extra-large sizes that are ideal for men and small sizes that are often used by women. Each type of glove has differences from others, so you can choose one that suits your exact needs. Multiple Styles There are many styles of driver gloves available, from those made with cuffs to those created with deerskin materials. Each has a different feel, so you can choose one that fits your hand well. Varied Sizes Men and women often wear different sizes, and these gloves offer many sizes to choose from. They range from small to extra-large sizes, making it easy to find the ideal fit.", "parent_text": "Gloves", "keyword_density": {"gloves": "4.5", "driver gloves": "3.0"}, "department_id": 16}
{"nr_products": 1, "level": -2, "url": "http://www.staples.com/Safety-Goggles-Protection-Parts-Accessories/cat_CL167005", "text": "Safety Goggles Protection Parts & Accessories", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_wc": 0, "parent_url": "http://www.staples.com/Eye-Protection/cat_DP5082", "parent_text": "Eye Protection", "department_text": "Safety Supplies", "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 10, "level": -2, "url": "http://www.staples.com/Canvas-Gloves/cat_CL167293", "text": "Canvas Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Canvas Gloves", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"canvas gloves": 5, "gloves": 9}, "description_wc": 162, "description_text": "Canvas gloves come in many sizes, and they prevent you from hurting your hands while working in the garden or with sharp objects. Many styles are cut resistant and provide other protective qualities. The comfortable sizes and styles keep you safe without feeling like your gloves are too tight or loose. Protective Qualities Canvas gloves help prevent damage to the hands, so you can work longer. Use canvas gloves around your home, job site, or anyplace you need a versatile glove. Comfortable Sizing You can choose from multiple sizes of gloves to keep your hands comfortable. There are medium, large, extra-large, and one-size-fits-all options. Be sure to check out Staples wide selection of other gloves if canvas gloves aren\u2019t the best option for your needs. Comfortable Wrist The comfortable knit-wrist style of canvas gloves is ideal for those who wear gloves often, as they stay snug around the wrist. They are soft and won't scratch.", "parent_text": "Gloves", "keyword_density": {"canvas gloves": "6.2", "gloves": "5.6"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 4, "level": -2, "url": "http://www.staples.com/Cut-Resistant-Gloves/cat_CL167294", "text": "Cut Resistant Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Cut Resistant Gloves", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"cut": 4, "gloves": 6, "cut resistant gloves": 3}, "description_wc": 193, "description_text": "Cut-resistant gloves will keep your hands safe from accidental slices or dices. Put them on before operating a heavy-duty knife or moving sharp objects to keep your fingers and hands free from injury. You'll find a wide variety of gloves featuring different types of material from Kevlar to stainless-steel nylon mesh. Find a Size That Fits Your Hand Most brands offer cut resistant gloves in three different sizes. Whether you're looking for a small, medium, or large, you'll be able to find a size that fits your hand comfortably. Protecting Your Hands Keeping your hands and finger safe is an important part of working in a warehouse or construction site. Whether you're working with a knife or moving sharp fiberglass, these gloves will protect you from slices while giving you a textured palm that'll keep your grip tight. Enough For Your Workforce Cut down on injuries by picking up a pack of cut-resistant gloves for your entire workforce. Whatever your preferred brand is, you'll find packs of 12 gloves, so you'll have more than enough for everyone to wear while at work.", "parent_text": "Gloves", "keyword_density": {"cut": "2.1", "gloves": "3.1", "cut resistant gloves": "4.7"}, "department_id": 16}
