{"department_text": "Safety Supplies", "nr_products": 50, "level": -2, "url": "http://www.staples.com/Coated-Gloves/cat_CL167027", "text": "Coated Gloves", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Coated Gloves", "parent_url": "http://www.staples.com/Gloves/cat_DP5084", "keyword_count": {"gloves": 8, "coated gloves": 4}, "description_wc": 186, "description_text": "Coated gloves are great to have around when you're moving items or handling rough or dangerous materials. The gloves come in several sizes, so you'll find the right fit for your hands. Pick up a large pack of gloves so that you'll have extras for your work crew. Prevent Hand Injuries Working in a warehouse can lead to splinters or blisters. With coated gloves, you'll protect your hands from injury while moving large items or working with hand tools around the job site. Cut Down on Abrasions You'll find coated gloves made of nitrile or latex that'll withstand tears or abrasions and protect your hands from cuts. Other gloves are made with strong grips that'll let you hold your hammer or screwdriver tight even in wet conditions. Enough for Everyone Pick up a pack of up to two hundred gloves so that you'll have plenty of extras at your work site. Whether you need coated gloves for yourself or your crew, these packs will give you more than enough to keep everyone's hands safe on the job.", "parent_text": "Gloves", "keyword_density": {"gloves": "4.3", "coated gloves": "4.3"}, "department_id": 16}
