{"department_text": "Safety Supplies", "nr_products": 19, "level": -2, "url": "http://www.staples.com/Coveralls-Overalls/cat_CL167046", "text": "Coveralls & Overalls", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Coveralls & Overalls", "parent_url": "http://www.staples.com/Workwear-Rainwear/cat_DP5090", "keyword_count": {"overalls": 7, "coveralls": 4}, "description_wc": 147, "description_text": "Coveralls and overalls protect workers from hazardous conditions arising from materials. Typically, hazardous materials include both particles that should not be touched and liquids that can be damaging or absorbed through the skin. Choosing the right protection solution can help keep your employees safe on the job. Protect Your Skin Chemicals that can be absorbed by touch are a particularly nasty hazard for some workers. Protect against contamination with coveralls designed to ward off both particles and liquids. Keep Tools Handy Modern coveralls and overalls have pockets to help keep your tools close at hand when on the worksite. Check out work aprons for lighter options in areas where particulate matter is less of a concern. Stay Safe at Work Inspect coveralls and overalls to ensure that they provide a snug fit. Well-fitting protective gear is likely to be more effective and help prevent serious injury.", "parent_text": "Workwear & Rainwear", "keyword_density": {"overalls": "4.8", "coveralls": "2.7"}, "department_id": 16}
{"nr_products": 5, "level": -2, "url": "http://www.staples.com/Coats-Jackets/cat_CL167038", "text": "Coats & Jackets", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_wc": 0, "parent_url": "http://www.staples.com/Workwear-Rainwear/cat_DP5090", "parent_text": "Workwear & Rainwear", "department_text": "Safety Supplies", "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 8, "level": -2, "url": "http://www.staples.com/Aprons/cat_CL167045", "text": "Aprons", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Aprons", "parent_url": "http://www.staples.com/Workwear-Rainwear/cat_DP5090", "keyword_count": {"aprons": 9}, "description_wc": 180, "description_text": "Wearing leather aprons, lead aprons, or synthetic aprons while working around sources of heat, abrasion, and other hazards keeps you and your clothing safe from damage. Fire-retardant coveralls are designed specifically for working around sparks that can ignite regular clothing. Choose the right apron for the job, and look for aprons with additional features such as pockets. Safety and Convenience Anchor Brand leather aprons protect against heat and abrasion, making them ideal for use during tasks such as sanding where abrasives are used with heat-generating equipment. These leather aprons feature convenient pockets and clips for tools. Advanced Protection Regular aprons do not cover the entire body, so we offer flame-retardant coveralls that include hoods and foot protection. These are ideal for welding and other situations where sparks are a known hazard, and you can also find heat-resistant welding gloves at Staples. Special Protection Aprons that protect against particle contamination keep even the smallest particles away from your clothing and body. You can also find cotton aprons that are flame resistant and protect against heat and abrasion.", "parent_text": "Workwear & Rainwear", "keyword_density": {"aprons": "5.0"}, "department_id": 16}
{"nr_products": 30, "level": -2, "url": "http://www.staples.com/Ear-Muffs/cat_CL167050", "text": "Ear Muffs", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_wc": 0, "parent_url": "http://www.staples.com/Ear-Protection/cat_DP5095", "parent_text": "Ear Protection", "department_text": "Safety Supplies", "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 24, "level": -2, "url": "http://www.staples.com/Hard-Hat-Cap-Parts-Accessories/cat_CL167013", "text": "Hard Hat & Cap Parts & Accessories", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Hard Hat & Cap Parts & Accessories", "parent_url": "http://www.staples.com/Head-Protection/cat_DP5087", "keyword_count": {"parts": 2, "cap": 1, "hard": 3, "hat": 8, "accessories": 4}, "description_wc": 126, "description_text": "Hardhat parts and accessories let you customize hats to suit the needs of your company. Masks provide polarized lenses and eye protection, and straps keep important safety equipment in place to help reduce injuries. Choose the Right Accessories The customization afforded by aftermarket parts and accessories lets you match the safety features to the current project. This ensures that you have the safety you need without unnecessary cost or unwanted bulk. Keep Workers Safe Hardhat accessories work in tandem with complete hats to enhance protection at the worksite. Check out hardhats and caps for comprehensive solutions to head safety. Straps for Security Aftermarket straps and harnesses help ensure that hats do not slip. A snug fit enhances safety and helps prevent accidents from becoming serious injuries.", "parent_text": "Head Protection", "keyword_density": {"hat": "6.3", "cap": "0.8", "parts": "1.6", "hard": "2.4", "accessories": "3.2"}, "department_id": 16}
{"nr_products": 113, "level": -2, "url": "http://www.staples.com/Safety-Glasses/cat_CL167003", "text": "Safety Glasses", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_wc": 0, "parent_url": "http://www.staples.com/Eye-Protection/cat_DP5082", "parent_text": "Eye Protection", "department_text": "Safety Supplies", "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 16, "level": -2, "url": "http://www.staples.com/Sweat-Bands/cat_CL167015", "text": "Sweat Bands", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Sweat Bands", "parent_url": "http://www.staples.com/Head-Protection/cat_DP5087", "keyword_count": {"sweat": 5, "sweat bands": 4}, "description_wc": 159, "description_text": "Sweat bands keep your head dry and cool while you work, so you can concentrate on your job instead of having to constantly wipe away perspiration. Manufacturers such as Allsafe, Anchor Brand, and MiraCool offer plenty of options for use inside helmets or work caps. Straps or snaps keep them from slipping or falling off. Compatible with Headgear Most sweat bands are designed to be compatible with different types of headgear. Simply snap the band into your safety helmet or strap it around your head before you put your hard hat on for full sweat protection. Long-Lasting Action Because they are extremely absorbent, sweat bands continue to soak up perspiration for hours. Enjoy all-day protection even when you are hard at work. Sanitary and Safe Each band is individually packaged, so you can rest assured that it is sanitary and safe. Buying a package of many sweat bands lets you stock up for when you need them.", "parent_text": "Head Protection", "keyword_density": {"sweat": "3.1", "sweat bands": "5.0"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 33, "level": -2, "url": "http://www.staples.com/Hard-Hats-Caps/cat_CL166862", "text": "Hard Hats & Caps", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Hard Hats & Caps", "parent_url": "http://www.staples.com/Head-Protection/cat_DP5087", "keyword_count": {"hats": 5, "hard": 5, "hard hats": 4, "caps": 5}, "description_wc": 179, "description_text": "Hard hats and caps are a great way to protect your team while on the job site. Perfect for construction sites, these plastic hats come in several sizes and styles, so you can find the exact type for your needs. Strap one on and feel secure as you walk around in a hard hat area. Great for Industrial Areas When you're touring a job site with extreme temperatures, check out some of the Skullgard protective hard hats and caps. Created by companies like MSA, these are great for protecting yourself from falling objects or changes in temperature. Pick a Style for Your Needs From V-Gard slotted hard hats and caps to safety helmets with a thermoplastic brim, it's easy to match your hat to your needs. You can even choose the color or style to fit with your company uniform. Protect Yourself Hard hats and caps protect you and your team from any accidents. Whether you're working with shovels or jackhammers, these caps will give you the confidence you need to finish the job safely.", "parent_text": "Head Protection", "keyword_density": {"hats": "2.8", "hard": "2.8", "hard hats": "4.5", "caps": "2.8"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 3, "level": -2, "url": "http://www.staples.com/Beard-Hair-Nets/cat_CL167295", "text": "Beard & Hair Nets", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Beard & Hair Nets", "parent_url": "http://www.staples.com/Head-Protection/cat_DP5087", "keyword_count": {"hair": 8, "nets": 6, "beard": 4}, "description_wc": 164, "description_text": "Even if you're just running a company barbecue, make sure all personnel who handle food in your enterprise are wearing beard and hairnets. These convenient, disposable nets keep head and facial hair from coming into contact with cooking and preparation utensils and surfaces. Safety and Cleanliness Organisms that are harmless when found on human hair can enter food and cause illness, and hair in food is unsightly and unpleasant. When you or your employees prepare food for sale or for your staff, make sure everyone wears beard and hairnets so hair does not fall into food. Comfort and Convenience Disposable beard and hairnets are convenient, as they are easily disposed of after a single use. Choose spun-bonded nets for more comfort. FDA-Accepted If your business needs to meet FDA health and safety standards, beard and hairnets help you comply with government requirements. You'll find additional protective equipment for yourself and your staff, such as face masks and respirators, at Staples.", "parent_text": "Head Protection", "keyword_density": {"hair": "4.9", "nets": "3.7", "beard": "2.4"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 7, "level": -2, "url": "http://www.staples.com/Back-Supports/cat_CL167043", "text": "Back Supports", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Back Supports", "parent_url": "http://www.staples.com/Ergonomics/cat_DP5092", "keyword_count": {"back supports": 3, "back": 7}, "description_wc": 176, "description_text": "Back supports protect workers against injuries from repetitive tasks that strain back muscles. Outfit your employees with the gear they need to stay healthy on the job. Back products from manufacturers such as Allegro and Pro-Guard go around the waist and use flexible and rigid stays to provide support and correct posture. Sized to Fit Back support belts come in a range of sizes, from small to extra large, so you are sure to find a size that fits. Velcro closures enable you to adjust the belt so it molds to your body for proper support. Comfortable Selections Back supports come in belt widths of seven to nine inches, so you can choose the type of belt that feels comfortable around your waist. The widest belts provide support throughout your lower to mid back. Easy Storage Elastic back supports can be folded and stored in a locker or drawer at work and put on whenever you're required to do strenuous physical tasks. Invest in a wrist guard for added protection when moving heavy items.", "parent_text": "Ergonomics", "keyword_density": {"back supports": "3.4", "back": "4.0"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 7, "level": -1, "url": "http://www.staples.com/Gas-Detectors/cat_CL169140", "text": "Gas Detectors", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Gas Detectors", "parent_url": "http://www.staples.com/Fire-Gas-Water-Protection/cat_DP5201", "keyword_count": {"gas": 4, "gas detectors": 2, "detectors": 3}, "description_wc": 146, "description_text": "Gas detectors help you maintain a safe environment for your employees. These models are designed to work accurately in both hot and cold environments, and chemical detectors are also available to test a variety of pipes at a lower cost. Digital Convenience Digital gas testers let you keep your workspace space safe from toxic gas leaks and come with features like loud alarms, vibrating alarms, and flashing LED lights, ensuring you are alerted to possible dangers. Testing Flexibility Gas detectors designed to be used on all kinds of pipe keep your from having to stock multiple types. Add a carbon monoxide detector to your office for extra peace of mind. Nontoxic Safety Nontoxic chemical testers ensure that workers can perform tests without worrying if they get accidentally splashed. These are also noncorrosive and can be used to test various air lines, air pumps, and refrigerator condensers.", "parent_text": "Fire, Gas & Water Protection", "keyword_density": {"detectors": "2.1", "gas detectors": "2.7", "gas": "2.7"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 11, "level": -1, "url": "http://www.staples.com/Carbon-Monoxide-Detectors/cat_CL169139", "text": "Carbon Monoxide Detectors", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Carbon Monoxide Detectors", "parent_url": "http://www.staples.com/Fire-Gas-Water-Protection/cat_DP5201", "keyword_count": {"carbon monoxide detectors": 2, "carbon monoxide": 3}, "description_wc": 152, "description_text": "Carbon monoxide detectors are essential pieces of safety equipment for any business or office with gas-powered devices. These tester are designed to let you know when CO levels reach unhealthy proportions. Multipacks are available, letting you buy enough for your entire office building at one time. LED Security LED lights make it easy to tell if your detector is getting power. Different colored or flashing lights alert you to possible carbon monoxide dangers. Battery Backup Units that can be plugged into wall outlets let you place testers conveniently next to gas stoves or other appliances. These models also feature battery backup, so you don't have to worry about missing the alarm if the power goes out. Convenient Testers Carbon monoxide detectors come equipped with easy-push test/reset buttons, letting you make sure your unit is still working properly whenever you want or as part of your regular maintenance schedule.", "parent_text": "Fire, Gas & Water Protection", "keyword_density": {"carbon monoxide detectors": "3.9", "carbon monoxide": "3.9"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 13, "level": -2, "url": "http://www.staples.com/Rubber-Boots-Overboots/cat_CL167041", "text": "Rubber Boots & Overboots", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Rubber Boots & Overboots", "parent_url": "http://www.staples.com/Footwear-Covers/cat_DP5091", "keyword_count": {"rubber": 2, "rubber boots": 1, "boots": 5}, "description_wc": 182, "description_text": "Find boots and shoes in your size to keep your feet safe while you're on the job. Be prepared for any conditions by getting footwear designed to protect your feet and toes. Whether you're working indoors or out, there is a pair of boots or shoes to suit your needs. Protect Your Toes Steel-toe boots and shoes ensure that your toes stay safe if something heavy falls or gets dropped. Don't forget to also stock up on head protection if you're working in an area where heavy items can come tumbling down. Avoid Wet Pant Legs Rubber boots and shoes, such as those from Anchor and CT, help your legs stay dry even when you're traipsing through puddles at your worksite. The thick protective outer surface also protects you from exposure to spilled chemicals or unidentified liquids on the ground. Stay Warm Outside Insulated boots and shoes, such as those from Ranger, keep your feet warm while you're working outside in the cold. The rubber exteriors also keep chilling snow or rain off your feet.", "parent_text": "Footwear & Covers", "keyword_density": {"rubber": "1.1", "rubber boots": "1.1", "boots": "2.7"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 2, "level": -2, "url": "http://www.staples.com/Bandanas/cat_CL167049", "text": "Bandanas", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Bandanas", "parent_url": "http://www.staples.com/Head-Protection/cat_DP5087", "keyword_count": {"bandanas": 5}, "description_wc": 143, "description_text": "Cotton bandanas add flair to any outfit. Headband or tie-neck-style bandanas can create a distinctive hallmark across employee uniforms. Hand out bandanas in different colors to employees during the annual company picnic to designate teams for competitive sports. One Size Fits All Bandanas are sized to fit anyone. Men and women of all heights and weights can fold these universally sized swaths of cloth to fit their heads or necks and tie them off so they stay in place. Stylish Accessorizing Bandanas are stylish as well as useful, adding a colorful touch to any casual outfit. Add a pair of sunglasses to complete the look. Cool Comfort Dip the bandana in water before tying it around your head or neck to keep cool while hiking or to cool off after a workout. The cotton material retains a pleasant coolness for hours.", "parent_text": "Head Protection", "keyword_density": {"bandanas": "3.5"}, "department_id": 16}
{"nr_products": 36, "level": -1, "url": "http://www.staples.com/Cylinder-Carts-Trucks/cat_CL167060", "text": "Cylinder Carts & Trucks", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_wc": 0, "parent_url": "http://www.staples.com/Material-Handling/cat_CG1365", "parent_text": "Material Handling", "department_text": "Safety Supplies", "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 10, "level": -1, "url": "http://www.staples.com/Smoke-Alarms/cat_CL169138", "text": "Smoke Alarms", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Smoke Alarms", "parent_url": "http://www.staples.com/Fire-Gas-Water-Protection/cat_DP5201", "keyword_count": {"alarms": 9, "smoke": 5, "smoke alarms": 2}, "description_wc": 177, "description_text": "Smoke alarms are a crucial component of keeping your work environment safe from fire- and smoke-related accidents. Place multiple alarms throughout your building to ensure everyone has time to get to safety. We also carry special spray adapter tubes that let you test to make sure your smoke detector is functioning properly. Can't-Miss Alarms You won't have to worry about anyone not hearing these loud alarms with noise ratings of up to 85 dB. For those that have hearing losses, voice alarms that say what the danger is or alarms that flash lights are available. Avoid Accidental Set Offs You want your smoke alarm to warn you of real danger, not just someone burning leftovers in the office kitchen. Smart hush capabilities in today's alarms let you silence overzealous warnings. Keep Batteries Fresh To keep your smoke alarms at peak function, it's important to replace the batteries even before they're dead. Alarms with a low-battery warning chirp or flash a light when it's time for a fresh set.", "parent_text": "Fire, Gas & Water Protection", "keyword_density": {"alarms": "5.1", "smoke": "2.8", "smoke alarms": "2.3"}, "department_id": 16}
{"department_text": "Safety Supplies", "nr_products": 22, "level": -1, "url": "http://www.staples.com/Fire-Extinguishers/cat_CL166489", "text": "Fire Extinguishers", "department_url": "http://www.staples.com/Safety-Supplies/cat_SC1718", "description_title": "Fire Extinguishers", "parent_url": "http://www.staples.com/Fire-Gas-Water-Protection/cat_DP5201", "keyword_count": {"fire": 5, "fire extinguishers": 3}, "description_wc": 150, "description_text": "Fire extinguishers make it easy to put out small office fires before they turn into major incidents. Keep one on every floor and near high-risk areas like the office kitchen or optimum protection. Choose from models that use carbon dioxide, sodium bicarbonate, monoammonium phosphate, and other chemicals, depending on your needs. Lightweight Aluminum canisters make these fire extinguishers light and easy to handle for even the less-than-athletic employee. Powder coating resists corrosion and protects your investment. User Friendly When the smoke alarm goes off, quick action is key. Easy-read gauges and instructions and quick-release pins make sure you don't have to fumble around while trying to put out the fire. Convenient Mounting Metal mounting brackets let you keep fire extinguishers within plain view and easy reach, and it also allows inspectors quick access so they can be in and out of your office quickly.", "parent_text": "Fire, Gas & Water Protection", "keyword_density": {"fire": "3.3", "fire extinguishers": "4.0"}, "department_id": 16}
