{"department_text": "Coffee | Water | Snacks", "level": 0, "url": "http://www.staples.com/Coffee-Coffee-Makers-Sugar/cat_DP4533", "text": "Coffee / Coffee Makers / Sugar", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Coffee / Coffee Makers / Sugar", "parent_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "keyword_count": {"coffee": 13, "coffee makers": 1, "makers": 2}, "description_wc": 132, "description_text": "For the coffee lover, keep your office or home stocked with supplies like coffee makers, sweeteners, stirrers, and K-Cups. We carry coffee brands like Keurig, Starbucks, Green Mountain, Folgers, Coffee-Mate, Splenda, Jura-Capresso Inc., and more. Make coffee your way - With a large variety of coffee and espresso makers, you can make coffee the way that you like it with coffee bags, a coffee pot, or instantly with K-Cups or Tassimo T-Discs . Coffee supplies - We carry coffee supplies for all of your needs like stirrers, filters, compostable hot cups with lids, and cup sleeves. For one or for many - We have coffee servers and large pots for serving many people or Keurig K-Cups , single cup pods and smaller coffee pots for just one or two.", "parent_text": "Coffee | Water | Snacks", "keyword_density": {"coffee": "10.0", "coffee makers": "1.5", "makers": "1.5"}, "department_id": 18}
