{"department_text": "Coffee | Water | Snacks", "nr_products": 10, "level": -1, "url": "http://www.staples.com/Hot-Chocolate/cat_CL164878", "text": "Hot Chocolate", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Hot Chocolate", "parent_url": "http://www.staples.com/Beverages/cat_CG1251", "keyword_count": {"hot chocolate": 5, "chocolate": 7}, "description_wc": 108, "description_text": "Relax and warm up with a delicious cup of hot chocolate with from our selection of hot chocolate packets and k-cups. We have hot chocolate mix from brands including Swiss Miss, Starbucks, Nestle, and Cafe Escapes. Quick mix - Both hot chocolate packets and k-cups are convenient and quick to make only taking as long as it takes to heat water in a Keurig, microwave, or on a stove top. Hot chocolate flavors - Browse our selection of regular, sugar free, milk chocolate, and dark chocolate flavors. Package quantities - Stock up on your favorite flavor with boxes of 24 and 50 packets or packs of 16 k-cups.", "parent_text": "Beverages", "keyword_density": {"hot chocolate": "9.3", "chocolate": "6.5"}, "department_id": 18}
