{"department_text": "Coffee | Water | Snacks", "nr_products": 12, "level": -1, "url": "http://www.staples.com/Creamers-Sweeteners/cat_CL141079", "text": "Milk & Creamers", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Milk & Creamers", "parent_url": "http://www.staples.com/Beverages/cat_CG1251", "keyword_count": {"creamers": 2}, "description_wc": 105, "description_text": "Add a rich and creamy taste to coffee, tea, cereal, and other beverages with our selection of liquid and non dairy creamers. We have a variety of flavors from creamer brands like Coffee-Mate, Nestle, International Delight, and Land O Lakes. Types of creamers - We have whatever type of creamer you are looking for whether it is dairy, non-dairy, powder, or liquid creamer. Enjoy your flavor - We have various creamer flavors for all tastes like French Vanilla, Hazelnut, Original, Lite, Peppermint, and Mocha. Convenience your way - Conveniently add creamer to your preference with single server creamer, creamer pump bottles, powder canisters, and creamer packets.", "parent_text": "Beverages", "keyword_density": {"creamers": "1.9"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 23, "level": -1, "url": "http://www.staples.com/Vue-Packs/cat_CL168307", "text": "Vue Packs", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Vue Packs", "parent_url": "http://www.staples.com/Beverages/cat_CG1251", "keyword_count": {"vue": 4, "vue packs": 2}, "description_wc": 110, "description_text": "Satisfy all of your instant coffee needs with our Keurig Vue Packs and single cup coffee from quality brands like Green Mountain, Starbucks, Coffee People, Tullys, Barista Prima, and Newman\u2019s Own. Your coffee, your roast - Choose from a variety of flavors in quantities of 12 or 16. More than just coffee - In addition to multiple coffee flavors, browse our selection of hot cocoa, cappuccinos and lattes. Recyclable - The plastic Vue cups used in the Vue packs are made of #5 plastic, so they can be recycled wherever #5 plastic is accepted. Convenient storage - Vue Pack carousel holders provide a convenient and aesthetically pleasing way to store your favorite flavors.", "parent_text": "Beverages", "keyword_density": {"vue": "3.6", "vue packs": "3.6"}, "department_id": 18}
