{"department_text": "Coffee | Water | Snacks", "nr_products": 26, "level": -1, "url": "http://www.staples.com/Coffee-Carafes-Tea-Kettles-Pitchers/cat_CL142180", "text": "Coffee Carafes, Tea Kettles & Pitchers", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Coffee Carafes, Tea Kettles & Pitchers", "parent_url": "http://www.staples.com/Coffee-Coffee-Makers-Sugar/cat_DP4533", "keyword_count": {"carafes": 2, "coffee": 4, "kettles": 3, "pitchers": 2}, "description_wc": 106, "description_text": "Keep your coffee or espresso beverages fresh and hot with our large selection of coffee servers, carafes, kettles, and pitchers. In addition to coffee servers, we have ice buckets and water kettles from brands like Hormel, Jura-Capresso Inc, and Rubbermaid. Keep beverages hot or cold - Whether you have a refreshing beverage for a hot day or a warm coffee for the morning, we have kettles and pitchers to keep your drinks the desired temperature. Drip proof pouring - Avoid messes and uncomfortable spills with drink servers designed with drip-proof spouts. Odorless and stainproof - Poly-lined carafes have a shatterproof liner that is odorless and stainproof.", "parent_text": "Coffee / Coffee Makers / Sugar", "keyword_density": {"carafes": "1.9", "coffee": "3.8", "kettles": "2.8", "pitchers": "1.9"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 12, "level": -1, "url": "http://www.staples.com/Sweeteners/cat_CL164882", "text": "Sweeteners", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Sweeteners", "parent_url": "http://www.staples.com/Coffee-Coffee-Makers-Sugar/cat_DP4533", "keyword_count": {"sweeteners": 7}, "description_wc": 94, "description_text": "Sweeten your coffee, tea, or any other beverage with our selection of sugars, flavored syrup, natural sweeteners, and artificial sweeteners. We have artificial and natural sweeteners from brands like Splenda, Truvia, Sweet N Low, Equal, Dixie, N\u2019joy, and Davinci. Sweet sugar flavors - Choose your preference of granular pure cane sugar and cane turbinado sugar packets and canisters. Alternative Sweeteners - We have a variety of alternative and artificial sweeteners like Sweet N Low, Splenda, Equal, and flavored syrups. Natural Sweeteners - Choose from natural sweeteners like Sugar In The Raw and zero-calorie Stevia Extract.", "parent_text": "Coffee / Coffee Makers / Sugar", "keyword_density": {"sweeteners": "7.4"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 29, "level": -1, "url": "http://www.staples.com/Cups-Stirrers-and-Filters/cat_CL164424", "text": "Cups, Stirrers and Filters", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Cups, Stirrers and Filters", "parent_url": "http://www.staples.com/Coffee-Coffee-Makers-Sugar/cat_DP4533", "keyword_count": {"stirrers": 1, "cups": 3, "filters": 2}, "description_wc": 97, "description_text": "Keep your home or office stocked with coffee cups and supplies like filters, straws, swizzle sticks, stirrers, and sleeves. We have a large selection of coffee supplies from brands like Dixie, Solo, and Staples. Keep your coffee hot, not your hands - We have many sleeves and coffee cups of various materials like plastic, foam, paper, and recycled post-consumer content. Various sizes and packages - We have various sizes and quantities of coffee supplies to meet your needs. Cover all of your bases - Stay stocked with all of your coffee supplies including lids, straws, filters, cups, and sleeves.", "parent_text": "Coffee / Coffee Makers / Sugar", "keyword_density": {"stirrers": "1.0", "cups": "3.1", "filters": "2.1"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 32, "level": -1, "url": "http://www.staples.com/Tea/cat_CL162668", "text": "Tea", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Tea", "parent_url": "http://www.staples.com/Coffee-Coffee-Makers-Sugar/cat_DP4533", "keyword_count": {"tea": 16}, "description_wc": 100, "description_text": "We have a large selection of many different tea flavors from brands including Bigelow, Celestial Seasonings, Starbucks, Tazo, Lipton, Nestea, Teaone, and Twinings. Brewed tea and tea leaves - We have tea in multiple forms to match your needs whether you are looking for brewed tea in cans, teabags, or k-cups. Tea types - Our selection of herbal tea flavors includes chamomile tea, black tea, sweet tea, green tea, honey lemon ginseng, and a variety of Tazo flavors. Stock up - Stock up on your favorite tea flavors and brands with bulk quantities ranging from 16 k-cups to 168 tea packets.", "parent_text": "Coffee / Coffee Makers / Sugar", "keyword_density": {"tea": "16.0"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 18, "level": -1, "url": "http://www.staples.com/Espresso-Combination-Coffee-Makers/cat_CL165611", "text": "Espresso & Combination Coffee Makers", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Espresso & Combination Coffee Makers", "parent_url": "http://www.staples.com/Coffee-Coffee-Makers-Sugar/cat_DP4533", "keyword_count": {"combination coffee": 1, "coffee": 3, "espresso": 9, "coffee makers": 1, "makers": 3}, "description_wc": 98, "description_text": "For a delicious boost of energy, browse our selection of espresso and cappuccino coffee makers, grinders, steamers, and milk frothers. We have automatic espresso machines and pumps from brands including Jura-Capresso Inc and Mr. Coffee. Brew rich and creamy espresso - Add a rich and creamy flavor to espresso with our selection of milk coolers and frothers. Cups per brew - Choose from one and two cup espresso machines and combination coffee espresso makers with up to 10 cups per pot. Convenient brewing - We have a variety of convenient automatic espresso machines, espresso pumps, and one touch espresso makers.", "parent_text": "Coffee / Coffee Makers / Sugar", "keyword_density": {"combination coffee": "2.0", "coffee": "3.1", "espresso": "9.2", "coffee makers": "2.0", "makers": "3.1"}, "department_id": 18}
