{"department_text": "Coffee | Water | Snacks", "nr_products": 8, "level": -1, "url": "http://www.staples.com/Powdered-Drink-Mixes/cat_CL165085", "text": "Powdered Drink Mixes", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Powdered Drink Mixes", "parent_url": "http://www.staples.com/Beverages/cat_CG1251", "keyword_count": {"powdered drink mixes": 1, "mixes": 3, "drink": 4, "drink mixes": 2}, "description_wc": 109, "description_text": "Tired of plain tasteless water? Enhance your tap water with powdered drink mixes that are low calorie and come in a variety of flavors. Stock up on your favorite drink mixes with brands including Crystal Light, Emergen C, and Nestea. Convenient packaging - On the go drink powder mixes are convenient for storage and simple to mix.\u00a0 Just pour, stir, and drink. Flavor without the guilt - Enjoy the refreshment of flavored water without the extra calories and sugar from soda and juices. Vitamin powder - Keep your immune system in top shape with Emergen-C vitamin packets for office wellness in tangerine, acai berry, pink lemonade, super orange, and raspberry flavors.", "parent_text": "Beverages", "keyword_density": {"powdered drink mixes": "2.8", "drink mixes": "3.7", "drink": "3.7", "mixes": "2.8"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 29, "level": -1, "url": "http://www.staples.com/Energy-Drinks/cat_CL165674", "text": "Energy Drinks", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Energy Drinks", "parent_url": "http://www.staples.com/Beverages/cat_CG1251", "keyword_count": {"energy drinks": 1, "energy": 8, "drinks": 3}, "description_wc": 129, "description_text": "Dragging throughout the day? Browse our selection of sports drinks, energy drinks, and propel water for an extra boost of energy. We carry sports and energy drink brands including Gatorade, Emergen C, Red Bull, Propel, Monster, and 5 Hour Energy. Get energy your way - Get energy the way you prefer it whether you need the extreme energy of a 16 oz Monster or a subtle boost with no crash from 5 Hour Energy. Buy in bulk - To reduce trips to the convenience store or supply drinks for a large group of people, we have quantities ranging from 12 to 24 packs. Hydrate for an active lifestyle - Replenish your electrolytes, hydrate, and quench your thirst all at the same time with one of our Gatorade or Propel Fit Water products.", "parent_text": "Beverages", "keyword_density": {"energy drinks": "1.6", "energy": "6.2", "drinks": "2.3"}, "department_id": 18}
{"department_text": "Coffee | Water | Snacks", "nr_products": 120, "level": -1, "url": "http://www.staples.com/Coffee/cat_CL141073", "text": "Coffee", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Coffee", "parent_url": "http://www.staples.com/Coffee-Coffee-Makers-Sugar/cat_DP4533", "keyword_count": {"coffee": 11}, "description_wc": 117, "description_text": "Whether you need that extra kick in the morning or you just love the taste of coffee, we have a variety of coffee products to choose from with brands like Starbucks , Folgers, Green Mountain , Maxwell House, Seattle\u2019s Best, Lavazza, Java One, and Java Roast. Make it your way - Choose from a large selection of instant coffee, coffee beans, ground coffee, coffee packets, cans, and bags to match your maker. Enjoy your flavor - We have different flavors of coffee including light, dark, bold, Crema Espresso, Italian Roast, Kona, Columbian, and other caffeinated and decaffeinated blends. Fair trade coffee - Enjoy our delicious coffee brands and products that are fair trade coffee supporting coffee growers and producers.", "parent_text": "Coffee / Coffee Makers / Sugar", "keyword_density": {"coffee": "9.6"}, "department_id": 18}
