{"department_text": "Coffee | Water | Snacks", "nr_products": 15, "level": -1, "url": "http://www.staples.com/Soda/cat_CL141075", "text": "Soda", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Soda", "parent_url": "http://www.staples.com/Beverages/cat_CG1251", "keyword_count": {"soda": 6}, "description_wc": 110, "description_text": "Enjoy your favorite refreshing soda and tea beverages with our large selection of canned and bottled soft drinks. We carry common soda pop and beverage brands including Coca-cola, Polar, Pepsi, Sprite, Mountain Dew, Canada Dry, Nestea, and Snapple. Refreshing flavors - Quench your thirst with your favorite refreshing soda flavors including coke, lemon tea, diet sodas, citrus sodas, seltzers, ginger ale, and flavored teas. Drink it your way - We have soda and tea beverages packaged in both bottles and cans for your individual preference. Stock up and save - Our soft drinks and teas are sold in packs of 24 for easy stocking and saving you money for buying in bulk.", "parent_text": "Beverages", "keyword_density": {"soda": "5.5"}, "department_id": 18}
