{"department_text": "Coffee | Water | Snacks", "nr_products": 24, "level": -1, "url": "http://www.staples.com/Water-Juices/cat_CL141077", "text": "Water & Juice", "department_url": "http://www.staples.com/Coffee-Water-Snacks/cat_SC1684", "description_title": "Water & Juice", "parent_url": "http://www.staples.com/Beverages/cat_CG1251", "keyword_count": {"water": 7, "juice": 6}, "description_wc": 121, "description_text": "Stock your home or office with bulk quantities of your favorite water and juice brands and have them delivered to you to save time and effort. We have a large selection of flavors and brands including Poland Spring, Tropicana, V8, Vitamin Water, Propel, Pure Life, Smart Water, Yoo Hoo, Nestle, and Lipton. Various flavors - We have a variety of juice and water flavors including fruit juices, vegetable juices, blended juices, cider, sparkling water, and pure water. Packaging and sizes - We offer juice and water containers from 5.5 oz to 20 oz and packaging from 12 to 48 per case. On the go - Chill your favorite beverage and drink it on the go with single serving containers and convenient screw on tops.", "parent_text": "Beverages", "keyword_density": {"water": "5.8", "juice": "5.0"}, "department_id": 18}
