{"department_text": "First Aid | Medical Supplies", "level": 0, "url": "http://www.staples.com/Medical-Gloves/cat_CG1428", "text": "Medical Gloves", "department_url": "http://www.staples.com/First-Aid-Medical-Supplies/cat_SC1929", "description_title": "Medical Gloves", "parent_url": "http://www.staples.com/First-Aid-Medical-Supplies/cat_SC1929", "keyword_count": {"medical": 2, "gloves": 9}, "description_wc": 185, "description_text": "Surgical and exam gloves are important accessories for every medical office and surgery suite. When your doctors and nurses use sterile gloves, everyone in the office has a reduced risk of exposure to potentially harmful germs and viruses. With several types and sizes to choose from, you can find gloves that will work for everyone. Multiple Uses Surgical and exam gloves are available in a variety of styles, so you can find gloves that suit the needs of your office. You can even purchase radiation protection gloves for use in radiology. Various Material Surgical and exam gloves are available in standard latex, but they are also available in vinyl or nitrile for employees who are sensitive to latex. Nitrile gloves are also resistant to punctures, tears, and chemicals, making them a good choice for those who are exposed to these risks. Promotes a Sterile Environment Surgical and exam gloves protect both employees and patients from exposure to germs, bacteria, and viruses. When used in conjunction with exam paper and drapes , you ensure that your medical office or surgery suite is as sterile as possible.", "parent_text": "First Aid | Medical Supplies", "keyword_density": {"medical": "1.1", "gloves": "4.9"}, "department_id": 17}
{"level": 0, "url": "http://www.staples.com/Feeding-Tubes-Nutrients/cat_CG1448", "text": "Feeding Tubes / Nutrients", "department_url": "http://www.staples.com/First-Aid-Medical-Supplies/cat_SC1929", "description_wc": 0, "parent_url": "http://www.staples.com/First-Aid-Medical-Supplies/cat_SC1929", "parent_text": "First Aid | Medical Supplies", "department_text": "First Aid | Medical Supplies", "department_id": 17}
{"department_text": "First Aid | Medical Supplies", "level": 0, "url": "http://www.staples.com/Medicine/cat_CG1442", "text": "Medicine", "department_url": "http://www.staples.com/First-Aid-Medical-Supplies/cat_SC1929", "description_title": "Medicine", "parent_url": "http://www.staples.com/First-Aid-Medical-Supplies/cat_SC1929", "keyword_count": {"medicine": 5}, "description_wc": 257, "description_text": "If you're feeling ill, an appropriate medicine can make your workday much more comfortable. At Staples, you can find the right remedies to manage diabetes, soothe heartburn, and alleviate cold and flu symptoms. Restock your medicine cabinet the easy way: choose from a wide range of medications, including antacids, laxatives, eye drops, and pain relievers. Get Ready for Allergy Season Many businesspeople with seasonal allergies find it tough to focus, particularly in the summer months. If you're afflicted with hay fever on an annual basis, get ready in advance with a range of effective antihistamines, congestion-relief products, and soothing lozenges. Saline or decongestant nasal sprays can help by opening up your nasal passages: after all, it's easier to concentrate if you can breathe properly. Tobacco Cessation Made Easy It can be tough to quit smoking, particularly given the excitement and potential stress generated by small-business ownership. Thankfully, stop-smoking aids such as nicotine patches and gum can make it easier to put down the tobacco for good. Simply select your ideal supportive medicine to help stem cravings at work: if you're less distracted, your productivity level may increase. Choice and Convenience Small-business owners and busy professionals rarely have the time to peruse pharmacy shelves for curative products. Conveniently, the medicine category incorporates a range of common remedies as well as an array of handy medical aids. You can purchase pill crushers, plastic medicine cups, acetaminophen, and other useful items, all of which can be delivered to your home or office.", "parent_text": "First Aid | Medical Supplies", "keyword_density": {"medicine": "1.9"}, "department_id": 17}
