{"department_text": "First Aid | Medical Supplies", "nr_products": 2, "level": -1, "url": "http://www.staples.com/Stop-Smoking-Aids/cat_CL168798", "text": "Stop Smoking Aids", "department_url": "http://www.staples.com/First-Aid-Medical-Supplies/cat_SC1929", "description_title": "Stop Smoking Aids", "parent_url": "http://www.staples.com/Medicine/cat_CG1442", "keyword_count": {"smoking": 4, "stop smoking aids": 2, "stop smoking": 3}, "description_wc": 176, "description_text": "Stop smoking aids are designed to help you quit your nicotine habit. Employees who don't smoke need less breaks and are healthier overall. Nonsmoking workers also generally have reduced insurance costs and need less sick leave time. Patches Nicotine patches allow you to ease off of nicotine instead of quitting cold turkey, reducing the risk of withdraw symptoms. These patches have different starting doses, depending on the current number of cigarettes you smoke a day. Gums Nicotine gum is a stop smoking aid specifically designed for those that smoke less than 25 cigarettes daily. This gum comes in an enticing mint flavor and is latex free, making it an ideal option for those who can't tolerate latex patches. Custom Quitting Plan Stop smoking aids are just one step in your custom quitting plan. They help you get used to not having a cigarette in your mouth while offering a way to step down your nicotine addiction, and you have the added convenience of being able to throw them in the office trash can .", "parent_text": "Medicine", "keyword_density": {"smoking": "2.3", "stop smoking aids": "3.4", "stop smoking": "3.4"}, "department_id": 17}
