{"department_text": "First Aid | Medical Supplies", "nr_products": 13, "level": -1, "url": "http://www.staples.com/Medication-Aids/cat_CL168725", "text": "Medication Aids", "department_url": "http://www.staples.com/First-Aid-Medical-Supplies/cat_SC1929", "description_title": "Medication Aids", "parent_url": "http://www.staples.com/Medicine/cat_CG1442", "keyword_count": {"medication aids": 3, "medication": 7}, "description_wc": 177, "description_text": "Medication aids assist your workers in preparing the correct portions for patients. Avoid contamination by storing medication in disposable cups or organizers. Keep track of recipients and medication details with line-ruled cards and envelopes. Fast, Sanitary Preparation Use pill crushers and splitters to neatly break down pill portions without creating a mess. Pills of all sizes fit inside these convenient medication aids, and the resulting powder is contained in the chamber or accompanying envelope for easy transfer to a patient's food or beverage. Organized Distribution Whether you work with small groups or run large patient facilities, medication aids like cups and pill organizers simplify the task of portioning medication for individual recipients. Find both disposable and sterile cups from brands like Medline to reduce the likelihood of cross contamination. Use organizers to divide pills into daily dosages for easy identification. Observation and Record Keeping Maintain accurate records of patient activity with preprinted cards and envelopes. Fill in quick details about each patient's medication requirements, dosage times, and even personal notes to prevent overlapping treatment.", "parent_text": "Medicine", "keyword_density": {"medication aids": "3.4", "medication": "4.0"}, "department_id": 17}
{"department_text": "First Aid | Medical Supplies", "nr_products": 10, "level": -1, "url": "http://www.staples.com/Ear-Drops-Eye-Drops/cat_CL168681", "text": "Ear Drops / Eye Drops", "department_url": "http://www.staples.com/First-Aid-Medical-Supplies/cat_SC1929", "description_title": "Ear Drops / Eye Drops", "parent_url": "http://www.staples.com/Medicine/cat_CG1442", "keyword_count": {"eye drops": 2, "ear": 7, "drops": 5, "eye": 7, "ear drops": 1}, "description_wc": 193, "description_text": "Ear drops and eye drops provide relief from the discomfort of dry eyes or wax buildup. Choose from a variety of trusted brands, including Artificial Tears, Natural Tears, and TheraTears, so you can make sure your eye drop selection works with all of your employees. There are also contact-safe and latex-free options. Relieve Dry Eyes Whether dry eyes are the result of office conditions, allergies, or contact lens irritation, lubricating eyedrops bring relief to your workers, combatting discomfort. You can choose a from a variety of sizes, from 15ml bottles to individual, single-use droppers that are preservative free. Stop Ear Wax Buildup Ear wax buildup can be uncomfortable for employees and decrease efficiency if they have to ask customers or clients to repeat themselves. Our OTC drops contain 6.5 percent carbam-peroxide to loosen and dissolve wax quickly and comfortably. Gels, Liquids, and Ointments Ear drop and eye drops are available in gel, liquid, an ointment drop form. This gives you the freedom to pick the best formula for your workers or keep a variety in your office first-aid kit , ensuring you have a remedy for every situation.", "parent_text": "Medicine", "keyword_density": {"eye": "3.6", "ear": "3.6", "eye drops": "2.1", "drops": "2.6", "ear drops": "1.0"}, "department_id": 17}
{"department_text": "First Aid | Medical Supplies", "nr_products": 19, "level": -1, "url": "http://www.staples.com/Cough-Cold-Allergy/cat_CL168672", "text": "Cough, Cold & Allergy", "department_url": "http://www.staples.com/First-Aid-Medical-Supplies/cat_SC1929", "description_title": "Cough, Cold & Allergy", "parent_url": "http://www.staples.com/Medicine/cat_CG1442", "keyword_count": {"cough cold": 2, "allergy": 4, "cold": 4, "cough": 5}, "description_wc": 184, "description_text": "Cough, cold, and allergy formulas can help your employees stay productive, even when they aren't feeling their best. Stock a variety of formulas, from OTC antihistamines to throat lozenges, to make sure you have something for everyone and every symptom. Consider sugar- and alcohol-free formulas, so you get the medicine without unnecessary extra ingredients. Sore Throats When sore throats make it tough for your employees to give presentations or speak with clients, lozenges and sprays provide relief. Grab the cherry-flavored option for a pleasant aftertaste. Cough Drops and Syrups Whether you prefer honey lemon or black cherry, flavored cough drops help quiet a lingering cough from a respiratory infection or common cold. You may also want to pick up some pain relievers to take care of other cold-related aches or pains. Allergy Relief When indoor or outdoor allergies strike, cough, cold, and allergy medications keep symptoms at ease, helping your workers look and feel at the top of their game. Allergy relief formulas are available with a range of active ingredients and formulas, from nondrowsy pills to basic saline spray.", "parent_text": "Medicine", "keyword_density": {"cough cold": "2.2", "allergy": "2.2", "cold": "2.2", "cough": "2.7"}, "department_id": 17}
{"department_text": "First Aid | Medical Supplies", "nr_products": 2, "level": -1, "url": "http://www.staples.com/Diabetes-Management/cat_CL168677", "text": "Diabetes Management", "department_url": "http://www.staples.com/First-Aid-Medical-Supplies/cat_SC1929", "description_title": "Diabetes Management", "parent_url": "http://www.staples.com/Medicine/cat_CG1442", "keyword_count": {"diabetes": 3, "diabetes management": 2}, "description_wc": 162, "description_text": "Use diabetes management products to keep your blood sugar on an even keel and help prevent hypoglycemia. These over-the-counter products can be used in conjunction with a comprehensive diabetes management plan as described by your doctor. Whether you control your diabetes through medication, diet, or insulin injections, keeping supplements on hand makes maintaining your blood sugar level much easier. Glucose Tablets Glucose tablets provide a quick dose of sugar to help counteract a physiological drop in blood glucose. These generic tablets can be stored at work or in your vehicle for instant access when you need them. Gel Supplements Gel glucose supplements are an easy-to-ingest alternative to pills or tablets. These nutrition supplements come in handy individual packages that are simple to use. Latex-Free Convenience Choose glucose supplements in latex-free packaging to avoid problems associated with latex allergies. Use a blood glucose monitor to help determine when your blood sugar is too high or too low.", "parent_text": "Medicine", "keyword_density": {"diabetes management": "2.5", "diabetes": "1.9"}, "department_id": 17}
{"department_text": "First Aid | Medical Supplies", "nr_products": 3, "level": -1, "url": "http://www.staples.com/Anti-Nausea/cat_CL168627", "text": "Anti-Nausea", "department_url": "http://www.staples.com/First-Aid-Medical-Supplies/cat_SC1929", "description_title": "Anti-Nausea", "parent_url": "http://www.staples.com/Medicine/cat_CG1442", "keyword_count": {"anti nausea": 3}, "description_wc": 152, "description_text": "Keeping anti-nausea medications in your office ensures you are always prepared for your employees stomach issues. Whether you choose liquid or tablet formulas, your workers will be able to get relief from minor digestive discomfort. This keeps everyone on task and the productivity high. Multisymptom Relief Anti-nausea medications are available to treat a variety of stomach symptoms, including indigestion, diarrhea, and heartburn. Choose from the trusted Pepto-Bismol brand or affordable generic formulas to keep your employees feeling comfortable. Tablets Anti-nausea tablets are a convenient, no-mess way to stock stomach upset medications in your office first-aid kit . Choose a flavored variety to cut down on any chalky medicinal taste. Liquids Liquid medications are perfect for those who don't like to swallow pills. They are also latex free, so you don't have to worry about any possible complications if any of your employees have allergies.", "parent_text": "Medicine", "keyword_density": {"anti nausea": "4.0"}, "department_id": 17}
{"department_text": "First Aid | Medical Supplies", "nr_products": 22, "level": -1, "url": "http://www.staples.com/Laxatives/cat_CL168722", "text": "Laxatives", "department_url": "http://www.staples.com/First-Aid-Medical-Supplies/cat_SC1929", "description_title": "Laxatives", "parent_url": "http://www.staples.com/Medicine/cat_CG1442", "keyword_count": {"laxatives": 3}, "description_wc": 142, "description_text": "Laxatives are an important, yet often neglected part of your office first-aid kit. Stomach troubles can come on suddenly. Keeping laxatives and stool softeners on hand ensures your employees can get discreet relief and get back to work. Fast-Acting Relief When you need fast-acting relief, laxative suppositories and stool softeners keep things moving without uncomfortable cramping. These come with a variety of active ingredients, so you can keep a few different kinds stocked. Sizes and Flavors Laxatives are available in a range of package sizes, including 50-, 100-, or 1,000-tablet packs, so you can pick the one that's just right for your office, whether you have a just a few employees or a large team. Liquid forms come in 8-, 10-, and 16-ounce bottles in different flavors to suit everyone's preferences.", "parent_text": "Medicine", "keyword_density": {"laxatives": "2.2"}, "department_id": 17}
