{"department_text": "First Aid | Medical Supplies", "nr_products": 21, "level": -1, "url": "http://www.staples.com/Antacids/cat_CL168625", "text": "Antacids", "department_url": "http://www.staples.com/First-Aid-Medical-Supplies/cat_SC1929", "description_title": "Antacids", "parent_url": "http://www.staples.com/Medicine/cat_CG1442", "keyword_count": {"antacids": 6}, "description_wc": 185, "description_text": "With antacids close by, you can ease the symptoms of indigestion and upset stomach. Fast-acting ingredients rapidly reach the area of discomfort to reduce acid buildup. Purchase individually packaged pills for easy dispensing to staff or visitors. Alleviate Digestive Conditions Indigestion can start after your lunch break, during a meeting, or at any other time, so keep antacids available to reduce digestive pain and symptoms from stomach discomfort and heartburn. You can also find brands such as Prevacid that contain antigas or laxative properties to flush out unpleasant buildup in the intestinal tract. Choose Your Preferred Ingredients With ingredients such as sodium bicarbonate and milk of magnesia, antacids are effective at quickly relieving stomach cramps and indigestion. However, each brand uses specific ingredient combinations that are more or less effective for different users, so stock up on the products that work for you. Consume Antacids with Ease Antacids are available in multiple formats to make consumption comfortable for different users. Individually wrapped pills reduce the spread of germs in busy offices, while some chewable pills, flavored varieties, and liquid antacids are safe for children.", "parent_text": "Medicine", "keyword_density": {"antacids": "3.2"}, "department_id": 17}
