{"department_text": "First Aid | Medical Supplies", "nr_products": 35, "level": -1, "url": "http://www.staples.com/Aspirin-Pain-Relievers/cat_CL140891", "text": "Aspirin / Pain Relievers", "department_url": "http://www.staples.com/First-Aid-Medical-Supplies/cat_SC1929", "description_title": "Aspirin / Pain Relievers", "parent_url": "http://www.staples.com/Medicine/cat_CG1442", "keyword_count": {"pain": 8, "pain relievers": 2, "aspirin pain": 1, "aspirin": 6}, "description_wc": 218, "description_text": "Aspirin and pain relievers help your employees get relief from common aches and pains, including headaches, backaches, and carpal tunnel. Many size and formula options are available, including a 1,000-tablet bottle of aspirin, individually wrapped single-dose packets of Advil, Tylenol, Bayer, and more. Keep a few different active ingredients on hand to make sure you're prepared for every situation. Get Rid of Aches and Pains Aspirin helps combat muscle aches and pains as well as arthritis-related joint pain and fevers. Tablets come in the standard 325 mg and the low-dose 81 mg formulas, so you can pick the one best suited for your staff's needs. Non-Aspirin Pain Relief For those who can't tolerate aspirin or prefer to stick with acetaminophen and iburprofen, you can find caplets, tablets, and even suppositories to help relieve aches and pains or bring down a fever. Keep a bottle or two of the children's chewable versions in your first-aid kit for employees who have trouble swallowing pills. Trusted Brands and Generic Options Shop with confidence when you browse our selection of aspirin and other pain relievers from trusted brands like Bayer, Tylenol, Advil, Motrin, Aleve, and others. There are also generic formulas that contain the same active ingredients at a more economical price.", "parent_text": "Medicine", "keyword_density": {"aspirin pain": "0.9", "aspirin": "2.8", "pain": "3.7", "pain relievers": "1.8"}, "department_id": 17}
